import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as b,e as f,q as D}from"./chunks/framework.B1z0IdBH.js";const v={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},B={class:"entry-container"},y={class:"entry"},A={class:"entry-image"},j=["src","alt"],z={class:"entry-content"},C={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",B,[i("div",y,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,j)]),i("div",z,[i("h2",C,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const M=g(v,[["render",x],["__scopeId","data-v-57d3c0da"]]),P=JSON.parse(`[{"page_url":"https://sq.wikipedia.org/wiki/Riselda_Selaj","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Riselda_Selaj_on_beam_during_European_Championship_in_Birmingham_2010.jpg","page_title":"Riselda Selaj","context_page_description":"Riselda Selaj është një sportiste shqiptare dhe ish-gjimnaste artistike. Ajo është gjimnastja e parë shqiptare që ka fituar 5 medalje ari në një garë ndërkombëtare. Dhe gjimnastja e parë që fiton 2 herë radhazi 5 medalje në të njëjtën garë ndërkombëtare. Ajo është shpallur si një nga gjimnastet më të mira shqiptare ndër vite.\\nSelaj ka konkurruar edhe në Kampionatin Evropian dhe në Festivalin Olimpik Rinor Evropian duke dhënë shfaqjet e saj më të mira.\\nSelaj njoftoi daljen e saj nga gjimnastika në tetor 2014 për shkak të rënies së gjimnastikës së federatës shqiptare."},{"page_url":"https://ca.wikipedia.org/wiki/Manuel_Joaquim_Raspall_i_Mayol","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Raspall-hospitalet-buxeres-6594-01.jpg","page_title":"Manuel Joaquim Raspall i Mayol","context_page_description":"Manuel Joaquim Raspall i Mayol fou un arquitecte modernista i noucentista català.\\nArquitecte d'un modernisme tardà, Raspall no arribà a tenir la fama dels seus predecessors i mestres Domènech i Montaner o Puig i Cadafalch que havien gaudit de l'interès de les grans fortunes i els mecenes entre els seus clients. Tanmateix, Raspall va saber adaptar-se a un temps canviant i la seva obra va del modernisme al noucentisme per acabar en un déco incipient, construint el que tocava en cada moment i evolucionant d'estil i de tipus d'edificació. La major part de les seves obres es concentren entre Barcelona i el Vallès Oriental. Les obres principals a la Garriga i Cardedeu, avui considerades Bé Cultural d'Interès Nacional, van estar a punt de caure sota les excavadores als anys 70. De fet, quasi un 60% dels més de 760 projectes signats han desaparegut. Raspall, a més, actuà com urbanista, ja que fou arquitecte municipal de l'Ametlla del Vallès, la Garriga, Caldes de Montbui i Granollers en un període de creixement que forçà a aquests municipis a desenvolupar un planejament urbanístic vigent fins als anys 80."},{"page_url":"https://en.wikipedia.org/wiki/Celtis_laevigata","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Celtis_Laevigata.jpg","page_title":"Celtis laevigata","context_page_description":"Celtis laevigata is a medium-sized tree native to North America. Common names include sugarberry, Southern hackberry, or in the southern U.S. sugar hackberry or just hackberry.\\nSugarberry is easily confused with common hackberry where the range overlaps. Sugarberry has narrower leaves which are smoother above. The species can also be distinguished by habitat: where the ranges overlap, common hackberry occurs primarily in upland areas, whereas sugarberry occurs mainly in bottomland areas.\\nSugarberry's range extends from the Eastern United States west to Texas and south to northeastern Mexico. It is also found on the island of Bermuda."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Utrecht_(stad)/Binnenstad","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/LoeffBerchmakerstraat.48.Utrecht.jpg","page_title":"Lijst van rijksmonumenten in Utrecht (stad)/Binnenstad","context_page_description":"De stad Utrecht telt in totaal 1402 inschrijvingen in het rijksmonumentenregister, de Binnenstad bevat hiervan het grootste aantal.\\nDe straten met de meeste rijksmonumenten hebben een aparte lijst, deze zijn:\\nLijst van rijksmonumenten in Utrecht (stad)/Achter de Dom\\nLijst van rijksmonumenten in Utrecht (stad)/Achter Sint Pieter\\nLijst van rijksmonumenten in Utrecht (stad)/Boothstraat\\nLijst van rijksmonumenten in Utrecht (stad)/Breedstraat\\nLijst van rijksmonumenten in Utrecht (stad)/Brigittenstraat\\nLijst van rijksmonumenten in Utrecht (stad)/Choorstraat\\nLijst van rijksmonumenten in Utrecht (stad)/Domplein\\nLijst van rijksmonumenten in Utrecht (stad)/Drift\\nLijst van rijksmonumenten in Utrecht (stad)/Hamburgerstraat\\nLijst van rijksmonumenten in Utrecht (stad)/Herenstraat\\nLijst van rijksmonumenten in Utrecht (stad)/Janskerkhof\\nLijst van rijksmonumenten in Utrecht (stad)/Kromme Nieuwegracht\\nLijst van rijksmonumenten in Utrecht (stad)/Lange Nieuwstraat\\nLijst van rijksmonumenten in Utrecht (stad)/Lijnmarkt\\nLijst van rijksmonumenten in Utrecht (stad)/Mariaplaats\\nLijst van rijksmonumenten in Utrecht (stad)/Minrebroederstraat\\nLijst van rijksmonumenten in Utrecht (stad)/Nieuwegracht"},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9B%D0%B5%D1%82%D0%B5%D0%B2%D1%86%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/%D0%9B%D0%B5%D1%82%D0%B5%D0%B2%D1%86%D0%B8_%D0%9C%D0%9A.jpg","page_title":"Летевци","context_page_description":"Летевци — село во Општина Петровец, во областа Блатија, во околината на град Скопје."},{"page_url":"https://fr.wikipedia.org/wiki/Hindouisme_en_Indon%C3%A9sie","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/C%C3%A9r%C3%A9monie_au_temple_de_Goa_Lawah.jpg","page_title":"Hindouisme en Indonésie","context_page_description":"Sous le régime de Soeharto, l'hindouisme faisait partie des cinq religions officiellement reconnues ; une desquelles les Indonésiens devaient avoir sur leur carte d'identité.\\nLes chiffres officiels de 1998 indiquent que 80 % des Indonésiens sont musulmans, 5 % protestants, 3 % catholiques, 2 % hindouistes, 1 % bouddhistes, le 9 % étant constitué d'autres religions, ce qui inclut le judaïsme et le christianisme orthodoxe.\\nL'Indonésie est née du désir de populations culturellement et religieusement diverses de construire une seule nation. Sa Constitution ne fait référence à aucune religion particulière. Elle revendique son passé hindou-bouddhique. Une illustration en sont les armoiries de la République, Garuda, l'oiseau de la mythologie hindoue qui sert de vahana à Vishnu pour descendre sur terre, et le nom de la compagnie aérienne nationale, Garuda Indonesia.\\nCe passé a pour témoins les nombreux temples bouddhiques et hindouistes construits entre les VIIIᵉ et XVᵉ siècles, dont la plupart sont à Java."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%8D%E4%BC%A6%E7%91%9E%E5%85%8B%E5%B9%BF%E5%9C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/BrunswickSquare.jpg","page_title":"不伦瑞克广场","context_page_description":"不伦瑞克广场是英国伦敦卡姆登区布卢姆茨伯里的一个公共花园。其北侧为伦敦大学药学院和育婴堂博物馆，西侧为不伦瑞克中心，南侧为伦敦大学宿舍国际馆，在其西侧是两个独立但相关的儿童慈善机构，科勒姆之家和科勒姆田园。\\n现在的不伦瑞克广场和东面的梅克伦堡广场原来都是育婴堂院落的一部分。1790年，育婴堂计划将土地出租建房，筹集资金。不伦瑞克广场得名于不伦瑞克的卡罗琳，由詹姆斯·伯顿建于1795–1802年。\\n罗素广场站是最近的地铁站。\\n在简·奥斯汀的小说《爱玛》中，约翰·奈特利夫妇就住在不伦瑞克广场。\\n约翰·罗斯金于1819年诞生在不伦瑞克广场亨特街54号。\\n不伦瑞克广场26号是作家E·M·福斯特在伦敦的基地。"},{"page_url":"https://xmf.wikipedia.org/wiki/%E1%83%98%E1%83%9C%E1%83%92%E1%83%9A%E1%83%98%E1%83%A1%E1%83%98%E1%83%A8_%E1%83%9B%E1%83%9D%E1%83%9C%E1%83%90%E1%83%A0%E1%83%A5%E1%83%94%E1%83%A4%E1%83%98%E1%83%A8_%E1%83%94%E1%83%A0%E1%83%99%E1%83%94%E1%83%91%E1%83%A3%E1%83%9A%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Harold2.jpg","page_title":"ინგლისიშ მონარქეფიშ ერკებული","context_page_description":"ინგლისიშ ომაფე არსებენდ 871 - 1707 წანეფს. 1199 წანაშე ინგლისიშ მაფეფი ატარენდეს დიო ირლანდიაშ ლორდიშ, 1541 - წანაშე ირლანდიაშ მაფაშ ტიტულს. ინგლისიშ ომაფე ხვისტას შოტლანდიის მაფაშ ჯეიმზ IV-ის ეშულაშ უკული ინგლისიშ მაფეფი ართბორჯულო რდეს შოტლანდიაშ მაფეფი ხოლო. 1707 წანას ინგლის დო შოტლანდიაშ შქას აკოშქუმალაშ აქტეფით გიჭყჷ დიდი ბრიტანეთიშ ომაფექ."},{"page_url":"https://fi.wikipedia.org/wiki/Petra_Ahola","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Petra_Ahola_-_Photo_Kari_Sunnari.jpg","page_title":"Petra Ahola","context_page_description":"Petra Teresa Ahola on suomalainen näyttelijä."},{"page_url":"https://pl.wikipedia.org/wiki/Rejon_Krasna_poljana","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Sofia-Krasna_polyana.png","page_title":"Rejon Krasna poljana","context_page_description":"Rejon Krasna poljana − rejon w obwodzie miejskim Sofii, w Bułgarii. Populacja wynosi 65 400 mieszkańców."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B1%D8%A8%DA%A9%D8%A7_%D9%85%DB%8C%D8%AF%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Rebecca_Mader_May_2017.jpg","page_title":"ربکا میدر","context_page_description":"ربکا میدر بریتانیالی اوْیونچو"},{"page_url":"https://nn.wikipedia.org/wiki/Stein_am_Rhein","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Offizielles_Wappen_von_Stein_am_Rhein.png","page_title":"Stein am Rhein","context_page_description":"Stein am Rhein er ein kommune i kantonen Schaffhausen i Sveits. Kommunen har 3 209 innbyggjarar med eit areal på 6 km². Kommunesenteret ligg 413 meter over havet og ligg ved Bodensjøen.\\nByen har eit godt bevart sentrum frå mellomalderen og har behalde den gamle gateplanen. Staden der bymurane låg og byportane er bevarte, men den tidlegare bymuren består i dag av hus. Gamlebyen er ein bilfri sone med mange bygg frå mellomalderen."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Lyon-Brotteaux","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/LB_-_LYON_-_Gare_des_Brotteaux.JPG","page_title":"Gare de Lyon-Brotteaux","context_page_description":"La gare de Lyon-Brotteaux est une ancienne gare française à voyageurs du quartier des Brotteaux, dans le 6ᵉ arrondissement de Lyon, aujourd'hui désaffectée. Elle fait l’objet d’un classement au titre des monuments historiques depuis le 7 mai 1982. Cette protection concerne l’ensemble des façades et toitures, ainsi que la salle décorée des pas perdus."},{"page_url":"https://de.wikipedia.org/wiki/Haspel","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Coils_imgp8569.jpg","page_title":"Haspel","context_page_description":"Die Haspel, oft Weife genannt, ist ein technisches Hilfsmittel zum Auf- und Abwickeln von langgestreckten Materialien wie Garnen, Seilen, Drähten und Bändern.\\nHaspeln bestehen aus einem in der Regel walzen-, spulen- oder kreuzförmigem Aufbau, der drehbar um eine Mittelachse mit Kurbel gelagert ist. Eine Haspel wird zu dem Zweck verwendet, die oben genannten Materialien in eine handhabbare, kompakte Form zu bringen, sie vor dem Verwirren und Verknoten zu sichern, die aufgewickelte Länge des Materials über Zahnräder zu messen und sie bis zum weiteren Gebrauch in dieser Form zu lagern. Daneben gibt es Vorrichtungen, deren Bezeichnung zwar von der Gestalt der Haspel abgeleitet sind, die aber eine andere Funktion haben."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BC%D1%8D%D1%80%D0%BE%D0%B2_%D0%94%D0%B5%D1%82%D1%80%D0%BE%D0%B9%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/SolomonSibleyDetroit.jpg","page_title":"Список мэров Детройта","context_page_description":"Это список мэров Детройта, штата Мичиган, США с 1806 года по настоящее время."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B2%D0%B0%D0%BA%D1%88%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Tadpoles_-_Agalychnis_callidryas.jpg","page_title":"Квакши","context_page_description":"Квакши, или древесные лягушки, или древесницы — семейство бесхвостых земноводных, одно из самых больших среди амфибий."},{"page_url":"https://lb.wikipedia.org/wiki/L%C3%ABscht_vun_den_nationale_Monumenter_an_der_Gemeng_Wuermer","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Ehnen_Wine_Museum_R02.jpg","page_title":"Lëscht vun den nationale Monumenter an der Gemeng Wuermer","context_page_description":"An dëser Lëscht vun den nationale Monumenter an der Gemeng Wuermer sinn all national Monumenter opgezielt, déi an der lëtzebuergescher Gemeng Wuermer ze fanne sinn."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_ponts_du_Portugal","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Silves_%22Roman%22_bridge.jpg","page_title":"Liste de ponts du Portugal","context_page_description":"Cette liste de ponts du Portugal a pour vocation de présenter une liste de ponts remarquables du Portugal, tant par leurs caractéristiques dimensionnelles, que par leur intérêt architectural ou historique.\\nElle est présentée sous forme de tableaux récapitulant les caractéristiques des différents ouvrages, et peut être triée selon les diverses entrées pour voir un type de pont particulier ou les ouvrages les plus récents par exemple. La seconde colonne donne la classification de l'ouvrage parmi ceux présentés, les colonnes Portée et Long. sont exprimées en mètres. Date indique la date de mise en service du pont."},{"page_url":"https://ceb.wikipedia.org/wiki/Amblypharyngodon_atkinsonii","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Amblypharyngodon_atkinsonii_Achilles_134.jpg","page_title":"Amblypharyngodon atkinsonii","context_page_description":"Espesye sa isda nga una nga gihulagway ni Edward Blyth ni adtong 1860 ang Amblypharyngodon atkinsonii. Ang Amblypharyngodon atkinsonii sakop sa kahenera nga Amblypharyngodon sa kabanay nga karpa. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://it.wikipedia.org/wiki/Weissenhof","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Weissenhof_Corbusier_03.jpg","page_title":"Weissenhof","context_page_description":"Il Weißenhof è un complesso di edifici abitativi costruito a Stoccarda nel 1927, in occasione dell'esposizione organizzata dal Deutscher Werkbund. È stato una sorta di \\"vetrina\\" internazionale, per esporre le innovazioni proposte dal Movimento moderno."},{"page_url":"https://vec.wikipedia.org/wiki/Les_Farges","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Chapelle_Les_Farges.JPG","page_title":"Les Farges","context_page_description":"Les Farges el xé on comun de 319 abitanti del departemento de Dordogna che el fa parte del rejon Nova Acuitania in Fransa."},{"page_url":"https://sv.wikipedia.org/wiki/Svartbukig_amarant","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Black-bellied_Firefinch.JPG","page_title":"Svartbukig amarant","context_page_description":"Svartbukig amarant är en fågel i familjen astrilder inom ordningen tättingar.<"},{"page_url":"https://azb.wikipedia.org/wiki/%D9%88%D8%A7%D8%B1%D9%86_%D8%B3%DB%8C%D8%AA%DB%8C%D8%8C_%D8%AA%DA%A9%D8%B2%D8%A7%D8%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/TXMap-doton-ClarksvilleCity.PNG","page_title":"وارن سیتی، تکزاس","context_page_description":"وارن سیتی آمریکانین تکزاس ایالتینده یئرلشن بیر کند. ۲۰۱۱-جی وئریلن معلوماتا اهالیسینین سایی ۲۹۸ نفر ایدی."},{"page_url":"https://en.wikipedia.org/wiki/WDR53","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Chart_of_Divergence.jpg","page_title":"WDR53","context_page_description":"WD repeat containing protein 53 is a protein encoded by the WDR53 gene that has been identified in the human genome by the Human Genome Project but has, at the moment, lacked experimental procedures to understand the function. It is located on chromosome 3 at location 3q29 in Homo sapiens. It has short up and down stream untranslated regions as well as WD40 repeat regions which have been linked to various functions."},{"page_url":"https://en.wikipedia.org/wiki/Tianjin","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Tianjin_shuidi.JPG","page_title":"Tianjin","context_page_description":"Tianjin, alternately romanized as Tientsin, is a municipality and a coastal metropolis in Northern China on the shore of the Bohai Sea. It is one of the nine national central cities in Mainland China, with a total population estimated at 15,621,200 in 2016. Its built-up area, made up of 12 central districts, was home to 12,491,300 inhabitants in 2016 and is also the world's 29th-largest agglomeration and 11th-most populous city proper.\\nIt is governed as one of the four municipalities under the direct administration of Chinese central government and is thus under direct administration of the State Council. Tianjin borders Hebei Province and Beijing Municipality, bounded to the east by the Bohai Gulf portion of the Yellow Sea. Part of the Bohai Economic Rim, it is the largest coastal city in northern China.\\nIn terms of urban population, Tianjin is the fourth largest in China, after Shanghai, Beijing, and Guangzhou. In terms of administrative area population, Tianjin ranks fifth in Mainland China. The walled city of Tianjin was built in 1404. As a treaty port since 1860, Tianjin has been a major seaport and gateway to Beijing."},{"page_url":"https://en.wikipedia.org/wiki/Kazan_Federal_University","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/eb/Kazan_new_ac_build_and_lib.JPG","page_title":"Kazan Federal University","context_page_description":"Kazan Federal University is located in Kazan, Russia.\\nFounded in 1804 as Imperial Kazan University, famous mathematician Nikolai Ivanovich Lobachevsky served there as the rector from 1827 until 1846. In 1925, the university was renamed in honour of its most famous student Vladimir Ilyich Ulyanov. The university is known as the birthplace of organic chemistry due to works by Aleksandr Butlerov, Vladimir Markovnikov, Aleksandr Arbuzov, and the birthplace of electron spin resonance discovered by Evgeny Zavoisky.\\nIn 2010, Kazan University received a federal status. It is also one of 15 Russian universities that were initially selected to participate in the Project 5-100, coordinated by the Government of the Russian Federation and aimed to improve their international competitiveness among the world’s leading research and educational centers.\\nAs of January 2020, the university comprises 18 primary educational units, 2 of which are territorial branches. More than 50,000 students are enrolled in over 600 degree programs at undergraduate and postgraduate level; the number of international students is about 9,700 from 106 countries."},{"page_url":"https://de.wikipedia.org/wiki/1868","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Rossini_by_Grevedon.jpg","page_title":"1868","context_page_description":"25. Mai: Kaiser Franz Joseph I. setzt für Cisleithanien die vom Kabinett unter Ministerpräsident Karl von Auersperg erarbeiteten Maigesetze in Kraft. Damit werden mehrere Bestimmungen des Konkordats von 1855 aufgehoben oder eingeschränkt. Unter anderem wird das Unterrichts- und Erziehungswesen unter die Leitung des Staates gestellt und weltliche Gerichte für die Ehegerichtsbarkeit zuständig gemacht. Außerdem darf jeder ab 14 Jahren sein Religionsbekenntnis frei wählen oder auf ein solches verzichten. Die Maigesetze bilden in Österreich bis heute die Basis der Trennung von Kirche und Staat. Papst Pius IX. verurteilt noch im gleichen Jahr in einem geheimen Konsistorium die Maigesetze als leges abominabiles. In einem Hirtenbrief vom 7. September ruft der Linzer Bischof Franz Joseph Rudigier zum Widerstand gegen die Maigesetze auf.\\n22. August: In der von František Ladislav Rieger ausgearbeiteten Böhmischen Deklaration artikuliert sich das Verlangen von 82 tschechischen Abgeordneten des Böhmischen Landtags, die böhmische Nation in Österreich-Ungarn und die Länder der böhmischen Krone gegenüber dem österreichischen Staat und Kaiser gerecht zu behandeln.\\n20."},{"page_url":"https://nn.wikipedia.org/wiki/Fylkesveg_191_i_Oppland","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/FV191_Ankaltrudslinna.jpg","page_title":"Fylkesveg 191 i Oppland","context_page_description":"Fylkesveg 191 i Oppland går mellom Leppa bru og Loengsbygda i Nordre Land kommune. Vegen er 10,3 km lang."},{"page_url":"https://vi.wikipedia.org/wiki/Koshiba_Masatoshi","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Masatoshi_Koshiba_and_Junichiro_Koizumi_20030827.jpg","page_title":"Koshiba Masatoshi","context_page_description":"Koshiba Masatoshi, sinh ngày 19 tháng 9 năm 1926 tại Toyohashi, Nhật Bản là một nhà vật lý học người Nhật Bản. Ông là một trong 3 nhà vật lý nhận giải Nobel vật lý trong năm 2002.\\nÔng bây giờ là Cố vấn cao cấp của Trung tâm Quốc tế Vật lý Hạt cơ và Giáo sư danh dự của Đại học Tokyo."},{"page_url":"https://eu.wikipedia.org/wiki/Obervisse","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Obervisse_-_%C3%A9glise_paroissiale.JPG","page_title":"Obervisse","context_page_description":"Obervisse Frantziako udalerri bat da, Moselle departamenduan dagoena, Ekialde Handia eskualdean. 2013an 149 biztanle zituen."},{"page_url":"https://en.wikipedia.org/wiki/Catalan_nationalism","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/PratRiba-4716.jpg","page_title":"Catalan nationalism","context_page_description":"Catalan nationalism is the ideology asserting that the Catalans are a nation.\\nIntellectually, Catalan nationalism can be said to have commenced as a political philosophy in the unsuccessful attempts to establish a federal state in Spain in the context of the First Republic. Valentí Almirall i Llozer and other intellectuals that participated in this process set up a new political ideology in the 19th century, to restore self-government, as well as to obtain recognition for the Catalan language. These demands were summarized in the so-called Bases de Manresa in 1892.\\nIt met very little support at first. But after the Spanish–American War in which the United States invaded and annexed the last of the Spanish colonies, these early stages of Catalanism grew in support, mostly because of the weakened Spanish international position after the war and the loss of the two main destinations for Catalan exports."},{"page_url":"https://en.wikipedia.org/wiki/Strmca,_Postojna","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Strmca_Postojna_Slovenia_1.jpg","page_title":"Strmca, Postojna","context_page_description":"Strmca is a small village west of Planina in the Municipality of Postojna in the Inner Carniola region of Slovenia."},{"page_url":"https://br.wikipedia.org/wiki/Shibasaburo_Kitasato","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Kitasato_Shibasaburo.jpg","page_title":"Shibasaburo Kitasato","context_page_description":"Shibasaburō Kitasato, ganet d'an 29 a viz Genver 1853 ha tremenet d'an 13 a viz Even 1931 a oa ur bakteriologour japanat stummet en Alamagn hag a implije hentenn Koch.\\nAnavezet eo evel kendizoloer orin ar vosenn werblus e Hong Kong e 1894, tost war un dro gant Alexandre Yersin."},{"page_url":"https://zh.wikipedia.org/zh-tw/T95/96%E6%AC%A1%E5%88%97%E8%BD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Board_of_Train_T95-96%2820181109%29.jpg","page_title":"T95/96次列车","context_page_description":"T95/96次列車是中國鐵路運行於湖北省會武漢至廣東經濟特區深圳之間的特快旅客列車，自1998年10月1日起開行，現由武漢鐵路局武漢客運段武深車隊負責客運任務，是武漢直通深圳的第一趟特快列車。列車使用25K型客車，沿京廣鐵路、廣深鐵路運行，全程1216公里，途經湖北、湖南、廣東三省。其中武昌站至深圳站運行13小時40分，使用車次為T95次；深圳站至武昌站運行14小時34分，使用車次為T96次。列車結合乘務工作推出了「十點服務法」，針對港澳台旅客較多的特點還推出「三語」服務。餐車則針對不同層次的旅客，推出「三店式」全過程服務，即出售盒飯「快餐店式管理」，餐車用餐「酒店式管理」，娛樂休閒「吧檯式管理」， 其設施及服務水準被社會各界譽為「陸地航班」。"},{"page_url":"https://hu.wikipedia.org/wiki/Jap%C3%A1n_jen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Series_C_5K_Yen_Bank_of_Japan_note_-_back.jpg","page_title":"Japán jen","context_page_description":"A jen Japán hivatalos fizetőeszköze. Ezenfelül széles körben használják tartalékvalutaként az amerikai dollár és az euró után. ISO 4217 kódja JPY és 392. Latin átírásban a jen szimbóluma a ¥, ami japán kandzsival írva 円."},{"page_url":"https://en.wikipedia.org/wiki/Sderot","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/Campus_sapir.jpg","page_title":"Sderot","context_page_description":"Sderot is a western Negev city and former development town in the Southern District of Israel. In 2018 it had a population of 26,455.\\nSderot is located less than a mile from Gaza, and is notable for having been a major target of Qassam rocket attacks from the Gaza Strip. Between 2001 and 2008, rocket attacks on the city killed 13 people, wounded dozens, caused millions of dollars in damage and profoundly disrupted daily life. Although rocket fire subsided after the Gaza War, the city has come under rocket attack on occasion since that time."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%97%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Akashi-uontana%2C2010%E5%B9%B4%E6%9C%AB-%E9%AD%9A%E3%81%AE%E6%A3%9A%E5%95%86%E5%BA%97%E8%A1%97_DSCF0215.JPG","page_title":"旗","context_page_description":"旗は、布や紙など薄い素材を用いて、主に竿の先端に付けて空中に掲げたものである。竿以外には綱などに付ける場合がある。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B7%D1%80%D1%8F%D0%B4%D0%BD%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Lightningarrestor.jpg","page_title":"Розрядник","context_page_description":"Розря́дник — пристрій, що містить два чи декілька електродів, призначений для здійснення розряджання за певних умов.\\nСпочатку розрядником називали пристрій для захисту від перенапруг, який базується на технології іскрового проміжку. Потім, з розвитком технологій, для обмеження перенапруг почали застосовувати пристрої на основі напівпровідників і метал-оксидних варисторів, стосовно яких продовжують використовувати термін «розрядник»."},{"page_url":"https://it.wikipedia.org/wiki/Parco_internazionale_delle_Bocche_di_Bonifacio","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/France_-_Lavezzi.PNG","page_title":"Parco internazionale delle Bocche di Bonifacio","context_page_description":"Il parco internazionale delle Bocche di Bonifacio, in via di istituzione a partire dal 2010, è un parco marino della Corsica e della Sardegna, comprende la riserva naturale delle Bocche di Bonifacio e il parco nazionale dell'Arcipelago di La Maddalena."},{"page_url":"https://ka.wikipedia.org/wiki/Siemens_Combino","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Combino_G%C5%82ogowska_RB2.JPG","page_title":"Siemens Combino","context_page_description":"Siemens Combino — დაბალიატაკიანი ტრამვაის ვაგონი, რომელსაც კომპანია სიმენსი აწარმოებს. ამ ტიპის პირველი ვაგონი დიუსელდორფში, Duewag–ის ქარხანაში 1996 წელს გამოუშვეს. ამჟამად მათი წარმოება მიმდინარეობს კრეფელდში. Siemens Combino-ს ზოგიერთი ვაგონი აგებულია Siemens-ის პოლონეთის ფილიალში, ქ. პოზნანში. კომბინოს აწყობენ სტანდარტული დეტალებისგან, რაც ამცირებს მის თვითღირებულებას."},{"page_url":"https://pt.wikipedia.org/wiki/DHR_Classe_B","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/DHR_792_with_School_Train_05-02-23_02.jpeg","page_title":"DHR Classe B","context_page_description":"A DHR Classe B é uma famosa classe de locomotivas a vapor 0-4-0 ST de bitola estreita 2 pés utilizadas na ferrovia Darjeeling Himalayan Railway em Bengala Ocidental, Índia."},{"page_url":"https://de.wikipedia.org/wiki/Giora_Eiland","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Msc_2004-Sunday_Morning-1100-1300-IMG_0020.jpg","page_title":"Giora Eiland","context_page_description":"Giora Eiland ist ein ehemaliger Generalmajor der Israelischen Verteidigungsstreitkräfte. Er war nationaler Sicherheitsberater Israels und ist „Senior Research Associate“ am israelischen „Institute for National Security Studies“."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%95%E0%B4%BE%E0%B4%B8%E0%B5%8D%E0%B4%AA%E0%B4%BF%E0%B4%AF%E0%B5%BB_%E0%B4%95%E0%B4%9F%E0%B5%BD%E0%B4%95%E0%B4%BE%E0%B4%95%E0%B5%8D%E0%B4%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Larus_portrait.jpg","page_title":"കാസ്പിയൻ കടൽകാക്ക","context_page_description":"കാസ്പിയൻ കടൽ കാടക്ക് ഇംഗ്ലീഷിൽ yellow-legged gullഎന്നു പറയുന്നു. ശാസ്ത്രീയ നാമംLarus michahellisഎന്നാണ്. ചിലപ്പോൾ western yellow-legged gull എന്നും പറയുന്നു."},{"page_url":"https://sr.wikipedia.org/wiki/The_Stanley_Parable","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/The_Stanley_Parable_-_Screenshot_08.jpg","page_title":"The Stanley Parable","context_page_description":"The Stanley Parable је интерактивна драма и симулатор ходања дизајниран од стране америчког програмера Дејвија Редена. Игра је првобитно објављена 27. јула 2011. као бесплатни мод за Half-Life 2. Заједно са Вилијамом Пуом, Реден је касније објавио самостални римејк користећи Source engine под именом Galactic Cafe studio. Римејк је подразумевао нове елементе приче и бољу графику. Најављен је и потврђен преко Steam Greenlight у 2012, и објављен је 17. октобра 2013, за Microsoft Windows. Ажурирања која су уследила за игру додала су подршку за OS X 19. децембра 2013, а за Linux 09. септембра 2015. Даље проширено издање под називом The Stanley Parable: Ultra Deluxe је заказано за објаву у 2020. Биће доступно на конзолама и укључиваће додатни садржај..\\nИгра не садржи борбу или друге секвенце засноване на акцији. Уместо тога, играње подразумева вођење тихог протагонисте под именом Стенли уз нарацију од стране британског глумца Кевана Брајтинга. Како прича напредује, играч је суочен са разилазећим путевима. Играч не мора послушати нараторове предлоге, што ће бити урачунато у причу."},{"page_url":"https://de.wikipedia.org/wiki/Minoische_Kunst","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Minoische_Keramik_-_Kannen02.jpg","page_title":"Minoische Kunst","context_page_description":"Die minoische Kunst ist der künstlerische Ausdruck der minoischen Kultur der Bronzezeit, wie sie von der Insel Kreta auf benachbarte Inseln der südlichen Ägäis, das griechische Festland und bis nach Ägypten ausstrahlte. Hauptwerke der minoischen Kunst sind neben der Architektur vor allem die zahlreichen Wandmalereien und Malereien auf Vasen. Besonders erwähnenswert ist auch die Glyptik. Die Plastik spielte nur eine untergeordnete Rolle und ist meist klein.\\nGrundformen der minoischen Kunst sind logische geometrische Gefüge, die bald mit Spiralen und einfachen Pflanzmotiven verbunden wurden. Hier treten auch erstmals Wellenranken und Palmetten auf."},{"page_url":"https://en.wikipedia.org/wiki/Toyota_Avalon","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/98-99_Toyota_Avalon_XLS_2.jpg","page_title":"Toyota Avalon","context_page_description":"The Toyota Avalon is a full-size car produced by Toyota. It is Toyota's largest front-wheel drive sedan and serves as its flagship vehicle in the United States, Canada, Puerto Rico, China and the Middle East. It was also produced in Australia from April 2000 until June 2005, when it was replaced in November 2006 by the Aurion. The first production Avalon rolled off the TMMK assembly line in Georgetown, Kentucky, in September 1994. A second-generation model was released in the United States and Japan in 1999.\\nToyota marketed the Avalon as a replacement for the Cressida, a model discontinued for the American market in 1992. While the Cressida was an upper-level midsize rear-wheel drive car with a straight-six engine, the Avalon is front-wheel drive, powered by a V6 engine. In recent years, there has been considerable overlapping with its platform mates, the Camry V6 and the Lexus ES, although the third-generation Avalon was distinguished by offering extra legroom. Since 2013, the Avalon was introduced on a platform that is shared with the Lexus ES.\\nAs of 2013, the Avalon is sold in the United States, Canada, China, Puerto Rico, South Korea and the Middle East."},{"page_url":"https://pl.wikipedia.org/wiki/Wanderup","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Wanderup_Wappen.png","page_title":"Wanderup","context_page_description":"Wanderup – miejscowość i gmina w Niemczech w kraju związkowym Szlezwik-Holsztyn, w powiecie Schleswig-Flensburg, wchodzi w skład urzędu Eggebek."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_Merseyside","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/St_Peter%27s_Church%2C_Woolton_%281%29.jpg","page_title":"Grade II* listed buildings in Merseyside","context_page_description":"There are over 20,000 Grade II* listed buildings in England. This page is a list of these buildings in the county of Merseyside."},{"page_url":"https://de.wikipedia.org/wiki/Auswil","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/2012-03-17-Supra_Argovio_%28Foto_Dietrich_Michael_Weidmann%29_047.JPG","page_title":"Auswil","context_page_description":"Auswil ist eine politische Gemeinde im Verwaltungskreis Oberaargau des Kantons Bern in der Schweiz. Eine Burger- oder eigene Kirchgemeinde existiert nicht."},{"page_url":"https://en.wikipedia.org/wiki/Prudencia_Ayala","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Placa_en_honor_a_prudencia_ayala%2C_en_san_salvador.png","page_title":"Prudencia Ayala","context_page_description":"Prudencia Ayala was a Salvadoran writer, social activist and pioneer campaigner for women's rights in El Salvador and first woman to run for president in El Salvador and Latin America."},{"page_url":"https://sv.wikipedia.org/wiki/Shakatak","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/2014-09-19_Shakatak_039.jpg","page_title":"Shakatak","context_page_description":"Shakatak är en brittisk jazzfunk-grupp bildad 1980. De har haft ett antal hitlåtar på brittiska singellistan, som topp 10-hitsen \\"Night Birds\\" och \\"Down on the Street\\", och har även varit mycket populära i Japan."},{"page_url":"https://hu.wikipedia.org/wiki/Budapest_gy%C3%B3gyf%C3%BCrd%C5%91i","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Budapest%2C_Dag%C3%A1ly_f%C3%BCrd%C5%91%2C_62.jpg","page_title":"Budapest gyógyfürdői","context_page_description":"Budapest a világ kevés olyan fővárosának egyike, ahol hőforrások találhatóak. A különleges összetételű gyógyvizet hivatalosan 8 gyógyfürdő hasznosítja.\\nA gyógyfürdők többsége egyben műemlék és turisztikai látnivaló is."},{"page_url":"https://uk.wikipedia.org/wiki/MAGEA1","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/PDB_1w72_EBI.jpg","page_title":"MAGEA1","context_page_description":"MAGEA1 – білок, який кодується однойменним геном, розташованим у людей на X-хромосомі. Довжина поліпептидного ланцюга білка становить 309 амінокислот, а молекулярна маса — 34 342.\\nКодований геном білок за функцією належить до фосфопротеїнів.\\nЗадіяний у таких біологічних процесах, як транскрипція, регуляція транскрипції.\\nЛокалізований у цитоплазмі, ядрі."},{"page_url":"https://ia.wikipedia.org/wiki/Superhero","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/MajorTriumphPaperback002.png","page_title":"Superhero","context_page_description":"Le Superhero es un heroe e persona fictive in libros, comics e cartones, qui possede plenipotentias extraordinari, frequentamente, magical."},{"page_url":"https://fr.wikipedia.org/wiki/Christine_Dacremont","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Lancia_Stratos_Turbo_Le_Mans_1976.jpg","page_title":"Christine Dacremont","context_page_description":"Christine Dacremont, née le 6 janvier 1949 à Sedan, est une ancienne pilote de course française, de rallyes de 1970 à 1979, et sur circuits."},{"page_url":"https://nl.wikipedia.org/wiki/Jean_Goldschmit","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Jean_Goldschmit_%281948%29.jpg","page_title":"Jean Goldschmit","context_page_description":"Jean Goldschmit was een Luxemburgs wielrenner."},{"page_url":"https://es.wikipedia.org/wiki/Piazza_San_Giovanni_(Florencia)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/Piazza_San_Giovanni_%28Florence%29_9.JPG","page_title":"Piazza San Giovanni (Florencia)","context_page_description":"La Piazza San Giovanni es una plaza de Florencia, Italia, que recibe su nombre del Baptisterio de San Juan y es la continuación hacia el oeste de la Piazza del Duomo. La plaza actual se construyó en el siglo XIX, cuando se demolió una parte del Palacio Arzobispal para crear un espacio apropiado para la vista del Baptisterio y unir en línea recta la Via de' Martelli con la Via Roma."},{"page_url":"https://hr.wikipedia.org/wiki/Vrhovo_(Rade%C4%8De,_Slovenija)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Vrhovo1.JPG","page_title":"Vrhovo (Radeče, Slovenija)","context_page_description":"Vrhovo je naselje u slovenskoj Općini Radeče. Nalazi se u pokrajini Štajerskoj i statističkoj regiji Savinjskoj."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B6%E0%A7%80%E0%A6%A4%E0%A6%BE%E0%A6%A4%E0%A6%AA_%E0%A6%A8%E0%A6%BF%E0%A6%AF%E0%A6%BC%E0%A6%A8%E0%A7%8D%E0%A6%A4%E0%A7%8D%E0%A6%B0%E0%A6%A3_%E0%A6%AC%E0%A7%8D%E0%A6%AF%E0%A6%AC%E0%A6%B8%E0%A7%8D%E0%A6%A5%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Volkswagen_W16.jpg","page_title":"শীতাতপ নিয়ন্ত্রণ ব্যবস্থা","context_page_description":"শীতাতপ নিয়ন্ত্রণ ব্যবস্থা হচ্ছে অভ্যন্তরীন বাতাসে আর্দ্রতার পরিমাণ নিয়ন্ত্রণ করে আরামদায়ক পরিবেশ তৈরী। বিশদ অর্থে শীতলীকরন, তাপমাত্রা বৃদ্ধি, বাতাসের গতি নিয়ন্ত্রণ ও বিশুদ্ধতা নিশ্চিতকরণই শীতাতপ নিয়ন্ত্রণ ব্যবস্থা।"},{"page_url":"https://nl.wikipedia.org/wiki/Diego_Calder%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Diego_Armando_Calder%C3%B3n.jpg","page_title":"Diego Calderón","context_page_description":"Diego Armando Calderón Espinoza is een Ecuadoraans voetballer. In 2015 verruilde hij LDU Quito voor Barcelona SC."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AB%D8%A7%D9%8A%D8%AF%D9%88%D9%86_%D8%A8%D9%88%D9%8A%D8%B3_(%D9%85%D8%AD%D8%B7%D8%A9_%D9%85%D8%AA%D8%B1%D9%88_%D8%A3%D9%86%D9%81%D8%A7%D9%82_%D9%84%D9%86%D8%AF%D9%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Theydon_Bois_stn_north.JPG","page_title":"ثايدون بويس (محطة مترو أنفاق لندن)","context_page_description":"ثايدون بويس ‏ هي إحدى محطات مترو أنفاق لندن. تقع على خط سينترال افتتحت في المنطقة رقم 6 افتتحت في 24 أبريل 1865، 25 سبتمبر 1949."},{"page_url":"https://it.wikipedia.org/wiki/Zoarcidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/PolarEelpout-B-Sheiko.jpg","page_title":"Zoarcidae","context_page_description":"Gli Zoarcidae sono una numerosa famiglia di pesci ossei marini appartenenti all'ordine Perciformes."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%80%D1%85%D0%B8%D0%B5%D0%BF%D0%B0%D1%80%D1%85%D0%B8%D1%8F_%D0%9C%D1%8E%D0%BD%D1%85%D0%B5%D0%BD%D0%B0_%D0%B8_%D0%A4%D1%80%D0%B0%D0%B9%D0%B7%D0%B8%D0%BD%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Marx_05-2009.jpg","page_title":"Архиепархия Мюнхена и Фрайзинга","context_page_description":"Архиепархия Мюнхена и Фрайзинга — архиепархия Римско-Католической церкви с центром в городе Мюнхен, Германия. В митрополию Мюнхена и Фрайзинга входят епархии Аугсбурга, Пассау и Регенсбурга. Кафедральным собором архиепархии Мюнхена и Фрайзинга является церковь Пресвятой Девы Марии. В Фрайзинге находится сокафедральный собор Пресвятой Девы Марии и Святого Корбиниана."},{"page_url":"https://fr.wikipedia.org/wiki/Wissembourg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Wissembourg_-_Maison_de_l%27ami_Fritz.jpg","page_title":"Wissembourg","context_page_description":"Wissembourg [visɑ̃buʁ] est une commune française située dans le département du Bas-Rhin, en région Grand Est.\\nCette commune se trouve dans la région historique et culturelle d'Alsace.\\nSes habitants sont appelés les Wissembourgeois.\\nElle avait le statut de sous-préfecture jusqu'au 1ᵉʳ janvier 2015, date du rattachement de l'arrondissement avec celui de Haguenau pour former l'arrondissement de Haguenau-Wissembourg."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Essingen_(Pfalz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/PROT_KIRCHE_ESSINGEN.JPG","page_title":"Liste der Kulturdenkmäler in Essingen (Pfalz)","context_page_description":"In der Liste der Kulturdenkmäler in Essingen sind alle Kulturdenkmäler der rheinland-pfälzischen Ortsgemeinde Essingen aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://pt.wikipedia.org/wiki/Robert_Charles_Wilson","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Robert_Charles_Wilson.jpg","page_title":"Robert Charles Wilson","context_page_description":"Robert Charles Wilson é um autor de ficção científica americano-canadense. Ganhou o prêmio Hugo de literatura pelo romance Spin, além de muitos outros prêmios."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D9%88_%D8%A8%D8%A7%D9%8A%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Bo_Bice.jpg","page_title":"بو بايس","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nبو بايس مغنى من امريكا."},{"page_url":"https://de.wikipedia.org/wiki/Bolama_(Guinea-Bissau)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Barco_regular_entre_Bolama_e_Bissau.jpg","page_title":"Bolama (Guinea-Bissau)","context_page_description":"Bolama ist eine Stadt in Guinea-Bissau mit 4819 Einwohnern. Sie liegt auf der gleichnamigen Insel im Bissagos-Archipel und ist Hauptstadt der Landesregion Bolama.\\nDie Stadt ist zudem Sitz eines gleichnamigen Sektors mit einer Fläche von 451 km² und 10.206 Einwohnern.\\nTeils verfallende, teils restaurierte Gebäude im Kolonialstil prägen den Ortskern der ehemaligen Hauptstadt Guinea-Bissaus. In der Nähe des Hafens liegt der ehemalige Gouverneurspalast."},{"page_url":"https://eu.wikipedia.org/wiki/Rabat","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Sale_from_Rabat.JPG","page_title":"Rabat","context_page_description":"Rabat Marokoko hiriburua da, Casablanca herrialdeko hiri nagusia den arren.\\nOzeano Atlantikoaren kostaldean dago."},{"page_url":"https://pt.wikipedia.org/wiki/Dromiacea","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Sponge_crab_eating_a_sea_urchin.jpg","page_title":"Dromiacea","context_page_description":"Dromiacea é uma zoosecção de caranguejos que contém cerca de 240 espécies extantes e cerca de 300 espécies conhecidas apenas pelo registo fóssil."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%82%D0%B5%D0%BC%D0%BF%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%AF%D1%80%D0%B5%D0%BC%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Stepowski.jpg","page_title":"Стемповский, Ярема","context_page_description":"Ярема Стемповский — польский актёр театра, кино, телевидения и кабаре, также певец."},{"page_url":"https://ms.wikipedia.org/wiki/Rainn_Wilson","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Rainn_Wilson_2011_Shankbone.JPG","page_title":"Rainn Wilson","context_page_description":"Rainn Dietrich Wilson ialah seorang pelakon, pelawak, penulis, pengarah, ahli perniagaan dan penerbit Amerika Syarikat. Beliau terkenal dengan memegang watak Dwight Schrute dalam sitkom NBC The Office."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E5%BB%A3%E5%B7%9E%E5%B8%82%E4%BA%A4%E9%80%9A%E9%81%8B%E8%BC%B8%E8%81%B7%E6%A5%AD%E5%AD%B8%E6%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/School_Uniform_for_GZTTVS_%28S%29.jpg","page_title":"廣州市交通運輸職業學校","context_page_description":"廣州市交通運輸職業學校（粵拼：gwong² zau¹ si⁵ gaau¹ tung¹ wan⁶ syu¹ zik¹ jip⁶ hok⁶ haau⁶）\\n，全名係廣州市交通運輸高級職業技術學校gwong² zau¹ si⁵ gaau¹ tung¹ wan⁶ syu¹ gou¹ kap¹ zik¹ jip⁶ gei⁶ seot⁶ hok⁶ haau⁶，係中國廣東廣州嘅全日制技工學校，1964年11月16號成立。有2個校區，都喺白雲區入面。\\n佢亦係全日制國家級重點職業學校。"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%B5%A6%E9%A1%B9%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Pohang_Yangdeok-dong_City.jpg","page_title":"浦项市","context_page_description":"浦项市是大韩民国庆尚北道的一个行政区划、大邱庆北地区的主要港口。浦项市兴建于兄山江出口的冲积层，面向迎日湾，通往日本海。整个城市被划分为南、北两个区。\\n浦项市面积1127.24平方公里；有人口51万6471人，是庆尚北道人口最多的城市，在韩国所有城市当中亦排行第三，仅次于安东市及庆州市。\\n浦项是世界最大的钢铁公司之一—浦项钢铁的总部所在。1970年代初浦项制铁所诞生以来是韩国有数的工业都市。"},{"page_url":"https://en.wikipedia.org/wiki/Ximenia_americana","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Ximenia_americana_leaves_%26_fruit_at_Chilkur_near_Hyderabad%2C_AP_W2_IMG_7288.jpg","page_title":"Ximenia americana","context_page_description":"Ximenia americana, commonly known as tallow wood, hog plum, yellow plum, sea lemon, or pi'ut, is a small sprawling tree of woodlands native to the tropics.\\nLeaves are oval shaped, bright green and have a strong smell of almonds. Flowers are pale in color. Fruits are lemon-yellow or orange-red."},{"page_url":"https://fr.wikipedia.org/wiki/Mission_de_formation_de_l%27OTAN_en_Afghanistan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Signing_of_transition_documents_for_RMTC-SW%2C_Helmand_Afghanistan.jpg","page_title":"Mission de formation de l'OTAN en Afghanistan","context_page_description":"La Mission OTAN de formation en Afghanistan était une organisation militaire multinationale, initiée en novembre 2009 et dissoute fin 2014, chargée de fournir une formation de niveau supérieur pour les Forces armées afghanes regroupant la composante terre la composante air, les forces de police ainsi que l'Académie militaire nationale d'Afghanistan et les différentes écoles. Elle était aussi chargée de l'élaboration de la doctrine, de la formation et du conseil de la police nationale afghane. L'unité était placée sous le double commandement, de la MFO-A et du CSTC-A.\\nSa mission consistait à coordonner et diriger les actions des différentes partenaires et pays : OTAN, organisations international, donateurs et ONG. Elle soutenait et assistait le gouvernement afghan par la formation de ses unités, de ses cadres et la structuration de son organisation militaire.\\nElle mettait en lien les priorités du gouvernement afghan en matière de forces de police avec les actions compris de la Mission de Police européenne en Afghanistan et les travaux du Conseil international de coordination de la police."},{"page_url":"https://et.wikipedia.org/wiki/Peedu_raudteepeatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Peedu_raudteepeatuskoht_2009.jpg","page_title":"Peedu raudteepeatus","context_page_description":"Peedu raudteepeatus on raudteepeatus Tartu–Valga raudteeliinil Tartumaal Elvas Peedu linnaosas.\\nPeedul peatub mõlemas suunas päevas neli reisirongi."},{"page_url":"https://fr.wikipedia.org/wiki/Universit%C3%A9_du_Sud-Ouest","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/Swu_38jiao.JPG","page_title":"Université du Sud-Ouest","context_page_description":"L'université du Sud-Ouest est une université généraliste située sur la municipalité de Chongqing, en République populaire de Chine."},{"page_url":"https://ja.wikipedia.org/wiki/US-2_(%E8%88%AA%E7%A9%BA%E6%A9%9F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/US-2_Rear.JPG","page_title":"US-2 (航空機)","context_page_description":"US-2は、新明和工業が開発した海洋における救難に特化した飛行艇。US-1Aの後継として海上自衛隊が導入している。\\nなお、US-2は、US-1同様の「水陸両用機」である。"},{"page_url":"https://fr.wikipedia.org/wiki/Rod%C3%A9o","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Steerwrestling-c01.jpg","page_title":"Rodéo","context_page_description":"Le rodéo est, tout à la fois, un spectacle et un événement sportif composé de différentes épreuves issues du travail des cow-boys dans les ranchs. En tant que spectacle, le rodéo débute par une cérémonie d'ouverture durant laquelle organisateurs et concurrents défilent à cheval avec des drapeaux, puis l'hymne national est chanté."},{"page_url":"https://en.wikipedia.org/wiki/Hortus_Sanitatis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Mel-Honig1.jpg","page_title":"Hortus Sanitatis","context_page_description":"The Hortus Sanitatis, a Latin natural history encyclopaedia, was published by Jacob Meydenbach in Mainz, Germany in 1491.\\nIt describes species in the natural world along with their medicinal uses and modes of preparation. It followed the Latin Herbarius moguntinus and the German Gart der Gesundheit, that Peter Schöffer had published in Mainz. Unlike these earlier works, besides dealing with herbs, the Hortus sanitatis deals with animals, birds, fish and stones too. Moreover the author does not restrict himself to dealing only with real creatures, but also includes accounts of mythical animals such as the dragon, harpy, hydra, myrmecoleon, phoenix, and zitiron."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%BD%95%E5%A1%9E%E6%99%AE%C2%B7%E5%A1%94%E6%8B%89%E5%BE%B7%E5%88%A9%E4%BA%9A%E6%96%AF%E5%B7%B4%E5%A1%9E%E7%BD%97%E9%82%A3-%E5%9F%83%E5%B0%94%E6%99%AE%E6%8B%89%E7%89%B9%E6%9C%BA%E5%9C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/LEVEL%2C_Airbus_A330-202%2C_EC-MOY_%2835010932651%29.jpg","page_title":"何塞普·塔拉德利亚斯巴塞罗那-埃尔普拉特机场","context_page_description":"何塞普·塔拉德利亞斯巴塞隆那-埃爾普拉特機場，多簡稱為埃爾普拉特機場，是西班牙第二大城市巴塞隆那的聯外國際機場，乃西班牙僅次於馬德里-巴拉哈斯機場的第二大機場，也是加泰隆尼亞最大的機場，由西班牙機場及飛航服務經營，以提供西班牙國內，以及歐洲、北非的國際航線為主。 2019年2月27日起以前加泰隆尼亞政府主席何塞普·塔拉德利亞斯冠名。\\n埃爾普拉特機場位於巴塞隆那市區西南方的埃爾普拉特市，開航於1918年，是巴塞隆那第二座啟用的機場。巴塞隆那至馬德里間的穿梭航班服務，被稱為「天橋」，在馬德里－巴塞隆那高速鐵路於2008年開通前，是歐洲最繁忙的航線。在2010年，超過292萬人次使用巴塞隆那機場，較2009年成長6.5%，使其躋身歐洲第十大繁忙機場。"},{"page_url":"https://de.wikipedia.org/wiki/Albert_Lehr","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Die_Wohnweise_der_Arbeiterfamilien_in_Bayern%2C_Albert_Lehr%2C_1911_%2800%29.jpg","page_title":"Albert Lehr","context_page_description":"Otto Albert Arthur Lehr war ein deutscher Architekt und bayerischer Baubeamter, der als Oberregierungsbaurat und Oberpostbaurat in Nürnberg und Würzburg tätig war. Er war Architekt der Nürnberger Kirche St. Paul in der Rangierbahnhof-Siedlung."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B2%D9%88%D8%B1%D8%A7%D9%86_%D8%B1%D8%A7%D8%AF%D9%85%DB%8C%D9%84%D9%88%D9%88%DB%8C%DA%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Zoran_Radmilovi%C4%87_2003_Serbian_stamp.jpg","page_title":"زوران رادمیلوویچ","context_page_description":"زوران رادمیلوویچ یک هنرپیشه اهل صربستان بود. وی بین سال‌های ۱۹۵۹ تا ۱۹۸۵ میلادی فعالیت می‌کرد.\\nاز فیلم‌ها یا برنامه‌های تلویزیونی که وی در آن نقش داشته است می‌توان به وقتی بابا رفته بود مأموریت اشاره کرد."},{"page_url":"https://de.wikipedia.org/wiki/Cumberland_County_(Maine)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Cumberland_County_Courthouse_5.JPG","page_title":"Cumberland County (Maine)","context_page_description":"Cumberland County ist ein County im US-Bundesstaat Maine der Vereinigten Staaten. Damit ist es das County mit der höchsten Bevölkerungsdichte Maines. Der Sitz der Countyverwaltung befindet sich in Portland."},{"page_url":"https://eo.wikipedia.org/wiki/Lip%C5%88any_(Tr%C5%A1ice)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Lip%C5%88any%2C_sv._Jan_Nepomuck%C3%BD%2C_1730%2C_Ji%C5%99%C3%AD_Anton%C3%ADn_Heinz.jpg","page_title":"Lipňany (Tršice)","context_page_description":"Lipňany estas vilaĝo en Ĉeĥio, parto de municipo Tršice en distrikto Olomouc. Ĝi troviĝas proksimume 3 km sudokcidente de Tršice. En la jaro 2009 estis ĉi tie registritaj 43 adresoj. En la jaro 2011 ĉi tie dare vivis 119 loĝantoj.\\nLipňany estas ankaŭ nomo de katastra teritorio kun areo 2,82 km²."},{"page_url":"https://es.wikipedia.org/wiki/Lactuca_virosa","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/52/Lactuca_virosa_01012001.JPG","page_title":"Lactuca virosa","context_page_description":"Lactuca virosa L. es una planta silvestre, emparentada con la lechuga, pero no es comestible."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE-%D0%9D%D0%B5%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BB%D0%B0%D0%B2%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3._%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE-%D0%9D%D0%B5%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BB%D0%B0%D0%B2%D1%80%D0%B0._%D0%A1%D0%B5%D0%BC%D0%B8%D0%BD%D0%B0%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%BE%D1%80%D0%BF%D1%83%D1%81..JPG","page_title":"Александро-Невская лавра","context_page_description":"Свя́то-Тро́ицкая Алекса́ндро-Не́вская ла́вра — мужской православный монастырь на восточной оконечности Невского проспекта в Санкт-Петербурге. Первый и наиболее крупный монастырь города. С 1797 года имеет статус лавры.\\nВ состав архитектурного комплекса входит несколько знаменитых некрополей, где покоятся многие выдающиеся деятели XVIII—XIX веков."},{"page_url":"https://pt.wikipedia.org/wiki/Marktheidenfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Wappenmar.png","page_title":"Marktheidenfeld","context_page_description":"Marktheidenfeld é uma cidade da Alemanha, localizada no distrito de Main-Spessart, no estado de Baviera."},{"page_url":"https://es.wikipedia.org/wiki/Cylindropuntia_sanfelipensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Cylindropuntia_sanfelipensis.jpg","page_title":"Cylindropuntia sanfelipensis","context_page_description":"Cylindropuntia sanfelipensis es una especie de choya perteneciente a la familia Cactaceae que se distribuye en Baja California en México. La palabra sanfelipensis hace referencia a la localidad de San Felipe, región donde habita la especie.​"},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A7%88%EC%82%AD%EC%A4%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Trachelospermum_asiaticum_cv1.jpg","page_title":"마삭줄","context_page_description":"마삭줄은 상록의 덩굴성 목본으로서, 줄기는 길게 뻗으며, 부착근을 내어 바위나 나무 등에 기어오른다. 잎은 마주 달려 있는데, 타원형으로 두꺼우며 윤이 나고 뒷면에는 털이 나 있다. 꽃은 흰색으로, 5월경이 되면 잎겨드랑이나 가지 끝에 취산꽃차례를 이룬다. 열매는 8~9월에 익으며 원통형의 골돌로 가을에 익으며, 씨의 끝에는 여러 개의 긴 털이 나 있다. 산과 들 및 숲속·바위 틈에서 자라며, 꽃향기가 좋아 관상용으로 널리 재배되고 있다."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B5%D0%B9%D0%BC,_%D0%A5%D0%B5%D0%BD%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Henk_Tijm_vs._Lazar_Radovic.jpg","page_title":"Тейм, Хенк","context_page_description":"Хендрикюс Р. Тейм — нидерландский футболист, завершивший игровую карьеру, выступал на позиции защитника за команды «Алкмар ’54», «Аякс» и АЗ'67. Провёл несколько матчей за вторую сборную Нидерландов."},{"page_url":"https://fr.wikipedia.org/wiki/Leopold_Mueller","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Benjamin_Carl_Leopold_M%C3%BCller.JPG","page_title":"Leopold Mueller","context_page_description":"Benjamin Karl Leopold Mueller est un médecin allemand qui fut conseiller étranger au Japon pendant l'ère Meiji."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B0%D1%85%D1%82%D0%B8%D0%B3%D0%B0%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Nachtigall_Battalion.jpg","page_title":"Нахтигаль","context_page_description":"Специальное подразделение «На́хтигаль», также известное как группа «Север» в составе так называемых Дружин украинских националистов — одно из двух вооружённых подразделений, сформированных преимущественно из членов и сторонников ОУН и обученных абвером для действий на территории Украинской ССР в составе диверсионного подразделения «Бранденбург 800» в ходе операции «Барбаросса».\\nСогласно планам руководства ОУН, Дружинам украинских националистов предстояло стать основой будущей армии самостоятельного украинского государства, союзной вооружённым силам Третьего рейха. Создание украинского националистического формирования было санкционировано 25 февраля 1941 года руководителем абвера Вильгельмом Канарисом. Диверсионные группы из состава «Нахтигаля» были переброшены на территорию УССР до начала операции «Барбаросса», тогда как основной состав батальона перешёл границу СССР 22 июня 1941 года и в течение лета действовал совместно с немецкими войсками на направлении Перемышль — Львов — Тернополь — Проскуров — Жмеринка — Винница, в основном осуществляя охранные функции — охрану мостов, железных дорог, промышленных предприятий, водохранилищ."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D9%86%D8%A8%D9%88%D9%87%E2%80%8C%D8%AF%D9%86%D8%AF%D8%A7%D9%86%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Pycnodus_platessus.jpg","page_title":"انبوه‌دندانان","context_page_description":"انبوه‌دندانان نام یک خانواده از راسته انبوه‌دندان‌ریختان است."},{"page_url":"https://sv.wikipedia.org/wiki/La_Todolella_(kommun)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Castell_de_la_Todolella_2.jpg","page_title":"La Todolella (kommun)","context_page_description":"Todolella är en kommun i Spanien. Den ligger i provinsen Província de Castelló och regionen Valencia, i den östra delen av landet, 290 km öster om huvudstaden Madrid. Antalet invånare är 148. Arean är 34 kvadratkilometer. Todolella gränsar till Cinctorres, Forcall, La Mata de Morella och Olocau del Rey.\\nTerrängen i Todolella är lite kuperad.\\nEtt kallt stäppklimat råder i trakten. Årsmedeltemperaturen i trakten är 13 °C. Den varmaste månaden är juli, då medeltemperaturen är 24 °C, och den kallaste är december, med 2 °C. Genomsnittlig årsnederbörd är 627 millimeter. Den regnigaste månaden är november, med i genomsnitt 102 mm nederbörd, och den torraste är december, med 28 mm nederbörd."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9F%D1%80%D0%B8%D0%BA%D0%BE%D0%B2%D1%86%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/%D0%A3%D1%87%D0%B8%D0%BB%D0%B8%D1%88%D1%82%D0%B5%D1%82%D0%BE_%D0%B2%D0%BE_%D0%9F%D1%80%D0%B8%D0%BA%D0%BE%D0%B2%D1%86%D0%B8.jpg","page_title":"Приковци","context_page_description":"Приковци — село во Општина Кратово, во околината на градот Кратово."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%BF%9F%E5%8D%97%E5%9F%BA%E7%9D%A3%E9%95%B7%E8%80%81%E6%95%99%E6%9C%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Jinan_Church%2C_Presbyterian_Church_in_Taiwan_plates_20060424.jpg","page_title":"濟南基督長老教會","context_page_description":"台灣基督長老教會濟南教會，原名臺北幸町教會，於1916年落成在臺北市幸町，設計者井手薰。\\n教堂因為其宗教性，其特色與井手薰其他作品略有不同。外觀方面，井手薰採用哥德式建築的小尖塔、塔樓，誇張線條設計，石雕百葉窗。其中唭哩岸石所砌成的拱門，尤為特色。不過在另一方面，用清水磚刻意造成的紅磚裸露與仍由唭哩岸石搭配的丁掛外表，則又較為接近英國維多利亞時期的磚造小教堂風格。除此，接連於該教堂後方的主日學教室，也一併採磚造的歐風平房建築。另外，該教堂坐東朝西，西側仍配置基督新教教堂特有的幾何型玻璃裝飾，內部採鋼骨挑高骨架，將木樑架在鋼骨衍架上，且在屋頂舖設原木木板與瓦片，呈現了空曠且莊嚴的傳道會場。"},{"page_url":"https://en.wikipedia.org/wiki/St_Mary_the_Virgin,_Wheatley","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/St_Mary%27s_Church_and_graveyard.jpg","page_title":"St Mary the Virgin, Wheatley","context_page_description":"The Church of St Mary the Virgin is a parish church in Wheatley, Oxfordshire, in the Church of England Diocese of Oxford.\\nThe church was designed by George Edmund Street and built in 1855–57 in the Gothic Revival style. It is listed at Grade II*.\\nA past vicar of the church was the Reverend Hubert Brasier, father of former British Prime Minister Theresa May, who was married at the church.\\nThe churchyard contains three Commonwealth war graves, of a Wiltshire Regiment soldier of World War I, and a Royal Navy sailor and Oxfordshire and Buckinghamshire Light Infantry soldier of World War II."},{"page_url":"https://cs.wikipedia.org/wiki/Papowo_Biskupie","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Kostnica_-_Papowo_Biskupie.JPG","page_title":"Papowo Biskupie","context_page_description":"Papowo Biskupie je vesnice v Polsku v kujavsko-pomořském vojvodství. Leží asi 17 kilometrů jihovýchodně od Chelmna a 25 km severně od Toruně. Rozloha vesnice je 3,17 km². SPZ: CCH."},{"page_url":"https://fr.wikipedia.org/wiki/Miehlen","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/22/Haus_Schinderhannes_Miehlen_2010.jpg","page_title":"Miehlen","context_page_description":"Miehlen est une municipalité du Verbandsgemeinde Nastätten, dans l'arrondissement de Rhin-Lahn, en Rhénanie-Palatinat, dans l'ouest de l'Allemagne."},{"page_url":"https://de.wikipedia.org/wiki/Graham_Wardle","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Graham_Wardle_2013.jpg","page_title":"Graham Wardle","context_page_description":"Graham Wardle ist ein kanadischer Schauspieler, Filmemacher und Fotograf. Zu großer Bekanntheit kam Graham Wardle durch die Serie Heartland – Paradies für Pferde."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8D%B0%EB%B2%A4%ED%84%B0%EB%A5%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/IJsselkade_Deventer_2011.jpg","page_title":"데벤터르","context_page_description":"데벤터르는 네덜란드 동부 오버레이설주에 위치한 도시로 면적은 134.33km², 높이는 9m, 인구는 99,577명, 인구 밀도는 759명/km²이다. 도시의 대부분은 에이설 강의 동안에 자리잡고 있고, 약간은 서안에 걸쳐 있다. 매년 8월 첫째주 일요일에 유랍 최대의 책장터가 열린다\\n중세 시대에는 한자 동맹 가맹 도시로 남아 있었다. 시내에는 오랜 역사를 자랑하는 유적지가 남아 있다. 특히 1560년에 건립된 데벤터르 과학 도서관은 네덜란드에서 오랜 역사를 갖고 있는 과학 도서관이다."},{"page_url":"https://sv.wikipedia.org/wiki/Mercer_Bay","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Location_map_South_Georgia.png","page_title":"Mercer Bay","context_page_description":"Mercer Bay kan syfta på följande platser:"},{"page_url":"https://en.wikipedia.org/wiki/Lil%27_Mo_discography","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/LilMoOct05.jpg","page_title":"Lil' Mo discography","context_page_description":"The discography of American R&B singer-songwriter Lil' Mo consists of five studio albums, two mixtapes and fourteen singles.\\nBased on a True Story is Mo's debut album, released on June 26, 2001. It peaked at number 14 on the US Billboard 200 albums chart and attained a gold certification from the RIAA. It featured a total of four charting singles: \\"5 Minutes\\", \\"Ta Da\\", \\"Superwoman Pt. II\\", and \\"Gangsta\\".\\nIn 2002, Lil' Mo received her first ASCAP Rhythm & Soul Award, BMI Urban Music Award and BMI Pop Music Award for her contribution to Ja Rule's hit single \\"Put It on Me\\".\\nOn April 29, 2003, Mo released her second album, Meet the Girl Next Door, which was led by the hit single, \\"4Ever\\". In 2003, Lil' Mo received two ASCAP Rhythm & Soul Music Awards for \\"Award-Winning R&B/Hip-Hop Songs\\" and \\"Award-Winning Rap Songs\\" for her contribution to Fabolous' single, \\"Can't Let You Go\\". The following year, Mo received the ASCAP Pop Music Award for her work on \\"Can't Let You Go\\". In 2007 and 2011, Lil' Mo released her follow-up studio efforts, Pain & Paper and P.S. I Love Me respectively."},{"page_url":"https://cs.wikipedia.org/wiki/V%C3%A1clav_Oukropec","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/V%C3%A1clav_Oukropec_as_bakery_worker.jpg","page_title":"Václav Oukropec","context_page_description":"Václav Oukropec byl český dělnický básník."},{"page_url":"https://eo.wikipedia.org/wiki/El_Lim%C3%B3n_(Venezuelo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Escudo_Mario_Brice%C3%B1o_Iragorri.PNG","page_title":"El Limón (Venezuelo)","context_page_description":"El Limón estas urbego kaj signifa universitata urbo en subŝtato Aragua en norda Venezuelo. La urbego apartenas al urbaro de Marakajo."},{"page_url":"https://en.wikipedia.org/wiki/Myrrha","image_url":"http://upload.wikimedia.org/wikipedia/en/1/15/Myrrha%27s_flight.jpg","page_title":"Myrrha","context_page_description":"Myrrha, also known as Smyrna, is the mother of Adonis in Greek mythology. She was transformed into a myrrh tree after having had intercourse with her father, and gave birth to Adonis in tree form. Although the tale of Adonis has Semitic roots, it is uncertain from where the myth of Myrrha emerged, though it was likely from Cyprus.\\nThe myth details the incestuous relationship between Myrrha and her father, Cinyras. Myrrha falls in love with her father and tricks him into sexual intercourse. After discovering her identity, Cinyras draws his sword and pursues Myrrha. She flees across Arabia and, after nine months, turns to the gods for help. They take pity on her and transform her into a myrrh tree. While in plant form, Myrrha gives birth to Adonis. According to legend, the aromatic exudings of the myrrh tree are Myrrha's tears.\\nThe most familiar form of the myth was recounted in the Metamorphoses of Ovid, and the story was the subject of the most famous work of the poet Helvius Cinna."},{"page_url":"https://is.wikipedia.org/wiki/Yellowstone-%C3%BEj%C3%B3%C3%B0gar%C3%B0urinn","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/ElkYNP.jpg","page_title":"Yellowstone-þjóðgarðurinn","context_page_description":"Yellowstone-þjóðgarðurinn eða einfaldlega Yellowstone er þjóðgarður í Bandaríkjunum, staðsettur að mestu í Wyoming, en einnig að hluta í Idaho og Montana.\\nYellowstone er fyrsti og elsti þjóðgarður heims, stofnaður árið 1872. Upphaf skipulegrar náttúruverndar má rekja til hans. Yellowstone er á svokölluðum heitum reit, enda eru þar heitir hverir, eins og Old Faithful, sem er einn af frægustu goshverum heims. Einnig er þar gríðarstór eldfjallaaskja.\\nÁrið 1988 urðu þar miklir skógareldar þar sem yfir 3000 ferkílómetrar lands urðu fyrir áhrifum þeirra.\\nÁrið 1995 voru úlfar fluttir til Yellowstone en þeim hafði verið útrýmt þar á þriðja áratug 20. aldar. Breytingar urðu á gróðurfari í kjölfarið og uxu ösp og víðir í meira mæli þar sem úlfar höfðu áhrif á staðsetningu grasbíta sem nörtuðu áður í trén."},{"page_url":"https://fr.wikipedia.org/wiki/M%C3%A9diation_urbaine","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Agent_de_m%C3%A9diation_urbaine_%C3%A0_Fort-de-France_%28Martinique%29.jpg","page_title":"Médiation urbaine","context_page_description":"Un titre de technicien médiation services de niveau IV a été créé. Le texte a été publié dans le Journal officiel n°180 du 5 août 2004."},{"page_url":"https://sv.wikipedia.org/wiki/Protoplanet%C3%A4r_skiva","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/M42proplyds.jpg","page_title":"Protoplanetär skiva","context_page_description":"En protoplanetär skiva, eller proplyd, är en roterande cirkumstellär skiva med tät gas som omger en mycket ung stjärna, en T-Tauri-stjärna eller Herbig-Ae/Be-stjärna. Den protoplanetära skivan kan anses vara en ackretionsskiva, eftersom materia kan falla ner från de inre delarna av skivan till stjärnans yta. Den processen bör dock inte blandas ihop med ackretionsprocessen som tros bilda själva planeterna.\\nProtoplanetära skivor runt T-Tauri-stjärnor skiljer sig från skivorna som omger den dominerande stjärnan i dubbelstjärnesystem genom storlek och temperatur. Protoplanetära skivor har radier upp emot 1000 AE och är tämligen kalla. Bara deras innersta delar når temperaturer över 1000 K. De är ofta associerade med så kallade Herbig-Haro-objekt och liknande fenomen.\\nProtostjärnor bildas normalt från molekylmoln som huvudsakligen består av molekylärt väte. När en del av ett molekylmoln når en kritisk storlek, massa, eller densitet, börjar den kollapsa av sin egen gravitation. När det kollapsande molnet, kallad en solnebulosa, blir tätare, börjar de slumpmässiga rörelser som fanns hos molekylerna i molnet jämna ut sig och övergå till riktningen för nebulosans nettorörelsemängdsmoment."},{"page_url":"https://es.wikipedia.org/wiki/Aut%C3%B3dromo_Parque_Provincia_del_Neuqu%C3%A9n","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Aut%C3%B3dromo_de_Centenario.jpg","page_title":"Autódromo Parque Provincia del Neuquén","context_page_description":"El Autódromo Parque Provincia del Neuquén, también conocido como Autódromo Parque Ciudad de Centenario está ubicado en la ciudad de Centenario, a escasos 15 km de la ciudad de Neuquén, capital de la provincia homónima, en Argentina. Se encuentra emplazado al oeste en una zona de mesetas y bardas, y se accede a través de una autopista sobre la ruta provincial Nº 7.\\nFue presentado el 25 de agosto de 2009 con una conferencia de prensa, en la que estuvieron presentes los pilotos Juan Manuel Silva y Norberto Fontana. Acto seguido realizaron los primero giros a este nuevo trazado con la modalidad de los showcars de TC2000 de los equipos oficiales Toyota y Honda."},{"page_url":"https://de.wikipedia.org/wiki/Montb%C3%A9liard","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Blason_ville_fr_historique_Montb%C3%A9liard_%281470%29.svg","page_title":"Montbéliard","context_page_description":"Montbéliard ist eine französische Stadt mit 25.395 Einwohnern im Département Doubs in der Region Bourgogne-Franche-Comté.\\nDer frühere deutsche Name „Mömpelgard“ beruht auf der 400-jährigen Zugehörigkeit zum weltlich-historischen Territorium des Hauses Württemberg."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%86%DB%8C%DA%A9%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Nikon_F_Black_Motor_Camera_50mm_Austin_Calhoon_Photograph.jpg","page_title":"نیکون","context_page_description":"نیکون سهامی عام و یا خالقا آچیق شیرکتدیر. بۇ شیرکت الکترونیک ساحه‌سینده فعالیّت گؤستریر. چالیشان ایشچی‌لرینین سایی‌سی ۲۵٬۷۲۹ نفر اوْلوب."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_beelden_in_Woerden","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Kanis_Kerkhof_Crucifix.JPG","page_title":"Lijst van beelden in Woerden","context_page_description":"Dit is een lijst van beelden in Woerden. Onder een beeld wordt hier verstaan elk driedimensionaal kunstwerk in de openbare ruimte van de Nederlandse gemeente Woerden, waarbij beeld wordt gebruikt als verzamelbegrip voor sculpturen, standbeelden, installaties, gedenktekens en overige beeldhouwwerken.\\nVoor een volledig overzicht van de beschikbare afbeeldingen zie: Beelden in Woerden op Wikimedia Commons."},{"page_url":"https://en.wikipedia.org/wiki/Mountain_velvetbreast","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Mountain_Velvetbreast_JCB.jpg","page_title":"Mountain velvetbreast","context_page_description":"The mountain velvetbreast is a species in the family Troochiidae, the family to which all hummingbirds belong. It is the only member of its genus and is found in the Andes, mostly between 2400 and 3500 m, of northwestern Venezuela, Columbia, Ecuador, and Peru. Its natural habitats are clearings and bushes at the edges of subtropical or tropical moist montane forests and heavily degraded forests."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8F%E3%83%AF%E3%82%A4%E7%8E%8B%E5%9B%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Liliuokalani.jpg","page_title":"ハワイ王国","context_page_description":"ハワイ王国は、1795年から1893年までハワイ諸島に存在した王国である。1893年にサンフォード・ドールなどアメリカ移民による革命でアメリカ合衆国の傀儡国家として名目上共和制のハワイ共和国となり、1898年にはハワイ準州として併合されて消滅した。"},{"page_url":"https://en.wikipedia.org/wiki/Grade_I_listed_buildings_in_East_Sussex","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/All_Saints_Church%2C_Eaton_Road%2C_Hove.jpg","page_title":"Grade I listed buildings in East Sussex","context_page_description":"There are over 9300 Grade I listed buildings in England. This page is a list of these buildings in the county of East Sussex."},{"page_url":"https://zh.wikipedia.org/zh-my/%E9%A6%99%E6%B8%AF%E7%A7%81%E4%BA%BA%E5%B1%8B%E8%8B%91%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Fleur_Pavilia.jpg","page_title":"香港私人屋苑列表","context_page_description":"香港私人屋苑列表主要收录香港私人住宅；本列表只列出较具知名度的住宅楼宇组群。"},{"page_url":"https://id.wikipedia.org/wiki/Rodolfo_P._Hern%C3%A1ndez","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Rudy_Hernandez_2009_crop.jpg","page_title":"Rodolfo P. Hernández","context_page_description":"Rodolfo Pérez \\"Rudy\\" Hernández adalah seorang prajurit Angkatan Darat Amerika Serikat. Ia meraih Medal of Honor — penghargaan militer tertinggi di Amerika Serikat — atas pengabdiannya pada 31 Mei 1951, dalam serangan balasan PBB Mei–Juni 1951 pada Perang Korea."},{"page_url":"https://pl.wikipedia.org/wiki/You%E2%80%99ll_See","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Madonna_you%27ll_see_logo.png","page_title":"You’ll See","context_page_description":"You'll See – pierwszy singel z kompilacji najlepszych ballad Madonny pt. Something to Remember. Piosenka została napisana przez Davida Fostera znanego ze współpracy m.in z Céline Dion. Madonna nagrała także hiszpańskojęzyczną wersję tej piosenki zatytułowaną \\"Verás\\"."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D8%B9%D9%84%D8%A7%D9%85_%D8%A7%D9%84%D9%85%D8%B3%D9%8A%D8%AD%D9%8A%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Plaza_Virgen_de_los_Reyes%2C_Seville%2C_Spain_-_Sep_2009.jpg","page_title":"أعلام المسيحيين","context_page_description":"أعلام المسيحيين لقد برز المسيحيين في كل مراحل التاريخ، كما برعوا في كل المجالات العلمية والأدبية والثقافية:"},{"page_url":"https://sv.wikipedia.org/wiki/Lambert_Thiboust","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Lambert-Thiboust.jpeg","page_title":"Lambert Thiboust","context_page_description":"Lambert Thiboust, född den 25 oktober 1827 i Paris, död där den 10 juli 1867, var en fransk dramatisk författare.\\nThiboust var en kort tid skådespelare och författade i förening med dramatiker som Barrière, Duval och andra en lång rad stycken, varav en del uppnådde stora framgångar på scenen. Till dessa hör Les filles de marbre, Je dine chez ma mère, La fille du diable, Le secret de Miss Aurore, Les diables roses med flera."},{"page_url":"https://no.wikipedia.org/wiki/Ladbyskipet","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Ladbyskibet_gravhoej.jpg","page_title":"Ladbyskipet","context_page_description":"Ladbyskibet ligger i en gravhaug på en eng ved Ladby, ved kysten av Kerteminde fjord på Fyn i Danmark. Skipet ble funnet i 1935 og er Danmarks eneste bevarte skipsbegravelse fra vikingtiden. Hele utstillingen rundt skipet er bygget slik at det ligger i den opprinnelige gravhaugen. Man vet ikke hvem som ble begravet i haugen."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A6%AC%ED%8B%80_%EB%B9%85_%ED%83%80%EC%9A%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/LittleBigTown.JPG","page_title":"리틀 빅 타운","context_page_description":"리틀 빅 타운는 미국의 컨트리 보컬 그룹이다. 1998년 결성되었으며 결성부터 현재까지 초창기 멤버 그대로 활동 중이다. 네 명 모두 리드 싱어이다."},{"page_url":"https://en.wikipedia.org/wiki/Francesco_Borromini","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/CHF100_6_front_horizontal.png","page_title":"Francesco Borromini","context_page_description":"Francesco Borromini, byname of Francesco Castelli, was an Italian architect born in the modern Swiss canton of Ticino who, with his contemporaries Gian Lorenzo Bernini and Pietro da Cortona, was a leading figure in the emergence of Roman Baroque architecture.\\nA keen student of the architecture of Michelangelo and the ruins of Antiquity, Borromini developed an inventive and distinctive, if somewhat idiosyncratic, architecture employing manipulations of Classical architectural forms, geometrical rationales in his plans and symbolic meanings in his buildings. He seems to have had a sound understanding of structures, which perhaps Bernini and Cortona, who were principally trained in other areas of the visual arts, lacked. His soft lead drawings are particularly distinctive. He appears to have been a self-taught scholar, amassing a large library by the end of his life.\\nHis career was constrained by his personality. Unlike Bernini who easily adopted the mantle of the charming courtier in his pursuit of important commissions, Borromini was both melancholic and quick in temper which resulted in him withdrawing from certain jobs, and his death was by suicide."},{"page_url":"https://hsb.wikipedia.org/wiki/Kicman","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Kitsman_herb.png","page_title":"Kicman","context_page_description":"Kicman je městačko w oblasći Černiwci na zapadnej Ukrainje. Leži w historiskej Bukowinje něhdźe 20 kilometrow sewjerozapadnje wot města Černiwci.\\nMa něhdźe šěsć tysac wobydlerjow.\\nSydlišćo je so w lěće 1413 prěni raz naspomniło. Wot lěta 1798 měšćanske prawa. Wot lěta 1775 słušeše Kicman k rakuskemu krajej Bukowina. Po Prěnjej swětowej wójnje přeńdźe do Rumunskeje a wot kónca Druheje swětoweje wójny je dźěl Ukrainy."},{"page_url":"https://en.wikipedia.org/wiki/Vehicle_registration_plates_of_Tennessee","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/1951_Tennessee_license_plate.jpg","page_title":"Vehicle registration plates of Tennessee","context_page_description":"The U.S. state of Tennessee first required its residents to register their motor vehicles in 1905. Registrants provided their own license plates for display until 1915, when the state began to issue plates.\\nPlates are currently issued by the Vehicle Services Division of the Tennessee Department of Revenue. Only rear plates have been required since 1977."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A1%D1%8C%D0%BF%D1%96%D1%81_%D1%81%D1%83%D0%B4%D0%B7%D1%96%D0%BD%D0%BA%D0%B0%D0%B2%D1%8B%D1%85_%D1%80%D0%B0%D1%81%D1%8C%D0%BB%D1%96%D0%BD_%D0%91%D0%B5%D0%BB%D0%B0%D1%80%D1%83%D1%81%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Ranunculus_acris_new.jpg","page_title":"Сьпіс судзінкавых расьлін Беларусі","context_page_description":"Сьпіс судзінкавых расьлін Беларусі зьмяшчае пералік з 1358 відаў, зарэгістраваных на тэрыторыі Беларусі. Табліцы не зьмяшчаюць культурныя і выпадковыя іншародныя віды расьлін. Сьпіс налічвае 43 віды судзінкавых споравых, 4 віды голанасенных і 1311 відаў кветкавых расьлін. Від Alisma praecox, адкрыты ў 2013 годзе, можа быць адзіным эндэмікам для Беларусі, аднак неабходны пошук расьліны ў Украіне."},{"page_url":"https://nl.wikipedia.org/wiki/Ch%C3%A9rifien-rijk","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Saadiens-1591.png","page_title":"Chérifien-rijk","context_page_description":"Het Sjerifisch Rijk is een historische benaming van Marokko die tussen de 16e en 20e eeuw gebruikt is voor het land onder de heerschappij van respectievelijk de Saadidynastie en vervolgens van de Alaouidynastie. Beide dynastieën beweerden van sjariefische afkomst te zijn.\\nTot 1912 was het een multi-etnisch en multi-confessioneel rijk met wisselende grenzen, onder een bewind dat zijn legitimiteit ontleende aan een mix van theocratie en militaire macht. Het rijk werd langzaam ingekapseld door de komst van Europese machten in de 19e eeuw. Frankrijk had het naburige Algerije gekoloniseerd, en strekte zijn invloed westwaarts uit. Met de ondertekening van het protectoraatverdrag door de Alawitische sultan Moulay Abdelhafid op 30 maart 1912 in Fez werd het rijk een protectoraat, voor het grootste deel van Frankrijk, het noorden van Spanje.\\nDe naam raakte kort na het einde van het Franse protectoraat in onbruik. Op het niveau van het officiële bulletin wordt de naam \\"Chérifien Rijk\\" voor de laatste keer gebruikt in de kop van nummer 2352 van 22 november 1957 en wordt vervangen door \\"Koninkrijk Marokko\\" in de kop van nummer 2353 van 29 november 1957 en volgende."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A8%D0%BB%D0%B5%D0%BF%D1%86%D0%B8%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Schlepzig_church.jpg","page_title":"Шлепциг","context_page_description":"Шлепциг — општина во округот Даме-Шпревалд, во Бранденбург, Германија."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%81%96%E7%91%AA%E7%88%BE%E5%AE%9A%E7%AF%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Martinigansl_mit_Rotkraut_und_Serviettenkn%C3%B6del.jpg","page_title":"聖瑪爾定節","context_page_description":"圣玛尔定节也译为圣马田日，是每年11月11日，为庆祝天主教圣人玛尔定的庆日而举办的宗教传统节日。主要是在欧洲庆祝，虽然是天主教的圣人庆日，但由于重要宗教改革家马丁·路德是在该日受洗，因此德国基督新教团体也会以大同小异的方式庆祝该节日。"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Pla%E1%B8%B1%C3%A9_(Ohrid)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/%D0%9F%D0%BE%D0%B3%D0%BB%D0%B5%D0%B4_%D0%BD%D0%B0_%D0%9F%D0%BB%D0%B0%D1%9C%D0%B5.jpg","page_title":"Plaḱé (Ohrid)","context_page_description":"Plaḱé sī Macedonia Ohrid chū-tī-thé ê chi̍t ê hiuⁿ-siā.\\nChe sī chi̍t phiⁿ koan-î Macedonia tē-lí ê phí-á-kiáⁿ. Chhiáⁿ tàu khok-chhiong."},{"page_url":"https://no.wikipedia.org/wiki/Adlikon_bei_Andelfingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/2011-09-10-Vinlando_%28Foto_Dietrich_Michael_Weidmann%29_064.JPG","page_title":"Adlikon bei Andelfingen","context_page_description":"Adlikon bei Andelfingen er en kommune i distriktet Andelfingen i kantonen Zürich. Kommunen har 579 innbyggere.\\nAdlikon ble først nevnt i 1255 som Adilinkon. Kommunen ligger sør for elven Thur."},{"page_url":"https://en.wikipedia.org/wiki/Power_canal","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Queenston-Chippawa_power_canal_-a.jpg","page_title":"Power canal","context_page_description":"A Power Canal refers to a canal used for hydraulic power generation, rather than for transport of watercraft. The power canal was a major factor in the Industrial revolution in New England in the 19th century. Most early power canals were mill races used mechanically to transfer power directly from falling water to machinery in mill buildings. Later, the hydraulic power generated electricity locally for the same mill factories. These power canals were often filled in as electricity replaced the need for local water power, and road transport needs or city expansion needs reclaimed the land. Some hydraulic power canals were transformed into local electric generators, but most were closed. Remains of power canals can be seen in old mill towns and are often protected as historical structures today."},{"page_url":"https://en.wikipedia.org/wiki/Bratislava_Castle","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Pozsinycivertan%C3%A9egi2.jpg","page_title":"Bratislava Castle","context_page_description":"Bratislava Castle is the main castle of Bratislava, the capital of Slovakia. The massive rectangular building with four corner towers stands on an isolated rocky hill of the Little Carpathians directly above the Danube river in the middle of Bratislava. Because of its size and location, it has been a dominant feature of the city for centuries.\\nThe location provides excellent views of Bratislava, Austria and, in clear weather, parts of Hungary. Many legends are connected with the history of the castle."},{"page_url":"https://da.wikipedia.org/wiki/V%C3%A1clav_Havel","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/N%C3%A1rodn%C3%AD_t%C5%99%C3%ADda_%282010%29.jpg","page_title":"Václav Havel","context_page_description":"Václav Havel var en tjekkisk forfatter, dramatiker og politiker."},{"page_url":"https://da.wikipedia.org/wiki/Skrufs_glasbruk","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Skrufs_glasbruk-2012-07-13.jpg","page_title":"Skrufs glasbruk","context_page_description":"Skrufs glasbruk er et glasværk i Skruv i Lessebo kommune, Kronobergs län i Småland i Sverige.\\nSkruf glasværk, der er grundlagt i 1897, ligger i det område af Småland, der kaldes Glasriget. Produktionen har først og fremmest bestået af service- og pynteglas i kali- og helkrystalmasse. Glasbruket havde i 1978 omkring 100 ansatte.\\nGlasbruket blev nedlagt i 1981, men blev overtaget af fire glasarbejdere, der driver bruket videre i håndværksmæssige former."},{"page_url":"https://ca.wikipedia.org/wiki/Alexandre_Dubuque","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Alexandre_Dubuque.jpg","page_title":"Alexandre Dubuque","context_page_description":"Alexandre Dubuque fou un pianista, compositor i mestre rus d'origen francès."},{"page_url":"https://ga.wikipedia.org/wiki/Dionne_Warwick","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Optreden_van_de_Amerikaanse_zangeres_Dionne_Warwick%2C_Bestanddeelnr_919-6271.jpg","page_title":"Dionne Warwick","context_page_description":"Amhránaí Meiriceánach is ea Marie Dionne Warwick a rugadh ar an 12 Nollaig, 1940 in Orange, Nua-Gheirsí.\\nIs síol ceoil é an t-alt seo. Cuir leis, chun cuidiú leis an Vicipéid.\\nMá tá alt níos forbartha le fáil i dteanga eile, is féidir leat aistriúchán Gaeilge a dhéanamh."},{"page_url":"https://fr.wikipedia.org/wiki/Xiangqi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Xiangqi-_ra.PNG","page_title":"Xiangqi","context_page_description":"Le xiangqi, aussi appelé « échecs chinois », est un jeu de société combinatoire abstrait qui se joue sur un tableau rectangulaire de 9 lignes de large sur 10 lignes de long. Le jeu est également connu au Japon sous le nom de kawanakajima shōgi.\\nCe jeu se joue avec 16 pièces par joueur qui sont placées sur les intersections des lignes. Les deux camps sont le rouge et le noir. Une rivière, qui limite aussi les déplacements autorisés de certaines pièces, sépare les deux camps sur le plateau où figure aussi la position de chaque palais."},{"page_url":"https://ca.wikipedia.org/wiki/Manuscrit_il%C2%B7luminat","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Monk_sneaking_a_drink.jpg","page_title":"Manuscrit il·luminat","context_page_description":"Un manuscrit il·luminat o il·lustrat és un manuscrit que presenta un text ornamentat amb caplletres decorades, sanefes i miniatures. En la definició més estricta del terme, es tracta únicament d'aquelles obres escrites a mà que han estat decorades amb or o plata. No obstant això, en l'actualitat, aquesta designació és més àmplia i s'aplica a qualsevol obra escrita a mà que inclogui il·lustracions o motius ornamentals de les tradicions occidental i islàmica. Els manuscrits il·lustrats més antics que encara perduren daten dels anys 400-600 dC i provenen d'Irlanda, Itàlia, Espanya i d'altres punts del continent europeu."},{"page_url":"https://vec.wikipedia.org/wiki/Viger","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/%C3%89glise_Saint-Martin_de_Viger_%28Hautes-Pyr%C3%A9n%C3%A9es%29_1.jpg","page_title":"Viger","context_page_description":"Viger el xé on comun de 140 abitanti del departemento de Hautes-Pyrénées che el fa parte del rejon Ositània in Fransa."},{"page_url":"https://id.wikipedia.org/wiki/Pantai_Angsana","image_url":"https://upload.wikimedia.org/wikipedia/id/8/87/PesisirBaratPantaiAngsana.jpeg","page_title":"Pantai Angsana","context_page_description":"Pantai Angsana adalah sebuah tempat pariwisata yang terletak di kecamatan Angsana Tanah Bumbu, Kabupaten Tanah Bumbu yang bisa ditempuh dengan waktu kurang lebih 5 jam perjalanan darat dari kota Banjarmasin. Tepatnya berada di belakang lokasi perkebunan kelapa sawit. Daerah ini merupakan sebuah tujuan wisata yang tergolong masih baru namun saat ini sudah mulai dikembangkan oleh pemerintah setempat dan semakin ramai dikunjungi oleh wisatawan lokal.\\nPantai ini sangat bersih dan terhitung masih perawan serta belum begitu diketahui oleh wisatawan lokal terutama dari luar Kalimantan Selatan. Salah satu objek wisata yang menarik dari pantai ini adalah snorkeling dan selam scuba seperti di pantai Bunaken atau Raja Ampat dimana kita bisa melihat keindahan terumbu karang yang terletak tidak jauh dari lepas pantai ini menjadikannya objek wisata yang wajib masuk dalam daftar tempat wisata di Kalimantan Selatan.\\nDi pantai ini sudah cukup banyak fasilitas pendukung seperti penginapan maupun hotel-hotel kecil di sekitarnya. Saat ini, pemerintah setempat tidak mengenakan pungutan atau retribusi apapun kepada para pengunjung pantai ini."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_de_Sant_Boi_de_Llu%C3%A7an%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/050_Cal_Sol%C3%A0%2C_pl._Verge_dels_Munts_12_%28Sant_Boi_de_Llu%C3%A7an%C3%A8s%29.jpg","page_title":"Llista de monuments de Sant Boi de Lluçanès","context_page_description":"Llista de monuments de Sant Boi de Lluçanès inclosos en l'Inventari del Patrimoni Arquitectònic Català pel municipi de Sant Boi de Lluçanès. Inclou els inscrits en el Registre de Béns Culturals d'Interès Nacional amb la classificació de monuments històrics, els béns culturals d'interès local de caràcter immoble i la resta de béns arquitectònics integrants del patrimoni cultural català.\\nLa Capella de Santa Margarida de Vilaltella està entre els termes de Perafita i Sant Boi, vegeu la llista de monuments de Perafita."},{"page_url":"https://et.wikipedia.org/wiki/Bulgaaria_linnade_loend","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Vratsa001.png","page_title":"Bulgaaria linnade loend","context_page_description":"See on Bulgaaria linnade terviklik loend, mis on vaikimisi sorteeritud rahvaarvu järgi. Bulgaarias on kokku 257 linna. Piirkonnakeskused on paksus kirjas. Arvandmete algallikaiks on Bulgaaria Riiklik Statistikainstituut ja Bulgaaria Teaduste Akadeemia.\\nBulgaaria suurim linn on Sofia umbes 1,2 miljoni elanikuga, väikseim Melnik umbes 300 elanikuga. Väiksematest linnadest on aga päris mitmed külad suuremad. Suurima rahvaarvuga Bulgaaria küla on Lozen, kus elab umbes 5000 elanikku."},{"page_url":"https://ca.wikipedia.org/wiki/Il_crociato_in_Egitto","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/MeyerbeerCrociatoActIIScene4%281824%29.jpg","page_title":"Il crociato in Egitto","context_page_description":"Il crociato in Egitto és una òpera en dos actes composta per Giacomo Meyerbeer, sobre un llibret de Gaetano Rossi. S'estrenà al Teatre La Fenice de Venècia el 7 de març de 1824.\\nÉs l'última òpera italiana d'un compositor que era alemany i que poc després seria aclamat a França com el creador d'un nou gènere, la grand opéra. És una obra que presenta un desplegament inusual de forces orquestrals i corals. És la primera òpera de Meyerbeer que se centra en un conflicte interreligiós, un tema sempre present en les seves grands-opéras. A més de ser el primer èxit internacional del seu autor, marca la frontera entre una vella i una nova era de l'òpera seriosa i l'òpera romàntica, entre Itàlia i França, entre Rossini i la generació de compositors d'òpera italians que el van succeir."},{"page_url":"https://it.wikipedia.org/wiki/Palazzo_del_Banco_di_Napoli_(Potenza)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Banco_di_napoli_pz.jpg","page_title":"Palazzo del Banco di Napoli (Potenza)","context_page_description":"Il Palazzo del Banco di Napoli è un edificio storico di Potenza situato nel centro della città, in corso XVIII Agosto."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%85%AC%E6%B5%B7%E8%88%B0%E9%98%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Bundesarchiv_Bild_134-C1743%2C_Alfred_von_Tirpitz.jpg","page_title":"公海舰队","context_page_description":"公海舰队是德意志帝国海军的一支主力舰队，参与过第一次世界大战，该舰队始于1907年2月，由德意志帝国本土舰队改名而来。公海舰队由海军上将阿尔弗雷德·冯·提尔皮茨一手打造，他将其建设为一支足以挑战英国皇家海军海上霸权的舰队。德皇威廉二世积极拥护公海舰队，将其视为德国攫取海外殖民地、晋升全球强权的利器。提尔皮茨建军的核心思想为“风险理论”，相对于海军兵力分散于帝国各处的皇家海军，他相信，在北海集结强大的战斗舰队，将能够与英国形成均势对峙，足以严重破坏英国的海上霸权。他也相信，要是英国将德国舰队视为重大威胁，必定会避免与德国发生冲突。\\n公海舰队主要由战列舰编组而成，一般为8艘舰艇组成分舰队，亦有少数如第1侦查集群的特别编制。1907年创建时，公海舰队仅有2支分舰队，在1914年时额外增加了3个分舰队。1906年的无畏舰革命极大地影响了公海舰队的组成，编制中的24艘前无畏舰都沦为过时产物、需要汰换。到了1914年中第一次世界大战爆发时，公海舰队才有了两支满编的无畏舰分舰队。8艘最现代化的前无畏舰编为第3分舰队。尽管战争结束后立即解编，仍有两支额外的分舰队在战争爆发时执行了动员。\\n第一次世界大战爆发后，公海舰队于北海多次出击，意在引出英国大舰队的部分落单船舰，进而实施歼灭。这类引诱作战多半由第1侦查集群执行，尤其是集群中航行速度较快的战列巡洋舰群。引诱作战的结果促成了1916年5月31日至6月1日的日德兰海战，然而，与德国计划不同的是，公海舰队遭遇了整支大舰队。日德兰海战的结果不具决定性，却让英国取得了战略优势，进而说服了德国舰队司令——赖因哈德·舍尔上将：尽管舰队决战获得重大战术优势，却无法让德国扭转战局。此后，舍尔与其他海军高层一同向德皇建议改采无限制潜艇战。在1917与1918年间，公海舰队的主要任务变成了确保北海的德国海军基地，使其可供U艇作战。尽管如此，公海舰队依旧于北海出击数次，还曾调派分舰队前往波罗的海对抗俄国波罗的海舰队。1918年11月，德国战败，协约国在斯卡帕湾拘留了整支公海舰队，然而就在1919年6月、《凡尔赛条约》签署前几天，德国海军士兵自行凿沉了舰队的大部分船舰。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%88%E3%83%BC%E3%83%9E%E3%82%B9%E3%83%BB%E3%83%8F%E3%82%A4%E3%83%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Thomas_Theodor_Heine_-_Der_nackte_Reichsadler%2C_1900.jpg","page_title":"トーマス・ハイネ","context_page_description":"トーマス・ハイネ、本名、ダーフィット・テオドール・ハイネは、ドイツ生まれのユダヤ系の画家、イラストレータである。\\"Th.Th.Heine\\"の名前で作品を発表することもあった。風刺漫画週刊誌「ジンプリチシムス」の風刺漫画家として活動した。ナチスの迫害から逃れるために最終的にスウェーデンに亡命した。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BB%D0%B0%D0%B3_%D0%A0%D0%BE%D0%B4%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Flag_of_Rodniki_%28Moscow_oblast%29.png","page_title":"Флаг Родников","context_page_description":"Флаг Роднико́в — официальный символ муниципального образования «Городское поселение Родники» Раменского муниципального района Московской области Российской Федерации.\\nФлаг утверждён 31 января 2008 года и внесён в Государственный геральдический регистр Российской Федерации под номером 3839.\\nФлаг муниципального образования городское поселение Родники составлен на основе герба городского поселения Родники по правилам и соответствующим традициям вексиллологии и отражает исторические, культурные, социально-экономические, национальные и иные местные традиции."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A4%D0%B8%D0%BD%D0%B8%D0%BA%D0%B8%D0%B9%D1%81%D0%BA%D0%BE_%D0%B8%D0%B7%D0%BA%D1%83%D1%81%D1%82%D0%B2%D0%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5b/Ingresso_cothon_Mozia_MOD.jpg","page_title":"Финикийско изкуство","context_page_description":"Финикийското изкуство е част от западносемитската културна традиция.\\nФиникийското изкуство се свързва с Леванта - днешните земи на Ливан, Западна Сирия, Киликия, Палестина и Израел, и в по-малка степен с островите и крайбрежието на и по Средиземноморието. Възникването и развитието му е в тясна връзка с презморската и не само морска търговия, като е силно повлияно от близките си и донякъде родствени контакти с асиро-вавилонската цивилизация, Древен Египет и Древна Гърция. Водената оживена търговия от финикийците в древността разпрострира финикийското влияние по четирите страни на древния свят.\\nИзкуството и културата на финикийците е близкородствена на тази на съседните им семитски общности – угаритски, сирийски, ханаански, израилтянски. Цивилизацията на финикийците и евреите в древността не се подчинява на стремеж към изграждане на единна и голяма централизирана държава подобно на източносемитския Акад, Вавилония, а и Асирия. Цялостното културно развитие на финикийските градове-държави, подобно на Израиля, е в противоречие на подобна идея."},{"page_url":"https://es.wikipedia.org/wiki/Estados_monta%C3%B1osos","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Detroit_Photographic_Company_%280326%29.jpg","page_title":"Estados montañosos","context_page_description":"Los Estados Montañosos forman una de las nueve divisiones geográficas de los Estados Unidos reconocidas oficialmente por la Oficina del Censo de los Estados Unidos. Es una subregion del Oeste de los Estados Unidos. Los Estados Montañosos se suelen dividir a su vez en otras dos regiones conocidas como el Noroeste y el Suroeste. Idaho, Wyoming y Montana están considerados parte del Noroeste, mientras Arizona, Colorado, Nevada, Nuevo México, y Utah están considerados parte del Suroeste.\\nLa división consta de siete estados: Arizona, Colorado, Idaho, Montana, Nevada, Nuevo México, y Utah. Estos siete estados tienen las elevaciones medias más altas de los 50 estados de EE.UU. Junto con los Estados del Pacífico de Alaska, California, Hawái, Oregón y Washington, los Estados Montañosos constituyen la región más amplia del Oeste, que es una de las cuatro regiones que reconoce formalmente la Oficina del Censo de los Estados Unidos. La palabra \\"Montañosos\\" hace referencia a las Montañas Rocosas, las cuales cruzan de norte a sur porciones de los estados de Montana, Idaho, Colorado, Utah, y Nuevo México."},{"page_url":"https://cs.wikipedia.org/wiki/La%C4%8Dnov_(rybn%C3%ADk)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Rybn%C3%ADk_La%C4%8Dnov_u_Z%C3%A1l%C5%A1%C3%AD_01.jpg","page_title":"Lačnov (rybník)","context_page_description":"Rybník Lačnov je velký rybník o rozloze vodní plochy 13,0 ha nalézající se v katastrálním území obce Zálší v okrese Ústí nad Orlicí. Rybník je nejlépe dosažitelný polní cestou odbočující ze silnice III. třídy č. 3176 vedoucí ze Zálší do vesnice Zaháj, místní části obce Tisová. Pod hrází rybníka se nalézá mlýn Betlém, chráněný jako kulturní památka."},{"page_url":"https://eu.wikipedia.org/wiki/Sirenoscincus_yamagishii","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Sirenoscincus_yamagishii.JPG","page_title":"Sirenoscincus yamagishii","context_page_description":"Sirenoscincus yamagishii Sirenoscincus generoko animalia da. Narrastien barruko Scincidae familian sailkatuta dago."},{"page_url":"https://es.wikipedia.org/wiki/Nautilus_pompilius","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Nautilus_pompilius.jpg","page_title":"Nautilus pompilius","context_page_description":"Nautilus pompilius es una especie de molusco cefalópodo de la familia Nautilidae; es la especie más conocida de nautilo. Su concha, al ser seccionada sagitalmente, revela una línea de nácar, y se dispone formando un espiral equiangular casi perfecto. Su distribución está restringida al área Indo-Pacífica.\\nPrincipalmente viven en zonas menos profundas que los otros cefalópodos, alimentándose de peces, crustáceos o carroña, comida que detecta principalmente a través del olfato. Pueden sobrevivir hasta 500 metros de profundidad pero suelen encontrarse más cerca de la superficie durante la noche. También se pueden encontrar rondando los arrecifes de coral del sur del Pacífico.\\nSe trata de una especie nocturna, que llega a vivir hasta 20 años, tiempo inusualmente largo para un cefalópodo."},{"page_url":"https://nl.wikipedia.org/wiki/Zwalm_(gemeente)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Roborst.jpg","page_title":"Zwalm (gemeente)","context_page_description":"Zwalm is een gemeente in de Belgische provincie Oost-Vlaanderen. De gemeente telt ruim 8.000 inwoners, die Zwalmenaars worden genoemd."},{"page_url":"https://en.wikipedia.org/wiki/Edward_Carson","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Northern_Ireland_Parliament_Buildings_-_Edward_Carson_statue.jpg","page_title":"Edward Carson","context_page_description":"Edward Henry Carson, Baron Carson, PC, PC, from 1900 to 1921 known as Sir Edward Carson, was an Irish unionist politician, barrister and judge. From 1905 Carson was both the Irish Unionist Alliance MP for Trinity College Dublin and leader of the Ulster Unionist Council in Belfast. In 1915 he entered the war cabinet of Herbert Asquith as Attorney-General. Carson was defeated in his ambition to maintain Ireland as a whole in union with Great Britain. His leadership, however, was celebrated for securing a continued place in the United Kingdom for the six north-east counties, albeit under a devolved Northern Ireland Parliament that neither he nor his fellow unionists had sought. He is also remembered for his open ended cross examination of Oscar Wilde in a legal action that Wilde had brought, but led to him being gaoled and ruined. Carson unsuccessfully attempted to intercede for Wilde after the case."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9A%D1%96%D1%80%D0%B0%D1%9E%D1%81%D0%BA%D1%96_(%D0%90%D1%81%D1%82%D1%80%D0%B0%D1%85%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%86%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/%D0%97%D0%B4%D0%B0%D0%BD%D0%B8%D0%B5_%D1%88%D0%BA%D0%BE%D0%BB%D1%8B_%D0%B2_%D0%BF%D0%BE%D1%81%D1%91%D0%BB%D0%BA%D0%B5_%D0%9A%D0%B8%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%90%D1%81%D1%82%D1%80%D0%B0%D1%85%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B9_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D0%B8.jpg","page_title":"Кіраўскі (Астраханская вобласць)","context_page_description":"Кіраўскі — пасёлак гарадскога тыпу ў Камызякскім раёне Астраханскай вобласці Расіі. Утварае муніцыпальнае ўтварэнне Пасёлак Кіраўскі са статусам гарадскога паселішча як адзіны населены пункт у яго складзе. Размешчаны ў паўднёвай частцы вобласці, за 55 км на поўдзень ад Астрахані, за 32 км ад Камызяк. Злучаны аўтадарогай з Астраханню. 12 снежня 1938 гады выйшаў Указ Прэзідыума Вярхоўнага Савета РСФСР аб утварэнні пасёлка Кіраўскі. У студзені 1939 года населены пункт пры рыбзаводы ім. С. М. Кірава Камызякскага раёна быў ператвораны ў Кіраўскі рабочы пасёлак і ў сакавіку створаны Кіраўскі пасялковы Савет."},{"page_url":"https://ga.wikipedia.org/wiki/An_Bearnas_M%C3%B3r","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Biddy%27s_Pub%2C_Barnes_Gap_-_geograph.org.uk_-_408560.jpg","page_title":"An Bearnas Mór","context_page_description":"Is mám sléibhe nó bearna é An Bearnas Mór atá suite ins Na Cruacha Gorma, Contae Dhún na nGall, Éire. Téann an príomh-bhóthar ó Bhealach Féich, an N15, agus iar-Iarnróid Chontae Dhún na nGall tríd an Bearnas Mór, a gníomhaíonn mar an bealach is mó idir tuaisceart agus deisceart Dhún na nGall."},{"page_url":"https://it.wikipedia.org/wiki/Little_Gaddesden","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Little_Gaddesden_-_Church_-_geograph.org.uk_-_82065.jpg","page_title":"Little Gaddesden","context_page_description":"Little Gaddesden è un villaggio e parrocchia civile dell'Inghilterra, appartenente alla contea dell'Hertfordshire."},{"page_url":"https://en.wikipedia.org/wiki/NGC_3198","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/NGC_3198_GALEX_WikiSky.jpg","page_title":"NGC 3198","context_page_description":"NGC 3198, also known as Herschel 146 is a barred spiral galaxy in the constellation Ursa Major. It was discovered by William Parsons, 3rd Earl of Rosse, sometime before 1850.\\nNGC 3198 is located in the Leo Spur, which is part of the Virgo Supercluster, and is approximately 47 million light years away."},{"page_url":"https://fi.wikipedia.org/wiki/Clemente_Biondetti","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/1938ClementeBiondetti.jpg","page_title":"Clemente Biondetti","context_page_description":"Clemente Biondetti oli italialainen moottoriurheilija. Hän menestyi erityisesti kestävyyskilpailuissa. Hän voitti Mille Miglian neljästi, vuonna 1938 sekä vuosina 1947-49, mikä on ennätys Mille Miglia -voittojen määrässä. Biondetti osallistui myös yhteen Formula 1 -kilpailuun, vuoden 1950 Italian Grand Prix'hin yksityisellä Ferrarilla. Biondetti keskeytti kilpailun 18. kierroksella moottorivikaan."},{"page_url":"https://ca.wikipedia.org/wiki/Alps","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Alpenrelief_01.jpg","page_title":"Alps","context_page_description":"Els Alps són una cadena de muntanyes situada a l'Europa central.\\nEl seu punt culminant és el Mont Blanc, amb 4.810 metres d'altitud. Al voltant dels Alps –afavorit per rius importants de cabal uniforme i riques terres de conreu– es va edificar la civilització europea que avui coneixem. Els Alps estan administrativament repartits entre quatre estats: França, Suïssa, Àustria i Itàlia, almenys pel que fa als grans massissos, ja que també Mònaco, Eslovènia, Alemanya i Liechtenstein tenen dintre de les seves fronteres alguns estreps de la serralada."},{"page_url":"https://de.wikipedia.org/wiki/Bargenstedt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Schleswig-Holstein%2C_Dellbr%C3%BCck%2C_H%C3%BCnengrab_NIK_1686.JPG","page_title":"Bargenstedt","context_page_description":"Bargenstedt ist eine Gemeinde im Kreis Dithmarschen in Schleswig-Holstein."},{"page_url":"https://ro.wikipedia.org/wiki/Rela%C8%9Biile_dintre_Republica_Moldova_%C8%99i_NATO","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/Masa_rotunda_dl_simmons_ii.jpg","page_title":"Relațiile dintre Republica Moldova și NATO","context_page_description":"Relațiile dintre Republica Moldova și Alianța Nord-Atlantică au fost stabilite după declararea independenței țării. La 20 decembrie 1991, la Bruxelles, a avut loc reuniunea Consiliului de Cooperare Nord-Atlantică, creat în urma hotărîrii reuniunii la nivel înalt a țărilor membre ale NATO de la Roma din 7-8 noiembrie 1991. Scopul creării CCNA a fost de a institui un organism permanent de consultări între adversarii de altă dată în problemele primordiale de securitate europeană. La prima reuniune CCNA a participat Ministrul Afacerilor Externe al Republicii Moldova, Moldova devenind astfel stat membru al acestui Consiliu."},{"page_url":"https://it.wikipedia.org/wiki/Ares_Vallis","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Ares_Valles.JPG","page_title":"Ares Vallis","context_page_description":"Ares Vallis è una valle situata sulla superficie di Marte, il suo nome deriva dal termine greco con cui si indica il dio della guerra. Si trova nell'emisfero boreale, a nord-est della formazione di Valles Marineris e collega la regione collinare di Margaritifer Terra con la pianura nota come Chryse Planitia."},{"page_url":"https://en.wikipedia.org/wiki/Collingwood_College,_Durham","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Lord_Henley.jpg","page_title":"Collingwood College, Durham","context_page_description":"Collingwood College is a college of Durham University in England. It is the second largest of Durham's undergraduate colleges with around 1100 students. Founded in 1972 as the first purpose-built, mixed-sex college in Durham, it is named after the mathematician Sir Edward Collingwood, who was a former Chair of the Council of Durham University."},{"page_url":"https://en.wikipedia.org/wiki/Hakea_rhombales","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Hakea_rhombales_foliage.jpg","page_title":"Hakea rhombales","context_page_description":"Hakea rhombales, commonly known as walukara, is a shrub in the family Proteacea. It has red, pink or purple flowers and is endemic to Western Australia and the Northern Territory."},{"page_url":"https://en.wikipedia.org/wiki/San_Giacomo,_Foligno","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Foligno103.jpg","page_title":"San Giacomo, Foligno","context_page_description":"San Giacomo is a Gothic-style, Roman Catholic church located at the Piazza San Giacomo, Foligno, Italy."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kirchen_im_Bistum_M%C3%BCnster","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Wesel_Mariae_Himmelfahrt_W_Portal_Langhaus_201809.jpg","page_title":"Liste der Kirchen im Bistum Münster","context_page_description":"Diese Liste der Kirchen im Bistum Münster listet die römisch-katholischen Kirchen und Kapellen im Bistum Münster auf."},{"page_url":"https://fr.wikipedia.org/wiki/Fieffes-Montrelet","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Montrelet_%C3%A9glise_1.jpg","page_title":"Fieffes-Montrelet","context_page_description":"Fieffes-Montrelet est une commune française située dans le département de la Somme, en région Hauts-de-France."},{"page_url":"https://nl.wikipedia.org/wiki/Olga_Jevkova","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/%D0%97%D0%BD%D0%B0%D0%BA_%D0%BC%D1%81%D0%BC%D0%BA_%D0%A1%D0%A1%D0%A1%D0%A0.jpg","page_title":"Olga Jevkova","context_page_description":"Olga Vladimirovna Jevkova, is een voormalig basketbalspeelster die uitkwam voor het nationale team van de Sovjet-Unie. Ze werd Meester in de sport van de Sovjet-Unie, Internationale Klasse."},{"page_url":"https://nl.wikipedia.org/wiki/Hever_(Kent)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Alfred_Vickers_%281810-1837%29_Het_dorp_Hever_-_Hever_Castle_8-05-2017_11-45-48.JPG","page_title":"Hever (Kent)","context_page_description":"Hever is een civil parish in het bestuurlijke gebied Sevenoaks, in het Engelse graafschap Kent met 1231 inwoners."},{"page_url":"https://az.wikipedia.org/wiki/Coreopsis_californica","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Coreopsiscalifornica-calif.jpg","page_title":"Coreopsis californica","context_page_description":"Coreopsis californica — mürəkkəbçiçəklilər fəsiləsinin koreopsis cinsinə aid biki növü."},{"page_url":"https://ca.wikipedia.org/wiki/Eleccions_presidencials_de_Sri_Lanka_de_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Mahinda_Rajapaksa.jpg","page_title":"Eleccions presidencials de Sri Lanka de 2015","context_page_description":"El 8 de gener de 2015 se celebraren eleccions presidencials de Sri Lanka, dos anys abans de la data que tocaria segons el calendari previst. El president en el càrrec, Mahinda Rajapaksa, fou el canditat de l'Aliança de la Llibertat del Poble Unit, cercant un tercer mandat. La coalició de l'oposició, liderada pel Partit Nacional Unit, escollí presentar Maithripala Sirisena, exministre de Sanitat del govern de Rajapaksa i secretari general del Partit de la Llibertat de Sri Lanka.\\nSirisena fou declarat guanyador després de rebre el 51,28% de tots els vots dipositats, davant del 47,58% per Rajapaksa. El resultat fou percebut, en general, com a sorprenent. Quan Rajapaksa convocà les eleccions el novembre de 2014 sembla que tenia clar que guanyaria. L'11 de gener del mateix any el nou govern anuncià una investigació especial davant de les al·legacions d'un cop intentat per Rajapaksa."},{"page_url":"https://en.wikipedia.org/wiki/University%E2%80%94Rosedale","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/University-Rosedale_in_relation_to_the_other_Toronto_ridings_%282015_boundaries%29.png","page_title":"University—Rosedale","context_page_description":"University—Rosedale is a federal electoral district in Ontario, Canada, that has been represented in the House of Commons of Canada since 2015."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B2%D9%88%D8%A7%D8%AC_%D8%A7%D9%84%D9%85%D8%AB%D9%84%D9%8A%D9%8A%D9%86_%D9%81%D9%8A_%D8%A7%D9%84%D8%A3%D8%B1%D8%AC%D9%86%D8%AA%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/State_recognition_of_same-sex_relationships_%28South_America%29.svg","page_title":"زواج المثليين في الأرجنتين","context_page_description":"أصبح زواج المثليين قانونيا في الأرجنتين منذ 22 يوليو 2010.\\nأصبحت الأرجنتين أول بلد في أمريكا اللاتينية، والثاني في الأمريكتين، والثاني في نصف الكرة الجنوبي الذي يسمح بزواج المثليين في جميع أنحاء البلاد. أصبحت البلد العاشرة في العالم التي تسمح بزواج المثليين.\\nأصبحت الاتحادات المدنية قانونية على الصعيد الوطني منذ عام 2015."},{"page_url":"https://ceb.wikipedia.org/wiki/Rhinella_boulengeri","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Rhinella_boulengeri_%282_-_upper_view%29.jpg","page_title":"Rhinella boulengeri","context_page_description":"Espesye sa baki ang Rhinella boulengeri. Una ning gihulagway ni Chaparro, Pramuk, Gluesenkamp ug Frost ni adtong 2007. Ang Rhinella boulengeri sakop sa kahenera nga Rhinella sa kabanay nga Bufonidae. Giklaseklase sa IUCN ang espesye sa kapos sa datos. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wappen_im_Landkreis_Altenburger_Land","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Wappen_Tegkwitz.png","page_title":"Liste der Wappen im Landkreis Altenburger Land","context_page_description":"Diese Liste erfasst alphabetisch geordnet die Wappen der Städte und Gemeinden des Landkreises Altenburger Land in Thüringen."},{"page_url":"https://gl.wikipedia.org/wiki/Paeoniaceae","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Paeonia_officinalis0.jpg","page_title":"Paeoniaceae","context_page_description":"As peoniáceas constitúen unha familia monoxenérica de plantas dicotoledóneas rizomatosas orixinarias de diversas rexións de Europa, Extremo Oriente e de América do Norte, usualmente chamadas de peonias.\\nPaeonia, o único xénero da familia, comporta unhas 40 especies aceptadas, das 170 descritas. Tamén están aceptados uns 20 taxons infra-específicos dos 230 descritos."},{"page_url":"https://cs.wikipedia.org/wiki/Lomnice_(okres_Brno-venkov)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Historick%C3%A1_lomnice.JPG","page_title":"Lomnice (okres Brno-venkov)","context_page_description":"Lomnice je městys v okrese Brno-venkov v Jihomoravském kraji. Rozkládá se na rozhraní Boskovické brázdy a Hornosvratecké vrchoviny, v přírodním parku Svratecká hornatina, přibližně 6 kilometrů severně od Tišnova. Žije zde přibližně 1 500 obyvatel. Nedaleko historického jádra městyse se nachází také bývalá židovská čtvrť."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Hot_C%26W_Sides_number_ones_of_1959","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/Marty_Robbins_1966.JPG","page_title":"List of Hot C&W Sides number ones of 1959","context_page_description":"Hot Country Songs is a chart that ranks the top-performing country music songs in the United States, published by Billboard magazine since 1958, when the magazine amalgamated its separate C&W Best Sellers in Stores and Most Played C&W by Jockeys charts. In 1959, eleven different songs topped the chart, then published under the title Hot C&W Sides, in 52 issues of the magazine, based on playlists submitted by country music radio stations and sales reports submitted by stores.\\nAt the start of the year the song at number one was \\"City Lights\\" by Ray Price. The song had been in the top spot since the issue of Billboard dated October 20, 1958, the first in which the magazine combined country sales and airplay into a single chart, and remained at number one until the issue dated January 19, 1959. Four artists achieved a number one country single for the first time in 1959: Johnny Horton with \\"When It's Springtime in Alaska\\", George Jones with \\"White Lightning\\", which replaced Horton's song at number one, Stonewall Jackson with \\"Waterloo\\", and the Browns with \\"The Three Bells\\"."},{"page_url":"https://eu.wikipedia.org/wiki/El_Pont_de_Suert","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/El_Pont_de_Suert.JPG","page_title":"El Pont de Suert","context_page_description":"El Pont de Suert Kataluniako udalerria da, Alta Ribagorça eskualdean eta Lleidako probintzian kokatua. Eskualdeko hiriburua da.\\n2009ko urtarrilaren 1eko erroldaren arabera 2.570 biztanle zituen. 148.14 km2-ko azalera du."},{"page_url":"https://nl.wikipedia.org/wiki/Micha%C3%ABl_VI_Stratiotikos","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Michael_VI_tetarteron_%28reverse%29.jpg","page_title":"Michaël VI Stratiotikos","context_page_description":"Michaël VI Stratiotikos was keizer van Byzantium van 1056 tot 1057.\\nIn 1056 stierf Theodora, de laatste telg van het Macedonische huis. Voor haar overlijden benoemde zij de man die de hofkringen graag op de troon wilden zien: iemand die alle ambtenaren een promotie zou geven, Michaël VI, die eerder minister van Oorlog was geweest. Hij wist spoedig het leger tegen zich in het harnas te jagen en in 1057 werd Isaäk Comnenus in Paphlagonië tot keizer uitgeroepen. Isaäk versloeg de snel slinkende keizerlijke troepen en Michaël liet zich naar een klooster sturen, waar hij nog twee jaar leefde."},{"page_url":"https://nl.wikipedia.org/wiki/Aleksandr_Basjminov","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Aleksandr_Bashminov_2011-03-19_%282%29.JPG","page_title":"Aleksandr Basjminov","context_page_description":"Aleksandr Vasiljevitsj Basjminov, is een voormalig professionele basketbalspeler die speelde voor het nationale team van Rusland. Hij heeft de medaille gekregen van Meester in de sport van Rusland."},{"page_url":"https://en.wikipedia.org/wiki/Church_of_the_Holy_Sepulchre,_Cambridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Cambridge%2C_the_round_church_03.JPG","page_title":"Church of the Holy Sepulchre, Cambridge","context_page_description":"The Church of the Holy Sepulchre, generally known as The Round Church, is an Anglican church in the city of Cambridge, England. It is located on the corner of Round Church Street and Bridge Street. Since 1950 the church has been designated a Grade I listed building, and is currently managed by Christian Heritage. It is one of the four medieval round churches still in use in England."},{"page_url":"https://de.wikipedia.org/wiki/Autoverleih_Pistulla","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Autoverleih_Pistulla_Logo.jpg","page_title":"Autoverleih Pistulla","context_page_description":"Autoverleih Pistulla ist eine Fernsehserie der ARD. Es werden Geschichten rund um einen Autoverleih und dessen Kunden erzählt. Die Ausstrahlung erfolgte 1975 im Vorabendprogramm des NDR."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%B1%CF%84%CE%AC%CE%BB%CE%BF%CE%B3%CE%BF%CF%82_%CE%AD%CF%81%CE%B3%CF%89%CE%BD_%CF%84%CE%BF%CF%85_%CE%9B%CE%BF%CF%81%CE%AD%CE%BD%CF%84%CF%83%CE%BF_%CE%93%CE%BA%CE%B9%CE%BC%CF%80%CE%AD%CF%81%CF%84%CE%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/08_Ges%C3%B9_cammina_sulle_acque_e_salva_Pietro.JPG","page_title":"Κατάλογος έργων του Λορέντσο Γκιμπέρτι","context_page_description":"Η σελίδα αυτή περιέχει εικονογραφημένο κατάλογο των έργων του Λορέντσο Γκιμπέρτι."},{"page_url":"https://de.wikipedia.org/wiki/Fatalismus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Strudwick-_A_Golden_Thread.JPG","page_title":"Fatalismus","context_page_description":"Als Fatalismus bezeichnet man eine Weltanschauung, der zufolge das Geschehen in Natur und Gesellschaft durch eine höhere Macht oder aufgrund logischer Notwendigkeit vorherbestimmt ist. Aus der Sicht von Fatalisten sind die Fügungen des Schicksals unausweichlich, der Wille des Menschen kann ihnen nichts entgegensetzen. Daraus ergibt sich aber nicht zwangsläufig die Folgerung, menschliche Entscheidungen und Handlungen seien bedeutungslos. Mit der Überzeugung vom eigenen Ausgeliefertsein verbindet sich im Fatalismus eine davon geprägte Gefühlslage und Lebenseinstellung, die „Schicksalsergebenheit“.\\nKennzeichnend für den Fatalismus ist die Annahme einer universell wirkenden Instanz oder einer logischen Zwangsläufigkeit, die den Geschichtsverlauf ebenso wie die individuellen Schicksale von vornherein festgelegt hat. Die bestimmende Instanz kann die Vorsehung einer Gottheit sein, die den Gang der Ereignisse von Anfang an geplant und arrangiert hat, oder eine unpersönliche Macht, die im Rahmen einer kosmischen Ordnung für einen bestimmten fixierten Ablauf sorgt. Eine alternative Begründung postuliert die Gleichsetzung des Möglichen mit dem Tatsächlichen als Erfordernis der Logik."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9C%9F%E5%BA%93%E6%9B%BC%E6%96%AF%E5%9D%A6%E9%A9%AC%E7%BA%B3%E7%89%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/TMT_2009_50t_yuz.jpg","page_title":"土库曼斯坦马纳特","context_page_description":"马纳特是土库曼的流通货币，于1993年10月1日由土库曼斯坦中央银行开始发行，以取代该国当时流通的俄罗斯卢布。首次发行时，对卢布的收兑比率为1土库曼马纳特=500卢布。辅币单位坚戈，1马纳特=100坚戈。有时会使用缩写“m”表示马纳特，如“25 000 m”就是25000马纳特。\\n土库曼斯坦马纳特原先的ISO 4217代码为“TMM”。2009年1月1日土库曼斯坦进行币改，虽未改变货币名称，但币值改变，1新马纳特=5000旧马纳特，马纳特的ISO 4217代码也因此变更为“TMT”。"},{"page_url":"https://en.wikipedia.org/wiki/Coronation_of_the_Russian_monarch","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Fireworks_1856.JPG","page_title":"Coronation of the Russian monarch","context_page_description":"Coronations in Russia involved a highly developed religious ceremony in which the Emperor of Russia was crowned and invested with regalia, then anointed with chrism and formally blessed by the church to commence his reign. Although rulers of Muscovy had been crowned prior to the reign of Ivan III, their coronation rituals assumed overt Byzantine overtones as the result of the influence of Ivan's wife Sophia Paleologue, and the imperial ambitions of his grandson, Ivan IV. The modern coronation, introducing \\"Western European-style\\" elements, replaced the previous \\"crowning\\" ceremony and was first used for Catherine I in 1724. Since czarist Russia claimed to be the \\"Third Rome\\" and the replacement of Byzantium as the true Christian state, the Russian rite was designed to link its rulers and prerogatives to those of the so-called \\"Second Rome\\".\\nWhile months or even years could pass between the initial accession of the sovereign and the performance of this ritual, church policy held that the monarch must be anointed and crowned according to the Orthodox rite to have a successful tenure."},{"page_url":"https://de.wikipedia.org/wiki/Distrikt_Casca","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Location_of_the_province_Mariscal_Luzuriaga_Ancash.PNG","page_title":"Distrikt Casca","context_page_description":"Der Distrikt Casca liegt in der Provinz Mariscal Luzuriaga in der Region Ancash in West-Peru. Der Distrikt wurde am gegründet. Er besitzt eine Fläche von 76 km². Beim Zensus 2017 wurden 4026 Einwohner gezählt. Im Jahr 1993 lag die Einwohnerzahl bei 4248, im Jahr 2007 bei 4301. Die Distriktverwaltung befindet sich in der 3132 m hoch gelegenen Ortschaft Casca mit 353 Einwohnern. Casca liegt 4,5 km westnordwestlich der Provinzhauptstadt Piscobamba."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BB%D1%8C%D0%BA%D0%B8%D0%BD%D0%B8_(%D0%BC%D1%83%D0%BD%D0%B8%D1%86%D0%B8%D0%BF%D0%B0%D0%BB%D0%B8%D1%82%D0%B5%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Iglesia_de_Calkin%C3%AD._-_panoramio.jpg","page_title":"Калькини (муниципалитет)","context_page_description":"Калькини́ — муниципалитет в Мексике, штат Кампече с административным центром в одноимённом городе. Численность населения, по данным переписи 2010 года, составила 52 890 человек."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Frederick_County,_Maryland","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Harris_Farmhouse_Walkersville%2C_MD1.jpg","page_title":"National Register of Historic Places listings in Frederick County, Maryland","context_page_description":"This is a list of the National Register of Historic Places listings in Frederick County, Maryland.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Frederick County, Maryland, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are 99 properties and districts listed on the National Register in the county, and two former listings.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D8%AD%D9%8A%D8%B1%D9%87_%D8%A8%D8%B1%D9%8A%D8%AA%D9%8A%D8%B1%D8%B3%D9%89_(%D8%A7%D9%84%D9%86%D9%85%D8%B3%D8%A7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Brettersee1850.JPG","page_title":"بحيره بريتيرسى (النمسا)","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nبريتيرسى بحيره فى النمسا."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%A8%82%E5%AF%8C%E6%B3%B0%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Australia_South_Australia_relief_location_map.png","page_title":"樂富泰山","context_page_description":"乐富泰山，又译巍峨山，是南澳州乐富泰山脉最高的山峰，位于南澳州首府阿德莱德以东15公里。乐富泰山顶是阿德莱德著名的旅游景点，亦因其灯塔而闻名。山顶设观景台、餐厅及精品店，观景台能饱览由西面的阿德莱德至东面的必嘉迪利之景色。\\n前往乐富泰山的方式包括，开车可使用东南公路嘉佛士出口、青山道。步行则可由瀑布涌经洁兰郊野公园及针八士涌，此段亦是最为人广知的行山径。亦有不少单车爱好者使用旧白加山道前往山顶。\\n在峰顶附近的山脊上有三个电视讯号塔，包括澳大利亚广播公司及国立消防处使用的乐富泰山消防塔。"},{"page_url":"https://pt.wikipedia.org/wiki/Guilherme,_Duque_de_Gloucester","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/William%2C_Duke_of_Gloucester_by_Sir_Godfrey_Kneller%2C_Bt.jpg","page_title":"Guilherme, Duque de Gloucester","context_page_description":"Guilherme Henrique foi o filho de Ana da Grã-Bretanha e Jorge da Dinamarca e Noruega. Ele foi o único filho do casal a sobreviver à infância. Guilherme recebeu o título de Duque de Gloucester e foi visto por seus contemporâneos como um campeão do protestantismo já que seu nascimento parecia cementar a sucessão protestante estabelecida através da \\"Revolução Gloriosa\\", que havia deposto no ano anterior seu avô católico, o rei Jaime II da Inglaterra & VII da Escócia.\\nAna era distante de seu cunhado e primo, o rei Guilherme III da Inglaterra e Orange & II da Escócia, e sua irmã, a rainha Maria II da Inglaterra, porém apoiou uma ligação entre o filho e os dois monarcas. Ele cresceu próximo do tio, que lhe fez um Cavaleiro da Jarreteira, e da tia, que frequentemente lhe mandava presentes. Guilherme operava seu próprio exército em miniatura em seu berçário em Kensington, que chegou a ser formado por noventa meninos. Ele também ficou amigo de seu criado Jenkin Lewis, cujas memórias do duque são uma importante fonte histórica.\\nA saúde ruim de Guilherme sempre preocupou Ana."},{"page_url":"https://el.wikipedia.org/wiki/Dodge_Caliber","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Dodge_Caliber_2.0_CRD_rear.jpg","page_title":"Dodge Caliber","context_page_description":"To Dodge Caliber ήταν ένα μικρομεσαίο οικογενειακό αυτοκίνητο της κατηγορίας C, που παρήχθη από την αμερικανική αυτοκινητοβιομηχανία Dodge, από τον Φεβρουάριο του 2006 έως τις 23 Νοεμβρίου 2011. Το μοντέλο διατέθηκε αποκλειστικά σε αμάξωμα 5-πορτο hatchback, το οποίο ωστόσο έφερε σχεδιαστικά στοιχεία από αυτοκίνητα crossover SUV, με αποτέλεσμα να θεωρείται συχνά από αρκετά έντυπα ως station wagon ή ακόμα και ως crossover SUV. Κατά τα έτη παραγωγής του, υπήρξε το μικρότερο και φθηνότερο μοντέλο στην παλέτα της Dodge. Αντικατέστησε το Dodge Neon και αντικαταστάθηκε τον Ιούνιο του 2012 από το Dodge Dart, το οποίο όμως σημείωσε ακόμα χαμηλότερη απήχηση και τελικώς διακόπηκε στις 2 Σεπτεμβρίου 2016, χωρίς διάδοχο."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%88%D0%B5%D0%BB%D0%B8%D1%81%D0%B0%D0%B2%D0%B5%D1%82%D0%B0_%D0%A4%D1%98%D0%BE%D0%B4%D0%BE%D1%80%D0%BE%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Elizaveta_Federovna.gif","page_title":"Јелисавета Фјодоровна","context_page_description":"Света преподобномученица Јелисавета Фјодоровна Руска руска је кнегиња из руске царске династије Романов. У Православној цркви чува се успомена на њу и њено мученичко страдање, заједно са члановима руске царске династије Романов, њеном пријатељицом монахињом Варваром и другима, међу којима је и кнез Јован Константинович, ожењен Јеленом — сестром краља Александра Карађорђевића.\\nОни су, дан након погубљења породице Романових, претучени и живи бачени у окно оближњег напуштеног рудника. Пошто нису пали на дно окна, већ се задржали на неком од испуста, из окна су се још неколико дана чуле њихове молитве и духовне песме након чега су преминули од глади и задобијених повреда. Њихова тела су пронађена и кришом пребачена у Кину, а велику кнегињу са сестром Варваром пренели су у Јерусалим, где се и данас налазе у манастиру Марије Магдалене на Јелеонској гори."},{"page_url":"https://en.wikipedia.org/wiki/Dynamic_random-access_memory","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Olivetti_JP90_-_Toshiba_TC518129CFWL-80_on_controller-8514.jpg","page_title":"Dynamic random-access memory","context_page_description":"Dynamic random-access memory is a type of random access semiconductor memory that stores each bit of data in a memory cell consisting of a tiny capacitor and a transistor, both typically based on metal-oxide-semiconductor technology. The capacitor can either be charged or discharged; these two states are taken to represent the two values of a bit, conventionally called 0 and 1. The electric charge on the capacitors slowly leaks off, so without intervention the data on the chip would soon be lost. To prevent this, DRAM requires an external memory refresh circuit which periodically rewrites the data in the capacitors, restoring them to their original charge. This refresh process is the defining characteristic of dynamic random-access memory, in contrast to static random-access memory which does not require data to be refreshed. Unlike flash memory, DRAM is volatile memory, since it loses its data quickly when power is removed. However, DRAM does exhibit limited data remanence.\\nDRAM typically takes the form of an integrated circuit chip, which can consist of dozens to billions of DRAM memory cells."},{"page_url":"https://id.wikipedia.org/wiki/County_Collingsworth,_Texas","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Collingsworth_County%2C_TX%2C_Court_House%2C_IMG_6175.JPG","page_title":"County Collingsworth, Texas","context_page_description":"Collingsworth County adalah county yang terletak di negara bagian Texas, Amerika Serikat. Jumlah penduduk pada tahun 2010 sebesar 3,057 jiwa. County ini ada sejak 1876 dan mulai terorganisasi tahun 1890. Nama county ini diambil dari nama seorang penanda tangan Deklarasi Kemerdekaan Texas dan Ketua Mahkamah Agung Republik Texas yang pertama, James Collinsworth. Hingga November 2015 County Collingsworth adalah satu dari tujuh county di negara bagian Texas yang melarang penjualan semua jenis minuman beralkohol."},{"page_url":"https://it.wikipedia.org/wiki/Capi_di_Stato_di_Cuba","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Miguel_Diaz_Canel.jpg","page_title":"Capi di Stato di Cuba","context_page_description":"I capi di Stato di Cuba dal 1902 ad oggi sono i seguenti."},{"page_url":"https://hr.wikipedia.org/wiki/Obalna_vidra","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Lfelina.jpg","page_title":"Obalna vidra","context_page_description":"Obalna vidra rijedak je i slabo poznat morski sisavac, pripadnik porodice kuna. Jedina su vrsta morskih vidri u Južnoj Americi, i rijetko zalaze u slatke vode ili estuarije. Njeno latinsko ime znači \\"vidra mačka\\", dok na španjolskom jeziku, obalnu vidru često se naziva \\"gato marino\\" – morska mačka."},{"page_url":"https://fi.wikipedia.org/wiki/Sunnuntaipalstat","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Sadetie_Sunnuntaipalstat_Malmi.jpg","page_title":"Sunnuntaipalstat","context_page_description":"Sunnuntaipalstat on noin 500 asukkaan pientaloalue Helsingissä Malmin lentokentän länsipuolella, lähellä Ala-Malmin keskustaa. Se kuuluu itse lentokentän ohella Malmin kaupunginosan Malmin lentokenttä -nimiseen osa-alueeseen.\\nTasaiselle peltoalueelle palstoitettiin tontteja ja rakennettiin pientaloja jo 1900-luvun alkuvuosina. Vanhin säilynyt rakennus Pilvitie 7:ssä on vuodelta 1900. Sen lisäksi on säilynyt muutama muukin rakennus toista maailmansotaa edeltäneeltä ajalta, mutta valtaosa nykyisistä rakennuksista on vuosilta 1975–2000. Alueella on sekä yksityisesti omistettuja että kaupungin omistamia, vuokrattuja tontteja, ja omakotitalojen ohella joitakin rivitaloja.\\nMalmin lentoaseman kiitotien jatkeeksi tarvittu suoja-alue jakoi 1930-luvulla Sunnuntaipalstat eteläiseen ja pohjoiseen osaan, joiden välillä on vain kevyen liikenteen yhteys. Pohjoiselle osalle pääsee autolla Malminkaarelta, eteläiselle Tullivuorentieltä. Pohjoisella osalla asui 2010-luvun keskivaiheilla yhteensä 239 ja eteläisellä osalla 236 asukasta, yhteensä siis 475.\\nViereisen Tapanilan tavoin Sunnuntaipalstat olivat alun perin työväen asuinaluetta. Alueen asukasluku kasvoi nopeasti 1910-luvulla."},{"page_url":"https://en.wikipedia.org/wiki/Station_days","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Santa_Sabina3.jpg","page_title":"Station days","context_page_description":"Station days were days of fasting in the early Christian Church, associated with a procession to certain prescribed churches in Rome, where the Mass and Vespers would be celebrated to mark important days of the liturgical year. Although other cities also had similar practices, and the fasting is no longer prescribed, the Roman churches associated with the various station days are still the object of pilgrimage and ritual, especially in the season of Lent."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A2%D7%99%D7%A0%D7%AA_%D7%A4%D7%A8%D7%A0%D7%91%D7%9A_%D7%91%D7%9F_%D7%90%D7%94%D7%A8%D7%95%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Einat_Fernbach_Speech1.jpg","page_title":"עינת פרנבך בן אהרון","context_page_description":"עינת פרנבך בן אהרון הייתה במאית, תסריטאית ומלהקת ישראלית."},{"page_url":"https://sh.wikipedia.org/wiki/Sunset,_Louisiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/ChrisLitherlandSunset.jpg","page_title":"Sunset, Louisiana","context_page_description":"Sanset je grad u američkoj saveznoj državi Luizijana."},{"page_url":"https://en.wikipedia.org/wiki/Couch_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Couch_Park_in_Portland%2C_Oregon.jpg","page_title":"Couch Park","context_page_description":"Couch Park is a city park in downtown Portland, Oregon, located at the intersection of Northwest 19th Avenue and Glisan Street. Named after merchant John H. Couch, the park was acquired in 1977.\\nThe park is located adjacent to the Metropolitan Learning Center, a public, Kx12 magnet school."},{"page_url":"https://fr.wikipedia.org/wiki/Poisson-clown_%C3%A0_trois_bandes","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Magnificent_Sea_Anemone_%28Heteractis_magnifica%29_with_Western_Clown_Anemonefishes_%28Amphiprion_ocellaris%29_%288454170152%29.jpg","page_title":"Poisson-clown à trois bandes","context_page_description":"Le Poisson-clown à trois bandes ou Poisson-clown ocellé est une espèce de poissons marins de la famille des Pomacentridés qui regroupe les poissons-clowns et les demoiselles."},{"page_url":"https://en.wikipedia.org/wiki/Bassae","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Bassai_Temple_of_Apollo_Plan.svg","page_title":"Bassae","context_page_description":"Bassae is an archaeological site in Oichalia, a municipality in the northeastern part of Messenia, Greece. In classical antiquity, it was part of Arcadia. Bassae lies near the village of Skliros, northeast of Figaleia, south of Andritsaina and west of Megalopolis. It is famous for the well-preserved mid- to late-5th century BC Temple of Apollo Epicurius.\\nAlthough this temple is geographically remote from major polities of ancient Greece, it is one of the most studied ancient Greek temples because of its multitude of unusual features. Bassae was the first Greek site to be inscribed on the World Heritage List."},{"page_url":"https://da.wikipedia.org/wiki/Maria_Luisa_af_Parma","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/La_famiglia_di_Don_Filippo_di_Borbone_by_Giuseppe_Baldrighi_%28C._1757%29.jpg","page_title":"Maria Luisa af Parma","context_page_description":"Maria Luisa af Parma var en spansk-italiensk prinsesse, der var dronning af Spanien fra 1788 til 1808 som ægtefælle til Kong Karl 4. af Spanien.\\nMaria Luisa var datter af hertug Filip 1. af Parma og prinsesse Louise Élisabeth af Frankrig. I 1765 blev hun gift med sin fætter, den daværende spanske tronfølger Karl, Fyrste af Asturien, ældste søn af Kong Karl 3. af Spanien. Ved svigerfaderens død i 1788 blev Maria Luisa dronning af Spanien. I 1808 blev Karl 4. tvunget af Kejser Napoleon til at abdicere til fordel for sin søn, Ferdinand 7. Maria Luisa og Karl boede herefter i eksil, først i Frankrig og siden i Rom, hvor Maria Luisa døde i 1819."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_S%C3%A4ugetiere_Deutschlands","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Raccoon-range.png","page_title":"Liste der Säugetiere Deutschlands","context_page_description":"Diese kommentierte Liste führt die beobachtete wild lebende Säugetierfauna in Deutschland auf.\\nSie listet die Arten der Säugetiere Deutschlands auf, die rezent vorkommen oder in Deutschland ab 1492 als ausgestorben eingestuft wurden. Haus- und Nutztiere sowie Zootiere gehören nicht dazu. Diese Liste enthält 136 Arten, die in neun Ordnungen und 36 Familien unterteilt sind.\\nSie enthält mindestens 13 in Deutschland eingeführte Arten, die mehr oder weniger gut akklimatisiert sind und zum Teil zu großen Problemen führen.\\nEs werden auch Irrgäste aufgeführt. Dies sind Arten, die sich versehentlich von ihrem üblichen Verbreitungsgebiet entfernen und hier in Deutschland landen. Sie sind also nicht einheimisch in diesem Gebiet, zählen aber zu dessen Fauna."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D1%80%D0%B8%D0%B7%D1%83%D0%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/CoA_mil_ITA_rgt_alpini_014.png","page_title":"Тризуб","context_page_description":"Три́зуб — український національний герб, сучасний державний герб України у формі золотого тризубця особливої форми на синьому полі; у минулому — герб князів Рюриковичів і Київської Русі. Про походження і значення українського герба Тризуба існують різні теорії, жодна з них не є загальновизнаною, але можна виділити кілька теорій які є найбільш обґрунтованими — це трактування Тризуба як стилізованого зображення або сокола, або якоря-хреста."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Saint-Michel-de-Castelnau","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/Map_commune_FR_insee_code_33450.png","page_title":"Saint-Michel-de-Castelnau","context_page_description":"Saint-Michel-de-Castelnau sī ūi-tī Hoat-kok Aquitaine tōa-khu Gironde séng ê chi̍t ê commune."},{"page_url":"https://nl.wikipedia.org/wiki/Henricus_Antonides_Nerdenus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/H.A.Nerdenus.JPG","page_title":"Henricus Antonides Nerdenus","context_page_description":"Henricus Antonides Nerdenus, ook wel Henricus Antonius van der Linden, was predikant en hoogleraar theologie gedurende de reformatie.\\nHenricus Antonides bezocht de Latijnse school in Naarden, waar zijn vader leraar was en Lambertus Hortensius rector, en wordt al op jonge leeftijd gewonnen voor de ideeën van de reformatie. In 1565 sloot hij zich aan bij een geloofsgemeente en een jaar later zou hij daar voorganger zijn. Naar eigen zeggen zou hij “een van de eerste beeldenstormers” zijn geweest. Om zijn protestantse geloof werd hij opgesloten, maar met de marteldood voor ogen wist hij te vluchten naar Oost-Friesland, waar hij in zich verder bekwaamde in de Bijbelstudie. In die periode, in 1572, kwamen zijn beide ouders en mogelijk andere familieleden om bij het bloedbad van Naarden.\\nIn 1573 werd Henricus predikant, eerst in Dykhuyzen en later in Enkhuizen. In 1585 tot aan zijn dood in 1614 was hij hoogleraar theologie en speelde een belangrijke rol aan de net opgerichte Universiteit van Franeker – op dat moment de tweede universiteit in de noordelijke Nederlanden."},{"page_url":"https://fr.wikipedia.org/wiki/Famille_von_Tschirschky","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/2010-oWIESNO-HABENDORF.jpg","page_title":"Famille von Tschirschky","context_page_description":"La famille von Tschirschky est une famille de la noblesse immémoriale de Silésie, connue depuis le XIIIᵉ siècle, qui a essaimé en Pologne et en Bohême. Elle a donné des généraux, diplomates, propriétaires terriens, gouverneur de citadelle, chambellan, député."},{"page_url":"https://az.wikipedia.org/wiki/Qabriel_Qarsiya_Markes","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Gabriel_Garcia_Marquez%2C_2009.jpg","page_title":"Qabriel Qarsiya Markes","context_page_description":"Qabriel Xose de la Konkordiya \\"Qabo\\" Qarsiya Markes — Kolumbiyalı romançı, jurnalist, ssenarist, qıssa-hekayə yazıçısı, Latın Amerikasında Qabo və ya Qabito adı ilə məhşur idi. 20-ci əsrin, xüsusən də ispan dilində yazan ən görkəmli müəlliflərindən biri hesab olundu, 1972-ci ildə Neyştadt Beynəlxalq Ədəbiyyat Mükafatına və 1982-ci ildə Ədəbiyyat üzrə Nobel Mükafatına layiq görüldü. O, öztəhsilin tərəfini tuturdu, bu da onun hüquq məktəbini tərk etməsi və jurnalistikada karyera qurması ilə nəticələndi. 1958-ci ildə Mersedes Barça ilə evləndi; onların Rodriqo və Qonzalo adlı iki oğlu var idi.\\nQarsiya Markes bir jurnalist kimi fəaliyyətə başladığı müddət ərzində bir çox qeyri-fantastik əsərlər və qısa hekayələr yazdı, lakin o, Yüz ilin tənhalığı, Patriarxın payızı və Vəba günlərində eşq kimi romanları ilə məşhurlaşdı. Onun əsərləri, xüsusən magik elementlərin dünyanın realist mənzərəsinə daxil edildiyi sehrli realizm kimi tanınan ədəbi üslubun populyarlaşması üçün əhəmiyyətli tənqid və geniş kommersiya uğuru qazandı. Bəzi əsərlərindəki hadisələr Makondo adlı uydurma bir kənddə cərəyan edir və əksəriyyəti tənhalıq mövzusuna toxunur."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D0%BD%D0%B4%D0%B8,_%D0%91%D1%8C%D1%8E%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Beulah_Bondi_Wagon_Train_1961.JPG","page_title":"Бонди, Бьюла","context_page_description":"Бью́ла Бо́нди — американская актриса, обладательница «Эмми» и двукратная номинантка на премию «Оскар»."},{"page_url":"https://en.wikipedia.org/wiki/Rengit","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Rengit.JPG","page_title":"Rengit","context_page_description":"Rengit is a town and an autonomous sub-district in Mukim Sungai Kluang, Batu Pahat District, Johor, Malaysia. Rengit has more than 30 villages and 25 schools."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9E%D0%BC%D1%83%D1%80%D1%82%D0%B0%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/KoutragonChristiansBGhistory.jpg","page_title":"Омуртаг","context_page_description":"Хан Омуртаг е български владетел, син на Крум. Управлява България от 814 до 831 г.\\nИма мнение, поддържано от покойния професор Рашо Рашев, че името на хана не е добре разчетено от преводача. Името също така е засвидетелствано и като Муртагон. Едноименен връх се намира в планината Тян Шан в днешен Китай."},{"page_url":"https://eo.wikipedia.org/wiki/Kristalsistemo","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/Orthorhombic.png","page_title":"Kristalsistemo","context_page_description":"Kristalsistemo ebligas klasifikan skemon pri kristalaj solidaĵoj. Oni klasifikas en kristalografio la priskribendajn kristalojn tridimensie helpe de la kristala strukturo.\\nLa kristala strukturo estas mezurata en koordinata sistemo, en kiu oni komparas la kristalojn. Oni uzas por la pli simplaj kalkuloj kaj prezentoj ne ĉiam la kartezian koordinatan sistemon, sed unu adaptitan al la kristalo. La angulo kaj la bazunuoj de la aksoj estas variitaj. La orientiĝo de la kristalo sekvas surbaze de la randoj kaj ties etendiĝo.\\nLa kristala sistemo trovas uzeblecon ĉefe en mineralogio, solidstata kemio kaj solidstata fiziko.\\nEkzistas laŭ aŭtoritatoj 6-8 diversaj kristalaj strukturoj, kiujn oni povas dividi plu je 32 kristalklasoj:\\ntriklina kristalsistemo: havas tri ajnajn laterojn, kiuj ne estas interorbitaj; ĝi havas nek spegulan simetrion, nek rotacian akson, nek saman angulon, nek samlongan lateron.\\nmonoklina kristalsistemo: rilata al kristalformo kun du interortaj lateroj; ĝi havas du 90°-angulojn kaj nenian samlongan lateron.\\nOrtoromba, romba kristalsistemo: ĝi havas tri 90°-angulojn, kaj nenian samlongan lateron."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%82%D9%88%D8%B7%DB%8C_%DA%A9%D9%84%DB%8C%D8%AF_%D9%88_%D9%BE%D8%B1%DB%8C%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Opened_light_switch.JPG","page_title":"قوطی کلید و پریز","context_page_description":"قوطی کلید و پریز محفظه‌ای برای قرار دادن قسمت پشتی ابزارآلات برقی نظیر دوشاخه و پریز برق متناوب، کلید لامپ یا هلدر لامپ است."},{"page_url":"https://pl.wikipedia.org/wiki/Ferrari_360_Modena","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/2003_Ferrari_360_Modena_3.6_Front.jpg","page_title":"Ferrari 360 Modena","context_page_description":"Ferrari 360 Modena – supersamochód klasy średniej produkowany przez włoską markę Ferrari w latach 1999 - 2005."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B8%D0%B6%D1%81%D0%BA%D0%BE%D0%B5_%D0%BD%D0%B0%D0%BF%D1%80%D0%B0%D0%B2%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5_%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B9_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%BE%D0%B9_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Rizhsky_Rail_Terminal%2C_Moscow%2C_Russia.jpg","page_title":"Рижское направление Московской железной дороги","context_page_description":"Рижское направление Московской железной дороги — железнодорожная линия от Рижского вокзала Москвы до станции Шаховская. Проходит через города Красногорск, Дедовск, Истра и Волоколамск. Длина линии 155 километров. Линия от станции Шаховская на запад до станции Посинь относится к Октябрьской железной дороге. Построена как часть Московско-Виндавской железной дороги.\\nПо линии следуют пригородные поезда, связывающие запад Московской области с Москвой и с югом области, а также поезда дальнего следования до Риги, Великих Лук. Главный пассажирский терминал — Рижский вокзал."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Heuvelland","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Locre_Hospice_Cem.2_1.JPG","page_title":"Lijst van onroerend erfgoed in Heuvelland","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Heuvelland. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://en.wikipedia.org/wiki/Ash%C3%A1ninka","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Ashaninka_people_-_Minist%C3%A9rio_da_Cultura_-_Acre%2C_AC_%2827%29.jpg","page_title":"Asháninka","context_page_description":"The Asháninka or Asháninca are an indigenous people living in the rainforests of Peru and in the State of Acre, Brazil. Their ancestral lands are in the forests of Junín, Pasco, Huánuco and part of Ucayali in Peru."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%B1%B3%E5%B0%94_(%E7%99%BD%E4%BF%84%E7%BD%97%E6%96%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Flag_of_Mir%2C_Belarus.png","page_title":"米尔 (白俄罗斯)","context_page_description":"米尔是白俄罗斯格罗德诺州的一个城镇，位于首都明斯克西南85公里，约有2500人。\\n1939年之前，该镇曾经属于波兰。"},{"page_url":"https://en.wikipedia.org/wiki/Apple_II_series","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Apple_II_advertisement_Dec_1977_page_1.jpg","page_title":"Apple II series","context_page_description":"The Apple II series is a family of home computers, one of the first highly successful mass-produced microcomputer products, designed primarily by Steve Wozniak, manufactured by Apple Computer, and launched in 1977 with the original Apple II. In terms of ease of use, features, and expandability, the Apple II was a major advancement over its predecessor, the Apple I, a limited-production bare circuit board computer for electronics hobbyists. Through 1988, a number of models were introduced, with the most popular, the Apple IIe, remaining changed relatively little into the 1990s. A 16-bit model with much more advanced graphics and sound, the Apple IIGS, was added in 1986. While compatible with earlier Apple II systems, the IIGS was in closer competition with the Atari ST and Amiga.\\nThe Apple II was first sold on June 10, 1977. By the end of production in 1993, somewhere between five and six million Apple II series computers had been produced. The Apple II was one of the longest running mass-produced home computer series, with models in production for just under 17 years."},{"page_url":"https://en.wikipedia.org/wiki/Hagia_Sophia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Entr%C3%A9e_principale_de_la_mosqu%C3%A9e_-_Fossati_Gaspard_-_1852.jpg","page_title":"Hagia Sophia","context_page_description":"Hagia Sophia, officially the Hagia Sophia Grand Mosque and formerly the Church of Hagia Sophia, is a Late Antique place of worship in Istanbul. Built in 537 as the patriarchal cathedral of the imperial capital of Constantinople, it was the largest Christian church of the eastern Roman Empire and the Eastern Orthodox Church, except during the Latin Empire from 1204 to 1261, when it became the city's Roman Catholic cathedral. In 1453, after the Fall of Constantinople to the Ottoman Empire, it was converted into a mosque. In 1935 the secular Turkish Republic established it as a museum. In 2020, it re-opened as a mosque.\\nBuilt by the eastern Roman emperor Justinian I as the Christian cathedral of Constantinople for the state church of the Roman Empire between 532 and 537, the church was then the world's largest interior space and among the first to employ a fully pendentive dome. It is considered the epitome of Byzantine architecture and is said to have \\"changed the history of architecture\\". The building was designed by the Greek geometers Isidore of Miletus and Anthemius of Tralles."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Cagnano_Amiterno","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Cagnano_Amiterno-frazione_Termine.jpg","page_title":"Cagnano Amiterno","context_page_description":"Cagnano Amiterno sī Ì-tāi-lī Abruzzo Tōa-khu L'Aquila Séng ê chi̍t-ê comune."},{"page_url":"https://sv.wikipedia.org/wiki/Exelastis_atomosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/19-Indian-Insect-Life_-_Harold_Maxwell-Lefroy_-_Exelastis-atomosa.jpg","page_title":"Exelastis atomosa","context_page_description":"Exelastis atomosa är en fjärilsart som beskrevs av Walsingham 1886. Exelastis atomosa ingår i släktet Exelastis och familjen fjädermott. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://sk.wikipedia.org/wiki/La_Chavanne","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/Map_commune_FR_insee_code_73082.png","page_title":"La Chavanne","context_page_description":"La Chavanne je francúzska obec, ktorá sa nachádza v departemente Savoie, v regióne Rhône-Alpes."},{"page_url":"https://nl.wikipedia.org/wiki/Satijnsteek","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Embroidered_Panel_Morris_and_Company_detail.jpg","page_title":"Satijnsteek","context_page_description":"De satijnsteek of platsteek is een borduursteek die wordt gebruikt om vlakken te vullen. De steken worden hierbij altijd parallel aan elkaar gemaakt en zeer dicht naast elkaar geplaatst, zodat de stof ertussen niet meer zichtbaar is. De steken van de satijnsteek kunnen in lengte verschillen, afhankelijk van de vorm van het op te vullen vlak. Bij gebruik van een glanzend borduurgaren wordt het effect van satijn bereikt."},{"page_url":"https://ms.wikipedia.org/wiki/Batang_Melaka","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/New_Geographic_Map_of_the_Interior_of_Malaca_WDL972.png","page_title":"Batang Melaka","context_page_description":"Batang Melaka adalah sebuah mukim dalam daerah Jasin, negeri Melaka, Malaysia. Batang Melaka telah wujud semenjak dari pentadbiran Portugis di Melaka lagi. Ini boleh dirujuk pada peta yang dicatatkan oleh Manuel Godinho de Eredia iaitu seorang ahli ilmuan berdarah Portugis dan Bugis.Batang Melaka boleh dirujuk di dalam peta 1602 dan dikenalpasti dengan nama \\"Batam Malaca\\".Ini menunjukkan Batang Melaka, merupakan kawasan-kawasan terpenting semenjak zaman dahulu lagi.Pekan Batang Melaka pula adalah sebuah pekan yang sebahagian daripadanya dalam daerah Jasin negeri Melaka dan sebahagian lagi dalam daerah Tampin, Negeri Sembilan. Sempadan bagi kedua negeri Melaka dan Negeri Sembilan pekan Batang Melaka adalah ditengah-tengah pekan Batang Melaka, yang mana terdapat papan tanda memasuki negeri Melaka/Negeri Sembilan. Pekan ini merupakan sebuah pekan mempunyai kadar kemajuan yang baik sejajar dengan pembangunan semasa.\\nTerdapat pelbagai kemudahan di Batang Melaka."},{"page_url":"https://en.wikipedia.org/wiki/Bolsheboldinsky_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Bolshoye_Boldino._Pushkins%27_Family_manor.jpg","page_title":"Bolsheboldinsky District","context_page_description":"Bolsheboldinsky District is an administrative district, one of the forty in Nizhny Novgorod Oblast, Russia. Municipally, it is incorporated as Bolsheboldinsky Municipal District. It is located in the southeast of the oblast. The area of the district is 866.5 square kilometers. Its administrative center is the rural locality of Bolshoye Boldino. Population: 12,035; 13,035; 14,156. The population of Bolshoye Boldino accounts for 42.2% of the district's total population."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D0%BF%D1%88%D1%82%D0%B8%D0%BD%D0%B0_%D0%91%D0%B0%D1%82%D0%BE%D1%87%D0%B8%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/%C5%BDelezni%C4%8Dka_stanica_Bato%C4%8Dina.jpg","page_title":"Општина Баточина","context_page_description":"Општина Баточина је општина у Шумадијском округу у централном делу Републике Србије. По подацима из 2004. општина заузима површину од 141 km², по чему заузима шесто место у округу.\\nЦентар општине је градско насеље Баточина. Општина Баточина се састоји од 11 насеља. Према подацима са последњег пописа 2011. године у општини је живело 11.760 становника. По подацима из 2004. природни прираштај је износио -7,1‰, а број запослених у општини износи 2095 људи."},{"page_url":"https://oc.wikipedia.org/wiki/Maomet","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Muhammad2.png","page_title":"Maomet","context_page_description":"Maomet, en arabi: محمّد; mʊħɑmmæd̪, foguèt un cap religiós, politic e militara arabi que venguèt lo profèta major e la fondator de l'Islam.\\nLei musulmans lo consideran coma lo darrier profèta dei religions monoteïstas abraamicas. Après sa mòrt, l'ensems de sei revelacions foguèt gropat per formar l'Alcoran que venguèt lo libre sacrat de l'Islam. Sa vida e lo rèsta de seis ensenhaments forman tanben d'elements importants per la fe musulmana. Acomencèt sei predicacions a partir de 610 dins la vila de La Mèca. Deguèt rapidament faciar l'ostilitat de la màger part deis elèits e dei populacions localas e s'exilar a Medina en 622. Aquel eveniment foguèt l'etapa decisiva que permetèt ai musulmans de formar una comunautat e una armada organizadas. A partir de 624, acomencèt una guèrra còntra La Mèca. Sei succès permetèron d'aumentar la popularitat de la religion novèla que foguèt pauc a pauc adaptada ai revendicacions localas. Aquò permetèt de melhorar lei relacions entre Medina e La Mèca que negocièt sa rediccion e son ocupacion per lei musulmans en genier de 630."},{"page_url":"https://en.wikipedia.org/wiki/State_Research_and_Design_Shipbuilding_Center","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/SRDSC.png","page_title":"State Research and Design Shipbuilding Center","context_page_description":"State Research and Design Shipbuilding Center is a design bureau specializing in shipbuilding and located in Mykolaiv, Ukraine. It is part of the Ukrainian Defense Industries state corporation."},{"page_url":"https://nl.wikipedia.org/wiki/Wereldtentoonstelling","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Eiffel_Tower_from_Trocadero.jpg","page_title":"Wereldtentoonstelling","context_page_description":"Wereldtentoonstellingen zijn grote internationale exposities die sinds 1851 in verschillende landen gehouden zijn en waar de deelnemende landen een beeld kunnen geven van hun economische, sociale, culturele en technische ontwikkeling. Vaak resteert er een gebouw of kunstwerk van een wereldtentoonstelling, zoals de Eiffeltoren in Parijs of het Atomium in Brussel."},{"page_url":"https://es.wikipedia.org/wiki/John_Terry_(futbolista)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/John_Terry_of_Chelsea_with_his_kids.jpg","page_title":"John Terry (futbolista)","context_page_description":"John George Terry, más conocido como John Terry, es un exfutbolista británico que se desempeñaba como defensa central, actualmente se desempeña como segundo entrenador en el club de futbol Aston Villa. Ha sido elegido como mejor defensa de la Liga de Campeones de la UEFA en los años 2005, ​ 2008 y 2009, así como ganador del Premio PFA al Jugador del Año en el 2005.​Ha sido incluido en el Equipo del Año FIFpro por 5 años consecutivos, del 2005 al 2009.​​​​​ También fue incluido en el Equipo Estelar de la Copa Mundial de Fútbol de 2006, siendo el único jugador inglés en ser incluido.​\\nEn el 2007, Terry se convirtió en el primer capitán en levantar el trofeo de la FA Cup en el nuevo Estadio de Wembley, cuando el Chelsea derrotó al Manchester United por 1-0 en la final. También es el primer jugador inglés en anotar un gol en ese estadio, cuando Inglaterra empató a 1-1 con Brasil.​ Sin embargo, Terry y el Chelsea fueron subcampeones en tres de las cuatro competiciones en las que participaban en la temporada 2007-08, perdiendo la final de la Football League Cup 2-1 frente al Tottenham Hotspur y perdiendo la Premier League y la Liga de Campeones contra el Manchester United."},{"page_url":"https://ca.wikipedia.org/wiki/Musaranya_elefant_de_Peters","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/ZooElephantShrew.jpg","page_title":"Musaranya elefant de Peters","context_page_description":"La musaranya elefant de Peters és una de les setze espècies vivents de musaranya elefant d'Àfrica. Com els altres membres del gènere Rhynchocyon, és una espècie relativament gran; els adults tenen una longitud mitjana de 28 cm i un pes mitjà de 450-700 g. És endèmica de Kenya i Tanzània."},{"page_url":"https://de.wikipedia.org/wiki/Akademie_zur_Wei%C3%9Fen-Hirsch-Grotte","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/%E7%99%BD%E9%B9%BF%E6%B4%9E.JPG","page_title":"Akademie zur Weißen-Hirsch-Grotte","context_page_description":"Die Akademie zur Weißen-Hirsch-Grotte oder Bailudong-Akademie im Gebirge Lu Shan liegt auf dem Gebiet der kreisfreien Stadt Lushan der bezirksfreien Stadt Jiujiang in der südchinesischen Provinz Jiangxi.\\nEs war die berühmteste der Vier Großen Akademien des alten China und sie genoss hohes Ansehen in der chinesischen Erziehungsgeschichte. Am Ort der heute gut erhaltenen Akademie studierte und lebte Li Bo, der berühmte Gelehrte aus der Zeit der Tang-Dynastie. Die Akademie wurde von Zhu Xi, dem Gelehrten des Neokonfuzianismus, während der Song-Dynastie wiederbelebt und ausgebaut. Sie genoss in der alten chinesischen Kultur über mehrere Jahrhunderte den Ruhm eines wichtigen Bildungszentrums.\\nSie steht seit 1988 auf der Liste der Denkmäler der Volksrepublik China."},{"page_url":"https://en.wikipedia.org/wiki/List_of_local_nature_reserves_in_Norfolk","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Smockmill_Common_6.jpg","page_title":"List of local nature reserves in Norfolk","context_page_description":"Norfolk is a county in East Anglia. It has an area of 2,074 square miles and a population as of mid-2017 of 898,400. The top level of local government is Norfolk County Council with seven second tier councils: Breckland District Council, Broadland District Council, Great Yarmouth Borough Council, King's Lynn and West Norfolk Borough Council, North Norfolk District Council, Norwich City Council and South Norfolk District Council. The county is bounded by Cambridgeshire, Suffolk, Lincolnshire and the North Sea.\\nLocal nature reserves are designated by local authorities under the National Parks and Access to the Countryside Act 1949. The local authority must have a legal control over the site, by owning or leasing it or having an agreement with the owner. Local nature reserves are sites which have a special local interest either biologically or geologically. Local authorities have a duty to care for them, and can apply local bye-laws to manage and protect them."},{"page_url":"https://eu.wikipedia.org/wiki/Sweet_Water_(Alabama)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Downtown_Sweet_Water_Marengo_County_Alabama.JPG","page_title":"Sweet Water (Alabama)","context_page_description":"Sweet Water Alabamako herri bat da. Marengo konderrian kokatua dago. 2010ean 258 biztanle zituen, 49,3 kilometro koadrotan banatuta."},{"page_url":"https://de.wikipedia.org/wiki/Amtsgericht_Ravensburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Ravensburg_Herrenstra%C3%9Fe40_1.jpg","page_title":"Amtsgericht Ravensburg","context_page_description":"Das Amtsgericht Ravensburg ist eines von 108 Amtsgerichten in Baden-Württemberg. Es ist ein Gericht der ordentlichen Gerichtsbarkeit."},{"page_url":"https://en.wikipedia.org/wiki/St._Clair_County,_Missouri","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Map_of_Missouri_highlighting_Saint_Clair_County.svg","page_title":"St. Clair County, Missouri","context_page_description":"St. Clair County is a county located in the western portion of the U.S. state of Missouri. As of the 2010 census, the population was 9,805. Its county seat is Osceola. The largest city is Appleton City. The county was organized in 1841 and named after General Arthur St. Clair, Governor of the Northwest Territory. St. Clair was also the 9th president of the United States in Congress Assembled. Under his presidency, the Northwest Ordinance and United States Constitution were passed.\\nAccording to the April 1907 issue of The Century Magazine, for well over 30 years St. Clair County was in open rebellion against the U.S. Government, refusing to pay interest on bonds which it had issued to assist in the building of a railroad, which was never built."},{"page_url":"https://it.wikipedia.org/wiki/Luoghi_di_Battlestar_Galactica","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/26/Picon_flag_symbol.png","page_title":"Luoghi di Battlestar Galactica","context_page_description":"La serie televisiva Battlestar Galactica è ambientata in un ampio universo immaginario, che fa da scenario agli eventi narrati."},{"page_url":"https://de.wikipedia.org/wiki/Kathedrale_von_Florenz","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Fa%C3%A7ade_cath%C3%A9drale_Florence.jpg","page_title":"Kathedrale von Florenz","context_page_description":"Die Kathedrale Santa Maria del Fiore in Florenz ist die Bischofskirche des Erzbistums Florenz und somit Metropolitankirche der Kirchenprovinz Florenz. Sie wurde von Papst Eugen IV. am 24. März 1436 geweiht und trägt den Titel einer „Basilica minor“.\\nDas Kirchenschiff fasst circa 30.000 Personen. Ihre gewaltige Kuppel, das Hauptwerk Brunelleschis, gilt als technische Meisterleistung der frühen Renaissance."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%83%B3%E3%83%BB%E3%82%A2%E3%83%BC%E3%82%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Star_Wars_Celebration_Orlando_Anovos_Jyn_Erso_Costume.jpg","page_title":"ジン・アーソ","context_page_description":"ジン・アーソは、『スター・ウォーズシリーズ』の登場キャラクター。『ローグ・ワン/スター・ウォーズ・ストーリー』の主人公で、銀河帝国の超兵器デス・スターの設計図奪取を図る「ローグ・ワン」のメンバー。\\n英国人女優のフェリシティ・ジョーンズが演じ、日本語吹き替えは渋谷はるかが担当している。批評家からはキャラクターを「オリジナル・トリロジー」のハン・ソロ、「シークエル・トリロジー」のレイと比較して論評されている。"},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Michel_de_Beautiran","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Beautiran_l%27%C3%A9glise_Saint_Michel_Modillons_14.JPG","page_title":"Église Saint-Michel de Beautiran","context_page_description":"L'église Saint-Michel est une église catholique située dans la commune de Beautiran, dans le département de la Gironde, en France."},{"page_url":"https://de.wikipedia.org/wiki/Matzingen","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/Karte_Gemeinde_Matzingen_2011.png","page_title":"Matzingen","context_page_description":"Matzingen ist eine politische Gemeinde und eine Ortschaft im Bezirk Frauenfeld des Kantons Thurgau in der Schweiz. Von 1870 bis 2002 war Matzingen eine Einheitsgemeinde."},{"page_url":"https://en.wikipedia.org/wiki/New_Zealand_at_the_2016_Summer_Olympics","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/ElizaMcCartneyHeatPoleVaultRio2016_010.jpg","page_title":"New Zealand at the 2016 Summer Olympics","context_page_description":"New Zealand competed at the 2016 Summer Olympics in Rio de Janeiro, Brazil, from 5 to 21 August 2016. This was the nation's twenty-third appearance as an independent nation at the Summer Olympics, having made its debut at the 1920 Games and competed at every Games since. The New Zealand team consisted of 199 athletes, 100 women and 99 men, across twenty sports, the first time New Zealand was represented by more women than men at the Summer Olympics.\\nThe New Zealand team collected a total of 18 medals, four gold, nine silver and five bronze, at these Games, surpassing a record of 13 gained at both the 1988 and 2012 Summer Olympics; it also exceeded High Performance Sport New Zealand's target of 14 medals for the Games. Athletics and sailing led the sports with four medals each, with three medals in each of canoeing and rowing, and one medal in each of cycling, golf, rugby sevens and shooting. Rowers Mahé Drysdale, Hamish Bond and Eric Murray, and sprint canoeist Lisa Carrington successfully defended their Olympic titles, while sailors Peter Burling and Blair Tuke ran away in the 49er class standings and secured their gold-medal victory before the final two races."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D0%BD%D1%84%D0%BE%D1%80%D0%BC%D0%B0%D1%86%D1%96%D0%B9%D0%BD%D0%B5_%D0%B0%D0%B3%D0%B5%D0%BD%D1%82%D1%81%D1%82%D0%B2%D0%BE_%D0%A6%D0%B5%D0%BD%D1%82%D1%80_%D0%BD%D0%BE%D0%B2%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/%D0%9A%D1%83%D0%B1%D0%BE%D0%BA_%D0%9D%D0%B5%D0%B7%D0%B0%D0%BB%D0%B5%D0%B6%D0%BD%D0%BE%D1%81%D1%82%D1%96-2017_%D0%97%D0%9D%D0%94.jpg","page_title":"Інформаційне агентство Центр новин","context_page_description":"Інформаційне агентство «Центр новин» — незалежне українське інформаційне агентство.\\nІА «Центр новин» виробляє на добу близько 500 новин про політику, світ, економіку, війну на Сході України, Крим, культурне і спортивне життя України та світу."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_th%C3%A1p_%C4%91%E1%BB%93ng_h%E1%BB%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Mahbob_chowk_clock_tower.jpg","page_title":"Danh sách tháp đồng hồ","context_page_description":"Đây là danh sách các tháp đồng hồ theo vị trí, chỉ bao gồm các tháp đồng hồ dựa trên định nghĩa sau:\\nTháp đồng hồ là một tháp được xây dựng đặc biệt với một hoặc nhiều mặt đồng hồ. Tháp đồng hồ có thể là độc lập hoặc là một phần của nhà thờ hoặc tòa nhà thành phố như tòa thị chính.\\nCấu trúc bên trong tòa tháp được gọi là đồng hồ tháp pháo thường đánh dấu giờ bằng cách phát ra tiếng chuông hoặc chuông lớn, đôi khi chơi các cụm từ hoặc giai điệu âm nhạc đơn giản."},{"page_url":"https://ro.wikipedia.org/wiki/Meyrin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Eglise_Saint-Julien_%28Meyrin%29_01.jpg","page_title":"Meyrin","context_page_description":"Meyrin este o municipalitate din cantonul Cantonul Geneva, Elveția. Este localitatea urbană cea mai apropiată de laboratorul de fizica particulelor CERN.\\nMeyrin fusese înainte de anii 1960 un sat a cărui economie era bazată pe agricultură. După începerea construcției clădirilor laboratoarelor CERN, a devenit rapid un oraș unde locuiesc majoritatea angajaților acetora.\\nParte a Aeroportului Internațional Geneva se găsește pe teritoriul localității."},{"page_url":"https://de.wikipedia.org/wiki/George_Thorne_(Fu%C3%9Fballspieler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/George_Thorne2_%28cropped%29.jpg","page_title":"George Thorne (Fußballspieler)","context_page_description":"George Louis Elliot Thorne ist ein englischer Fußballspieler auf der Position eines Mittelfeldspielers in Diensten von Derby County."},{"page_url":"https://fr.wikipedia.org/wiki/Agar_et_Ismaele_esiliati","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Pieter_Pietersz._Lastman_001.jpg","page_title":"Agar et Ismaele esiliati","context_page_description":"Agar et Ismaele esiliati est un oratorio d'Alessandro Scarlatti, pour cinq solistes avec orchestre, sur un livret italien de Giuseppe Domenico de Totis. Écrit sous le patronage de la reine Christine de Suède, l'œuvre est créée à Rome en 1683, lors d'une représentation privée, probablement au Palazzo Pamphili. Basé sur le chapitre 21 de la Genèse, l'oratorio narre l'histoire d'Agar et Ismael dans le désert.\\nL'œuvre est révisée et reprise postérieurement avec d'autres titres : L'Abramo, Palerme 1691. L'Ismaele soccorso dall'angelo. Oratorio a cinque voci da cantarsi nella venerabible compagnia dell' angiolo Raffaello detta la scala, Rome et Florence 1695. Il Sacrificio di Abramo, Rome 1703.\\nLe musicologue Edward Dent le considère comme le meilleur oratorio de jeunesse du compositeur."},{"page_url":"https://es.wikipedia.org/wiki/Miguel_%C3%81ngel_Guerra_(piloto)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Pedro_Passadore_y_Miguel_%C3%81ngel_Guerra_F1MA_1977.jpg","page_title":"Miguel Ángel Guerra (piloto)","context_page_description":"Miguel Ángel Guerra es un expiloto y dirigente argentino de automovilismo.​ Se destacó por haber desarrollado una vasta trayectoria a nivel nacional e internacional, como piloto de automovilismo de velocidad, donde llegara a competir en categorías como la Fórmula 1, TC 2000 y Turismo Carretera. A lo largo de su carrera deportiva, supo consagrarse campeón en distintas categorías nacionales, destacándose el título obtenido en el año 1989 en el TC 2000.\\nSu carrera deportiva se inició a principios de la década del '70, debutando en la Fórmula 4 Argentina donde alcanzaría dos subcampeonatos en 1972 y 1973, más el título de campeón en 1974 y 1975. Su actuación en esta división lo llevó a ascender en 1975 a la Fórmula 2 Argentina, donde obtuvo el título en su año debut y repitiese el logro en 1976 y 1977. Gracias a esto, lograría en 1978 emigrar a Europa donde competiría sucesivamente en la Fórmula 3 Europea y la Fórmula 2, hasta su gran desembarco en la Fórmula 1 en el año 1981.\\nSu llegada a la máxima categoría del automovilismo mundial, lo vería debutando en el equipo Osella al comando de una unidad potenciada por Ford."},{"page_url":"https://en.wikipedia.org/wiki/William_Orpen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/The_Mad_Woman_of_Douai_Art.IWMART4671.jpg","page_title":"William Orpen","context_page_description":"Major Sir William Newenham Montague Orpen, KBE, RA, RHA was an Irish artist who worked mainly in London. Orpen was a fine draughtsman and a popular, commercially successful, painter of portraits for the well-to-do in Edwardian society, though many of his most striking paintings are self-portraits.\\nDuring World War I, he was the most prolific of the official war artists sent by Britain to the Western Front. There he produced drawings and paintings of ordinary soldiers, dead men, and German prisoners of war, as well as portraits of generals and politicians. Most of these works, 138 in all, he donated to the British government; they are now in the collection of the Imperial War Museum. His connections to the senior ranks of the British Army allowed him to stay in France longer than any of the other official war artists, and although he was made a Knight Commander of the Order of the British Empire in the 1918 King's birthday honours list, and also elected a member of the Royal Academy of Arts, his determination to serve as a war artist cost him both his health and his social standing in Britain."},{"page_url":"https://de.wikipedia.org/wiki/Befreiungshalle","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Die_Ludwigsbahn.JPG","page_title":"Befreiungshalle","context_page_description":"Die Befreiungshalle ist ein Denkmal auf dem Michelsberg oberhalb der Stadt Kelheim in Niederbayern. Sie steht von Regensburg gesehen donauaufwärts an der Einmündung der Altmühl bzw. des Main-Donau-Kanals in die Donau. Errichtet wurde die Befreiungshalle von 1842 bis 1863 im Andenken an die gewonnenen Schlachten gegen Napoleon während der Befreiungskriege in den Jahren von 1813 bis 1815. Auftraggeber des Baus war König Ludwig I. von Bayern."},{"page_url":"https://de.wikipedia.org/wiki/Eberhard_Gildemeister","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Lehnhof_2-1251.jpg","page_title":"Eberhard Gildemeister","context_page_description":"Eberhard Gildemeister war ein deutscher Architekt, der hauptsächlich in Bremen wirkte."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%A6%8F%E5%8D%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Fo%C3%A7a_pictures_8.jpg","page_title":"福卡","context_page_description":"福卡是土耳其的城镇，位于该国西部，由伊兹密尔省负责管辖，距离首府伊兹密尔约69公里，始建于公元前11年，面积205平方公里，2011年人口28,629。"},{"page_url":"https://pl.wikipedia.org/wiki/Kip_Thorne","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Kip_Thorne_at_Caltech.jpg","page_title":"Kip Thorne","context_page_description":"Kip Stephen Thorne – amerykański fizyk teoretyczny i astrofizyk, popularyzator nauki i nauczyciel akademicki.\\nJego prace są związane z m.in. ogólną teorią względności i kosmologią. Ukończył California Institute of Technology w 1962, trzy lata później otrzymał doktorat w Princeton University, jego promotorem był John Wheeler.\\nJest członkiem American Academy of Arts and Sciences, National Academy of Sciences i American Philosophical Society oraz laureatem wielu nagród i wyróżnień naukowych.\\nPracował jako konsultant naukowy przy produkcji filmu Interstellar, nadzorując m.in. proces tworzenia widowiskowej wizualizacji czarnej dziury. W fandomie sci-fi znany z promocji hipotezy tuneli czasoprzestrzennych. W Polsce ukazały się jego książki „Czarne dziury i krzywizny czasu” i „Interstellar i nauka”. Wraz z polską astrofizyczką Anną Żytkow wymyślił i opracował teoretycznie istnienie nowego rodzaju gwiazd zwanych obiektami Thorne-Żytkow.\\nW roku 2017 roku uzyskał Nagrodę Nobla w dziedzinie fizyki za zaobserwowanie wraz z Rainerem Weissem oraz Barrym C. Barishem fal grawitacyjnych."},{"page_url":"https://la.wikipedia.org/wiki/Passamaquoddy","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/The_Mi%27kmaq.png","page_title":"Passamaquoddy","context_page_description":"Passamaquoddy, vel populus Passamaquoddy, sunt una ex Primis Nationibus quae parvam Americae Septentrionalis boreorientalis partem incolunt, praecipue in Cenomannica et Novo Brunsvico. Ei regiones litorales secundum Sinus Fundy et Sinus Cenomannicae et secundum Flumen Sanctae Crucis et flumina influentia. Hieme in locos mediterraneos ad venandum diffugebant; aestate autem in litore et insulis propinquis artius convenire solebant, ubi cibum marinum plerumque petebant, inter quem phocoenidae. Nomen Passamaquoddy est peskotomuhkati in verbum Anglicum conversum, forma praenominis Peskotomuhkat, nominis quod sibi imponebant. Peskotomuhkat ad verbum significat 'qui pollachios hastá transfigit' vel 'qui locum habitant ubi pollachii abundant', momentum huius piscis monstrans. Ei piscibus hastá transfigendis, contra pisces hamo captos, piscabantur. Habuerunt ante adventum Europaeorum historiam solum oralem."},{"page_url":"https://nl.wikipedia.org/wiki/Dagrijverlichting","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Audi_R8_Led_20080225.jpg","page_title":"Dagrijverlichting","context_page_description":"Dagrijverlichting is een verlichting aan de voorzijde van een motorvoertuig die is bedoeld om het voertuig overdag beter zichtbaar te maken. Deze verlichting wordt automatisch ingeschakeld zodra de motor van het voertuig in werkende toestand is of in een toestand waarin deze direct gereed is om in werking te treden.\\nDagrijverlichting bestaat voor auto's uit twee witte lampen, tussen 250 en 1500 mm boven het wegdek aan de voorzijde van het voertuig geplaatst op een afstand van minimaal 600 mm van elkaar. Een motorfiets heeft één lamp. Op een zijspan kan een tweede licht zijn aangebracht. De lichtbundel moet vanaf 20 graden horizontaal naar beide zijden en vanaf 10 graden verticaal omhoog en omlaag zichtbaar zijn. De lichten worden automatisch gedoofd zodra de dimlichten worden ingeschakeld. In plaats van enkele lampen kunnen ook meerdere lampen bij elkaar in een behuizing worden gemonteerd. Vaak worden LED-lampen hiervoor toegepast.\\nSinds februari 2011 is dagrijverlichting in Nederland en België voor nieuw op de markt verschenen voertuigen wettelijk verplicht gesteld, conform richtlijn 2008/89/EC van de Europese Unie."},{"page_url":"https://vec.wikipedia.org/wiki/La_Morra","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/37/La_Morra_seen_from_south.JPG","page_title":"La Morra","context_page_description":"La Morra el xe on comun n'te la provincia de Cuneo chel fa parte de la rejon Piemonte"},{"page_url":"https://fr.wikipedia.org/wiki/Pierre_aux_neuf_gradins","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/9_gradins_pierre_n%C2%B02_vue_face.jpg","page_title":"Pierre aux neuf gradins","context_page_description":"La pierre aux neuf gradins se trouve sur la commune de Soubrebost, à proximité de Pontarion, dans le département de la Creuse, en France. Un panneau signale le site et ses pierres à cupules comme étant une « énigme archéologique » mais celui-ci n'est protégé ni au titre des sites et paysages ni au titre des monuments historiques.\\nEn occitan limousin, cet endroit s'appelle « La peira daus nòu esbalets », qui signifie « la pierre aux neuf marches »."},{"page_url":"https://pt.wikipedia.org/wiki/Cesar_(Portugal)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Capela_de_frei_sim%C3%A3o.JPG","page_title":"Cesar (Portugal)","context_page_description":"Cesar é uma freguesia portuguesa do concelho de Oliveira de Azeméis, com 5,43 km² de área e 3 166 habitantes. A sua densidade populacional é de 583,1 hab/km². Foi elevada a vila a 13 de julho de 1990."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E9%98%BF%E7%88%BE%E6%96%AF%E9%80%9ACitadis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/3%2C52_Verneau_Citadis_n%C2%B01016_%28tram_Angers%29_par_Cramos.JPG","page_title":"阿爾斯通Citadis","context_page_description":"阿尔斯通Citadis，是法国阿尔斯通公司于法国拉罗歇尔及西班牙巴塞罗那生产的低地台电车，至2008年已经生产了1,140架次，并且在全球28个城市中使用。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BF%E3%82%A4%E3%83%80%E3%83%AB%E3%83%99%E3%82%A4%E3%82%B9%E3%83%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/West_potomac_park.jpg","page_title":"タイダルベイスン","context_page_description":"タイダルベイスンまたはタイダルベイズンは、アメリカ合衆国ワシントンD.C.のナショナル・モール南側に位置し、ポトマック川に隣接する入り江である。"},{"page_url":"https://azb.wikipedia.org/wiki/%DA%A9%DB%8C%D9%85%D8%A8%D8%B1%DB%8C%D8%AC%D8%8C_%D9%86%D8%A8%D8%B1%D8%A7%D8%B3%DA%A9%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Cambridge%2C_Nebraska_Nasby_St.JPG","page_title":"کیمبریج، نبراسکا","context_page_description":"کیمبریج، نبراسکا آمریکانین نبراسکا ایالتیندا یئر آلان بیر شهردیر و ۳٫۴۷ کیلومتر موربّع ساحه سی وار. ۲۰۱۰-جی ایلين نۆفوس ساییمی اساسیندا ۱۰۶۳ نفر دیر. بۇ شهر ۶۹۰ متر دنیز سئوییه‌سیندن اۇجالیقیدا یئرلشیر."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9E%D0%B2%D0%B5%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Oatnoodles.jpg","page_title":"Овес","context_page_description":"Овесот е вид на житно растение, кое припаѓа на родот овес, од семејството треви. Се користи за исхрана на луѓето и на домашните животни. Овесните посеви во светот зафаќаат околу 14 милиони хектари.\\nСтеблото е членковидно и поотпорно на свиткување од другите житни растенија. Просечна висина на овесот е околу 80-120 сантиметри. Листот е долг, влакнест, со форма на ланцета, со паралелна нерватура и без израстоци. Цветовите се сместени во метловидни класови, а цвета во јули и август. Овесот е типично самооплодувачко растение, плодот е крупа, срасната со плевицата. Постои зимска и пролетна сорта на овес.\\nВо овесот се присутни авенини, кои можат да предизвикаат целијакија кај мал дел од популацијата. Овесните продукти често можат да бидат контаминирани со други житарици кои содржат глутен, воглавно со пченица и јачмен.\\nОвесот е храна богата со хранливи материи, која при редовно консумирање делува на снижување на нивото на крвниот холестерол."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A8%D0%B0%D0%BC%D0%B4%D0%BE%D0%BB%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/%C3%89glise_champdolent.JPG","page_title":"Шамдолан","context_page_description":"Шамдола́н — муніципалітет у Франції, у регіоні Нова Аквітанія, департамент Приморська Шаранта. Населення — 402 осіб.\\nМуніципалітет розташований на відстані близько 410 км на південний захід від Парижа, 115 км на південний захід від Пуатьє, 39 км на південний схід від Ла-Рошель."},{"page_url":"https://ast.wikipedia.org/wiki/Puertu_Henry","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/Sur1.gif","page_title":"Puertu Henry","context_page_description":"Puertu Henry ta asitiáu na rexón austral de Chile, al sur del golfu de Penas sobre la mariña NW de la isla Madre de Dios nel llau SE del golfu Trinidá.\\nAlministrativamente pertenez a la provincia d'Última Esperanza de la XII Rexón de Magallanes y l'Antártica Chilena.\\nDende fai aprosimao 6.000 años les sos mariñes fueron habitaes pol pueblu kawésqar. A empiezos del sieglu xxi esti pueblu fuera práuticamente escastáu pola aición del home blancu."},{"page_url":"https://hu.wikipedia.org/wiki/Naivasha-t%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Kenya_Naivasha_Lake_2013_september_-_panoramio_%287%29.jpg","page_title":"Naivasha-tó","context_page_description":"A Naivasha-tó egy édesvízi tó Kenyában, Naivasha település mellett, Nakuru megyében, Nairobi északnyugati részén. A Nagy-hasadékvölgy része. A név a helyi Maasai Nai'posha névből származik."},{"page_url":"https://en.wikipedia.org/wiki/Opuntia_oricola","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Opuntia_oricola_3.jpg","page_title":"Opuntia oricola","context_page_description":"Opuntia oricola is a species of prickly pear cactus known by the common name chaparral prickly pear. It is native to southern California and Baja California, where it grows in coastal sage scrub and chaparral habitats."},{"page_url":"https://id.wikipedia.org/wiki/Pointillisme","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Seurat-La_Parade_detail.jpg","page_title":"Pointillisme","context_page_description":"Pointillisme adalah salah satu teknik dalam lukisan yang memanipulasi ketidaksensitifan mata dalam meneliti detail kumpulan titik hingga mampu memberikan kesan keberadaan bidang atau warna baru. Biasanya warna-warna yang bukan merupakan warna primer dibentuk secara visual dengan mendekatkan beberapa warna primer. Metode ini disebut Divisionisme. Tetapi pointillisme bisa pula mengacu kepada lukisan satu warna atau hitam putih saja. Efek dari perbedaan kerapatan titik bisa menciptakan halusinasi gradasi warna."},{"page_url":"https://es.wikipedia.org/wiki/Nancy_Reagan","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Edith_Luckett_Davis_with_Nancy_1931.jpg","page_title":"Nancy Reagan","context_page_description":"Nancy Davis Reagan ​ fue una actriz estadounidense; esposa de Ronald Reagan, 40º presidente de los Estados Unidos, y por tanto primera dama entre 1981 y 1989.\\nNacida en Nueva York, sus padres se divorciaron poco después de su nacimiento y Nancy se crio en Maryland con sus tíos mientras su madre continuaba desempeñándose como actriz. Bajo su nombre legal de Nancy Davis, actuó en Hollywood en los años 1940 y 1950, protagonizando películas como El cerebro de Donovan, Night into Morning y Hellcats of the Navy. Contrajo matrimonio en 1952 con Ronald Reagan, presidente en esas fechas del Sindicato de Actores de Cine, con quien tuvo dos hijos. Llegó a ser la primera dama de California durante el mandato de su marido como gobernador, desde 1967 hasta 1975, y fue durante este periodo que Nancy comenzó a colaborar con el Programa de Abuelos Adoptivos.\\nSe convirtió en la primera dama de Estados Unidos en enero de 1981 después de la elección de su marido. Fue criticada al principio debido a su decisión de reemplazar la vajilla de porcelana de la Casa Blanca, a pesar de ser sufragada por donaciones privadas."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_des_Saints_C%C3%B4me_et_Damien_sur_Marose%C3%AFka","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Church_of_Saints_Cosmas_and_Damian_in_Maroseyka_99.jpg","page_title":"Église des Saints Côme et Damien sur Maroseïka","context_page_description":"L'église des Saints Côme et Damien d'Asie Mineure sur Maroseïka de Moscou, mentionnée à partir du XVIᵉ siècle, est une des églises du quartier de la colline Saint-Jean située sur la rue Maroseïka.\\nLe bâtiment actuel, réalisation de l'architecte M. Kazakov dans le style du classicisme, date de 1791-1793.\\nL'église fut fermée vers 1930 et sa destruction programmée. Le bâtiment n'a cependant pas été rasé et servi de blanchisserie puis d'entrepôt et d'archive. Dans les années 1960 des bâtiments annexes de l'église laissèrent place à un immeuble administratif et l'extérieur de l'église partiellement restauré.\\nEn 1993 la ville de Moscou ordonna la restitution de l'église au patriarcat orthodoxe de Moscou, les services religieux ont repris en novembre de cette même année."},{"page_url":"https://ro.wikipedia.org/wiki/Tabas","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/%D8%A7%D9%85%D8%A7%D9%85%D8%B2%D8%A7%D8%AF%D9%87.jpg","page_title":"Tabas","context_page_description":"Tabas este un oraș din Iran."},{"page_url":"https://pl.wikipedia.org/wiki/Ru%C5%9B_Kijowska","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Vladimir_I_of_Kiev.PNG","page_title":"Ruś Kijowska","context_page_description":"Ruś Kijowska – średniowieczne państwo feudalne w Europie Wschodniej, rządzone przez dynastię Rurykowiczów pochodzenia wareskiego. Najstarsze źródło do historii Rusi Kijowskiej Powieść minionych lat wiąże początki państwa z rokiem 862, w którym wódz Waregów Ruryk przybył do Nowogrodu Wielkiego w celu zażegnania sporów pomiędzy plemionami wschodniosłowiańskimi i fińskimi. Centrum państwa ruskiego zostało w roku 882 przeniesione z Nowogrodu do Kijowa, gdzie znajdowało się w czasie jego największego rozkwitu. Historiografia ukraińska wiąże silniej powstanie państwa z ustanowieniem stolicy w Kijowie w 882 roku i legendarnym założeniem miasta Kijowa przez trzech braci Kija, Szczeka i Chorywa.\\nChoć dominującą grupą ludności Rusi Kijowskiej była od początku ludność słowiańska, to jednak jego powstanie wiązane jest z Waregami, którzy prowadzili handel na szlaku „od Waregów do Greków” prowadzącym od Bałtyku wzdłuż Dniepru do Morza Czarnego. Ludność wareska uległa na Rusi całkowitej asymilacji, a ludność fińska uległa tylko częściowej asymilacji ze Słowianami."},{"page_url":"https://ga.wikipedia.org/wiki/Intendente_(Metro_Liosp%C3%B3in)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Logo_aerobus_lx.jpg","page_title":"Intendente (Metro Liospóin)","context_page_description":"Is stáisiún é Intendente ar Líne Glas Metro Liospóin. Tá an stáisiún suite i Ascaill an Almirante Reis. Dearadh an stáisiún leis an ailtire Denis Gomes le suiteálacha ealaíne ag an bpéintéir Maria Keil."},{"page_url":"https://pl.wikipedia.org/wiki/Cerkiew_%C5%9Bw._Paraskewy_w_Kamiannej","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Kamianna%2C_cerkiew_%C5%9Bw._Paraskewy_%28HB4%29.jpg","page_title":"Cerkiew św. Paraskewy w Kamiannej","context_page_description":"Cerkiew św. Paraskewy w Kamiannej – dawna cerkiew prawosławna, wzniesiona w 1930 w Kamiannej.\\nPo 1947 przejęta i użytkowana przez kościół rzymskokatolicki, obecnie jako kościół parafialny pw. Nawiedzenia Najświętszej Maryi Panny Parafii w Kamiannej.\\nCerkiew wpisano na listę zabytków w 2011."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A2%85%E7%BA%B3%E8%B5%AB%E5%A7%86%C2%B7%E8%B4%9D%E4%BA%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Altalena_off_Tel-Aviv_beach.jpg","page_title":"梅纳赫姆·贝京","context_page_description":"梅纳赫姆·沃尔福维奇·贝京，波兰籍的犹太人，以色列政治家，利库德集团的创始人，第6任以色列总理。贝京出生于布列斯特，青年时投身犹太复国运动，1942年前往巴勒斯坦，1943年起担任犹太复国运动恐怖组织伊尔贡的领导人，曾领导伊尔贡与英国政府和阿拉伯人进行武装斗争。1948年成立右翼政党赫鲁特，并成为以色列右翼的代表人物和反对派领袖。1973年，贝京成立了右翼联盟利库德集团并担任领导人。1977年利库德集团在大选中获胜，贝京担任总理。1978年，贝京由于和埃及总统萨达特签订了戴维营协议，当年与后者一同获得诺贝尔和平奖。1981年，利库德集团再次在大选中获胜，贝京连任总理。1983年，贝京因为妻子去世、经济危机、黎巴嫩战事以及健康等原因宣布辞职，从此告别政治舞台。1992年3月9日，贝京在特拉维夫去世，享年78岁。"},{"page_url":"https://fr.wikipedia.org/wiki/RV_Huxley","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/RV_Huxley.png","page_title":"RV Huxley","context_page_description":"Le RV Huxley a été le premier navire de recherche halieutique de la Marine Biological Association of the United Kingdom exploité par le ministère de l'Agriculture, de la Pêche et de l'Alimentation-Direction des pêches entre 1921 et 1939, désormais connu sous le nom de Centre des sciences de l'environnement, des pêches et de l'aquaculture."},{"page_url":"https://simple.wikipedia.org/wiki/Six_Flags_Great_Adventure","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/SFGadv_Skyline.jpg","page_title":"Six Flags Great Adventure","context_page_description":"Six Flags Great Adventure is a theme park in Jackson Township, New Jersey, United States. It opened on July 4, 1974. The park complex also contains the Hurricane Harbor water park.\\nIn 2012, Six Flags combined Great Adventure Park with the Wild Safari Area to form a single 475-acre theme park. As of 2018, the park contained 12 roller coasters. Three are world-class rides: El Toro, Kingda Ka and Nitro. Kingda Ka, with a top speed of 128 mph feels like taking off from an aircraft carrier. At 458 feet tall guests say on a clear day you can see both the Philadelphia and New York City skylines. Nitro, another fast roller coaster, offers a panoramic view of the New Jersey countryside. El Toro is one of the tallest wooden roller coasters at 181 feet. The park includes a Safari Off-Road Adventure that has over 1,200 animals. It is the largest drive-through safari park in North America.\\nThere are three areas just for children. The Hurricane Harbor water park takes up 45 acres by itself. Between the three areas there are over 200 rides and attractions. Six Flags Great Adventure is open between spring break and late October."},{"page_url":"https://en.wikipedia.org/wiki/Manny_Randazzo_King_Cakes","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Manny_Randazzo_King_Cakes_-_Robert_Aderholt.jpg","page_title":"Manny Randazzo King Cakes","context_page_description":"Manny Randazzo King Cakes is a bakery in New Orleans, Louisiana in the United States. The bakery\\nwas founded in 1965 by Sam Randazzo and his three sons: Lawrence, Manuel and Anthony. The bakery specializes in king cakes.\\nIn 2019, Randazzo King Cakes won best traditional king cake in the annual King Cake Snob competition, beating 633 king cakes. Their king cake has been named one of the best in New Orleans by The Times-Picayune/The New Orleans Advocate food critic Ian McNulty and one of the best in the country by Food & Wine. Randazzo King Cakes have been featured on Delish and Eater, on Fox 8 New Orleans, and in Southern Living.\\nEvery year, US Congressmember Steve Scalise buys and delivers Randazzo King Cakes to fellow congresspeople during Mardi Gras."},{"page_url":"https://eo.wikipedia.org/wiki/Biblioteko_Dukino_Anna_Amalia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Anna-Amalie-1.jpg","page_title":"Biblioteko Dukino Anna Amalia","context_page_description":"La Herzogin Anna Amalia Bibliothek, estis fondita en 1691 far duko Vilhelmo Ernesto en Vajmaro. Mondfama estas la ovala kaj trietaĝa rokokosalono, kiun ornamas granda oleoportreto de duko Karlo Aŭgusto, pentrita de Ferdinand Jagemann. La apuda studcentro troviĝas ĉe Flava Kastelo."},{"page_url":"https://de.wikipedia.org/wiki/1970","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Seal_of_the_United_States_Environmental_Protection_Agency.svg","page_title":"1970","context_page_description":"1970 ist „Internationales Jahr der Bildung“.\\nEuropäisches Naturschutzjahr"},{"page_url":"https://en.wikipedia.org/wiki/Federal_Dam,_Minnesota","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/85/Cass_County_Minnesota_Incorporated_and_Unincorporated_areas_Federal_Dam_Highlighted.svg","page_title":"Federal Dam, Minnesota","context_page_description":"Federal Dam is a city in Cass County, Minnesota, United States, near Leech Lake. The population was 110 at the 2010 census. It is part of the Brainerd Micropolitan Statistical Area."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D8%A7%D8%BA%D8%A7%D9%83%D9%88%D8%AA%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Iroganeyama2.JPG","page_title":"ناغاكوتي","context_page_description":"ناغاكوتي هي مدن اليابان، تتبع آيتشي، بلغ عدد سكانها 59٬532 نسمة، في 2017، تبلغ مساحتها 21٬550٬000 متر مربع."},{"page_url":"https://it.wikipedia.org/wiki/Tis%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Tisa_CZ_CoA.jpg","page_title":"Tisá","context_page_description":"Tisá è un comune della Repubblica Ceca facente parte del distretto di Ústí nad Labem, nella regione omonima."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%91%E3%82%AD%E3%82%B9%E3%82%BF%E3%83%B3%E3%81%AE%E9%89%84%E9%81%93%E9%A7%85%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Pakistan_Railways_Network_Map.png","page_title":"パキスタンの鉄道駅一覧","context_page_description":"パキスタンの鉄道駅一覧は、パキスタンの鉄道駅の一覧である。\\nなるべく読みを付け、同名・同表記の駅には会社名・路線名も付けた。"},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Lake_County,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/293_W_Main_St_2.jpg","page_title":"National Register of Historic Places listings in Lake County, Ohio","context_page_description":"This is a list of the National Register of Historic Places listings in Lake County, Ohio.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Lake County, Ohio, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in an online map.\\nThere are 80 properties and districts listed on the National Register in the county, including 2 National Historic Landmarks.\\nThis National Park Service list is complete through NPS recent listings posted June 26, 2020."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_windmolens_in_Gelderland","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/De_Lelie_-_Aalten_-_2005.JPG","page_title":"Lijst van windmolens in Gelderland","context_page_description":"Hier volgt een lijst van windmolens in Gelderland. In Gelderland staan ca. 127 complete windmolens."},{"page_url":"https://de.wikipedia.org/wiki/Kriegsgefangenenlager_Sigmundsherberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/GuentherZ_2015-07-25_%282%29_Sigmundsherberg_Soldatenfriedhof.JPG","page_title":"Kriegsgefangenenlager Sigmundsherberg","context_page_description":"Das Kriegsgefangenenlager Sigmundsherberg war eines der größten Kriegsgefangenenlager der Donaumonarchie während des Ersten Weltkriegs."},{"page_url":"https://sv.wikipedia.org/wiki/Wavves","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Wavves.jpg","page_title":"Wavves","context_page_description":"Wavves är ett amerikanskt noiserockband från San Diego. De släppte sitt självbetitlade debutalbum 2008 och uppföljaren \\"Wavvves\\" 2009. Pitchfork har gett bandet uppmärksamhet.\\nWavves fjärde studioalbum Afraid of Heights släpptes den 26 mars 2013.\\nBandmedlemmarna Nathan och Stephen är även radiovärdar för Vinewood Boulevard Radio i Tv-spelet Gta V, där de bland annat spelar upp deras låt \\"Nine Is God\\", som de exklusivt skrivit för radiokanalen.\\nDen 13 september 2013 uppträdde bandet med låten hos Conan"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B8%D1%80%D0%B0_(%D0%BB%D1%83%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BA%D1%80%D0%B0%D1%82%D0%B5%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Normal_Kira_AS15-M-0305_LTVT.jpg","page_title":"Кира (лунный кратер)","context_page_description":"Кратер Кира — маленький вулканический кратер в южном полушарии обратной стороны Луны. Название присвоено по русскому женскому имени и утверждено Международным астрономическим союзом в 1976 г."},{"page_url":"https://tt.wikipedia.org/wiki/NGC_648","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/NGC_0648_SDSS.jpg","page_title":"NGC 648","context_page_description":"NGC 648 — Томанлыклар һәм йолдыз тупланмалары яңа гомуми каталогында теркәлгән галактика."},{"page_url":"https://fr.wikipedia.org/wiki/Championnat_du_monde_masculin_de_handball_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/K%C3%B6ln_deutz_k%C3%B6lnarena.jpg","page_title":"Championnat du monde masculin de handball 2019","context_page_description":"Le Championnat du monde masculin de handball 2019 est la 26ᵉ édition du Championnat du monde de handball qui a lieu du 10 au 27 janvier 2019. C'est une compétition organisée par la Fédération internationale de handball, elle réunit les meilleures sélections nationales.\\nPour la première fois, la compétition est organisée par deux pays, le Danemark et l'Allemagne. L'autre nouveauté pour ce tournoi est que, comme pour le tournoi féminin de hockey sur glace aux Jeux olympiques d'hiver de 2018, une équipe unifiée de Corée est amenée à participer à ce championnat du monde. Elle remplace la Corée du Sud qui avait obtenu sa qualification lors du Championnat d'Asie 2018. Pour faciliter l’intégration des joueurs nord-coréens, l'équipe sera composée de 20 joueurs au lieu de 16. À noter également qu'elle disputera le match d'ouverture face à l'Allemagne.\\nL'équipe de France, vainqueur de l'édition précédente et de quatre des cinq dernières compétitions, remet son titre en jeu. Après trois défaites en finale, le Danemark remporte son premier titre dans la compétition et devient la dixième équipe championne du monde."},{"page_url":"https://tr.wikipedia.org/wiki/Zikzak_diki%C5%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Cretan_embroidery.jpg","page_title":"Zikzak dikiş","context_page_description":"İngilizce:Featherstitch veya feather stitch ve Cretan stitch veya faggoting stitch yaprak damarının soluna ve sağına birbiri ardına gelerek çalışan açık, düğümlü dikiş nakış teknikleridir. Fermuar dikiş zikzak dikiş ile sınıflandırılır."},{"page_url":"https://de.wikipedia.org/wiki/Alternierende_Permutation","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Alternating_Permutation_qtl3.svg","page_title":"Alternierende Permutation","context_page_description":"Eine alternierende Permutation ist in der Kombinatorik eine Permutation der ersten natürlichen Zahlen, bei der keine Zahl der Größe nach zwischen der vorangehenden und der nachfolgenden Zahl steht. Beginnt die Folge mit einem Anstieg, so spricht man von einer Up-Down-Permutation, beginnt sie mit einem Abstieg von einer Down-Up-Permutation. Alternierende Permutationen weisen eine Reihe von Spiegelsymmetrien auf. Jede alternierende Permutation ungerader Länge entspricht einem vollen partiell geordneten Binärbaum und jede alternierende Permutation gerader Länge einem fast vollen solchen Baum. Die Anzahlen der alternierenden Permutationen fester Länge treten als Koeffizienten in der Maclaurin-Reihe der Sekans- und der Tangensfunktion auf und stehen in engem Zusammenhang mit den Euler- und den Bernoulli-Zahlen."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%B9%BF%E5%B3%B6%E7%A5%9E%E5%AE%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Taya%2C_Kashima%2C_Ibaraki.JPG","page_title":"鹿島神宮","context_page_description":"鹿島神宮は、茨城県鹿嶋市宮中にある神社。式内社、常陸国一宮。旧社格は官幣大社で、現在は神社本庁の別表神社。\\n全国にある鹿島神社の総本社。千葉県香取市の香取神宮、茨城県神栖市の息栖神社とともに東国三社の一社。また、宮中の四方拝で遥拝される一社である。"},{"page_url":"https://fr.wikipedia.org/wiki/WandaVision","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Paul_Bettany_by_Gage_Skidmore_2.jpg","page_title":"WandaVision","context_page_description":"WandaVision est une mini-série en neuf épisodes produite par Marvel Studios et diffusée sur la plateforme de streaming Disney+. Elle fait partie de la phase IV de l'univers cinématographique Marvel. Elle est basée sur les personnages de Wanda Maximoff, alias la Sorcière rouge, ainsi que de Vision, tous deux issus des comics Marvel.\\nElizabeth Olsen et Paul Bettany reprennent leurs rôles respectifs de Wanda Maximoff et de Vision. Ils sont accompagnés par Teyonah Parris, Kat Dennings, Randall Park et Kathryn Hahn.\\nLa série est officiellement confirmée en avril 2019 et la diffusion de ses 9 épisodes est prévue pour décembre 2020. Elle sert de préquelle à Doctor Strange in the Multiverse of Madness, dont la sortie est prévue 25 mars 2022."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D9%88%DB%8C%D8%B4%D9%86_%D9%88%D8%A7%D9%82%D8%B9%DB%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Thymus_serpyllum_flowering_plants.jpg","page_title":"آویشن واقعی","context_page_description":"سیسنبر یا سوسنبر یا آس بویه که در زبان‌های دیگر آویشن وحشی، آویشن خزنده و آویشن برکلند نیز نامیده می‌شود،\\nگیاهی است از تیره نعناعیان، دارای بوی خوش با گل‌های کوچک به رنگ گلی، سفید و ارغوانی. این گیاه در نواحی بحرالروم، ایران، آمریکای شمالی و سیبری می‌روید."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Aloe_species","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Aloe_perfoliata_%282%29.jpg","page_title":"List of Aloe species","context_page_description":"This is a list of the species of the genus Aloe. As of November 2016, the World Checklist of Selected Plant Families accepts about 580 species and hybrids."},{"page_url":"https://es.wikipedia.org/wiki/Ej%C3%A9rcito_de_Wurtemberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Knoe05_60.jpg","page_title":"Ejército de Wurtemberg","context_page_description":"El Real Ejército de Wurtemberg era en un principio el ejército del Ducado de Wurtemberg, y posteriormente en 1806 del reino de Wurtemberg. En 1871, se integra en el ejército imperial alemán conservando sus instituciones hasta la Primera Guerra Mundial."},{"page_url":"https://it.wikipedia.org/wiki/Storie_di_san_Benedetto_di_Monte_Oliveto_Maggiore","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Luca_signorelli%2C_storie_di_san_benedetto_a_monteoliveto%2C_san_benedetto_rimprovera_due_monaci_che_hanno_violato_la_Regola%2C_dett_02.jpg","page_title":"Storie di san Benedetto di Monte Oliveto Maggiore","context_page_description":"La Storie di san Benedetto di Monte Oliveto Maggiore sono un ciclo di affreschi nel Chiostro Grande dell'Abbazia di Monte Oliveto Maggiore, realizzati da Luca Signorelli, che vi lavorò dal 1497 al 1498, e dal Sodoma, che completò il ciclo dopo il 1505 con le ventisei lunette mancanti.\\nUna venne ridipinta dal Riccio.\\nSi tratta di una delle più complete descrizioni della vita di san Benedetto, ben trentacinque scene, che si basano sul racconto di san Gregorio Magno."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Hameln","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Stolpersteine_in_Hameln_f%C3%BCr_Familie_Birnbaum.jpg","page_title":"Liste der Stolpersteine in Hameln","context_page_description":"Die Liste der Stolpersteine in Hameln gibt eine Übersicht über die im Rahmen der Aktion des Künstlers Gunter Demnig verlegten Stolpersteine in der Stadt Hameln in Niedersachsen."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_op_17_maart","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Madame_Roland.png","page_title":"Lijst van personen geboren op 17 maart","context_page_description":"Dit is een lijst van personen die geboren zijn op 17 maart.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n766 - Haroen ar-Rashid, politicus uit het kalifaat van de Abbasiden bewerken\\n1231 - Shijo, Japanse Keizer bewerken\\n1473 - Jacobus IV van Schotland, koning van Schotland uit het Koninkrijk Schotland bewerken\\n1486 - Jan Chojeński, Poolse Lijst van bisschoppen en aartsbisschoppen van Przemyśl, Kanclerz, Lijst van bisschoppen van Płock, Aartsbisschop van Krakau, aartsdiakonaat en katholiek bisschop, rooms-katholiek priester bewerken\\n1520 - Thoinot Arbeau, Franse rooms-katholiek priester, schrijver, componist en choreograaf bewerken\\n1540 - Bernhard VII van Anhalt-Dessau, Duitse hertog, aristocraat bewerken\\n1591 - Gerard Seghers, kunstschilder uit de Zuidelijke Nederlanden bewerken\\n1605 - Georg II van Hessen-Darmstadt, Duitse bewerken\\n1615 - Gregorio Carafa, aartsbisschop, monnik bewerken"},{"page_url":"https://es.wikipedia.org/wiki/Guerra_civil_colombiana_de_1876-1877","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/Mapa_de_los_Estados_Unidos_de_Colombia.jpg","page_title":"Guerra civil colombiana de 1876-1877","context_page_description":"La guerra civil de 1876 a 1877, también conocida como la Guerra de las Escuelas; fue un conflicto interno de Colombia que tuvo un carácter político-religioso y fue la manifestación de los intereses del Partido Conservador Colombiano en oposición al gobierno de la facción radical del Partido Liberal Colombiano."},{"page_url":"https://en.wikipedia.org/wiki/Tirggel","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/Migros-Tirggel.jpg","page_title":"Tirggel","context_page_description":"Tirggel are traditional Christmas biscuits from Zürich, Switzerland. Made from flour and honey, they are thin, hard, and sweet."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A2%D1%83%D1%80%D0%B8%D0%B7%D1%8A%D0%BC_%D0%B2_%D0%91%D1%8A%D0%BB%D0%B3%D0%B0%D1%80%D0%B8%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Staia-v-muzeia.jpg","page_title":"Туризъм в България","context_page_description":"Туризмът е един от основните клонове на българската икономика. Разположена на кръстопът, свързващ Изтока и Запада от хилядолетия, България е била дом на много цивилизации, включително на траки, римляни, византийци, славяни, древни българи и османци. В страната има изобилие от исторически и природни забележителности, музеи и манастири, разпръснати на сравнително малка, но транспортно леснодостъпна територия. Основните ски курорти са Боровец, Банско и Пампорово, а най-популярните морски – Созопол, Несебър, Златни пясъци, Слънчев бряг и Албена. Планините Рила, Пирин, Витоша, Стара планина и Родопите привличат любители на алтернативния туризъм и алпинисти.\\nПрез 2016 г. България е била посетена от 10,6 милиона туристи. Пътешествениците от три страни – Гърция, Румъния и Италия – отговарят за близо 38% от всички посещения. През 2015 година броят на заетите в сектора се оценява на около 92 хиляди души, а заедно с косвено заетите – на около 338 хиляди.\\nОсвен традиционните форми на туризъм, в България са развити и балнеоложкия туризъм. През последните години особено популярен става селският туризъм, както и други алтернативни форми на туризъм."},{"page_url":"https://zh.wikipedia.org/wiki/2018%E5%B9%B4%E4%B8%AD%E9%9D%9E%E5%8C%97%E4%BA%AC%E5%B3%B0%E4%BC%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Mohamed_Abdullahi_Farmajo_%28cropped%29.jpg","page_title":"2018年中非北京峰会","context_page_description":"2018年中非合作论坛北京峰会是原定第七届部长会议规模扩大所召开的中国同非洲建交国家的领导人会议，于2018年9月3日至4日在北京举行。中非领导人围绕“合作共赢，携手构建更加紧密的中非命运共同体”这一峰会主题，共叙友情，共商合作，共话未来。这是中非友好大家庭的又一次大团圆，也是中国今年举办的规模最大、外国领导人出席最多的主场外交。众多非洲国家领导人和非盟委员会主席率团与会，联合国秘书长作为特邀嘉宾、27个国际和非洲地区组织作为观察员也出席了峰会有关活动。\\n在2016、2018年与中华人民共和国复交的圣多美普林西比、布吉纳法索也参与了本届峰会。"},{"page_url":"https://fr.wikipedia.org/wiki/H%C3%A9l%C3%A8ne_de_Rascie","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Geiger_Aradi_gyules_1131.jpg","page_title":"Hélène de Rascie","context_page_description":"Hélène de Rascie, née après 1109 et morte après 1146 est reine consort de Hongrie de 1131 à 1141 par son mariage avec Béla II de Hongrie dit l'Aveugle. Fille d'Uroš Ier Vukanović, son mariage avec Béla II est arrangé par son cousin Étienne II de Hongrie. Comme son père, Béla II a eu les yeux crevés sur ordre de Coloman, père d'Étienne II. Après sa mort, elle est régente du royaume avec son frère Beloš de 1141 à septembre 1146, jusqu'à ce que son fils aîné Géza II de Hongrie soit en âge de gouverner. Deux de ses autres fils règneront, Ladislas, et Étienne."},{"page_url":"https://oc.wikipedia.org/wiki/Bandi%C3%A8ra_basca","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Flag_of_the_Basque_Country.svg","page_title":"Bandièra basca","context_page_description":"L'ikurrinha es la bandièra de la Comunautat Autonòma Basca e tanben la que es estat adoptada pel País Basc.\\nFoguèt creada en 1894 pels fraires Luis e Sabino Arana, e a la debuta correspondiá, dins tota la tièra de bandièras que dessenhèron, a la que identificava lo territòri de Biscaia. Mai tard passèt a representar la totalitat del País Basc, o coma se disiá en aquel moment, Euzkadi. A partir de la constitucion de la Comunautat Autonòma Basca, o Euskadi, s'adoptèt coma bandièra oficiala d'aquesta entitat.\\nComa o explicava Arana, en dessenhar la bandièra s'inspirèt de l'escut de Biscaia:\\nA un fons roge, color de la senhoriá de Biscaia e, segon Arana, color de l'ancian fons de l'escut. Sus aqueste fons, se superpausa una aspa verda, simbòl de l'apòstol Sant Andreu, sant patron de Biscaia en aquel temps, presa de las sèt croses de la bordura de l'escut. Se ditz que simboliza l'independéncia biscaïna per èsser arribada lo jorn de Sant Andrieu la victòria d'Arrigoriaga contra los espanhòls.\\nA la crotz de Sant Andrieu es superpausada una crotz blanca, simbòl de la religion catolica, coma la qu'apareis inserida al roure de l'escut."},{"page_url":"https://pt.wikipedia.org/wiki/Bar%C3%B3metro","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/MercuryBarometer.svg","page_title":"Barómetro","context_page_description":"O barómetro ou barômetro é um instrumento científico utilizado em meteorologia para medir a pressão atmosférica.\\nExistem dois tipos de uso corrente: os barômetros de mercúrio e os barômetros aneroides.\\nInventado por Evangelista Torricelli em 1643, o barômetro de mercúrio é composto por um tubo de vidro com uma das extremidades fechadas, uma base e mercúrio. Primeiramente, ele encheu o tubo de vidro com mercúrio e o tampou com o dedo. Em seguida, inverteu-o e mergulhou-o na base que também continha mercúrio.\\nA coluna de mercúrio descia até estabilizar em 760 milímetros. Tal fato deve-se à equiparação entre o peso da coluna de mercúrio dentro do tubo e o peso da coluna de ar aplicados na base que contém mercúrio. Esse peso exercido sobre a base de mercúrio pelo ar é a pressão atmosférica, a qual influencia diretamente na altura da coluna de mercúrio. Quanto maior a pressão atmosférica, mais comprida fica a coluna de mercúrio. Em 1648, Blaise Pascal comprovou essa dependência ao fazer o experimento a 1478 metros de altitude, de modo que a coluna do mercúrio caía a 8,6 centímetros.\\nJá o barômetro aneroide é menos preciso, porém mais compacto."},{"page_url":"https://en.wikipedia.org/wiki/List_of_West_Virginia_wildlife_management_areas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Beech_Fork_State_Park_Lake.jpg","page_title":"List of West Virginia wildlife management areas","context_page_description":"This is a list of wildlife management areas in West Virginia."},{"page_url":"https://en.wikipedia.org/wiki/List_of_State_Protected_Monuments_in_Kerala","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Budha_mavelikara_kerala.jpg","page_title":"List of State Protected Monuments in Kerala","context_page_description":"This is a list of State Protected Monuments as officially reported by and available through the website of the Archaeological Survey of India in the Indian state Kerala. The monument identifier is a combination of the abbreviation of the subdivision of the list and the numbering as published on the website of the ASI. 116 Kerala State Protected Monuments have been recognized by the Kerala State Department of Archaeology under Kerala Ancient Monuments and Archaeological sites and Remains Act of 1968."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%83%D0%B4%D0%B5%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D1%83%D0%B7%D0%BA%D0%BE%D0%BA%D0%BE%D0%BB%D0%B5%D0%B9%D0%BD%D0%B0%D1%8F_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%B0%D1%8F_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Kud-9.JPG","page_title":"Кудемская узкоколейная железная дорога","context_page_description":"Кудемская узкоколейная железная дорога — лесовозная узкоколейная железная дорога в городском округе «Северодвинск» Архангельской области. Ширина колеи 750 мм. Неэлектрифицированная. Максимальная длина 108 км, эксплуатируется в настоящее время 35 км. Год открытия: 1949 год. Пассажирское движение, грузовое движение."},{"page_url":"https://pl.wikipedia.org/wiki/Arno_(atol)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/ArnoAtoll_ASTER_2002jul25.jpg","page_title":"Arno (atol)","context_page_description":"Arno – zamieszkany atol w łańcuchu Ratak Chain Wysp Marshalla na Oceanie Spokojnym.\\nAtol obejmuje 83 wysepki, m.in. Kebjaltak, Ulien, Rearlaplap, Langor i Bikarej. Wraz z laguną Arno zajmuje 338,69 km².\\nAtol został odkryty przez angielskiego kapitana Johna Marshalla w 1788 roku.\\nNa wybrzeżu laguny wysepki Jab'u znajduje się wrak samolotu Consolidated B-24 Liberator z okresu II wojny światowej, który rozbił się przy lądowaniu 2 stycznia 1944 roku.\\nW latach 1964–1967 na atolu stwierdzono występowanie 126 gatunków roślin i 15 gatunków ptaków, m.in. występowała tu Ducula oceanica ratakensis."},{"page_url":"https://fr.wikipedia.org/wiki/Colombier_(%C3%A9difice)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/France%2C_Marne%2C_Villers-en-Argonne_%284%29.JPG","page_title":"Colombier (édifice)","context_page_description":"Un colombier était à l'époque féodale un édifice destiné à loger et à élever des pigeons.\\nLe colombier, lointain héritier du colombarium romain, est nommé plus souvent pigeonnier depuis le XVIIIᵉ siècle mais le terme de colombier peut dans une acception plus étroite désigner un pigeonnier en forme de tour, généralement indépendant des autres bâtiments. Les mutations agricoles des Temps modernes, par l'introduction des cultures fourragères comme la betterave, ont condamné insensiblement l'intérêt nourricier et la rentabilité de l'élevage en colombier.\\nUne grande diversité architecturale caractérise les petits dérivés domestiques ou isolés du colombarium. Il existe une surprenante géographie des colombiers, avec des densités éminemment variables suivant les régions du Moyen-Orient et méditerranéennes, ou encore les contrées d'Europe occidentale. Les colombiers ont marqué les paysages en Gascogne, Quercy, Occitanie toulousaine, Provence, Touraine, Anjou, Normandie, Picardie mais aussi l'Angleterre après la conquête normande et plus tardivement en Basse Écosse, notamment sur les rives du Firth of Forth, près d'Édimbourg pendant le règne des Stuart."},{"page_url":"https://en.wikipedia.org/wiki/Alfonso_Castillo_Orta","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/ACastilloOrta008.JPG","page_title":"Alfonso Castillo Orta","context_page_description":"Alfonso Castillo Orta was a Mexican potter from the ceramics town of Izúcar de Matamoros, Puebla, whose work made the ceramics of this area internationally known. He was particularly known for his trees of life sculptures and received various awards for his work, including the Premio Nacional de Ciencias y Artes in 1996. He taught the craft to his wife and five children who continue to create pieces in his style in the family workshop."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_H%C3%BCtten_des_Pf%C3%A4lzerwald-Vereins","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Bauernwaldh%C3%BCtte3.JPG","page_title":"Liste der Hütten des Pfälzerwald-Vereins","context_page_description":"Der Pfälzerwald-Verein erbaute seit 1904 über 110 Hütten und Gasthäuser in der Pfalz und in der Saarpfalz. Dies ist eine weitgehend vollständige Liste dieser Gebäude. Einige sind inzwischen verkauft oder verpachtet worden, aber fast alle werden auch heute noch als Wanderhütten für die Einkehr und zum Schutz für die Wanderer betrieben und fast alle sind für Feste und Veranstaltungen zu mieten. Grundlage der Liste ist die ursprüngliche Liste des Pfälzerwald-Vereins aus dem Jahrgang 1999/2000. Bei der Bewirtung ist nur unterschieden, ob die Hütte überhaupt während der Woche geöffnet hat. Für Näheres muss die Internetseite des PWV oder des Betreibers eingesehen werden.\\n¹ B. Bewirtung in der Hütte\\n² S. Schlafplätze in der Hütte\\n\uFEFF Rot unterlegte Hütten wurden vom Pfälzerwald-Verein abgegeben."},{"page_url":"https://it.wikipedia.org/wiki/Bibiano_Fernandes","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Bibiano_Fernandes.jpg","page_title":"Bibiano Fernandes","context_page_description":"Bibiano Fernandes è un atleta di arti marziali miste brasiliano.\\nCombatte nella divisione dei pesi gallo per l'organizzazione singaporiana ONE FC, nella quale è l'attuale campione di categoria dal 2013; in passato è stato il primo campione dei pesi piuma e l'unico campione dei pesi gallo nella promozione giapponese Dream.\\nPrima del suo ingresso nella Dream Fernandes è stato un campione di jiu jitsu brasiliano di livello internazionale, vincendo il campionato del mondo nel 2002, 2003, 2005 e 2006."},{"page_url":"https://en.wikipedia.org/wiki/Ajit_Singhvi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Philanthropist_Ajit_Singhvi.jpg","page_title":"Ajit Singhvi","context_page_description":"Ajit Singhvi is philanthropist of Indian origin and a management expert based in London. He is best known as professorial chair donor at IIT Roorkee and IIT Madras. Together with Abdullahi Adamu and Ernest Shonekan, Singhvi received attention for campaigning with letters to the presidency for a shift in Nigeria's economic recovery model in 1993."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_im_Kreis_Rendsburg-Eckernf%C3%B6rde","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Herrenhaus_Louisenlund.JPG","page_title":"Liste der Kulturdenkmale im Kreis Rendsburg-Eckernförde","context_page_description":"In der Liste der Kulturdenkmale im Kreis Rendsburg-Eckernförde sind die Kulturdenkmale im schleswig-holsteinischen Kreis Rendsburg-Eckernförde aufgelistet.\\nGrundlage der Einzellisten sind die in den jeweiligen Listen angegebenen Quellen. Die Angaben in den einzelnen Listen ersetzen nicht die rechtsverbindliche Auskunft der zuständigen Denkmalschutzbehörde. Die erforderlichen Denkmaleigenschaften werden im Denkmalschutzgesetz von Schleswig-Holstein festgeschrieben."},{"page_url":"https://es.wikipedia.org/wiki/Epitelio_escamoso_estratificado","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Tinci%C3%B3n_hematoxilina-eosina.jpg","page_title":"Epitelio escamoso estratificado","context_page_description":"Un epitelio escamoso estratificado consiste en células epiteliales escamosas, establecidas en capas sobre una membrana basal. Solo una capa está en contacto con dicha membrana basal; Las otras capas se unen una a la otra para mantener la integridad de la estructura. Aunque este epitelio es llamado escamoso, muchas células dentro de las capas no son planas; esto se debe a la convención de denominarlo epitelio en función del tipo de células en la superficie.\\nEste tipo de epitelio está bien adaptado a zonas en el cuerpo que están sujetas a constante abrasión. Así, las capas pueden ser secuencialmente mudadas y reemplazadas antes de que se exponga la membrana basal.\\nEl epitelio escamoso estratificado se clasifica a su vez por la presencia o ausencia de queratina en la superficie apical de la membrana plasmática. Las superficies sin queratina deben permanecer humedecidas por secreciones corporales para prevenir que se sequen y mueran, mientras que las superficies queratinizadas se mantienen hidratadas y protegidas por la queratina.\\nEpitelios escamosos estratificados sin queratina: la córnea, la boca, el esófago, la vagina, y la parte interna de los labios."},{"page_url":"https://eo.wikipedia.org/wiki/Ilm-parko","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2c/Superioris_Saxoniae_%28Merian%29_355.jpg","page_title":"Ilm-parko","context_page_description":"Ilm-parko estas la plej granda kaj konata pejzaĝparko en Vajmaro, Germanujo. Ekde sia stariĝo en la 18-a jarcento restis kvazaŭ netuŝita nombriĝante tial inter la plej bone deorigine konserviĝintaj klasikismaj respektive romantikismaj parkoj. Helpis konsile la starigon Johann Wolfgang von Goethe. Karakterizas ĝin la enrigardaksoj, la belaj pontetoj trans la riveron Ilm, la multo de arkitekturaĵoj parkaj kaj la altvaloraj arboj kiuj parte devenis de ekstere de Eŭropo. La komplekso estas parto de la UNESKO-mondheredaĵaro ekde 1998 prizorgate de Klassik Stiftung Weimar."},{"page_url":"https://es.wikipedia.org/wiki/Nati_Mistral","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Nati_Mistral.jpg","page_title":"Nati Mistral","context_page_description":"Natividad Macho Álvarez, más conocida por su nombre artístico Nati Mistral, ​ fue una actriz y cantante española, estrechamente vinculada a Argentina y México.\\nInició su carrera discográfica en 1944 y desde entonces interpretó y grabó coplas andaluzas, pasodobles, boleros, cuplés, zarzuelas, rancheras y valses criollos. Protagonizó las películas María Fernanda, la jerezana, Oro y marfil, Currito de la cruz y Cabaret. En la escena sobresalió por su dicción exacta y claridad de pronunciación, lo que la llevó a dar recitales poéticos de autores clásicos.​"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B1%D1%83_%D0%86%D0%B1%D1%80%D0%B0%D0%B3%D1%96%D0%BC_%D0%B0%D0%BB%D1%8C-%D0%93%D0%B0%D1%88%D0%B5%D0%BC%D1%96_%D0%B0%D0%BB%D1%8C-%D0%9A%D1%83%D1%80%D0%B0%D1%88%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Hajji%E2%80%98Abdallah.jpg","page_title":"Абу Ібрагім аль-Гашемі аль-Кураші","context_page_description":"Абу Ібрагім аль-Гашемі аль-Кураші — халіф Ісламської держави Іраку і Леванту. Його призначення Радою шури було оголошено 31 жовтня 2019 року, менш ніж через тиждень після смерті Абу Бакра аль-Багдаді — першого лідера ІДІЛ."},{"page_url":"https://fr.wikipedia.org/wiki/Polyester","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Ouvertureanhydride.png","page_title":"Polyester","context_page_description":"Un polyester est un polymère dont les motifs de répétition de la chaîne principale contiennent la fonction ester."},{"page_url":"https://pl.wikipedia.org/wiki/Tournoisis","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Tournoisis_church.jpg","page_title":"Tournoisis","context_page_description":"Tournoisis – miejscowość i gmina we Francji, w Regionie Centralnym, w departamencie Loiret.\\nWedług danych na rok 1990 gminę zamieszkiwały 332 osoby, a gęstość zaludnienia wynosiła 22 osoby/km²."},{"page_url":"https://en.wikipedia.org/wiki/Trichome","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Red_Trichomes_of_the_roses.jpg","page_title":"Trichome","context_page_description":"Trichomes, from the Greek τρίχωμα meaning \\"hair\\", are fine outgrowths or appendages on plants, algae, lichens, and certain protists. They are of diverse structure and function. Examples are hairs, glandular hairs, scales, and papillae. A covering of any kind of hair on a plant is an indumentum, and the surface bearing them is said to be pubescent."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D8%B2%D9%8A%D8%B1_%D8%A7%D9%84%D8%AF%D9%81%D8%A7%D8%B9_(%D8%A7%D9%84%D8%A7%D8%AA%D8%AD%D8%A7%D8%AF_%D8%A7%D9%84%D8%B3%D9%88%D9%81%D9%8A%D8%AA%D9%8A)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Podvoisky_1903.jpg","page_title":"وزير الدفاع (الاتحاد السوفيتي)","context_page_description":"وزير دفاع الاتحاد السوفيتي هو الوزير المسؤول عن شؤون الدفاع بجمهورية روسيا السوفيتية الاتحادية الاشتراكية فيما بين 1917 و1922 ثم الاتحاد السوفيتي من عام 1922 وحتى عام 1991."},{"page_url":"https://en.wikipedia.org/wiki/2016_Belgium_Tour","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/2016_Lotto_Belgium_Tour_33a.jpg","page_title":"2016 Belgium Tour","context_page_description":"The 2016 Lotto Belgium Tour is the fourth edition of the Lotto-Belisol Belgium Tour, previous called Lotto-Decca Tour, a women's cycle stage race in Belgium. The tour has an UCI rating of 2.1."},{"page_url":"https://es.wikipedia.org/wiki/Domnall_M%C3%B3r_Ua_Briain","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/LimerickCICathedral.jpg","page_title":"Domnall Mór Ua Briain","context_page_description":"Domnall Mór Ua Briain, o Domnall Mór mac Toirrdelbaig Uí Briain, fue rey de Thomond en Irlanda de 1168 a 1194 y pretendiente al título de Rey de Munster. Aparece mencionado también como Rey de Limerick, título que pertenece a la dinastía O'Brien desde la anexión de la ciudad nórdica por Brian Boruen el siglo X."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_okrese_Plze%C5%88-sever","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Horn%C3%AD_B%C4%9Bl%C3%A1_-_kapli%C4%8Dka.JPG","page_title":"Seznam kulturních památek v okrese Plzeň-sever","context_page_description":"Tento seznam nemovitých kulturních památek v okrese Plzeň-sever vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu.\\nSeznam kulturních památek v Čeminách\\nSeznam kulturních památek v Hromnici včetně částí obce Chotiná, Kostelec, Nynice, Planá a Žichlice\\nSeznam kulturních památek v Kozojedech včetně částí obce Borek, Břízsko, Lednice a Robčice\\nSeznam kulturních památek v Kožlanech včetně částí obce Dřevec, Hedčany a Hodyně\\nSeznam kulturních památek v Kralovicích včetně částí obce Bukovina, Hradecko, Mariánský Týnec, Řemešín a Trojany\\nSeznam kulturních památek v Krsech včetně částí obce Kejšovice, Polínka a Trhomné\\nSeznam kulturních památek v Líšťanech včetně částí obce Hunčice, Lipno, Luhov, Náklov, Písek a Třebobuz"},{"page_url":"https://en.wikipedia.org/wiki/New_London,_Connecticut","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Harry-K-Daghlian.gif","page_title":"New London, Connecticut","context_page_description":"New London is a seaport city and a port of entry on the northeast coast of the United States, located at the mouth of the Thames River in New London County, Connecticut. It was one of the world's three busiest whaling ports for several decades beginning in the early 19th century, along with Nantucket and New Bedford, Massachusetts. The wealth that whaling brought into the city furnished the capital to fund much of the city's present architecture. The city subsequently became home to other shipping and manufacturing industries, but it has gradually lost most of its industrial heart.\\nNew London is home to the United States Coast Guard Academy, Connecticut College, Mitchell College, and The Williams School. The Coast Guard Station New London and New London Harbor is home port to the Coast Guard Cutter Chinook and the Coast Guard's tall ship Eagle. The city had a population of 27,620 at the 2010 census. The Norwich–New London metropolitan area includes 21 towns and 274,055 people."},{"page_url":"https://no.wikipedia.org/wiki/Feltkanon","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/24-%D0%B3%D1%80%D0%B8%D0%B2%D0%B5%D0%BD%D0%BA%D0%BE%D0%B2%D0%B0%D1%8F_%28152-%D0%BC%D0%BC%29_%D0%BE%D1%81%D0%B0%D0%B4%D0%BD%D0%B0%D1%8F_%D0%BF%D0%B8%D1%89%D0%B0%D0%BB%D1%8C_%D0%A6%D0%B0%D1%80%D1%8C_%D0%90%D1%85%D0%B8%D0%BB%D0%BB%D0%B5%D1%81_%28%D0%B2%D0%B8%D0%B4_%D1%81%D0%B1%D0%BE%D0%BA%D1%83_1%29.jpg","page_title":"Feltkanon","context_page_description":"Feltkanon er en flyttbar kanon, brukt av feltartilleri.\\nI motsetning til faste kanoner blir feltkanoner flyttet til der hvor fienden er, for å angripe disse. Feltkanonene plasseres bak fronten, og gir støtte- eller oppmykningsild for infanteri eller kavaleri. Normalt har feltkanonene flat prosjektilbane. En typisk feltkanon har kaliber mellom 75 – 105 millimeter. De første feltkanonene ble trukket av hester, men ettervert ble de trukket av motoriserte kjøretøy, og enkelte ble også selvdrevne.\\nUnder andre verdenskrig ble et større antall feltkanoner satt ut i norske kystfort av tyskerne i mangel på festningskanoner. Disse var tatt som krigsbytte fra andre europeiske land, som Polen og Frankrike.\\nI Norge brukte man feltkanoner tidligere, men de er nå erstattet med felthaubitser, som har en høyere prosjektilbane, men kortere rekkevidde."},{"page_url":"https://en.wikipedia.org/wiki/Incense","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Katorisenkou.jpg","page_title":"Incense","context_page_description":"Incense is aromatic biotic material that releases fragrant smoke when burned. The term is used for either the material or the aroma. Incense is used for aesthetic reasons, aromatherapy, meditation, and ceremony. It may also be used as a simple deodorant or insect repellent.\\nIncense is composed of aromatic plant materials, often combined with essential oils. The forms taken by incense differ with the underlying culture, and have changed with advances in technology and increasing number of uses.\\nIncense can generally be separated into two main types: \\"indirect-burning\\" and \\"direct-burning\\". Indirect-burning incense is not capable of burning on its own, and requires a separate heat source. Direct-burning incense is lit directly by a flame and then fanned or blown out, leaving a glowing ember that smoulders and releases a smoky fragrance. Direct-burning incense is either a paste formed around a bamboo stick, or a paste that is extruded into a stick or cone shape."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B8%D1%81%D0%B8%D0%B9_%E2%80%94_%D0%B2%D0%BE%D0%BB%D0%BE%D1%81%D0%B0%D1%82%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Boris_Yeltsin-2.jpg","page_title":"Лисий — волосатий","context_page_description":"«Лисий — волохатий» — поширений політичний жарт, заснований на парадоксальній закономірності чергування керівників Росії та СРСР з грудня 1825 року, коли на царський трон зійшов Микола I, який мав не дуже пишну шевелюру.\\nНайяскравішою особливістю цього «політологічного принципу» є те, що як фундаментальна визначальна ознака взята чисто формальна, зовнішня відмінність державних діячів один від одного. Вплив цієї ознаки на політичні процеси в країні ніяк не доведений, але при цьому дана умова завжди дотримується, а її виконання ніяк не залежить від авторів жарту. Таким чином, чиста випадковість виявляється закономірністю, що являє собою унікальний історичний парадокс."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89levage_bovin_au_Br%C3%A9sil","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Taureau_charolais_2.jpg","page_title":"Élevage bovin au Brésil","context_page_description":"L'élevage bovin au Brésil résulte de l'introduction de bovins issus de l'élevage portugais, pays d'origine des colonisateurs. Par la suite des introductions de zébus, bien adaptés aux conditions climatiques du pays, ont eu lieu. Des races métissées créées au Brésil sont également élevées.\\nEn 2011, le Brésil était à la deuxième place du marché d'exportation de viande bovine."},{"page_url":"https://cs.wikipedia.org/wiki/Bajd%C5%BE%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Bayji_Fertiliser_Plant.jpg","page_title":"Bajdží","context_page_description":"Bajdží je město v Iráku. Leží v guvernorátu Saladdín přibližně 200 kilometrů severozápadně od Bagdádu, přibližně v polovině hlavní silnice z Bagdádu do Mosulu. Má přibližně šedesát tisíc obyvatel.\\nVe městě je jedna z největších iráckých ropných rafinérií.\\nPřes město vede Bagdádská dráha, která se v něm kříží s dráhou vedoucí kolmo od Kirkúku směrem do Hadíthy."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A5%D0%B8%D0%BD%D1%87%D0%B5%D1%88%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Hincesti_Primaria.jpg","page_title":"Хинчешти","context_page_description":"Хинчешти — місто в Молдові, центр Хинчештського району. Розташований на річці Когильник за 36 км від Кишиніва."},{"page_url":"https://de.wikipedia.org/wiki/K%C3%B6feln","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/HP_K%C3%B6feln.png","page_title":"Köfeln","context_page_description":"Köfeln ist ein Ortsteil der Gemeinde Harth-Pöllnitz im Landkreis Greiz in Thüringen."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%95%D7%A8%D7%95%D7%AA%D7%99_%D7%94%D7%90%D7%9E%D7%99%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Laura_Bush_and_Dorothy_Hamill_%28cropped%29_-_Hamill.jpg","page_title":"דורותי האמיל","context_page_description":"דורותי סטיוארט האמיל היא מחליקה לשעבר ופרשנית טלוויזיה אמריקאית להחלקה אמנותית, אלופה אולימפית ואליפות עולם ו-3 פעמים ברציפות אלופת ארצות הברית בהחלקה אמנותית ליחידות."},{"page_url":"https://en.wikipedia.org/wiki/Ain_W_Zain","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Awzgt01.jpg","page_title":"Ain W Zain","context_page_description":"Ain W Zain also known as Ain Wazein is a Lebanese village in the Chouf District in the Mount Lebanon Governorate"},{"page_url":"https://en.wikipedia.org/wiki/Cinema_of_Italy","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Franco_Nero_%28Django%29.jpg","page_title":"Cinema of Italy","context_page_description":"The Cinema of Italy comprises the films made within Italy or by Italian directors. The first Italian director is considered to be Vittorio Calcina, a collaborator of the Lumière Brothers, who filmed Pope Leo XIII in 1896. Since its beginning, Italian cinema has influenced film movements worldwide. As of 2018, Italian films have won 14 Academy Awards for Best Foreign Language Film as well as 12 Palmes d'Or, one Academy Award for Best Picture and many Golden Lions and Golden Bears.\\nItaly is a birthplace of Art Cinema and the stylistic aspect of film has been the most important factor in the history of Italian movies. In the early 1900s, artistic and epic films such as Otello, The Last Days of Pompeii, L'Inferno, Quo Vadis, and Cabiria, were made as adaptations of books or stage plays. Italian filmmakers were utilizing complex set designs, lavish costumes, and record budgets, to produce pioneering films. One of the first cinematic avante-garde movements, Italian Futurism, took place in Italy in the late 1910s. After a period of decline in the 1920s, the Italian film industry was revitalized in the 1930s with the arrival of sound film."},{"page_url":"https://es.wikipedia.org/wiki/Inmigraci%C3%B3n_suiza_en_Venezuela","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Mar%C3%ADa_Gabriela_Isler_cropped.jpg","page_title":"Inmigración suiza en Venezuela","context_page_description":"La inmigración suiza en Venezuela es de larga data, con sus primeros indicios en la primera mitad del Siglo XVI. Según datos, hacia 1940 habían emigrado al país un aproximado de 1900 suizos.​\\nLos primeros suizos que arribaron al actual territorio de Venezuela entre 1529 y 1535, que participaron en las primeras expediciones alemanas de América organizadas por los Welser de Augsburgo fueron Joachim Ritz​ quien se estableció primeramente en Coro, luego Barquisimeto y se deduce que murió en Coro en 1570 dejando descendientes en Coro, Barquisimeto, El Tocuyo y Carora; y Melchior Grübel​ quien también fue residente de El Tocuyo. Otro suizo que llegó a Venezuela fue Leonhard Grübel quien tenía nueve años al momento de arribar a Coro. Los hijos de Leonhard Grübel optaron por usar el apellido de la madre \\"Arias de Valdés\\" dejando descendientes en Mérida. Otro suizo-alemán que llegó a Venezuela con los Welsares fue Ulrich Sailer, murió víctima de las flechas de los aborígenes en Maracaibo luego de apresar jóvenes indígenas.\\nEn la actualidad, la comunidad suiza en Venezuela está bien organizada en varias asociaciones civiles y organizaciones sin fines de lucro."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A0%D1%8D%D0%BD%D1%8D_%D0%94%D0%BE%D0%B1%D1%80%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/King_Rene_and_Jeanne_de_Lavalle._Louvre.jpg","page_title":"Рэнэ Добры","context_page_description":"Рэнэ́ Добры — герцаг Латарынгіі, герцаг Анжуйскі, тытулярны кароль Неапаля, Іерусаліма, граф дэ Гіз.\\nДругі сын Людовіка II Анжуйскага і Іаланды Арагонскай. Дзякуючы шлюбу з Ізабелай Латарынгскай атрымаў у спадчыну герцагствы Бар і Латарынгію. На апошняе герцагства існаваў яшчэ адзін прэтэндэнт, якога падтрымліваў Філіп III Добры. У вайне за Латарынгію Рэнэ трапіў у палон, дзе знаходзіўся да 1437 г.\\nЗа гэты час быў прызнаны ў якасці герцага Латарынгскага імператарам Жыгімонтам. У 1434 г. пасля смерці свайго старэйшага брата Людовіка III Анжуйскага атрымаў у спадчыну герцагствы Анжу і Праванс, а таксама статус спадчынніка бяздзетнай Джаваны II, каралевы Неапаля. Пасля яе смерці стаў намінальна каралём Неапаля."},{"page_url":"https://mg.wikipedia.org/wiki/Wilfried_Sanou","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/WilfriedSanou.jpg","page_title":"Wilfried Sanou","context_page_description":"Wilfried Sanou dia mpilalao baolina kitra teraka ny 16 Martsa 1984"},{"page_url":"https://en.wikipedia.org/wiki/List_of_football_stadiums_in_Austria","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Stadion_Birkenwiese_Dornbirn_.JPG","page_title":"List of football stadiums in Austria","context_page_description":"The following is a list of football stadiums in Austria, ordered by capacity. Currently all stadiums with a capacity of 7,000 or more are included."},{"page_url":"https://pt.wikipedia.org/wiki/Turdus_sanchezorum","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Turdus_sanchezorum.jpg","page_title":"Turdus sanchezorum","context_page_description":"Turdus sanchezorum é uma espécie de ave da família Turdidae endêmica do Brasil. É encontrada na Amazônia ocidental. É uma espécie críptica identificada através de análise molecular em espécimes de museus. Era considerada coespecífica com o Turdus hauxwelli."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%80%D0%B0%D1%83%D0%BD%D1%81%D0%B1%D0%B5%D0%B4%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/BraunsdorfHauptstr.JPG","page_title":"Браунсбедра","context_page_description":"Браунсбедра — город в Германии, в земле Саксония-Анхальт.\\nВходит в состав района Зале. Население составляет 12 069 человек. Занимает площадь 74,34 км². Официальный код — 15 2 61 008.\\nГород подразделяется на 13 городских районов. В городском районе Росбах состоялась в 1757 г. Битва при Росбахе."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Lisberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/2019_Lisberg_Hauptstra%C3%9Fe14.jpg","page_title":"Liste der Baudenkmäler in Lisberg","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberfränkischen Gemeinde Lisberg zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDie Liste gibt den Fortschreibungsstand vom 19. August 2014 wieder und enthält 15 Baudenkmäler."},{"page_url":"https://bar.wikipedia.org/wiki/Hum%20%28Fo%C4%8Da%29","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/%C5%A0%C4%87epan_Polje_Border.JPG","page_title":"Hum (Foča)","context_page_description":"Hum is a Ort in da Vabandsgmoa Foča im aissasdn Sidostn vo Bosnien und Herzegowina, direkd on da montenegrinischn Grenz. Seitm Bosnienkriag gheads zua Republika Srpska, oana vo zwoa Entitätn in Bosnien und Herzegowina. Da Stroßngrenziwagong Hum-Šćepan Polje mid ana Bruck iwa de Tara is nochm Doaf bnennd."},{"page_url":"https://en.wikipedia.org/wiki/Ilya_Repin","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Repin_17October.jpg","page_title":"Ilya Repin","context_page_description":"Ilya Yefimovich Repin was a Russian realist painter. He was the most renowned Russian artist of the 19th century, when his position in the world of art was comparable to that of Leo Tolstoy in literature. He played a major role in bringing Russian art into the mainstream of European culture. His major works include Barge Haulers on the Volga, Religious Procession in Kursk Province and Reply of the Zaporozhian Cossacks.\\nRepin was born in Chuguyev, in Kharkov Governorate, Russian Empire into a family of \\"military settlers\\". His father traded horses and his grandmother ran an inn. He entered military school to study surveying. Soon after the surveying course was cancelled, his father helped Repin to become an apprentice with Ivan Bunakov, a local icon painter, where he restored old icons and painted portraits of local notables through commissions. In 1863 he went to St. Petersburg Art Academy to study painting but had to enter Ivan Kramskoi preparatory school first. He met fellow artist Ivan Kramskoi and the critic Vladimir Stasov during the 1860s, and his wife, Vera Shevtsova in 1872."},{"page_url":"https://pt.wikipedia.org/wiki/Edif%C3%ADcio_Mercosur","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/2016_Parque_Hotel_Edificio_Mercosur_Montevideo_Uruguay.jpg","page_title":"Edifício Mercosur","context_page_description":"O Edifício Mercosul ou Palácio do Mercosul é uma histórica edificação localizada em Montevidéu, capital do Uruguai onde funciona a sede do MERCOSUL."},{"page_url":"https://nl.wikipedia.org/wiki/Tweeherigheid_van_Maastricht","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Maastricht%2C_het_Dinghuis_foto10_2011-01-30_13.12.JPG","page_title":"Tweeherigheid van Maastricht","context_page_description":"Met de tweeherigheid van Maastricht wordt in de geschiedenis van Maastricht de periode van 1204 tot 1794 aangeduid, waarin de stad als condominium werd bestuurd door twee heren, enerzijds de bisschop van Luik en anderzijds de hertog van Brabant. De tweeherigheid had tot gevolg dat Maastrichtse burgers de Luikse of Brabantse nationaliteit hadden en dat het grondgebied van de stad bestond uit een lappendeken van tweeherige, Luikse, Vroenhofse, Tweebergse en andere territoria. De complexe bestuurlijke en rechterlijke organisatie van Maastricht tijdens het ancien régime was in zekere zin uniek in Europa, vooral toen na 1632 twee gelijkberechtigde confessies een religieuze dimensie aan de tweeherigheid gaven."},{"page_url":"https://da.wikipedia.org/wiki/Stamhuset_Rathlousdal","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Rathlousdal_old.jpg","page_title":"Stamhuset Rathlousdal","context_page_description":"Stamhuset Rathlousdal er et stamhus der blev oprettet 7. august 1749 og ophørte i 1921, bestående af hovedgårdene Rathlousdal og Gersdorffslund og Sophienlund i alt ca. 279 tdr. hartkorn af alle slags. Jordtilliggendet udgør 1.496. Skovarealet var 1.402 tdr. land."},{"page_url":"https://en.wikipedia.org/wiki/Dayton_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/DAYTON_HOUSE%2C_LILMA%2C_LIVINGSTON_COUNTY.jpg","page_title":"Dayton House","context_page_description":"Dayton House is a historic home located at Lima in Livingston County, New York. It was built about 1844 and expanded and upgraded in the 1850s / 1860s. It is a two-story, three bay dwelling with Greek Revival form and an overlay of Italianate and Gothic Revival design elements. Also on the property is a large carriage house, smoke house, and original cast iron lamp post.\\nIt was listed on the National Register of Historic Places in 1989."},{"page_url":"https://de.wikipedia.org/wiki/Bundesstra%C3%9Fe_322","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/2012-08-08-fotoflug-bremen_erster_flug_0093.JPG","page_title":"Bundesstraße 322","context_page_description":"Die Bundesstraße 322 ist eine etwa sechs Kilometer lange deutsche Bundesstraße bei Stuhr. Sie beginnt an der Anschlussstelle Groß-Mackenstedt der A 28, kreuzt das Dreieck Stuhr der A 1 um kurz dahinter an der B 6 zu enden."},{"page_url":"https://vo.wikipedia.org/wiki/Highbridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Highbridge_St_Johns.jpg","page_title":"Highbridge","context_page_description":"Highbridge binon zif in grafän: Somerset, in Linglän.\\nHighbridge labon belödanis 4 606."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9B%E1%83%98-%E1%83%A1%E1%83%9D%E1%83%9C%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Th%C3%A1nh_%C4%91%E1%BB%8Ba_M%E1%BB%B9_S%C6%A1n%2C_khu_C-B-D.JPG","page_title":"მი-სონი","context_page_description":"მი-სონი — ტაძრების კომპლექსი, რომელიც ეკუთვნის ყოფილ ჩამპას სახელმწიფოს. ამჟამად მდებარეობს ვიეტნამის ცენტრალურ ნაწილში. ტაძრები ამ დროისთვის ნახევრად დანგრეულია. თავის დროზე, ისინი ღმერთ შივას სადიდებლად ააგეს. 1999 წელს, ის იუნესკომ მსოფლიო მემკვიდრეობის სიაში შეიყვანა.\\nმი-სონი იუნესკოს სხვა ძეგლის, ქალაქ ჰოი-ანიდან 50 კმ-ით სამხრეთ აღმოსავლეთით მდებარეობს.\\nჩვ.წ. IV-XII საუკუნეებში, მი-სონი ჩამპას იმპერიის დედაქალაქი იყო. ჩამპას კულტურა ინდური კულტურის დიდ გავლენას განიცდიდა.\\n2002 წელს, კომპლექსის ტერიტორიაზე გათხრები დაიწყო, რომელიც იუნესკომ 70,000 $-ით დააფინანსა.\\nყველაზე მაღალი, 24 მეტრიანი კოშკზე ამოკვეთილი ყოფილა ლომებისა და სპილოების გამოსახულებები. იგი 1969 წელს, ვიეტნამის ომის მიმდინარეობისას, დაბომბვებისას დაინგრა. საბოლოო ჯამში, დაბომბვების შედეგად, მეოცე საუკუნის პირველ ნახევარში აღრიცხული კომპლექსის 70 ტაძრიდან 50 მთლიანად ან ნაწილობრივ დაინგრა."},{"page_url":"https://ca.wikipedia.org/wiki/Herichthys_cyanoguttatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Herichthys_cyanoguttatum_%28Rio_Grande_Cichlid%29.jpg","page_title":"Herichthys cyanoguttatus","context_page_description":"Herichthys cyanoguttatus és una espècie de peix de la família dels cíclids i de l'ordre dels perciformes."},{"page_url":"https://simple.wikipedia.org/wiki/Arrondissement_of_Florac","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Map_arrondissement_code_481.svg","page_title":"Arrondissement of Florac","context_page_description":"The arrondissement of Florac is an arrondissement of France; it is part of the Lozère département in the Occitanie region."},{"page_url":"https://ast.wikipedia.org/wiki/Historia_de_la_qu%C3%ADmica","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Frkekul%C3%A9.jpg","page_title":"Historia de la química","context_page_description":"La hestoria de la química toma un periodu de tiempu bien ampliu, que va dende la prehistoria hasta'l presente, y ta amestada al desenvolvimientu cultural del home y la so conocencia de la naturaleza. Les civilizaciones antigües yá usaben teunoloxíes que demostraben la so conocencia de los tresformamientos de la materia, y dalgunes sirviríen de base a los primeros estudios de la química. Ente elles cunten la estraición de los metales de los sos menas, la ellaboración d'aleaciones como'l bronce, la fabricación de cerámica, esmaltes y vidriu, les fermentación de la cerveza y del vinu, la estraición de sustances de les plantes pa usales como medicines o arumes y el tresformamientu de les grases en xabón.\\nNin la filosofía nin l'alquimia, la protociencia química, fueron capaces d'esplicar verazmente la naturaleza de la materia y los sos tresformamientos. Sicasí, a base de realizar esperimentos y rexistrar les sos resultaos los alquimistas establecieron los cimientos pa la química moderna."},{"page_url":"https://sv.wikipedia.org/wiki/Buskmyrt%C3%B6rnskata","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Thamnophilus_caerulescens_1.jpg","page_title":"Buskmyrtörnskata","context_page_description":"Buskmyrtörnskata är en fågel i familjen myrfåglar inom ordningen tättingar."},{"page_url":"https://en.wikipedia.org/wiki/Applied_Arts_Collection","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Civiche_Raccolte_d%27Arte_Applicata_di_Milano_-_Tabernacolo_con_storie_della_vergine_e_di_ges%C3%B9_-_XV_secolo_-_avorio.JPG","page_title":"Applied Arts Collection","context_page_description":"The Applied Arts Collection of Milan is located in the Sforza Castle museum complex under the management of the municipality of Milan, Italy. The museum is divided into several sections with particular emphasis on jewelry, ivories, pottery and art glass.\\nThe ceramic collection includes medieval, Renaissance and Baroque pottery, a maiolica group with pieces from 17th-century Lodi and Milan, and a collection of European chinaware and earthenware.\\nThe collection of artistic glass includes the Cup Gonzagna, made of crystal clear glass and decorated with a pattern of small golden flowers and the Gonzaga coat of arm with a quadripartite black eagle on a white background.\\nIn the Sala Della Balla is the Arazzi Trivulzio, a series of twelve tapestries representing the different months of the years. Their design is based on drawings by Italian painter Bramantino."},{"page_url":"https://it.wikipedia.org/wiki/Microfono_a_condensatore","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Ldc-mike.jpg","page_title":"Microfono a condensatore","context_page_description":"Il microfono a condensatore è un tipo di microfono che sfrutta l'effetto di variazione capacitiva. Le due lamine che compongono la capsula sono sollecitate dalle variazioni di pressione che un suono provoca nel mezzo di propagazione.\\nLa sua figura polare può essere omnidirezionale, bidirezionale o unidirezionale. Il microfono a condensatore può essere ritenuto qualitativamente migliore perché più sensibile ai transienti e alle sollecitazioni, tuttavia il segnale che esce dalla capsula è ad altissima impedenza, per cui viene aggiunto nel corpo del microfono un preamplificatore preposto ad abbassare l'impedenza del segnale generato, il quale però necessita di essere alimentato. Il preamplificatore rappresenta però anche il punto debole di un microfono a condensatore perché se di bassa qualità può indurre saturazioni, distorsioni e introdurre rumore. Per evitare i rischi di saturazione dell'elettronica, soprattutto nei microfoni di miglior qualità che quindi, disponendo di un'elevata sensibilità e di un'alta dinamica sono soggetti a questo problema, il produttore inserisce un attenuatore;\\nl'alimentazione può essere separata o viaggiare sul cavo del microfono."},{"page_url":"https://de.wikipedia.org/wiki/Hermann_Carl_Dittmer","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/WP_Hermann_Carl_Dittmer.jpg","page_title":"Hermann Carl Dittmer","context_page_description":"Hermann Carl Dittmer war Ratsherr der Hansestadt Lübeck."},{"page_url":"https://ca.wikipedia.org/wiki/Pilar_(Vit%C3%B2ria)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Vitoria_-_Calle_Cofrad%C3%ADa_de_Arriaga.jpg","page_title":"Pilar (Vitòria)","context_page_description":"Pilar és un barri de la ciutat de Vitòria. Té una població de 10.462 habitants. Està situat al nord-oest de la ciutat; encara que a causa del creixement de la ciutat cap al nord amb Lakua i a l'oest amb Zabalgana actualment constitueix el centre geogràfic de la ciutat. Limita a l'Est amb el Cementiri de Santa Isabel a Zaramaga, al nord amb el parc d'Arriaga, al sud amb el barri de Koroatzea i a l'est amb els barris de Txagorritxu i Gazalbide."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D0%BA%D1%80%D1%83%D0%B3_%D0%9C%D0%B5%D0%BD%D0%BE%D0%BC%D0%B8%D0%BD%D0%B8_(%D0%92%D0%B8%D1%81%D0%BA%D0%BE%D0%BD%D1%81%D0%B8%D0%BD)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Map_of_Wisconsin_highlighting_Menominee_County.svg","page_title":"Округ Меномини (Висконсин)","context_page_description":"Округ Меномини је округ у америчкој савезној држави Висконсин."},{"page_url":"https://da.wikipedia.org/wiki/LIFE%2B","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Logolife.jpg","page_title":"LIFE+","context_page_description":"Life+ er et EU-program, der finansierer projekter, der bidrager til udvikling og gennemførelse af politik og lovgivning på miljøområdet. Programmet fremmer integrationen af miljøspørgsmål i politikken på andre områder, og fremmer en bæredygtig udvikling i almindelighed.\\nLife+ er efterfølgeren til LIFE programmet, der blev igangsat i 1992. LIFE+ medfinansierer projekter til fordel for miljøet i EU og i visse tredjelande f.eks. ansøgningslande og EFTA-lande, som er medlem er Det Europæiske Miljøagentur."},{"page_url":"https://en.wikipedia.org/wiki/Machaire_Rabhartaigh","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Machairerabhartaigh2011.jpg","page_title":"Machaire Rabhartaigh","context_page_description":"Machaire Rabhartaigh, meaning \\"plane of the spring tide/plane of roarty\\", is a Gaeltacht village and townland on the north-west coast of County Donegal, Ireland. It is in the parish of Cloughaneely and its main access road is the R257.\\nIt has been home to a Gael Linn Irish Language Summer School since 1981 which runs three courses for teenagers aged 12–18 every summer and has an intake of about 200 students per course.\\nThe village has a port suited for fishing vessels. It is the main ferry port for Tory Island.\\nIt attracts many tourists during the summer and watersports enthusiasts visit the area to windsurf/surf/kitesurf and to go kayaking in the bay. A natural reef exists to the left of the pier which provides excellent surf throughout the year. Amenities include Coll's Bar & Pub grub, an Café, Salt & Sand and Scoil Naomh Dubhthach Machaire Rabhartaigh, an Irish-speaking primary school."},{"page_url":"https://sv.wikipedia.org/wiki/Universitetet_i_Leiden","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Faculteit_der_Sociale_Wetenschappen_Leiden.jpg","page_title":"Universitetet i Leiden","context_page_description":"Universitetet i Leiden är Nederländernas äldsta universitet, beläget i Leiden. Universitetet har ungefär 25 800 studenter.\\nUniversitetet i Leiden grundades 1575 av Vilhelm I av Oranien; Huset Nassau-Oranien och universitetet har fortfarande nära band. I dess tidiga historia knöts högt framstående forskare till universitetet, och det fick snart rykte som ett av de främsta lärosätena i Europa. Det var vid detta universitet som René Descartes teorier fick sitt första genombrott, och det blev även ett centrum för filologi, botanik och medicinsk vetenskap. Till skillnad från universiteten i Frankrike och Italien, blev Leiden även ett starkt fäste för protestantismen; när Justus Lipsius konverterade till katolicismen 1590 fick han troligen lämna sin professur vid universitetet.\\nDess första campus var vid St Barbaras kloster, men det flyttade 1581 till De vita nunnornas kloster. Byggnaden förstördes 1616, men universitetet besitter ännu den platsen.\\nBland de mest berömda institutionerna vid universitetet är observatoriet från 1633, naturhistoriska museet med den anatomiska teatern, historiska museet samt Hortus Botanicus. Universitetsbiblioteket har mer än 3,5 miljoner böcker."},{"page_url":"https://sv.wikipedia.org/wiki/Afghanistan","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/An_overall_view_of_a_refugee_camp_in_Kabul_%284298532900%29.jpg","page_title":"Afghanistan","context_page_description":"Afghanistan, formellt Islamiska republiken Afghanistan, persiska: جمهوری اسلامی افغانستان; pashto: د افغانستان اسلامي جمهوریت, är ett land i södra Asien. Afghanistan räknas enligt olika källor till Centralasien, Sydasien eller Mellanöstern.\\nLandet är bergigt och saknar kust. Det gränsar till Pakistan i söder och öster, Iran i väst, Turkmenistan, Uzbekistan och Tadzjikistan i norr, och Kina allra längst i öster. En stor del av Afghanistans 652 000 kvadratkilometer stora yta täcks av bergskedjan Hindukush vid den västra änden av Himalaya. I norr finns slättland som delvis är mycket bördigt. Ett relativt låglänt område i sydväst utgörs till stor del av öken och salträsk. Kabul är huvudstad och största stad.\\nStatistiken om landet är mycket bristfällig och man vet inte ens hur många invånare det finns, men folkmängden uppskattades 2019 till mellan 26 och 33 miljoner. Cirka 70 procent av befolkningen är under 25 år. Etniskt sett består befolkningen framför allt av etniska pashtuner, tadzjiker, hazarer och uzbeker.\\nAfghanistan är en Islamisk republik. Det är Asiens fattigaste land, helt beroende av utländskt bistånd och ett av världens mest korrupta länder."},{"page_url":"https://pl.wikipedia.org/wiki/Gruta_(gmina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Piramida_wieku_Gmina_Gruta.png","page_title":"Gruta (gmina)","context_page_description":"Gruta – gmina wiejska w województwie kujawsko-pomorskim, w powiecie grudziądzkim. W latach 1975–1998 gmina położona była w województwie toruńskim.\\nSiedzibą gminy jest Gruta.\\nWedług danych z 30 czerwca 2004 gminę zamieszkiwało 6595 osób."},{"page_url":"https://ceb.wikipedia.org/wiki/Granholmen_(pulo_sa_Suwesya,_Stockholm,_lat_59,38,_long_18,88)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Granholmen_brygga_december_2012.jpg","page_title":"Granholmen (pulo sa Suwesya, Stockholm, lat 59,38, long 18,88)","context_page_description":"Pulo ang Granholmen sa Sweden. Nahimutang ni sa lalawigan sa Stockholms län, sa habagatang bahin sa nasod, 50 km sa sidlakan sa Estokolmo ang ulohan sa nasod.\\nAng klima kasarangan. Ang kasarangang giiniton 6 °C. Ang kinainitan nga bulan Agosto, sa 17 °C, ug ang kinabugnawan Enero, sa -2 °C."},{"page_url":"https://fi.wikipedia.org/wiki/Mikko_von_Deringer","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1a/MikkoVonDeringer.jpg","page_title":"Mikko von Deringer","context_page_description":"Mikko von Deringer oli suomalainen kapellimestari ja kuoronjohtaja.\\nMikko von Deringer kuului Baltiasta Pietarin kautta Viipuriin muuttaneeseen saksalaissyntyiseen sukuun. Hän opiskeli pianonsoittoa Viipurin musiikkiopistossa, jossa hän suoritti diplomin vuonna 1924. Hän jatkoi opintojaan Wienin musiikkiakatemiassa Friedrich Wührerin johdolla vuosina 1926–1929.\\nMikko von Deringer toimi vuosina 1929−1934 Viipurin Työväen Teatterin ja vuosina 1934−1940 Viipurin Kaupunginteatterin kapellimestarina ja sittemmin samassa tehtävässä Helsingin Ruotsalaisessa teatterissa. Hän esiintyi uransa aikana myös pianistina. Sotien jälkeen von Deringer siirtyi Suomen Yleisradion palvelukseen kapellimestariksi, pianistiksi ja musiikkiohjelmien järjestäjäksi.\\nParhaiten Mikko von Deringer kuitenkin muistetaan kuoronjohtajana. Hänen aloitteestaan Yleisradioon perustettiin vuonna 1952 sekakuoro Peipposet, johon kuului noin 30 laulajaa. Kansanomaisen ohjelmistonsa ansiosta kuorosta tuli hyvin suosittu ja pitkäikäinen. Von Deringer toimi kuoron johtajana kuolemaansa saakka ja laajensi sen ohjelmistoa suurella määrällä ulkomaisia kansanlauluja."},{"page_url":"https://vi.wikipedia.org/wiki/Pilisj%C3%A1szfalu","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Pilisj%C3%A1szfalu_l%C3%A9gifot%C3%B3.jpg","page_title":"Pilisjászfalu","context_page_description":"Pilisjászfalu là một thị trấn thuộc hạt Pest, Hungary. Thị trấn này có diện tích 6,97 km², dân số năm 2010 là 1490 người, mật độ 214 người/km²."},{"page_url":"https://en.wikipedia.org/wiki/Parish_of_St_Andrew","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Darlingharbour_today.jpg","page_title":"Parish of St Andrew","context_page_description":"St Andrew Parish, Cumberland is one of the 57 parishes of Cumberland County, New South Wales, a cadastral unit for use on land titles. It is one of the four small parishes in the Sydney city area, which is named after the church of St Andrew's. The parish was named while the church was still in the planning stages. The parish includes Pyrmont and the Darling Harbour area. It is bounded by Wattle Street in the south west, George Street in the south and east, and King Street in the north-east. It includes Town Hall railway station, which is on the eastern end of the parish."},{"page_url":"https://en.wikipedia.org/wiki/Cussonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Cussonia_natalensis%2C_blaar%2C_Mthonjaneni.jpg","page_title":"Cussonia","context_page_description":"Cussonia is a genus of plants of the family Araliaceae, which is native to the Afrotropics. It originated in Africa and has its center of distribution in South Africa and the Mascarene Islands. Due to their striking habit, they are a conspicuous and easily recognizable group of plants. Their genus name commemorates the botanist Pierre Cusson. The Afro-Malagasy and Asian Schefflera, and Afrotropical Seemannaralia genera are related taxa that share several of its morphological characteristics, among which the leaves borne on the end of branches, inflorescences carried on terminal branches or stems, and reduced leaf complexity in developing inflorescences."},{"page_url":"https://es.wikipedia.org/wiki/Spyker_C8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Spyker_C8_Heck.JPG","page_title":"Spyker C8","context_page_description":"El Spyker C8 es un superdeportivo de motor central y diseño retrofuturista inspirado en la aviación fabricado por la empresa neerlandesa Spyker Cars. Fue diseñado por Maarten de Brujin y se fabrica en Zeewolde, Países Bajos. Es el único coche de producción de la marca tras su resurgimiento en 1999, aunque no fue el primero creado. Actualmente se encuentra en su tercera generación, llamada C8 Preliator."},{"page_url":"https://es.wikipedia.org/wiki/Ernesto_Lecuona","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/Lecuona_white_ink.jpg","page_title":"Ernesto Lecuona","context_page_description":"Ernesto Sixto de la Asunción Lecuona Casado fue un intérprete y compositor de música español."},{"page_url":"https://en.wikipedia.org/wiki/Bernard","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Stained_glass_St_Bernard_MNMA_Cl3273.jpg","page_title":"Bernard","context_page_description":"Bernard is a West Germanic masculine given name.\\nThe name is attested from at least the 9th century. West Germanic Bernhard is composed from the two elements bern \\"bear\\" and hard \\"brave, hardy\\". Its native Old English reflex was Beornheard, which was replaced by the Old French form Bernard after the Norman conquest.\\nThe name Bernhard was notably popular among Old Frisian speakers.\\nIts wider use was popularized due to Saint Bernhard of Clairvaux."},{"page_url":"https://nl.wikipedia.org/wiki/Binnenvaartpolitiereglement","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/Verkeerstekens_Binnenvaartpolitiereglement_-_F.4_%2865612%29.png","page_title":"Binnenvaartpolitiereglement","context_page_description":"Het Binnenvaartpolitiereglement bevat de verkeersregels voor de Nederlandse binnenwateren. Zo staan hierin de borden en overige verkeerstekens vermeld, de te voeren verlichting, tekens en geluidsseinen voor vaartuigen, en de voorrangs- en uitwijkregels op het water. Het BPR werd als wet vastgesteld op 26 oktober 1983 en vormt de opvolger van het vaarreglement. Het is laatstelijk op 1 juli 2010 grondig gewijzigd; de laatste herziening dateert 1 januari 2017.\\nHet BPR geldt voor iedereen en voor elk vaartuig, zowel voor de beroepsvaart als voor de recreatievaart. Op grond van het Vaststellingsbesluit Binnenvaartpolitiereglement is het BPR geldig op de openbare wateren van het Rijk die voor scheepvaart openstaan, met uitzondering van:\\nBoven-Rijn, de Waal, het Pannerdensch Kanaal, de Neder-Rijn, de Lek. Hier geldt het Rijnvaartpolitiereglement.\\nDe Westerschelde en haar mondingen. Hier geldt het Scheepvaart Reglement Westerschelde.\\nHet Kanaal van Gent naar Terneuzen. Hier geldt het Scheepvaartreglement voor het Kanaal van Gent naar Terneuzen.\\nDe Gemeenschappelijke Maas. Hier geldt het Scheepvaartreglement Gemeenschappelijke Maas."},{"page_url":"https://en.wikipedia.org/wiki/Kidarites","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Yinayaditya_of_Kashmir_Late_5th_century_CE.jpg","page_title":"Kidarites","context_page_description":"The Kidarites were a dynasty that ruled Bactria and adjoining parts of Central Asia and South Asia in the 4th and 5th centuries CE. The Kidarites belonged to a complex of peoples known collectively in India as the Huna and/or in Europe as the Xionites. The 5th century Byzantine historian Priscus called them Kidarites Huns, or \\"Huns who are Kidarites\\". The Huna/Xionite tribes are often linked, albeit controversially, to the Huns who invaded Eastern Europe during a similar period. They are entirely different from the Hephthalites, who replaced them about a century later.\\nThe Kidarites were named after Kidara one of their main rulers. The Kidarites appear to have been a part of a Huna horde known in Latin sources as the Kermichiones or \\"Red Huna\\". The Kidarites established the first of four major Xionite/Huna states in Central Asia, followed by the Hephthalites, the Alchon, and the Nezak.\\nIn 360–370 CE, a Kidarite kingdom was established in Central Asian regions previously ruled by the Sasanian Empire, replacing the Kushano-Sasanians in Bactria. Thereafter, the Sasanian Empire roughly stopped at Merv."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_dei_Santi_Vito_e_Modesto_(Spinea)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Vittore_Belliniano_Coronaci%C3%B3n_de_la_Virgen_Spinea.JPG","page_title":"Chiesa dei Santi Vito e Modesto (Spinea)","context_page_description":"La chiesa dei Santi Vito e Modesto è la parrocchiale Spinea, in città metropolitana di Venezia e diocesi di Treviso; fa parte del vicariato di Mirano.\\nLa chiesa è il principale luogo di culto della città e conserva al suo interno alcune interessanti opere, tra cui un'Incoronazione della Vergine del 1524 di Vittore Belliniano e l'organo del 1773 di Gaetano Callido."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_aan_de_Prins_Hendrikkade","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/WLM_-_andrevanb_-_amsterdam%2C_prins_hendrikkade_105.jpg","page_title":"Lijst van rijksmonumenten aan de Prins Hendrikkade","context_page_description":"Een overzicht van de 93 rijksmonumenten aan de Prins Hendrikkade in Amsterdam."},{"page_url":"https://sv.wikipedia.org/wiki/Brandy_Norwood","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Whitney_Houston_Welcome_Heroes_7_cropped.JPEG","page_title":"Brandy Norwood","context_page_description":"Brandy Rayana Norwood, känd mononymt som Brandy, född 11 februari 1979 i McComb, Mississippi, är en amerikansk singer-songwriter, musikproducent och skådespelare. Under 1990-talet kom Norwood att beskrivas som ett \\"kulturellt fenomen\\" när hon som tonåring, nästan samtidigt, slog igenom i musik-, film- och modellbranschen. Hennes studioalbum har sedan dess sålts i 40 miljoner exemplar internationellt och Recording Industry Association of America listar henne 2014 som en av USA:s bäst säljande artister med 10,5 miljoner certifierade album. Norwood rankas bland 1990-talets 20 mest framgångsrika popsångare samt bland de 50 största och framgångsrikaste tonårsstjärnorna i musikhistorien. För sina insatser inom populärmusik har hon vunnit över hundra prisnomineringar och belönats med titeln \\"Princess of R&B\\".\\nNorwood växte upp i ett kristet hem i Los Angeles och sjöng i sin fars kyrkokör. Vid två års ålder framförde hon sitt första gospelsolo. Norwood fick ett skivkontrakt med Atlantic Records vid 13 års ålder. Debutalbumet Brandy kom i september 1994 och certifierades fyrdubbel platina av RIAA och genererade R&B-ettorna \\"I Wanna Be Down\\" och \\"Baby\\"."},{"page_url":"https://fr.wikipedia.org/wiki/G%C3%A9ologie_d%27Andorre","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Cirque_des_pessons.JPG","page_title":"Géologie d'Andorre","context_page_description":"Située au sein des Pyrénées, la géologie d'Andorre est indissociable de celle de ce massif montagneux. L'orogenèse s'est déroulée il y a 40 millions d'années à la suite de la collision entre la plaque ibérique et la plaque eurasienne. Andorre est située dans la zone axiale des Pyrénées centrales, ce qui signifie que la région qu'elle occupe a été intensément plissée lors de cette collision.\\nCependant les roches qui forment le territoire andorran sont antérieures à cette orogenèse puisque le plissement a fait remonter à la surface des roches sédimentaires du Permien mais aussi des roches métamorphiques, volcaniques et plutoniques du socle hercynien."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AB%D8%B1%D9%8A%D9%84%D8%B1_(%D8%A3%D8%BA%D9%86%D9%8A%D8%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Vincent_Price_on_the_red_carpet_at_the_1989_Academy_Awards_cropped.jpg","page_title":"ثريلر (أغنية)","context_page_description":"ثريلر هو عنوان أغنية لفنان موسيقى البوب الأمريكي مايكل جاكسون."},{"page_url":"https://it.wikipedia.org/wiki/Maierdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Wappen_Maierdorf.jpg","page_title":"Maierdorf","context_page_description":"Maierdorf è una frazione di 513 abitanti del comune austriaco di Gnas, nel distretto di Südoststeiermark. Già comune autonomo, il 1º gennaio 2015 è stato aggregato a Gnas assieme agli altri comuni soppressi di Aug-Radisch, Baumgarten bei Gnas, Grabersdorf, Poppendorf, Raning, Trössing e Unterauersbach e alla località di Kohlberg II, già frazione del comune di Kohlberg."},{"page_url":"https://vi.wikipedia.org/wiki/Sphingulus_mus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Sphingulus_mus_MHNT_CUT_2010_0_317_Ussuri%2C_Gornotajosnoje%2C_Russia%2C_female_dorsal.jpg","page_title":"Sphingulus mus","context_page_description":"Sphingulus là một chi bướm đêm thuộc họ Sphingidae, chỉ gồm một loài Sphingulus mus, which is found from tây nam part of vùng Viễn Đông Nga and the Korean Peninsula phía nam into miền đông Trung Quốc.\\nSải cánh dài 57–60 mm.\\nIn miền bắc China, there is one generation per year con trưởng thành bay in tháng 5 and tháng 6. In đông bắc China and the Russian Far East, there is probably partial second generation con trưởng thành bay in tháng 7 and tháng 8 in some years. In Korea, adults have been recorded từ tháng 6 đến tháng 7.\\nẤu trùng ăn Fraxinus species."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B0-%D0%9B%D1%96%D0%B3%D0%B0_2012%E2%80%942013","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Coppadelre.png","page_title":"Ла-Ліга 2012—2013","context_page_description":"Сезон 2012-2013 в Ла Лізі — футбольне змагання у найвищому дивізіоні чемпіонату Іспанії, що проходило між 18 серпня 2012 та 1 червня 2013 року. Участь у змаганні взяли 20 команд, у тому числі 3 команди, які попереднього сезону підвищилися у класі з Сегунди. За результатами сезону 17 команд продовжили виступи в елітному дивізіоні, а три найгірших клуби вибули до Сегунди.\\nПереможцем турніру стала «Барселона», яка здобула свій 22-й трофей національної першості. Майбутні чемпіони захопили лідерство у турнірній таблиці від першого туру і впевнено фінішували з 15-очковим відривом від срібного призера, яким став «Реал Мадрид». При цьому каталонці набрали 100 турнірних очок, зазнавши лише 2 поразок та звівши 4 гри внічию протягом турнірної дистанції з 38 матчів. При цьому лідер атак «Барселони» Ліонель Мессі став найкращим бомбардиром сезону, записавши до свого активу 46 зі 115 голів команди."},{"page_url":"https://pnb.wikipedia.org/wiki/%D8%A2%D8%B1%D9%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e3/Blue_Turkish_Tiles.JPG","page_title":"آرٹ","context_page_description":"آرٹ ایسے کم یا کماں نوں آکھیا جاندا اے جیدے وچ چیزاں نوں نشاناں نال اینج دسیا جاندا اے جے اوہ سوہنیاں لگن۔ ارٹ دی بنی شی کوئی کہانی دسدی اے یا صرف کوئی سوہنا سچ یا مسوس ہون والا جذبہ۔ انسائیکلوپیڈیا بریٹانیکا آرٹ نوں اینج دسدا اے،\\" اوہ سوہنیاں شیواں، محول، یا تجربیاں جنہاں نوں دوجیاں نوں وی دسیا جا سکے تے جنہاں دے بنان وچ سوچ تے گر نوں ورتیا گیا ہوۓ\\"۔ ایتھے آرٹ وچ مورتاں، بتی بنانا، تے فوٹوگرافی آندے نیں۔ آرکیٹیکچر نوں وی ویکھے جان والے آرٹ وج گنیا جاندا اے پر اوہدے وچ اوس شے تے کم لینا اوہدے بنان دا مڈھ ہوندا اے۔ موسیقی، تھیٹر، فلم نوں آرٹ نال رلایا جاسکدا اے۔\\nآرٹ فلاسفی دی اک ونڈ اے جیدے وچ ایدی اصل ایدا بنانا تے ایہنوں دسنا آندے نیں۔ آرٹ اک ول یا راہ اے انسانی سوچ یا جذبے نوں دسن یا کسے ہور تک اپڑان لئی۔ ارسطو دی فلاسفی وچ آرٹ اک ودیا تے آئیڈیل نقل اے۔ لیو ٹالسٹائی ایہنوں اک بندے توں دوجے بندے تک گل اپڑان دا پٹھا ول کیندا اے۔ مارٹن ہائیڈگر دی اکھ وچ آرٹ اک ایسا ول اے جیدے راہیں کوئی سنگت اپنا آپ دسدی اے۔"},{"page_url":"https://en.wikipedia.org/wiki/Progressive_metalcore","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Born_Of_Osiris.jpg","page_title":"Progressive metalcore","context_page_description":"Progressive metalcore is a fusion of progressive metal and metalcore characterized by highly technical lead guitar, \\"atmospheric\\" elements, and complex instrumentation. Some notable practitioners take influence from djent."},{"page_url":"https://en.wikipedia.org/wiki/Blayais_Nuclear_Power_Plant","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/St%C3%A9phaneLhommeGrosPlan.jpg","page_title":"Blayais Nuclear Power Plant","context_page_description":"The Blayais Nuclear Power Plant is a nuclear plant on the banks of the Gironde estuary near Blaye, France operated by Électricité de France."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A5%E0%B8%B4%E0%B8%87%E0%B8%A7%E0%B8%AD%E0%B8%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Rhesus_Macaque_area.png","page_title":"ลิงวอก","context_page_description":"ลิงวอก เป็นสัตว์เลี้ยงลูกด้วยนมในอันดับวานร เป็นลิงที่มีร่างกายอ้วนสั้น บริเวณหลัง หัวไหล่ และตะโพกมีสีน้ำตาลปนเทา ส่วนบริเวณใต้ท้องและสีข้างมีสีอ่อนกว่า หางยาวประมาณครึ่งหนึ่งของความยาวลำตัว ขนหางค่อนข้างยาวและฟู มีการผลัดขนประมาณช่วงเดือนมิถุนายนถึงกรกฎาคมของทุกปี โดยจะเริ่มที่บริเวณปากก่อน หลังจากนั้นจึงจะเริ่มผลัดขนที่หลัง ตัวเมียอาจมีขนสีแดงในฤดูผสมพันธุ์ ขนที่หัวของลิงวอกจะชี้ตรงไปด้านหลัง ลิงตัวผู้มีขนาดใหญ่กว่าตัวเมีย\\nมีความยาวลำตัวและหัว 47 – 58.5 เซนติเมตร ความยาวหาง 20.5 – 28 เซนติเมตร น้ำหนัก 3 – 6 กิโลกรัม\\nมีการกระจายพันธุ์ตั้งแต่ อัฟกานิสถาน, ภาคเหนือของอินเดีย, เนปาล, พม่า, ภาคใต้ของจีน, ลาว, เวียดนาม และภาคตะวันตกของไทย โดยในประเทศ ปัจจุบันเชื่อว่า เหลืออยู่เพียงฝูงสุดท้ายแล้วที่ วัดถ้ำผาหมากฮ่อ ในพื้นที่อำเภอวังสะพุง จังหวัดเลย แต่จากข้อมูลล่าสุด ยังพบเห็นฝูงลิงวอกได้อีกที่บริเวณสะพานข้ามน้ำ หน่วยพิทักษ์ป่าศาลาพรม ในเขตรักษาพันธุ์สัตว์ป่าภูเขียว จังหวัดชัยภูมิ"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A5%D0%BE%D0%BC%D1%80%D0%BE%D0%B2%D0%B0_%D0%9E%D0%BB%D0%B5%D0%BD%D0%B0_%D0%9C%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D1%97%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/%D0%A5%D0%BE%D0%BC%D1%80%D0%BE%D0%B2%D0%B0.jpg","page_title":"Хомрова Олена Миколаївна","context_page_description":"Олена Миколаївна Хомрова — українська фехтувальниця, олімпійська чемпіонка 2008 року в командній першості, чемпіонка Європи та чемпіонка світу 2009 року у командній першості, заслужений майстер спорту, депутат Миколаївської обласної ради. Триразова володарка нагороди «Герої спортивного року».\\nОлена Хомрова завоювала золоту олімпійську медаль на пекінській Олімпіаді в командному фехтуванні на шаблях разом з Ольгою Харлан, Галиною Пундик та Ольгою Жовнір.\\nПредставниця клубів «Спартак», «Динамо». Співробітниця Служби безпеки України. Тренер — Анатолій Шлікар.\\nНа чемпіонаті світу 2007 року вона здобула срібло в командних змаганнях, на чемпіонаті Європи 2008 року — срібло в командних змаганнях та бронза в особистих. Стала чемпіонкою Європи у командній першості 2009 року.\\nСрібна призерка всесвітньої універсіади 2007 у Бангкоку.\\nОсвіта: Миколаївське вище училище фізичної культури і Одеський державний екологічний університет, Гідрометеорологічний факультет.\\n2010 року вийшла заміж за баскетболіста Сергія Гладиря."},{"page_url":"https://fi.wikipedia.org/wiki/Bernard_Dietz","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Bernard_Dietz_1985.jpg","page_title":"Bernard Dietz","context_page_description":"Bernard Dietz on entinen saksalainen jalkapalloilija ja nykyinen jalkapallovalmentaja. Hän oli aktiiviuransa ajan pelipaikaltaan puolustaja."},{"page_url":"https://fr.wikipedia.org/wiki/Lance-roquettes_Type_4_20_cm","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Japanese_Type_4_20_cm_Rocket_Mortar_with_a_20_cm_shell.jpg","page_title":"Lance-roquettes Type 4 20 cm","context_page_description":"Le lance-roquettes Type 4 de 20 cm était utilisé par l'armée impériale japonaise pendant les derniers moments de la Seconde Guerre mondiale."},{"page_url":"https://sv.wikipedia.org/wiki/Microcladia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Microcladia_glandulosa_Crouan.jpg","page_title":"Microcladia","context_page_description":"Microcladia är ett släkte av fjärilar. Microcladia ingår i familjen Megalopygidae.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://fr.wikipedia.org/wiki/Nautilus_pompilius","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Nautilus_shell.jpg","page_title":"Nautilus pompilius","context_page_description":"Le Nautilus pompilius est une espèce de nautile, de la famille des Nautilidae. Il s'agit de l'espèce de nautile la plus répandue actuellement."},{"page_url":"https://ro.wikipedia.org/wiki/Brezno,_Podvelka","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Brezno.jpg","page_title":"Brezno, Podvelka","context_page_description":"Brezno este o localitate din comuna Podvelka, Slovenia, cu o populație de 472 de locuitori."},{"page_url":"https://es.wikipedia.org/wiki/Corporaci%C3%B3n_de_Radiodifusi%C3%B3n_Israel%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Main_Building_of_Israel_Broadcasting_Corporation.JPG","page_title":"Corporación de Radiodifusión Israelí","context_page_description":"La Corporación de Radiodifusión Israelí, más conocida por la marca Kan es la radiodifusora pública de Israel desde 2017.\\nLa empresa fue constituida en 2015 como reemplazo de la anterior corporación pública, la Autoridad de Radiodifusión de Israel. Después de un año de negociación, el nuevo medio pudo comenzar sus emisiones el 15 de mayo de 2017 sobre las frecuencias de su antecesor.​ Kan gestiona nueve emisoras de radio, tres canales de televisión y un portal web multimedia con video bajo demanda."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%B0%D0%B9%D0%BB%D1%8C%D0%B3%D0%B0%D0%B9%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/GiebelhausHauptstrTheilheim.JPG","page_title":"Тайльгайм","context_page_description":"Тайльгайм — громада в Німеччині, розташована в землі Баварія. Підпорядковується адміністративному округу Нижня Франконія. Входить до складу району Вюрцбург.\\nПлоща — 9,69 км². Населення становить 2313 ос."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B5%D0%BB%D1%8C%D1%82%D0%B0_(%D0%91%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D1%81%D1%8C%D0%BA%D0%B0_%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1%D1%96%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/AlexFraserBridge.jpg","page_title":"Дельта (Британська Колумбія)","context_page_description":"Дельта — окружний муніципалітет в Канаді, у провінції Британська Колумбія, у складі регіонального округу Метро-Ванкувер."},{"page_url":"https://de.wikipedia.org/wiki/Electric_Questioner","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Electric_Questioner.jpg","page_title":"Electric Questioner","context_page_description":"Der Electric Questioner ist ein klassisches elektrisches Lernspielzeug. Es wurde am 2. Mai 1928 von Louis Marx zum Patent angemeldet. Das US Patent 1,860,895 für den Educational Apparatus erschien am 31. Mai 1932 und basiert auf dem Patent 1,664,842 von G. Fred Yessler/Knapp Electric, eingereicht 1926. Letzteres Educational Appliance war jedoch noch nicht elektrisch.\\nDas Quizspiel wird seitdem weltweit von verschiedenen Unternehmen vermarktet. Besonders verbreitet war es in den 1950er Jahren unter dem Namen Electra oder mit dem Zusatz „-Electric“."},{"page_url":"https://en.wikipedia.org/wiki/Edward_John_O%27Dea","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Right_Rev_Edward_J_O%27Dea%2C_Bishop_of_the_Diocese_of_Seattle%2C_with_a_group_at_his_Silver_Jubilee%2C_1908_%28CURTIS_271%29.jpeg","page_title":"Edward John O'Dea","context_page_description":"Edward John O'Dea was an American prelate of the Catholic Church. He served as Bishop of Seattle from 1896 until his death in 1932; the diocese was called Nesqually until 1907.\\nBorn in Boston, Massachusetts, O'Dea was ordained to the priesthood in the Diocese of Oregon City in 1876. He was named the third bishop of the Diocese of Nesqually in 1896. During his time as bishop, O'Dea moved the episcopal see of the diocese from Vancouver, Washington to Seattle, and the diocese was renamed the Diocese of Seattle. He was also responsible for the construction of the present-day St. James Cathedral, which opened in 1907."},{"page_url":"https://ca.wikipedia.org/wiki/Bisbat_de_San_Miguel_(El_Salvador)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/San_Miguel_El_Salvador.png","page_title":"Bisbat de San Miguel (El Salvador)","context_page_description":"El bisbat de San Miguel és una seu de l'Església Catòlica a El Salvador, sufragània de l'arquebisbat de San Salvador. Al 2014 tenia 871.500 batejats sobre una població de 1.253.100 habitants. Actualment està vacant."},{"page_url":"https://en.wikipedia.org/wiki/Falla_monument","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Falla_del_Ayuntamiento_Valencia_2007.jpg","page_title":"Falla monument","context_page_description":"A Falla or monumento fallero is an artistic monument, usually large composed of figures called ninots, which typically encircle one or more bigger central figures, called remates. The fallas are placed in the streets during the Falles festival in Valencia, and in other towns with festivals inspired by it. The monument usually deals with a satirical subject connected with recent news or public controversies, and is covered in posters with words, verses and statements of a humorous nature. The monument is made with combustible materials which are then burned in the streets after being on show for a few days."},{"page_url":"https://da.wikipedia.org/wiki/Fjerbregne-familien","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Athyrium_distentifolium_Grimsel.JPG","page_title":"Fjerbregne-familien","context_page_description":"Fjerbregne-familien er en stor familie med følgende fællestræk: Planterne er landlevende stauder. De har store blade, som danner åbne rosetter. De enkelte blade har furet bladstilk med to flade ledningsstrenge ved basis. Bladpladen er blød og fjerformet med det bredeste sted midt på.\\nIflg. ITIS henregnes alle slægter i denne familie til Mangeløv-familien.\\nFjerbregne-slægten\\nStrudsvinge-slægten\\nBægerbregne-slægten\\nEgebregne-slægten"},{"page_url":"https://en.wikipedia.org/wiki/Tamatea_/_Dusky_Sound","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/DuskySound.JPG","page_title":"Tamatea / Dusky Sound","context_page_description":"Tamatea / Dusky Sound is a fiord on the southwest corner of New Zealand, in Fiordland National Park."},{"page_url":"https://nl.wikipedia.org/wiki/Thysanostomatidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/MeduseOcIndien.jpg","page_title":"Thysanostomatidae","context_page_description":"Thysanostomatidae is een familie van neteldieren uit de klasse van de Scyphozoa."},{"page_url":"https://oc.wikipedia.org/wiki/Fontgrava","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Fongrave_-_%C3%89glise_Saint-L%C3%A9ger_-3.JPG","page_title":"Fontgrava","context_page_description":"Fontgrava es una comuna agenesa situada dins lo departament d'Òut e Garona e la region de Novèla Aquitània, ancianament d'Aquitània."},{"page_url":"https://fr.wikipedia.org/wiki/Potamites_strangulatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Potamites_strangulatus_strangulatus.png","page_title":"Potamites strangulatus","context_page_description":"Potamites strangulatus est une espèce de sauriens de la famille des Gymnophthalmidae."},{"page_url":"https://tl.wikipedia.org/wiki/Kane_Hodder","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Kane_Hodder_%C3%84lvsj%C3%B6.jpg","page_title":"Kane Hodder","context_page_description":"Si Kane Warren Hooder ay isang Amerikanong aktor na gumaganap bilang Jason Voorhees sa apat na pelikula mula 1988 hanggang 2002."},{"page_url":"https://pl.wikipedia.org/wiki/Richard_Brabec","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Richard_Brabec_02.jpg","page_title":"Richard Brabec","context_page_description":"Richard Brabec – czeski polityk, menedżer i samorządowiec, parlamentarzysta krajowy, od 2014 minister środowiska, w latach 2017–2019 również wicepremier."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BE%D0%B1%D1%8A%D0%B5%D0%BA%D1%82%D0%BE%D0%B2_%D0%B2%D1%81%D0%B5%D0%BC%D0%B8%D1%80%D0%BD%D0%BE%D0%B3%D0%BE_%D0%BD%D0%B0%D1%81%D0%BB%D0%B5%D0%B4%D0%B8%D1%8F_%D0%AE%D0%9D%D0%95%D0%A1%D0%9A%D0%9E_%D0%B2_%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Gro%C3%9FglStr.jpg","page_title":"Список объектов всемирного наследия ЮНЕСКО в Австрии","context_page_description":"В списке Всеми́рного насле́дия ЮНЕ́СКО в А́встрии значатся 10 наименований, это составляет 0,8 % от общего числа. 9 объектов включены в список по культурным критериям, причём 1 из них признан шедевром человеческого гения и 1 - по природным. Кроме этого, по состоянию на июль 2019 года 12 объектов на территории Австрии находятся в числе кандидатов на включение в список всемирного наследия. Австрийская Республика ратифицировала Конвенцию об охране всемирного культурного и природного наследия 18 декабря 1992 года. Первые два объекта, находящиеся на территории Австрии были занесены в список в 1996 году на 20-й сессии Комитета всемирного наследия ЮНЕСКО."},{"page_url":"https://ca.wikipedia.org/wiki/Lou_Diamond_Phillips","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/LouDiamondPhillipsByPhilKonstantinPublicDomain.jpg","page_title":"Lou Diamond Phillips","context_page_description":"Lou Diamond Phillips és un actor, director i guionista estatunidenc criat a Texas, que va saltar a la fama per la seva interpretació del músic Ritchie Valens a la pel·lícula La bamba. L'any 1990 va ser adoptat per la tribu Sioux, tot i que ell té sang Cherokee, i va rebre el nom de \\"Star Keeper\\".\\nLa seva filmografia principal inclou títols com La bamba, Lliçons inoblidables, Young Guns, Young Guns II, Teresa's Tattoo, Courage Under Fire, The Big Hit, Un altre dia al paradís, Brokedown Palace, Bats, Una manera millor de morir, Hollywood: Departament d'homicidis i Che: Guerrilla, encara que també ha participat a diverses sèries de televisió."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Cendrillon","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/25th_Celebration_Cinderella_Castle_1997.jpg","page_title":"Château de Cendrillon","context_page_description":"Le Château de Cendrillon est le château de contes de fées occupant la place centrale de deux parcs à thèmes Disney : Magic Kingdom et Tokyo Disneyland. D'inspiration néogothique, son architecture est issue des esquisses de l'imagineer Herbert Ryman.\\nLe château sert d'icône aux deux Royaumes Enchantés précités, ainsi qu'à la société Walt Disney Pictures depuis 2006."},{"page_url":"https://es.wikipedia.org/wiki/Nant-le-Grand","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Blason_Nant-le-Grand_%28Meuse%29.svg","page_title":"Nant-le-Grand","context_page_description":"Nant-le-Grand es una población y comuna francesa, en la región de Lorena, departamento de Mosa, en el distrito de Bar-le-Duc y cantón de Ligny-en-Barrois."},{"page_url":"https://es.wikipedia.org/wiki/L%C3%AD%C5%A1ina","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/L%C3%AD%C5%A1ina_-_kaple_Pov%C3%BD%C5%A1en%C3%AD_Svat%C3%A9ho_K%C5%99%C3%AD%C5%BEe.JPG","page_title":"Líšina","context_page_description":"Líšina es una localidad del distrito de Pilsen Sur en la región de Pilsen, República Checa, con una población estimada a principio del año 2018 de 165 habitantes.\\nSe encuentra ubicada al este de la región, en la cuenca hidrográfica del río Berounka —un afluente izquierdo del río Moldava que, a su vez, lo es del Elba— y cerca de la frontera con las regiones de Bohemia Central y Bohemia Meridional.​"},{"page_url":"https://eo.wikipedia.org/wiki/Glageon","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Emmaus_glageon.JPG","page_title":"Glageon","context_page_description":"Glageon estas franca komunumo lokita en la departemento Nord kaj en la regiono Nordo-Kaleza Markolo. Ĝi havis 1 877 loĝantojn laŭ censo plenumita en 1999."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%BF%A0%EB%A5%B4%EC%8A%A4%ED%81%AC%ED%98%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/Kursk_Gubernia_Map_%28late_XIX_century%29.jpg","page_title":"쿠르스크현","context_page_description":"쿠르스크현은 1796년부터 1928년까지 존재했던 러시아 제국의 현으로 현도는 쿠르스크이며 면적은 46,455km², 인구는 3,256,600명이다. 현재의 러시아 쿠르스크주와 벨고로드주에 걸쳐 있었다."},{"page_url":"https://ru.wikipedia.org/wiki/120_mm/50_Ansaldo_Mod._1926","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/HN-INS-Misgav-K-30-Italian-120mm-gun-1.jpg","page_title":"120 mm/50 Ansaldo Mod. 1926","context_page_description":"120 mm/50 Ansaldo Mod. 1926 — 120-миллиметровое корабельное артиллерийское орудие, разработанное и производившееся в Италии. Состояло на вооружении Королевских ВМС Италии. Разработано компанией «Ансальдо» для вооружения лёгких скаутов типа «Навигатори». Стало развитием более раннего 120-мм орудия OTO. В дальнейшем имело значительно количество модификаций, отличавшихся, главным образом, конструкцией орудийной установки. Известны модели 1936, 1937 и 1940 годов производства «Ансальдо» и модели 1931, 1933 и 1936 годов, производства ОТО. Являлось основным оружием итальянских эсминцев времен Второй мировой войны. Использовалось на эсминцах типов «Дардо», «Фольгоре», «Маэстрале», «Ориани», «Сольдати», а также в качестве противоминного на модернизированных линкорах типа «Конте ди Кавур»."},{"page_url":"https://it.wikipedia.org/wiki/Fiume_Housatonic","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Housatonicrivermap.png","page_title":"Fiume Housatonic","context_page_description":"Il fiume Housatonic è un fiume degli Stati Uniti d'America che nasce nell'ovest dello Stato del Massachusetts e sfocia nel Long Island Sound, Connecticut."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%AD%90%E5%BE%B7%E9%9F%8B%E5%85%A7%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Odweyne_District.png","page_title":"歐德韋內區","context_page_description":"歐德韋內區是索馬利亞的一個區級行政區，位於該國東北部的托格代爾州，而該州實際上由索馬里蘭政府控制。首府為歐德韋內。"},{"page_url":"https://pt.wikipedia.org/wiki/Angelus_Silesius","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Silesius%2C_Angelus_%E2%80%93_Des_Angelus_Silesius_Cherubinischer_Wandersmann%2C_1905_%E2%80%93_BEIC_3325036.jpg","page_title":"Angelus Silesius","context_page_description":"Angelus Silesius, nascido Johann Scheffler e também conhecido como Johann Angelus Silesius, foi um padre e médico católico alemão, conhecido como poeta místico e religioso."},{"page_url":"https://es.wikipedia.org/wiki/Se%C3%B1or_de_Ancara","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Chonguinos.jpg","page_title":"Señor de Ancara","context_page_description":"El Señor de Ancara es una de las festividades del mes de las cruces más importantes del centro del Perú. Se venera la imagen de un Cristo crucificado que inicialmente era una cruz ubicada en el paraje denominado Áncara, a 2 kilómetros de la Plaza de Armas del Distrito de Paucartambo, en el Departamento de Pasco, en los andes centrales del otrora imperio de los Incas."},{"page_url":"https://de.wikipedia.org/wiki/1._FC_K%C3%B6ln","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/20180602_FIFA_Friendly_Match_Austria_vs._Germany_Jonas_Hector_850_0692.jpg","page_title":"1. FC Köln","context_page_description":"Der 1. FC Köln ist mit 111.599 Mitgliedern der größte Sportverein in Köln und der sechstgrößte in Deutschland.\\nDer Klub wurde am 13. Februar 1948 durch Zusammenschluss der beiden Fußballvereine Kölner BC 01 und SpVgg Sülz 07 gegründet. Er wurde dreimal Deutscher Meister, viermal DFB-Pokalsieger, erreichte 1986 das Finale des UEFA-Pokals und stand achtmal in einem Europapokal-Halbfinale.\\nDas Gründungsmitglied der Bundesliga hielt sich bis 1998 35 Jahre lang ununterbrochen in der höchsten deutschen Spielklasse, wo es nach dem sechsten Aufstieg in der Saison 2019/20 auch wieder aktiv ist. Der 1. FC Köln belegt den achten Platz in der Ewigen Tabelle der Bundesliga und den dritten Platz in der Ewigen Tabelle der Oberliga West, der höchsten Spielklasse für westdeutsche Vereine vor Einführung der Bundesliga.\\nSeit dem 6. März 2002 ist der Profifußballbereich in die 1. FC Köln GmbH & Co. KGaA ausgegliedert. Der eingetragene Verein hält 100 Prozent des Stammkapitals an der KGaA und ist Alleingesellschafter der zur Geschäftsführung berechtigten und voll haftenden Komplementärin, der 1. FC Köln Verwaltungs GmbH."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%BB%D1%8E%D0%BA%D1%88%D1%82%D0%B0%D0%B4%D1%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/Gl%C3%BCckstadt_01.jpg","page_title":"Глюкштадт","context_page_description":"Глюкштадт — місто в Німеччині, розташоване в землі Шлезвіг-Гольштейн. Входить до складу району Штайнбург.\\nПлоща — 22,76 км². Населення становить 11 228 ос."},{"page_url":"https://sv.wikipedia.org/wiki/Karl_Friedrich_Reinhard","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cf/CarlFriedrichGrafReinhardDiplomatS173.jpg","page_title":"Karl Friedrich Reinhard","context_page_description":"Karl Friedrich Reinhard, född 2 oktober 1761 i Schorndorf i Württemberg, död 25 december 1837 i Paris, var en fransk greve och diplomat av tysk börd.\\nReinhard var prästson, studerade i Tübingen och kom 1787 som informator till Bordeaux. År 1791 kom han till Paris och fick tack vare Dumouriez beskydd anställning i utrikesministeriet. Han blev legationssekreterare i London 1792 och i Neapel 1793, avdelningschef i utrikesministeriet 1794, fransk resident i Hamburg 1795, minister i Florens 1798 och var under några månader 1799 utrikesminister.\\nHan vann sin efterträdare Talleyrands välvilja, blev tack vare honom minister i Schweiz 1800, i Lombardiet 1801, i Neder-Sachsen 1802, i Moldau 1805 och i Westfalen 1808-1814. Under restaurationen upphöjdes han till greve, blev medlem av Conseil d'état och fransk minister hos det tyska förbundet.\\nJulimonarkin gjorde honom till minister i Dresden och pär av Frankrike. Han var medlem av Franska institutet. För sin egendomliga karriär hade han framför allt att tacka sina vänskapsförbindelser med girondisterna och med Talleyrand."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AB%E3%82%B7%E3%82%AA%E3%83%BB%E3%82%B3%E3%82%B9%E3%82%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/LucioCostaELA.jpg","page_title":"ルシオ・コスタ","context_page_description":"ルシオ･コスタは、建築家、都市計画家。ブラジルの首都ブラジリアの設計者としてよく知られる。ブラジルの近代主義の建築家の中でも最も重要な人物のひとりとされるが、長い建築キャリアの人生で作品が実現したのは多くない。そのかわりに自身の文章は多く残されているが、文面から高姿勢の態度が災いし、しばしば論争の火種となっていった。"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8B%9D%E6%B5%A6%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/%E5%8B%9D%E6%B5%A6%E9%A7%85_Katsuura_station.jpg","page_title":"勝浦駅","context_page_description":"勝浦駅は、千葉県勝浦市墨名にある、東日本旅客鉄道外房線の駅である。\\n御宿駅から当駅までは複線区間、当駅から先は単線区間となる。"},{"page_url":"https://ce.wikipedia.org/wiki/(6312)_%D0%A0%D0%BE%D0%B1%D1%85%D0%B0%D0%B9%D0%BD%D0%BB%D0%B0%D0%B9%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Robheinlein-6312.jpg","page_title":"(6312) Робхайнлайн","context_page_description":"(6312) Робхайнлайн — Маьлхан системехь астероидийн коьрта асанехь, Марсан а, Юпитеран а орбиташна юкъахь лаьтташ йолу астероид."},{"page_url":"https://en.wikipedia.org/wiki/Mitchell_%26_Titus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/17_State_Street.jpg","page_title":"Mitchell & Titus","context_page_description":"Mitchell & Titus, LLP is a former member firm of Ernst & Young Global Limited and the largest minority-owned accounting firm in the United States. Headquartered in New York City, the company provides professional services in assurance, tax, and advisory to Fortune 1000 companies, entrepreneurial enterprises, not-for-profit organizations, financial services firms, government entities, and high-net-worth individuals. Mitchell & Titus maintains six offices across six states in New York, New Jersey, Pennsylvania, Maryland, District of Columbia, and Illinois."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Hamburg-Billbrook","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Stolperstein_Billbrookdeich_152_%28Theodor_Tuch%29_in_Hamburg-Billbrook.jpg","page_title":"Liste der Stolpersteine in Hamburg-Billbrook","context_page_description":"Die Liste der Stolpersteine in Hamburg-Billbrook enthält alle Stolpersteine, die im Rahmen des gleichnamigen Kunst-Projekts von Gunter Demnig in Hamburg-Billbrook verlegt wurden. Mit ihnen soll Opfern des Nationalsozialismus gedacht werden, die in Hamburg-Billbrook lebten und wirkten.\\nDiese Seite ist Teil der Liste der Stolpersteine in Hamburg, da diese mit insgesamt 5660 Steinen zu groß würde und deshalb je Stadtteil, in dem Steine verlegt wurden, eine eigene Seite angelegt wurde."},{"page_url":"https://nl.wikipedia.org/wiki/Daphnella_patula","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Naturalis_Biodiversity_Center_-_RMNH.MOL.226034_-_Daphnella_patula_%28Reeve%2C_1845%29_-_Raphitomidae_-_Mollusc_shell.jpeg","page_title":"Daphnella patula","context_page_description":"Daphnella patula is een slakkensoort uit de familie van de Raphitomidae. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1845 door Reeve."},{"page_url":"https://sh.wikipedia.org/wiki/Bari","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Crkva%2C_Bari_2017.jpg","page_title":"Bari","context_page_description":"Bari, u srednjevekovnoj Srbiji poznat i kao Veliki Bar je deveti po veličini grad u Italiji. Bari je i glavni grad istoimene Provincije Bari i glavni grad Regije Apulije u jugoistočnoj Italiji.\\nBari je drugo po značaju drugo privredno središte južne Italije, posle Napulja. Grad je poznat i kao grad svetoga Nikole, jer se u gradskoj katedrali nalaze mošti sveca, koje su stalno privlačile hodočasnike."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B0%D0%B9%D1%85%D0%BC%D0%B0%D0%BD%D0%BD%D1%81%D0%B4%D0%BE%D1%80%D1%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Reichmannsdorf-Kirche.jpg","page_title":"Райхманнсдорф","context_page_description":"Райхманнсдорф — громада в Німеччині, розташована в землі Тюрингія. Входить до складу району Заальфельд-Рудольштадт. Складова частина об'єднання громад Ліхтеталь-ам-Реннштайг.\\nПлоща — 20,01 км². Населення становить 767 ос."},{"page_url":"https://pt.wikipedia.org/wiki/Santa_Mar%C3%ADa_del_Invierno","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Pueblo_026.jpg","page_title":"Santa María del Invierno","context_page_description":"Santa María del Invierno é um município da Espanha na província de Burgos, comunidade autónoma de Castela e Leão, de área 16,35 km² com população de 62 habitantes e densidade populacional de 4,22 hab/km²."},{"page_url":"https://sh.wikipedia.org/wiki/Nikotin","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Side_effects_of_nicotine.png","page_title":"Nikotin","context_page_description":"Nikotin je alkaloid koji se može naći u nekim biljkama iz porodice Solanaceae, naročito u duhanu. Čini od oko 0,6 do 3% ukupne suhe mase sušenog, industrijskog duhana, a njegova biosinteza u biljci se odvija u korijenu, a sprema se u listovima. Služi kao hemijska odbrana biljke od insekata; tako da je ranije bila rasprostranjena njegova upotreba u vidu insekticida, dok se danas u tu svrhu koriste dosta slične supstance poput imidakloprida.\\nU vrlo malehnim koncentracijama djeluje kao stimulans za većinu sisara, te je jedan od najvažnijih faktora odgovornih za stvaranje ovisnosti pušenja duhana. Prema navodima Američkog udruženja za srce: Ovisnost o nikotinu je, historijski posmatrano, uvijek bila najteža za odvikavanje.\\nFarmakološke osobine i uticaj na ljudski organizam kojima se definiše ovisnost o duhanu su slični onima kojima se određuje ovisnost o drogama poput heroina i kokaina. Smatra se da je količina nikotina u cigaretama postepeno opadala tokom godina, ali je jedna studija iznijela podatke da je njegova koncentracija povećana oko 1,6% u periodu od 1998 do 2005 godine. Ovom studijom su bile obuhvaćene sve glavne tržišne kategorije cigareta."},{"page_url":"https://vi.wikipedia.org/wiki/Iwakura","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Gojo-gawa_in_Iwakura_04.JPG","page_title":"Iwakura","context_page_description":"Iwakura là một thành phố thuộc tỉnh Aichi, Nhật Bản.\\nTính đến năm 2010, thành phố có dân số ước tính khoảng 48.287 người và mật độ dân số là 4,600 người/km². Tổng diện tích là 10.49 km²."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9B%D0%B5%D0%B9%D0%B4%D0%B8_%D0%9D%D1%8E%D0%BD%D1%81_(%D0%B7%D0%B0%D0%BB%D0%B8%D0%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/C73189s1_Ant.Map_Coulman_Island.jpg","page_title":"Лейди Нюнс (залив)","context_page_description":"Заливът Лейди Нюнс е залив в северозападната част на море Рос, част от акваторията на тихоокеанския сектор на Южния океан, край бреговете на Източна Антарктида, Земя Виктория, Бряг Борхгревинк. Простира се на 96 km между нос Сибалд на югозапад и остров Коулмен на североизток. Вдава се в континента на около 70 km. От север, северозапад и запад в него се „вливат“ големите долинни ледници Борхгревинк, Маринър, Уайлд и Авиатор и други по-малки.\\nЗаливът е открит през януари 1900 г. от участниците в британската антарктическа експедиция, възглавявана от норвежкия полярен изследовател Карстен Борхгревинк и е наименуван в чест на лейди Нюнс, съпруга на Джордж Нюнс, спонсор на експедицията."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%91%9E%E5%A3%AB%E5%9F%8E%E5%A0%A1%E5%88%97%E8%A1%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Schloss_Neu_Bechburg_Oensingen_2.jpg","page_title":"瑞士城堡列表","context_page_description":"本表列舉瑞士聯邦各州現存的各類城堡建築。"},{"page_url":"https://es.wikipedia.org/wiki/Ambulyx","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Ambulyx_phalaris_MHNT_CUT_2010_0_320_Wau%2C_Morobe_Dist._New_Guinea_male.jpg","page_title":"Ambulyx","context_page_description":"Ambulyx es un género de lepidópteros ditrisios perteneciente a la familia Sphingidae.​"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Zubrnice","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Zubrnice_UL_CZ.png","page_title":"Zubrnice","context_page_description":"Zubrnice sī Czech Ústí nad Labem chiu Ústí nad Labem koān ê chi̍t ê hiuⁿ-siā."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%A7%D9%86%D8%B4%DA%AF%D8%A7%D9%87_%DA%A9%D8%A7%D9%84%DB%8C%D9%81%D8%B1%D9%86%DB%8C%D8%A7%D8%8C_%D8%A8%D8%B1%DA%A9%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Eric_E_Schmidt%2C_2005_%28looking_left%29.jpg","page_title":"دانشگاه کالیفرنیا، برکلی","context_page_description":"دانشگاه کالیفرنیا، برکلی مشهور به دانشگاه برکلی دانشگاهی، بسیار مطرح و معتبر در شرق خلیج سان‌فرانسیسکو و در شهر برکلی در ایالت کالیفرنیا قرار دارد. این دانشگاه که در سال ۱۸۶۸ تأسیس شده‌است، دانشگاهی در سیستم دانشگاه‌های کالیفرنیا است. رتبه‌بندی یو اس نیوز این دانشگاه را چهارمین دانشگاه برتر آمریکا می‌داند.\\nاین دانشگاه حاصل ادغام دو دانشگاه قدیمی در سال ۱۸۶۸ در اوکلند کالیفرنیا است. ترجمهٔ شعار این دانشگاه «بگذار نور بیاید» است. این دانشگاه در دههٔ ۱۹۶۰ برای تظاهرات آزاد و مخالفت برای جنگ در ویتنام معروف شد. برکلی از اعضای انجمن دانشگاه‌های آمریکایی است و در طی سال‌ها هزینه‌هایی به فعالیت‌های پژوهشی و عملی مختلف اختصاص داد.\\nدانشگاه برکلی به‌افتخار جرج برکلی نامگذاری گردیده‌است. برکلی در دههٔ شصت به اعتراضات دانشجویی معروف شد؛ زیرا دانشجویان مخالف جنگ ویتنام بودند. تظاهرات معروفی که در سال ۱۹۶۹ در برکلی برگزار شد، تظاهرات «پارک مردم» است. دانشجویان و مسئولان برکلی در مورد یک قطعه زمین با همدیگر مقابله می‌کردند. از آنجایی‌که آن‌ها نتوانستند توافق کنند، گارد ملی به دانشگاه فرستاده شد که به برخورد دانشجویان با «گارد ملی» انجامید.\\nدر حال حاضر دانشجویان برکلی اکثراً لیبرال و محافظه‌کاران در اقلیت هستند."},{"page_url":"https://fr.wikipedia.org/wiki/Cath%C3%A9drale_Notre-Dame-de-l%27Assomption_de_Lescar","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Cath%C3%A9drale_Notre-Dame-de-l%27Assomption_de_Lescar%2C_autel_secondaire_IMGP2370.jpg","page_title":"Cathédrale Notre-Dame-de-l'Assomption de Lescar","context_page_description":"La cathédrale Notre-Dame-de-l'Assomption de Lescar est l'ancien siège du diocèse de Lescar, supprimé sous le Concordat de 1801 qui le sépare entre le diocèse d'Agen et celui de Bayonne. Désormais co-cathédrale du Diocèse de Bayonne, Lescar et Oloron, elle est située dans la ville de Lescar, dans le département français des Pyrénées-Atlantiques. Elle est classée monument historique en 1840."},{"page_url":"https://vi.wikipedia.org/wiki/Onycodes_traumataria","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Onycodes_traumataria_2.jpg","page_title":"Onycodes traumataria","context_page_description":"Onycodes traumataria là một loài bướm đêm thuộc họ Geometridae. Nó được tìm thấy ở Úc, bao gồm New South Wales và Tasmania."},{"page_url":"https://en.wikipedia.org/wiki/Edmund_Roman_Orlik","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Orlik_tankietka.jpg","page_title":"Edmund Roman Orlik","context_page_description":"Edmund Roman Orlik was a Polish architect, and World War II tank commander. During the Invasion of Poland by Nazi Germany in September 1939 he claimed to have destroyed ten German tanks, including one Panzer IV Ausf. B, the largest tank then fielded by Germany, with a 2.6 tonne TKS tankette armed with a 20mm autocannon."},{"page_url":"https://cs.wikipedia.org/wiki/Paul-Philippe_Hardouin_de_P%C3%A9r%C3%A9fixe_de_Beaumont","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Hardoin_de_Perifaxe_de_Baumont.jpg","page_title":"Paul-Philippe Hardouin de Péréfixe de Beaumont","context_page_description":"Paul-Philippe Hardouin de Péréfixe de Beaumont byl francouzský římskokatolický kněz, biskup v Rodez a arcibiskup pařížský. Je znám jako velký odpůrce jansenismu. Byl členem Francouzské akademie."},{"page_url":"https://eu.wikipedia.org/wiki/Cercopithecus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/FranceNormandieChamprepusCercopithecusDiana.jpg","page_title":"Cercopithecus","context_page_description":"Cercopithecus Catarrhiniren barruko Cercopithecidae familiako generoetako bat da. 29 espezie ezagutzen dira. Gehienez ere 1,3 metro neurtzen dituzte eta 8 bat kilogramoko pisua dute. 25 urteko bizi-itxaropena dute.\\nEuren dietan fruituak, haziak, loreak, grama, intsektuak, narrastiak eta txoriak daude. Afrika osoan bizi dira, batez ere sabanan, manglaretan eta ura dagoen mendietan.\\nGehienak 20-40 kideko taldetan bizi dira. Bertan eme heldu bakoitzak bere familia-talde txikiagoa du. Espresioak egiteko gaitasun handia dute."},{"page_url":"https://fr.wikipedia.org/wiki/Family_One","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Spectacle_Family_One.jpg","page_title":"Family One","context_page_description":"Family One est un chœur gospel, composé de jeunes gens issus de la Fondation d'Auteuil."},{"page_url":"https://zh.wikipedia.org/wiki/W126","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/500_SEL_W126_2.jpg","page_title":"梅賽德斯-賓士W126","context_page_description":"梅赛德斯-奔驰W126系列是奔驰在1980-90年代推出的高级房车系列，公布于1979年9月时作为早期W116线的继任者，W126是第二代的奔驰旗舰，正式承担指Sonderklasse或S-Class的名字。\\n最初提供W126直6-V8的涡轮增压柴油轿车车型。 1981年9月，2门Coupe版本的W126进行了发布。和它的前身相比，W126是更符合空气动力学，配备燃油效率高、容量大的有力引擎。 W126的S-Class还推出一个新的奔驰设计风格，后来在公司阵容中的其他车辆使用。 W126行还推出了许多奔驰的安全创新，包括创的第一个安全气囊辅助约束系统，安全带预紧器和牵引控制系统。\\nW126在1979年和1991年之间长达12年的生产，比1950年代中期的旗舰车型都还长寿。"},{"page_url":"https://sl.wikipedia.org/wiki/Bitka_pri_Hajroneji","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Battle_of_Chaeronea%2C_338_BC.png","page_title":"Bitka pri Hajroneji","context_page_description":"Bitka pri Hajroneji je bila bitka, ki je potekala 2. avgusta 338 pr. n. št. pri Hajroneji med Makedonci in grško koalicijo.\\nBitka pri Hajroneji je bila najpomembnejša bitka pri Filipovem osvajanju Grčije, saj je s tem utrdil makedonsko hegemonijo in hkrati uničil atensko demokracijo; hkrati velja tudi za najboljšo Filipovo bitko."},{"page_url":"https://nl.wikipedia.org/wiki/Montrottier","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Montrottier_brouillard.jpg","page_title":"Montrottier","context_page_description":"Montrottier is een gemeente in het Franse departement Rhône en telt 1358 inwoners. De plaats maakt deel uit van het arrondissement Lyon."},{"page_url":"https://pl.wikipedia.org/wiki/Nosalowa_Prze%C5%82%C4%99cz","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Polana_Olczysko.jpg","page_title":"Nosalowa Przełęcz","context_page_description":"Nosalowa Przełęcz – znajdująca się na wysokości 1102 m przełęcz w północno-wschodniej grani Kasprowego Wierchu pomiędzy grzbietem Nosala i Nieboraka. Zachodnie stoki spod przełęczy opadają do Doliny Bystrej, wschodnie do Doliny Olczyskiej. W obydwa stoki przełęczy wcinają się żleby z niewielkimi potoczkami.\\nObszar przełęczy porasta górnoreglowy las świerkowy. Przełęcz jest ważna z punktu widzenia turystów i narciarzy – znajduje się na niej skrzyżowanie szlaków turystycznych i nartostrad. Oprócz znakowanych szlaków turystycznych i nartostrad wychodzą stąd nieznakowane ścieżki. Łącznie wszystkich ścieżek zaczynających się lub kończących się na Nosalowej Przełęczy jest 9, co jest tatrzańskim rekordem."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%80%D1%96%D1%81%D0%BD%D0%BE%D0%B2%D0%BE%D0%B4%D0%BD%D0%B8%D1%85_%D0%B0%D0%BA%D0%B2%D0%B0%D1%80%D1%96%D1%83%D0%BC%D0%BD%D0%B8%D1%85_%D1%80%D0%B8%D0%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Gelber_Buntbarsch.JPG","page_title":"Список прісноводних акваріумних риб","context_page_description":"Аква́ріумні риби — збірна назва таксономічно різнорідних риб, яких утримують у акваріумах з декоративною метою.\\nУ даному списку в систематичному порядку наведений список прісноводних риб, що утримуються в акваріумах."},{"page_url":"https://pt.wikipedia.org/wiki/Fort_Portal","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Fort_Portal_-_Flickr_-_Dave_Proffer_%281%29.jpg","page_title":"Fort Portal","context_page_description":"Fort Portal é uma cidade localizada na região Oeste de Uganda. É a principal cidade do distrito de Kabarole e do Reino de Toro. Está a aproximadamente 320 quilômetros de Kampala, a capital e maior cidade do país."},{"page_url":"https://eo.wikipedia.org/wiki/Grosswangen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Grosswangen_kaj_Sursee_viditaj_de_Pilato_324.jpg","page_title":"Grosswangen","context_page_description":"Grosswangen estas komunumo en la distrikto Sursee en Kantono Lucerno, Svislando. Ĝi havis 2896 loĝantojn je la 31-a de decembro 2008."},{"page_url":"https://es.wikipedia.org/wiki/Xbloc","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Xbloc_production.JPG","page_title":"Xbloc","context_page_description":"Un Xbloc es un bloque de hormigón para la sujeción de escolleras y rompeolas. Se diseñó para proteger orillas, paredes de puerto, diques, rompeolas, y otras estructuras costeras del impacto directo de las olas. El modelo Xbloc ha sido diseñado y desarrollado por Delta Marine Consultants en 2001 y desde entonces ha sido sometido a pruebas e investigaciones por varias universidades."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E7%85%A4%E7%B2%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Schwarzer_Trauerschmuck2.jpg","page_title":"煤精","context_page_description":"煤精，又稱煤精石、煤玉、黑玉、黑碳石，是一種有機寶石，為黑色或黑褐色固體，存在於沉積岩中，是遠古樹木在溫度和壓力作用下分解而成。其主要產地有：英格蘭北部約克郡海岸，法國的朗格多克省，西班牙的阿拉貢、加利西亞、阿斯圖里亞斯和中國的撫順等。"},{"page_url":"https://en.wikipedia.org/wiki/St_Botolph%27s_Church,_Boston","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Boston_Church%2C_Lincolnshire_by_James_Harrison.jpg","page_title":"St Botolph's Church, Boston","context_page_description":"St Botolph's Church is a parish church in the Church of England in Boston, Lincolnshire. Its tower, 266 feet 9 inches tall, has been nicknamed the \\"Boston Stump\\" since its construction. It was long used as a landmark for sailors, and on a clear day can be seen from Norfolk."},{"page_url":"https://de.wikipedia.org/wiki/Phaseoleae","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Clitoria_ternatea_beans.jpg","page_title":"Phaseoleae","context_page_description":"Phaseoleae ist eine Tribus in der Unterfamilie der Schmetterlingsblütler innerhalb der Familie der Hülsenfrüchtler. Diese Tribus enthält mit etwa 90 die meisten Gattungen innerhalb der Familie der Fabaceae. Ihre etwa 1570 Arten besitzen ein Hauptverbreitungsgebiet in tropischen bis warm-gemäßigten Gebieten der Welt, wobei es mehr Arten in trockeneren Gebieten gibt. Zahlreiche Arten werden durch den Menschen genutzt."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BE%D0%BD%D1%8F%D1%87%D0%BD%D0%B0_%D0%BA%D0%BE%D1%80%D0%BE%D0%BD%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/Coronal_Hole_Magnetic_Field_Lines.svg","page_title":"Сонячна корона","context_page_description":"Со́нячна коро́на — зовнішня частина атмосфери Сонця, яка відстежується до відстані майже в два радіуси Сонця від сонячної фотосфери. Сонячна плазма в цій частині має малу густину й розігрівається до температур у кілька мільйонів Кельвінів.\\nВисока температура корони зумовлює незвичайні спектральні характеристики, що змусило деяких дослідників 19-го сторіччя припустити наявність в ній раніше невідомого хімічного елемента — «коронію». Ці спектральні характеристики пізніше були пояснені наявністю високоіонізованих атомів заліза. Бенгт Едлен, по кроках праці Гротріана, вперше ідентифікував спектральні лінії корони у 1940 як переходи між низькими метастабільними рівнями базових конфігурацій високоіонізованих металів. Такі високі стадії іонізації означають температуру плазми понад 1 мільйон Кельвінів, що значно гарячіше температури поверхні Сонця.\\nЯскравість корони значно менша від яскравості поверхні Сонця та походить з трьох основних джерел, які всі займають один просторовий об'єм."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D8%A7%D9%85%D9%84%D8%A7%D8%AA_%D8%A7%D9%84%D8%B5%D9%81%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ed/Capra_ibex_ibex_%E2%80%93_03.jpg","page_title":"حاملات الصفن","context_page_description":"حاملات الصفن هي أصنوفة من الوحشيات تتبع طائفة الثدييات."},{"page_url":"https://cs.wikipedia.org/wiki/Vokovice","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/Cube-Koospol_Evropsk%C3%A1.jpg","page_title":"Vokovice","context_page_description":"Vokovice jsou katastrální území a čtvrť hlavního města Prahy, součást městské části, městského obvodu a správního obvodu Praha 6\\nVokovice byly připojeny k Praze roku 1922, kdy měly 2021 obyvatel. Předtím byly samostatnou obcí."},{"page_url":"https://nl.wikipedia.org/wiki/Saint-Agnan-sur-Erre","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Saint-Agnan-sur-Erre_-_Town_hall.JPG","page_title":"Saint-Agnan-sur-Erre","context_page_description":"Saint-Agnan-sur-Erre is een gemeente in het Franse departement Orne en telt 167 inwoners. De plaats maakt deel uit van het arrondissement Mortagne-au-Perche."},{"page_url":"https://en.wikipedia.org/wiki/County_of_Dalhousie_(South_Australia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Yongala3.jpg","page_title":"County of Dalhousie (South Australia)","context_page_description":"The County of Dalhousie is one of the 49 cadastral counties of South Australia in straddling the Mid North and Flinders Ranges regions. It was proclaimed in 1871 by Governor James Fergusson and was named for Fergusson's father-in-law James Broun-Ramsay, 1st Marquess of Dalhousie."},{"page_url":"https://pl.wikipedia.org/wiki/Pa%C5%82ac_Cosela","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Coselpalais.jpg","page_title":"Pałac Cosela","context_page_description":"Pałac Cosela – rokokowy pałac, znajdujący się w Dreźnie, w dzielnicy Innere Altstadt, przy Neumarkt. Jego nazwa pochodzi od nazwiska Fryderyka Augusta Cosela, z inicjatywy którego budynek powstał w latach 1762–1764. Obecnie w pałacu mieszczą się biura oraz dwie restauracje."},{"page_url":"https://de.wikipedia.org/wiki/Palais_Breuner","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Generalihof%2C_ehem._Palais_Brauner_%2845083%29_stitch_IMG_2811_-_IMG_2812.jpg","page_title":"Palais Breuner","context_page_description":"Das Palais Breuner ist ein ehemaliges Grazer Stadtpalais an der Ecke Herrengasse und Stempfergasse im Bezirk Innere Stadt."},{"page_url":"https://de.wikipedia.org/wiki/Talfest","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Maler_der_Grabkammer_des_Nacht_001.jpg","page_title":"Talfest","context_page_description":"Das Talfest zählte im Alten Ägypten zu den thebanischen Himmelsfesten und fiel jährlich in die altägyptische Jahreszeit Schemu. Bei der erstmaligen Begehung unter Mentuhotep II. wurde das Talfest während der sich dem Ende zuneigenden Nilschwemme im September gefeiert. Als Nekropolenfest stand es in direkter Verbindung mit dem Totenkult. Im Neuen Reich wurde das Talfest in Anspielung auf die Göttinnen Hathor, Sachmet und Bastet auch als „Fest der Trunkenheit“ verstanden, da in Esna zeitgleich das Fest „Besänftigen der Sachmet“ stattfand. Die thebanische Bevölkerung nahm nicht direkt am Prozessionszug sowie der Barkenüberfahrt des Amun teil, sondern beging in Gleichsetzung den „Tag des Rauschtrunks“ als „Fest im Grabe“\\nAbläufe des Talfestes, wie sie von der Bevölkerung begangen wurden, sind erstmals mit Beginn der 18. Dynastie belegt. Abbildungen der Opferrituale und der Prozession tauchen dagegen nur in den Tempeln der Könige auf, da jene heiligen Handlungen für den „einfachen Ägypter“ nicht zugänglich waren. Das Bildprogramm der königlichen Tempel und der Gräber ergänzte sich und umfasste somit die gesamten Rahmenhandlungen des Talfestes."},{"page_url":"https://it.wikipedia.org/wiki/Zemn%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Sz%C3%ADm%C5%9101.JPG","page_title":"Zemné","context_page_description":"Zemné è un comune della Slovacchia facente parte del distretto di Nové Zámky, nella regione di Nitra."},{"page_url":"https://da.wikipedia.org/wiki/Ingeni%C3%B8r_Valdemar_Poulsen_paa_sin_Station_for_traadl%C3%B8s_Telegrafi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Ingeni%C3%B8r_Valdemar_Poulsen_paa_sin_Station_for_traadl%C3%B8s_Telegrafi_07.jpg","page_title":"Ingeniør Valdemar Poulsen paa sin Station for traadløs Telegrafi","context_page_description":"Ingeniør Valdemar Poulsen paa sin Station for traadløs Telegrafi er en kort dokumentarisk stumfilm fra 1912 med ingeniøren Valdemar Poulsen.\\nDen korte dokumentarfilm beskrives af Det Danske Filminstitut med \\"Ingeniør Valdemar Poulsen ved sin station for trådløs telegrafi og telefoni på Radiomarken ved Bagsværd Sø. En mand ses kravle ned fra den høje sendemast. Der kigges på strimler sammen med Politiken-journalist Anker Kirkeby og en anden mand.\\"\\nFilmen er tilgængelig fra Det Danske Filminstituts streamingsite Filmcentralen.dk."},{"page_url":"https://fi.wikipedia.org/wiki/Panepist%C3%ADmio_(metroasema)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Attiki_Metro_Panepistimio1.jpg","page_title":"Panepistímio (metroasema)","context_page_description":"Panepistímio on Ateenan metron asema Linjalla 2. Se sijaitsee Ateenan ydinkeskustassa lähellä Ateenan yliopistoa, josta se on saanut nimensä.\\nMetroasema avattiin 28. tammikuuta 2000. Yliopiston päärakennuksen lisäksi aseman lähellä ovat muun muassa Ateenan akatemia, Kreikan kansalliskirjasto ja Dionysios Areopagitan katedraali. Seuraava asema pohjoiseen on Omónoia ja etelään Sýntagma."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%BF%BC%E9%BE%8D%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Altmuehlopterus_DB.jpg","page_title":"翼龍列表","context_page_description":"這份翼龍列表是翼龍目所有屬的綜合列表，表中列出了它們的屬名、命名者、命名時間、化石發現地以及有效性。該列表包括所有普遍接受的屬，但也包括無效、可疑或未正式命名的屬和有效屬的次異名，以及不再被認為是翼龍類的物種。該列表目前包括235個屬。"},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BF%D5%B8%D6%82%D5%A2%D5%A1%D5%B5%D5%B8%D6%82%D5%B4_%D5%85%D5%88%D5%92%D5%86%D4%B5%D5%8D%D4%BF%D5%95-%D5%AB_%D5%80%D5%A1%D5%B4%D5%A1%D5%B7%D5%AD%D5%A1%D6%80%D5%B0%D5%A1%D5%B5%D5%AB%D5%B6_%D5%AA%D5%A1%D5%BC%D5%A1%D5%B6%D5%A3%D5%B8%D6%82%D5%A9%D5%B5%D5%A1%D5%B6_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Capitolio_von_hinten.jpg","page_title":"Կուբայում ՅՈՒՆԵՍԿՕ-ի Համաշխարհային ժառանգության ցանկ","context_page_description":"ՅՈՒՆԵՍԿՕ-ի Համաշխարհային ժառանգության օբյեկտները Կուբայում, ստորև նշված է 9 անուն օբյեկտ։ Այս վայրերը կազմում են համաշխարհային ընդհանուր ժառանգության 0,8 %-ը ։ Բոլոր օբյեկտները ցանկի մեջ ներառված են մշակութային չափանիշներով։"},{"page_url":"https://cs.wikipedia.org/wiki/Leteck%C3%BD_motor","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Le_rhone.jpg","page_title":"Letecký motor","context_page_description":"Letadlové motory slouží k pohonu letadel. Ve většině případů jde o pístový motor nebo spalovací turbínu. Bývají zavěšeny pod křídlem nebo v trupu, ale některé konstrukce letecké motory umisťují na záď letounu, případně jinam."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_sat%C3%A9lites_naturais_do_Sistema_Solar","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Mimas_Cassini.jpg","page_title":"Lista de satélites naturais do Sistema Solar","context_page_description":"Os planetas e os planetas anões oficiais do Sistema Solar são, até onde se sabe, orbitados por 214 satélites naturais ou luas. 19 satélites do Sistema Solar são grandes o suficiente para serem arredondados devido ao efeito de sua gravidade e, portanto, seriam considerados planetas ou planetas anões se estivessem em órbita direta ao redor do Sol."},{"page_url":"https://sl.wikipedia.org/wiki/John_Frederick_William_Herschel","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Herschel_sitzend.jpg","page_title":"John Frederick William Herschel","context_page_description":"Sir John Frederick William Herschel, 1. baronet, FRS, angleški astronom, matematik in kemik, * 7. marec 1792, Slough pri Windsorju, grofija Berkshire, Anglija, † 11. maj 1871, Collingwood pri Hawkhurstu, Kent, Anglija."},{"page_url":"https://ro.wikipedia.org/wiki/Chilly,_Ardennes","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Chilly_%28Ardennes%29_city_limit_sign.JPG","page_title":"Chilly, Ardennes","context_page_description":"Chilly este o comună în departamentul Ardennes din nordul Franței. În 2009 avea o populație de 159 de locuitori."},{"page_url":"https://id.wikipedia.org/wiki/Kerupuk","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Kerupuk.jpg","page_title":"Kerupuk","context_page_description":"Kerupuk atau krupuk adalah makanan ringan yang pada umumnya dibuat dari adonan tepung tapioka dicampur bahan perasa seperti udang atau ikan. Kerupuk dibuat dengan mengukus adonan sampai matang, kemudian dipotong tipis-tipis, dikeringkan di bawah sinar matahari sampai kering dan digoreng dengan minyak goreng yang banyak. Makanan ini populer di kalangan masyarakat Indonesia sebagai lauk hidangan serta sebagai jenis lomba makan utama pada peringatan Hari Kemerdekaan Indonesia.\\nKerupuk tidak selalu berbahan dasar tepung tapioka, tetapi lebih kepada 3 proses persiapan. Pembuatan, pengeringan, dan pemasakan.\\nKerupuk bertekstur garing dan sering dijadikan pelengkap untuk berbagai makanan Indonesia seperti nasi goreng dan gado-gado.\\nKerupuk udang dan kerupuk ikan adalah jenis kerupuk yang paling umum dijumpai di Indonesia. Kerupuk berharga murah seperti kerupuk aci atau kerupuk mlarat hanya dibuat dari adonan sagu dicampur garam, bahan pewarna makanan, dan vetsin.\\nKerupuk biasanya dijual di dalam kemasan yang belum digoreng. Kerupuk ikan dari jenis yang sulit mengembang ketika digoreng biasanya dijual dalam bentuk sudah digoreng."},{"page_url":"https://de.wikipedia.org/wiki/Elektronischer_Aufenthaltstitel","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Aufenthaltserlaubnis-Schweiz.JPG","page_title":"Elektronischer Aufenthaltstitel","context_page_description":"Der elektronische Aufenthaltstitel, im Gesetz ausschließlich als Dokument mit elektronischem Speicher- und Verarbeitungsmedium bezeichnet, ist eine Kunststoffkarte aus Polycarbonat im Scheckkartenformat, mit der ein Ausländer in Deutschland und der übrigen Europäischen Union sein Aufenthaltsrecht nachweist. Der elektronische Aufenthaltstitel wird seit dem 1. September 2011 ausgestellt, ersetzt den in den Nationalpass eingeklebten Aufkleber und ähnelt in Aussehen und Funktion dem deutschen Personalausweis."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%BE%D9%88%D9%84%D8%A7_%D8%AC%D8%A7%D9%88%D8%AC%D9%88%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Pola_Gauguin_OB.F05882c.jpg","page_title":"پولا جاوجوين","context_page_description":"پولا جاوجوين كان صحفى من النرويج و دنمارك و فرنسا."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D1%80%D0%BE%D0%B2%D0%BE%D0%B7_%D1%81%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D1%8B_%D0%A4%D0%B5%D1%80%D0%BB%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/SM%26AR_Single_Fairlie_1878.jpg","page_title":"Паровоз системы Ферли","context_page_description":"Паровоз системы Ферли — сочленённый танк-паровоз, экипажная часть которого состоит из двух независимых, не соединённых между собою тележек. Различают двойной Ферли — классическая схема, — где оси каждой из тележек являются движущими, и одинарный Ферли, у которого движущие оси расположены только на одной из тележек, а вторая оборудована поддерживающими осями. Назван по фамилии шотландского инженера Роберта Френсиса Ферли, взявшего в 1864 г. патент на локомотив этой конструкции.\\nКлассический, двойной, Ферли является симметричным паровозом: от будки машиниста в обе стороны отходят два котла, оборудованные дымовыми трубами и сухопарниками, на каждой из двух тележек располагается по паре цилиндров, вдоль каждого из котлов устанавливаются водяные и топливные танки. Первоначально оба котла обслуживала одна топка, разделявшая будку машиниста на две части так, что машинист при движении оказывался в одной её части, а кочегар — в другой. Позже каждый из котлов получил собственную, отдельную, топку, но будка всё равно осталась разделённой на две половины.\\nОдинарный Ферли — несимметричен: у него один котёл и одна будка машиниста, за которой может располагаться угольный ящик."},{"page_url":"https://no.wikipedia.org/wiki/11._etappe_i_Tour_de_France_2006","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Cyril_Dessel_en_maillot_jaune_%28Tour_de_France_2006%29.jpg","page_title":"11. etappe i Tour de France 2006","context_page_description":"Etappe: 11.\\nDato: 13. juli\\nLengde: 206,5 km\\nNorske resultater:\\n163. Thor Hushovd"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BB%D0%B8%D0%BD%D0%BE%D0%B2%D1%89%D0%B8%D0%BD%D0%B0_(%D0%9C%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/%D0%9C%D0%B0%D0%BB%D1%96%D0%BD%D0%BE%D1%9E%D1%88%D1%87%D1%8B%D0%BD%D0%B0._%D0%90%D0%B1%D0%B5%D0%BB%D1%96%D1%81%D0%BA_%D0%BD%D0%B0_%D0%BC%D0%B0%D0%B3%D1%96%D0%BB%D0%B5_%D0%9C%D1%96%D1%85%D0%B0%D1%96%D0%BB%D0%B0_%D0%A1%D0%B2%D0%B5%D0%BD%D1%82%D0%B0%D1%80%D0%B6%D1%8D%D1%86%D0%BA%D0%B0%D0%B3%D0%B0_%2801%29.jpg","page_title":"Малиновщина (Минская область)","context_page_description":"Малиновщина — деревня в Молодечненском районе Минской области Белоруссии, в составе Лебедевского сельсовета. Население — 282 человека."},{"page_url":"https://no.wikipedia.org/wiki/Bacopa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Starr_010818-0007_Bacopa_monnieri.jpg","page_title":"Bacopa","context_page_description":"Bacopa er en gruppe vannplanter. De er ettårige eller stauder. Bladene står motsatt av hverandre. Stammen er hårete eller glatt. Blomstene er enkle eller i par, og har fem kronblader. De er vanligvis hvite, blå eller fiolette på farge.\\nBacopa monnieri er viktig i Ayurveda, og har blitt brukt i flere tusen år, særlig i India. Noen av de aktive bestanddelene er alkaloider, saponiner og flavonoider.\\nDen inneholder også betulinsyre, stigmastarol, beta-sitosterol og bacopasaponiner.\\nNoen arter regnes som ugress. Noen arter er utbredte i ferskvannsakvaristikken, og brukes også i dammer i varmere strøk. De fleste er enkle å dyrke, er saktevoksende, og krever middels til sterkt lys. De kan trives i de fleste vannkvaliteter. Bacopa caroliniana kan tolerere brakkvann."},{"page_url":"https://sv.wikipedia.org/wiki/Nordiska_passunionen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/FIN-NO.jpg","page_title":"Nordiska passunionen","context_page_description":"Den nordiska passunionen är ett mellanstatligt gränskontrollsamarbete mellan de nordiska staterna Danmark, Finland, Island, Norge och Sverige, inklusive de autonoma områdena Färöarna och Åland men exklusive Grönland, Jan Mayen och Svalbard. Samarbetet består av två delar, den ena rör nordiska medborgares rätt att röra sig fritt inom Norden utan pass, annan typ av resehandling eller uppehållstillstånd, den andra rör avskaffandet av gränskontrollerna vid de inre gränserna mellan de nordiska staterna. Dock kan tullkontroller och tillfälliga gränskontroller förekomma. Nordiska medborgare bör inneha någon typ av legitimationshandling vid resa inom Norden eftersom det kan krävas i andra sammanhang, till exempel vid flygresor, hotellvistelser och poliskontroller.\\nStora delar av den nordiska passunionens bestämmelser är i praktiken ersatta av Schengensamarbetet sedan de nordiska staterna anslöt sig till Schengenområdet i början av 2000-talet. Dock ger den nordiska passunionen mer långtgående rättigheter till nordiska medborgare än vad Schengenregelverket ger unionsmedborgare."},{"page_url":"https://fi.wikipedia.org/wiki/Evankeliumi_Markuksen_mukaan","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Armenian_gospels_%28The_S.S._Teacher%27s_Edition-The_Holy_Bible_-_Plate_XIX%29.jpg","page_title":"Evankeliumi Markuksen mukaan","context_page_description":"Evankeliumi Markuksen mukaan eli Markuksen evankeliumi on järjestykseltään toinen Uuden testamentin neljästä evankeliumista. Se on evankeliumeista vanhin ja lyhyin. Perinteisesti evankeliumin kirjoittajana on pidetty evankelista Markusta, mutta nykytutkimus pitää sitä tuntemattoman kirjoittajan teoksena, jossa on yhdistelty kronologiseen kertomusmuotoon varhaiskristillistä perinnetietoa eri lähteistä.\\nMarkuksen, Matteuksen ja Luukkaan evankeliumeja kutsutaan yhdessä synoptisiksi evankeliumeiksi, koska niiden sisällöt muistuttavat toisiaan. Markuksen evankeliumi on toiminut lähteenä Matteukselle ja Luukkaalle."},{"page_url":"https://en.wikipedia.org/wiki/List_of_palaces","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Istana_Lama_Kedah.jpg","page_title":"List of palaces","context_page_description":"Darul Aman Palace, Kabul – the country's most famous palace.\\nTajbeg Palace – inaccurately known as the Queen's Palace in English\\nArg Presidential Palace – Home of the President of Afghanistan"},{"page_url":"https://es.wikipedia.org/wiki/Distrito_Centro_(Jerez_de_la_Frontera)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Jerez_de_la_Fra._Iglesia_de_Santiago._Fachada.JPG","page_title":"Distrito Centro (Jerez de la Frontera)","context_page_description":"Distrito Centro es uno de los siete distritos de la ciudad de Jerez de la Frontera, en la provincia de Cádiz, España. Cuenta con una población de 34.190 habitantes​ y una extensión 2,9 km².\\nGran parte del centro histórico de la ciudad es Bien de Interés Cultural con la denominación de Conjunto Histórico Artístico: Casco Antiguo de Jerez de la Frontera, identificador RI-53-0000255.\\nConcentra actividad turista y de restauración​"},{"page_url":"https://pl.wikipedia.org/wiki/Skala_molowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Moll_dor.jpg","page_title":"Skala molowa","context_page_description":"Skala molowa, zwana też minorową – siedmiostopniowa skala z charakterystycznym półtonem między stopniami II i III. Skale molowe i oparte na nich fragmenty utworów muzycznych mają smutne brzmienie, w odróżnieniu od skal durowych."},{"page_url":"https://de.wikipedia.org/wiki/Willisau","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Willisau_historisch_beim_Undertor.jpg","page_title":"Willisau","context_page_description":"Willisau ist eine Kleinstadt und Einwohnergemeinde im Schweizer Kanton Luzern. Sie ist Sitz eines der vier Luzerner Bezirksgerichte.\\nDie heutige Gemeinde entstand am 1. Januar 2006 aus einer Fusion der beiden bisherigen Gemeinden Willisau Stadt und Willisau Land, nachdem deren stimmberechtigte Einwohner am 25. Januar 2004 den Zusammenschluss zur Stadt Willisau beschlossen hatten."},{"page_url":"https://en.wikipedia.org/wiki/List_of_public_art_in_Copenhagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Emiliekilde.jpg","page_title":"List of public art in Copenhagen","context_page_description":"This is a list of public art in Copenhagen, Denmark. This list applies only to works of public art on permanent display in an outdoor public space. For example, this does not include artworks in museums."},{"page_url":"https://de.wikipedia.org/wiki/Chenon","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/Chenon_castle1.JPG","page_title":"Chenon","context_page_description":"Chenon ist ein Ort und eine Gemeinde mit 141 Einwohnern im westfranzösischen Département Charente in der Region Nouvelle-Aquitaine. Die Gemeinde besteht aus mehreren Weilern und Einzelgehöften."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BB%D0%B0%D1%82%D1%96%D0%BD%D0%B0-%D0%A2%D1%96%D0%BC%D1%96%D1%88_(%D0%BA%D0%BE%D0%BC%D1%83%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/ROU_CS_Slatina-Timis_CoA.png","page_title":"Слатіна-Тіміш (комуна)","context_page_description":"Слатіна-Тіміш — комуна у повіті Караш-Северін в Румунії. До складу комуни входять такі села:\\nІлова\\nСадова-Веке\\nСадова-Ноуе\\nСлатіна-Тіміш\\nКомуна розташована на відстані 313 км на захід від Бухареста, 31 км на схід від Решиці, 99 км на південний схід від Тімішоари."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D0%B5%D0%B7%D1%83%D0%BE%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Bridge_on_B%C3%A8ze_in_Bezouotte.JPG","page_title":"Безуот","context_page_description":"Безуот насеље је и општина у источном делу централне Француске у региону Бургоња, у департману Златна обала која припада префектури Дижон.\\nПо подацима из 2011. године у општини је живело 204 становника, а густина насељености је износила 185,45 становника/km². Општина се простире на површини од 1,1 km². Налази се на средњој надморској висини од 219 метара."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_provinciale_monumenten_in_Drenthe","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Tramremise%2C_Wilhelminalaan_76%2C_Frederiksoord.JPG","page_title":"Lijst van provinciale monumenten in Drenthe","context_page_description":"Deze lijst bevat een overzicht van alle provinciale monumenten in de Nederlandse provincie Drenthe. Meer afbeeldingen daarvan zijn te vinden in de categorie Provinciale monumenten in Drenthe op Wikimedia Commons.\\nZie ook de lijsten van rijksmonumenten en gemeentelijke monumenten in Drenthe."},{"page_url":"https://eu.wikipedia.org/wiki/Azukre_beltz","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Brown_sugar_examples.JPG","page_title":"Azukre beltz","context_page_description":"Azukre beltza sakarosazko azukre bat da, melazaren presentziagatik kolore hori bereizgarria duena. Findu gabeko edo partzialki findutako azukrea da, melaza hondarreko edukiren bat duten edo azukre zuri finduari melaza gehitzearen ondorioz sortutako azukre-kristalez osatua.\\nAzukre beltzaranak %3,5 eta % 6,5 melaza ditu. Azukre beltzak, uraren presentziari esker, azukre zuriak baino kaloria gutxiago du. Ehun gramo azukre beltzek 373 kilokaloria dituzte; azukre zuriak, berriz, 396."},{"page_url":"https://no.wikipedia.org/wiki/Amor_Ben_Yahia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Amor_Ben_Yahia_runs_3%2C000-meter_steeplechase_at_Rio_Olympic_Games_photos_by_Tim_Hipps%2C_U.S._Army_IMCOM_Public_Affairs_%2828974477421%29_%28cropped%29.jpg","page_title":"Amor Ben Yahia","context_page_description":"Amor Ben Yahia er en tunisisk friidrettsutøver som konkurrerer i hinderløp. Han representerte landet sitt under Sommer-OL 2012 i London, der han ble utslått i de innledende rundene på 3000 meter hinder."},{"page_url":"https://es.wikipedia.org/wiki/Oliveira_(Minas_Gerais)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Cai%27n%C3%A1guas.jpg","page_title":"Oliveira (Minas Gerais)","context_page_description":"Oliveira es un municipio brasileño del estado de Minas Gerais, localizado a 150 kilómetros a suroeste de Belo Horizonte, que tiene 41181 habitantes, conforme las últimas estimativas del IBGE."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D6%80%D5%A5%D5%A3%D5%A1%D5%AF%D5%AB_%D5%AD%D5%A1%D5%BE%D5%A1%D6%80%D5%B8%D6%82%D5%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Eclipse_fromISS_2006-03-29.jpg","page_title":"Արեգակի խավարում","context_page_description":"Արեգակի խավարում, տիեզերական երևույթ է, երբ Լուսինն անցնում է Երկրի և Արեգակի միջով՝ մասամբ կամ ամբողջությամբ ծածկելով Արեգակի սկավառակը երկրային դիտորդի համար։ Կախված Երկրի նկատմամբ իր դիրքից և Երկրից ունեցած հեռավորությունից՝ Լուսինը կարող է ծածկել Արեգակն ամբողջությամբ կամ դրա մի մասը միայն ։ Լինում են նաև օղակաձև և հիբրիդ խավարումներ։ Հիբրիդ խավարում շատ հազվադեպ է դիտվում, երբ երկրագնդի որոշ մասում լրիվ, որոշ մասում օղակաձև խավարում է դիտվում։"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A0%96%EC%83%98","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Baby_sheep_feeding.JPG","page_title":"젖샘","context_page_description":"젖샘은 포유류가 자식에게 먹이기 위해 젖을 생성하는 기관이다. 외분비선의 일종으로 땀샘이 변형, 확대된 것이다.\\n젖샘의 위치와 개수는 포유류마다 많은 차이가 있다. 유두와 젖샘은 복부에 평행하게 나 있는 두 개의 '젖줄'을 따라 발달한다. 거의 대부분의 포유류는 이 줄을 따라 짝수의 젖샘을 갖게 되는데, 보통 출산시 한 번에 갖는 새끼의 수와 비슷한 쌍을 가진다. 거의 대부분의 영장류가 2개를 갖고, 소는 4개, 곰은 6개, 개는 8개, 돼지는 거의 20개이다."},{"page_url":"https://es.wikipedia.org/wiki/Bourdeilles","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Bourdeilles_view.jpg","page_title":"Bourdeilles","context_page_description":"Bourdeilles es una población y comuna francesa, situada en la región de Aquitania, departamento de Dordoña, en el distrito de Périgueux y cantón de Brantôme. La localidad es atravesada por el río Dronne."},{"page_url":"https://it.wikipedia.org/wiki/Cino_Del_Duca","image_url":"https://upload.wikimedia.org/wikipedia/it/a/a6/Cino_del_duca.jpg","page_title":"Cino Del Duca","context_page_description":"Cino Del Duca, all'anagrafe Pacifico Del Duca, è stato un imprenditore, editore, produttore cinematografico e filantropo italiano.\\nHa vissuto e operato soprattutto in Francia, dove è noto per aver fondato diversi periodici e per l'attività filantropica e di sostegno alla cultura svolta in quel paese. È sepolto nel cimitero di Père-Lachaise."},{"page_url":"https://en.wikipedia.org/wiki/M-10003_to_M-10006","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/CNW_Streamliners.jpg","page_title":"M-10003 to M-10006","context_page_description":"The Union Pacific Railroad's M-10003, M-10004, M-10005, and M-10006 were four identical diesel-electric streamliner train 2-car power sets delivered in May, June, and July 1936 from Pullman-Standard, with prime movers from the Winton Engine Corporation of General Motors and General Electric generators, control equipment and traction motors. One was for the City of San Francisco, two were for the City of Denver, and one was a spare set intended for both routes. In 1939, M-10004 was split and converted into additional boosters for the other sets, now renumbered CD-05, CD-06, and CD-07, all running on the City of Denver. The M-10001 power car became the other third booster. In this form, the three power sets ran until they were replaced by E8 locomotives in 1953, at which point they were scrapped."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A7%9F%E5%B2%9B%E5%B8%82%E6%94%BF%E5%8E%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Penang_City_Hall.jpg","page_title":"槟岛市政厅","context_page_description":"槟岛市政厅是马来西亚槟城州首府乔治市的地方政府，隶属槟城州政府。"},{"page_url":"https://en.wikipedia.org/wiki/New_York_State_Route_182","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/NY_182_in_Niagara_Falls.jpg","page_title":"New York State Route 182","context_page_description":"New York State Route 182 is a 6.18-mile state highway in Niagara County, New York, in the United States. It serves as a signed connection between the Whirlpool Rapids Bridge over the Niagara River and the Niagara Falls International Airport east of the city of Niagara Falls. From the bridge, NY 182 runs across the city of Niagara Falls, following several local streets as it makes its way to an intersection with U.S. Route 62 in Wheatfield. The route was originally designated as New York State Route 18D in the early 1930s. It gained its current designation on January 1, 1962."},{"page_url":"https://pl.wikipedia.org/wiki/Parafia_Podwy%C5%BCszenia_Krzy%C5%BCa_%C5%9Awi%C4%99tego_w_Borecznie","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Boreczno%2C_ko%C5%9Bci%C3%B3%C5%82_par._p.w._Podwy%C5%BCszenia_%C5%9Aw._Krzy%C5%BCa%2C_ok._1330%2C_1832_01.JPG","page_title":"Parafia Podwyższenia Krzyża Świętego w Borecznie","context_page_description":"Parafia Podwyższenia Krzyża Świętego w Borecznie – parafia rzymskokatolicka w diecezji elbląskiej. Erygowana w 1311 roku, reerygowana 28 października 1972 roku przez administratora warmińskiego Józefa Drzazgę. Do parafii należą miejscowości: Boreczno, Jaśkowo, Huta Wielka, Janiki Małe, Janiki Wielkie, Kęty, Karpowo, Karnity, Mozgowo, Smolajny, Surbajny, Surzyki Małe, Śliwa, Urowo, Wielowieś, Wieprz. Tereny te znajdują się w gminie Zalewo w powiecie iławskim w województwie warmińsko-mazurskim.\\nKościół parafialny w Borecznie został wybudowany i konsekrowany ok. 1330 roku."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_cores_de_corpo_da_Luftwaffe","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Bundesarchiv_Bild_146-1990-021-09A%2C_G%C3%BCnther_Rall_Recolored.jpg","page_title":"Lista de cores de corpo da Luftwaffe","context_page_description":"Esta é uma lista das cores de corpo da Luftwaffe. As cores de corpo, ou cores de função, foram usadas pelas forças armadas alemãs entre 1935 e 1945, para distinguir os militares dos vários ramos, funções especiais, corpos, grupos de classificação, funcionários, entre outros serviços. A cor de corpo era uma parte do uniforme que se expressava através dos galões, das passadeiras de posto e dos ornamentos; fazia também parte das bandeiras, cores padrões e guias dos símbolos representativos de determinadas forças.\\nNa Luftwaffe, havia um sistema estritamente definido de cores de corpo para as divisas nas extremidades do colarinho, nos ombros e nos ornamentos da própria farda. As passadeiras em uniformes especiais da Luftwaffe, como os fatos de voo e macacões, também exibiam cores de corpo."},{"page_url":"https://eo.wikipedia.org/wiki/Gere%C4%89e","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Roman_Catholic_church_in_Tardos%2C_Hungary.jpg","page_title":"Gereĉe","context_page_description":"Gereĉe estes malgranda montaro en la departemento Komárom-Esztergom en nord-meza parto de Transdanubio.\\nLa averaĝa alto estas 400 m. La plej alta monto estas Nagy-Gerecse 634 m-ojn alta. Areo estas 850 km². La granda parto konsistas el kalkoŝtono, kelkloke estas dolomitoj. Sur la surfaco troviĝas ankaŭ laŭso. Oni minadas en la montaro marmoron kaj karbon.\\nInterne de la montaro troviĝas nur 2 komunumoj: Tardos kaj Vértestolna. Urboj Tata, Tatabánya kaj Lábatlan troviĝas ĉe la piedoj de la montaro.\\nEn la montaro oni trovis 300 da malgrandaj kavernoj."},{"page_url":"https://en.wikipedia.org/wiki/Uniform_tiling","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/Uniform_tiling_552-t02.png","page_title":"Uniform tiling","context_page_description":"In geometry, a uniform tiling is a tessellation of the plane by regular polygon faces with the restriction of being vertex-transitive.\\nUniform tilings can exist in both the Euclidean plane and hyperbolic plane. Uniform tilings are related to the finite uniform polyhedra which can be considered uniform tilings of the sphere.\\nMost uniform tilings can be made from a Wythoff construction starting with a symmetry group and a singular generator point inside of the fundamental domain. A planar symmetry group has a polygonal fundamental domain and can be represented by the group name represented by the order of the mirrors in sequential vertices.\\nA fundamental domain triangle is, and a right triangle, where p, q, r are whole numbers greater than 1. The triangle may exist as a spherical triangle, a Euclidean plane triangle, or a hyperbolic plane triangle, depending on the values of p, q and r.\\nThere are a number of symbolic schemes for naming these figures, from a modified Schläfli symbol for right triangle domains: → {p, q}. The Coxeter-Dynkin diagram is a triangular graph with p, q, r labeled on the edges. If r = 2, the graph is linear since order-2 domain nodes generate no reflections."},{"page_url":"https://en.wikipedia.org/wiki/The_Nun%27s_Story_(film)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Brugge_Sint-Annarei_22_R01.jpg","page_title":"The Nun's Story (film)","context_page_description":"The Nun's Story is a 1959 American drama film directed by Fred Zinnemann and starring Audrey Hepburn, Peter Finch, Edith Evans, and Peggy Ashcroft. The screenplay was written by Robert Anderson, based upon the popular 1956 novel of the same name by Kathryn Hulme. The film tells the life of Sister Luke, a young Belgian woman who decides to enter a convent and make the many sacrifices required by her choice.\\nThe film is a relatively faithful adaptation of the novel, which was based on the life of Belgian nun Marie Louise Habets.\\nLatter portions of the film were shot on location in the Belgian Congo and feature Finch as a cynical but caring surgeon."},{"page_url":"https://nl.wikipedia.org/wiki/Speciale_markering","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Br.%26W._Oostende.jpg","page_title":"Speciale markering","context_page_description":"Speciale markering of speciale betonning in de vorm van een boei of andere markering, zoals gedefinieerd door de International Association of Lighthouse Authorities door middel van het IALA Maritiem Betonningsstelsel, is een vorm van betonning die gebruikt wordt door maritieme loodsen om aan te geven voor de scheepvaart dat hier de grens ligt van een obstructie, van een administratief gebied, zoals voor een snelheidsbeperking, voor waterskiën, of voor ligplaatsen, of om andere functies te markeren zoals de monding van rioleringspijpen.\\nDeze speciale markeringen zijn herkenbaar door hun gele kleur en de X als top-markering."},{"page_url":"https://eu.wikipedia.org/wiki/A%C3%AFrosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Airosa.jpg","page_title":"Aïrosa","context_page_description":"Aïrosa Donibane Lohizunen egoitza duen atunontzia da\\n1953an Ziburuko Hiribarren anaiek egina, Patchiku itsasontziaren moduan, euskal itsas-arotzeriaren adibide nagusienetariko bat da. BA 294 641 matrikula-zenbakia du. Inguratze arrantzan erabilia, bolintxa erabiltzen zuen sardinak harrapatzeko. Tretzaontzi moduan ere erabiltzen zuten.\\n1999an France 2rako Les Moissons de l'océan telefilmean agertu zen.\\n2002ko ekainaren 7an monumentu historiko izendatu zuten. Oraindik lanean dabil."},{"page_url":"https://it.wikipedia.org/wiki/Felipe_Massa","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Felipe_Massa_at_the_press_conference.jpg","page_title":"Felipe Massa","context_page_description":"Felipe Massa è un pilota automobilistico brasiliano.\\nNel corso della sua lunga carriera in Formula 1 ha corso al volante di Sauber, Ferrari e Williams. Ha conquistato 11 vittorie, 16 pole position ed è salito 41 volte sul podio, facendo segnare oltre 1000 punti iridati. Dopo Michael Schumacher e Kimi Räikkönen è il pilota ad aver disputato più stagioni e più Gran Premi al volante della Ferrari in Formula 1. Dalla stagione 2018-2019 prende parte al campionato di Formula E con il team Venturi Grand Prix."},{"page_url":"https://en.wikipedia.org/wiki/Rugby,_North_Dakota","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Rugby_North_Dakota_Downtown.jpg","page_title":"Rugby, North Dakota","context_page_description":"Rugby is a city in, and the county seat of, Pierce County, North Dakota, United States. The population was 2,876 at the 2010 census, making it the twentieth largest city in North Dakota. Rugby was founded in 1886.\\nRugby is often billed as the geographic center of North America."},{"page_url":"https://fr.wikipedia.org/wiki/Dewoitine_D.500","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Dewoitine_D.511.jpg","page_title":"Dewoitine D.500","context_page_description":"Le Dewoitine D.500 est un chasseur français de l'entre-deux-guerres construit par Dewoitine. Il fut le premier appareil monoplan à ailes basses cantilever à entrer en service au sein de l'armée de l'air française."},{"page_url":"https://fr.wikipedia.org/wiki/Lee_Patrick","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Lee_Patrick_in_Inner_Sanctum.jpg","page_title":"Lee Patrick","context_page_description":"Lee Patrick est une actrice américaine, de son nom complet Lee Salome Patrick, née le 22 novembre 1901 à New York, morte d'une crise cardiaque le 21 novembre 1982 à Laguna Beach."},{"page_url":"https://pt.wikipedia.org/wiki/Etanotiol","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Ethanethiol-3D-balls.png","page_title":"Etanotiol","context_page_description":"O etanotiol é um composto químico de odor muito desagradável. Na prática o etanotiol é usado para detectar vazamentos de gases inodoros como o gás natural."},{"page_url":"https://it.wikipedia.org/wiki/James_Price","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/James_Price_alchemist.png","page_title":"James Price","context_page_description":"James Higginbotham, alias James Price, è stato un chimico e alchimista britannico, che affermò di essere in grado di trasmutare il mercurio in oro o argento. Quando gli venne chiesta una dimostrazione pubblica della trasformazione di fronte ad una platea di testimoni attendibili si suicidò bevendo acido prussico.\\nNato a Londra nel 1752 con il nome di James Higginbotham, che cambiò in Price per esaudire i desideri di un suo parente che morì e gli lasciò un'eredità. Seguì l'università di Oxford dove, anche se non esistono registrazioni della sua carriera scolastica precedente o delle sue ricerche all'università, ebbe una brillante carriera diventando Master of Arts a 25 anni e dottore in medicina nel 1778, dopo i suoi lavori nel campo della chimica. Nel 1781, a 29 anni, divenne un membro della Royal Society.\\nNell'anno successivo si occupò di studi alchemici, in particolare nella trasmutazione dei metalli di base in metalli preziosi. Il 6 maggio 1782, dopo aver rivelato le sue scoperte ad alcuni amici, iniziò una serie di esperimenti pubblici nel suo laboratorio a Guildford."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%B1%CF%84%CE%AC%CE%BB%CE%BF%CE%B3%CE%BF%CF%82_%CE%BC%CE%BF%CE%BD%CE%B1%CF%81%CF%87%CF%8E%CE%BD_%CF%84%CE%B7%CF%82_%CE%94%CE%B1%CE%BD%CE%AF%CE%B1%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Harald-2.%28Harald-VI%29%2C1646%2CAlbert-Haelwegh.jpg","page_title":"Κατάλογος μοναρχών της Δανίας","context_page_description":"Ακολουθεί κατάλογος των μοναρχών της Δανίας που περιλαμβάνει:\\nΤο Βασίλειο της Δανίας\\nΤην προσωπική ένωση Δανίας και Νορβηγίας\\nΤην Ένωση του Κάλμαρ\\nΈνωση Δανίας, Νορβηγίας και Σουηδίας\\nΈνωση Δανίας και Νορβηγίας\\nΤο Βασίλειο Δανίας-Νορβηγίας\\nΤο Βασίλειο της Δανίας\\nΤο Βασίλειο της Ισλανδίας\\nΓροιλανδία\\nΝησιά Φερόες\\nΟ Οίκος του Ολδεμβούργου κατείχε το Στέμμα της Δανίας την περίοδο, κατόπιν πέρασε στον Οίκο του Γκλύξμπουργκ υποκλάδο του ίδιου Οίκου. Το βασίλειο ήταν αιρετό μέχρι το 1660, κατόπιν έγινε κληρονομικό και απολυταρχικό. Μέχρι το 1864 η Δανία ήταν ενωμένη σε προσωπική ένωση με τα δουκάτα του Σλέσβιχ και Χόλσταϊν."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Bele%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Bele%C3%B1a-Salamanca_03.JPG","page_title":"Beleña","context_page_description":"Beleña sī tī Se-pan-gâ Castilla kap León chū-tī siā-lí Salamanca séng ê chi̍t ê municipio."},{"page_url":"https://nn.wikipedia.org/wiki/AMD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/AMD_C8080A.jpg","page_title":"AMD","context_page_description":"Advanced Micro Devices, Inc. er eit USA-amerikansk multinasjonalt selskap med hovudkontor i Sunnyvale i California. AMD utviklar prosessorar og annan maskinvare for datamaskinar. AMD er den nest største globale leverandøren av mikroprosessorar basert på x86-arkitektur etter Intel Corporation, og den tredje største leverandøren av grafikkustyr. Selskapet eig og 21 prosent av Spansion, ein leverandør av flash-minne."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9D%D1%83%D1%82%D1%80%D0%B8%D0%B3%D0%B5%D0%BD%D0%BE%D0%BC%D0%B8%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Nutrisls5.1.JPG","page_title":"Нутригеномика","context_page_description":"Нутригеномика је концепт тзв. инвидидуализације исхране. Реч је настала од енглеских речи nutrition и genomics. Истраживањем у САД прихваћен је израз personalized nutrition, док је у Европи назива нутриогеномика."},{"page_url":"https://en.wikipedia.org/wiki/Air_Training_Command","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/T-37_021203-O-9999G-003.jpg","page_title":"Air Training Command","context_page_description":"Air Training Command is a former United States Air Force Major Command designation. It was headquartered at Randolph Air Force Base, Texas, but was initially formed at Barksdale Air Force Base, Louisiana. It was re-designated as Air Education and Training Command following a merger with Air University on 1 July 1993.\\nATC was organized on 1 July 1946 as a re-designation of Army Air Forces Training Command as part of the re-organization of the United States Army Air Forces after World War II.\\nFor nearly 50 years, ATC was the primary training organization of the United States Air Force from its inception as an independent service in September 1947. It provided pilot and aircrew training; technical training, and enlisted and officer basic training.\\nAt the end of the Cold War, it was merged with Air University in July 1993 as part of a major top-to-bottom reorganization of the USAF. Personnel, equipment and resources of both organizations were re-designated as Air Education and Training Command, which assumed the mission of both organizations, but retained AU as a subordinate organization within AETC."},{"page_url":"https://eu.wikipedia.org/wiki/MK_Ultra_proiektua","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Mkultra-lsd-doc.jpg","page_title":"MK Ultra proiektua","context_page_description":"MK Ultra proiektua —batzuetan CIAren kontrol mentalerako programa bezala aipatua— legez kanpoko sekretupeko programa bati jarri zitzaion gako-hitza izan zen, Estatu Batuetako Inteligentzia Agentzia Zentralak martxan jarria eta gizakietan esperimentuak egiteko pentsatua. Saiakera hauek substantzia eta prozedura berriak aurkitu eta garatzea zuten xede, galdeketetan eta torturetan erabiltzeko. Substantzia edo prozedura horiek norbanakoa ahultzen zuten eta kontrol mentalaren bidezko tekniken bidez aitormenak egitera behartzen zen.\\nCIAren Inteligentzia Zientifikoko Banaketak antolatu zuen proiektua, Estatu Batuetako Armadaren Operazio Berezien Zuzendaritzarekin batera. Programa 1950ko hamarkadan abiarazi zen eta 1953an ofizialki zigortua izan zen, hala ere, 1964. urtera arte bere horretan jarraitu zuen programak; urte horretan ekintzak poliki murrizten hasi zen, harik eta 1973. urtean bertan behera utzi arte. Programak legez kanpoko ekintza bat baino gehiago burutu zituen, adibidez, Estatu Batuetako eta Kanadako biztanle batzuk gogoz kontra hartu eta esperimentuak egin zizkien, horrek haren zilegitasuna deuseztatu zuen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D1%87%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/%D0%97%D0%B4%D0%B0%D0%BD%D0%B8%D0%B5_%D0%B4%D0%B0%D1%87%D0%B8_%D0%A4%D1%80%D0%BE%D0%BD%D1%88%D1%82%D0%B5%D0%B9%D0%BD_03.JPG","page_title":"Сочи","context_page_description":"Со́чи — город в России, расположен на северо-восточном побережье Чёрного моря в Краснодарском крае, на расстоянии 1620 км от Москвы. Административный центр муниципального образования город-курорт Сочи.\\nСочи — крупнейший курортный город России, важный транспортный узел, а также крупный экономический и культурный центр черноморского побережья России.\\nНеофициально именуется также летней, южной и курортной «столицей» России. В 2012 году журнал Forbes признал Сочи лучшим городом для ведения бизнеса в стране.\\nВ 2007 году Сочи избран столицей XXII зимних Олимпийских игр. 15 сентября 2009 года Сочи вступил во Всемирный союз олимпийских городов. В период подготовки к Олимпиаде на развитие города и его инфраструктуры потратили 500 млрд рублей.\\nВ 2018 году город принял матчи Чемпионата мира по футболу."},{"page_url":"https://en.wikipedia.org/wiki/Sri_Lankan_Moors","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Lanka_moors.jpg","page_title":"Sri Lankan Moors","context_page_description":"Sri Lankan Moors are an ethnic minority group in Sri Lanka, comprising 9.2% of the country's total population. They are mainly native speakers of the Tamil language with influence of Sinhalese and Arabic words. They are predominantly followers of Islam. The Sri Lankan Muslim community is divided as Sri Lankan Moors, Indian Moors and Sri Lankan Malays as per their history and traditions.\\nThe Moors trace their ancestry to Arab traders who first settled in Sri Lanka around the 9th century who intermarried with local women. The concentration of Moors are the highest in the Ampara, Trincomalee and Batticaloa districts."},{"page_url":"https://sv.wikipedia.org/wiki/Sommaren_med_Monika","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Monikamovie.JPG","page_title":"Sommaren med Monika","context_page_description":"Sommaren med Monika är en film från 1953 i regi av Ingmar Bergman, med Lars Ekborg och Harriet Andersson i huvudrollerna. Filmen är baserad på romanen Sommaren med Monika skriven av Per Anders Fogelström."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_der_Bahnhofsvorstadt_(Plauen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Plauen%2C_Pausaer_Stra%C3%9Fe_022.JPG","page_title":"Liste der Kulturdenkmale in der Bahnhofsvorstadt (Plauen)","context_page_description":"In der Liste der Kulturdenkmale in der Bahnhofsvorstadt sind die Kulturdenkmale des Plauener Stadtteils Bahnhofsvorstadt verzeichnet, die bis Dezember 2019 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Aufzählung ist eine Teilmenge der Liste der Kulturdenkmale in Plauen."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%81%8A%E8%A6%BD%E5%AE%8C%E4%B8%8A%E6%B0%B4%E5%8E%BB%E5%B1%AF%E9%96%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/San_Kung_Street_Shops_closed_20150308.jpg","page_title":"遊覽完上水去屯門","context_page_description":"游览完上水去屯门为2015年3月8日在香港新界上水、屯门及尖沙咀所发生的社会运动，由社交网络群组在网上发起，原因为抗议香港境内水货客问题，目标与自2012年9月起发动的光复上水站的原因相近，为2015年继光复屯门、捍卫沙田及光复元朗后，第四次抗议香港境内水货客问题活动。\\n示威者指控香港政府无视来自中国大陆的水货客充斥着上水，涉嫌从事走私活动，同时使到物价膨胀以及商铺租金上升，位于市中心一带的小商户均被药房及首饰店深受自由行欢迎的商店取代，严重影响居民生活。约20名网民响应社交网络号召，到上水港铁站集合。唯由于警员人数较示威者多数倍，加上没有发起人号召游行路线，到下午4时许示威者未有起步游行已陆续散去，部分人号称是响应网上号召前往屯门市中心一带商场。到晚上7时，警方在V City天桥底包围并拘捕4名示威者，示威者随即散去。到晚上近10时，数十名示威人士又转往尖沙咀一带。期间有一些激进蒙面示威者高声辱骂以及踢打疑似中国大陆旅客及其行李，部分店铺见状暂时关门，恐防示威者进入店内，事件令他们无法正常营业。"},{"page_url":"https://de.wikipedia.org/wiki/Lohme","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Findling_Blandow_3.jpg","page_title":"Lohme","context_page_description":"Lohme ist eine Gemeinde im Landkreis Vorpommern-Rügen auf der Insel Rügen in Mecklenburg-Vorpommern. Sie grenzt an die berühmten Rügener Kreidefelsen mit der Stubbenkammer an."},{"page_url":"https://ca.wikipedia.org/wiki/De_divina_proportione","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Luca_Pacioli%2C_De_divina_proportione%2C_Letter_I.jpg","page_title":"De divina proportione","context_page_description":"De divina proportione és un llibre sobre matemàtiques escrit per Luca Pacioli i il·lustrat per Leonardo da Vinci, compost al voltant de 1498 a Milà i imprès per primer cop el 1509. El seu tema era sobre proporcions matemàtiques i les seves aplicacions en geometria, art visual a través de perspectiva, i arquitectura. La claredat del material escrit i els esquemes excel·lents de Leonardo van ajudar a que el llibre aconseguís un impacte allèn cercles matemàtics, popularitzant conceptes i imatges geomètriques contemporànies.\\nPacioli va produir tres manuscrits del treatise amb escribans diferents. Va donar la primera còpia amb una dedicació al Duc de Milà, Ludovico il Moro; aquest manuscrit es conserva a Suïssa al Bibliothèque de Genève de Ginebra. Una segona còpia va ser lliurada a Galeazzo da Sanseverino i ara restes al Biblioteca Ambrosiana dins Milà. El tercera, el qual ha anat desaparegut, va ser lliurada a Pier Soderini, el Gonfaloniere de Florence. L'1 de juny de 1509 la primera edició impresa va ser publicada a Venècia per Paganino Paganini; de llavors ençà ha estat reimpresa diversos vegades."},{"page_url":"https://en.wikipedia.org/wiki/Vop_(river)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Vop-Yartsevo.JPG","page_title":"Vop (river)","context_page_description":"The Vop is a river in Smolensk Oblast, Russia. It is a right tributary of the Dnieper. It is 158 km long, with a drainage basin of 3300 km². The average discharge is 22 m³/s.\\nThe river was the site of intense combat operations in the Smolensk region in the period July–September, 1941 as part of Operation Barbarossa."},{"page_url":"https://it.wikipedia.org/wiki/Letteratura_latina","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Cicero_-_Musei_Capitolini.JPG","page_title":"Letteratura latina","context_page_description":"La letteratura latina è l'insieme della produzione letteraria in lingua latina e delle problematiche che gravitano intorno al suo studio."},{"page_url":"https://en.wikipedia.org/wiki/Jane_Birkin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/2017.04.19._Jane_Birkin_Warsaw_Poland_Fot_Mariusz_Kubik.JPG","page_title":"Jane Birkin","context_page_description":"Jane Mallory Birkin, OBE is an English-French actress, singer, songwriter, and model. She attained international fame and notability for her decade-long musical and romantic partnership with Serge Gainsbourg. She also had a prolific career as an actress in British and French cinema.\\nA native of London, Birkin began her career as an actress, appearing in minor roles in Michelangelo Antonioni's Blowup, and Kaleidoscope. In 1969, she met Serge Gainsbourg while co-starring with him in Slogan, which marked the beginning of a years-long working and personal relationship. The duo released their debut album Jane Birkin/Serge Gainsbourg, and Birkin also appeared in the controversial film Je t'aime moi non plus under Gainsbourg's direction. Birkin would attain further acting credits in Agatha Christie's films Death on the Nile, and Evil Under the Sun.\\nAfter separating from Gainsbourg in 1980, Birkin continued to work as both an actress and a singer, appearing in various independent films and recording numerous solo albums. In 1991, she appeared in the miniseries Red Fox, and in the American drama film A Soldier's Daughter Never Cries, in 1998."},{"page_url":"https://sv.wikipedia.org/wiki/Joyeuse,_Ard%C3%A8che","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Ch%C3%A2teau_Ducal_%C3%A0_Joyeuse.JPG","page_title":"Joyeuse, Ardèche","context_page_description":"Joyeuse är en kommun i departementet Ardèche i regionen Auvergne-Rhône-Alpes i sydöstra Frankrike. Kommunen ligger i kantonen Joyeuse som ligger i arrondissementet Largentière. År 2009 hade Joyeuse 1 640 invånare."},{"page_url":"https://hu.wikipedia.org/wiki/Megyercs","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Megyercs054.JPG","page_title":"Megyercs","context_page_description":"Megyercs község Szlovákiában, a Nyitrai kerületben, a Komáromi járásban. Területe 23,2 km²."},{"page_url":"https://sh.wikipedia.org/wiki/Zastava_Libije","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Flag_of_Libya_%281969%E2%80%931972%29.svg","page_title":"Zastava Libije","context_page_description":"Zastava Libije usvojena 19. studenog 1977. sastoji se od prostog zelenog polja bez ikakvih detalja na sebi. Jedina je takva zastava na svijetu."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%84%9B%E7%9F%A5%E7%9C%8C%E9%81%93489%E5%8F%B7%E6%9C%AC%E5%9C%B0%E9%B4%9B%E9%B4%A8%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Aichi_Pref_r-489_Honji.JPG","page_title":"愛知県道489号本地鴛鴨線","context_page_description":"愛知県道489号本地鴛鴨線は、愛知県豊田市本地町と愛知県豊田市鴛鴨町を結ぶ愛知県の一般県道である。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%86%E3%83%B3%E3%82%AC%E3%82%A4%E3%83%8F%E3%82%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Trachipterus_trachypterus_%28Ribbon_fish%29.gif","page_title":"テンガイハタ","context_page_description":"テンガイハタは条鰭綱アカマンボウ目フリソデウオ科の魚類の一種。"},{"page_url":"https://fr.wikipedia.org/wiki/Eifel","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Eifel_-_Deutsche_Mittelgebirge%2C_Serie_A-de.png","page_title":"Eifel","context_page_description":"L'Eifel [ɛfɛl] est une région de collines en Allemagne occidentale, au sud de Cologne, et au sud-est des cantons de l'est de la Belgique. Elle occupe le Sud-Ouest de la Rhénanie-du-Nord-Westphalie et le Nord-Ouest de la Rhénanie-Palatinat. Elle avoisine la Belgique et le Luxembourg.\\nElle a donné son nom à l'Eifélien."},{"page_url":"https://fy.wikipedia.org/wiki/Berchlemming","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Lemmus_lemmus_range_map.png","page_title":"Berchlemming","context_page_description":"De berchlemming is in sûchdier út it skift fan 'e kjifdieren, de famylje fan 'e wrotmûseftigen, de ûnderfamylje fan 'e wrotmûzen, de tûke fan 'e lemmings enit skaai fan 'e echte lemmings, dat inkeld foarkomt yn Skandinaavje en noardwestlik Ruslân. It is it iennichste wringedier út dy regio dat nearne oars op 'e wrâld foarkomt. De berchlemming is de bekendste lemmingsoarte, en syn dramatyske populaasjeskommelings en grutskalige migraasjes foarmje de basis foar de myte dat lemmings soms oan massale selsdeading dogge troch harsels yn grutte klibers fan 'e rotsen ôf yn see te smiten."},{"page_url":"https://fr.wikipedia.org/wiki/Lissounov_Li-2","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Lisunov_Li-2_Soviet_AF_Monino_1994.jpg","page_title":"Lissounov Li-2","context_page_description":"Lissounov Li-2 est le nom donné en URSS au bimoteur américain Douglas DC-3, produit sous licence. Appelé initialement PS-84, cet avion de transport a été renommé Lissounov Li-2 en 1942 pour honorer l'ingénieur qui fut chargé d'organiser sa production et de l'adapter aux besoins de l'URSS. À la fin de la Seconde Guerre mondiale, un certain nombre de ces appareils furent distribués aux pays alliés de l'URSS, et l'OTAN donnera le nom de code Cab aux Li-2 et DC-3 utilisés par ces pays."},{"page_url":"https://sv.wikipedia.org/wiki/Talteater","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Kungliga_Dramatiska_Teatern_-_Stockholm%2C_Sweden_-_DSC09683.JPG","page_title":"Talteater","context_page_description":"Talteater eller dramatisk teater är teater där monolog eller dialog är den huvudsakliga uttrycksformen, till skillnad från musikteater där musik är ett viktigt inslag.\\nSveriges nationalscen för talteater är Kungliga Dramatiska teatern."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BE%D0%B1%D0%BE%D1%80_%D1%81%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%BE_%D0%A1%D1%82%D0%B5%D1%84%D0%B0%D0%BD%D0%B0_(%D0%9C%D0%B5%D1%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Metz%2C_Cath%C3%A9drale_Saint-Etienne-PM_49673.jpg","page_title":"Собор святого Стефана (Мец)","context_page_description":"Собо́р свято́го Сте́фана або Ме́цький собо́р — готичний католицький собор у французькому місті Мец, департамент Мозель, регіон Лотарингія. Сформований у XIV столітті, коли до північного фасаду старої романської церкви був прибудований новий неф. Собор розташований у самому центрі міста, на площі Зброї і є основним об'єктом історичного центру міста.\\nУ XV столітті до собору були прибудовані поперечний неф і хори. Висота нефу становить 41,41 метри, що робить його третім за величиною у Франції.\\nСобор святого Стефана є кафедральний собором Мецької дієцезії Римо-Католицької церкви та резиденцією єпископа Меца.\\nСвою неофіційну назву — «Ліхтар Божий» — собор отримав через велику кількість вітражів, зокрема, тут знаходиться найбільший вітраж у світі, його площа становить 6,496 м². Над вітражами собору працювали митці різних часів і стилів: за доби Відродження — Ерманн фон Мюнстер, Теобальд з Ліксхейму, Валентін Буш, за доби романтизму — Шарль-Лорен Марешаль, а у XX столітті — ташист Роже Біссьєр, кубіст Жак Війон та модерніст Марк Шагал."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_K%C5%99esetic%C3%ADch","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Kostel_K%C5%99esetice_1.JPG","page_title":"Seznam kulturních památek v Křeseticích","context_page_description":"Tento seznam nemovitých kulturních památek v obci Křesetice v okrese Kutná Hora vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://hu.wikipedia.org/wiki/Gymnocalycium_mihanovichii","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Gymnocalycium_mihanovichii.jpg","page_title":"Gymnocalycium mihanovichii","context_page_description":"A Gymnocalycium mihanovichii a valódi kaktuszok Trichocereeae nemzetségcsoportjának Gymnocalycium nemzetségébe tartozó gömbkaktusz faj."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B2%D0%BE%D0%B5%D0%B2%D1%80%D0%B5%D0%BC%D0%B5%D0%BD%D0%BD%D0%B0_%D0%BF%D0%BE%D0%B4%D0%BC%D1%8F%D0%BD%D0%B0_%D0%BD%D0%B0_%D1%80%D0%B5%D1%81%D0%BF%D0%B8%D1%80%D0%B0%D1%82%D0%BE%D1%80%D0%BD%D0%B8%D1%82%D0%B5_%D1%84%D0%B8%D0%BB%D1%82%D1%80%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/%D0%98%D0%BD%D0%B4%D0%B8%D0%BA%D0%B0%D1%82%D0%BE%D1%80_%D0%B4%D0%BB%D1%8F_%D0%BE%D0%BF%D1%80%D0%B5%D0%B4%D0%B5%D0%BB%D0%B5%D0%BD%D0%B8%D1%8F_%D1%81%D1%80%D0%BE%D0%BA%D0%B0_%D1%81%D0%BB%D1%83%D0%B6%D0%B1%D1%8B_%D1%84%D0%B8%D0%BB%D1%8C%D1%82%D1%80%D0%B0_End_of_Service_Life_Indicator_ESLI_12.jpg","page_title":"Своевременна подмяна на респираторните филтри","context_page_description":"Своевременната подмяна на респираторните филтри е важен проблем, който възниква при работа в замърсена атмосфера, при което обикновено се използват нескъпи и удобни филтриращи респиратори. Те осигуряват на работещия подходящ за дишане въздух, пречистен с помощта на филтри. Срокът на експлоатация на тези филтри обаче е ограничен и филтрите трябва да бъдат заменени своевременно. За определяне на необходимостта от замяна могат да се използват различни методи."},{"page_url":"https://sr.wikipedia.org/wiki/Stepeni%C4%8Dasta_konformacija","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/Eclipsed_Conformation.svg","page_title":"Stepeničasta konformacija","context_page_description":"U organskoj hemiji stepeničasta konformacija je hemijska konformacija etanu-sličnih molekula abcX-Ydef u kojoj su supstituenti a, b i c na maksimalnoj udaljenosti od d, e i f. Neophodno je da su torzioni uglovi 60°.\\nTakva konformacija postoji za bilo koju jednostruku hemijski vezu otvorenog lanca koja povezuje dva sp³ hibridizovana atoma. Ona normalno ima minimalnu konformacionu energiju. Za neke molekule kao što je n-butan, postoje specijalne verzije stepeničastih konformacija koje se zovu gauč i anti."},{"page_url":"https://es.wikipedia.org/wiki/Jorge_Martinuzzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Martinuzzi_Gyorgy_olajfestmenye.JPG","page_title":"Jorge Martinuzzi","context_page_description":"Jorge Martinuzzi “El monje blanco”, fue un importante personaje político húngaro y croata, quincuagésimo tercer arzobispo de Estrigonia y cardenal."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BB%D1%8F%D0%BD%D0%BE_%D0%B4%D0%B8_%D0%A2%D0%B5%D0%BD%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Map_of_comune_of_Magliano_di_Tenna_%28province_of_Fermo%2C_region_Marche%2C_Italy%29.svg","page_title":"Маляно ди Тена","context_page_description":"Маля̀но ди Тѐна е село и община в Централна Италия, провинция Фермо, регион Марке. Разположено е на 293 m надморска височина. Населението на общината е 1455 души.\\nДо 2004 г. общината е част от провинция Асколи Пичено, когато участва в новата провинция Фермо."},{"page_url":"https://fr.wikipedia.org/wiki/H%C3%B4tel_Imp%C3%A9rial_(Nice)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/LyceeParc_Imperial-FromStadium.jpg","page_title":"Hôtel Impérial (Nice)","context_page_description":"L’hôtel Impérial de Nice est un palace de la Belle Époque, de 1902 à 1925, situé dans le quartier du Piol. Construit dans le « quartier russe » de Nice, il hébergeait la famille impériale de Russie en villégiature.\\nEn 1930, le bâtiment devient une annexe lycée Félix-Faure. En 1948, le lycée devient un établissement à part entière."},{"page_url":"https://it.wikipedia.org/wiki/Smerillo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Smerillo_Porta_Nord.jpg","page_title":"Smerillo","context_page_description":"Smerillo è un comune italiano di 335 abitanti della provincia di Fermo nelle Marche.\\nIl comune fa parte del circondario amministrativo montano di Amandola della provincia di Fermo, comprendente oltre al capoluogo circondariale, anche i comuni preappenninici di Montefalcone Appennino, Montefortino, Montelparo, Santa Vittoria in Matenano."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D1%83%D0%BA%D0%B0%D0%B2%D0%B8%D1%88%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2,_%D0%98%D0%B2%D0%B0%D0%BD_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Mansion_of_Rukavishnikov_on_Verkhnevolzhskaya_embankment.jpg","page_title":"Рукавишников, Иван Сергеевич","context_page_description":"Ива́н Серге́евич Рукави́шников — русский писатель, поэт-символист Серебряного века и прозаик, переводчик украинской поэзии. Прославился формальными «экспериментами» над стихотворной речью, известен как «мастер триолета». Издал 20 томов своих сочинений.\\nПерсонаж анекдотов в литературных мемуарах и пособиях по стиховедению.\\nВ Нижнем Новгороде организовал 2 музея."},{"page_url":"https://ceb.wikipedia.org/wiki/Loppington_(lungsod)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Loppington_Church_-_geograph.org.uk_-_226764.jpg","page_title":"Loppington (lungsod)","context_page_description":"Lungsod ang Loppington sa Hiniusang Gingharian. Nahimutang ni sa kondado sa Shropshire ug apil sa nasod sa Inglatera, sa habagatang bahin sa nasod, 230 km sa amihanan-kasadpan sa London ang ulohan sa nasod. 92 metros ibabaw sa dagat kahaboga ang nahimutangan sa Loppington, ug adunay 576 ka molupyo.\\nAng yuta palibot sa Loppington kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 124 ka metro ug 2.5 km sa kasadpan sa Loppington. Dunay mga 86 ka tawo kada kilometro kwadrado sa palibot sa Loppington medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Shrewsbury, 16.7 km sa habagatan sa Loppington. Hapit nalukop sa kaumahan ang palibot sa Loppington.\\nAng klima baybayon. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Hulyo, sa 16 °C, ug ang kinabugnawan Disyembre, sa -1 °C."},{"page_url":"https://fr.wikipedia.org/wiki/Citro%C3%ABn_C3_III","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Citro%C3%ABn_C3_-_2016_%2817%29.jpg","page_title":"Citroën C3 III","context_page_description":"La C3 est une citadine polyvalente du constructeur automobile français Citroën sortie en 2016. Il s'agit de la troisième génération de la Citroën C3 depuis 2002.\\nElle est dévoilée le 29 juin 2016, commercialisée à partir de septembre 2016 et présentée au grand public le 1ᵉʳ octobre suivant lors du Mondial de l'automobile de Paris 2016."},{"page_url":"https://nl.wikipedia.org/wiki/Fabas_(Ari%C3%A8ge)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Chateau_de_Poudelay_a_Fabas.jpg","page_title":"Fabas (Ariège)","context_page_description":"Fabas is een gemeente in het Franse departement Ariège en telt 306 inwoners. De plaats maakt deel uit van het arrondissement Saint-Girons."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B7%D0%B5%D0%BC%D0%BD%D0%BE%D0%B2%D0%BE%D0%B4%D0%BD%D1%8B%D1%85_%D0%9C%D0%B0%D0%B4%D0%B0%D0%B3%D0%B0%D1%81%D0%BA%D0%B0%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Boophis_occidentalis_01.jpg","page_title":"Список земноводных Мадагаскара","context_page_description":"Список земноводных Мадагаскара включает виды класса Земноводные, распространённые на территории Мадагаскара. Фауна амфибий острова включает 266 видов и многие из них являются редкими или исчезающими.\\nПредставлены 4 семейства класса Земноводных: Прыгуньи, Мантеллы, Узкороты или микроквакши и Настоя́щие лягу́шки. Почти все виды являются эндемиками, за исключением Ptychadena mascareniensis и Hoplobatrachus tigerinus."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BC%D0%B5%D0%BE%D0%BD_%D0%98%D0%B4%D0%B0%D0%BA%D0%B8%D0%B5%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/S-Idakiev_Hillary.jpg","page_title":"Симеон Идакиев","context_page_description":"Симеон Кирилов Идакиев е български филолог, журналист и пътешественик, леководолаз и ветроходец. Продуцент и водещ на популярното географско предаване „Атлас“ на Българската национална телевизия."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BB%D0%B0%D0%BD%D0%BA%D0%B0_%D0%9D%D0%B0%D0%BC%D1%8E%D1%80%D1%81%D0%BA%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Drottning_Blanka%2C_m%C3%A5lning_av_Albert_Edelfelt_fr%C3%A5n_1877.jpg","page_title":"Бланка Намюрская","context_page_description":"Бланка Намюрская — старшая дочь маркграфа Намюра Жана I из рода Дампьеров, в замужестве — королева Швеции и Норвегии.\\nОдна из самых известных средневековых шведских и норвежских королев. Вела активную политическую и общественную жизнь. В народной среде о ней были сложены многочисленные рассказы и песни."},{"page_url":"https://ceb.wikipedia.org/wiki/Hartv%C3%ADkovice","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Village_center_in_Hartv%C3%ADkovice%2C_T%C5%99eb%C3%AD%C4%8D_District.jpg","page_title":"Hartvíkovice","context_page_description":"Lungsod ang Hartvíkovice sa Nasod nga Czech. Nahimutang ni sa lalawigan sa Kraj Vysočina, sa habagatan-sidlakang bahin sa nasod, 160 km sa habagatan-sidlakan sa Prague ang ulohan sa nasod. 442 metros ibabaw sa dagat kahaboga ang nahimutangan sa Hartvíkovice, ug adunay 553 ka molupyo. Hartvíkovice nga nahimutang sa lanaw sa Údolní nádrž Dalešice.\\nAng yuta palibot sa Hartvíkovice kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 473 ka metro ug 1.0 km sa amihanan sa Hartvíkovice. Dunay mga 20 ka tawo kada kilometro kwadrado sa palibot sa Hartvíkovice may gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Třebíč, 15.9 km sa kasadpan sa Hartvíkovice. Hapit nalukop sa kaumahan ang palibot sa Hartvíkovice. Sa rehiyon palibot sa Hartvíkovice, mga bungtod talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 7 °C. Ang kinainitan nga bulan Hulyo, sa 20 °C, ug ang kinabugnawan Enero, sa -6 °C. Ang kasarangang pag-ulan 896 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 110 milimetro nga ulan, ug ang kinaugahan Marso, sa 33 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/Chiron","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Th%C3%A9tis_et_Achille_chez_Chiron_09764_Achille_et_les_filles_de_Lycom%C3%A8de.jpg","page_title":"Chiron","context_page_description":"In Greek mythology, Chiron was held to be the superlative centaur amongst his brethren since he was called the \\"wisest and justest of all the centaurs\\"."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_chefs_du_gouvernement_fran%C3%A7ais","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/De_Neufville2.jpg","page_title":"Liste des chefs du gouvernement français","context_page_description":"Cet article dresse la liste des chefs du gouvernement français depuis 1598.\\nLa France a connu 172 chefs de gouvernement de Charles-Maurice de Talleyrand-Périgord, président du Conseil des ministres en 1815, sous la Restauration, à Jean Castex, actuel Premier ministre."},{"page_url":"https://en.wikipedia.org/wiki/NEMA_connector","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/NEMA-1-15P-plugs-old-new-electric-toy.jpg","page_title":"NEMA connector","context_page_description":"NEMA connectors are power plugs and receptacles used for AC mains electricity in North America and other countries that use the standards set by the US National Electrical Manufacturers Association. NEMA wiring devices are made in current ratings from 15 to 60 amperes, with voltage ratings from 125 to 600 volts (V). Different combinations of contact blade widths, shapes, orientation, and dimensions create non-interchangeable connectors that are unique for each combination of voltage, electric current carrying capacity, and grounding system.\\nNEMA 1-15P and NEMA 5-15P plugs are used on commonplace domestic electrical equipment, and NEMA 5-15R is the standard 15 A electric receptacle found in the United States, and under relevant national standards, in Canada, Mexico and Japan.\\nOther plug and receptacle types are for special purposes or for heavy-duty applications.\\nThe dimensional standard for electrical connectors is ANSI/NEMA WD-6 and is available from the NEMA website."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%89%BE%E4%BC%A6%E6%AF%94%E5%B9%BF%E5%9C%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/Jerusalem_Allenby_Sqr.JPG","page_title":"艾伦比广场","context_page_description":"艾伦比广场是耶路撒冷两个不同的广场的名称，得名于第一次世界大战中指挥英军占领巴勒斯坦的埃德蒙·艾伦比元帅。"},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D8%B1%D8%A8%D9%87_%D9%86%D9%88%D8%B1%D9%88%D8%B2%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Forest_Tent_Moth.JPG","page_title":"گربه نوروزی","context_page_description":"گربه نوروزی گونه ای شاپرک از تیره شاپرک‌های پشمالو است."},{"page_url":"https://sv.wikipedia.org/wiki/Bupleurum_praealtum","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Neuch%C3%A2tel_Herbarium_-_Bupleurum_junceum_-_NEU000005843.jpg","page_title":"Bupleurum praealtum","context_page_description":"Bupleurum praealtum är en flockblommig växtart som beskrevs av Carl von Linné. Bupleurum praealtum ingår i släktet harörter, och familjen flockblommiga växter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://es.wikipedia.org/wiki/Toro_embolado","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/-Fortanete_-Maestrazgo_-Teruel_%2841498158720%29.jpg","page_title":"Toro embolado","context_page_description":"El toro embolado o toro de fuego es un festejo tradicional que se celebra en España y que se encuentra relacionado con la tauromaquia. En esta celebración, un toro de lidia corre por la trama urbana de una determinada localidad portando sobre sus astas o cuernos un herraje, sobre los cuales se colocan estopas engrasadas a las que se les prende fuego."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D9%87%D8%B3%D8%AA%D8%A7%D9%86_%DA%A9%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/K%C3%B5o_valla_lipp.jpg","page_title":"دهستان کو","context_page_description":"دهستان کو یک دهستان در استونی است که در شهرستان ویلیاندی واقع شده‌است."},{"page_url":"https://de.wikipedia.org/wiki/R%C3%B6merbrauerei_(Bergheim)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Ehemalige_R%C3%B6merbrauerei.jpg","page_title":"Römerbrauerei (Bergheim)","context_page_description":"Die Römerbrauerei war eine Brauerei in Kreisstadt Bergheim im Rhein-Erft-Kreis.\\nDie Brauerei wurde 1755 gegründet. Ab der Mitte des 19. Jahrhunderts betrieben die Gebrüder Roleff das Unternehmen. Von 1868 bis 1876 war dann Johann Roleff alleiniger Besitzer."},{"page_url":"https://pl.wikipedia.org/wiki/Ruch_Chorz%C3%B3w","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Ryszard_Trzcionka.JPG","page_title":"Ruch Chorzów","context_page_description":"Ruch Chorzów – polski klub sportowy założony 20 kwietnia 1920 r. w Bismarkhucie jako jednosekcyjny klub piłkarski, występujący obecnie w III lidze.\\n14-krotny mistrz Polski, 6-krotny wicemistrz Polski, 3-krotny zdobywca Pucharu Polski, ćwierćfinalista Ligi Mistrzów, ćwierćfinalista Ligi Europy oraz finalista Pucharu Intertoto UEFA. Do sezonu 1986/87 był jedynym klubem, jaki uczestniczył we wszystkich sezonach polskiej ekstraklasy. W tabeli wszech czasów tych rozgrywek prowadził do połowy lat 90., aktualnie plasuje się na 3. miejscu. W klasyfikacji medalowej Mistrzostw Polski w piłce nożnej zajmuje drugie miejsce.\\nRuch Chorzów jest pierwszym historycznym mistrzem Górnego Śląska w oficjalnych rozgrywkach PZPN. Jako pierwszy klub piłkarski reprezentował region górnośląski na szczeblu klubowych mistrzostw Polski. Jako pierwszy górnośląski klub zdobył też Mistrzostwo Polski oraz Puchar Polski. Ostatni śląski zdobywca Pucharu Polski.\\n27 grudnia 2004 założono Sportową Spółkę Akcyjną, która 27 stycznia 2005 przejęła klub. 4 grudnia 2008 Sportowa Spółka Akcyjna zadebiutowała na rynku NewConnect."},{"page_url":"https://la.wikipedia.org/wiki/Thomas_(comitatus_Georgiae)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/Map_of_Georgia_highlighting_Thomas_County.svg","page_title":"Thomas (comitatus Georgiae)","context_page_description":"Thomas est Georgiae comitatus in Civitatibus Foederatis Americae 42.737 incolarum. Comitatus, cuius caput est urbicula Thomasville, die 23 Decembris 1825 creatus est."},{"page_url":"https://nl.wikipedia.org/wiki/Terssac","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Terssac.JPG","page_title":"Terssac","context_page_description":"Terssac is een gemeente in het Franse departement Tarn en telt 911 inwoners. De plaats maakt deel uit van het arrondissement Albi."},{"page_url":"https://fr.wikipedia.org/wiki/Adrien_d%27%C3%89pinay","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Statue_d%27A_d%27%C3%89pinay.jpg","page_title":"Adrien d'Épinay","context_page_description":"Antoine Zacharie Adrien d'Épinay, né en 1794 à Port-Louis et décédé en 1839 à Paris, est un avocat et homme politique mauricien."},{"page_url":"https://da.wikipedia.org/wiki/Full_Moon_Party","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Full-Moon-Party-fire-skipping-rope_DSC03279w.jpg","page_title":"Full Moon Party","context_page_description":"Full Moon Party er en månedlig fest, der ved fuldmåne afholdes på Haad Rin-stranden på den sydthailandske ø Koh Phangan siden slutningen af 1970'erne, og som organiseret fest siden 1985. Festen er med årene blevet en fast institution og turistattraktion, hvori deltager omkring 10.000 gæster fra hele verden i lavsæsonen og op til 30.000 i højsæson.\\nTre gange er Full Moon Party blevet aflyst, første gang var festen den 17. oktober, 2016, grundet kong Bhumibol Adulyadejs død den 13. oktober og efterfølgende landesorg i 30 dage, indtil 14. november, hvor festen blev genoptaget. Det var første fuldmåne i november, der tillige er en af thai-årets største højtider, Loy krathong. Anden gang var festen planlagt til den 6. oktober, 2017, der blev aflyst grundet kong Bhumibols kremeringsceremoni. Tredje gang var i forbindelse med Coronavirusepidemien i 2020, hvor festen den 8. marts med kort varsel blev aflyst, for at begrænse smittespredning blandt større forsamlinger. Aflysning er gældende indtil videre."},{"page_url":"https://gl.wikipedia.org/wiki/Bohemia_Central","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Central_Bohemia_districts.png","page_title":"Bohemia Central","context_page_description":"Bohemia Central ou Středočeský kraj en checo é unha rexión da República Checa. A súa capital é a cidade de Praga, tamén capital do país e situada no centro da rexión."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wappen_mit_der_Jakobsmuschel","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Tucapy_TA_CZ_CoA.jpg","page_title":"Liste der Wappen mit der Jakobsmuschel","context_page_description":"Die Liste der Wappen mit der Jakobsmuschel enthält Kommunalwappen sowie weitere Wappen und Logos mit der Jakobsmuschel. Als Jakobs- oder Pilgermuscheln werden zwei nahe verwandte Arten von Muscheln bezeichnet, die beide zur Gattung Pecten gehören.\\nDer Name Jakobsmuschel geht auf den heiligen Jakobus, den Schutzpatron der Pilger, zurück, dessen Erkennungszeichen die Muschel ist. Daher ist die Jakobsmuschel auch als das Symbol der Pilger, insbesondere derer vom Jakobsweg, bekannt. Die christlichen Pilger des Mittelalters benutzten die Jakobsmuschel zum Wasserschöpfen. Ein unter Jakobspilgern verbreiteter Brauch war es, den Pilgergang 60 Kilometer weiter am Cap Finisterre zu beenden, um dort aus dem Meer eine echte Jakobsmuschel zu sammeln. Als Pilgerzeichen am Hutband des Hutes oder am Gürtel getragen, ist sie geschichtlich mit der Wallfahrt nach Santiago de Compostela verbunden, um damit an den Besuch des Grabs des heiligen Jakobus zu erinnern. Die Muschel war mehr als nur ein Souvenir. Nach der Rückkehr in die Heimat sicherte sie ihrem Träger Ansehen, und mancher ließ sich die Muschel ins Grab legen."},{"page_url":"https://sh.wikipedia.org/wiki/Post_u_islamu","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/%D9%87%D9%84%D8%A7%D9%84_%D8%B1%D9%85%D8%B6%D8%A7%D9%86.jpg","page_title":"Post u islamu","context_page_description":"Post u islamu predstavlja potpuno odricanje od hrane, pića, pušenja, spolnih i bilo kojih drugih tjelesnih zadovoljstava, ali i nedoličnog govora i ponašanja od zore do zalaska sunca, u ime Allaha. Post u toku devetog mjeseca islamskog kalendara, Ramadana ili Ramazana, koji traje 29 ili 30 dana, je obavezan za sve fizički i psihički zdrave i punoljetne muslimane i muslimanke. To je četvrti stup islama. Postoje dva obroka u Ramazanu, sehur i iftar. Post se započinje i prekida prigodnim molitvama, najčešće uz vodu i datulje, slijedeći praksu Poslanika Muhameda."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%AD%D9%85%D8%AF_%D8%B4%D8%A7%D9%81%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Sir-Mian-Muhammad-Shafi.jpg","page_title":"محمد شافى","context_page_description":"محمد شافى كان محامى من الراج البريطانى."},{"page_url":"https://simple.wikipedia.org/wiki/Nunningen","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/59/Nunningen_769.JPG","page_title":"Nunningen","context_page_description":"Nunningen is a municipality in the district of Thierstein in the canton of Solothurn in Switzerland."},{"page_url":"https://ga.wikipedia.org/wiki/Tommy_Bowe","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c4/Tommy_Bowe.jpg","page_title":"Tommy Bowe","context_page_description":"Rugadh Tommy Bowe ar an dhá lá is fiche de mhí Feabhra, 1984. Imríonn sé rugbaí ar feadh Uladh agus Éire. Tá sé méadar amháin agus nócha haon ceintiméadar. Tá sé ó Muineachán I Éire. Rinné Tommy Bowe an chéad caipín I 2004. Tá cuigeoir I a chlann. Hannah is ainm an a dheirféar agus David is ainm an a dhearthair. Is fisiteiripe í a mhaithair. Imríonn Hannah hacái le Eirinn. Bhí vótaíl Tommy Bowe an imreoir is fearr na sé náisiún I 2010. Scoráil Tommy Bowe timpeall fiche sé iarracht ar feadh Éire. Scoráil sé 510 pointí le hagaidh thír. D'imrionn sé timpeall 57 cliuche le hagaidh Éire. Bhí Tommy Bowe go maith Ag peil gaelach freisin. D'imir sé le hagaidh Múineachán i u16 I pail gaelach.\\nD'imir sé le hagaidh Queens University, agus Belfast Harlequins I rugbaí."},{"page_url":"https://de.wikipedia.org/wiki/Flughafen_Frankfurt_am_Main","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/2012-03-06_EDDF_Aushubarbeiten_Terminal_3.JPG","page_title":"Flughafen Frankfurt am Main","context_page_description":"Der Flughafen Frankfurt am Main ist der größte deutsche Verkehrsflughafen. Gemessen am Fluggastaufkommen war er 2017 nach London-Heathrow, Paris-Charles-de-Gaulle und Amsterdam Schiphol der viertgrößte europäische Flughafen und liegt im weltweiten Vergleich auf dem 14. Rang. Auch ist er eines der weltweit bedeutendsten Luftfahrtdrehkreuze.\\n2019 wurden in Frankfurt insgesamt 70,5 Millionen Passagiere gezählt. Mit über 2,0 Millionen Tonnen hat der Frankfurter Flughafen das größte Frachtaufkommen aller europäischen Flughäfen und das achthöchste weltweit. Der Flughafen ist die Heimatbasis der Fluggesellschaften Lufthansa, Condor Flugdienst, Sunexpress Deutschland sowie der Frachtfluggesellschaft Lufthansa Cargo.\\nBetreibergesellschaft ist die im MDAX notierte Fraport AG, welche mehrheitlich im Besitz des Landes Hessen und der Stadt Frankfurt am Main ist."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%90%D0%97-13","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/71731_3.jpg","page_title":"ГАЗ-13","context_page_description":"ГАЗ-13 «Чайка» — радянський репрезентативний легковий автомобіль великого класу, що випускався малою серією на Горьківському автомобільному заводі з 1959 по 1981 роки.\\nВсього було виготовлено приблизно 3179 автомобілів цієї моделі."},{"page_url":"https://es.wikipedia.org/wiki/Boeing_C-137_Stratoliner","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/DF-ST-82-06709.jpg","page_title":"Boeing C-137 Stratoliner","context_page_description":"El Boeing C-137 Stratoliner es un avión de transporte VIP derivado del avión de pasajeros Boeing 707 y es empleado por la Fuerza Aérea de los Estados Unidos, Fuerza Aérea Colombiana y la Fuerza Aérea Brasileña. Una versión del Stratoliner, el VC-137C, se empleó como Air Force One, el avión del Presidente de los Estados Unidos, entre 1967 y 2001.\\nOtros países también han comprado Boeing 707 nuevos y los han usado para el servicio militar, principalmente como aviones de transporte VIP y como aviones de reabastecimiento en vuelo, similares al C-137. Además, el 707 sirvió como base para numerosas versiones especializadas, como el E-3 Sentry AWACS.\\nLa denominación C-18 se refiere a las variantes basadas en la serie 707-320B/C."},{"page_url":"https://oc.wikipedia.org/wiki/Cons%C3%B2rci_Liure_de_Comunas_de_Caltanissetta","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Divisions_de_Sic%C3%ADlia_en_2016.png","page_title":"Consòrci Liure de Comunas de Caltanissetta","context_page_description":"Lo Consòrci Liure de Comunas de Caltanissetta es una division de primièr nivèl de la Region autonòma de Sicília establit per la lei regionala n°15 del 4 d'agost de 2015. Pren la seguida, dins lo meteis encastre territorial, de la Província de Caltanissetta.\\nPòrta lo còde 085 de l’ISTAT. Sa populacion es de 259 866 abitants.\\nEs devesit en 22 comunas."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F_%D0%BF%D0%BE%D1%87%D1%82%D1%8B_%D0%B8_%D0%BF%D0%BE%D1%87%D1%82%D0%BE%D0%B2%D1%8B%D1%85_%D0%BC%D0%B0%D1%80%D0%BE%D0%BA_%D0%90%D0%B7%D0%B5%D1%80%D0%B1%D0%B0%D0%B9%D0%B4%D0%B6%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Stamps_of_AzSSR1921Golod.jpg","page_title":"История почты и почтовых марок Азербайджана","context_page_description":"История почты и почтовых марок Азербайджана подразделяется на периоды, соответствующие почтовым системам государств, в составе которых находилась территория современного Азербайджана, самостоятельных государственных образований начала XX века и независимой Азербайджанской Республики.\\nИстория почты Азербайджана берёт начало в эпоху Сефевидов. Однако основное развитие почты пришлось на XIX—XX века, когда Азербайджан входил в состав Российской империи, а затем являлся одной из союзных республик Советского Союза. С распадом СССР в независимом Азербайджане наступил временный упадок развития почтовой связи. С 1992 года выходят собственные почтовые марки Азербайджанской Республики, а с 1993 года она является членом Всемирного почтового союза."},{"page_url":"https://fr.wikipedia.org/wiki/Fran%C3%A7ois-C%C3%A9sar_de_Moreton_de_Chabrillan","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Blason_fam_fr_Guigues_de_Moreton_de_Chabrillan.svg","page_title":"François-César de Moreton de Chabrillan","context_page_description":"François-César de Moreton, marquis de Chabrillan, est un général français né le 22 août 1701 à Montélimar, où il est mort le 27 septembre 1776.\\nColonel de cavalerie, il se distingue à la tête de son régiment à la bataille de Fontenoy où son action est célébrée par Voltaire, puis à la bataille de Rocourt. Il devient maréchal de camp en 1748."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%96%D7%99%D7%A8%D7%94_%D7%94%D7%99%D7%9E%D7%99%D7%AA_%D7%91%D7%9E%D7%9C%D7%97%D7%9E%D7%AA_%D7%94%D7%94%D7%AA%D7%A9%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/AvinoamBarHeyDaroma.jpg","page_title":"הזירה הימית במלחמת ההתשה","context_page_description":"מלחמת ההתשה בזירה הימית התאפיינה בלחימה מתמשכת בין ישראל למצרים, שכללה פעילות כלי שיט, חוליות קומנדו ימי ומטוסים. מוקד האירועים היה בגזרת תעלת סואץ ומפרץ סואץ עם זירות משנה לאורך מפרץ אילת, חופו הצפוני של חצי האי סיני, ונתיבי השיט והנמלים במערב אפריקה. זירות עימות נוספות התפתחו בין ישראל למחבלים הפלסטינים, לאורך החוף הלבנוני, נהר הירדן ובמצרי באב אל-מנדב.\\nהתקופה מאופיינת בצמיחה גדולה של חיל הים הישראלי בבניין כוח ספינות סער, הצוללות מסדרת T, סירות קומנדו ימי, ספינות סיור. חיל הים הישראלי שיפר את התארגנותו המבצעית והוקמו בסיסי שליטה חדשים בחופי סיני, הים התיכון וים המלח. הוקמו מתקני תחזוקה בחיפה אשדוד ואילת, בסיס ההדרכה הצטייד במתקני אימון ממוחשבים ומפקדת החיל הועברה לבסיס הקריה בתל אביב.\\nהפעילות העיקרית בזירה הימית הייתה הפקת נפט במערב חצי האי סיני ומפרץ סואץ והובלתו לאילת. מחצית מתצרוכת הנפט של ישראל סופקה בדרך זו."},{"page_url":"https://sh.wikipedia.org/wiki/Fenilacetilglutamin","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Phenylacetylglutamine.png","page_title":"Fenilacetilglutamin","context_page_description":"Fenilacetilglutamin je organsko jedinjenje, koje sadrži 13 atoma ugljenika i ima molekulsku masu od 264,277 Da."},{"page_url":"https://fr.wikipedia.org/wiki/Alfred_Neubauer","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Alfred_Neubauer_1958_April.jpg","page_title":"Alfred Neubauer","context_page_description":"Alfred Neubauer, né le 29 mars 1891 à Neutitschein en Silésie autrichienne, et mort le 22 août 1980 à Stuttgart en Allemagne, est une personnalité du sport automobile. Il est surtout connu pour avoir dirigé l'équipe de course de Mercedes-Benz de 1926 à 1955."},{"page_url":"https://ja.wikipedia.org/wiki/Toshiba_(%E3%82%B5%E3%83%AB%E3%83%9F%E3%82%A8%E3%83%B3%E3%83%88%E7%B7%9A%E3%83%BB%E3%83%9F%E3%83%88%E3%83%AC%E7%B7%9A%E7%94%A8%E9%9B%BB%E8%BB%8A)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Estaci%C3%B3n_Villa_Luro_FCO.png","page_title":"Toshiba (サルミエント線・ミトレ線用電車)","context_page_description":"Toshibaは、アルゼンチン・ブエノスアイレスの近郊鉄道路線であるサルミエント線とミトレ線の電化区間用に1956年以降導入された、川崎車両、日本車輌製造、近畿車輛、東急車輛製造、および東芝製の電車の通称。1956年7月から営業運転を開始し、第二次世界大戦後、完全に独立した日本が最初に国外へ輸出した日本企業製の電車として歴史に刻まれた。ここでは、これらの車両の部品を流用し、アルゼンチン国内にて改造・製作された二階建ての電車および客車についても記述する。"},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E8%A5%BF%E5%B6%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Niuxinshan.JPG","page_title":"西嶼","context_page_description":"西嶼，又叫漁翁島，係澎湖列島第二大島，面積 18.2028 km²。全島都屬於中華民國澎湖縣西嶼鄉嘅範圍。"},{"page_url":"https://sk.wikipedia.org/wiki/Heinrich_von_Kleist","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Kleist%2C_Heinrich_von.jpg","page_title":"Heinrich von Kleist","context_page_description":"Bernd Heinrich Wilhelm von Kleist bol nemecký dramatik, lyrický básnik a publicista."},{"page_url":"https://en.wikipedia.org/wiki/Awards_and_decorations_of_the_State_Defense_Forces","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/In_NG_Homeland_Defense.JPG","page_title":"Awards and decorations of the State Defense Forces","context_page_description":"Awards and decorations of the state defense forces are presented to members of the state defense forces in addition to regular United States military decorations and state National Guard military decorations. Each of the state governments of the United States maintains a series of decorations for issuance to members of the state defense forces, with such awards presented under the authority of the various state adjutants general and/or respective state defense force commanders.\\nIn most states, state defense force members may wear any regular United States military decorations and United States National Guard decorations that they may have earned while members of the National Guard and/or while in federal active duty service. The members of some state defense force may also be awarded state National Guard military decorations in addition to state defense force awards while serving in a state defense force capacity. The order of precedence for the wear of the awards are: federal, state National Guard, then state defense force."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A6%E3%83%84%E3%82%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Deutzia_crenata_for._plena%27s_flowerage_02.JPG","page_title":"ウツギ","context_page_description":"ウツギはアジサイ科ウツギ属の落葉低木。ユキノシタ科で分類される場合もある。"},{"page_url":"https://sv.wikipedia.org/wiki/S%C3%A4terbo_kyrka","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/S%C3%A4terbo_kyrka_fr%C3%A5n_v%C3%A4ster.jpg","page_title":"Säterbo kyrka","context_page_description":"Säterbo kyrka är en kyrkobyggnad i Säterbo i Västerås stift. Den är församlingskyrka i Arbogabygdens församling. Kyrkan med omgivande kyrkogård är belägen på norra utlöparen av den långsträckta höjden Käglan, i övergången mellan slättbygd och skogsbygd."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D0%B5%D0%B4%D0%B2%D0%B5%D0%B4%D0%BD%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Medvednik_-_Zapadna_Srbija_-_isto%C4%8Dni_obronci_Medvednika_-_mesto_Kozila_-_Medvedni%C4%8Dko_platno_3.jpg","page_title":"Медведник","context_page_description":"Планина Медведник се налази недалеко од града Ваљева и са 1247 метара надморске висине налази се у средишту планинског венца који од Дрине на западу преко Гучева, Борање, Јагодње и Соколске планине наставља венцем Ваљевских планина које на западу почињу са Медведником, Јаблаником, Повленом, Маљеном, а завршавају Сувобором и Рајцем на истоку."},{"page_url":"https://cs.wikipedia.org/wiki/Nau%C4%8Dn%C3%A1_stezka_Okol%C3%ADm_Studence","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Tablo_Pust%C3%BD_z%C3%A1mek.JPG","page_title":"Naučná stezka Okolím Studence","context_page_description":"Naučná stezka Okolím Studence je pojmenování naučné stezky v západní části Lužických hor, která zde byla vytyčena Správou CHKO Lužické hory v roce 2002. Je vedena v okrese Děčín, jen velmi malá část zasahuje do okresu Česká Lípa. Své jméno získala podle kopce Studenec v Klíčské hornatině."},{"page_url":"https://nl.wikipedia.org/wiki/Betzigau","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Betzigau.JPG","page_title":"Betzigau","context_page_description":"Betzigau is een gemeente in de Duitse deelstaat Beieren, gelegen in het Landkreis Oberallgäu. De plaats telt 2.758 inwoners."},{"page_url":"https://fr.wikipedia.org/wiki/Complexe_(chimie)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/IRMOF-1_wiki.png","page_title":"Complexe (chimie)","context_page_description":"En chimie, plus particulièrement en chimie inorganique, un complexe est un édifice polyatomique constitué d'une ou de plusieurs entités indépendantes, en interaction. L'étude des complexes trouve plusieurs applications en catalyse, en chimie organométallique et en chimie bioinorganique. Un complexe est souvent constitué d'un cation métallique entouré de plusieurs ligands anioniques ou neutres qui délocalisent une partie de leur densité électronique. Ces complexes sont nommés « composés de coordination » et la chimie de coordination est la science qui les étudie.\\nVoir également l'article sur les complexes en biologie."},{"page_url":"https://zh.wikipedia.org/zh-my/C-47%E9%81%8B%E8%BC%B8%E6%A9%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/101st_Airborne_on_D-Day_-1.jpg","page_title":"C-47運輸機","context_page_description":"道格拉斯C-47空中火车是由DC-3民用客机衍生而成的军用运输机，为二战盟军广泛采用的机种之一，并一直采用至1950年代，时至今日仍然服役于少数国家。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BB%A3%E8%A5%BF%E7%AD%89%E8%99%95%E6%89%BF%E5%AE%A3%E5%B8%83%E6%94%BF%E4%BD%BF%E5%8F%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Li_River_8_hills_in_mist_near_Guilin.jpg","page_title":"廣西等處承宣布政使司","context_page_description":"广西等处承宣布政使司，简称广西布政司，通称广西省，是明朝、清朝在广西一带设置的一级民政区。布政使司衙门驻桂林府。"},{"page_url":"https://fr.wikipedia.org/wiki/Surg%C3%A8res","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Laiterie_industrielle_de_Surg%C3%A8res.JPG","page_title":"Surgères","context_page_description":"Surgères est une commune du Sud-Ouest de la France, située dans le département de la Charente-Maritime, en région Nouvelle-Aquitaine. Ses habitants sont appelés les Surgériens.\\nSituée à l'est de la plaine de l'Aunis et baignée par les eaux de la Gères, Surgères est une cité de 6 807 habitants en 2017, que favorise grandement son rôle de carrefour géographique et de voies de communication.\\nCe chef-lieu de canton fait office de centre de « commandement local » en Pays d'Aunis que favorise sa position géographique, Surgères étant le siège d'une communauté de communes : les douze initialement regroupées sous la dénomination communauté de communes de Surgères sont devenues le 1ᵉʳ janvier 2014, à la faveur d'un nouveau regroupement, la communauté de communes Aunis sud désormais forte de 27 communes. Elle figure sans conteste comme l'une des villes les plus influentes du Pays d'Aunis, notamment en matière de poids démographique et économique.\\nConsidérée comme la « capitale laitière » du Centre-Ouest de la France, Surgères est demeurée un centre agroalimentaire actif dominé par les importantes écoles nationales d'industrie laitière et de meunerie."},{"page_url":"https://es.wikipedia.org/wiki/Tele2_Arena","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Tele2_Arena_juni_2013a_01.jpg","page_title":"Tele2 Arena","context_page_description":"El Tele2 Arena es un estadio multiusos con techo retráctil ubicado en la ciudad de Estocolmo, Suecia. Es utilizado preferentemente para la práctica del fútbol y eventos artísticos y tiene una capacidad de 33 000 espectadores para partidos de fútbol. Sirve como sede para los clubes Djurgårdens IF y Hammarby IF, que actualmente juegan en la primera división sueca Allsvenskan."},{"page_url":"https://en.wikipedia.org/wiki/Queenstown,_New_Zealand","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Remarkables.jpg","page_title":"Queenstown, New Zealand","context_page_description":"Queenstown is a resort town in Otago in the south-west of New Zealand's South Island. It has an urban population of 15,650, making it the 27th-largest urban area in New Zealand. In 2016, Queenstown overtook Oamaru to become the second-largest urban area in Otago, behind Dunedin.\\nThe town is built around an inlet called Queenstown Bay on Lake Wakatipu, a long, thin, Z-shaped lake formed by glacial processes, and has views of nearby mountains such as The Remarkables, Cecil Peak, Walter Peak and just above the town, Ben Lomond and Queenstown Hill.\\nThe Queenstown-Lakes District has a land area of 8,704.97 square kilometres not counting its inland lakes. The region has an estimated resident population of 41,700. Neighbouring towns include Arrowtown, Glenorchy, Kingston, Wanaka, Alexandra, and Cromwell. The nearest cities are Dunedin and Invercargill. Queenstown is known for its commerce-oriented tourism, especially adventure and ski tourism."},{"page_url":"https://eo.wikipedia.org/wiki/Kin%C5%9Daso","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Kinshasa_2001.jpg","page_title":"Kinŝaso","context_page_description":"Kinŝaso estas la ĉefurbo kaj plej granda urbo de la Demokratia Respubliko Kongo kaj havenurbo. Iam nur loko de vilaĝoj de fiŝkaptistoj, Kinŝaso estas nune urba areo kun loĝantaro de ĉirkaŭ 13 milionoj da personoj. Ĝi havas la rangon de provinco. Ĉar la administraj limoj de la urbo-provinco kovras ampleksan areon, ĉirkaŭ 90% de la urbo-provinca tero estas rura laŭnature, kaj la urba areo okupas nur malgrandan sekcion en plej okcidenta pinto de la urbo-provinco. Loĝanto de Kinŝaso estas nomata Kinois [kinuA].\\nĜi havis 9 milionojn da loĝantoj, la aglomeraĵo 9,3 milionojn, kaj tial ĝi estas la tria plej granda metropola regiono en Afriko post Kairo kaj Lagoso. Ĝi estas ankaŭ la dua plej granda urba areo de \\"Franclingvio\\" en la mondo post Parizo; la franca estas la lingvo de regado, lernejoj, gazetaro, publikaj servoj kaj alta komerco en la urbo, dum lingala estas uzata kiel lingvafrankao surstrate. Se pluas la demografiaj tendencoj, Kinŝaso preterpasos Parizon laŭ loĝantaro ĉirkaŭ 2020. Kinshasa gastigis la 14an Pintokunvenon de la Internacia Organizo de la Franclingvio en oktobro 2012."},{"page_url":"https://fr.wikipedia.org/wiki/Le_Monast%C3%A8re_de_Sandomierz","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Klostret_i_Sendomir_%281920%29_1.jpg","page_title":"Le Monastère de Sandomierz","context_page_description":"Le Monastère de Sandomierz est un film suédois muet réalisé par Victor Sjöström, sorti en 1920. Ce film est l'adaptation au cinéma d'une nouvelle de Franz Grillparzer intitulée Das Kloster bei Sendomir."},{"page_url":"https://ro.wikipedia.org/wiki/Boris_Karloff","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Boris_Karloff.jpg","page_title":"Boris Karloff","context_page_description":"William Henry Pratt, mai bine cunoscut sub numele de scenă Boris Karloff, a fost un actor englez.\\nKarloff este cel mai notabil pentru rolurile sale din mai multe filme de groază și pentru interpretarea rolului monstrului lui Frankenstein în Frankenstein, Bride of Frankenstein și Son of Frankenstein, filme care au dus la o imensă popularitate a actorului. Cel mai cunoscut rol non-horror al său este Grinch din episodul special animat de televiziune „Dr. Seuss's Cum a furat Grinch Crăciunul”. De asemenea are un rol memorabil în filmul original Scarface."},{"page_url":"https://fr.wikipedia.org/wiki/Morangis_(Essonne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Morangis_Chateau_St-Michel.JPG","page_title":"Morangis (Essonne)","context_page_description":"Morangis est une commune française située à dix-huit kilomètres au sud de Paris dans le département de l’Essonne en région Île-de-France.\\nAuparavant appelé Louans, le lieu fut longtemps partagé entre nobles parisiens et congrégations religieuses et occupé par les vignerons et les maraîchers. Desservie à la fin du XIXᵉ siècle par un tramway, l’Arpajonnais, le territoire fut loti dès l’entre-deux-guerres avant que ne fut développée une importante zone d'activité à la faveur de l’ouverture de l’autoroute A6. Avec une population multipliée par deux en quarante années, c’est au début du XXIᵉ siècle une commune à la fois résidentielle et industrielle participant à la vitalité économique du nord-ouest essonnien.\\nSes habitants sont appelés les Morangissois."},{"page_url":"https://en.wikipedia.org/wiki/Los_trabajos_de_Persiles_y_Sigismunda","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Los_trabajos_de_Persiles_y_Sigismunda_%281617%29.png","page_title":"Los trabajos de Persiles y Sigismunda","context_page_description":"Los trabajos de Persiles y Sigismunda is a romance or Byzantine novel by Miguel de Cervantes Saavedra, his last work and one that stands in opposition to the more famous novel Don Quixote by its embrace of the fantastic rather than the commonplace. While Cervantes is known primarily for Don Quixote, widely regarded as one of the foremost classic novels of all time, he himself believed the Persiles, as it is commonly called, to be his crowning achievement. He completed it only three days before his death, and it was posthumously published in 1617.\\nThe generally accepted idea about the novel's orthodoxy as a Byzantine, neo-classical and Catholic epic romance has been challenged in two books by Michael Nerlich and Michael Armstrong-Roche. More recently, in a volume of studies celebrating the 400th anniversary of the novel's publication, the editor Mercedes Alcalá Galán points out that new interpretations of the Persiles have led to an expansion of its meaning, and that her volume emphasises the novel's poetic legacy, its inventiveness, and above all the appeal of the writer's creative passion, \\"el contagio de la pasión literaria con la que fue escrita.\\""},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Augsburg-Georgs-_und_Kreuzviertel","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Alte_Gasse_20_Augsburg_%281%29.JPG","page_title":"Liste der Baudenkmäler in Augsburg-Georgs- und Kreuzviertel","context_page_description":"In der Liste der Baudenkmäler im Georgs- und Kreuzviertel sind die Baudenkmäler im Augsburger Stadtbezirk Georgs- und Kreuzviertel im\\nPlanungsraum Innenstadt\\n(I)\\naufgelistet. Zu diesen Baudenkmälern gibt es auch eine Bildersammlung.\\nDiese Liste ist eine Teilliste der Liste der Baudenkmäler in Augsburg. Grundlage der Liste ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt und aktualisiert wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://en.wikipedia.org/wiki/George_Head_Head","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Rickerby_Folly.jpg","page_title":"George Head Head","context_page_description":"George Head Head was a mayor, magistrate, banker and mine owner in Carlisle. The bank was started by his father, but was improved and rebuilt in his lifetime. He attended an important convention in 1840 on Anti-Slavery, where a painting records his involvement."},{"page_url":"https://en.wikipedia.org/wiki/Qingbai_ware","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Yuan_porcelain_buddha.JPG","page_title":"Qingbai ware","context_page_description":"Qingbai ware is a type of Chinese porcelain produced under the Song Dynasty and Yuan dynasty, defined by the ceramic glaze used. Qingbai ware is white with a blue-greenish tint, and is also referred to as Yingqing. It was made in Jiangxi province in south-eastern China, in several locations including Jingdezhen, and is arguably the first type of porcelain to be produced on a very large scale. However, it was not at the time a prestigious ware, and was mostly used for burial wares and exports, or a middle-rank Chinese market. The quality is very variable, reflecting these different markets; the best pieces can be very thin-walled.\\nQingbai ware was made with a white porcelain body, fired with a glaze that produced a slight blue-green tint. The kilns used pine wood as fuel, producing a reducing atmosphere that produced the tint. Qingbai ware was used by commoners, and never seems to have been made for imperial use; its quality only came to be appreciated by collectors several centuries later. In the 14th century the same manufacturers turned to the new blue and white porcelain, using the same body, which saw the end of Qingbai ware."},{"page_url":"https://az.wikipedia.org/wiki/B%C3%B6y%C3%BCk_Mo%C4%9Fol_%C4%B0mperiyas%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Badshahi_Mosque_July_1_2005_pic32_by_Ali_Imran_%281%29.jpg","page_title":"Böyük Moğol İmperiyası","context_page_description":"Böyük Moğol İmperiyası və ya Babur İmperiyası — 1526–1857-ci illər arasında mövcud olmuş və əsası Teymurilər sülaləsindən olan Babur tərəfindən qoyulmuş türk dövləti.\\nXVI əsrin əvvəlində Şimali Hindistan Böyük Moğol İmperiyasının təsiri altına düşdü. Moğollar yerli idarə üsulunu tamamilə aradan qaldırmadı və bunun əvəzinə daha balanslaşdırılmış, mərkəzləşdirilmiş və vahid sistemə malik bir idarə üsulu bərqərar etdilər. Xüsusilə Böyük Əkbərin hakimiyyəti illərində özlərinin tarixi qəbilə əlaqələrini qoruyub saxlamaqla onlara tabe olan ərazilər çərçivəsində fars mədəniyyətini öz mədəniyyələri ilə birləşdirdilər. Moğolların iqtisadi siyasəti kənd təsərrüfatından gələn gəlirə əsaslanırdı. Vergilər əsasən möhkəm nizamlanmış gümüş valyuta ilə ödənilirdi, bu isə əkinçilərin və sənətkarların böyük əmək bazarına daxil olmasına kömək edirdi. İqtisadiyyatda nisbi sabitlik XVII əsr ərzində imperiya tərəfindən qorunub saxlanıla bildi. Marata, Racput və Sikh kimi şimali və qərbi Hindistanda məskunlaşan sosial-ictimai qruplar hərbi və idarəedici sahələrdə maraqlı idilər və bu onlara sonradan hərbi təcrübə qazandırdı."},{"page_url":"https://it.wikipedia.org/wiki/Saint-Cirgues-en-Montagne","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/St_Cirgues_la_Montagne_-_place.JPG","page_title":"Saint-Cirgues-en-Montagne","context_page_description":"Saint-Cirgues-en-Montagne è un comune francese di 259 abitanti situato nel dipartimento dell'Ardèche della regione dell'Alvernia-Rodano-Alpi."},{"page_url":"https://en.wikipedia.org/wiki/Badan_Informasi_Geospasial","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Badan_Informasi_Geospasial_logo.png","page_title":"Badan Informasi Geospasial","context_page_description":"Geospatial Information Agency is the National Mapping Agency of Indonesia. BIG formerly named National Coordinator for Survey and Mapping Agency. This national agency is responsible for Indonesian geospatial information as one map policy implementation.\\nIn 2010, Susilo Bambang Yudhoyono stated that Indonesia should has single referenced map, so there wouldn't be any different spatial data for country development.\\nGeospatial Information Agency is mandated by the Presidential Regulation No. 9 Year 2016 pertaining to the Implementation of One Map Policy to play a key role in achieving the goal of having one standardized map by the end of 2019. Specifically, Geospatial Information Agency is tasked to chair the One Map Policy Implementation Team as stipulated in Chapter 6, Article 3 of the regulation. Furthermore, this agency is also responsible to assist the Acceleration Team chaired by Indonesia's Coordinating Ministry of Economic Affairs to resolve land and map conflicts as the result of One Map Policy implementation."},{"page_url":"https://et.wikipedia.org/wiki/Kuldamine","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Goldleaf.jpg","page_title":"Kuldamine","context_page_description":"Kuldamine on mittemetallist või kullast odavamast metallist pinna katmine kullaga. Kuldamistehnikad jaotatakse mehaanilisteks ja keemilisteks. Lisaks kaunimale, luksuslikumale ja prestiižsemale välimusele annab kuldamine metallipinnale ka kaitse korrosiooni eest."},{"page_url":"https://en.wikipedia.org/wiki/Outline_of_golf","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/The_MacDonald_boys_playing_golf.jpg","page_title":"Outline of golf","context_page_description":"The following outline is provided as an overview of and topical guide to golf:\\nGolf – precision club and ball sport, in which competing players use many types of clubs to hit balls into a series of holes on a golf course using the fewest strokes."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%A1%D0%BA%D1%83%D0%BC%D0%B8%D0%BD_%D1%81%D0%B8%D0%BD%D0%B4%D1%80%D0%BE%D0%BC%D1%8B","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/85/Shiley-valve.png","page_title":"Скумин синдромы","context_page_description":"Скумин синдромы — йөрәкләренең клапан аппаратына протез куйганнан соң авыруларның дүрттән бер өлешендә күзәтелә торган психик эшчәнлек бозылуның үзенчәлекле симптомнар комплексы.\\nУл имплантатларның ышанычлылыгына шикләнү, һичбер сәбәпсез алар ватылыр дип курку, физик һәм психоэмоциональ йөкләмәләргә, йокының специфик бозылуына һәрвакыт тискәре мөнәсәбәт, шомлану, таркаулык, кәефнең төшенке булуы белән характерлана.\\n1978 елда танылган галим Виктор Скумин бу симптомнар комплексын кардиопротез психопатологик синдром атамасы белән тасвирлый.\\nНиколай Амосов Институтында үзе үткәргән тикшеренүләр нигезендә, Виктор Скумин беренчеләрдән булып, әлеге авыруның этиологиясен, патогенезын, клиник картинасын өйрәнә, аңа диагностика ясау, дәвалау, профилактикалау методларын, нәтиҗәле реабилитация чаралары системасын, халыкның бу контингентына сәламәтлек культурасы нигезләрен төшендерү программасын эшләтә."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%90%BD%E5%90%88%E9%87%8C%E6%B3%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Ochiai_satomi.jpg","page_title":"落合里泉","context_page_description":"落合 里泉は、日本の女子バスケットボール選手である。ポジションはセンターガード。シャンソンVマジック所属。165cm、57kg。"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%89%A9%E6%B5%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Allentown_Project_042.jpg","page_title":"物流","context_page_description":"物流中文源自于日文，指货运、货物流通、传输送货，是军事领域后勤概念的民间用语。在西方该词语源于希腊语：λογιστικός, Logistikos，意为“计数科学”或“精于算计”。“物流”是一套通过计算、策划来控制原材料、制成品、产成品或信息在供、需、仓储不同部之间转运的管理系统。“物流”或也可详称为其最终目的之“策略性物流运输”或“策运”。物质资料从供给者到需求者的物理运动，是创造时间价值、场所价值和一定的加工价值的活动。物流是指物质体从供应者向需求者的物理移动，它由一系列创造时间价值和空间价值的经济活动组成，包括运输、保管、配送、包装、装卸、流通加工及处理等多项基本活动，是这些活动的统一。\\n相关概念最早出现于军事行政组织，在中国古代一直被称为辎重，后来在近代被逐渐改为后勤。\\n现代的“物流”概念最早可能是以在二战中，围绕战争物资供应，美军建立的后勤理论为原型的。当时的“后勤”是指将战时物资生产、采购、运输、配给等活动作为一个整体进行统一布置，以求战略物资补给的费用更低、速度更快、服务更好。后来，将“后勤”体系移植到现代经济生活中，才逐步演变为今天的物流。物流系统也可像互联网般，促进全球化。在贸易上，若要更进一步与世界连系，就得靠良好的物流管理系统。\\n市场上的商品很多是“游历”各国后才来到的。原料可能来自马来西亚和泰国，加工可能在新加坡，生产却在中国，最后才入口到美国。产品的“游历”路线就是由物流师计划、组织、指挥、协调、控制和监督，使各项物流活动实现最佳的协调与配合，以实现产品物流的目标，目标可能是：降低物流成本，提高物流效率及质量，或提高物流的供应满足性。目标可能会有取舍和侧重。"},{"page_url":"https://af.wikipedia.org/wiki/Lee_Daniels","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Lee_Daniels_Deauville_2013.jpg","page_title":"Lee Daniels","context_page_description":"Lee Daniels is 'n Amerikaanse akteur, skrywer, vervaardiger, en regisseur. Hy is bekend vir sy rolle in die rolprente The Woodsman, Precious, The Paperboy, en Lee Daniels' The Butler."},{"page_url":"https://fr.wikipedia.org/wiki/Maison_au_16,_rue_Jenner_%C3%A0_Molsheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Molsheim_rJenner_16-18f.JPG","page_title":"Maison au 16, rue Jenner à Molsheim","context_page_description":"La maison au 16, rue Jenner est un monument historique situé à Molsheim, dans le département français du Bas-Rhin."},{"page_url":"https://nl.wikipedia.org/wiki/Bi%C3%A8vres_(Essonne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Map_commune_FR_insee_code_91064.png","page_title":"Bièvres (Essonne)","context_page_description":"Bièvres is een gemeente in het Franse departement Essonne en telt 4034 inwoners. De plaats maakt deel uit van het arrondissement Palaiseau."},{"page_url":"https://sv.wikipedia.org/wiki/Alex_G","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Alex_G.jpg","page_title":"Alex G","context_page_description":"Alexander Giannascoli, född 3 februari 1993, mest känd under sitt artistnamn Alex G eller tidigare Alex G, är en amerikansk artist från Philadelphia. Han inledde sin karriär som DIY-artist med utgivningar på Bandcamp och började få uppmärksamhet med sin första studioskiva DSU som utgavs på Orchid Tapes som fick ett varmt mottagande från kritikerkåren. Han utgav sedan studioalbumen Rules och Trick på skivbolaget Lucky Number. 2015 släppte han sin första skiva på Domino Records, Beach Music, vilken följdes av Rocket 2017. 2019 släpptes hans åttonde studioalbum House of Sugar."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BD%E3%83%AB%E3%83%87%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/SordesDB.jpg","page_title":"ソルデス","context_page_description":"ソルデス はジュラ紀後期に生息していた嘴口竜亜目の翼竜。発見された化石にはっきりとした体毛の痕跡が残っていたことが大きな注目を集めた。現在のところ模式種であるS. pilosus のみが確認されている。\\n属名Sordes はラテン語で「不浄・汚物」を意味し、種小名pilosus は同じくラテン語で「毛むくじゃらの」という意味である。"},{"page_url":"https://en.wikipedia.org/wiki/Javi_Mart%C3%ADnez","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Javi_Mart%C3%ADnez_Euro_2012_trophy.jpg","page_title":"Javi Martínez","context_page_description":"Javier \\"Javi\\" Martínez Aginaga is a Spanish footballer who plays for German club Bayern Munich as a defensive midfielder or a central defender.\\nHe arrived at Athletic Bilbao in 2006, before his 18th birthday, quickly imposing himself as a starter and going on to appear in 251 official games over the course of six La Liga seasons, scoring 26 goals. In 2012, he signed with Bayern Munich for €40 million, going on to win eight consecutive Bundesliga titles as well as the UEFA Champions League in 2013 and 2020.\\nA Spain international since 2010, Martínez was a member of the squads that won the 2010 FIFA World Cup and UEFA Euro 2012, and also played at the 2014 FIFA World Cup."},{"page_url":"https://sk.wikipedia.org/wiki/Via_Dolorosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Viadolorosa08.jpg","page_title":"Via Dolorosa","context_page_description":"Via Dolorosa je ulica v Starom Meste v Jeruzaleme.\\nPodľa tradície tadiaľto niesol Ježiš Kristus svoj kríž po ceste k ukrižovaniu. Je tak predobrazom krížových ciest. Jej trasa sa ustálila v 18. storočí. Má deväť zastavení a ďalších päť je vo vnútri baziliky Svätého hrobu.\\nVia Dolorosa je pozostatkom jednej z dvoch východozápadných ciest cez Aeliu Capitolinu postavenú rímskym cisárom Hadriánom."},{"page_url":"https://ast.wikipedia.org/wiki/Palaciu_de_Topkapi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Istanbul_asv2020-02_img23_Topkap%C4%B1_Palace.jpg","page_title":"Palaciu de Topkapi","context_page_description":"El Palaciu de Topkapi, asitiáu n'Istambul, foi'l centru alministrativu del Imperiu otomanu dende 1465 hasta 1853. La construcción del palaciu foi ordenada pol sultán Mehmed II en 1459 y foi completada en 1465. El palaciu ta asitiáu sobre'l Sarayburnu, ente'l Cuernu d'Oru y el Mar de Mármara, dende él tiense una arrogante vista del Bósforu. Ta formáu por munchos pequeñu edificios construyíos xuntos y arrodiaos por cuatro patios.\\nEl palaciu ta construyíu siguiendo les normes de l'arquiteutura seglar turca, siendo'l so máximu exemplu. Ye un treme complexu d'edificios, xuníos por patios o xardinos siendo la superficie total del complexu de 700.000 m², arrodiaos por una muralla bizantina.\\nEn 1853, el sultán Abdulmecid decidió treslladar la so residencia al recién construyíu y modernu Palaciu de Dolmabahçe. Na actualidá, el Topkapi ye un muséu de la dómina imperial, siendo una de les mayores atraiciones turístiques d'Istambul."},{"page_url":"https://cy.wikipedia.org/wiki/Prif_Weinidog_Cymru","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/AlunMichael_crop.jpg","page_title":"Prif Weinidog Cymru","context_page_description":"Arweinydd Llywodraeth Cymru yw Prif Weinidog Cymru. Pan ffurfiwyd gan Ddeddf Llywodraeth Cymru 1998 Prif Ysgrifennydd Cymru oedd teitl y swydd, gan fod Cymru gyda chynulliad llai yn nhermau grymoedd na Gogledd Iwerddon a'r Alban. Hefyd, mae'r term Cymraeg Prif Weinidog yn gallu cyfieithu i'r Saesneg fel Prime Minister, gall wedi achosi camddealltwriaeth â Phrif Weinidog y Deyrnas Unedig.\\nNewidiwyd y teitl ar ôl ffurfiad llywodraeth glymbleidiol rhwng y Democratiaid Rhyddfrydol a'r Blaid Lafur yn y Cynulliad yn Hydref 2000. Yn ôl Mesur Seneddol Llywodraeth Cymru rhoddir caniatád i'r swydd cael ei hadnabod yn swyddogol fel y Brif Weinidog."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%AF%D1%80%D0%B5%D0%BD%D1%81%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Yarensk_%28Vologda_Governorate%29_%281780%29.png","page_title":"Яренск","context_page_description":"Яренск — Российн Федерацин эвла, Архангельскан областан Ленан кӀоштан административан центр."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1974","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Sharon_Laws%2C_Mendrisio_2009_-_Women_Elite.jpg","page_title":"Lijst van personen geboren in 1974","context_page_description":"Dit is een lijst van personen die geboren zijn in 1974.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://pt.wikipedia.org/wiki/Lu%C3%ADs_de_Sousa_(arcebispo_de_Braga)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Inoc%C3%AAncio_XI_e_D._Lu%C3%ADs_de_Sousa_%28c._1682-1683%29_-_F%C3%A9lix_da_Costa_Meesen.png","page_title":"Luís de Sousa (arcebispo de Braga)","context_page_description":"Luís de Sousa foi um prelado português, bispo de Lamego de 1670 a 1677 e arcebispo de Braga de 1677 até 1690.\\nFoi embaixador extraordinário de D. Pedro II em Roma em 1675."},{"page_url":"https://de.wikipedia.org/wiki/Pelzseide","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Marthamansfield_4_%28cropped%29.jpg","page_title":"Pelzseide","context_page_description":"Pelzseiden oder Pelzfutter sind im Besonderen die speziell zur Abfütterung von Pelzbekleidung hergestellten Stoffe im Seidencharakter, allgemeiner gefasst alle hierfür verwendeten seidenähnlichen Stoffe. Die meisten mit dem Haar nach außen zu tragenden Pelzbekleidungen erhalten ein Seidenfutter. Es soll das Fellleder mit seinen Nähten und Abnähern sowie die Einlagen verdecken, die Gleitfähigkeit beim An- und Ausziehen erhöhen, den Fall des Kleidungsstückes verbessern und ihm ein gutes Innenaussehen geben.\\nFür Pelzinnenfutter, die in Textilbekleidung eingearbeiteten Fellfutter, siehe bei Pelzinnenfutter."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Neunkirchen_am_Brand","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Klosterhof_4_Neunkirchen_am_Brand_20190308_001.jpg","page_title":"Liste der Baudenkmäler in Neunkirchen am Brand","context_page_description":"Auf dieser Seite sind die Baudenkmäler des oberfränkischen Marktes Neunkirchen am Brand zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 8. Januar 2015 wieder und enthält 114 Baudenkmäler."},{"page_url":"https://no.wikipedia.org/wiki/Proastiakos","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Attica_06-13_Doukissis_Plakentias_suburban_train_stop.jpg","page_title":"Proastiakos","context_page_description":"Proastiakos er navnet på forstadsbanene i Athen og i Thessaloniki som begge drives av det greske statlige jernbaneselskapet, OSE. I Athen forbinder den Pireus og Athens sentralstasjon med Eleftherios Venizelos internasjonale lufthavn og Kiato. Det er planer om å forlenge Proastiakos vestover til Loutraki og Patras, nordover til Thiva og Khalkida, og østover til Rafina og Lavrio. I Thessaloniki betjenes strekningen mellom Thessalonikis nye stasjon og Larisa."},{"page_url":"https://en.wikipedia.org/wiki/Kaikhosru_Shapurji_Sorabji","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Ferruccio_Busoni.jpg","page_title":"Kaikhosru Shapurji Sorabji","context_page_description":"Kaikhosru Shapurji Sorabji was an English composer, music critic, pianist and writer. One of the 20th century's most prolific piano composers, he is best known for his works for the instrument, which include seven symphonies for piano solo, four toccatas, Sequentia cyclica, 100 Transcendental Studies, Opus clavicembalisticum, six piano sonatas and his \\"Gulistān\\"—Nocturne for Piano.\\nSorabji expressed a sense of otherness early in his life. As a homosexual of mixed ancestry and feeling alienated from English society, he was educated privately and had a lifelong tendency to seclusion. His mother was English and his father a wealthy Parsi businessman from India, who set up a modest trust fund that freed him from the need to work. Although a reluctant performer and not a virtuoso, Sorabji played a few of his works in public between 1920 and 1936. In the late 1930s, a shift in his attitude took place and he imposed restrictions on performance of his music, which he lifted in 1976."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD_%D0%9F%D0%B0%D1%88%D0%B5%D0%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/Pashev-1935-Sofia.jpg","page_title":"Константин Пашев","context_page_description":"Константин Михайлов Пашев е български лекар офталмолог и общественик.\\nТой е академик на Българската академия на науките, почетен член на Академията на медицинските науки в Палермо, член-кореспондент на Баварската академия на науките в Мюнхен, професор. Основоположник на българската офталмологична научна школа."},{"page_url":"https://it.wikipedia.org/wiki/Storia_del_municipio_Roma_III","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/Piranesi-16058.jpg","page_title":"Storia del municipio Roma III","context_page_description":"La storia del Municipio Roma III riguarda il territorio della zona nord di Roma, tra il Tevere e l'Aniene, delimitato da tre grandi assi di trasporto: la Via Salaria a ovest, la Via Nomentana a sud-est e, ovviamente di più recente costruzione, il Grande Raccordo Anulare a nord. Le prime testimonianze della presenza dell'uomo nel territorio suddetto risalgono a 700.000 anni fa; nell'età antica vi fu un grande sviluppo demografico con la costituzione di diverse città nella zona, all'incirca negli anni della fondazione di Roma, come Crustumerio, abitata dai Crustumini, e Fidene.\\nNell'età imperiale, al contrario, vi fu uno spopolamento dovuto alla moltiplicazione del numero di villae nel territorio; lo stesso fenomeno avvenne nel Medioevo con i casali.\\nÈ nell'ultimo secolo che la zona raggiunge un grandissimo e celere sviluppo urbanistico, con la nascita prima della garden city di Monte Sacro e poi, nel secondo dopoguerra, di molti altri quartieri."},{"page_url":"https://hu.wikipedia.org/wiki/T%C3%B6r%C3%B6korsz%C3%A1g_vil%C3%A1g%C3%B6r%C3%B6ks%C3%A9gi_helysz%C3%ADnei","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Ani_-_Tigran_Honents.jpg","page_title":"Törökország világörökségi helyszínei","context_page_description":"Törökország területéről eddig tizennyolc helyszín került fel a Világörökségi Listára, hetvennyolc helyszín a javaslati listán várakozik a felvételre."},{"page_url":"https://la.wikipedia.org/wiki/Stephanus_Maderno","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/St_Cecilia%27s_Martyrdom.jpg","page_title":"Stephanus Maderno","context_page_description":"Stephanus Maderno fuit sculptor Italianus ex Helvetia aetate baroca oriundus, qui in Italia praecipue Romae versatus est. Frater eius Carolus fuit illustris architectus."},{"page_url":"https://en.wikipedia.org/wiki/Stefano_Borchi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Stefano_Borchi_4JDD2011.JPG","page_title":"Stefano Borchi","context_page_description":"Stefano Borchi is an Italian racing cyclist. He rode at the 2013 UCI Road World Championships."},{"page_url":"https://en.wikipedia.org/wiki/List_of_people_from_Savannah,_Georgia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/TomTurpin.png","page_title":"List of people from Savannah, Georgia","context_page_description":"The city of Savannah, Georgia, the largest city and the county seat of Chatham County, Georgia, is the birthplace and home of several notable individuals. This is a list of people from Savannah, Georgia and includes people that were born or lived in Savannah, Georgia for a nontrivial amount of time. Individuals included in this listing are people presumed to be notable because they have received significant coverage in reliable sources that are independent of the subject.\\nSavannah was established in 1733 and was the first colonial and state capital of Georgia. It is known as America's first planned city and attracts millions of visitors who enjoy the city's architecture and historic structures such as the birthplace of Juliette Gordon Low, the Telfair Academy of Arts and Sciences, the First African Baptist Church, Temple Mickve Israel, and the Central of Georgia Railway roundhouse complex. Today, Savannah's downtown area is one of the largest National Historic Landmark Districts in the United States."},{"page_url":"https://nl.wikipedia.org/wiki/Huis_Stuart","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Portrait_of_Bonnie_Prince_Charlie.jpg","page_title":"Huis Stuart","context_page_description":"Het huis Stuart was een Brits adellijk huis afkomstig uit Schotland. De dynastie verenigde Engeland en Schotland tot één koninkrijk, en regeerde daarnaast ook over Ierland."},{"page_url":"https://en.wikipedia.org/wiki/House_of_Representatives_(Netherlands)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Henk_Krol_2013.jpg","page_title":"House of Representatives (Netherlands)","context_page_description":"The House of Representatives is the lower house of the bicameral parliament of the Netherlands, the States General, the other one being the Senate. It has 150 seats, which are filled through elections using a party-list proportional representation. It sits in the Binnenhof in The Hague."},{"page_url":"https://pl.wikipedia.org/wiki/Kisiel_owsiany","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Oats_kissel_6.jpg","page_title":"Kisiel owsiany","context_page_description":"Kisiel owsiany – potrawa przygotowywana z mąki owsianej lub płatków owsianych, przyrządzana na zakwasie, opcjonalnie na rozczynie z drożdży. Jedna z tradycyjnych potraw na okres wielkiego postu lub Wigilię Bożego Narodzenia w kuchni rosyjskiej, litewskiej, Kresów Wschodnich. Pierwsze wzmianki o tej potrawie pochodzą z XII-XIII wieku. Pojawiła się znacznie wcześniej niż kisiel owocowy, który spopularyzował się na terenach rosyjskich prawdopodobnie dopiero w XX wieku – wraz z rozprzestrzenieniem się uprawy ziemniaka.\\nKisiel owsiany można przyrządzić jedynie na mące lub płatkach owsianych zaparzonych wodą. Proces fermentacji można wspomóc kawałkiem chleba żytniego. Inny tradycyjny sposób polega na przygotowaniu rozczynu z drożdży. Konsystencja gotowej potrawy zależy od intencji kucharza – od rzadkiej polewki do gęstej leguminy, którą można kroić nożem. Kisiel o rzadkiej, płynnej postaci jest tożsamy ze staropolskim żurem.\\nPrzyrządzenie na zakwasie nadawało kisielowi charakterystyczny kwaśny smak. Spożywany był na gorąco lub zimno. Zazwyczaj okraszany był masłem, olejem lub skwarkami z cebulą. Spożywano go z warzywami, jako dodatek do ziemniaków lub z chlebem."},{"page_url":"https://es.wikipedia.org/wiki/El_Milano","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Escudo_de_El_Milano.svg","page_title":"El Milano","context_page_description":"El Milano es un municipio y localidad española de la provincia de Salamanca, en la comunidad autónoma de Castilla y León. Se integra dentro de la comarca de Vitigudino y la subcomarca de La Ramajería. Pertenece al partido judicial de Vitigudino.​​​​\\nSu término municipal está formado por un solo núcleo de población, ocupa una superficie total de 22,66 km² y según los datos demográficos recogidos en el padrón municipal elaborado por el INE en el año 2017, cuenta con una población de 122 habitantes."},{"page_url":"https://fr.wikipedia.org/wiki/Amsterdam","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Amsterdam_Magere_Brug.jpg","page_title":"Amsterdam","context_page_description":"Amsterdam est la capitale des Pays-Bas, bien que le gouvernement ainsi que la plupart des institutions nationales siègent à La Haye. Sur la base des chiffres de l'année 2017, la commune d'Amsterdam compte plus de 850 000 habitants, appelés Amstellodamois, ce qui en fait la commune néerlandaise la plus peuplée. Elle est située au cœur de la région d'Amsterdam, regroupant environ 1 350 000 habitants. L'aire urbaine, qui rassemble plus de 2 400 000 résidents fait elle-même partie d'une conurbation appelée Randstad qui compte 7 100 000 habitants. La ville est la plus grande de Hollande-Septentrionale, mais n'est cependant pas le chef-lieu de la province, ce dernier étant Haarlem, situé à 19 kilomètres à l'ouest d'Amsterdam.\\nLe nom de la commune vient de l'ancien nom néerlandais Amstelredamme évoquant les origines de la ville : la digue sur l'Amstel. Petit village de pêcheurs au XIIᵉ siècle, la ville connaît une très forte croissance au Moyen Âge au point de devenir l'un des principaux ports du monde durant le siècle d'or néerlandais."},{"page_url":"https://fr.wikipedia.org/wiki/Art_nouveau","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/2TiffanyVasesB.JPG","page_title":"Art nouveau","context_page_description":"L'Art nouveau, Modern style ou style nouille est un mouvement artistique de la fin du XIXᵉ et du début du XXᵉ siècle qui s'appuie sur l'esthétique des lignes courbes.\\nNé en réaction contre les dérives de l’industrialisation à outrance et la reproduction sclérosante des anciens styles, c'est un mouvement soudain, rapide, qui connaît un développement international : Tiffany, Jugendstil, Sezessionstil, Nieuwe Kunst, Stile Liberty, Modernismo, style sapin, Modern. Le terme français « Art nouveau » s’est imposé au Royaume-Uni, en même temps que l’anglomanie en France a répandu le terme Modern Style au début du XXᵉ siècle.\\nS'il comporte des nuances selon les pays, ses critères sont communs : l'Art nouveau se caractérise par l'inventivité, la présence de rythmes, couleurs, ornementations inspirés des arbres, des fleurs, des insectes, des animaux, et qui introduisent du sensible dans le décor quotidien. C'est aussi un art total en ce sens qu'il occupe tout l'espace disponible pour mettre en place un univers personnel considéré comme favorable à l’épanouissement de l'homme moderne à l'aube du XXᵉ siècle."},{"page_url":"https://it.wikipedia.org/wiki/Fregata_minor","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Fragata_com%C3%BAn_%28Fregata_minor%29%2C_isla_de_San_Crist%C3%B3bal%2C_islas_Gal%C3%A1pagos%2C_Ecuador%2C_2015-07-24%2C_DD_93.JPG","page_title":"Fregata minor","context_page_description":"La fregata maggiore è un uccello marino della famiglia dei Fregatidi."},{"page_url":"https://en.wikipedia.org/wiki/Gerhard_Jahn","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Bundesarchiv_B_145_Bild-F064715-0017%2C_Bonn%2C_Carstens_mit_Willy_Brandt_und_Gerhard_Jahn.jpg","page_title":"Gerhard Jahn","context_page_description":"Gerhard Jahn was a German politician and a member of the Social Democratic Party of Germany. He was Parliamentary Secretary to the Minister for Foreign Affairs from 1967 to 1969, and Federal Minister of Justice from 1969 to 1974."},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%27%D7%A0%D7%98_%D7%9E%D7%95%D7%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Janet_Mock_Head_Shot.png","page_title":"ג'נט מוק","context_page_description":"ג'נט מוק היא סופרת, פעילה למען זכויות טרנסג'נדרים, כתבת, והעורכת לשעבר של אתר מגזין פיפל."},{"page_url":"https://en.wikipedia.org/wiki/1971_Western_Australian_state_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/JohnTonkin1964crop.jpg","page_title":"1971 Western Australian state election","context_page_description":"Elections were held in the state of Western Australia on 20 February 1971 to elect all 51 members to the Legislative Assembly and 15 members to the 30-seat Legislative Council. The four-term Liberal-Country Party coalition government, led by Premier David Brand, was defeated by the Labor Party, led by Opposition Leader John Tonkin.\\nThis was the first election in which no seats were uncontested since the introduction of responsible government in 1890. This was partly due to the Democratic Labor Party deciding to contest every seat up for election in both Houses.\\nThere was a large increase in the number of electors, because this was the first election after 18 year olds had been given the vote."},{"page_url":"https://de.wikipedia.org/wiki/Kalifornischer_Mohn","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Cal_poppy.jpg","page_title":"Kalifornischer Mohn","context_page_description":"Der Kalifornische Mohn, auch Goldmohn, Kalifornischer Kappenmohn oder Schlafmützchen genannt, ist eine Pflanzenart aus der Familie der Mohngewächse. Ihren Ursprung hat diese Art in Kalifornien und anderen südwestamerikanischen Bundesstaaten. Inzwischen ist sie auch in Australien, Südafrika und Europa verbreitet. Sie war Giftpflanze des Jahres 2016."},{"page_url":"https://en.wikipedia.org/wiki/Axel_Rydin","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Crew_of_40m2_Skerry_cruiser_SIF.jpg","page_title":"Axel Rydin","context_page_description":"Axel Rydin was a Swedish sailor who competed in the 1920 Summer Olympics.\\nHe was a crew member of the Swedish boat Sif, which won the gold medal in the 40 m² class."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A5%88%E8%89%AF%E5%B2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Mount_Nara_and_Mount_Ogasa_2011-06-19.jpg","page_title":"奈良岳","context_page_description":"奈良岳は、石川県金沢市と白山市、富山県南砺市の3市にまたがる標高1,644mの両白山地北部の山。金沢市の最高峰であり、山頂に国土地理院の三等三角点が設置されている。別称、倉谷三方岳。"},{"page_url":"https://ro.wikipedia.org/wiki/Marie_Fredriksson","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Marie_Fredriksson-Roxette_at_Bospop_festival_The_Netherlands_2011.jpg","page_title":"Marie Fredriksson","context_page_description":"Marie Fredriksson a fost o cântăreață, cantautoare și pianistă suedeză de muzică pop, cunoscută mai ales datorită evoluției sale în formația pop rock Roxette, pe care a fondat-o împreună cu Per Gessle în anul 1986. Formația Roxette a câștigat faima internațională la sfârșitul anilor 1980 - începutul anilor 1990 cu un total de șase hituri în top 10 din Statele Unite, cum ar fi „It Must Have Been Love”, „Listen to Your Heart”, „The Look”, „Joyride” și „Dangerous”."},{"page_url":"https://es.wikipedia.org/wiki/Motorsport_Manager","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Motorsport_Manager_Logo.png","page_title":"Motorsport Manager","context_page_description":"Motorsport Manager es un juego de simulación de automóviles desarrollado por Playsport Games. El juego fue lanzado para iOS en agosto de 2014 y para Android en 2015. El juego lo publicó Sega para los sistemas MacOS y Windows en noviembre de 2016."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D9%88%D8%B1%D9%8A%D8%B3_%D9%83%D9%84%D9%8A%D8%A8%D9%88%D8%B1%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Morris_Claiborne_2011.jpg","page_title":"موريس كليبورن","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nموريس كليبورن لاعب كورة القدم الامريكيه من امريكا."},{"page_url":"https://fr.wikipedia.org/wiki/Antsiranana","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/MSC_Longoni_port_Antsiranana.jpg","page_title":"Antsiranana","context_page_description":"Antsiranana, aussi appelée Diego-Suarez ou Antsirane, est la plus grande ville du nord de Madagascar et le troisième port de la Grande île. Elle est la capitale de la province de Diego-Suarez. Il s'agit, avec Nosy Be et l'île Sainte-Marie, d'un des trois anciens établissements français qui furent associés à l'ancien territoire du royaume mérina pour former l'ancien protectorat français de Madagascar dont l'actuelle république de Madagascar reprend les frontières. Avec la récente mise en place des vingt-deux régions en 2004, elle est devenue la capitale de la région de Diana. Ses habitants s'appellent les Antsiranais. Son aire urbaine est estimée à 125 103 habitants en 2014."},{"page_url":"https://pl.wikipedia.org/wiki/Veysel_Sar%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Veysel_Sar%C4%B1%2714-15.JPG","page_title":"Veysel Sarı","context_page_description":"Veysel Sarı – turecki piłkarz grający na pozycji prawego obrońcy. Od 2015 jest zawodnikiem klubu Kasımpaşa SK."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8F%A4%E5%A1%94%E5%88%97%E8%A1%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Guangxiaosi_Tieta.jpg","page_title":"古塔列表","context_page_description":"本列表主要集中了中文維基百科收錄的古塔，塔的相關形制請參見條目。中國的古塔定義為民國以前修建的塔，有部分民國後重修的塔，但條目中有塔建歷史信息的，以「現代重修」列入本列表。"},{"page_url":"https://fr.wikipedia.org/wiki/Miermaigne","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Interieur_de_l%27%C3%A9glise_de_Miermaigne.jpg","page_title":"Miermaigne","context_page_description":"Miermaigne est une commune française située dans le département d'Eure-et-Loir en région Centre-Val de Loire."},{"page_url":"https://de.wikipedia.org/wiki/Herrg%C3%B6ttle_von_Biberbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Biberbach_St._Jakobus_und_Laurentius_651.JPG","page_title":"Herrgöttle von Biberbach","context_page_description":"Das Herrgöttle von Biberbach ist ein großes hölzernes Kruzifix aus dem 13. Jahrhundert, das in der Wallfahrtskirche St. Jakobus, St. Laurentius und zum Heiligen Kreuz in Biberbach, einem Markt im Landkreis Augsburg, bewahrt wird. Das vielbesuchte Gnadenbild hatte aufgrund seiner beachtlichen Größe vermutlich als Triumphkreuz in einer größeren Kirche des benachbarten Württemberger Raumes Verwendung gefunden und ist der Romanik zuzuordnen."},{"page_url":"https://fr.wikipedia.org/wiki/Uturuncu","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Uturuncu.jpg","page_title":"Uturuncu","context_page_description":"L'Uturuncu est une montagne de Bolivie culminant à 6 008 mètres d'altitude dans la cordillère des Andes. C'est un volcan présentant des signes d'activité notamment sous la forme de fumerolles et de fréquents séismes. Malgré son altitude et son isolement, il est facile d'accès, son ascension pouvant être en partie faite en véhicule motorisé."},{"page_url":"https://vi.wikipedia.org/wiki/Rhamphomyia_lamellata","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Rhamphomyia.lamellata.jpg","page_title":"Rhamphomyia lamellata","context_page_description":"Rhamphomyia lamellata là một loài ruồi, trong họ Empididae. Nó được tìm thấy ở Vương quốc Anh |Vương quốc Anh và Ireland, Đức, Switzeland, cộng hòa Séc, Slovakia và Hungary."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B4%D0%B0%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Monreale_-_Kathedrale_Mosaik_Adam_01.JPG","page_title":"Адам","context_page_description":"Ада́м — в авраамічних релігіях, перша людина, батько роду людського. Також слово «Адам» може позначати людство загалом.\\nСтворення Богом Адама та пізніше його дружини Єви завершило творіння світу. Адам і Єва задумувалися Богом як досконалі істоти та були поселені в Едемі, щоб розмножитись і створити людство. За порушення Божої заборони не їсти плоду Дерева пізнання добра і зла, вони були вигнані з Едему. Скуштування плоду стало першородним гріхом, що передався нащадкам Адама та Єви. Головним покаранням за це для Адама та наступних чоловіків стала потреба самостійно добувати харчі тяжкою працею. Як і всі ранні люди, Адам вирізнявся дуже довгим життям і зараховується до старозаповітних пророків."},{"page_url":"https://es.wikipedia.org/wiki/Trafalgar_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Trafalgar_Park.jpg","page_title":"Trafalgar Park","context_page_description":"El Trafalgar Park es un estadio multiusos localizado en la ciudad de Nelson, Nueva Zelanda. Habiendo sido inaugurado el 21 de abril de 1888, cuenta con una capacidad para 18 000 espectadores. Recibe su nombre en honor a la Batalla de Trafalgar de 1805, en la que la Royal Navy británica derrotó a las armadas navales de España y Francia.\\nLa mayoría los equipos de la ciudad que compiten en torneos nacionales lo utilizan: el Tasman United, del Campeonato de Fútbol; el Tasman Makos de la ITM Cup; y el Tasman Titans de la Rugby League. Fue una de las sedes utilizadas para la Copa Mundial de Rugby de 2011 y el lugar donde en 1978 se disputó la final de la Copa Chatham."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Technik_und_Bewaffnung_der_NVA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Hiddensee_AK-176_gun.jpg","page_title":"Liste der Technik und Bewaffnung der NVA","context_page_description":"Die Liste enthält Technik und Bewaffnung, die von der Nationalen Volksarmee der DDR genutzt wurde.\\nAufbau, Gliederung und Inhalt der Liste folgen dabei den entsprechenden Katalogen der Fachdienste."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Ciuchici","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/CIUCHICI.JPG","page_title":"Ciuchici","context_page_description":"Ciuchici sī Romania Caraş-Severin Koān ê chi̍t ê chū-tī-thé."},{"page_url":"https://ast.wikipedia.org/wiki/Durr%C3%ABs","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Golem_Albania_2016_Durres.jpg","page_title":"Durrës","context_page_description":"Durrës o Dirraquio ye una ciudá costera y un conceyu d'Albania con una población de 113 249 hab. De fundación griega, ye considerada la ciudá más antigua d'esti país y ye, tres la capital Tirana, la segunda con mayor población ya importancia económica. Durrës ye la capital del condáu de Durrës.\\nDurrës ye sede de la Universidá Aleksander Moisiu, la universidá pública albanesa de creación más recién."},{"page_url":"https://es.wikipedia.org/wiki/Ta%C3%A7a_Corcovado","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Bandeira_de_Campos_dos_Goytacazes.png","page_title":"Taça Corcovado","context_page_description":"La Taça Corcovado es un torneo de fútbol de Río de Janeiro creado en 2013, que se realiza en anexo al Campeonato Carioca Serie B1 como su segundo turno. Es administrado por la Federação de Futebol do Estado do Rio de Janeiro."},{"page_url":"https://it.wikipedia.org/wiki/Jean_II_Le_Meingre","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Blason_Jean_II_Le_Meingre%2C_dit_Boucicaut_%28selon_Gelre%29.svg","page_title":"Jean II Le Meingre","context_page_description":"Jean II Le Meingre detto Boucicaut è stato un cavaliere medievale, diplomatico e politico francese, crociato.\\nParticolarmente conosciuto per la sua abilità nell'arte bellica, si mise in luce nel periodo della guerra dei cent'anni; era l'omonimo figlio del maresciallo di Francia Jean I Le Meingre, anch'egli detto Boucicaut, morto a Digione il 15 marzo 1367, e del padre fu chiamato a ricoprire la medesima carica.\\nGran connestabile dell'Impero a Costantinopoli, presente nelle colonie genovesi d'oltremare, dal 1º novembre 1401 sino al 1409 ricoprì la carica di governatore della Repubblica di Genova. L'incarico gli venne assegnato per volontà dello stesso Carlo VI dopo che una lunga campagna militare aveva portato la Francia ad ottenere una sorta di protettorato sulla repubblica ligure.\\nDiplomatico di alterne fortune, è considerato dagli storici uno dei più valorosi cavalieri medioevali."},{"page_url":"https://pl.wikipedia.org/wiki/Uhldingen-M%C3%BChlhofen_(stacja_kolejowa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Bahnhof_Uhldingen-M%C3%BChlhofen.jpg","page_title":"Uhldingen-Mühlhofen (stacja kolejowa)","context_page_description":"Uhldingen-Mühlhofen – stacja kolejowa w Oberuhldingen, w kraju związkowym Badenia-Wirtembergia, w Niemczech."},{"page_url":"https://en.wikipedia.org/wiki/Dianne_Foster","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Dianne_Foster_in_The_Last_Hurrah_trailer.jpg","page_title":"Dianne Foster","context_page_description":"Dianne Foster was a Canadian actress of Ukrainian descent."},{"page_url":"https://fr.wikipedia.org/wiki/Colonisation_de_l%27espace","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Kuiper_belt_-_Oort_cloud-fr.svg","page_title":"Colonisation de l'espace","context_page_description":"La colonisation de l'espace, ou colonisation spatiale, est au-delà d'un sujet classique de fiction, un projet astronautique d'habitation humaine permanente et en grande partie auto-suffisante en dehors de la Terre. Elle est liée à la conquête de l'espace.\\nPlusieurs groupes de développement de la NASA, de l'ESA, des Agences spatiales russe et chinoise ainsi que d'autres scientifiques ont étudié la faisabilité de projets de colonies spatiales en divers endroits du Système solaire. Bien qu'ils aient déterminé qu'il y a des matières premières exploitables sur la Lune et les astéroïdes géocroiseurs, que l'énergie solaire est disponible en grande quantité et qu'aucune nouvelle découverte scientifique majeure n'est nécessaire, ils ont évalué qu'il faudrait des prouesses techniques d'ingénierie, une meilleure connaissance de l'adaptation humaine à l'espace et surtout d'énormes moyens financiers pour concrétiser de tels projets. Presque tous les projets sont donc réduits à un niveau d'évaluation théorique ou ont même été abandonnés.\\nLa seule présence humaine permanente dans l'espace est actuellement celle de la station spatiale internationale, qui n'est cependant pas autonome."},{"page_url":"https://ms.wikipedia.org/wiki/Penisilin","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/Penicillin-core.png","page_title":"Penisilin","context_page_description":"Penisilin merupakan salah satu dari jenis ubat antibiotik. Penisilin diperolehi daripada kulat yang bernama penisilum.\\nPenisilin digunakan dengan meluas untuk merawat jangkitan pada pelbagai bahagian tubuh, seperti penyakit:\\ngonorea\\nsiflis\\nantraks\\npneumonia\\nDalam Perang Dunia Kedua, ramai askar telah diselamatkan kerana luka mereka dapat dirawat dengan penisilin. Terdapat pelbagai jenis penisilin dan setiap satunya adalah khusus untuk membunuh kuman tertentu.\\nSecara umumnya penisilin merupakan suatu ubat yang selamat digunakan. Walau bagaimanapun, terdapat segelintir pesakit yang sangat peka terhadap penisilin. Apabila seseorang memakan penisilin, mereka mungkin menjadi sakit, merasa gatal, semput, ataupun ruam kulit. Dalam kes yang serius, pesakit itu boleh mati akibat kekusutan penyakitnya."},{"page_url":"https://gl.wikipedia.org/wiki/Trigueir%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Emberiza_calandra_MHNT.ZOO.2010.11.217_Chiach_Maroc-Naurois.jpg","page_title":"Trigueirón","context_page_description":"O trigueirón é unha ave da familia das Emberizidae."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_Birkenhead","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Birkenhead_Priory%2C_exterior.jpg","page_title":"Listed buildings in Birkenhead","context_page_description":"Birkenhead is a town in Wirral, Merseyside, England. Its central area contains 149 buildings that are recorded in the National Heritage List for England as designated listed buildings. Of these, six are listed at Grade I, the highest of the three grades, six at Grade II*, the middle grade, and the others are at Grade II, the lowest grade. This list contains the listed buildings in the central area of the town, and the other listed buildings are to be found in separate lists.\\nBirkenhead did not develop as a town until the 19th century. Prior to that time, a Benedictine priory was established in the 1170s, and the monks ran a ferry across the River Mersey. By 1811, the priory was in ruins, but a ferry was still in existence, carrying passengers to the growing port of Liverpool. The lord of the manor, with the intention of creating a bathing resort, built a few streets and commissioned the building of St Mary's Church adjacent to the site of the priory. However, Birkenhead developed as an industrial town rather than a resort starting from 1823 when William Laird built a boiler factory."},{"page_url":"https://en.wikipedia.org/wiki/Colonial_Germantown_Historic_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/4901_Gate.JPG","page_title":"Colonial Germantown Historic District","context_page_description":"The Colonial Germantown Historic District is a designated National Historic Landmark District in the Germantown and Mount Airy neighborhoods of Philadelphia, Pennsylvania along both sides of Germantown Avenue. This road followed an Indian path from the Delaware River just north of Old City Philadelphia, through Germantown, about 6 miles northwest of Center City Philadelphia, and on to Pottstown. Settlement in the Germantown area began, at the invitation of William Penn, in 1683 by Nederlanders and Germans under the leadership of Francis Daniel Pastorius fleeing religious persecution.\\nColonial Germantown was a leader in religious thought, printing, and education. Important dates in Germantown's early history include:\\nAugust 16, 1683, Pastorius arrives in Philadelphia\\nOctober 25, 1683, Lots are drawn for land among Pastorius's followers and settlement begins\\n1688, first American anti-slavery protest published\\n1690, first paper-mill built in America is built near Germantown\\n1705, possibly the first portrait painted in oil in America painted by Christopher Witt in Germantown\\n1708, first Mennonite Meetinghouse in America built in Germantown"},{"page_url":"https://az.wikipedia.org/wiki/Almaniya%E2%80%93Az%C9%99rbaycan_m%C3%BCnasib%C9%99tl%C9%99ri","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Stamps_of_Azerbaijan%2C_2013-1101.jpg","page_title":"Almaniya–Azərbaycan münasibətləri","context_page_description":"Azərbaycan–Almaniya münasibətləri — Azərbaycan Respublikası ilə Almaniya Federativ Respublikası arasındakı mövcud ikitərəfli əlaqələr.\\nİki ölkə arasında qarşılıqlı münasibətlərin başlanğıcı XIX əsrin ikinci yarısına təsadüf edir. 1863-cü ildə Almaniyanın \\"Simens qardaşları\\" firması tərəfindən Gədəbəy ərazisində yerləşən mis yataqları bazasında iri misəritmə zavodları tikilib. XX əsrin əvvəllərinədək bu zavodlarda istehsal edilən mis Cənubi Qafqazda əridilən misin 2/3 hissəsini təşkil edirdi. Bundan əlavə \\"Simens qardaşları\\" firması Daşkəsən ərazisində kobalt yataqları bazasında kobalt zavodu inşa edib. Bu zavodların inşası nəticəsində xeyli sayda insan işlə təmin edilib, əhalinin maddi rifahı yüksəlib. Alman sənayeçilərinin bu ərazidə fəallığının artması nəticəsində ətraf ərazilərdə, xüsusilə Azərbaycanın indiki Göy-göl və Şəmkir rayonlarında alman koloniyaları yaranıb."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%87%E6%A3%AE%E7%89%B9%C2%B7%E6%99%AE%E8%8E%B1%E6%96%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Vincent_Price_in_House_on_Haunted_Hill_%28cropped%29.jpg","page_title":"文森特·普莱斯","context_page_description":"小文森特·倫納德·普萊斯是一名美國演員，雖然也出演其他種類的影片，但主要以他在恐怖片中扮演的角色為人銘記。他一生出演了超過100部電影，名列好萊塢星光大道。其時常主演改編自愛倫·坡之作品，如《陷阱與鐘擺 》、《烏鴉》、《利吉亞之墓》、《長方形箱子》等。\\n他也是一名藝術收藏家，曾撰寫藝術史類書籍。東洛杉磯學院的文森特·普萊斯美術館就是以他的名字命名的。此外，他還是一名美食家，曾出版過數本美食介紹書及食譜。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8F%E3%82%A4%E3%83%81%E5%A4%A7%E4%BD%BF%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Diplomatic_missions_in_Haiti.png","page_title":"ハイチ大使館","context_page_description":"ハイチ大使館は、ハイチが世界各国に設置している大使館。世界各国がハイチに設置している在ハイチ大使館を指して、単にハイチ大使館と呼ばれることもある。\\nハイチが大使館を設置している国は20ヶ国以上、ハイチに大使館を設置している国は10ヶ国以上あるが、日本語でハイチ大使館と呼ぶ場合、日本が関係する下記いずれかの大使館を指すことが多い。\\n駐日ハイチ大使館\\n在ハイチ日本国大使館"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%91%D0%B5%D0%BD%D0%B8_%D0%9C%D0%BE%D1%80%D0%B8%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Benny_morris.jpg","page_title":"Бени Морис","context_page_description":"Бени Морис е израелски историк, един от най-влиятелните и плодовити членове на т.нар. школа на Новите историци в страната.\\nТой е роден през 1948 година в кибуца Ейн Хахореш. Към 2009 година е професор по история в Университета „Бен Гурион“. Основните му изследвания са в областта на причините за емиграцията на палестинците от територията на Израел след обявяването на независимостта на страната през 1948 година. Морис е обвиняван както в пропалестински, така и в произраелски позиции. Самият той се определя като ционист."},{"page_url":"https://es.wikipedia.org/wiki/Ford_Thunderbird","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Ford_Thunderbird_1980.jpg","page_title":"Ford Thunderbird","context_page_description":"El Ford Thunderbird es un automóvil del segmento F fabricado en los Estados Unidos por la Ford Motor Company. El nombre del Ford Thunderbird proviene del folklore nativo estadounidense de Arizona y Nuevo México. Cuenta la mitología que el Thunderbird gobernaba en el cielo y era el ayudante divino del hombre. Sus grandes alas batientes, invisibles para los mortales, originaban los vientos y los truenos, dando lugar a las tormentas del desierto que proporcionaban a los indígenas estadounidenses el agua para seguir viviendo en la sequedad en la que les había situado el destino en América del Norte.\\nLa idea era llamar al Thunderbird Fairlane, pero se consideraron muchas otras opciones; por ejemplo, aun cuando Lewis D. Crusoe se inclinó por el nombre alternativo de Savile, fue él quién convocó a un concurso entre los empleados de Ford Motor Company para sugerir un nombre. El ganador recibiría un premio de USD $250. Alden \\"Gib\\" Giberson, un estilista nativo del suroeste, sugirió el nombre de \\"Thunderbird\\"."},{"page_url":"https://en.wikipedia.org/wiki/Raetia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Roman_Empire_125.png","page_title":"Raetia","context_page_description":"Raetia was a province of the Roman Empire, named after the Rhaetian people. It bordered on the west with the country of the Helvetii, on the east with Noricum, on the north with Vindelicia, on the south-west with Transalpine Gaul and on the south with Venetia et Histria.\\nIt thus comprised the districts occupied in modern times by eastern and central Switzerland, southern Germany, Vorarlberg and the greater part of Tyrol in Austria, and part of northern Lombardy in Italy. The region of Vindelicia was annexed to the province at a later date than the others. The northern border of Raetia during the times of Augustus and Tiberius was the River Danube. Later the Limes Germanicus marked the northern boundary, stretching for 166 km north of the Danube. Raetia linked to Italy across the Alps over the Reschen Pass, by the Via Claudia Augusta.\\nThe capital of the province was Augusta Vindelicorum, present-day Augsburg in southern Germany."},{"page_url":"https://eo.wikipedia.org/wiki/Sieversh%C3%BCtten","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Wappen_Sieversh%C3%BCtten.png","page_title":"Sievershütten","context_page_description":"Sievershütten estas komunumo en Germanio. Ĝi troviĝas en la distrikto Segeberg de la federacia lando Ŝlesvigo-Holstinio. Fine de decembro 2018 la komunumo havis 1 108 loĝantojn. La teritorio estas parto de la komunumaro Kisdorf, administra ligo de pluraj formale sendependaj politikaj komunumoj, kies administra centro estas la urbo Kattendorf."},{"page_url":"https://el.wikipedia.org/wiki/%CE%92%CF%81%CE%B1%CE%B2%CE%B5%CE%AF%CE%BF_Erasmus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/William_H._McNeill.jpg","page_title":"Βραβείο Erasmus","context_page_description":"Το βραβείο Erasmus ή Praemium Erasmianum είναι ετήσιο βραβείο που απονέμεται από το διοικητικό συμβούλιο του Ιδρύματος Praemium Erasmianum σε πρόσωπα ή οργανισμούς που έχουν συμβάλει εξαιρετικά στον πολιτισμό, την κοινωνία, ή τις κοινωνικές επιστήμες στην Ευρώπη και στον υπόλοιπο κόσμο. Είναι μια από τις πιο αναγνωρίσιμες διακρίσεις στην Ευρώπη. Το βραβείο πήρε το όνομά του Εράσμου, του ανθρωπιστή της ολλανδικής Αναγέννησης. Ένας από τους οργανισμούς που βραβεύτηκαν ήταν και η κοινότητα της Βικιπαίδειας το 2015."},{"page_url":"https://pl.wikipedia.org/wiki/Park_Narodowy_Bernardo_O%E2%80%99Higgins","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Southern_Patagonian_Ice_Field.jpg","page_title":"Park Narodowy Bernardo O’Higgins","context_page_description":"Park Narodowy Bernardo O’Higgins – największy obszar chroniony w Chile, którego powierzchnia wynosi 35 259,01 km². Nazwa parku pochodzi od imienia generała Bernardo O’Higginsa, który był pierwszym przywódcą Chile. Park sąsiaduje z kilkoma innymi parkami, od wschodu z Parkiem Narodowym Los Glaciares oraz Parkiem Narodowym Torres del Paine, od północy z Parkiem Narodowym Laguna San Rafael oraz z dwoma rezerwatami, od południowego zachodu z Rezerwatem Narodowym Alacalufes i od północnego zachodu z Rezerwatem Narodowym Katalalixar.\\nTeren parku obejmuje znaczną część Południowego Lądolodu Patagońskiego. Jedną z głównych atrakcji jest Lodowiec Brüggen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B8%D1%80%D0%B8%D0%BD%D0%B3_(%D0%B0%D1%8D%D1%80%D0%BE%D0%BF%D0%BE%D1%80%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/DEE-d.jpg","page_title":"Диринг (аэропорт)","context_page_description":"Аэропорт Диринг, — государственный гражданский аэропорт, расположенный в 3,7 километрах к юго-западу от центрального делового района города Диринг, США."},{"page_url":"https://es.wikipedia.org/wiki/Villanueva_de_Huerva","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Bandera_de_Villanueva_de_Huerva.svg","page_title":"Villanueva de Huerva","context_page_description":"Villanueva de Huerva es un municipio español del Campo de Cariñena, provincia de Zaragoza, Aragón. Tiene un área de 78,35 km² con una población de 473 habitantes y una densidad de 6,04 hab/km²."},{"page_url":"https://en.wikipedia.org/wiki/Barbara_Kolar","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Barbara_Kolar_15012012_20_godina_priznanja_RH.jpg","page_title":"Barbara Kolar","context_page_description":"Barbara Kolar is a Croatian actress, television presenter at the Croatian Radiotelevision and the radio presenter at Antena Zagreb. She is the most famous for hosting the Ples sa zvijezdama and Zvijezde pjevaju shows. She hosts Antena Zagreb's Jutarnji Show. She starred in the HRT series Bitange i princeze, Stipe u gostima and Naša mala klinika, and is the host of the quiz show Upitnik."},{"page_url":"https://sk.wikipedia.org/wiki/Kr%C5%A1iak_ryb%C3%A1r","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Pandion_haliaetus_MHNT.ZOO.2010.11.93.9.jpg","page_title":"Kršiak rybár","context_page_description":"Kršiak rybár je kozmopolitný druh z čeľade kršiakovité, nevyskytuje sa len v Južnej Amerike a v Antarktíde. Podľa Medzinárodnej únie na ochranu prírody a prírodných zdrojov kršiak rybár patrí medzi najmenej ohrozené druhy, trend celkovej populácie je stúpajúci, stavy v Severnej Amerike za posledných 40 rokov štatisticky významne narástli o 1100%, veľkosť populácie narastá aj v Európe."},{"page_url":"https://de.wikipedia.org/wiki/Gustav_Rau_(Kunstsammler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Dou_K%C3%B6chin.JPG","page_title":"Gustav Rau (Kunstsammler)","context_page_description":"Gustav Rau war ein deutscher Arzt, Philanthrop und Kunstsammler."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Mitglieder_des_Deutschen_Bundestages_(19._Wahlperiode)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Stefan_Mueller_MdB_Pressebild_2017.jpg","page_title":"Liste der Mitglieder des Deutschen Bundestages (19. Wahlperiode)","context_page_description":"Diese Liste gibt einen Überblick über alle Mitglieder des Deutschen Bundestages der 19. Wahlperiode nach der Bundestagswahl 2017. Die Mandatszeit der Abgeordneten begann mit der konstituierenden Sitzung am 24. Oktober 2017.\\nIm Juli 2019 lag der Frauenanteil im Bundestag bei 31,17 %, vor der Wahl bei 36,83 %."},{"page_url":"https://nl.wikipedia.org/wiki/Montezuma%27s_Revenge_(Hellendoorn)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Hellendoorn7.JPG","page_title":"Montezuma's Revenge (Hellendoorn)","context_page_description":"Montezuma's Revenge is een topspin in het Nederlandse attractiepark Avonturenpark Hellendoorn.\\nDe in 1998 geopende topspin bereikt tijdens de anderhalf minuten durende rit een hoogte van circa twaalf meter. De gondel, waarin plaats is voor maximaal 28 personen, maakt tijdens de rit meerdere inversies. Om veiligheidsredenen dient elke bezoeker tussen de 140 en 190 cm lang te zijn."},{"page_url":"https://it.wikipedia.org/wiki/Arte_islamica","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Bassin_Syrie_1.JPG","page_title":"Arte islamica","context_page_description":"L'espressione arte islamica o arti islamiche comprende le arti prodotte a partire dall'Egira fino al XIX secolo da artisti, che hanno vissuto in territori culturalmente legati alla religione dell'Islam. Essa riguarda ambiti assai vari, dall'architettura alla calligrafia, dalla pittura all'arte ceramica, ecc.\\nInizialmente l'arte islamica si è ispirata a quella bizantina, a quella romana, a quella paleocristiana, a quella persiana ed a quella cinese.\\nFin dall'inizio l'arte islamica pratica l'astrazione e la stilizzazione delle forme che appartengono agli esseri viventi, sforzandosi di descrivere i valori spirituali dell'uomo; evita il naturalismo, che include nella tradizione occidentale l'uso dello spazio tridimensionale, della prospettiva e della modellistica della figura umana in luci e ombre.\\nPuò essere suddivisa in vari periodi storici:\\nquello iniziale detto degli Omayyadi;\\nquello medio degli Abbasidi e quello della dinastia dei turchi Selgiuchidi;\\nquello dei Safavidi;\\nquello della rinascita dell'arte sotto gli Ottomani.\\nL'arte islamica è tipicamente focalizzata sulla riproduzione della calligrafia araba."},{"page_url":"https://sco.wikipedia.org/wiki/Kaposv%C3%A1r","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Kaposvar_montage.jpg","page_title":"Kaposvár","context_page_description":"Kaposvár is a ceety in the soothwastren pairt o Hungary, sooth frae the Lake Balaton. It is ane o the leadin ceeties o Transdanubia an it is the caipital o Somogy Coonty. Kaposvár is the seat o the Roman Catholic Diocese o Kaposvár."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Randolph_County,_Arkansas","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Map_of_Arkansas_highlighting_Randolph_County.svg","page_title":"National Register of Historic Places listings in Randolph County, Arkansas","context_page_description":"This is a list of the National Register of Historic Places listings in Randolph County, Arkansas.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Randolph County, Arkansas, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in a map.\\nThere are 17 properties and districts listed on the National Register in the county. Another two properties were once listed but have been removed.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D0%B5%D1%98%D0%BC%D0%B8%D1%98%D0%B5%D0%BD_%D0%94%D0%B0%D1%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/DDuff.JPG","page_title":"Дејмијен Даф","context_page_description":"Дејмијен Ентони Даф енгл. Damien Anthony Duff бивши је ирски фудбалер."},{"page_url":"https://en.wikipedia.org/wiki/Stone_circle","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Carrigagulla_03.jpg","page_title":"Stone circle","context_page_description":"A stone circle is a circular alignment of standing stones. They are commonly found across Northern Europe and Great Britain, and typically date from the Late Neolithic and Early Bronze Age eras, with most concentrations appearing from 3000 BCE. The best known examples include those at the henge monument at Avebury, the Rollright Stones, and elements within the ring of standing stones at Stonehenge. Ancient stone circles appear throughout Europe, with many existing in the Pyrenees, on the Causse de Blandas in southern France in the Cevennes, in the Alps, Bulgaria, and Poland. Another type can be found in the Horn of Africa.\\nStone circles are usually grouped in terms of the shape and size of the stones, the span of their radius, and their population within the local area. Although many theories have been advanced to explain their use, usually related to providing a setting for ceremony or ritual, there is no consensus among archaeologists as to their intended function. Their construction often involved considerable communal effort, including specialist tasks such as planning, quarrying, transportation, laying the foundation trenches, and final construction."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_der_M%C3%BCnchner_Altstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/NieserstrLapidarium_Muenchen-01.JPG","page_title":"Liste der Baudenkmäler in der Münchner Altstadt","context_page_description":"Auf dieser Seite sind die Baudenkmäler im Münchner Stadtteil Altstadt im Stadtbezirk 1 Altstadt-Lehel aufgelistet. Zu diesen Baudenkmälern gibt es auch eine Bildersammlung und ein Fotoalbum mit ausgewählten Bildern.\\nDiese Liste ist Teil der Liste der Baudenkmäler in München. Grundlage ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt und aktualisiert wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://en.wikipedia.org/wiki/Signal_(software)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Signal_Blue_Icon.png","page_title":"Signal (software)","context_page_description":"Signal is a cross-platform encrypted messaging service developed by the Signal Foundation and Signal Messenger LLC. It uses the Internet to send one-to-one and group messages, which can include files, voice notes, images and videos. Its mobile apps can also make one-to-one voice and video calls, and the Android version can optionally function as an SMS app.\\nSignal uses standard cellular telephone numbers as identifiers and secures all communications to other Signal users with end-to-end encryption. The apps include mechanisms by which users can independently verify the identity of their contacts and the integrity of the data channel.\\nAll Signal software is free and open-source. Its clients are published under the GPLv3 license, while the server code is published under the AGPLv3 license. The non-profit Signal Foundation was launched in February 2018 with initial funding of $50 million."},{"page_url":"https://pt.wikipedia.org/wiki/Wikip%C3%A9dia_em_portugu%C3%AAs","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Portuguese_Wikipedia_Page_views_ratio_by_country_201101-201112.png","page_title":"Wikipédia em português","context_page_description":"A Wikipédia em português, Wikipédia em língua portuguesa ou Wikipédia lusófona é a versão em língua portuguesa da Wikipédia, a enciclopédia de licença livre. A palavra \\"lusófona\\" refere-se a um país ou povo que tem como língua oficial o português. Além de ser o sexto site mais acessado do mundo, a Wikipédia é o décimo terceiro mais acessado do Brasil e o sexto mais acessado de Portugal."},{"page_url":"https://ro.wikipedia.org/wiki/Castelul_Montsoreau","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/William_Turner_rem_high_res.jpg","page_title":"Castelul Montsoreau","context_page_description":"Castelul Montsoreau este un castel francez în stil renascentist de pe Valea Loarei, construit direct în albia râului Loara. Acesta este situat în micul târg Montsoreau, în departamentul Maine-et-Loire din Franța. Începând cu 8 aprilie 2016, Castelul Montsoreau a devenit sediu pentru colecția extraordinară Philippe Méaille a conceptualiștilor radicali Art & Language și a fost redenumit Muzeul de Artă Contemporană - Castelul Montsoreau.\\nCastelul Montsoreau are o poziție excepțională la confluența a două râuri, Loara și Vienne, și la punctul de întâlnire al trei regiuni istorice: Anjou, Poitou și Touraine. O clădire de tranziție între castelul fortificat și palatul urban, are particularitatea de a fi singurul castel din Loire construit direct pe albia râului.\\nCastelul de Montsoreau a fost imortalizat în mai multe rânduri, în special de Alexandre Dumas în romanul său Doamna de Monsoreau, scris între 1845 și 1846, de J. M. W."},{"page_url":"https://en.wikipedia.org/wiki/Konwent_Polonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Polonia_lipp.png","page_title":"Konwent Polonia","context_page_description":"Konwent Polonia is a Polish student corporation. It is the oldest active Polish student corporation.\\nThe corporation is established in 1828 at Tartu University.\\nIn 1919 the corporation moved to Vilnius, Lithuania. In Vilnius, it was active until 1939. When Lithuanian SSR was established then the corporation existed in exile. The strongest chapter existed in London."},{"page_url":"https://en.wikipedia.org/wiki/Wuling_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Changde_Street.jpg","page_title":"Wuling District","context_page_description":"Wuling District is one of two urban districts in Changde City, Hunan Province, China. Located on the central area of Changde, the district is surrounded by Dingcheng District to the north and south, bordered to the west by Taoyuan County, to the east by Hanshou County. Wuling District has an area of 289 kilometres with 426,694 of registered population. It is divided into 11 subdistricts, one towns and two township, its government seat is Nanping Subdistrict."},{"page_url":"https://en.wikipedia.org/wiki/Folschviller","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Commune_de_Folschviller_puits_1.jpg","page_title":"Folschviller","context_page_description":"Folschviller is a commune in the Moselle department in Grand Est in north-eastern France.\\nLocalities of the commune: Aling, Berfang Neuf, Vieux Berfang."},{"page_url":"https://en.wikipedia.org/wiki/Sepia_(genus)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/HPIM1795.JPG","page_title":"Sepia (genus)","context_page_description":"Sepia is a genus of cuttlefish in the family Sepiidae encompassing some of the best known and most common species. The cuttlebone is relatively ellipsoid in shape. The name of the genus is the Latinized form of the Ancient Greek σηπία, sēpía, cuttlefish."},{"page_url":"https://eo.wikipedia.org/wiki/K%C3%A1roly_Nendtvich","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Nendtvich_K%C3%A1roly.jpg","page_title":"Károly Nendtvich","context_page_description":"Károly Nendtvich [kAroj nendviĉ], laŭ hungarlingve kutima sinsekvo Nendtvich Károly [mikŝa] estis hungara kuracisto, kemiisto, profesoro, membro ordinara de Hungara Scienca Akademio. Lia nobela antaŭnomo estis cserkúti.\\nKároly Nendtvich naskiĝis la 31-an de decembro 1811 en Pécs. Li mortis la 5-an de julio 1892 en Budapeŝto."},{"page_url":"https://fr.wikipedia.org/wiki/Mike%C5%A1,_le_chat","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/eb/%C5%98%C3%AD%C4%8Dany_-_sm%C4%9Brovka_na_Hrusice_-_Mike%C5%A1_-_1c.jpg","page_title":"Mikeš, le chat","context_page_description":"Mikeš est un livre pour enfants écrit et illustré par Josef Lada. Les tribulations d'un jeune garçon dénommé Pepík et de ses copains qui déambulent avec un chat noir appélé Mikeš.\\nUne grande partie du livre se déroule dans le village natal de l'auteur à Hrusice, en République Tchèque.\\nLe livre illustré sort pour la première fois dans les années 1934-1936."},{"page_url":"https://ht.wikipedia.org/wiki/Brentwood,_Tennessee","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Brentwood_Tennessee_Town_Hall.jpg","page_title":"Brentwood, Tennessee","context_page_description":"Brentwood se yon vil nan eta Tennessee, nan Etazini.\\nLi nan konte, rejyon Williamson.\\nNan lane 2000, popilasyon l te genyen 23,445 moun."},{"page_url":"https://hu.wikipedia.org/wiki/A_magyar_n%C5%91i_labdar%C3%BAg%C3%B3-v%C3%A1logatott_2011._augusztus_25-i_m%C3%A9rk%C5%91z%C3%A9se","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/P%C3%A1d%C3%A1r_Anita_2011.jpg","page_title":"A magyar női labdarúgó-válogatott 2011. augusztus 25-i mérkőzése","context_page_description":"Előző mérkőzés - Következő mérkőzés\\nA magyar női labdarúgó-válogatott barátságos mérkőzése Románia ellen, 2011. augusztus 25-én, amelyen a magyar válogatott 2–0-s vereséget szenvedett."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D9%8A%D9%86%D8%A7_%D8%A8%D9%8A%D8%AA%D9%8A%D8%B1%D9%85%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Lena_Petermann_FIFA_Women%27s_World_Cup_Canada_2015_-_Edmonton_%2819441949965%29_%282%29_%28cropped%29.jpg","page_title":"لينا بيتيرمان","context_page_description":"لينا بيتيرمان ‏ هي لاعبة كرة قدم ألمانية في مركز الهجوم. شاركت مع منتخب ألمانيا لكرة القدم للسيدات ومنتخب ألمانيا تحت 17 سنة للسيدات لكرة القدم ومنتخب ألمانيا تحت 20 سنة للسيدات لكرة القدم. أما مع النوادي، فقد لعبت مع منتخب ألمانيا الوطني لكرة القدم للسيدات تحت 15 سنة ونادي فرايبورغ وHamburger SV."},{"page_url":"https://es.wikipedia.org/wiki/Alliance_(Nebraska)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Alliance%2C_Nebraska_2nd_and_Box_Butte_looking_N.jpg","page_title":"Alliance (Nebraska)","context_page_description":"Alliance es una ciudad ubicada en el condado de Box Butte en el estado estadounidense de Nebraska. En el Censo de 2010 tenía una población de 8491 habs. y una densidad poblacional de 694 hab/km².​"},{"page_url":"https://en.wikipedia.org/wiki/Vaccine","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Agile_Pulse_In_Vivo.jpg","page_title":"Vaccine","context_page_description":"A vaccine is a biological preparation that provides active acquired immunity to a particular infectious disease. A vaccine typically contains an agent that resembles a disease-causing microorganism and is often made from weakened or killed forms of the microbe, its toxins, or one of its surface proteins. The agent stimulates the body's immune system to recognize the agent as a threat, destroy it, and to further recognize and destroy any of the microorganisms associated with that agent that it may encounter in the future. Vaccines can be prophylactic, or therapeutic.\\nThe administration of vaccines is called vaccination. Vaccination is the most effective method of preventing infectious diseases; widespread immunity due to vaccination is largely responsible for the worldwide eradication of smallpox and the restriction of diseases such as polio, measles, and tetanus from much of the world. The effectiveness of vaccination has been widely studied and verified; for example, vaccines that have proven effective include the influenza vaccine, the HPV vaccine, and the chicken pox vaccine."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%A8%E0%AE%BE%E0%AE%9F%E0%AF%8D%E0%AE%9F%E0%AE%BF%E0%AE%A9%E0%AF%8D_%E0%AE%A4%E0%AF%8B%E0%AE%B2%E0%AF%8D%E0%AE%B5%E0%AE%BF_%E0%AE%9A%E0%AF%81%E0%AE%9F%E0%AF%8D%E0%AE%9F%E0%AF%86%E0%AE%A3%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Failed_state_index_2013.svg","page_title":"நாட்டின் தோல்வி சுட்டெண்","context_page_description":"2005 ஆம் ஆண்டில் இருந்து அமெரிக்காவின் சமாதனத்திற்கான நிதி என்ற அமைப்பும் வெளிநாட்டுக் கொள்கை பத்திரிக்கையும் இணைந்து 12 அம்சங்களை அடிப்படையாக கொண்ட தோல்வி சுட்டெண் என்னும் எண்ணை வெளியிடுகின்றன.\\nஅந்த 12 அம்சங்களாவன\\nசமூக சுட்டெண்\\nமக்கள் தொகை அழுத்தம்\\nஇடம்பெயர்ந்த உள்நாட்டுமக்கள் மற்றும் அகதிகள் நடமாட்டம்\\nபழிவாங்கும் எண்ணம்\\nதொடர்ச்சியான ஒய்வற்ற கலவரம்\\nபொருளாதார சுட்டெண்\\nசீரற்ற பொருளாதார வளர்ச்சி\\nஏழ்மை மற்றும் கடுமையான பொருளாதார சரிவு\\nஅரசியல் சுட்டெண்\\nஅரசின் சட்ட வகையில் அமைந்துள்ள நிலை\\nஅதிகரிக்கும் பொது சொத்துகளின் சேதம்\\nமனித உரிமைகள் மீறல் மற்றும் சட்ட ஒழுங்கு\\nநாட்டின் இறையான்மைக்கு ஊறு விளைவிக்கும் இராணுவம் மற்றும் வேறு அமைப்புகள்\\nநாட்டின் ஆட்சியாளர்கழுக்கு அடங்காத அரசியல் அமைப்புகள்\\nஅன்னிய நாடுகளின் தலையிடு"},{"page_url":"https://fr.wikipedia.org/wiki/Acide_3-ur%C3%A9idoisobutyrique","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Beta-ureidoisobutyric_acid.png","page_title":"Acide 3-uréidoisobutyrique","context_page_description":"L’acide 3-uréidoisobutyrique, également appelé acide β-uréidoisobutyrique, est un intermédiaire métabolique de la dégradation de la thymine. Chez l'humain, elle s'accumule dans l'urine des patients souffrant d'un déficit en bêta-uréidopropionase, ce qui permet de dépister les anomalies dans le métabolisme des pyrimidines et prévenir l'usage du 5-fluorouracile comme néoplasique lorsqu'il pourrait s'avérer gravement toxique pour l'organisme."},{"page_url":"https://sv.wikipedia.org/wiki/Svartbukig_flygh%C3%B6na","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Pterocles_orientalis_1921.jpg","page_title":"Svartbukig flyghöna","context_page_description":"Svartbukig flyghöna är en fågel i familjen flyghöns inom ordningen flyghönsfåglar."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AD%E0%A4%97%E0%A4%B5%E0%A4%82%E0%A4%A4_%E0%A4%AE%E0%A4%BE%E0%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Bhagwant.jpg","page_title":"भगवंत मान","context_page_description":"भगवंत मान पंजाब के एक प्रसिद्ध हास्य कलाकार हैं। वे पंजाब के ही संगरूर लोक सभा निर्वाचन क्षेत्र से सत्रहवीं लोकसभा के निर्वाचित सदस्य हैं। इसके पूर्व वे सोलहवीं लोकसभा में भी इसी क्षेत्र से २०१४ के चुनाव में चुने गए थे। वे आम आदमी पार्टी के सदस्य हैं। अपने राजनीतिक करियर की शुरुआत उन्होंने मनप्रीत सिंह बादल की पार्टी पंजाब पीपल्स पार्टी से की, लेकिन बाद में मनप्रीत काँग्रेस में शामिल हो गए तथा भगवंत आम आदमी पार्टी में आ गए।"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_2002/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Ambassador_Vernon_A._Walters.jpg","page_title":"Lijst van personen overleden in 2002/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 2002.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://eo.wikipedia.org/wiki/Brian_Mulroney","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Brian_Mulroney_2011.jpg","page_title":"Brian Mulroney","context_page_description":"Martin Brian MULRONEY, PK, KK, NOK, LLD estis la dekoka Ĉefministro de Kanado de la 17-a de septembro 1984 ĝis la 25-a de junio 1993 kaj estro de la Progresisma Konservativa Partio de Kanado de 1983 ĝis 1993. Laŭ kanada kutimo, kiel iama Ĉefministro, li portas la titolon \\"La Tre Honorinda\\" dumvive.\\nMulroney fariĝis ĉefministro post kiam liaj Progresismaj Konservativuloj gajnis la pli grandan kvanton de parlamentaj sidlokoj iam ajn en kanada historio. Tiam Mulroney estis unikaĵo en la kanada politiko, ĉar li antaŭe ne estis politikisto, sed longtempa komercisto, kaj li fariĝis estro de la Progresisma Konservativa Partio sen antaŭe iam ajn elektiĝi al publika posteno."},{"page_url":"https://gl.wikipedia.org/wiki/Idomeneo,_re_di_Creta","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Idomeneo_frontespizi.JPG","page_title":"Idomeneo, re di Creta","context_page_description":"Idomeneo, re di Creta é unha ópera en tres actos con música de Wolfgang Amadeus Mozart e libreto en italiano de Giambattista Varesco, segundo un texto en francés de Antoine Danchet ao que puxo música André Campra como Idoménée en 1712. Carlos Teodoro, elector de Baviera, fíxolles o encargo a Mozart e Varesco en 1780 para un carnaval de corte. Probablemente elixiu o tema, aínda que puido ter sido Mozart. Foi estreada o 29 de xaneiro de 1781 no Cuvilliés-Theater de München baixo a dirección do propio compositor."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BA%9A%E4%BC%AF%E6%8B%89%E7%BD%95%C2%B7%E5%A5%A5%E7%89%B9%E6%9F%B3%E6%96%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/1580_Zelandicarum_v_Deventer.jpg","page_title":"亚伯拉罕·奥特柳斯","context_page_description":"亚伯拉罕·奥特柳斯是一名佛兰芒地图学家和地理学家，是史上第一本世界地图册的制图人。"},{"page_url":"https://uz.wikipedia.org/wiki/Yerevan","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Yerevan%27s_Covered_Market_interior.jpg","page_title":"Yerevan","context_page_description":"Yerevan — Armaniston Respublikasi poytaxti. Armanistonning maʼmuriy, madaniy va ilmiy markazi. Ararat tekisligining shimoliy chekkasida, Razdan daryosi boʻyida. Iqlimi keskin kontinental. Yozi quruq va issiq, qishi qisqa, sovuq. Avgustning oʻrtacha tempaturasi 24,8°, yanvar niki —4,2°. Yiliga 320–350 mm yogʻin yogʻadi. Aholisi 1249 ming kishi. Arxeologik qazishlarda topilgan mixxatli tosh boʻlagidan maʼlum boʻlishicha, Urartu podshosi Argishti I mil. av. 782 yilda Erebuni qalʼasini qurdirgan. Oʻsha qalʼa yonida hoz. Yerevan vujudga kelgan. 13-asr oʻrtalaridan siyosiy va iqtisodiy mavqei orta borgan. 1604 yil Yerevanni Eron shohi Abbos I qoʻshinlari egallaganidan keyin shahar Yerevan xonligining markaziga aylandi. 17-asrda Yerevan yirik karvon savdosi va hunarmandchilik markazlaridan biri. Rossiya-Eron urushi dan soʻng Ye.ni 1827 yil 1 oktabrda rus qoʻshinlari egalladi va Turkmanchoy shartnomasi ga binoan Ye. Rossiyaga oʻtdi. 1828—40 yillarda Yerevan Armaniston viloyati markazi, soʻng uyezd shahri, 1849 yildan Erivan gubernyasi markazi. Ye.ning Aleksandropol temir yo'l orqali Tbilisi va Julfa bilan bogʻlanishi shaharning iqtisodiy jihatdan rivojlanishiga olib keldi."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Ben_Hill_County,_Georgia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Ben_Hill_County_Courthouse.jpg","page_title":"National Register of Historic Places listings in Ben Hill County, Georgia","context_page_description":null},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A8%E3%83%83%E3%83%95%E3%82%A7%E3%83%AB%E5%A1%94%E3%81%AE%E3%83%AC%E3%83%97%E3%83%AA%E3%82%AB%E3%81%A8%E6%B4%BE%E7%94%9F%E4%BD%9C%E5%93%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Epcot_-_France_pavilion_-_by_ckramer.jpg","page_title":"エッフェル塔のレプリカと派生作品","context_page_description":"本項では、エッフェル塔のレプリカと派生作品を取り上げる。エッフェル塔は、最も象徴的かつ著名な建造物の一つであり、世界中の50以上の塔の建造に影響を与えてきた。"},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Rocky_Mountain_National_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Timberline_Cabin%2C_RMNP.jpg","page_title":"National Register of Historic Places listings in Rocky Mountain National Park","context_page_description":"This is a complete list of the properties and districts on the National Register of Historic Places in Rocky Mountain National Park, Colorado, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in a Google map.\\nThere are 48 properties and districts listed on the National Register in the park, one of which is a National Historic Landmark.\\nThis National Park Service list is complete through NPS recent listings posted August 21, 2020."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B2%D0%B5%D1%82%D0%B8%D1%81%D1%8F%D0%BD,_%D0%90%D1%80%D1%81%D0%B5%D0%BD_%D0%90%D0%BB%D1%8C%D0%B1%D0%B5%D1%80%D1%82%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/M%C3%A4yr%C3%A4koirapatsas_Terijoella.jpg","page_title":"Аветисян, Арсен Альбертович","context_page_description":"Арсе́н Альбе́ртович Аветися́н — армянский и российский скульптор. Член Союза художников России, член Союза художников Армении, член Международной федерации художников ЮНЕСКО."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_M%C3%BCnster","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/%28D.%29%2C_Wilhelm.jpg","page_title":"Liste der Stolpersteine in Münster","context_page_description":"Die Liste der Stolpersteine in Münster enthält die z. Z. etwa 270 Stolpersteine, die im Rahmen des gleichnamigen Kunstprojekts von Gunter Demnig in Münster verlegt wurden. Mit ihnen soll Opfern des Nationalsozialismus gedacht werden, die in Münster lebten und wirkten."},{"page_url":"https://en.wikipedia.org/wiki/Red_Hawk_cheese","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Cowgirl_Creamery_Point_Reyes_-_Red_Hawk_cheese.jpg","page_title":"Red Hawk cheese","context_page_description":"Red Hawk is a type of American triple-crème aged cow's-milk cheese with a brine-washed rind produced by the Cowgirl Creamery in Point Reyes Station, California. The brine wash encourages the development of the red-orange rind and the cheese was named after red-tailed hawks that are frequently seen around the Point Reyes Station."},{"page_url":"https://da.wikipedia.org/wiki/Narsarsuaq_Lufthavn","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Narsarsuaq-airport-terminal-from-tarmac.jpg","page_title":"Narsarsuaq Lufthavn","context_page_description":"Narsarsuaq Lufthavn er en grønlandsk lufthavn beliggende i Narsarsuaq med en betonlandingsbane på 1830 m x 45 m. I 2008 var der 33.491 afrejsende passagerer fra flyvepladsen fordelt på 3.275 starter.\\nNarsarsuaq Lufthavn drives af Mittarfeqarfiit, Grønlands Lufthavnsvæsen. Trafikstyrelsen fører tilsyn med flyvepladsen."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%8B%B1%E5%9B%BD%E4%B8%8B%E8%AE%AE%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Gavin_Wiliamson_-_2010.JPG","page_title":"英国下议院","context_page_description":"英國下議院，直譯為平民院或庶民院，是英國國會的下議院。\\n英國國會由三大部份組成，它們分別是君主、作為上院的上議院，以及作為下院的下議院，當中又以下議院最具影響力。下議院是一個透過民主選舉產生的機構，目前內有650名成員，稱為國會議員，常用的英文簡寫則是「MP」。下議院議員是經由多數制選出，國會每屆不可長於5年，5年之內就要宣布解散，而國會解散之時，也就是下議院議員任期的終結。自1950年來每一位下議院議員都是由一個選區的選民選出，議員當選後，也就在議會代表該選區。現今聯合王國政府的內閣閣臣，絕大部份皆來自下院，而自1902年起，歷任的首相也同樣是下議院議員。惟在1963年的時候，來自上議院的亞歷克·道格拉斯-休姆伯爵獲任命為英國首相，不過，他在任命後不久，即放棄貴族爵位，並成功以亞歷克·道格拉斯-休姆爵士之身份選入下議院。\\n下議院大約在14世紀出現，並且一直延續至今。在歷史上，下議院的權力曾遠遜於上議院，時至今日，下議院在兩院中佔主導地位。現時下議院的立法權力能夠超越上議院，而根據《1911年國會法令》，上院駁回大部份法案的權力被削減為僅僅拖延法案通過。此外，英國政府亦需要向下議院負責，首相如果失去下議院的支持，就要下野。\\n下議院之官式全稱為「尊貴的與會大不列顛及北愛爾蘭聯合王國下議院議員」。坊間一直以為，下議院的英文「House of Commons」中，「Commons」一字乃來自英文「commoners」，反映下議院議員盡皆庶民出身，以區別由貴族所掌的上議院。不過，這種解釋背後沒有史實支持，其實「Commons」一字語出諾曼法語的「communes」，意指議員們所代表的地區，具地理意味。上、下兩議院皆設於倫敦西敏市西敏宮內，而每次會議時，議事廳內必置有一權杖，以彰顯王權。\\n下議院的有關資料現存放於下議院圖書館。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%AC%AC108%E5%B1%8A%E7%BE%8E%E5%9B%BD%E5%9B%BD%E4%BC%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/US_Senate_Session_Chamber.jpg","page_title":"第108届美国国会","context_page_description":"第108屆美國國會的任期從2003年1月3日至2005年1月3日。2002年美國中期選舉決定了該屆國會的人員組成。共和黨在參議院與眾議院皆為多數黨。"},{"page_url":"https://vi.wikipedia.org/wiki/La_Bamba_(b%C3%A0i_h%C3%A1t)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Ritchie_Valens_%C4%91ang_bi%E1%BB%83u_di%E1%BB%85n_b%E1%BA%A3n_La_bamba.png","page_title":"La Bamba (bài hát)","context_page_description":"La Bamba là một bài hát dân gian Mexico, đến từ bang Veracruz, được biết đến nhiều nhất từ ​​năm 1958 bởi Ritchie Valens, và là một trong những bài hát hay nhất trong 40 bản hit hàng đầu của bảng xếp hạng âm nhạc Mỹ. Phiên bản \\"La Bamba\\" của Valens được xếp hạng 354 trong danh sách 500 bài hát vĩ đại nhất mọi thời đại của tạp chí Rolling Stone. Đây là bài hát duy nhất trong danh sách được hát bằng một ngôn ngữ khác ngoài tiếng Anh.\\nLa Bamba đã được thể hiện bởi rất nhiều nghệ sĩ, nổi bật nhất là Los Lobos, phiên bản là ca khúc chủ đề của bộ phim năm 1987: La Bamba và vươn tới vị trí số 1 trong bảng xếp hạng single của Mỹ và Anh trong cùng năm. Phiên bản của Los Lobos vẫn giữ vị trí số 1 trong ba tuần vào mùa hè năm 1987. Video âm nhạc của phiên bản Los Lobos, đạo diễn bởi Sherman Halsey, đã giành giải MTV Video Music Award năm 1988 cho Video âm nhạc hay nhất từ ​​một bộ phim."},{"page_url":"https://az.wikipedia.org/wiki/%C6%8Fsginas","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/100_manat_obv.jpg","page_title":"Əsginas","context_page_description":"Əsginas — dördbucaqlı kağız, xüsusi qalın parça, əsasən ipək, metal və plastik materialdan hazırlanan pul vahidi;\\nMilli valyuta əsginaslar hər ölkənin mərkəzi bankı tərəfindən buraxılır və de-yure bütün ölkə ərazisində ödəniş vasitəsi kimi qəbul edilməyə məcburidir."},{"page_url":"https://hu.wikipedia.org/wiki/TER_Picardie","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/GARE_APPILLY.jpg","page_title":"TER Picardie","context_page_description":"A TER Picardie egy regionális vasúthálózat Franciaországban, Pikárdia régióban."},{"page_url":"https://en.wikipedia.org/wiki/Robert_S._Wyer","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Wyer.jpg","page_title":"Robert S. Wyer","context_page_description":"Robert S. Wyer Jr. is a visiting professor at the University of Cincinnati and Professor at the University of Illinois, Urbana-Champaign. He received his doctoral degree from the University of Colorado. His research interests cut across numerous areas of social information processing, including knowledge accessibility, comprehension, memory, social inference, the impact of affect on judgment and decisions, attitude formation and change, and consumer judgment and decision making."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%87%E0%B4%A8%E0%B5%8D%E0%B4%A4%E0%B5%8D%E0%B4%AF%E0%B5%BB_%E0%B4%AF%E0%B5%82%E0%B4%A4%E0%B5%8D%E0%B4%A4%E0%B5%8D_%E0%B4%95%E0%B5%8B%E0%B5%BA%E0%B4%97%E0%B5%8D%E0%B4%B0%E0%B4%B8%E0%B5%8D%E0%B4%B8%E0%B5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Indian_Youth_Congress_Logo.jpg","page_title":"ഇന്ത്യൻ യൂത്ത് കോൺഗ്രസ്സ്","context_page_description":"ഇന്ത്യൻ നാഷണൽ കോൺഗ്രസ്സിന്റെ യുവജന വിഭാഗമാണ് യൂത്ത് കോൺഗ്രസ്സ്. 2013 ലെ കണക്കനുസരിച്ച് ഇന്ത്യയിലാകമാനം 79,40,401 ത്തിൽ കൂടുതൽ അംഗങ്ങൾ ഉണ്ട്.\\nനാരായൺ ദത്ത് തിവാരിയാണ്‌ 1969-ൽ യൂത്ത് കോൺഗ്രസ്സിന്റെ ആദ്യ പ്രസിഡന്റായത്.യൂത്ത് കോൺഗ്രസ് ദേശീയ അദ്ധ്യക്ഷനായ ഏക മലയാളി രമേശ് ചെന്നിത്തലയാണ്, പ്രിയരഞ്ജൻ ദാസ് മുൻഷിയായിരുന്നു ആദ്യത്തെ തിരഞ്ഞെടുക്കപ്പെട്ട പ്രസിഡന്റ്. അശോക് തൻവർ പ്രസിഡന്റായതിനു ശേഷം രാജിവ് സത്വവയാണ ഇപ്പൊൾ പ്രസിഡന്റ്."},{"page_url":"https://en.wikipedia.org/wiki/Elizabeth_Charlotte,_Madame_Palatine","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Arms_of_%C3%89lisabeth_Charlotte_of_the_Palatinate%2C_Princess_Palatine_as_Duchess_of_Orl%C3%A9ans.png","page_title":"Elizabeth Charlotte, Madame Palatine","context_page_description":"Princess Elisabeth Charlotte, was a German princess member of the House of Wittelsbach and, as Madame, the second wife of Philippe I, Duke of Orléans and mother of Philippe II, Duke of Orléans, France's ruler during the Regency. She gained literary and historical importance primarily through her correspondence, which is of cultural and historical value due to her sometimes very blunt descriptions of French court life and is today one of the best-known German-language texts of the Baroque period.\\nAlthough she only had two surviving children, she not only became the ancestress of the House of Orléans, which came to the French throne with Louis Philippe I, the so-called \\"Citizen King\\" from 1830 to 1848, but also became the ancestress of numerous European royal families, so she was also called the “Grandmother of Europe”. Through her daughter she was the grandmother of Francis I, Holy Roman Emperor, the husband of Maria Theresa, and great-grandmother of Joseph II and Leopold II and Marie Antoinette, the last Queen of France before the French Revolution."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Yurivka_Ko%C4%81n","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Yurivskiy_rayon_prapor.png","page_title":"Yurivka Koān","context_page_description":"Yurivka Koān sī Ukraina Dnipropetrovsk Chiu ê chi̍t ê koān."},{"page_url":"https://de.wikipedia.org/wiki/Tapo_(Berg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Rocks_on_Mt_Tapo.jpg","page_title":"Tapo (Berg)","context_page_description":"Der Tapo ist ein Berg in Osttimor. Er ist mit 1934 m der höchste Berg der Gemeinde Bobonaro. Der Tapo liegt im Westen des Sucos Leber, nahe der Grenze zum Suco Tapo."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BD%D1%81%D0%B5%D1%80%D0%B2%D0%B0%D1%82%D0%BE%D1%80%D0%B8%D1%8F_(%D0%A7%D0%B8%D0%BB%D0%B8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Aldunate-et-alia.jpg","page_title":"Национальная консерватория (Чили)","context_page_description":"Национальная консерватория — музыкальное учебное заведение, действовавшее в Чили в 1850—1968 гг. Располагалась в Сантьяго.\\nИнициатива создания консерватории принадлежала политику и любителю искусств Педро Паласуэлосу, которого убедил в целесообразности такого шага прибывший из Франции органист и музыкальный педагог Адольф Дежарден. 17 июня 1850 года манифест об учреждении консерватории подписал президент страны Мануэль Бульнес. Дежарден стал первым директором, почётным президентом была назначена певица Исидора Сегерс. Занятия в консерватории проходили три дня в неделю и были бесплатными, первоначально обучали только вокалу и игре на нескольких инструментах, курс гармонии и контрапункта был введён в 1877 году.\\nНа исходе 1880-х гг. директор консерватории Мойсес Алькальде, пользуясь тесными дружескими отношениями с министром просвещения Баньядосом Эспиносой, добился значительного повышения престижа консерватории. В 1889 году при участии президента Бальмаседы был торжественно открыт концертный зал консерватории."},{"page_url":"https://ro.wikipedia.org/wiki/Imperiul_Mongol","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Teg%C3%BCder_recevant_une_ambassade.jpeg","page_title":"Imperiul Mongol","context_page_description":"Imperiul Mongol, care s-a menținut între secolele XIII-XIV, a fost cel mai mare imperiu terestru din istorie. Expansiunea a pornit din stepele Asiei centrale, întinzându-se din Europa centrală și Levant până în Marea Japoniei și Siberia spre est, și în sud până în Indochina.\\nImperiul a fost format prin unificarea triburilor mongole și turcice, sub conducerea lui Genghis Khan, care s-a proclamat conducătorul tuturor mongolilor în 1206. Imperiul s-a extins rapid sub conducerea lui, iar sub succesorii săi, imperiul s-a extins pe diferite direcții, formând un vast imperiu transcontinental conectat la est de vest. Pax Mongolica permitea comerțul, tehnologiile, produsele de bazǎ și difuzarea ideologiilor în Eurasia.\\nCuceririle mongole au dus la cele mai sângeroase și distrugătoare războaie din istoria omenirii, de pe urma cărora au pierit 80 de milioane de oameni doar în subcontinentul indian. În Persia, exterminările, bolile și distrugerea irigațiilor au dus la emigrări în masă și foamete, ce a dus la un declin drastic al populației. Aproximativ 10-15 milioane de oameni au murit în Iran."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%AF%D0%BF%D0%BE%D0%BD%D1%81%D1%8C%D0%BA%D0%B0_%D0%B2%D0%B8%D1%88%D0%BD%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Sakura_MtHiei.jpg","page_title":"Японська вишня","context_page_description":"Япо́нська ви́шня, або са́кура — загальна назва декоративних дерев підроду вишень. Зазвичай позначає вишню дрібнопилчасту, що не плодоносять. В японській мові словом «сакура» позначають будь-яку вишню взагалі."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%97%90%ED%88%AC%EC%95%8C_%EA%B0%9C%EC%84%A0%EB%AC%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Le_D%C3%A9part_des_Volontaires_%28La_Marseillaise%29_par_Rude%2C_Arc_de_Triomphe_Etoile_Paris.jpg","page_title":"에투알 개선문","context_page_description":"에투알 개선문은 프랑스 파리 샹젤리제 거리의 서쪽 끝, 샤를 드골 광장 한복판에 위치한 거대한 개선문이다. 개선문의 위치는 총 3개의 아롱디스망에 걸쳐있는데, 남서쪽으로 16구, 북쪽으로 17구, 동쪽으로 8구가 자리하고 있다. 에투알 개선문은 프랑스 혁명과 나폴레옹 전쟁에서 죽은 전사자들을 기리기 위하여 세워졌으며, 개선문 아래에는 당시 전쟁에서 프랑스가 거둔 모든 승전보들과 지휘관들의 이름이 양각되어있다. 개선문 아래에는 제 1차 세계 대전에서 죽은 이들을 기리는 무명용사들의 무덤이 위치하여 있다.\\n에투알 개선문은 1806년에 건축가 장 샬그랭에 의하여 처음 설계되었으며, 군중들에게 최대한 애국심을 끓어오르게 하기 위하여 장대하고 우아한 신고전주의를 채택하여 개선문의 모양을 만들었다. 에투알 개선문은 로마의 티투스 개선문을 본따 지었으며, 그 높이는 약 50m, 너비는 약 45m, 그 깊이는 22m이다. 1919년에 제 1차 세계대전이 종전되고 약 3주 후 개선 퍼레이드를 벌일 때, 비행사 찰스 고드프로이가 자신의 비행기를 몰아 개선문의 아치를 통과하여 화제가 된 일이 있었다.\\n파리의 에투알 개선문은 멕시코시티에 개선문이 약 67m의 높이로 세워지기 전까지 세계에서 가장 높은 개선문이었으며, 1982년에 완공된 평양 개선문은 에투알 개선문의 모습을 본땄으며 그 높이는 60m로 에투알 개선문보다 약간 더 높다. 이후 파리에 세워진 신개선문은 약 110m의 높이이고, 프랑스어로 '개선문'이라는 뜻은 없지만 에투알 개선문과 거의 비슷한 용도로 설계되었다는 점에서 개선문이라고 불린다. 이는 세계에서 가장 거대한 아치 구조물이다. 개선문의 바로 아래에는 무명용사의 무덤이 있는데 사계절 등불이 꺼지는 일이 없고 헌화가 시드는 일이 없다."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_kulturminner_i_Halden","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Jellhaugen_grave_mound%2C_Halden.jpg","page_title":"Liste over kulturminner i Halden","context_page_description":"Liste over kulturminner i Halden er en oversikt over fredede og/eller bevaringsverdige bygninger og elementer i Halden. Data er hentet fra Riksantikvarens liste over kulturminner.\\nID-nummer består av et lenket tall som går direkte til det aktuelle kulturminnet i Kulturminnesøk."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%9D%99%E5%B2%A1%E5%A4%A7%E5%AD%A6%E6%95%99%E8%82%B2%E5%AD%A6%E9%83%A8%E9%99%84%E5%B1%9E%E5%B3%B6%E7%94%B0%E4%B8%AD%E5%AD%A6%E6%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/%E9%9D%99%E5%B2%A1%E5%A4%A7%E5%AD%A6%E6%95%99%E8%82%B2%E5%AD%A6%E9%83%A8%E9%99%84%E5%B1%9E%E5%B3%B6%E7%94%B0%E4%B8%AD%E5%AD%A6%E6%A0%A1%E6%AD%A6%E9%81%93%E9%A4%A8%28%E3%82%86%E3%81%86%E3%81%8B%E3%82%8A%E9%A4%A8%29.JPG","page_title":"静岡大学教育学部附属島田中学校","context_page_description":"静岡大学教育学部附属島田中学校は、静岡大学教育学部の附属中学校の3校のうちの一つ。静岡県島田市中河町169に所在する。\\n生徒定員は一学年120人であったが、平成30年度入学者選考から108人に縮小された。島田市立島田第二中学校と道を挟んで隣接する。"},{"page_url":"https://cy.wikipedia.org/wiki/Mynachdy_San_Lourenzo_de_Carboeiro","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Mural_at_Saint_Lawrence_Monastery_in_Carboeiro%2C_Silleda_%28Galicia%2C_Spain%29-3.JPG","page_title":"Mynachdy San Lourenzo de Carboeiro","context_page_description":"Mynachdy San Lourenzo de Carboeiro yw un o adeialdau pwysicaf o ran ei bensaerniaeth Romanesque yng Ngalisia sy'n un o wledydd ymreolaethol Sbaen. Fe'i lleolwyd ger Afon Deza yn Carboeiro, Silleda, Rhanbarth Pontevedra. Meudwy o'r enw Egica oedd perchennog y tir ac fe'i gwerthodd cyn 939 i Doña Tareixa Eiriz a Don Gonzalo Betote, ieirll o Deza.\\nRoedd y mynachdy'n perthyn i Urdd Sant Bened a gellir ei olrhain yn ôl i'r 10g. Roedd yn ei anterth rhwng y 11fed a'r 12g ac mae heddiw'n dal i fod mewn cyflwr da yn dilyn gwaith adfer yn ail hanner yr 20g. Yn 2015 roedd y gwaith o gynnal a chadw'r adeilad wedi ailddechrau. Saif y trefi Vigo 101 Km i ffwrdd, gyda Pontevedra 75 Km, Ourense 76 Km a Santiago de Compostela 38 Km.\\nCeir tair ystlys gyda phedwearedd ar hyd y groesfa. Ceir pedair colofn o bopty'r fynedfa fwaog, garreg - sy'n frith o gerfiadau o gymeriadau allan o Lyfr y Datguddiad - pencampwaith o gelfyddyd yn ôl y pensaeri \\"heb ei debyg yn unman arall\\". Fodd bynnag mae'r fynedfa i Portal of La Gloria, sydd yn eithaf agos, yr un mor gywrain."},{"page_url":"https://en.wikipedia.org/wiki/Capping_enzyme","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/PDB_1ckm_EBI.jpg","page_title":"Capping enzyme","context_page_description":"A capping enzyme is an enzyme that catalyzes the attachment of the 5' cap to messenger RNA molecules that are in the process of being synthesized in the cell nucleus during the first stages of gene expression. The addition of the cap occurs co-transcriptionally, after the growing RNA molecule contains as little as 25 nucleotides. The enzymatic reaction is catalyzed specifically by the phosphorylated carboxyl-terminal domain of RNA polymerase II. The 5' cap is therefore specific to RNAs synthesized by this polymerase rather than those synthesized by RNA polymerase I or RNA polymerase III. Pre-mRNA undergoes a series of modifications - 5' capping, splicing and 3' polyadenylation before becoming mature mRNA that exits the nucleus to be translated into functional proteins and capping of the 5' end is the first of these modifications. Three enzymes, RNA triphosphatase, guanylyltransferase, and methyltransferase are involved in the addition of the methylated 5' cap to the mRNA."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Sendling","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Am_Harras_12.jpg","page_title":"Liste der Baudenkmäler in Sendling","context_page_description":"Auf dieser Seite sind die Baudenkmäler im Münchner Stadtteil Sendling im gleichnamigen Stadtbezirk 6 aufgelistet. Zu diesen Baudenkmälern gibt es auch eine Bildersammlung und ein Fotoalbum mit ausgewählten Bildern.\\nDiese Liste ist Teil der Liste der Baudenkmäler in München. Grundlage ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt und aktualisiert wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://de.wikipedia.org/wiki/Eurovision_Song_Contest_2008","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Flickr_-_proteusbcn_-_Final_Eurovision_2008_%2863%29.jpg","page_title":"Eurovision Song Contest 2008","context_page_description":"Der 53. Eurovision Song Contest fand am 20., 22. und 24. Mai 2008 unter dem Motto „Confluence of Sound“ in der Belgrad-Arena mit Begleitveranstaltungen im Sava Center in Belgrad statt. Sieger wurde der russische Beitrag Believe von Dima Bilan.\\nFür Deutschland erreichten die No Angels mit Disappear im Finale den 23. Platz vor den punktgleichen Schlusslichtern Polen und dem Vereinigten Königreich. Der schweizerische Beitrag Era stupendo von Paolo Meneguzzi qualifizierte sich nicht für das Finale, während Österreich im Vorfeld der Veranstaltung seine Teilnahme zurückgezogen hatte."},{"page_url":"https://fr.wikipedia.org/wiki/Garrha_limbata","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Garrha_limbata.jpg","page_title":"Garrha limbata","context_page_description":"Garrha limbata est une espèce d'insectes lépidoptères de la famille des Oecophoridae.\\nOn le trouve en Australie."},{"page_url":"https://nl.wikipedia.org/wiki/Pink_Floyd","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Pink_Floyd_%281989%29.jpg","page_title":"Pink Floyd","context_page_description":"Pink Floyd was een Engelse rockband die internationale erkenning kreeg voor zijn progressieve psychedelische rockmuziek. De groep evolueerde tot pioniers van de progressieve rock en symfonische muziek. Pink Floyd is bekend door zijn filosofische songteksten, klassieke rockcomposities, experimenten met geluid, grafisch en artistiek vernieuwende hoesontwerpen en niet in de laatste plaats door vele spectaculaire live-concerten.\\nAls een van de meest succesvolle en invloedrijke bands in de rockmuziek verkocht Pink Floyd wereldwijd meer dan 300 miljoen albums.Syd Barrett, Roger Waters en het latere bandlid David Gilmour kenden elkaar van school in Cambridge, terwijl de overige leden Mason en Wright samen met Roger Waters architectuur studeerden aan het Polytechnic in Regent Street in Londen.\\nPink Floyd had in de late jaren 60 aanvankelijk bescheiden succes als een psychedelische band die destijds nog geleid werd door Syd Barrett. Barretts toenemende onbetrouwbaarheid en zijn moeizame gedrag dwongen de overige bandleden om een nieuwe gitarist en leadzanger toe te voegen. Dat werd David Gilmour, die Syd Barrett later helemaal zou vervangen."},{"page_url":"https://it.wikipedia.org/wiki/Falconara_Albanese","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Chiesa_della_Madonna_del_Buon_Consiglio.JPG","page_title":"Falconara Albanese","context_page_description":"Falconara Albanese è un comune italiano di 1 447 abitanti della provincia di Cosenza in Calabria."},{"page_url":"https://fr.wikipedia.org/wiki/Maison,_19_place_Sainte-Anne_(Rennes)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Rennes_19placeSainte-Anne-03.jpg","page_title":"Maison, 19 place Sainte-Anne (Rennes)","context_page_description":"La maison située au 19 place Sainte-Anne est un édifice de la commune de Rennes, dans le département d’Ille-et-Vilaine en région Bretagne."},{"page_url":"https://en.wikipedia.org/wiki/2013_Grand_Rapids_flood","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Fish_Ladder_Grand_Rapids_2013_flood.JPG","page_title":"2013 Grand Rapids flood","context_page_description":"The 2013 Grand Rapids flood lasted from April 12 to 25, 2013, affecting multiple areas in the Grand Rapids metropolitan area. Sudden heavy rainfall, saturation of the ground from rainwater and the flow of tributaries caused the Grand River to rise dramatically, with the river cresting at 21.85 feet in Grand Rapids on April 21, 2013. The flooding caused thousands of residents in the area to evacuate their homes."},{"page_url":"https://fr.wikipedia.org/wiki/Pelagothuria_natatrix","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Pelagothuria_natatrix_%28cropped%29.png","page_title":"Pelagothuria natatrix","context_page_description":"Pelagothuria natatrix, unique représentant du genre Pelagothuria, est une espèce d'holothuries abyssales de l'ordre des Elasipodida. Cette holothurie est remarquable car elle vit en nageant en pleine eau, à la manière des méduses avec lesquelles elle partage de nombreuses caractéristiques.\\nSon corps est ainsi translucide et surmonté par une ombrelle constituée de tentacules modifiés et unis par un voile. Vivant à très grande profondeur, elle semble se nourrir essentiellement de plancton. Cette espèce, à la répartition probablement cosmopolite, demeure cependant très rarement observée : elle n'a pu être observée in situ qu'à quelques occasions seulement, près de cent ans après sa découverte."},{"page_url":"https://pl.wikipedia.org/wiki/Mera-Poltik_MDG-1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Plotter_Mera_Poltik_MDG-1_Block_Diagram_PL.png","page_title":"Mera-Poltik MDG-1","context_page_description":"Mera–Poltik MDG–1 to ploter formatu A4 produkowany pod koniec lat 80 XX wieku przez Zakłady Mechanizmów Precyzyjnych Mera-Poltik w Łodzi. Urządzenie zostało stworzone przy współpracy Instytutu Systemów Sterowania w Katowicach.\\nPloter był prezentowany w roku 1988 na targach Infosystem ‘88 a w roku 1989 na targach w Lipsku. W roku 1988 planowano wyprodukować 2000 sztuk. Nieznaną liczbę wyeksportowano do ZSRR.\\nPod względem funkcjonalnym podobny do innych ploterów opartych na mechanizmach ALPS jak: Sharp CE–515P, Sony PRN–C41 oraz Atari 1020, Commodore 1520 i innych."},{"page_url":"https://pl.wikipedia.org/wiki/Angielskie_kr%C3%B3lowe","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Catherine_of_Braganza_-_Lely_1663-65.jpg","page_title":"Angielskie królowe","context_page_description":"Królowe Anglii – jest to chronologiczny spis żon władców angielskich; wszystkich koronowanych lub też jedynie używających tytułu królewskiego. W nawiasach podane są ich daty życia i śmierci, obok podane jest również imię ich królewskiego małżonka."},{"page_url":"https://es.wikipedia.org/wiki/Palacio_de_Friedenstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Friedensteinthronsaal.jpg","page_title":"Palacio de Friedenstein","context_page_description":"El palacio de Friedenstein es un antiguo palacio barroco alemán construido a mediados del siglo XVII por Ernesto I, duque de Sajonia-Gotha en la ciudad de Gotha. En Alemania, Friedenstein fue uno de los palacios más grandes de su tiempo y uno de los primeros palacios barrocos jamás construidos. Friedenstein sirvió como la sede principal de los duques de Sajonia-Gotha y más tarde como una de las residencias de los duques de Sajonia-Coburgo y Gotha, estrechamente vinculada con la familia real de Gran Bretaña a través del matrimonio de la reina Victoria y el príncipe Alberto. Los dos últimos duques gobernantes fueron ambos príncipes del Reino Unido.\\nEl complejo del palacio hoy alberga varios museos. También es notable por albergar el Ekhof-Theater, uno de los teatros más antiguos en operación en Alemania, que todavía presenta la maquinaria barroca original para cambiar el escenario."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Phelps_County,_Missouri","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Phelps_County_Jail.JPG","page_title":"National Register of Historic Places listings in Phelps County, Missouri","context_page_description":"This is a list of the National Register of Historic Places listings in Phelps County, Missouri.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Phelps County, Missouri, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are 11 properties and districts listed on the National Register in the county.\\nThis National Park Service list is complete through NPS recent listings posted August 31, 2018."},{"page_url":"https://pl.wikipedia.org/wiki/Tryboluminescencja","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Triboluminescence_of_L-Nicotin_salicylat.JPG","page_title":"Tryboluminescencja","context_page_description":"Tryboluminescencja – zjawisko fizyczne, w którym światło powstaje podczas deformacji ciała. Mechanizm tego zjawiska jest nieznany, najprawdopodobniej ma związek z pękaniem wiązań asymetrycznych w ciałach o strukturze krystalicznej. Tryboluminescencja jest wariantem luminescencji. Tryboluminescencji towarzyszy często emisja elektronów i zwana jest wówczas egzoemisją. Może być także efektem metamorfizmu dyslokacyjnego, który wywołuje efekt świecenia skał."},{"page_url":"https://es.wikipedia.org/wiki/Francisco_Eduardo_Tresguerras","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Templo_de_la_Virgen_del_Carmen%2C_Celaya%2C_Guanajuato%2C_M%C3%A9xico_.jpg","page_title":"Francisco Eduardo Tresguerras","context_page_description":"Francisco Eduardo Tresguerras, ​ nacido con el nombre de Francisco Joseph Eduardo Fernández Martínez de Ibarra, ​ fue un arquitecto, pintor, escultor y grabador español del período colonial y los primeros años de la independencia de México."},{"page_url":"https://pt.wikipedia.org/wiki/Jo%C3%A3o_de_%C3%81ustria","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/John_of_Austria_portrait.jpg","page_title":"João de Áustria","context_page_description":"João de Áustria foi um líder militar que esteve a serviço de seu meio-irmão, Filipe II de Espanha. Seu maior feito foi a vitória na Batalha de Lepanto em 1571 contra o Império Otomano. Era conhecido em castelhano como Juan de Áustria e em alemão como Johann von Österreich.\\nJoão era filho bastardo do imperador Carlos V. Foi governador e capitão-geral das forças espanholas na Flandres, por dois anos. Morto de peste ou tifo, seu corpo foi levado à Espanha, e repousa no Panteão de Infantes do Palácio do Escorial."},{"page_url":"https://cy.wikipedia.org/wiki/Elbert_County,_Colorado","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/St._Mark_United_Presbyterian_Church_04.JPG","page_title":"Elbert County, Colorado","context_page_description":"Sir yn nhalaith Colorado, Unol Daleithiau America yw Elbert County. Cafodd ei henwi ar ôl Samuel Hitt Elbert. Sefydlwyd Elbert County, Colorado ym 1874 a sedd weinyddol y sir yw Kiowa, Colorado.\\nMae ganddi arwynebedd o 4,794 cilometr sgwâr. Allan o'r arwynebedd hwn, y canran o ffurfiau dyfrol, megis llynnoedd ac afonydd, yw 0.01%. Yn ôl cyfrifiad y wlad, poblogaeth y sir yw: 23,733. Mewn cymhariaeth, yn 2016 roedd poblogaeth Caerdydd yn 361,462 a Rhyl tua 26,000.\\nMae'n ffinio gyda Arapahoe County, Lincoln County, El Paso County, Douglas County. Cedwir rhestr swyddogol o henebion ac adeiladau cofrestredig y sir yn: National Register of Historic Places listings in Colorado.\\nCeir sawl sir o’r un enw gan gynnwys:\\nElbert County, Georgia"},{"page_url":"https://en.wikipedia.org/wiki/Ana_Cump%C4%83na%C8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Anna_Sage_Woman_in_Red_Dillinger_1934.jpg","page_title":"Ana Cumpănaș","context_page_description":"Ana Cumpănaș or Anna Sage, nicknamed Woman in Red, was an Austro-Hungarian-born Romanian prostitute and brothel owner in the American cities of Chicago and Gary. She is best known for assisting the Federal Bureau of Investigation in tracking down gangster John Dillinger."},{"page_url":"https://pt.wikipedia.org/wiki/Copa_do_Mundo_de_Futebol_Feminino_Sub-20_de_2012","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/KokuritshuKasumigaoka-5.JPG","page_title":"Copa do Mundo de Futebol Feminino Sub-20 de 2012","context_page_description":"A Copa do Mundo de Futebol Feminino Sub-20 de 2012 foi a sexta edição do evento organizado pela Federação Internacional de Futebol e realizada entre 19 de agosto e 8 de setembro no Japão.\\nOriginalmente o torneio deveria ser organizado pelo Vietnã, mas como não foram apresentadas as garantias governamentais para a realização do evento, a FIFA transferiu a organização para o Uzbequistão, conforme designado em 3 de março de 2011. Porém em dezembro do mesmo ano o Comitê Executivo da FIFA decidiu excluir o Uzbequistão como sede devido a problemas logísticos e técnicos. Logo foi anunciada a possibilidade de o Japão sediar o torneio e a confirmação foi dada em janeiro de 2012, após um anúncio conjunto da FIFA e da Associação Japonesa de Futebol.\\nHavia a possibilidade de alteração no formato do torneio, expandido de 16 para 24 o número de seleções participantes, mas ao final foi mantido o número de seleções das últimas edições."},{"page_url":"https://de.wikipedia.org/wiki/Peter_Schoissengeier","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Schoissengeier_090607.jpg","page_title":"Peter Schoissengeier","context_page_description":"Peter Schoissengeier ist ein ehemaliger österreichischer Triathlet. Er wird in der Bestenliste Österreicher Triathleten auf der Ironman-Distanz geführt."},{"page_url":"https://sv.wikipedia.org/wiki/Nolby_Alpina_SK","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Nolbykullen_p%C3%A5_kv%C3%A4llen.JPG","page_title":"Nolby Alpina SK","context_page_description":"Nolby Alpina SK är en alpin skidklubb verksam i Njurunda socken. Föreningen driver Nolbybacken i Kvissleby som har två liftar och fyra nedfarter."},{"page_url":"https://es.wikipedia.org/wiki/Le_Houlme","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Map_commune_FR_insee_code_76366.png","page_title":"Le Houlme","context_page_description":"Le Houlme es una población y comuna francesa, en la región de Alta Normandía, departamento de Sena Marítimo, en el distrito de Rouen y cantón de Notre-Dame-de-Bondeville."},{"page_url":"https://nl.wikipedia.org/wiki/Kepler-10b","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/Exoplanet_Comparison_Kepler-10_b.png","page_title":"Kepler-10b","context_page_description":"Kepler-10b is een van de verschillende exoplaneten ontdekt met behulp van de ruimtetelescoop van NASA's Kepler-missie, en is na Kepler-37b de tweede kleinst bekende exoplaneet. Het is ook de eerste exoplaneet waarvan is bevestigd dat het een rotsachtige planeet is. De ontdekking van deze exoplaneet is gebaseerd op de verzamelde gegevens van acht maanden, met name van mei 2009 tot begin januari 2010. Met behulp van gegevens van Kepler, bevestigde het W.M. Keck-observatorium het bestaan van Kepler-10b."},{"page_url":"https://fr.wikipedia.org/wiki/La_Morera_de_Montsant","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Escut_de_La_Morera_del_Montsant.jpg","page_title":"La Morera de Montsant","context_page_description":"La Morera de Montsant est une commune de la province de Tarragone, en Catalogne, en Espagne, de la comarque de Priorat."},{"page_url":"https://hu.wikipedia.org/wiki/Rage_Against_the_Machine","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/RATM_bdo.jpg","page_title":"Rage Against the Machine","context_page_description":"A Rage Against the Machine egy 1991-ben alakult Grammy-díjas Los Angeles-i alternatívrock-zenekar. A zenekar alapítói: Zack de la Rocha, Tom Morello, Tim Commerford és Brad Wilk. A zenekar a funk metalt és a hiphopot egyesíti, szövegvilága pedig radikális baloldali. A csapat négy lemez kiadása után, 2000-ben feloszlott, majd 2007-ben újra összeállt koncertezni."},{"page_url":"https://tl.wikipedia.org/wiki/Primates","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Afrasia_djijidae_SEM_images.jpg","page_title":"Primates","context_page_description":"Ang Primates ay isang pangkat ng mga mamalyang naglalaman ng lahat ng mga primates o mga primate na kinabibilingan ng mga lemur, mga loris, mga tarsier, mga sari-saring unggoy, at mga bakulaw na kabilang ng mga tao. Tinatawag ang mga kasapi nito na primate. Mayroong mga umaabot sa 400 mga uri ng mga primate. Kahawig ng tao ang lahat ng mga primate sa ilang kaparaanan o katangian. Mayroon silang mga kamay na may limang mga daliri, mga kuko. Nahahati ang mga primate sa dalawang mga grupo: ang Strepsirrhini at ang Haplorrhini. Kabilang sa Haplorrhini ang mga unggoy, mga tarsier at mga bakulaw, kabilang ang mga tao. Kabilang sa Strepsirrhini ang mga lemur, mga loris, mga galago at ang aye-aye."},{"page_url":"https://en.wikipedia.org/wiki/Kheng_Hock_Keong","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Kheng_Hock_Keong_entrance%2C_Yangon.jpg","page_title":"Kheng Hock Keong","context_page_description":"The Kheng Hock Keong, also known as the Kheng Hock Keong or Qingfu Temple, is the largest and oldest temple to the Chinese sea-goddess Mazu in Yangon, Burma. It is located on the corner of Sintodan Street and Strand Road in Latha Township. Kheng Hock Keong is maintained by a Hokkien Chinese clan association. The temple attracts mostly Hokkien and Hakka worshipers, while the other temple in Latha Township, called the Guanyin Gumiao Temple, attracts Cantonese worshipers."},{"page_url":"https://fi.wikipedia.org/wiki/Sigtunan_kunta","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Norrsunda_kyrka_ext2.jpg","page_title":"Sigtunan kunta","context_page_description":"Sigtunan kunta on Tukholman läänissä sijaitseva Ruotsin kunta. Maakuntajaossa se kuuluu Uplantiin. Kunnan keskustaajama on Märsta.\\nKunnan maapinta-ala on 327,66 neliökilometriä ja asukasluku 44 786 henkeä.\\nSigtunan naapurikuntia ovat Norrtälje, Vallentuna, Upplands Väsby, Upplands-Bro, Håbo ja Knivsta.\\nMälaren-järven lahti Sigtunafjärden sijaitsee kunnan länsiosassa.\\nAlueella sijaitsee Arlandan lentoasema. Yli 75 % kunnan asukkaista asuu alle 25 %:lla kunnan pinta-alasta. Yli puolet kunnan pinta-alasta sijaitsee Arlandan lentokentän melualueella, mikä on johtanut rakentamisrajoituksiin.\\nKunnassa sijaitsevat Rosersbergin linna ja Steningen linna. Lisäksi entisessä Sigtunan kaupungissa on vanhoja kirkkoja, raatihuone ja lähistöllä Venngarnin linna.\\nVuonna 2007 kunnassa oli 92,14 km² peltoa, joten saman ajankohdan maapinta-alaan vertaamalla saadaan peltojen osuudeksi 28,1 prosenttia kunnan maapinta-alasta."},{"page_url":"https://pt.wikipedia.org/wiki/Dromaius_novaehollandiae_minor","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Dromaius_peroni.jpg","page_title":"Dromaius novaehollandiae minor","context_page_description":"Dromaius novaehollandiae minor é uma subespécie extinta de emu que era endêmica da ilha King, localizada no estreito de Bass entre a Austrália continental e a Tasmânia. Seu \\"primo\\" mais próximo é a também extinta subespécie de emu da Tasmânia, pois eles pertenciam a uma única população até menos de 14 mil anos atrás, quando as duas ilhas ainda estavam conectadas. O pequeno tamanho do emu da ilha King pode ser um exemplo de nanismo insular. A ave era o menor de todos os emus conhecidos e possuía plumagem mais escura que o emu do continente. Era preto e marrom e tinha pele nua de cor azul no pescoço; seus filhotes eram listrados como os do continente. A subespécie era distinta do igualmente diminuto emu da ilha dos Cangurus em vários detalhes osteológicos, incluindo o tamanho. O comportamento do D. n. minor provavelmente não diferiu muito do comportamento do emu do continente. As aves se reuniam em bandos para forragear e durante o período de reprodução. Alimentavam-se de frutas, grama e algas marinhas. Corriam rapidamente e se defendiam com chutes. O ninho era raso e feito com folhas mortas e musgo. Eram postos de sete a nove ovos, os quais eram incubados por ambos os pais."},{"page_url":"https://it.wikipedia.org/wiki/Paiwan","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Formosan_Distribution_en.png","page_title":"Paiwan","context_page_description":"I Paiwan sono un popolo di aborigeni taiwanesi, che forma il terzo gruppo tribale più ampio di indigeni di Taiwan. I Paiwan comprendono circa il 17.7% della popolazione indigena di Taiwan, con una popolazione aggiornata al 2000 di circa 70.331 individui. Circa 66.000 aborigeni parlano la lingua paiwan.\\nTipiche del popolo Paiwan sono due particolari cerimonie, chiamate Masaru e Maleveq. Il Masaru è una festa che celebra la raccolta del riso, mentre il Maleveq serve per commemorare le divinità e gli antenati."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BC%D1%91%D0%BD%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%BB%D0%BE%D1%89%D0%B0%D0%B4%D1%8C_(%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Semenovsky_Bridge_01.jpg","page_title":"Семёновская площадь (Санкт-Петербург)","context_page_description":"Семёновская площадь — площадь в Адмиралтейском районе Санкт-Петербурга."},{"page_url":"https://fr.wikipedia.org/wiki/Martin_Sandberger","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Martin_Sandberger.jpg","page_title":"Martin Sandberger","context_page_description":"Martin Sandberger était un Standartenführer-SS qui commanda le Sonderkommando 1a de l'Einsatzgruppe A dirigé par le Brigadeführer Stahlecker. Colonel SS, Martin Sandberger était également chef de la Sicherheitspolizei et du SD en Estonie, et joua donc un rôle significatif dans l'extermination des Juifs dans les États baltes. Il exerça aussi en Italie, organisant la déportation des Juifs vers Auschwitz. Martin Sandberger a été condamné à mort lors du procès des Einsatzgruppen à Nuremberg en 1948, mais sa peine fut commuée en prison à perpétuité en 1952. Il fut libéré en 1958 par le Comité des grâces. Il exerça alors à nouveau comme juriste pour l'entreprise Lechler, franchissant les échelons de la hiérarchie jusqu'à en être l'un de ses dirigeants."},{"page_url":"https://sv.wikipedia.org/wiki/Kullag%C3%A5rden","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Kullag%C3%A5rd_pr_M%C3%B6lle.jpg","page_title":"Kullagården","context_page_description":"Kullagården är en gård i Brunnby distrikt, Höganäs kommun och Skåne län. Den ligger invid Italienska vägen halvvägs mellan Mölle och Kullens fyr på Kullaberg. Gården kan ha medeltida ursprung, och var först känd under namnet Kulla Gård. Kullagården förlänades förr till den som ansvarade för driften av Kullens fyr. I början av 1800-talet uppdelades Kullagården i två gårdar, Gamla Kullagården, som idag är känt som Ransgården, och Nya Kullagården, där idag Kullagårdens Wärdshus och Mölle Golfklubb ligger. På 1800-talet kom Kullagården att bli centrum för den tidiga turismen på Kullaberg."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A5%CF%88%CE%B7%CE%BB%CE%AE_%CE%A1%CE%AC%CF%87%CE%B7_%CE%94%CF%81%CE%AC%CE%BC%CE%B1%CF%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f3/Dimos_Nikiforou.png","page_title":"Υψηλή Ράχη Δράμας","context_page_description":"Η Υψηλή Ράχη είναι ημιορεινό Χωριό του νομού Δράμας.\\nΚατοικήθηκε από πρόσφυγες κυρίως Πόντιους και Μικρασιάτες μετά την Μικρασιατική καταστροφή και την ανταλλαγή των πληθυσμών το 1922.\\nΟι ασχολίες των εναπομείναντων κατοίκων είναι η κτηνοτροφία και σε μικρότερο βαθμό η γεωργία, λόγω μορφολογίας του εδάφους που είναι ορεινό και χωρίς δυνατότητα εκτενούς άρδευσης. Δύσκολη περίοδος για το χωριό αποτέλεσε η Βουλγαρική κατοχή 1941-44 και αργότερα ο Εμφύλιος, αλλά και αργότερα οι περισσότεροι κάτοικοι πήραν το δρόμο της προσφυγιάς τη δεκαετία του 1960 λόγω έλλειψης εργασίας και αναζητώντας μια καλύτερη τύχη, εκ των οποίων πολύ λίγοι έχουν επιστρέψει μέχρι σήμερα."},{"page_url":"https://en.wikipedia.org/wiki/Newtonville,_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/NewtonvilleMethodistChurch.jpg","page_title":"Newtonville, New York","context_page_description":"Newtonville is a hamlet in the town of Colonie in Albany County, New York, United States. Located along U.S. Route 9, the hamlet is just south of Latham and north of Loudonville. Colonie Town Hall is located in the hamlet of Newtonville."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%A4%D1%83%D1%80%D1%83%D0%B4%D0%B3%D0%BE%D2%B3%D0%B8_%D1%88%D0%B0%D2%B3%D1%80%D0%B5_%D0%BE%D0%BB%D1%82%D1%83%D1%80%D0%BE%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Alturas_Municipal_Airport_diagram.png","page_title":"Фурудгоҳи шаҳре олтурос","context_page_description":"Фурудгоҳи шаҳри олтурос — фурудгоҳи ҳамагона баҳра‌бурдори ҳавоӣ аст, ки як бонди фуруди асфалт дорад, ва тӯли бонди он 1311 метр аст. Ин фурудгоҳ дар шаҳри олтурос, колефурнеё кишвари Иёлоти Муттаҳидаи Амрико қарор дорад, ва дар баландии 1334 метр аз сатҳи баҳр воқеъ шудааст."},{"page_url":"https://da.wikipedia.org/wiki/Kaukasuskrigene","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Imam_Shamil_-_01.jpg","page_title":"Kaukasuskrigene","context_page_description":"Kaukasuskrigene er et navn på Ruslands invasion og påfølgende erobring af Tjetjenien, Dagestan og det nordvestlige Kaukasus mellem 1817 og 1864.\\nKrigene blev udkæmpede af tre russiske zarer: Aleksander 1., Nikolaj 1. og Aleksander 2.. De vigtigste russiske militære ledere var Aleksej Jermolov mellem 1816-1827, Mikhail Vorontsov mellem 1844-1853 og Aleksandr Barjatinskij mellem 1853-1856."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%96%B0%E5%B1%85%E6%B5%9C%E5%85%AB%E5%8D%81%E5%85%AB%E3%83%B6%E6%89%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Niihama88.08.jpg","page_title":"新居浜八十八ヶ所","context_page_description":"新居浜八十八ヶ所は、愛媛県新居浜市にある霊場である。「にいはま新四国八十八ヶ所」とも表記する。\\n1921年3月、49番北の坊16世横関宥恵師が新居浜市内の由緒ある寺庵を踏査し、四国八十八ヶ所の土を配り、郷土の衆生安楽を祈念して開創した。\\n霊場のある場所は、郊外の谷間から町中の住宅地、田んぼの中、さらに標高数百メートルの山中、最後は島へと変化に富んでいる。霊場自体は、大きな歴史ある寺院から小さな祠まで様々である。"},{"page_url":"https://pl.wikipedia.org/wiki/Bj%C3%B6rn_Bergmann_Sigur%C3%B0arson","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Bj%C3%B6rn_Bergmann_Sigur%C3%B0arson.jpg","page_title":"Björn Bergmann Sigurðarson","context_page_description":"Björn Bergmann Sigurðarson – islandzki piłkarz grający na pozycji napastnika. Od 2018 roku zawodnik rosyjskiego FK Rostów."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_pam%C3%A1tn%C3%BDch_strom%C5%AF_v_okrese_Rychnov_nad_Kn%C4%9B%C5%BEnou","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/L%C3%ADpa_velkolist%C3%A1%2C_zvan%C3%A1_Jir%C3%A1skova%2C_v_Dob%C5%99anech_naproti_h%C5%99bitovu_-_1.jpg","page_title":"Seznam památných stromů v okrese Rychnov nad Kněžnou","context_page_description":"Toto je seznam památných stromů v okrese Rychnov nad Kněžnou, v němž jsou uvedeny památné stromy na území okresu Rychnov nad Kněžnou."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%84%DB%8C%D8%B3%D8%A7_%D9%BE%DB%8C._%D8%AC%DA%A9%D8%B3%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Lisa_P._Jackson_official_portrait.jpg","page_title":"لیسا پی. جکسون","context_page_description":"لیسا پی. جکسون آمریکالی سیاستچی و دموکرات حزبینین عوضوو."},{"page_url":"https://simple.wikipedia.org/wiki/Edward,_the_Black_Prince","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Coat_of_Arms_of_the_Prince_of_Wales_%28France_ancient%29.svg","page_title":"Edward, the Black Prince","context_page_description":"Edward, the Black Prince was the eldest son of King Edward III of England.\\nEdward was born at Woodstock Palace, near Oxford. He was made Prince of Wales in 1343, and followed his father into battle against France. He became a famous soldier, helping win the Battle of Crécy and commanding the Battle of Poitiers. He was a founding member of the Order of the Garter. In 1361, he married his cousin, Joan of Kent. They had two sons, Edward and Richard. The older son, Edward, died when he was only six.\\nEdward of Woodstock has become known in history as \\"the Black Prince\\", but no one is quite sure of the reason for the nickname. He died at the age of 45, and was buried at the Canterbury Cathedral. As his father was still living, he never became king himself. He asked his father to give the title Prince of Wales to his son Richard, who later became King Richard II of England."},{"page_url":"https://sv.wikipedia.org/wiki/Dry,_Loiret","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Map_commune_FR_insee_code_45130.png","page_title":"Dry, Loiret","context_page_description":"Dry är en kommun i departementet Loiret i regionen Centre-Val de Loire strax norr Frankrikes mitt. Kommunen ligger i kantonen Cléry-Saint-André som tillhör arrondissementet Orléans. År 2009 hade Dry 1 389 invånare."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A8%E3%83%AC%E3%82%AF%E3%83%88%E3%83%AA%E3%83%83%E3%82%AF%E3%83%BB%E3%82%AE%E3%82%BF%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Schema_kytary.JPG","page_title":"エレクトリック・ギター","context_page_description":"エレクトリック・ギターとは、ピックアップを内蔵し、それによって弦の振動を電気信号に変換するギター。通称・略称はエレキギターおよびエレキ。\\nエレクトリック・ギターは、その金属製の弦の振動をピックアップで電気信号に変えるギターであり、そのエレクトリック・ギター本体とアンプを、シールド・ケーブルで接続し、アンプの側で電気信号を増幅し音を出す。アンプで音をひずませたり大音量の音を出したり、様々なエフェクターを用いて音質を多彩に変化させることが可能で、それらがエレクトリック・ギターの大きな特徴となっている。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B0%D0%B2%D0%B8%D0%BD,_%D0%90%D0%B2%D1%80%D0%B8%D0%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8b/Sum41_Deryck_Whibley.jpg","page_title":"Лавин, Аврил","context_page_description":"А́врил Рамо́на Лави́н — канадская певица, автор песен, дизайнер и актриса. Её дебютный альбом, Let Go, вышедший в 2002 году, был продан тиражом 16 млн копий. Последующие работы — Under My Skin и The Best Damn Thing — возглавляли мировые чарты, в том числе американский Billboard 200. Пять песен Лавин — «Complicated», «Sk8er Boi», «I’m with You», «My Happy Ending» и «Girlfriend» — занимали первые строчки мировых чартов. По всему миру было продано более 30 млн копий её альбомов. По состоянию на январь 2011 года, она являлась одной из самых популярных певиц в США с 11,5 млн проданных альбомов. Журнал Billboard поместил Лавин на 10-е место в рейтинге артистов 2000-х годов, а также на 28-е место по коммерческому успеху. Её четвёртый студийный альбом Goodbye Lullaby вышел в марте 2011 года. Затем она выпустила свой пятый студийный альбом, который поступил в продажу 5 ноября 2013 года.\\nШестой альбом Аврил после длительного перерыва вышел 15 февраля 2019 года под названием Head Above Water.\\nПомимо музыкальной карьеры, Аврил Лавин занимается дизайном и участвует в кинематографической деятельности."},{"page_url":"https://ca.wikipedia.org/wiki/Neuilly-en-Vexin","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Map_commune_FR_insee_code_95447.png","page_title":"Neuilly-en-Vexin","context_page_description":"Neuilly-en-Vexin és un municipi francès, situat al departament de Val-d'Oise i a la regió d'Illa de França. L'any 2007 tenia 210 habitants.\\nForma part del cantó de Pontoise, del districte de Pontoise i de la Comunitat de comunes Vexin centre."},{"page_url":"https://eo.wikipedia.org/wiki/R._A._Dvorsk%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Rudolf_Anton%C3%ADn_Dvorsk%C3%BD_%281899-1966%29.jpg","page_title":"R. A. Dvorský","context_page_description":"R. A. DVORSKÝ naskiĝis la 24-an de marto 1899 en Dvůr Králové nad Labem, mortis la 2-an de aŭgusto 1966 en Prago. Li estis ĉeĥa muzikisto kaj eldonisto.\\nLia propra nomo sonas Rudolf Antonín, artan pseŭdonimon li elektis por si laŭ sia naskourbo. En la jaro 1918 li fariĝis muzika redaktoro en praga eldonejo Springer, en la jaroj 1919 – 1921 li komencis al muziko dediĉi aktive kiel kantisto, pianisto kaj pli malfrue ankaŭ kiel kapelestro de kabareto Ruĝa sepo. Li verkis multe da danckantojn influitaj de ĵazo. En la jaroj 1925 – 1929 li gvidis kvarteton Melody Makers, en la jaro 1929 li fondis ensemblon Melody Boys, kun kiu li ampleksis perstile tre vastan spektron de populara muziko. La orkestro de Dvorský estis ĉesigita en la jaro 1945, sed tiutempe jam Dvorský kelke da monatoj ne plu prezentiĝis kun ĝi, ĉar en la jaro 1944 li grave malsaniĝis je pulminflamo.\\nĜis tiu tempo li surdiskigis pli ol 2 000 komponaĵojn sur normaj gramofondiskoj. Li ofte prezentiĝis kun sia orkestro en filmoj.\\nEn la jaroj 1936 – 1948 Dvorský gvidis propran energian eldonejon, en kiu li koncentris vicon da gravaj personecoj de tiama populara muziko."},{"page_url":"https://it.wikipedia.org/wiki/Sportski_centar_Mora%C4%8Da","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Mora%C4%8Da_Sports_Center.jpg","page_title":"Sportski centar Morača","context_page_description":"Lo Sportski centar Morača è una arena polivalente situata nella città di Podgorica.\\nL'Arena, situata all'interno di un complesso sportivo di cinque ettari nei pressi del fiume Morača, venne aperta nel 1978, e ristrutturata nel 2005 per ospitare gli incontri del campionato europeo maschile di pallacanestro 2005.\\nOltre che per la pallacanestro, l'Arena ospita incontri di pallamano e pallavolo delle squadre della polisportiva del Budućnost, oltre che eventi culturali e concerti."},{"page_url":"https://es.wikipedia.org/wiki/Polevsko","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Polevsko_Church.jpg","page_title":"Polevsko","context_page_description":"Polevsko es una localidad del distrito de Česká Lípa en la región de Liberec, República Checa, con una población estimada a principio del año 2018 de 409 habitantes.\\nSe encuentra ubicada al oeste de la región, en la zona de los montes Jizera y el río Jizera —un afluente derecho del río Elba—, a poca distancia al norte de Praga y cerca de la frontera con Alemania y las regiones de Ústí nad Labem y Bohemia Central.​"},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Bertrand-de-Comminges_de_Saint-Lary","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/%C3%89glise_Saint-Bertrand_de_Saint-Lary_%28Hautes-Pyr%C3%A9n%C3%A9es%29_4.jpg","page_title":"Église Saint-Bertrand-de-Comminges de Saint-Lary","context_page_description":"L'église Saint-Bertrand-de-Comminges est une église catholique du XXᵉ siècle située à Saint-Lary-Soulan, dans le département français des Hautes-Pyrénées en France."},{"page_url":"https://de.wikipedia.org/wiki/Greta_Zimmer_Friedman","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Kissing_the_War_Goodbye.jpg","page_title":"Greta Zimmer Friedman","context_page_description":"Greta Zimmer Friedman geboren als Margarete Zimmer war eine in Österreich geborene US-amerikanische Designerin, bildende Künstlerin und Restaurateurin. Sie wurde bei der Feier des Kriegsendes am 14. August 1945 auf dem New Yorker Times Square von einem Seemann geküsst und ist mit hoher Wahrscheinlichkeit auf den weltberühmt gewordenen Fotografien von Alfred Eisenstaedt und Victor Jorgensen zu sehen."},{"page_url":"https://it.wikipedia.org/wiki/Bhavsinhji_Madhavsinhji","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Porbandar_state_CoA2.jpg","page_title":"Bhavsinhji Madhavsinhji","context_page_description":"Bhavsinhji Madhavsinhji fu maharaja di Porbandar e regnò dal 1900 sino alla propria morte nel 1908."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%85%D8%AD%D9%85%D8%AF_%D8%A7%D8%B9%D8%B8%D9%85_%D8%B4%D8%A7%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Azam_shah.jpg","page_title":"محمد اعظم شاه","context_page_description":"محمد از‌م شاه قدیم هیندوستان ایمپیراتورو. ۱۴ مارس ۱۷۰۷ – ۸ ژوئن ۱۷۰۷ ایل‌لر آراسیندا حؤکومت ائدیب. ایسلام دینینه اعتیقاد ائتمیشدی. آتاسی اورنقزیب دیر. اورنقزیب اؤلوموندن سوْنرا حؤکومتی اله کئچدیب و اؤزونون وفاتیندان سوْنرا بیرینجی بهادرشاه واریث کیمی تخت و تاجه صاحیب چیخیب."},{"page_url":"https://en.wikipedia.org/wiki/Calixarene","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Calixarene-schema.png","page_title":"Calixarene","context_page_description":"A calixarene is a macrocycle or cyclic oligomer based on a hydroxyalkylation product of a phenol and an aldehyde.\\nThe word calixarene is derived from calix or chalice because this type of molecule resembles a vase and from the word arene that refers to the aromatic building block. Calixarenes have hydrophobic cavities that can hold smaller molecules or ions and belong to the class of cavitands known in host–guest chemistry. Calixarene nomenclature is straightforward and involves counting the number of repeating units in the ring and include it in the name. A calix[4]arene has 4 units in the ring and a calix[6]arene has 6. A substituent in the meso position Rb is added to the name with a prefix C- as in C-methylcalix[6]arene."},{"page_url":"https://cs.wikipedia.org/wiki/Plymouthsk%C3%A1_kolonie","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Plymouth_Colony_seal.png","page_title":"Plymouthská kolonie","context_page_description":"Plymouthská kolonie byla anglická kolonie v Severní Americe, která existovala mezi lety 1620 a 1691. První město kolonie byl New Plymouth, který se nacházel v místě dříve pojmenovaném a prozkoumaném kapitánem Johnem Smithem. Toto město se dnes nazývá Plymouth. Plymouthská kolonie v době svého největšího rozmachu zabírala území odpovídající jihovýchodní části dnešního státu Massachusetts.\\nKolonie byla založena anglickými puritány, kteří sem poprvé připluli na lodi Mayflower. Plymouthská kolonie má zvláštní místo v amerických dějinách. Na rozdíl od Jamestownské kolonie většinu původních osadníků tvořili lidé prchající před náboženským pronásledováním, kteří hledali místo, kde by mohli svobodně vyznávat svou víru. To je dodnes jeden ze základních principů, na kterých jsou postaveny dnešní USA. V Plymouthské kolonii také vznikly některé tradice, které ovlivnily americkou kulturu, jako je svátek Den díkůvzdání."},{"page_url":"https://en.wikipedia.org/wiki/List_of_monastic_houses_in_England","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/DunsterPriory.JPG","page_title":"List of monastic houses in England","context_page_description":"Monastic houses in England include abbeys, priories and friaries, among other monastic religious houses.\\nThe sites are listed by modern county."},{"page_url":"https://pl.wikipedia.org/wiki/J%C3%B3zef_I_Reformator","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/94/EstatuaDJoseIemLisboa.JPG","page_title":"Józef I Reformator","context_page_description":"Józef I zwany Reformatorem – król Portugalii z dynastii Bragança. Urodził się w Lizbonie jako trzecie dziecko króla Jana V i jego żony Marii Anny Austriaczki. Starszy brat Józefa Piotr zmarł w wieku 2 lat.\\nW 1729 Józef ożenił się z księżniczką Marianną Wiktorią Burbon, jednocześnie jego starsza siostra Maria Barbara wyszła za przyszłego króla Hiszpanii – Ferdynanda VI."},{"page_url":"https://es.wikipedia.org/wiki/Serpiente_venenosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Atheris_hispida.jpg","page_title":"Serpiente venenosa","context_page_description":"Se denomina serpiente venenosa a toda serpiente que posee veneno en sus colmillos para el propósito de inmovilizar a su presa o la autodefensa. En contraste, las especies no venenosas matan por constricción o la dominación mandibular. De las 3.460 especies de serpientes que existen solo unas 600 son peligrosas para el ser humano.\\nLa mayoría de las serpientes poseen veneno pero solo el 20% a nivel mundial pueden ser perjudiciales debido a su toxicidad. Las serpientes venenosas incluyen a varias familias y no forman un solo grupo taxonómico. Muchos tipos de serpientes como boas o pitones, pueden no ser venenosas, pero sus mordeduras deben ser atendidas clínicamente."},{"page_url":"https://de.wikipedia.org/wiki/Oldenburger_Land","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/L%C3%B6ningen6.jpg","page_title":"Oldenburger Land","context_page_description":"Das Oldenburger Land ist eine Region in Niedersachsen im Bereich der ehemaligen Territorien bzw. Bundesstaaten Grafschaft Oldenburg /Niederstift Münster, Herzogtum Oldenburg, Großherzogtum Oldenburg, Freistaat Oldenburg und Verwaltungsbezirk Oldenburg ohne seine Exklaven, entlang der Flüsse Hunte und Hase. Als Landschaftsverband wird es durch die Oldenburgische Landschaft repräsentiert. In der Region zwischen Waterkant, Dümmer und Dammer Berge spricht man zum Teil bis heute Plattdeutsch, im Saterland auch saterfriesisch. Besonders in dieser Region werden alte niedersächsische Bräuche gepflegt, wie z. B. Schützenfeste oder Kohlfahrten. Landestypische Sportarten sind, wie auch in Ostfriesland, Klootschießen und Boßeln.\\nDer katholisch geprägte südliche Teil des Oldenburger Landes wird Oldenburger Münsterland genannt, der protestantisch geprägte nördliche Teil wird im engeren Sinne als Oldenburger Land bezeichnet.\\nDem Oldenburger Land entsprechen etwa neben den Städten Oldenburg, Wilhelmshaven und Delmenhorst die Landkreise Friesland, Ammerland, Oldenburg, Cloppenburg, Wesermarsch und Vechta."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A3%CE%BF%CF%85%CE%B7%CE%B4%CE%B9%CE%BA%CF%8C_%CE%A0%CF%81%CF%89%CF%84%CE%AC%CE%B8%CE%BB%CE%B7%CE%BC%CE%B1_%CE%9A%CE%BB%CE%B5%CE%B9%CF%83%CF%84%CE%BF%CF%8D_%CE%A3%CF%84%CE%AF%CE%B2%CE%BF%CF%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/AngelicaBengtssonLinneparkenVaxjo20100904.jpg","page_title":"Σουηδικό Πρωτάθλημα Κλειστού Στίβου","context_page_description":"Το Σουηδικό Πρωτάθλημα Κλειστού Στίβου είναι το εθνικό πρωτάθλημα στον κλειστό στίβο της Σουηδίας, που διοργανώνεται από την Σουηδική Ομοσπονδία Στίβου.\\nΠραγματοποιείται κάθε χρόνο, κατά τις χειμερινές περιόδους και αναδεικνύει τους πρωταθλητές Σουηδίας στα αγωνίσματα ανδρών και γυναικών. Διεξήχθη για πρώτη φορά το 1966 ως ανεπίσημη διοργάνωση και το 1984 ως επίσημη. Το πρωτάθλημα των συνθέτων αγωνισμάτων καθιερώθηκε το 1986 και αποτελεί μέρος του πρωταθλήματος. Συνολικά το κύριο μέρος του πρωταθλήματος έχει πραγματοποιηθεί πενήντα φορές και το πρωτάθλημα συνθέτων τριάντα φορές."},{"page_url":"https://vi.wikipedia.org/wiki/Amsacta_flaveola","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Aloa_marginata_%28ento-csiro-au%29.jpg","page_title":"Amsacta flaveola","context_page_description":"Amsacta flaveola là một loài bướm đêm thuộc phân họ Arctiinae, họ Erebidae."},{"page_url":"https://ast.wikipedia.org/wiki/Xylophanes","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Xylophanes_pyrrhus_MHNT_CUT_2010_0_149_Limbo%2C_Chapare_Cochabamba_female.jpg","page_title":"Xylophanes","context_page_description":"Xylophanes ye un xéneru de poliyes perteneciente a la familia de los esfínxidos."},{"page_url":"https://sk.wikipedia.org/wiki/Zoznam_kult%C3%BArnych_pamiatok_v_okrese_Bratislava_I_(T_%E2%80%93_V)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Blava_2007-3-28-32.jpg","page_title":"Zoznam kultúrnych pamiatok v okrese Bratislava I (T – V)","context_page_description":"Toto je zoznam kultúrnych pamiatok v okrese Bratislava I, časť T-V.\\nZoznam bol vytvorený na základe zoznamu, ktorý bol zverejnený na webe Pamiatkového úradu Slovenskej republiky.\\nV súčasnosti je na webovej stránke PÚSR dostupné vyhľadávanie podľa jednotlivých obcí."},{"page_url":"https://it.wikipedia.org/wiki/Pietre_d%27inciampo_a_Milano","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Pd%27I_Pio_Fo%C3%A0_Milano.jpg","page_title":"Pietre d'inciampo a Milano","context_page_description":"La lista delle pietre d'inciampo a Milano ricorda il destino delle vittime a Milano dello sterminio nazista, qualunque sia stato il motivo della persecuzione: religione, razza, idee politiche, orientamenti sessuali. Le Pietre d'inciampo sono una iniziativa dell'artista tedesco Gunter Demnig che ha già posato più di 75.000 pietre in tutta Europa. L'obiettivo di tale progetto è mantenere viva la memoria delle vittime di tutte le deportazioni e per farlo è stato scelto il luogo simbolo della vita quotidiana: la casa. Una semplice pietra sul selciato stradale rappresenta un invito per chi passa a riflettere su quanto accaduto in quel luogo e in quella data, per non dimenticare e per impedire che si possano ripetere le atrocità del passato."},{"page_url":"https://sv.wikipedia.org/wiki/Louis-Lucien_Klotz","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Louis-Lucien_Klotz.jpg","page_title":"Louis-Lucien Klotz","context_page_description":"Louis-Lucien Klotz, född 11 januari 1868 i Paris, död 15 juni 1930 i Paris, var en fransk advokat, journalist och politiker.\\nKlotz blev deputerad 1898 och specialiserade inom politiken på tull- och finansärenden. 1910-13 var han finansminister, med kortare avbrott 1911 och 1913 inrikesminister. Under första världskriget tjänstgjorde han en tid som officer i reserven. Klotz var 1917-20 finansminister i Raymond Poincarés och Georges Clemenceaus regeringar och deltog i Pariskonferensen och Versaillesfreden. Mest känd blev han för parollen det skall tyskarna betala och den lättsinniga optimism, varmed han bedömde Frankrikes finansiella läge, då han avslöt det ruinerande avtalet om Frankrikes övertagande av de resterande amerikanska krigsförråden. Senare kom Klotz på ekonomiskt obestånd och handhade även sina privata affärer med stort lättsinne, vilket ledde till att han ställdes inför rätta för sina förehavanden."},{"page_url":"https://it.wikipedia.org/wiki/Battaglia_delle_Midway","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Japanese_aircraft_carrier_Hiryu_1939.jpg","page_title":"Battaglia delle Midway","context_page_description":"La battaglia delle Midway fu combattuta durante la seconda guerra mondiale, tra il 4 e il 7 giugno 1942, presso le isole Midway, dove la Marina degli Stati Uniti respinse l'attacco della Marina imperiale giapponese. Quello che doveva essere il colpo di grazia alle forze statunitensi nel Pacifico, ormai logorate dalle numerose perdite, si trasformò nella più grande vittoria navale ottenuta dagli Stati Uniti durante la seconda guerra mondiale. Gli americani affondarono quattro grandi portaerei di squadra nemiche e segnarono in tal modo un punto di svolta nella guerra del Pacifico con l'arresto dell'avanzata nipponica.\\nCombattuta solo un mese dopo la battaglia del Mar dei Coralli, quella delle Midway fu la seconda battaglia navale della storia combattuta quasi completamente dalle forze aeree imbarcate sulle portaerei, senza contatto visivo tra le flotte contrapposte e senza scontri a fuoco tra navi di linea."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Sta%C3%9Ffurt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Neundorf%28Anhalt%29%2CFriedhofskapelle.jpg","page_title":"Liste der Kulturdenkmale in Staßfurt","context_page_description":"In der Liste der Kulturdenkmale in Staßfurt sind alle Kulturdenkmale der Stadt Staßfurt und ihrer Ortsteile aufgelistet. Grundlage ist das Denkmalverzeichnis des Landes Sachsen-Anhalt, das auf Basis des Denkmalschutzgesetzes vom 21. Oktober 1991 erstellt wurde."},{"page_url":"https://it.wikipedia.org/wiki/Sindaci_di_Firenze","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Mario_Primicerio.jpg","page_title":"Sindaci di Firenze","context_page_description":"Questa pagina è la cronotassi dei sindaci di Firenze, carica che ha avuto diverse denominazioni a partire dall'istituzione dell'amministrazione locale nel 1781 con editto di Pietro Leopoldo. Dal 2015 il sindaco è investito anche, di diritto, della carica di sindaco metropolitano della città metropolitana di Firenze."},{"page_url":"https://nn.wikipedia.org/wiki/Kalo_Dungar","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/View_from_kala_dunger_kutch.JPG","page_title":"Kalo Dungar","context_page_description":"Kalo Dungar er det høgaste punktet i Kachch i Gujarat i India, på 462 meter. Toppen ligg 97 km frå administrasjonsstaden Bhuj og 25 km nord for næraste by, Khavda.\\nToppen er truleg den einaste staden ein har panoramautsikt over saltmyra Rann av Kachchh. Sidan han ligg nær grensa til Pakistan ligg det ein militærpost på toppen. Allmugen har ikkje tilgang forbi posten.\\nKalo Dungar er også kjend for eit rundt 400 år gammalt tempel til Dattatreja. Prestane i tempelet lager offermat av ris som dei gjev til dei lokale sjakalane etter aarti-seremonien.\\nEi soge knytt til tempelet fortel at då Dattatreja var på jorda kom han til Kalo Dungar og fann ei gruppe sveltande sjakalar. Som gud kunne han gje dei kroppen sin å eta, og etter at han var blitt eten bli heil att.\\nEi anna soge fortel at ein heilag mann, Lakkh Guru, budde her og tilbad Dattatreja. Han pleide å mata sjakalane. Ein dag då han ikkje hadde mat å gje dei skar han ein del av sin eigen kropp og gav dei til å eta. I ein annan versjon skal ein konge ha tilbydd same offer då Dattatreja i sjakalform spurte kvifor han gav sjakalar vegetarisk mat som offer når dei var kjøtetarar."},{"page_url":"https://es.wikipedia.org/wiki/Red_Devil_(Alaska)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Red_Devil_Alaska_postmark.jpg","page_title":"Red Devil (Alaska)","context_page_description":"Red Devil es un lugar designado por el censo ubicado en el Área censal de Bethel en el estado estadounidense de Alaska. En el Censo de 2010 tenía una población de 23 habitantes y una densidad poblacional de 0,32 personas por km².​"},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B9%84%ED%83%80%EB%AF%BC_B_%EB%B3%B5%ED%95%A9%EC%B2%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/B_vitamin_supplement_tablets.jpg","page_title":"비타민 B 복합체","context_page_description":"비타민 B 복합체 또는 비타민 B군은 세포 대사에서 중요한 역할을 수행하는 수용성 비타민들이다. 비타민 B는 한때 단일한 비타민으로 알려졌었으나, 이 후의 연구에서 비타민 B군은 같은 음식에서 종종 공존하지만 화학적으로 구별되는 비타민들이라는 것이 밝혀졌다. 일반적으로 보충제는 비타민 B 복합체라고 불리는 8개 비타민 모두를 포함하고 있다. 개별적인 비타민 B 보충제는 각 비타민의 구체적인 이름으로 불린다."},{"page_url":"https://vi.wikipedia.org/wiki/C%E1%BB%95ng_tam_quan","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/Kim_Lien_shrine.jpg","page_title":"Cổng tam quan","context_page_description":"Cổng tam quan là một loại cổng có ba lối đi thường thấy ở chùa chiền theo lối kiến trúc truyền thống Việt Nam. Một số dinh thự, và đình miếu cũng xây loại cổng này như Cơ Mật viện ở Huế."},{"page_url":"https://nl.wikipedia.org/wiki/Ordeketen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Collar_and_star_of_the_Order_of_the_British_Empire.jpg","page_title":"Ordeketen","context_page_description":"Een ordeketen is een gouden of zilveren versiersel, bestaande uit schakels, dat over beide schouders wordt gedragen door ridders in sommige ridderorden.\\nDe oudste ridderorden waren kruisridderorden. Als teken van de onderlinge verbondenheid droegen de Ridders een zwart, rood of groen kruis op hun mantel. De latere Europese Orden van de middeleeuwen droegen allerlei uiterlijke kentekenen zoals geborduurde draken, ringen en zelfs kledingstukken zoals de kousenbanden.\\nIn de late middeleeuwen kwam het accent meer op het kleinood van de Orde dan op de gemeenschap van de ridders te liggen en werd een keten met daaraan een medaillon, dier of kruis het gebruikelijke insigne.\\nIn de 17e eeuw werden deze ketens steeds minder gedragen. Men bewaarde ze voor formele gelegenheden en in het dagelijks leven werd een geborduurde ster of een kleinood aan een lint om de hals gedragen. Uit dit kleinood, dat bij het rijden in het gezicht kon slaan en daarom in de 17e eeuw ook wel onder de oksel door werd getrokken, ontwikkelde zich het grootlint. Anderen droegen hun ordeteken liever aan een lint in het knoopsgat."},{"page_url":"https://et.wikipedia.org/wiki/Adrian_(Texas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Old_Route_66%2C_Adrian_Texas.jpg","page_title":"Adrian (Texas)","context_page_description":"Adrian on linn USA-s Texase osariigis Oldhami maakonnas. See asub ajaloolise maantee Route 66 geograafilise keskpunkti lähedal. Linna läbib kiirtee Interstate 40, mis ühtib maanteega Route 66.\\nElanike arv on 2015. aasta seisuga arvestuslikult 167. 2010. aasta rahvaloenduse kohaselt oli elanikke 166.\\nAdrian on saanud nime 1900. aastate alguses sealkandis töötanud farmeri Adrian Culleni järgi.\\n1909. aastal sai Adrian raudteeühenduse, kui sinna jõudis Chicago, Rock Island and Pacific Railroadi raudteeliin.1910. aastaks oli Adrianis postkontor ja mitu poodi ning ilmus ajaleht Adrian Eagle. 1915. aastal elas seal umbes 50 inimest. Pärast Route 66 valmimist hakkas Adrian teenima seal peatuvate möödasõitjate pealt. Samal ajal arenes piirkonnas põllumajandus. 1929. aastal ehitati viljaelevaator ning 1940. aastatel hakkas Adrianis tööle vabatahtlike tuletõrje ühing.\\nAdrian sai linnaõigused 1953. aastal. See on üks kahest linnast maakonnast; teine on maakonna halduskeskus Vega.\\nAdriani nimetab ennast ajaloolise Route 66 keskpunktiks. Linna sildile on märgitud linna kaugus Los Angelesest ja Chicagost, milleks on mõlemal juhul 1139 miili."},{"page_url":"https://uk.wikipedia.org/wiki/WIPI2","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/PBB_GE_WIPI2_214699_x_at_fs.png","page_title":"WIPI2","context_page_description":"WIPI2 – білок, який кодується однойменним геном, розташованим у людей на короткому плечі 7-ї хромосоми. Довжина поліпептидного ланцюга білка становить 454 амінокислот, а молекулярна маса — 49 408.\\nКодований геном білок за функцією належить до фосфопротеїнів.\\nЗадіяний у таких біологічних процесах, як автофагія, альтернативний сплайсинг.\\nЛокалізований у мембрані."},{"page_url":"https://de.wikipedia.org/wiki/Annelie_Grund","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Annelie_Grund.JPG","page_title":"Annelie Grund","context_page_description":"Annelie Grund ist eine deutsche Künstlerin, Glaskünstlerin, Malerin und Musikerin. Sie wohnt in Wandlitz und ist verheiratet mit dem Architekten Manfred Thon."},{"page_url":"https://ca.wikipedia.org/wiki/George_Wesley_Bellows","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/The_Black_Hat_MET_DP236290.jpg","page_title":"George Wesley Bellows","context_page_description":"George Wesley Bellows va ser un pintor i litògraf nord-americà, integrat a l'Escola Ashcan. Famós per les seves escenes en el ring i de la vida urbana a Nova York, fou a més cronista de la primera guerra mundial, paisatgista i un dels millors retratistes de la seva generació."},{"page_url":"https://id.wikipedia.org/wiki/Pustaha","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Pustaha_about_Protection_against_Evil_WDL2895.png","page_title":"Pustaha","context_page_description":"Pustaha, dikenal juga sebagai pustaka dalam kelompok bahasa Batak Utara dan laklak dalam bahasa Simalungun, adalah naskah tradisional Batak yang utamanya digunakan oleh pendeta adat Batak sebagai catatan pribadi mengenai ilmu kedukunan. Naskah ini terbuat dari olahan kulit kayu yang dilipat-lipat dan ditulisi dengan surat Batak, seringkali dengan selingan gambar dan diagram esoteris."},{"page_url":"https://es.wikipedia.org/wiki/Santuario_de_la_naturaleza_Yerba_Loca","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Casa_Piedra_Carvajal.jpg","page_title":"Santuario de la naturaleza Yerba Loca","context_page_description":"El Santuario Natural de Yerba Loca es un área protegida de Chile que se extiende desde la cumbre Poniente del cerro La Paloma por el Cordón de la Sierra Bella por el cerro Littoria hasta la cumbre del cerro El Plomo que divide la cuenca del río Blanco y del río Olivares."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Pacific_Union_College_alumni","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/52/Philip_G._Hoffman_crop.jpg","page_title":"List of Pacific Union College alumni","context_page_description":"This is a list of notable alumni of Pacific Union College, a highly ranked private liberal arts college in California's Napa Valley.\\nPacific Union College has produced a large number of distinguished alumni for a school of its size. It has been noted for being the \\"training ground for an inordinately large number of outstanding physicians, dentists, nurses, teachers and theologians\\" who make up part of its over 50,000 alumni. PUC's notable alumni include members of the United States Congress and California State Assembly; a Harlem Renaissance poet, a professional smooth jazz saxophonist, and others in the arts; multiple presidents of the World Seventh-day Adventist Church, judges, the founder of the Loma Linda University Medical Center, Glendale Adventist Medical Center and Glendale Adventist Hospital; presidents of many institutions of higher education including the University of Houston, La Sierra University and others; among the alumni also numerous scientists, professors, television personalities and even a surgeon in the Japanese Imperial Army."},{"page_url":"https://de.wikipedia.org/wiki/Hebr%C3%A4ische_Universit%C3%A4t_Jerusalem","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/HebrewU-MtScopus.JPG","page_title":"Hebräische Universität Jerusalem","context_page_description":"Die Hebräische Universität von Jerusalem ist die zweitälteste und zugleich bedeutendste Universität Israels mit weltweitem Ruf. Seit dem Jahr 2017 ist Asher Cohen Präsident der Universität. Die ersten Verwaltungsratsposten der Universität wurden unter anderem von Albert Einstein, Sigmund Freud, Martin Buber, Chaim Bialik und Chaim Weizmann bekleidet. Vier der insgesamt neun Ministerpräsidenten Israels sind Absolventen der Universität, welche weiter auch mit acht Nobelpreisträgern und einem Fields-Medaillisten assoziiert wird."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%95%E1%83%94%E1%83%A0%E1%83%9A%E1%83%90","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/Board_calibration_balance.jpg","page_title":"ვერლა","context_page_description":"ვერლა - XIX საუკუნის სამრეწველო სოფელი სამხრეთ ფინეთში, ქალაქ კოუვოლას სიახლოვეს, კიუმენლაასკოს პროვინციაში. 1996 წლიდან შესულია იუნესკოს მსოფლიო მემკვიდრეობის სიაში. სოფელში პირველი ხის გადამამუშავებელი ფაბრიკა 1872 წელს აშენდა, მაგრამ 1876 წელს ხანძარმა გაანადგურა. 1882 წელს აშენდა იგივე პროფილის უფრო მსხვილი ფაბრიკა, რომელიც 1964 წლამდე ფუნქციონირებდა.\\nდღეისათვის, ეს ისტორიული საწარმო ხის გადამამუშავებელი ტექნოლოგიების მუზეუმადაა ქცეული. ისტორიული დანადგარები კვლავ თავიანთ ძველ ადგილებზეა შენარჩუნებული."},{"page_url":"https://vec.wikipedia.org/wiki/Tabor_(Xlovenia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Stara_razglednica_Tabora_03.jpg","page_title":"Tabor (Xlovenia)","context_page_description":"Tabor el xé on comun de ƚa rejon statistega de Savinjska che ƚa fa parte del stato de ƚa Xlovenia."},{"page_url":"https://es.wikipedia.org/wiki/Mannlicher_M1895","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Mannlicher_M1895_sniper_rifle.png","page_title":"Mannlicher M1895","context_page_description":"El Mannlicher M1895, conocido también como el M95, es un fusil de cerrojo diseñado por Ferdinand Ritter von Mannlicher, que empleaba una versión refinada de su revolucionario cerrojo lineal, muy parecido a la carabina Mannlicher M1890. Fue apodado \\"Ruck-Zuck\\" por los soldados austrohúngaros.\\nOriginalmente fueron fabricados para disparar el cartucho con bala de punta redonda 8 x 50 R Mannlicher, pero casi todos fueron modificados para disparar el cartucho con bala spitzer 8 x 56 R más potente en la década de 1930."},{"page_url":"https://en.wikipedia.org/wiki/List_of_tallest_buildings_in_the_United_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Seattle_Washington_Mutual_Tower_2004-08-30.jpg","page_title":"List of tallest buildings in the United States","context_page_description":"The world's first skyscraper was built in Chicago in 1885. Since then, the United States has been home to some of the world's tallest skyscrapers. New York City, specifically the borough of Manhattan, notably has the tallest skyline in the country. Eleven American buildings have held the title of tallest building in the world. New York City and Chicago have always been the centers of American skyscraper building. The 10-story Home Insurance Building, built in Chicago in 1885, is regarded as the world's first skyscraper; the building was constructed using a novel steel-loadbearing frame which became a standard of the industry worldwide.\\nSince its topping out in 2013, One World Trade Center in New York City has been the tallest skyscraper in the United States. Its spire brings the structure to a symbolic architectural height of 1,776 feet, connoting the year the U.S. Declaration of Independence was signed, though the absolute tip of the structure is measured at 1,792 ft. However, the observation deck elevation and highest occupied floor of One World Trade Center are surpassed by 432 Park Avenue and Chicago's Willis Tower."},{"page_url":"https://es.wikipedia.org/wiki/Malaui_en_los_Juegos_Ol%C3%ADmpicos_de_la_Juventud_2018","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Flag_of_Malawi.svg","page_title":"Malaui en los Juegos Olímpicos de la Juventud 2018","context_page_description":"Malaui participó en los Juegos Olímpicos de la Juventud 2018 en Buenos Aires, Argentina, celebrados entre el 6 y el 18 de octubre de 2018. Su delegación estuvo conformada por cuatro atletas en dos disciplinas. No obtuvo medallas en las justas."},{"page_url":"https://en.wikipedia.org/wiki/2014_in_Norwegian_music","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Susanna_Voss_2014.JPG","page_title":"2014 in Norwegian music","context_page_description":"The following is a list of notable events and releases of the year 2014 in Norwegian music."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%9B%84%ED%83%80%EB%A7%88%ED%83%80%EC%98%A4_%EC%97%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Futamatao_Station_Tx-re.jpg","page_title":"후타마타오 역","context_page_description":"후타마타오 역은 일본 도쿄도 오메시에 있는 동일본 여객철도 오메 선의 역이다."},{"page_url":"https://de.wikipedia.org/wiki/%C3%84quatortaufe","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Franz_Josef_Fr%C3%BChbeck_Equator_Io%C3%A2o.jpg","page_title":"Äquatortaufe","context_page_description":"Die Äquatortaufe ist ein weltweit übliches Ritual von Seeleuten, wenn ein Besatzungsmitglied oder ein Passagier zum ersten Mal auf See den Äquator überquert.\\nÄquivalent ist die Polartaufe beim erstmaligen Überqueren des Polarkreises."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Leiden,_Binnenstad-Noord","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Langegracht_61%2C_Leiden.JPG","page_title":"Lijst van gemeentelijke monumenten in Leiden, Binnenstad-Noord","context_page_description":"De wijk Binnenstad-Noord in Leiden heeft 554 gemeentelijke monumenten, hieronder een overzicht."},{"page_url":"https://cs.wikipedia.org/wiki/Lhota_Samoty","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Plan%C3%A1_nad_Lu%C5%BEnic%C3%AD%2C_Lhota_Samoty%2C_south_view.jpg","page_title":"Lhota Samoty","context_page_description":"Lhota Samoty je vesnice, část města Planá nad Lužnicí v okrese Tábor na levém břehu Lužnice. Vlastní vesnice se nachází se 1,5 km na severozápad od Plané nad Lužnicí. Je zde evidováno 243 adres. V roce 2011 zde trvale žilo 177 obyvatel.\\nVlastní vesnice Lhota Samoty leží asi kilometr od Lužnice, ale k místní části patří i chatové osady blíže u řeky, jednak přímo pod vesnicí a pak níže po proudu v místech někdejšího středověkého Nového Města Sezimova Ústí, přes řeku od historického jádra Sezimova Ústí. K místní části patří též mlýn Soukeník. Nedaleko něj bývala tvrz Sedlec, kterou táboři roku 1420 zničili do základů. Z rybníčku ve Lhotě Samotě vytéká bezejmenné potok, který se vlévá zprava do Radimovického potoka nedaleko před jeho ústím do Lužnice.\\nLhota Samoty leží v katastrálním území Planá nad Lužnicí, která má celé výměru 21,42 km²."},{"page_url":"https://it.wikipedia.org/wiki/Cappelle_del_Sacro_Monte_di_Orta","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Sacred_Mount_of_Orta%2C_Dedicated_to_Saint_Francis_of_Assisi_-_twenty_chapels_with_episodes_of_the_life_of_the_saint_-_panoramio_%2812%29.jpg","page_title":"Cappelle del Sacro Monte di Orta","context_page_description":"Il Sacro Monte di Orta fu realizzato a partire dalla fine del Cinquecento per iniziativa dell'abate novarese Amico Canobio. La sua realizzazione venne affidata al padre cappuccino Cleto da Castelletto Ticino, che progettò alcune delle prime cappelle e curò quello che doveva essere il disegno del percorso devozionale nello splendido paesaggio naturale circostante.\\nVenti sono le cappelle costruite fra il XVII e il XVIII secolo: esse offrono testimonianza dei diversi successivi stili architettonici, dal tardo Rinascimento al barocco e al rococò. L'ultimo edificio costruito – la cosiddetta Cappella Nuova- fu progettato nel 1788 da G. F. Santini di Lagna, ma non fu mai ultimato. Il percorso devozionale che si snoda per toccare le varie cappelle lungo un itinerario a spirale, culmina con la chiesa di San Nicolao, un edificio romanico completamente ristrutturato nel Seicento ad imitazione della Basilica Inferiore di Assisi.\\nLa realizzazione dell'apparato decorativo delle cappelle ha visto impegnati molti grandi artisti di area piemontese-lombarda quali Giovanni d'Enrico, Cristoforo Prestinari, Dionigi Bussola, il Morazzone, i Fiammenghini e altri."},{"page_url":"https://ro.wikipedia.org/wiki/Genera%C8%9Bia_Z","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Myopia_Diagram.jpg","page_title":"Generația Z","context_page_description":"Generația Z, sau Gen Z pe scurt, este cohorta demografică ce se succede milenialilor și precede Generația Alpha. Nașterea celor din această generație a început în anul 1990 și s-a terminat în anul 2010. Majoritatea membrilor Generației Z sunt copiii celor din generația X și, uneori, a milenialilor.\\nMajoritatea membrilor Generației Z au folosit tehnologia digitală de la o vârstă fragedă și sunt familiarizați cu internetul și cu social media, dar nu sunt neapărat alfabetizați digital. Generația Z are tendința de a fi cumpătată și de evita riscurile în comparație cu milenialii, și are tendința de a fi mai flexibilă la locurile de muncă. Cu toate acestea, chiar dacă are rate mai mici de fete adolescente cu sarcini, de dependenți de băutură și de droguri în comparație cu generațiile anterioare, generația a fost caracterizată în mass-media și ca fiind anxioasă și deprimată. Unii comentatori cred că aceste efecte au drept cauză timpul acordat rețelelor de socializare, smartphone-urilor, pandemiei Coronavirus și recesiunii provocate de aceasta."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A4%D0%B5%D0%BB%D0%B8%D1%86%D0%B0%D0%BD%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Felizzano.jpg","page_title":"Фелицано","context_page_description":"Фелицано је насеље у Италији у округу Алесандрија, региону Пијемонт.\\nПрема процени из 2011. у насељу је живело 2276 становника. Насеље се налази на надморској висини од 113 м."},{"page_url":"https://it.wikipedia.org/wiki/Aphyocharax_anisitsi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Aphyocharax_anisitsi.jpg","page_title":"Aphyocharax anisitsi","context_page_description":"Aphyocharax anisitsi conosciuto anche come Aphyocharax rubropinnis è un pesce d'acqua dolce appartenente alla famiglia dei Caracidi. È conosciuto comunemente come pinne rosse."},{"page_url":"https://en.wikipedia.org/wiki/Dwight_Hall_Socially_Responsible_Investment_Fund","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/DHSRI_Icon_v2.PNG","page_title":"Dwight Hall Socially Responsible Investment Fund","context_page_description":"Dwight Hall Socially Responsible Investment Fund is an undergraduate-run socially responsible investment fund in the United States. Initially seeded with $50,000 from the Dwight Hall organization endowment, the fund is expected by the Dwight Hall Board of Directors and Trustees to grow to a $500,000 fundraising target. Managed by a committee of twenty undergraduate Yale College students, the fund makes use of traditional methods of socially responsible investing to have a positive environmental and social impact while aiming to outperform standard investment benchmarks and maximize financial return. The Dwight Hall SRI Fund pays out 4.25% of its value to Dwight Hall, which is the umbrella public service and social justice organization on Yale's campus."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D1%82%D0%B8%D1%81%D1%82%D0%B0,_%D0%A4%D1%83%D0%BB%D1%8C%D1%85%D0%B5%D0%BD%D1%81%D0%B8%D0%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/Fulgencio_Batista%2C_president_of_Cuba%2C_1952.jpg","page_title":"Батиста, Фульхенсио","context_page_description":"Рубе́н Фульхе́нсио Бати́ста-и-Сальди́вар — кубинский правитель: фактический военный лидер в 1933—1940 годах, президент в 1940—1944 и 1954—1959 годах, временный президент в 1952—1954 годах. Организатор государственных переворотов 1933 и 1952 годов. Был свергнут в ходе Кубинской революции 1 января 1959 года."},{"page_url":"https://en.wikipedia.org/wiki/Burchell%27s_coucal","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Centropus_burchellii_Limpopo_South_Africa.jpg","page_title":"Burchell's coucal","context_page_description":"Burchell's coucal, is a species of cuckoo in the family Cuculidae. It is found in sub-Saharan Africa. It inhabits areas with thick cover afforded by rank undergrowth and scrub, including in suitable coastal regions. Common names include gewone vleiloerie in Afrikaans and umGugwane in Zulu. It is sometimes considered a subspecies of the white-browed coucal. It is named after the British naturalist William John Burchell."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BD%D0%B0_%D1%82%D0%B2%D1%80%D0%B4%D0%B8%D0%BD%D0%B8_%D0%B2%D0%BE_%D0%9C%D0%B0%D0%BA%D0%B5%D0%B4%D0%BE%D0%BD%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Isar_%28Marvinci%29.jpg","page_title":"Список на тврдини во Македонија","context_page_description":"Ова е список на некои од тврдините во Македонија."},{"page_url":"https://id.wikipedia.org/wiki/Boeing_747","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/KLM_747-400_close_final_%286828175184%29_%282%29.jpg","page_title":"Boeing 747","context_page_description":"Boeing 747, dikenal juga sebagai Jumbo Jet, adalah pesawat penumpang berbadan lebar terbesar kedua saat ini, setelah pesawat A380 beroperasi pada akhir Oktober 2007.\\nPesawat empat mesin ini, diproduksi oleh Boeing Commercial Airplanes, menggunakan konfigurasi dua dek di mana dek atas digunakan untuk kelas bisnis. Konfigurasi 3-kelas mampu menampung 400 penumpang dan konfigurasi 1-kelas mampu menampung 600 penumpang.\\n747 dapat terbang pada kecepatan 0,85 Mach atau 909 kilometer per jam dan mampu terbang dengan jarak maksimum 13.570 km sampai 15.000 km. Pada tahun 1989, Qantas terbang tanpa henti dari London ke Sydney, jarak penerbangan tersebut adalah sejauh 18.000 km dan di selesaikan dalam waktu 20 jam 9 menit. Namun penerbangan itu tidak mengangkut penumpang maupun kargo. Pada Mei 2004, 1382 unit pesawat Boeing 747, dengan berbagai konfigurasi, telah diperbaiki atau disempurnakan, menjadikan 747 salah satu produk Boeing yang paling sukses."},{"page_url":"https://cs.wikipedia.org/wiki/Disotka","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Dissotis_rotundifolia_15.jpg","page_title":"Disotka","context_page_description":"Disotka je rod rostlin z čeledi melastomovité. Jsou to dřeviny i byliny s jednoduchými, vstřícnými nebo přeslenitými listy a čtyř nebo pětičetnými květy. Vyskytují se v počtu asi 75 druhů v subsaharské Africe, jeden druh roste na Madagaskaru. Druh Dissotis rotundifolia je pěstován v tropech na vhodných místech jako okrasná rostlina."},{"page_url":"https://it.wikipedia.org/wiki/Area_di_sicurezza_congiunta","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/OneHoleGolfCourse.jpg","page_title":"Area di sicurezza congiunta","context_page_description":"L'Area di sicurezza congiunta, situata nel paese di Panmunjeom, è l'unico punto di incontro tra le milizie di Corea del Nord e Corea del Sud di tutta la zona demilitarizzata coreana. L'area è utilizzata dalle due Coree per fini diplomatici. Fino al 1991 è stata sede delle negoziazioni militari tra la Corea del Nord e il Comando delle Nazioni Unite.\\nIl complesso Area di Sicurezza Congiunta-villaggio di Panmunjeom viene spesso definito \\"Truce Village\\", sia a livello mediatico sia in alcune documentazioni militari. Le coordinate dell'Area di Sicurezza Congiunta sono 37°57′21″N 126°40′36″E."},{"page_url":"https://fr.wikipedia.org/wiki/Lorry-Mardigny","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Lorry-Mardigny_chateau_de_Mardigny_3.JPG","page_title":"Lorry-Mardigny","context_page_description":"Lorry-Mardigny est une commune française située dans le département de la Moselle en région Grand Est."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%D8%B4%D8%B1%DA%A9%D8%AA%E2%80%8C%D9%87%D8%A7%DB%8C_%D9%87%D9%88%D8%A7%D9%BE%DB%8C%D9%85%D8%A7%DB%8C%DB%8C_%D9%82%D8%B2%D8%A7%D9%82%D8%B3%D8%AA%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Aerotur_KZ_Tupolev_Tu-154M_Mishin.jpg","page_title":"فهرست شرکت‌های هواپیمایی قزاقستان","context_page_description":"این مقاله شامل فهرست شرکت‌های هواپیمایی قزاقستان است.\\nدر سال ۱۹۹۴شرکت ژتیسو اولین خط هوایی قزاقستان را تاسیس کرد،و همین امر موجب شد تا خطوط هواپیمایی بیشتری وارد این کشور بشوند.امروزه از شرکت ژتیسو به عنوان پدر خطوط هواپیمایی قزاقستان یاد میشود."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BA%D0%B0%D1%80%D1%82%D0%B8%D0%BD_%D0%98%D0%B2%D0%B0%D0%BD%D0%B0_%D0%9A%D1%80%D0%B0%D0%BC%D1%81%D0%BA%D0%BE%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Adrian_Prakhov_by_I._Kramskoy.jpg","page_title":"Список картин Ивана Крамского","context_page_description":"Ниже представлен список избранных живописных произведений Ивана Крамского."},{"page_url":"https://it.wikipedia.org/wiki/Stazione_di_Portadown","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Portadown_railway_station_in_1972.jpg","page_title":"Stazione di Portadown","context_page_description":"La stazione di Portadown è una stazione ferroviaria che fornisce servizio a Portadown, contea di Armagh, Irlanda del Nord. Attualmente le linee che vi passano sono la Belfast-Newry, la Belfast-Bangor e soprattutto la Dublino-Belfast. La ferrovia fu aperta il 12 settembre 1842, chiusa il 4 gennaio 1965 per il traffico di merci. Passata sotto il patrocinio della Northern Ireland Railways nel 1970 fu chiamata Portadown-Craigavon, in virtù di una cittadina vicina che non si sviluppò come previsto.\\nLa stazione ha tre binari. Solo il binario 1 ha accesso per le sedie a rotelle, i binari 2 e 3 sono accessibili tramite scale e sottopassaggio. I treni Enterprise possono essere portati sul binario-1 in seguito a specifiche richieste telefoniche."},{"page_url":"https://en.wikipedia.org/wiki/Conowingo,_Maryland","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Maryland_Route_591.jpg","page_title":"Conowingo, Maryland","context_page_description":"Conowingo is a community in western Cecil County, Maryland, United States."},{"page_url":"https://it.wikipedia.org/wiki/Sovrani_di_Boemia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Boles%C5%82aw_III_Rudy.jpg","page_title":"Sovrani di Boemia","context_page_description":"Le Terre della Corona Boema, furono governate da duchi e re."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%BC%AF%E7%B4%8D%E5%BE%B7%C2%B7%E8%98%AD%E6%A0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Bernhard_Langer.jpg","page_title":"伯納德·蘭格","context_page_description":"伯纳德·兰格是一位德国职业高尔夫球选手。他曾经排名世界第一位。并且赢得过两项大满贯赛事的冠军：1985年和1993年的美国名人赛。"},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9Bci%C3%B3%C5%82_Ewangelicko-Augsburski_w_RP","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Our_Savior_Lutheran_Church_in_Szopienice.JPG","page_title":"Kościół Ewangelicko-Augsburski w RP","context_page_description":"Kościół Ewangelicko-Augsburski w Rzeczypospolitej Polskiej – najstarszy i największy Kościół ewangelicki w Polsce i obecnie jedyny Kościół luterański w Rzeczypospolitej Polskiej. Członek Światowej Federacji Luterańskiej, Światowej Rady Kościołów, Konferencji Kościołów Europejskich i Polskiej Rady Ekumenicznej. Organem prasowym jest „Zwiastun Ewangelicki”. Zwierzchnikiem Kościoła jest bp Jerzy Samiec. W 2017 roku Kościół liczył 61 270 wiernych w 133 parafiach."},{"page_url":"https://en.wikipedia.org/wiki/2006_UK_Independence_Party_leadership_election","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Campbell_Bannerman%2C_David-1700.jpg","page_title":"2006 UK Independence Party leadership election","context_page_description":"The UK Independence Party held a leadership election in September 2006.\\nThe Eurosceptic party had been led since 2002 by Roger Knapman. Although he was entitled to stand for second term of office on the expiry of his four-year term, he decided not to."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%85%D9%88%D9%84%D8%AF%D9%88%D8%B1%D9%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/NikolauskircheM%C3%BChldorf.jpg","page_title":"مولدورف","context_page_description":"مولدورف آلمانین بایرن ایالتینده یئر آلان بیر شهردیر و ۳۸۴ متر دنیز سوییه‌سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا ۱۷۶۸۵ نفر دیر. بۇ شهرین ۲۹٫۴۲ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D9%8A%D9%83_%D9%85%D8%A7%D8%B1%D9%8A%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/MikeMareen-05a.jpg","page_title":"ميك مارين","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nميك مارين ملحن مزيكا من المانيا."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BB%D0%B0%D0%B3_%D0%A1%D0%BA%D0%BE%D0%BF%D0%B8%D0%BD%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Flag_of_Ilinskoe_%28Ryazan_oblast%29.png","page_title":"Флаг Скопинского района","context_page_description":"Флаг муниципального образования — Скопи́нский муниципальный район Рязанской области Российской Федерации — опознавательно-правовой знак, составленный и употребляемый в соответствии с российскими и международными вексиллологическими правилами, служащий официальным символом муниципального образования, единства его территории, населения, прав и самоуправления.\\nЦелями учреждения и использования флага Скопинского района являются: создание зримого символа целостности территории района, единства и взаимодействия населяющих его граждан, территориальной и исторической преемственности; воспитание гражданственности, патриотизма, уважения к исторической памяти, национальным, культурным и духовным традициям жителей района.\\nФлаг внесён в Государственный геральдический регистр Российской Федерации с присвоением регистрационного номера 226.\\n26 апреля 2012, решением Скопинской районной Думы № 673, было утверждено положение о флаге Скопинского муниципального района в новой редакции."},{"page_url":"https://zh.wikipedia.org/zh-cn/IWI%E5%A1%94%E6%B2%83%E7%88%BEX95%E7%AA%81%E6%93%8A%E6%AD%A5%E6%A7%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/%D0%9F%D0%B0%D1%80%D0%B0%D0%B4_%D0%B2_%D1%87%D0%B5%D1%81%D1%82%D1%8C_70-%D0%BB%D0%B5%D1%82%D0%B8%D1%8F_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B9_%D0%9F%D0%BE%D0%B1%D0%B5%D0%B4%D1%8B_-_33.jpg","page_title":"IWI塔沃爾X95突擊步槍","context_page_description":"IWI X95是一系列由以色列武器工业专门为特种部队以及通常不使用长管突击步枪的军事人员研制及生产的无托结构突击步枪，亦可通过零件转换套件包变成无托结构冲锋枪，是IMI塔沃尔TAR-21的外型上独立及极其紧凑型武器。突击步枪时分别发射5.56×45毫米北约口径、5.45×39毫米苏联口径和.300 AAC BLK口径步枪子弹，而冲锋枪时则发射9×19毫米帕拉贝鲁姆口径手枪子弹。\\n2009年，以色列国防军宣布塔沃尔X95会被选定为以色列步兵未来的标兵武器。"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Proupiary","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Abbaye_cistercienne_de_Bonnefont.JPG","page_title":"Proupiary","context_page_description":"Proupiary sī ūi-tī Hoat-kok Midi-Pyrénées tōa-khu Haute-Garonne séng ê chi̍t ê commune."},{"page_url":"https://es.wikipedia.org/wiki/Old_Alresford","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/St_Mary_the_Virgin%2C_Old_Alresford_-_geograph.org.uk_-_1504074.jpg","page_title":"Old Alresford","context_page_description":"Old Alresford es una localidad situada en el condado de Hampshire, en Inglaterra, con una población estimada a mediados de 2016 de 578 habitantes.​\\nSe encuentra ubicada al suroeste de la región Sudeste de Inglaterra, cerca de la ciudad de Winchester —la capital del condado—, de la costa del canal de la Mancha y al suroeste de Londres."},{"page_url":"https://de.wikipedia.org/wiki/Elise_Mertens","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Elise_Mertens_4%2C_2015_Wimbledon_Qualifying_-_Diliff.jpg","page_title":"Elise Mertens","context_page_description":"Elise Mertens ist eine belgische Tennisspielerin."},{"page_url":"https://pt.wikipedia.org/wiki/Carmen_McRae","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Carmen_McRae-1980%28by_Barbara_Weinberg_Barefield%29.jpg","page_title":"Carmen McRae","context_page_description":"Carmen Mercedes McRae foi uma cantora de jazz americana. Ela é considerada uma das vocalistas de jazz mais influentes do século XX e é lembrada por seu fraseado por trás do ritmo e interpretação irônica das letras. McRae foi inspirada por Billie Holiday, mas ela estabeleceu sua própria voz. Ela gravou mais de sessenta álbuns e se apresentou em todo o mundo."},{"page_url":"https://fr.wikipedia.org/wiki/BB_63400","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/BB63401_au_d%C3%A9pot_de_Longueau.JPG","page_title":"BB 63400","context_page_description":"Les BB 63400 sont des locomotives diesel de la SNCF, similaires aux BB 63500. Elles sont quasi identiques aux BB 63500, leur numérotation différente est due à leur financement réalisé par l'organisme interbancaire helvétique Eurofima.\\nElles font partie de l'importante famille des BB Brissonneau et Lotz."},{"page_url":"https://it.wikipedia.org/wiki/Stazione_di_Komagata","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Komagata_Station.JPG","page_title":"Stazione di Komagata","context_page_description":"La stazione di Komagata è una stazione ferroviaria di Maebashi, nella prefettura di Gunma gestita dalla JR East."},{"page_url":"https://fi.wikipedia.org/wiki/Hammurabin_laki","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Milkau_Oberer_Teil_der_Stele_mit_dem_Text_von_Hammurapis_Gesetzescode_369-2.jpg","page_title":"Hammurabin laki","context_page_description":"Hammurabin laki on yksi varhaisimmista lakikokoelmista. Se luotiin Babyloniassa noin 1760 eaa. ja siinä on yhteensä 282 lakipykälää, jotka oli kaiverrettu julkisella paikalla olevaan kivipaateen. Laki on nimetty Babylonian tuolloisen kuninkaan Hammurabin mukaan.\\nLain perusajatukseksi on sanottu periaatetta \\"Silmä silmästä, hammas hampaasta\\". Tässä muodossaan fraasi ei kuitenkaan ole peräisin Hammurabin laista vaan Vanhasta testamentista, mutta myös Hammurabin laissa oli erilaisista väkivalta- ym. rikoksista ja veloista säädetty saman periaatteen mukaisia rangaistuksia. Oikeustieteessä tästä periaatteesta käytetään nimeä talio. Eräissä tapauksissa kuitenkin Hammurabin lain mukaankin tuomittiin väkivaltarikoksista vain sakkoa, erityisesti, jos rikos kohdistui alempaan säätyyn kuuluvaan henkilöön.\\nLaki käsitteli lähinnä varkautta, paimentolaisuuteen liittyviä kysymyksiä, omaisuudelle aiheutettua vahinkoa, naisen oikeuksia, avioliittoa, lasten oikeuksia, orjan oikeuksia, murhaa ja erilaisia pahoinpitelyjä sekä kuolemaa. Rangaistukset olivat erilaisia eri yhteiskuntaryhmän jäsenille. Verotuksesta laki ei mainitse mitään."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%97%D7%95%D7%96_%D7%A4%D7%9C%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Wappen_Kreis_Ploen.svg","page_title":"מחוז פלן","context_page_description":"מחוז פְּלֵן הוא מחוז במדינת שלזוויג-הולשטיין שבגרמניה. המחוז גובל במחוז אוסטהולשטיין ובמחוז זגברג, בעיר נוימינסטר, במחוז רנדסבורג-אקרנפרדה, בעיר קיל ובים הבלטי.\\nהמחוז מורכב מחמישה יישובים מאוכלסים בצפיפות לאורך הגבול עם קיל ולחופי לשון-הים קיל, ומעשרות יישובים קטנים יותר, שבכל אחד פחות מאלף תושבים. זהו מחוז המאופיין באגמים רבים, בהם האגם העשירי בגודלו בגרמניה, אגם פלן."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%B8%AD%E5%92%8C%E7%AB%99_(%E6%96%B0%E5%8C%97%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Zhonghe_Station_of_Taipei_Metro_20200214.jpg","page_title":"中和站 (新北市)","context_page_description":"中和站位于台湾新北市中和区，是台北捷运运营中的环状线及兴建中的万大线的交会换乘捷运车站，其中环状线已于2020年1月31日通车，而万大线将于2025年12月底完工。"},{"page_url":"https://sv.wikipedia.org/wiki/M%C3%B6tesplats_(milit%C3%A4r)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/%C3%96stersund%2C_Fr%C3%B6s%C3%B6n%2C_juli_2018_%2838%29.jpg","page_title":"Mötesplats (militär)","context_page_description":"Mötesplats, lägerplats eller exercished var en plats där soldater eller båtsmän samlades inför mönstring i vapen- och trupptjänst eller avresa. Platsen, kallad i regel för hed, var vanligtvis på en ganska stor och öppen plats i landskapet som medgav trupprörelser och större förflyttningar i övningshänseende, av tross, manskap och hästar."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%81%E0%B8%B2%E0%B8%A3%E0%B9%81%E0%B8%82%E0%B9%88%E0%B8%87%E0%B8%A3%E0%B8%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Lap_1%2C_Turn_1_Canada_2008.jpg","page_title":"การแข่งรถ","context_page_description":"การแข่งรถ เป็นมอเตอร์สปอร์ตที่เกี่ยวข้องกับการแข่งโดยใช้รถยนต์สำหรับการแข่งขัน"},{"page_url":"https://da.wikipedia.org/wiki/Kamphelikopter","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/IMG_hellfire467.JPG","page_title":"Kamphelikopter","context_page_description":"Kamphelikoptere er militærhelikoptere, der er skræddersyet til at nedkæmpe pansertropper. Kamphelikoptere er bygget til at modstå beskydning og er svært bevæbnede.\\nAlmindelige helikoptere med tillægspanser og panserværnsmissiler som Fennec, betegnes som \\"panserværnshelikoptere\\".\\nDen amerikanske hær opdagede tidligt i Vietnamkrigen at deres støjende UH-1 Iroquois troppetransporthelikoptere var nemme mål for vietnamesiske Viet Cong-partisaner med Kalasjnikov-automatrifler. Som en nødløsning blev nogle af dem bevæbnet med fremadrettede maskingeværer og ustyrede raketter samt skytter. Dette gjorde dem dog for langsomme i forhold til de rene troppetransporthelikoptere.\\nDe første AH-1 Cobra kamphelikoptere havde samme hovedrotor, hale og Avco Lycoming T53 turboskaftmotor som UH-1, men piloten og skytten sad i tandem, så kroppen var væsentlig smallere. Det gjorde den sværere at ramme forfra og mindskede luftmodstanden. Skytten fjernstyrede et hagetårn med en 7,62 mm gatling og en 40 mm granatkaster, frem for at skulle læne sig ud af UH-1's sidedøre. AH-1 havde anbragt våbenlasten på stubvinger, der bidrog til opdriften. Alt i alt var AH-1 hurtigere, og mere manøvredygtig, end UH-1."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D8%B2%D8%A7%D8%B1_%D8%A7%D9%81%D8%AA%D8%AE%D8%A7%D8%B1%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Premios_Goya_2018_-_Pen%C3%A9lope_Cruz.jpg","page_title":"سزار افتخاری","context_page_description":"سزار افتخاری جایزه ملی فیلم فرانسه است. دریافت‌کنندگان جایزه توسط اعضای آکادمی هنر و فناوری سینما برگزیده می‌شوند. فهرست زیر دریافت‌کنندگان جایزه سزار افتخاری از سال ۱۹۷۶ میلادی می‌باشد."},{"page_url":"https://sv.wikipedia.org/wiki/Mohammed_Bouazizi","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/Tunis_H%C3%B4pital_polytraumatisme.JPG","page_title":"Mohammed Bouazizi","context_page_description":"Tarek al-Tayyib Muhammad abo Bouazizi, mest känd som Mohammed Bouazizi, född 29 mars 1984, död 4 januari 2011, var en tunisisk gatuförsäljare som brände sig själv den 17 december 2010, för att protestera mot konfiskeringen av hans varor och förnedringen som han utsattes för av en kvinnlig polis. Händelsen blev starten för protesterna i Tunisien 2010–2011 med dödliga demonstrationer och uppror över hela Tunisien som en protest mot sociala och politiska problem i landet. Ilska och våld intensifierades efter Bouazizis död, vilket ledde till att den dåvarande presidenten Zine El Abidine Ben Ali klev ner från makten efter 23 år och flydde i exil till Saudiarabien. Bouazizis protest ledde slutligen till protester i flera andra arabländer.\\nEfter att Bouazizi brände sig själv har flera andra efterliknat agerandet i andra arabländer i ett försök att få ett slut på förtrycket de får stå ut med från korrupta autokratiska regeringar. De har tillsammans med Bouazizi hyllats av vissa som \\"heroiska martyrer i en ny revolution i Mellanöstern\\"."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%83%9C%ED%92%8D_%EC%82%AC%EB%9D%BC_(1959%EB%85%84)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Sarah_1959_track.png","page_title":"태풍 사라 (1959년)","context_page_description":"1959년 9월 12일에 발생한 태풍 사라는 열대저기압 등급 중에서 가장 높은 “카테고리 5급”까지 발달했던 태풍으로, 대한민국 최대 명절인 추석날 한반도를 강타하여 당시 사회에 큰 상처를 남겼다. 일본에서는, 미야코섬 태풍으로 불린다. 거의 없는 4등급의 태풍으로 영향을 준 태풍 중 하나이며, 일분 훗카이도까지 1등급의 태풍의 세력을 유지한 매우 강한 태풍으로 기록되었다."},{"page_url":"https://eo.wikipedia.org/wiki/William_Richardson_Linton","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Rev_William_Richardson_Linton_handwriting_source.jpg","page_title":"William Richardson Linton","context_page_description":"Pastro William Richardson LINTON, Corpus Christi College, Oksfordo, M.A., estis angla botanikisto kaj vikario de la paroĥa preĝejo de Shirley, Derbyshire de la Eklezio de Anglio. Li edziĝis kun Alice Shirley la 26-an de januaro 1887, kun kiu li havis filinon, Viola Marion Linton.\\nLinton verkis ampleksan libron pri la flaŭro de Derbyshire, publikigita en 1903. En 1969 la libro estis ĝisdatigita de A.R. Clapham kaj publikigita de Muzeo kaj artgalerio de Derby."},{"page_url":"https://fi.wikipedia.org/wiki/Nymphenburgin_linna","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/M%C3%BCnchen_-_Nymphenburg_%28Luftbild%29.jpg","page_title":"Nymphenburgin linna","context_page_description":"Nymphenburgin linna on barokin tyylisuuntaa edustava palatsi Baijerin pääkaupungissa Münchenissä, Saksassa. Linna oli aikoinaan Baijerin hallitsijoiden kesäresidenssi."},{"page_url":"https://xmf.wikipedia.org/wiki/%E1%83%91%E1%83%94%E1%83%98%E1%83%A0%E1%83%A3%E1%83%97%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Another_rainy_Beirut_day.jpg","page_title":"ბეირუთი","context_page_description":"ბეირუთი — ლიბანიშ ნანანოღა დო უდიდაში ნოღა. მახორობა 1,700,000 კოჩი."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9D%D1%8D%D0%BB%D1%96_%D0%A4%D1%83%D1%80%D1%82%D0%B0%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Nelly_Furtado_at_Radio_Regenbogen_Award_2017_%286%29.jpg","page_title":"Нэлі Фуртада","context_page_description":"Нэлі Кім Фуртада — канадская спявачка, аўтар песень, музычны прадзюсар і актрыса."},{"page_url":"https://it.wikipedia.org/wiki/Piccole_donne","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Houghton_AC85.A%E2%84%93194L.1869_pt.2aa_-_Little_Women%2C_title.jpg","page_title":"Piccole donne","context_page_description":"Piccole donne è il più famoso romanzo di Louisa May Alcott che pubblicò, per la prima volta in due volumi, il primo nel 1868 e il secondo nel 1869 in America, con il titolo Little Women or, Meg, Jo, Beth, and Amy.\\nNel 1880 i due volumi furono riuniti in uno solo, Little Women, che continua ad essere quello letto in America. L'edizione del 1880 presenta anche alcune modifiche, soprattutto nel linguaggio, l'American Idiom, che rispecchiava pienamente il parlato dei personaggi, ma poco conveniente in una prosa letteraria. In Italia le prime parziali traduzioni risalgono al 1908, dove anche dopo si preferì, come del resto in molti altri paesi, come la Francia e l'Inghilterra, dividere il romanzo in due parti, dato il pubblico di ragazzi a cui era destinato, con i due titoli Piccole donne e Piccole donne crescono.\\nIl libro ebbe un successo immediato quando uscì e oggi è considerato un classico della letteratura per l'infanzia, consigliato dagli insegnanti e amato dai bambini."},{"page_url":"https://qu.wikipedia.org/wiki/Vytautas_Landsbergis","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Landsbergis%2C_Vytautas-0085.jpg","page_title":"Vytautas Landsbergis","context_page_description":"Vytautas Landsbergis sutiyuq runaqa huk Lituwa mama llaqtayuq yachaq, qillqaq wan pulitiku qarqan.\\nTaytan: Vytautas Landsbergis-Žemkalnis; Maman: Ona Jablonskytė-Landsbergienė.\\nWarmi: Gražina Ručytė-Landsbergienė.\\nChurinkuna: Jūratė wan Birutė."},{"page_url":"https://gl.wikipedia.org/wiki/Lista_de_lugares_Patrimonio_da_Humanidade_en_Espa%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Valle_ordesa.jpg","page_title":"Lista de lugares Patrimonio da Humanidade en España","context_page_description":"Os sitios do Patrimonio da Humanidade da Organización das Nacións Unidas para a Educación, a Ciencia e a Cultura son lugares de importancia cultural ou natural tal como se describe na Convención do Patrimonio Mundial da UNESCO, creada en 1972. España aceptou a Convención o 4 de maio de 1982, facendo o seu conxunto histórico elixible para a súa inclusión na lista.\\nOs lugares de España inscribíronse por primeira vez na lista na 8ª reunión do Comité do Patrimonio Mundial, celebrada en Buenos Aires, Arxentina en 1984. Nesa sesión, engadíronse cinco sitios: a \\"Mesquita de Córdoba\\"; \\"a Alhambra e o Generalife, en Granada\\"; a \\"Catedral de Burgos\\"; o \\"Mosteiro e lugares do Escorial, Madrid\\"; e o \\"Parc Güell, Palau Güell e Casa Milà, en Barcelona\\" engadíronse cinco sitios en 1985, e outros catro en 1986. Ademais de 1984, 1985, e 1986, 2000 viu a maioría dos novos lugares inscritos, con cinco dese ano. A xuño de 2013, España conta con 45 lugares en total inscritos na lista, terceiro soamente detrás de China e Italia. Destes 45 lugares, 40 son culturais, 3 son naturais, e 2 son mixtos, segundo determinan os criterios de selección da organización."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Prime_Ministers_of_Bulgaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Racho_Petrov.jpg","page_title":"List of Prime Ministers of Bulgaria","context_page_description":"This is a list of the heads of government of the modern Bulgarian state, from the establishment of the Principality of Bulgaria to the present day."},{"page_url":"https://pl.wikipedia.org/wiki/Villar-Saint-Anselme","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Villar-Saint-Anselme_Castle_4325.JPG","page_title":"Villar-Saint-Anselme","context_page_description":"Villar-Saint-Anselme – miejscowość i gmina we Francji, w regionie Oksytania, w departamencie Aude.\\nWedług danych na rok 1990 gminę zamieszkiwały 112 osoby, a gęstość zaludnienia wynosiła 19 osób/km²."},{"page_url":"https://pl.wikipedia.org/wiki/Carpentum","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Dictionary_of_Roman_Coins.1889_P185S0_illus198.gif","page_title":"Carpentum","context_page_description":"Carpentum – rodzaj wozu używanego w starożytnym Rzymie do różnych celów.\\nZasadniczo był to kryty pojazd dwukołowy zaprzężony w parę mułów, pierwotnie służący w terenie do transportu i podróży. Później używany także w środowisku miejskim, gdzie korzystali z niego urzędnicy, m.in. kapłani udający się na Kapitol, oraz kobiety: matrony i westalki, a od czasów Augusta – także cesarzowe, zwłaszcza podczas uroczystości publicznych.\\nOsobnym jego przeznaczeniem – jako carpentum funebre, było podczas uroczystości pogrzebowych przewożenie prochów oraz wymaganych przez tradycję wizerunków zmarłych. Takie carpentum było okazalsze, wyposażone w zasłony i odpowiednio zdobione. Wygląd jego znany jest z rewersów monet okolicznościowych – sestercjuszy emitowanych m. in. dla Julii córki Augusta, żony Germanika – Agrypiny Starszej czy Julii córki Tytusa.\\nNierzadko potem nazywano tak pojazd czterokołowy z zaprzęgiem konnym, podobny do zwanego thensa, który zawsze był jednak zwykłym transportowym wozem otwartym."},{"page_url":"https://de.wikipedia.org/wiki/Acht_Ecken_(Potsdam)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Bundesarchiv_Bild_170-297%2C_Potsdam%2C_%22Acht_Ecken%22.jpg","page_title":"Acht Ecken (Potsdam)","context_page_description":"Die Acht Ecken waren ein in den Jahren 1771–1774 von Georg Christian Unger im Stil des Rokoko geschaffenes Bauensemble an der Kreuzung von Schwertfegerstraße und Hohewegstraße in Potsdam."},{"page_url":"https://es.wikipedia.org/wiki/Funes_(Santa_Fe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Cementerio_Funes_Jardin.jpg","page_title":"Funes (Santa Fe)","context_page_description":"Funes es una ciudad de la provincia de Santa Fe, Argentina. Conocida como el «Jardín de la Provincia», se encuentra en el departamento Rosario y forma parte del Gran Rosario. Dista 15 km al oeste del microcentro de Rosario, 170 km al sur de la ciudad capital provincial, 310 km al norte de Buenos Aires y 400 km al sureste de Córdoba. Su ejido municipal se extiende también por el departamento San Lorenzo.​\\nEl clima​ es húmedo y templado en la mayor parte del año. Se lo clasifica como clima templado pampeano.\\nLa población es mayoritariamente de clase media y se registra el más bajo porcentaje de población con necesidades básicas insatisfechas. Contaba con 23,520 habitantes fijos y se estimó en el año 2015 que se habían superado los 35 mil habitantes fijos.​ Una extensa arboleda y el suelo elevado le otorgan a esta ciudad, particulares condiciones ambientales que son altamente requeridas en la búsqueda de nuevas residencias."},{"page_url":"https://fr.wikipedia.org/wiki/Cerviculture","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Elevage_Cerf_002.jpg","page_title":"Cerviculture","context_page_description":"La cerviculture est l'activité visant à faire naître des espèces de la famille des Cervidae, au profit de l’activité humaine. Ces animaux sont considérés comme du gibier d’élevage, au même titre que les ratites d’élevage et les mammifères terrestres d’élevage autres que les ongulés domestiques. Au niveau européen, la Grande Bretagne est la plus grande productrice de cerfs avec 50 000 individus, et l’Allemagne est la plus grande productrice de daims avec 60 000 individus. En France, on ne dénombre que 130 élevages professionnels de cerfs et de daims d’élevages. La cerviculture requiert l’acquisition d’un certificat de capacité propre à l’espèce que l’éleveur doit demander auprès du préfet et des services vétérinaires."},{"page_url":"https://ast.wikipedia.org/wiki/Orxeta","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Orcheta-Orxeta_3_-_Esferofoto_Plaza_Dr._Ferr%C3%A1ndiz.jpg","page_title":"Orxeta","context_page_description":"Orcheta ye un conceyu de la Comunidá Valenciana, España. Asitiáu na provincia d'Alicante, na comarca de la Marina Baxa. Cuenta con 760 habitantes."},{"page_url":"https://tr.wikipedia.org/wiki/%C4%B0T%C3%9C_G%C3%BCne%C5%9F_Arabas%C4%B1_Ekibi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/2005_formula-g.JPG","page_title":"İTÜ Güneş Arabası Ekibi","context_page_description":"2004 yılında İTÜ Elektrik Mühendisliği bölümü öğrencileri tarafından kurulan İTÜ Güneş Arabası Ekibi, üniversite–sanayi–öğrenci üçgenini güçlendirmeyi, bu süreçte de alternatif enerji kaynaklarının önemini vurgulayarak güneş enerjisine dikkat çekmeyi kendine hedef edinmiştir.\\nİTÜ-GAE, Türkiye’de ilk defa düzenlenmiş güneş arabaları yarışı olan TÜBİTAK Formula G Güneş Arabaları Yarışı 2005 için çalışmalara başlamış ve ilk aracı olan ARIBA I’i üretmiştir. Bunu takip eden yıllarda sırası ile 2006 yılında ARIBA II, 2007 yılında ARIBA III, 2009 yılında ARIBA IV ve 2011 yılında ARIBA V adlı araçları tasarlayarak üretmiştir.\\nİTÜ GAE, ARIBA adını verdiği bu projeler serisi sayesinde teori ile uygulamayı birleştirerek alınan eğitimin kalitesini artıracağını kanıtlamıştır."},{"page_url":"https://simple.wikipedia.org/wiki/2020","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Sushant_Singh_Rajput_at_KAI_PO_CHE%27s_premiere_%28cropped%29.jpg","page_title":"2020","context_page_description":"2020 is a leap year starting on Wednesday in the Gregorian calendar and is the current year. It is the first year of the 2020s. It is the 20th year of the 21st century.\\nThe 2019–20 coronavirus pandemic has led to severe global economic and social disruption."},{"page_url":"https://nl.wikipedia.org/wiki/President_Manuel_A._Roxas","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/02/Ph_locator_zamboanga_del_norte_pres._manuel_a._roxas.png","page_title":"President Manuel A. Roxas","context_page_description":"Pres. Manuel A. Roxas is een gemeente in de Filipijnse provincie Zamboanga del Norte op het eiland Mindanao. Bij de laatste census in 2007 had de gemeente bijna 36 duizend inwoners."},{"page_url":"https://fr.wikipedia.org/wiki/Chester_Nimitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Adm_Chester_Nimitz-1942.jpg","page_title":"Chester Nimitz","context_page_description":"Chester William Nimitz, Sr. a été le troisième et le plus jeune amiral de la Flotte de la Marine des États-Unis, durant la Seconde Guerre mondiale. Il a été nommé Commandant-en-chef de la Flotte du Pacifique en décembre 1941 et Commandant-en-chef interarmées des Zones de l'Océan Pacifique en avril 1942, commandements qu'il a exercés jusqu'en décembre 1945. Il a fini sa carrière comme premier Chef des Opérations navales de l'après-guerre."},{"page_url":"https://de.wikipedia.org/wiki/Katharinenufer","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Trier_Katharinenufer_6.jpg","page_title":"Katharinenufer","context_page_description":"Das Katharinenufer ist eine Straße am Rande der Trierer Innenstadt. Es läuft parallel zum Moselufer zwischen Krahnenufer und Martinsufer."},{"page_url":"https://en.wikipedia.org/wiki/Portuguese_Romanesque_architecture","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/43/Solar_de_Barbosa.jpg","page_title":"Portuguese Romanesque architecture","context_page_description":"The Romanesque style of architecture was introduced in Portugal between the end of the 11th and the beginning of the 12th century. In general, Portuguese cathedrals have a heavy, fortress-like appearance, with crenellations and few decorative elements apart from portals and windows. Portuguese Romanesque cathedrals were later extensively modified, among others the Old Cathedral of Coimbra, although it only had some minor changes.\\nChronological and geographical distribution of Romanesque buildings in Portugal are intimately connected with the territorial organization emerging from the Reconquista, being the fundamental reason for the differences between a locally influenced artistical phenomenon in the North of the country and a more \\"international\\" kind in buildings like Coimbra and Lisbon cathedrals. Romanesque architecture first developed in Minho and Douro regions spreading later southwards to Coimbra. It is in the rural areas of the northwest and center regions that Romanesque buildings are more concentrated, being more dense in the margins of rivers Douro and Mondego."},{"page_url":"https://sv.wikipedia.org/wiki/Privat_omr%C3%A5de_(skylt)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Private_area_sign.JPG","page_title":"Privat område (skylt)","context_page_description":"Privata skyltar med fraser som privat område, privat mark, privat badplats, etc, ibland med tillägg som exempelvis obehöriga äga ej tillträde, används med syftet att stänga allmänheten ute från olika platser."},{"page_url":"https://ceb.wikipedia.org/wiki/Yumbo_(lungsod)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/Escudo_de_yumbo.jpg","page_title":"Yumbo (lungsod)","context_page_description":"Lungsod ang Yumbo sa Kolombiya. Nahimutang ni sa departamento sa Departamento del Valle del Cauca, sa kasadpang bahin sa nasod, 290 km sa kasadpan sa Bogotá ang ulohan sa nasod. 991 metros ibabaw sa dagat kahaboga ang nahimutangan sa Yumbo, ug adunay 71,436 ka molupyo.\\nAng yuta palibot sa Yumbo kay lain-lain. Ang kinahabogang dapit sa palibot dunay gihabogon nga 1,413 ka metro ug 2.3 km sa amihanan-kasadpan sa Yumbo. Dunay mga 308 ka tawo kada kilometro kwadrado sa palibot sa Yumbo nga hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Cali, 16.5 km sa habagatan sa Yumbo. Hapit nalukop sa kaumahan ang palibot sa Yumbo.\\nAng klima nga savanna. Ang kasarangang giiniton 23 °C. Ang kinainitan nga bulan Pebrero, sa 24 °C, ug ang kinabugnawan Hunyo, sa 20 °C. Ang kasarangang pag-ulan 1,874 milimetro matag tuig. Ang kinabasaan nga bulan Oktubre, sa 229 milimetro nga ulan, ug ang kinaugahan Hulyo, sa 64 milimetro."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%80%D1%85%D0%B8%D1%82%D0%B5%D0%BA%D1%82%D1%83%D1%80%D0%B0_%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D0%BE%D0%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Rietveld-SchroderhuisUtrechttheNetherlands.jpg","page_title":"Архитектура Нидерландов","context_page_description":"Архитектура Нидерландов.\\nРазвитие архитектуры на территории современного западно-европейского государства Нидерланды как составляющая искусства Нидерландов началось и активно продолжалось во 2-м тысячелетии н. э., пройдя в той или иной степени все этапы европейской архитектуры, а также во многом повлияло на общеевропейское развитие жилищного и промышленного зодчества.\\nОднозначного ответа относительно определения нидерландского национального стиля в архитектуре нет, но бесспорным остается факт, что именно нидерландская готика имеет наибольшую историческую преемственность на территории страны, её больше использовали строители-искатели и последователи историзма и XIX веке; своеобразными на нидерландских землях были ренессанс и классицизм."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B9%D5%A5%D5%B4%D5%AB%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Taemin_at_a_fansign_at_IFC_Mall_in_February_2016_05.jpg","page_title":"Թեմին","context_page_description":"Թեմին, հարավկորեացի երգիչ, SHINee բոյ-բենդի անդամ։"},{"page_url":"https://es.wikipedia.org/wiki/Arquitectura_tallada_en_la_roca_en_India","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Lomas_Rishi_entrance.jpg","page_title":"Arquitectura tallada en la roca en India","context_page_description":"La arquitectura tallada en la roca, también arquitectura rupestre, de la India se refiere a las construcciones excavadas o esculpidas en cuevas, grutas o paredes rocosas por las civilizaciones antiguas de la India, la más variada y que se encuentra en mayor abundancia en ese país que en cualquier otro país del mundo.​ La arquitectura tallada en la roca es la práctica de crear una edificación tallando en la roca natural sólida, retirando la roca que no formeparte de la edificación, hasta que la única roca que quede conforme los elementos arquitectónicos del interior excavado. La arquitectura india tallada en la roca es en su mayoría de naturaleza religiosa.​​\\nHay más de 1500 edificaciones conocidas talladas en la roca en la India, la mayoría adornadas con exquisitas tallas de piedra y muchas de ellas albergan obras de arte de importancia mundial. Estas edificaciones antiguas y medievales representan logros significativos de la ingeniería estructural y de la artesanía.​\\nEn la India, las cuevas han sido consideradas desde antiguo como lugares sagrados, condición que mantenían las cuevas que eran agrandadas o hechas por el hombre, tan sagradas como las cuevas naturales."},{"page_url":"https://ca.wikipedia.org/wiki/Carpomys_phaeurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Carpomys_ph%C3%A6urus_and_Carpomys_malanurus.jpg","page_title":"Carpomys phaeurus","context_page_description":"Carpomys phaeurus és una espècie de rosegador de la família dels múrids. És endèmic de l'illa de Luzon, on viu a altituds d'entre 2.100 i 2.500 msnm. Es tracta d'un animal arborícola. El seu hàbitat natural són els boscos molsosos. Es creu que no hi ha cap amenaça significativa per a la supervivència d'aquesta espècie. El seu nom específic, phaeurus, significa 'cua clara' en llatí."},{"page_url":"https://sk.wikipedia.org/wiki/La_Bastide-de-Bousignac","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/Map_commune_FR_insee_code_09039.png","page_title":"La Bastide-de-Bousignac","context_page_description":"La Bastide-de-Bousignac je francúzska obec, ktorá sa nachádza v departemente Ariège, v regióne Midi-Pyrénées."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_gi%C3%A1o_ho%C3%A0ng","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/138-Gregory_V.jpg","page_title":"Danh sách giáo hoàng","context_page_description":"Danh sách các Giáo hoàng tại đây dựa vào niên giám Annuario pontificio được Vatican ấn hành hàng năm. Theo niên giám đó, cho đến nay đã có 264 Giáo hoàng của Giáo hội Công giáo Rôma. Một vị được chọn vào năm 752 nhưng vì mất đột ngột sau đó 3 ngày, trước khi được tấn phong Giám mục, nên đã bị loại tên khỏi niên giám kể từ năm 1961.\\nẤn bản năm 2001 đang được dùng phổ biến hiện nay của Annuario Pontificio đã giới thiệu với gần 200 sửa chữa về tiểu sử của các Giáo hoàng. Khởi đầu từ Thánh Phêrô, vị Giáo hoàng đầu tiên, cho đến Giáo hoàng Gioan Phaolô II. Các sự điều chỉnh này liên quan đến ngày tháng, nơi sinh, tên gia đình của từng vị Giáo hoàng. Thuật ngữ Giáo hoàng là vị Giám mục của Giáo phận Rôma, lãnh đạo của Giáo hội Công giáo toàn thế giới. Theo quan điểm của Giáo hội Công giáo, Giáo hoàng là người kế vị Thánh Phêrô - tông đồ trưởng của Chúa Giêsu. Thời gian nhiệm chức của một Giáo hoàng được gọi là triều đại giáo hoàng\\" và thẩm quyền của ông đối với giáo hội thường được gọi là \\"quyền tông tòa\\" mà thực thể đại diện quyền lực đó gọi là Tòa Thánh, dựa trên truyền thống Giáo hội cho rằng đó là chiếc ngai tòa của Thánh Phêrô và Thánh Phaolô khi tử đạo tại Roma."},{"page_url":"https://es.wikipedia.org/wiki/(10001)_Palermo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/AnimatedOrbitOf10001Palermo.gif","page_title":"(10001) Palermo","context_page_description":"(10001) Palermo es un asteroide que forma parte del cinturón de asteroides y fue descubierto por Liudmila Ivánovna Chernyj el 8 de octubre de 1969 desde el Observatorio Astrofísico de Crimea, en Naúchni."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%95%E0%A8%BE%E0%A9%B1%E0%A8%95%E0%A8%A8%E0%A8%BE%E0%A8%A6%E0%A8%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/KakkanadanDSCN4051.JPG","page_title":"ਕਾੱਕਨਾਦਨ","context_page_description":"ਜਾਰਜ ਵਰਗੀਜ਼ ਕਾੱਕਨਦਾਨ, ਜਿਸ ਨੂੰ ਆਮ ਤੌਰ 'ਤੇ ਕਾੱਕਨਦਾਨ ਕਿਹਾ ਜਾਂਦਾ ਹੈ, ਮਲਿਆਲਮ ਭਾਸ਼ਾ ਵਿੱਚ ਇੱਕ ਭਾਰਤੀ ਕਹਾਣੀਕਾਰ ਅਤੇ ਨਾਵਲਕਾਰ ਸੀ। ਉਸ ਦੀਆਂ ਰਚਨਾਵਾਂ ਨਵ-ਯਥਾਰਥਵਾਦ ਨਾਲੋਂ ਟੁੱਟ ਗਈਆਂ ਜਿਸ ਨੇ 1950 ਅਤੇ 1960 ਦੇ ਦਹਾਕਿਆਂ ਦੌਰਾਨ ਮਲਿਆਲਮ ਸਾਹਿਤ ਦਾ ਦਬਦਬਾ ਬਣਾਇਆ ਹੋਇਆ ਸੀ। ਉਸਨੂੰ ਅਕਸਰ ਮਲਿਆਲਮ ਸਾਹਿਤ ਵਿੱਚ ਆਧੁਨਿਕਤਾ ਦੀ ਬੁਨਿਆਦ ਰੱਖਣ ਦਾ ਸਿਹਰਾ ਦਿੱਤਾ ਜਾਂਦਾ ਹੈ। ਉਹ ਕਈ ਹੋਰ ਪੁਰਸਕਾਰਾਂ ਅਤੇ ਮਾਨਤਾਵਾਂ ਤੋਂ ਇਲਾਵਾ ਕੇਂਦਰੀ ਸਾਹਿਤ ਅਕਾਦਮੀ ਅਵਾਰਡ ਅਤੇ ਕੇਰਲ ਸਾਹਿਤ ਅਕਾਦਮੀ ਅਵਾਰਡਾਂ ਦੁਆਰਾ ਸਨਮਾਨਿਤ ਕੀਤਾ ਗਿਆ ਸੀ।"},{"page_url":"https://de.wikipedia.org/wiki/C%C3%A4cilienstra%C3%9Fe_62_und_64_(Heilbronn)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/Hn-caecilienstr62-64-Detail-6.jpg","page_title":"Cäcilienstraße 62 und 64 (Heilbronn)","context_page_description":"Das Doppelhaus Cäcilienstraße 62 und 64 ist ein historisches Gebäude und Kulturdenkmal in Heilbronn."},{"page_url":"https://en.wikipedia.org/wiki/Anarchism_in_Italy","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Novatore.jpg","page_title":"Anarchism in Italy","context_page_description":"Italian anarchism as a movement began primarily from the influence of Mikhail Bakunin, Giuseppe Fanelli, and Errico Malatesta. Rooted in collectivist anarchism, it expanded to include illegalist individualist anarchism, anarcho-syndicalism, and especially anarcho-communism. It participated in the biennio rosso and survived Italian fascism. Platformism and insurrectionary anarchism were particularly common in Italian anarchism and continue to influence the movement today. The synthesist Italian Anarchist Federation appeared after the war, and autonomismo and operaismo especially influenced Italian anarchism in the second half of the 20th century."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9F%D0%B5%D0%B4%D0%B0%D0%B3%D0%BE%D1%88%D0%BA%D0%B8_%D1%84%D0%B0%D0%BA%D1%83%D0%BB%D1%82%D0%B5%D1%82_%D0%A3%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D0%B7%D0%B8%D1%82%D0%B5%D1%82%D0%B0_%D1%83_%D0%9D%D0%BE%D0%B2%D0%BE%D0%BC_%D0%A1%D0%B0%D0%B4%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Zgrada_Preparandije.jpg","page_title":"Педагошки факултет Универзитета у Новом Саду","context_page_description":"Педагошки факултет Сомбор је факултет у саставу Универзитета у Новом Саду са локацијом у граду Сомбору."},{"page_url":"https://sv.wikipedia.org/wiki/Charmian_Carr","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Evening_Primrose_Anthony_Perkins_Charmian_Carr_1966_redone.jpg","page_title":"Charmian Carr","context_page_description":"Charmian Carr, född Charmian Anne Farnon den 27 december 1942 i Chicago, Illinois, död 17 september 2016 i Woodland Hills, Los Angeles, var en amerikansk skådespelare och sångare. Carr är främst känd för att hon spelade sextonåriga Liesl von Trapp i filmen Sound of Music från 1965."},{"page_url":"https://pl.wikipedia.org/wiki/Paolo_Veneziano","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Paolo_Veneziano_002.jpg","page_title":"Paolo Veneziano","context_page_description":"Paolo Veneziano, także Veneziano Paolo lub Paolo da Venezia - średniowieczny malarz z Wenecji.\\nTypowe dla jego twórczości było kontynuowanie elementów bizantyńskich wraz z obróbką typowych elementów gotyckich. Nie można jednak u niego jeszcze zaobserwować wpływu florenckiego malarstwa renesansowego, które za jego życia obserwuje się w niedalekiej Padwie w Kaplicy Scrovegnich ozdabianej przez Giotto di Bondone. Bywa nazywany \\"najważniejszym weneckim malarzem XIV wieku\\".\\nUrodził się w rodzinie artystów, pracował razem ze swym synami Marco, Luca, i Giovanni. Był oficjalnym malarzem Andrea Dandolo, dla którego namalował m.in. Pala Feriale w \\"Złotym pałacu\\" Bazyliki św. Marka w Wenecji."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%91%D0%BE%D0%B1%D0%B8_%D0%A4%D0%B0%D1%80%D0%B5%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Boney_M_Bobby_Farrell_2006.jpg","page_title":"Боби Фарел","context_page_description":"Роберто „Боби“ Алфонсо Фарел е известен поп изпълнител и танцьор от близкото минало, най-известен като участник в световноизвестната диско група от 70-те и 80-те години на ХХ век Бони М."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%98%BF%E6%A0%B9%E5%BB%B7%E6%B9%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/SantaCruz-PeritoMoreno-P2140146b.jpg","page_title":"阿根廷湖","context_page_description":"阿根廷湖 位于圣克鲁斯省的巴塔哥尼亚地区，是阿根廷全国面积最大的淡水湖。湖泊面积1415平方千米，最大宽度有32km。湖水的平均深度为50m，最深深度150m。\\n阿根廷湖位于冰川国家公园内，130多条冰河、三大冰川融化的冰水注入阿根廷湖。北角为享誉世界的莫雷诺冰川。该湖旁的别德马湖的水源来自拉利昂娜河和一些山的溪流。两者流域涉及的面积超过17000平方公里。湖水通过400公里长的圣克鲁斯河最后注入大西洋。"},{"page_url":"https://nl.wikipedia.org/wiki/Blenina_chlorophila","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/A52-20160704-073_%2829020113353%29.jpg","page_title":"Blenina chlorophila","context_page_description":"Blenina chlorophila is een vlinder uit de familie van de visstaartjes. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1905 door Hampson."},{"page_url":"https://fr.wikipedia.org/wiki/Tour_de_la_province_de_Namur_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Jambes_%28Namur%29_-_Tour_de_la_province_de_Namur%2C_%C3%A9tape_1%2C_6_ao%C3%BBt_2014%2C_d%C3%A9part_%28B054%29.JPG","page_title":"Tour de la province de Namur 2014","context_page_description":"La 67ᵉ édition du Tour de la province de Namur a lieu du 6 au 10 août 2014, en Belgique."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%82%D8%A7%D8%B7%D8%B9%D8%A9_%D8%A8%D8%A7%D9%8A%D9%85%D8%A7%D9%83%D8%B3%D9%83%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Coat_of_Arms_of_Baimak_rayon_%28Bashkortostan%29.png","page_title":"مقاطعة بايماكسكي","context_page_description":"مقاطعة بايماكسكي هي مقاطعة إدارية وبلدية، واحدة من أربعة وخمسين مقاطعة في جمهورية باشكورتوستان، روسيا. تقع في الجنوب الشرقي للجمهورية وتحدها مقاطعة أبزيليلوفسكي في الشمال ومقاطعة تشيليابينسك وإقليم مدينة ذات الأهمية الفيدرالية لسيباي في الشرق ومقاطعة خيبولنسكي في الجنوب ومع مقاطعة زيلايرسكي في الجنوب والغرب. تبلغ مساحة المقاطعة 5,432 كيلومتر مربع. مركزها الإداري هو مدينة بيماك. حسب تعداد عام 2010، كان مجموع سكان المقاطعة 40862 نسمة."},{"page_url":"https://hu.wikipedia.org/wiki/Angra_do_Hero%C3%ADsmo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Coat_of_arms_of_Angra_do_Heroismo_Azores.jpg","page_title":"Angra do Heroísmo","context_page_description":"Angra do Heroísmo község és egyben város Terceira szigetén, a Portugáliához tartozó, autonóm önkormányzattal rendelkező Azori-szigeteken. A város népessége 2011-ben 35 402 fő volt, akik 239 km² területen éltek. A város és község alkotja Terceira szigetének déli felét, míg az északi rész Praia da Vitória község területéhez tartozik. A São Miguel-szigeten fekvő Ponta Delgadával, valamint a Faial-szigeten fekvő Hortával együtt Angra az egyike az Azori-szigetek három régiós központjának. Mindegyik régiós központ a kormányzat egy-egy ágáért felelős, Angra például a legfelsőbb bíróságnak ad otthont. Itt lakik az Azori-szigetek érseke is.\\nA várost a 15. század második felében alapították. A Napóleoni háborúk idején Angrába volt száműzve Almeida Garrett. 1830 és 1833 között II. Mária portugál királynő menedékeként is szolgált e város. A város 1983-ban került fel az UNESCO Világörökségi helyszíneinek listájára."},{"page_url":"https://es.wikipedia.org/wiki/Ruta_Estatal_de_California_113","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/California_State_Route_113_Map.svg","page_title":"Ruta Estatal de California 113","context_page_description":"La Ruta Estatal de California 113, y abreviada SR 113 es una carretera estatal estadounidense ubicada en el estado de California. La carretera inicia en el Sur desde la SR 12 cerca de Río Vista hacia el Norte en la SR 99 cerca de Yuba City. La carretera tiene una longitud de 94,9 km.​"},{"page_url":"https://pt.wikipedia.org/wiki/Ilha_de_S%C3%A3o_Miguel","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Santuario_de_Senhor_Santo_Cristo_%284616740146%29.jpg","page_title":"Ilha de São Miguel","context_page_description":"São Miguel é a maior das ilhas do arquipélago dos Açores e a maior de todas as ilhas integrantes do território de Portugal. Com uma superfície de 748,82 km², mede 64,7 quilómetros de comprimento e de 8–15 km de largura e conta com uma população 16 habitantes, Os Furtado, havendo esta crescido 4,4%, relativamente ao que se registou no Censo de 2001, de acordo com os dados estatísticos do Censo de 2011. É composta pelos concelhos de Lagoa, Nordeste, Ponta Delgada, Povoação, Ribeira Grande e Vila Franca do Campo.\\nAo natural, ou habitante, da ilha de São Miguel, dá-se o nome de micaelense."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%D8%B3_%D8%A8%D9%88%D8%B1%D9%84%D9%86%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/13-06-07_RaR_LB_Wes_Borland_01.jpg","page_title":"وس بورلند","context_page_description":"وسلی لودن \\"وس\\" بورلند با نام مخفف وس متولد ۷ فوریه ۱۹۷۵، در ریچموند، ویرجینیا، ایالات متحده آمریکا یک موسیقیدان آمریکایی است. او ترانه‌سرای اصلی و لید گیتاریست گروه بلک لایت برنز، و همچنین گیتارنواز گروه لیمپ بیزکت می‌باشد."},{"page_url":"https://es.wikipedia.org/wiki/Museo_Valenciano_de_Etnolog%C3%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Cultura_material_%28Museu_Valenci%C3%A0_d%27Etnologia%29.jpg","page_title":"Museo Valenciano de Etnología","context_page_description":"El Museo Valenciano de Etnología se encuentra ubicado en la calle Corona número 36 de la ciudad de Valencia.\\nFue creado en 1982 y abrió sus puertas al público en 1983.​ Sus objetivos son la investigación y difusión en el campo de la Etnología y la Antropología, poniendo al alcance del público un espacio dinámico de conocimiento y reflexión sobre la diversidad cultural que caracteriza a los humanos en dos ámbitos complementarios:​\\nPor una parte, el propiamente valenciano, centrándose en las pautas culturales de la sociedad tradicional valenciana y su proceso de tránsito a la sociedad industrializada, sin dejar de lado las nuevas formas culturales de la contemporaneidad.\\nPor otra parte, el ámbito general de las culturas, desde las mediterráneas, más próximas a nosotros y que nos enmarcan directamente, hasta las propias de ámbitos geográficos más lejanos.\\nEste centro está administrado por la Diputación de Valencia, ​ y tiene como sede el Centro Cultural la Beneficencia. En 2007 contaba con 15.000 piezas en su colección, ​ siendo el museo de referencia en lo que a cultura tradicional valenciana se refiere.​"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D1%80%D0%B0%D0%BE_(%D0%B2%D0%B0%D0%B7%D0%B4%D1%83%D1%85%D0%BE%D0%BF%D0%BB%D0%BE%D0%B2%D0%BD%D0%B0_%D1%98%D0%B5%D0%B4%D1%80%D0%B8%D0%BB%D0%B8%D1%86%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/02/Boris_Cijan.jpg","page_title":"Орао (ваздухопловна једрилица)","context_page_description":"Орао је високо способна једрилица Отворене класе. Једрилица је једноседа саграђена од дрвета а производила се у Југославији а намењена је спортским такмичењима и тренажи пилота једрилица."},{"page_url":"https://ro.wikipedia.org/wiki/Maria_Anna_de_Austria_(1882%E2%80%931940)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Habsburg%E2%80%93Tescheni_M%C3%A1ria_Anna_1902-52.jpg","page_title":"Maria Anna de Austria (1882–1940)","context_page_description":"Arhiducesa Maria Anna Isabelle Epiphanie Eugenie Gabriele de Austria, a fost membră a ramurei Teschen a Casei de Habsburg-Lorena, Arhiducesă de Austria și Prințesă a Boemiei, Ungariei și Toscanei prin naștere. Prin căsătoria cu Prințul Elias de Bourbon-Parma, Maria Anna a devenit membră a Casei de Bourbon-Parma și Prințesă de Bourbon-Parma."},{"page_url":"https://nl.wikipedia.org/wiki/Geschiedenis_van_Lieshout","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Woods-Place.jpg","page_title":"Geschiedenis van Lieshout","context_page_description":"De geschiedenis van Lieshout als dorp begon in de achtste eeuw, toen de Franken een domein stichtten in een onbevolkt gebied in het zuidwesten van de huidige gemeente Laarbeek in de Nederlandse provincie Noord-Brabant. Menselijke bewoning was er op die plaats al in de prehistorie en het gebied is continu bewoond geweest tussen ongeveer 1000 v.Chr. en 225 n.Chr.\\nOmstreeks 1190 schonk de heer van Lieshout het domein aan de abdij van Floreffe. In de eeuwen daarna verkreeg Lieshout de status van heerlijkheid en werd het bezit ervan overgedragen aan de abdij van Postel. In 1698 verkocht deze abdij vrijwel alle goederen van de heerlijkheid aan de pachters en enkele particuliere beleggers. De abdij verkocht de resterende goederen, evenals alle rechten die het klooster in Lieshout bezat, in 1714 aan Adriaan Bout, telg van een Hollandse adellijke familie.\\nDoor de hervormingen die tijdens en na de Franse tijd doorgevoerd werden, kwam er een eind aan de bestuurlijke bevoegdheden en de jurisdictie van de heerlijkheid Lieshout."},{"page_url":"https://pl.wikipedia.org/wiki/G%C3%B6ssitz","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Wappen_Goessitz.png","page_title":"Gössitz","context_page_description":"Gössitz – miejscowość i gmina w Niemczech, w kraju związkowym Turyngia, w powiecie Saale-Orla, wchodzi w skład wspólnoty administracyjnej Ranis-Ziegenrück."},{"page_url":"https://pt.wikipedia.org/wiki/Batalha_de_Berlim","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Bundesarchiv_Bild_146-1985-092-29%2C_vor_Berlin%2C_Volkssturm_mit_Panzerabwehrwaffe.jpg","page_title":"Batalha de Berlim","context_page_description":"A Batalha de Berlim, designada de Operação Ofensiva Estratégica de Berlim pela União Soviética, também conhecida como Queda de Berlim, foi uma das últimas grandes ofensivas militares lançadas na Europa durante a Segunda Guerra Mundial.\\nApós a Ofensiva no Vistula–Oder de janeiro–fevereiro de 1945, o Exército Vermelho pausou suas operações, detendo suas tropas a cerca de 60 km a leste de Berlim, a capital do Terceiro Reich. Em 9 de março, a Alemanha estabeleceu seu plano defensivo para a cidade com a Operação Clausewitz. As primeiras defesas nas cercanias de Berlim começaram a ser erguidas em 20 de março, sob a direção do general Gotthard Heinrici, comandante do Grupo de Exércitos Vístula.\\nQuando os soviéticos recomeçaram suas ofensivas, a 16 de abril, dois grupos de exército atacaram Berlim pelo leste e pelo sul, enquanto uma terceira tropa atacava as posições alemãs ao norte da capital. Antes de atacar diretamente a cidade, o Exército Vermelho começou cercando ela após as bem sucedidas batalhas em Seelower Höhen e Halbe."},{"page_url":"https://de.wikipedia.org/wiki/Charlton","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Charlton_House.jpg","page_title":"Charlton","context_page_description":"Charlton ist ein Arbeiterviertel im Royal Borough of Greenwich im Südosten der britischen Hauptstadt London, zu dem ein Teil der Docklands am Fluss Themse gehören. Im Zweiten Weltkrieg erlitt der Ort schwere Schäden.\\nAls Nachbarviertel von Greenwich hat sich Charlton gegenüber anderen Gebieten in Südost-London eher gut entwickelt, jedoch ist Charlton weiterhin eine Gegend mit hohem Kriminalitätsaufkommen und überdurchschnittlich hoher Arbeitslosigkeit.\\nEin sehenswertes Gebäude in Charlton ist das Charlton House, ein Herrenhaus im jakobinischen Stil, erbaut in den Jahren 1607 bis 1612.\\nIn Charlton ist der in der englischen Football League Championship spielende Charlton Athletic FC zu Hause."},{"page_url":"https://hu.wikipedia.org/wiki/Szerbia_az_Eurov%C3%ADzi%C3%B3s_Dalfesztiv%C3%A1lokon","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/ESC2016_-_Serbia_06.jpg","page_title":"Szerbia az Eurovíziós Dalfesztiválokon","context_page_description":"Szerbia eddig tizenkét alkalommal vett részt az Eurovíziós Dalfesztiválon.\\nA szerb műsorsugárzó a Radio Televizija Srbije, amely 2001-ben lett tagja az Európai Műsorsugárzók Uniójának, és 2004-ben csatlakozott a versenyhez Szerbia és Montenegró tagjaként. 2007-től vesznek részt független államként. Fehéroroszország mellett a másik ország, amely előbb vett részt a Junior Eurovíziós Dalfesztiválon, mint az Eurovíziós Dalfesztiválon"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BC%D0%B1%D0%B5%D1%80%D0%BB%D0%B5%D0%BD%D0%B4_%D0%A2%D0%B0%D1%83%D0%BD%D1%88%D0%B8%D0%BF_(%D0%BE%D0%BA%D1%80%D1%83%D0%B3_%D0%93%D1%80%D1%96%D0%BD,_%D0%9F%D0%B5%D0%BD%D1%81%D0%B8%D0%BB%D1%8C%D0%B2%D0%B0%D0%BD%D1%96%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Stevenson_Lane_farmhouse.jpg","page_title":"Камберленд Тауншип (округ Грін, Пенсильванія)","context_page_description":"Камберленд Тауншип — селище в США, в окрузі Грін штату Пенсильванія. Населення — 6623 особи."},{"page_url":"https://ckb.wikipedia.org/wiki/%D8%A8%DB%95%D9%86%D8%AF%D8%A7%D9%88%DB%8C_%DA%AF%D8%A7%DA%95%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Garan_dam%2C_Panorama.jpg","page_title":"بەنداوی گاڕان","context_page_description":"بەنداوی گاڕان بەنداوێکی خاکییە بە بەرزاییی ٦٢ مەتر لەسەر چەمی گاڕان لە شارستانی مەریوان و لە نزیکی گوندەکانی دوێسە و وێڵە لە ساڵی ٢٠٠٢ەوە خەریکە دروست دەکرێت."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E8%98%87%E5%9F%83%E6%96%AF%E5%8D%A1","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b8/RocasDeSuesca.JPG","page_title":"蘇埃斯卡","context_page_description":"蘇埃斯卡是哥倫比亞的城鎮，位於該國中部，由昆迪納馬卡省負責管轄，距離首府波哥大59公里，始建於1537年3月14日，海拔高度2,718米，主要經濟活動有園藝業和農業，2005年人口13,985。"},{"page_url":"https://en.wikipedia.org/wiki/Centre_Sportif_de_la_Charri%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/La_Charriere-big_stand.JPG","page_title":"Centre Sportif de la Charrière","context_page_description":"Stade de la Charrière is a multi-purpose stadium in La Chaux-de-Fonds, Switzerland. It is currently used mostly for football matches and is the home ground of FC La Chaux-de-Fonds. The stadium has 2,500 seats and 10,200 standing places."},{"page_url":"https://de.wikipedia.org/wiki/Anton_Kirchner","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Frankfurt_Am_Main-Anton_Kirchner-AVFAM-Titelblatt.jpg","page_title":"Anton Kirchner","context_page_description":"Anton Kirchner war ein deutscher evangelischer Pfarrer, Historiker, Lehrer und Schulreformer."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%86%D5%AB%D5%AF%D5%B8%D5%AC%D5%A1_%D4%BC%D5%A5%D5%A3%D6%80%D5%B8%D5%BF%D5%A1%D5%AC%D5%AB%D5%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Nicola_legrottaglie.png","page_title":"Նիկոլա Լեգրոտալիե","context_page_description":"Նիկոլա Լեգրոտալիե, իտալացի պաշտպան:"},{"page_url":"https://en.wikipedia.org/wiki/Westcott_railway_station","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/3rd_duke_governor_madras.jpg","page_title":"Westcott railway station","context_page_description":"Westcott railway station was a small station built to serve the village of Westcott, Buckinghamshire, and nearby buildings attached to Baron Ferdinand de Rothschild's estate at Waddesdon Manor. It was built by the Duke of Buckingham in 1871 as part of a short horse-drawn tramway to allow for the transport of goods from and around his extensive estates in Buckinghamshire and to connect the Duke's estates to the Aylesbury and Buckingham Railway at Quainton Road. A lobbying campaign by residents of the town of Brill led to the tramway being converted for passenger use and extended to Brill railway station in 1872, becoming known as the Brill Tramway.\\nCheaply built and ungraded, and using poor quality locomotives, services on the line were very slow, initially limited to 5 miles per hour. In the 1890s it was planned to extend the tramway to Oxford, but the scheme was abandoned. Instead, the operation of the line was taken over by the Metropolitan Railway in 1899."},{"page_url":"https://en.wikipedia.org/wiki/Kerala","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Regional_Cancer_Centre%2C_Trivandrum.jpg","page_title":"Kerala","context_page_description":"Kerala is a state on the southwestern Malabar Coast of India. It was formed on 1 November 1956, following the passage of the States Reorganisation Act, by combining Malayalam-speaking regions of the erstwhile states of Travancore-Cochin and Madras. Spread over 38,863 km², Kerala is the twenty-first largest Indian state by area. It is bordered by Karnataka to the north and northeast, Tamil Nadu to the east and south, and the Lakshadweep Sea to the west. With 33,387,677 inhabitants as per the 2011 Census, Kerala is the thirteenth-largest Indian state by population. It is divided into 14 districts with the capital being Thiruvananthapuram. Malayalam is the most widely spoken language and is also the official language of the state.\\nThe Chera Dynasty was the first prominent kingdom based in Kerala. The Ay kingdom in the deep south and the Ezhimala kingdom in the north formed the other kingdoms in the early years of the Common Era. The region had been a prominent spice exporter since 3000 BCE. The region's prominence in trade was noted in the works of Pliny as well as the Periplus around 100 CE."},{"page_url":"https://it.wikipedia.org/wiki/Distretto_di_Yabrasbamba","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Escudo_amazonasregion.png","page_title":"Distretto di Yabrasbamba","context_page_description":"Il distretto di Yabrasbamba è un distretto del Perù nella provincia di Bongará con 6.043 abitanti al censimento 2007 dei quali 2.234 urbani e 3.809 rurali.\\nÈ stato istituito il 26 dicembre 1870."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8E%D5%A1%D5%B0%D5%A1%D5%B6_%D5%8F%D5%A5%D6%80%D5%B5%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/%D5%8E%D5%A1%D5%B0%D5%A1%D5%B6_%D5%8F%D5%A5%D6%80%D5%B5%D5%A1%D5%B6_%2811%29.JPG","page_title":"Վահան Տերյան","context_page_description":"Վահան Տերյան, նշանավոր հայ բանաստեղծ, քնարերգու և հասարակական-քաղաքական գործիչ։"},{"page_url":"https://en.wikipedia.org/wiki/P%C3%A9ter_Koll%C3%A1r","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Angel_zbejsi_Adama_pa_Evo_z_paradizoma_%28Mala_biblia_z-kejpami%2C_1897%29.JPG","page_title":"Péter Kollár","context_page_description":"Péter Kollár Slovene Peter Kolar Hungarian Slovenian Roman Catholic priest and writer.\\nBorn in Ratkovci, his parents were Péter Kollár and Judit Zselezen. He was consecrated on 13 July 1882. He was chaplain in Črenšovci until 1885 later parish clerk in Bogojina. In 1885-1887 he was chaplain in Murska Sobota, after that he spent one year in Beltinci, one year in Turnišče. By 1900 he became priest of Beltinci.\\nIn 1897 wrote a biblical coursebook in Slovenian language."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D0%BA%D1%80%D1%83%D0%B3_%D0%9B%D0%BE%D1%80%D0%B5%D0%BD%D1%81_(%D0%88%D1%83%D0%B6%D0%BD%D0%B0_%D0%94%D0%B0%D0%BA%D0%BE%D1%82%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Lawrence_county_south_dakota_courthouse.jpg","page_title":"Округ Лоренс (Јужна Дакота)","context_page_description":"Округ Лоренс је округ у америчкој савезној држави Јужна Дакота."},{"page_url":"https://sv.wikipedia.org/wiki/George_Everest","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/GeorgeEverest.jpeg","page_title":"George Everest","context_page_description":"Sir George Everest, född 4 juli 1790 på Gwernvale Manor nära Crickhowell i Powys i Wales, död 1 december 1866 i Greenwich i London, var en brittisk överste och geograf. Han var Surveyor-General of India 1830-1843.\\nEverest ansvarade för uppmätningen av den Indiska halvön. Arbetet påbörjades under hans företrädare William Lambton 1806 och avslutades under hans efterträdare Andrew Waugh. Det var under den sistnämnde som Mount Everest uppmättes och namngavs efter George Everest.\\nEverest genomgick sin militära utbildning på Woolwich. 1806 sändes han till Indien som kadett i artilleriförbandet the Bengal Artillery. Han deltog sedan i den topografiska rekognosceringen av Java 1814-1816. Everest utsågs 1818 till assistent åt Lambton vid den trigonometriska uppmätningen av Indiska halvön. Everest efterträdde denne 1823 som ansvarig för de pågående mätningarna av Indien, för att 1830 utses till Surveyor-General of India. 1841 fullbordade han den indiska meridiangradmätningen, som han beskrev i Measurement of two sections of the meridional arc of India etc.\\nEverest pensionerades 1843 och återvände då till England, där han valdes in i Royal Society."},{"page_url":"https://pl.wikipedia.org/wiki/Samoch%C3%B3d_pancerny_wz._34","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Prototyp_samochodu_pancernego_wz._34_-_wczesny_kamufla%C5%BC.jpg","page_title":"Samochód pancerny wz. 34","context_page_description":"Samochód pancerny wz. 34 – lekki samochód pancerny produkcji polskiej z okresu dwudziestolecia międzywojennego. Był to podstawowy sprzęt Wojska Polskiego tej kategorii w kampanii wrześniowej."},{"page_url":"https://en.wikipedia.org/wiki/Cornwall,_Ontario","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Cornwall_ON_1.JPG","page_title":"Cornwall, Ontario","context_page_description":"Cornwall is a city in Eastern Ontario, Canada, and the seat of the United Counties of Stormont, Dundas and Glengarry. Cornwall is Ontario's easternmost city, located on the Saint Lawrence River in the Quebec City–Windsor Corridor along Ontario Highway 401, and is the urban centre for surrounding communities, including Long Sault and Ingleside to the west, Mohawk Territory of Akwesasne to the south, St. Andrew's and Avonmore to the north, and Glen Walter, Martintown, Apple Hill, Williamstown, and Lancaster to the east.\\nCornwall lies on the 45th parallel, approximately 100 km southeast of Ottawa, the national capital, 120 km southwest of Montreal, Quebec's largest city, and 440 km northeast of Toronto, the provincial capital and Canada's largest city. It is named after the English Duchy of Cornwall; the City's coat of arms is based on that of the duchy with its colours reversed and the addition of a \\"royal tressure\\", a Scottish symbol of royalty.\\nIts largest industries include logistics distribution and call centres."},{"page_url":"https://sv.wikipedia.org/wiki/Entombed","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Nico_Elgstrand_in_Borl%C3%A4nge_2011-12-08_%2813%29.jpg","page_title":"Entombed","context_page_description":"Entombed är ett svenskt death metal-band som bildades ur banden Morbid och Nihilist 1989. Debutalbumet Left Hand Path gavs ut 1990."},{"page_url":"https://vi.wikipedia.org/wiki/%C4%90%E1%BB%93ng_b%E1%BA%B1ng_s%C3%B4ng_C%E1%BB%ADu_Long","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/%C4%90%C6%B0%E1%BB%9Dng_H%C3%B9ng_V%C6%B0%C6%A1ng.jpg","page_title":"Đồng bằng sông Cửu Long","context_page_description":"Vùng đồng bằng sông Cửu Long là vùng cực nam của Việt Nam, còn được gọi là Vùng đồng bằng sông Mê Kông, Vùng đồng bằng Nam Bộ, Vùng Tây Nam Bộ, Cửu Long hoặc theo cách gọi của người dân Việt Nam ngắn gọn là Miền Tây, có 1 thành phố trực thuộc trung ương là thành phố Cần Thơ và 12 tỉnh: Long An, Tiền Giang, Bến Tre, Vĩnh Long, Trà Vinh, Hậu Giang, Sóc Trăng, Đồng Tháp, An Giang, Kiên Giang, Bạc Liêu và Cà Mau. Theo số liệu của Tổng cục Thống kê Việt Nam năm 2019, Đồng bằng sông Cửu Long là đồng bằng có tổng diện tích các tỉnh, thành phố trực thuộc Trung ương lớn nhất Việt Nam và có tổng dân số toàn vùng là 17.273.630 người. Đồng bằng sông Cửu Long chiếm 13% diện tích cả nước nhưng có gần 18% dân số cả nước, tốc độ tăng trưởng kinh tế cao hơn cả nước. Chỉ riêng lúa đã chiếm 47% diện tích và 56% sản lượng lúa cả nước; xuất khẩu gạo từ toàn vùng chiếm tới 90% sản lượng. Chưa kể thủy sản chiếm 70% diện tích, 40% sản lượng và 60% xuất khẩu cả nước, ... Tuy nhiên, Đồng bằng sông Cửu Long đứng về phương diện thu nhập vẫn còn nghèo hơn cả nước: thu nhập bình quân đầu người với mức 54 triệu đồng."},{"page_url":"https://gl.wikipedia.org/wiki/Arte_fenicia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/ByblosObeliskTemple.jpg","page_title":"Arte fenicia","context_page_description":"Arte fenicia é a denominación historiográfica da arte da civilización fenicia, tanto o das metrópoles fenicias do Mediterráneo oriental como o das colonias fenicias. Para a produción artística da principal colonia fenicia, Cartago, adoita empregarse o termo arte cartaxinés ou arte púnica.\\nAs producións artísticas fenicias teñen un forte compoñente artesanal. Nas súas esculturas, cerámicas, xoias e obxectos de metal, predominaban a [influencias exipcias, con elementos asirios, nun primeiro período. Nun segundo período pasou a predominar a influencia grega, chegando ás veces a confundirse as súas producións coas gregas, aínda que, polo xeral, detéctase unha maior tosquedade e eclecticismo do artista fenicio nas obras dos seus obradoiros.\\nA arte fenicia influíu en gran medida na dos pobos indíxenas da Península Ibérica.\\nAs formas de arquitectura fenicia inférense máis polos debuxos dos selos e outros relevos que polas ruínas dos seus edificios; aínda que non faltan algúns restos de pezas arquitectónicas achados en Chipre e -Fenicia. Entre estes, figura o capitel con volutas, inspirado na arte oriental e que ben puido ser o antecesor do orde xónica."},{"page_url":"https://en.wikipedia.org/wiki/House_of_Limburg-Stirum","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Coloma_kasteel_Sint-Pieters-Leeuw_40625_IMG_3987-MD.jpg","page_title":"House of Limburg-Stirum","context_page_description":"The house of Limburg Stirum, which adopted its name in the 12th century from the immediate county of Limburg an der Lenne in what is now Germany, is one of the oldest families in Europe. It is the eldest and only surviving branch of the House of Berg, which was among the most powerful dynasties in the region of the lower Rhine during the Middle Ages. Some historians link them to an even older dynasty, the Ezzonen, going back to the 9th century.\\nThe Limburg-Stirum were imperial counts within the Holy Roman Empire, until they were mediatised in 1806 by the Confederation of the Rhine. Although undisputedly a mediatised comital family, having enjoyed a dynastic status for over 600 years until the collapse of the Empire, they were omitted from the Almanach de Gotha because the branches of the family possessing mediatised lands were extinct by the time that the Congress of Vienna established the German Confederation's obligation to recognise their dynastic status."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B6%D0%B0%D1%81%D1%82%D1%96%D0%BD_%D0%91%D1%96%D0%B1%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Justin_Bieber_in_2015.jpg","page_title":"Джастін Бібер","context_page_description":"Джа́стін Дрю Бі́бер — канадський поп співак, автор пісень і актор. Кар'єра Бібера розпочалася в 2008-му році, коли Скутер Браун натрапив на одне із його відео на YouTube, та згодом став його менеджером. Браун домовився про зустріч Джастіна з Ашером в Атланті, штат Джорджія, де Бібер підписав угоду з Raymond Braun Media Group, власниками якої були Браун та Ашер. За деякий час він також підписав угоду із звукозаписуючою компанією Island Records, власником якої є L.A. Reid.\\nДебютний сингл Бібера, «One Time», був випущений 2009 року та одразу ж здобув перше місце в Канадському рейтингу топ-10, а також у топ-30 в інших міжнародних чартах. Його дебютний реліз, My World, який вийшов у листопаді 2009-го, став платиновим у Сполучених Штатах. Він став першим виконавцем, який має одразу сім пісень із дебютного альбому в рейтингах Billboard Hot 100. Перша студійна платівка, My World 2.0, котра побачила світ у травні 2010-го року і одразу ж здобула перші місця та місця в десятці найкращих альбомів у декількох країнах, також отримала статус платинового в США. Виходу повноцінного альбому передував всесвітній успіх синглу «Baby»."},{"page_url":"https://en.wikipedia.org/wiki/1992_Republican_National_Convention","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Reliant_Astrodome_in_January_2014.jpg","page_title":"1992 Republican National Convention","context_page_description":"The 1992 Republican National Convention was held in the Astrodome in Houston, Texas, from August 17 to August 20, 1992. The convention nominated President George H. W. Bush and Vice President Dan Quayle for reelection. It was Bush's fourth consecutive appearance as a candidate on a major party ticket; only Bush and Franklin D. Roosevelt have been nominated on four consecutive presidential tickets. Richard M. Nixon and Roosevelt were nominated five times, but not consecutively."},{"page_url":"https://it.wikipedia.org/wiki/Cumbernauld","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Cumbernauld_railway_station.jpg","page_title":"Cumbernauld","context_page_description":"Cumbernauld è una New Town del Regno Unito nell'area amministrativa scozzese del Lanarkshire Settentrionale, istituita nel 1956 per fare fronte all'eccedenza di popolazione della vicina Glasgow.\\nVanta più di 52 000 abitanti, che ne fanno l'ottavo insediamento più popoloso della Scozia e il più popoloso della sua area.\\nLa città è stata due volte vincitrice del Carbuncle award, insignito dalla rivista Urban Realm; la città da allora ha ricevuto il premio di Best Town dalla Scottish Design Awards 2012."},{"page_url":"https://de.wikipedia.org/wiki/Kokoretsch","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Kokoretsi.jpg","page_title":"Kokoretsch","context_page_description":"Kokoretsch ist eine türkische Spezialität und besteht aus klein geschnittenen, gegrillten bzw. gebratenen Lamm-Därmen. Es wird sowohl als Imbiss im türkischen Baguette als auch auf dem Teller mit Beilagen serviert als Hauptmahlzeit gegessen. Kokoreç ist in der gesamten Türkei bekannt und sehr beliebt. Auch in den Ländern der Balkanhalbinsel ist es verbreitet."},{"page_url":"https://de.wikipedia.org/wiki/P%C3%B6ls_(Gemeinde_P%C3%B6ls-Oberkurzheim)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/P%C3%B6ls-Allerheiligen_-_Schloss_Gusterheim_-_2.jpg","page_title":"Pöls (Gemeinde Pöls-Oberkurzheim)","context_page_description":"Pöls ist eine ehemalige Marktgemeinde im österreichischen Bundesland Steiermark mit 2259 Einwohnern im Gerichtsbezirk Judenburg, Bezirk Murtal. Seit 2015 ist Pöls im Rahmen der steiermärkischen Gemeindestrukturreform mit der Gemeinde Oberkurzheim zusammengeschlossen, die neue Gemeinde führt den Namen „Pöls-Oberkurzheim“."},{"page_url":"https://es.wikipedia.org/wiki/La_Rivi%C3%A8re-Drugeon","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Map_commune_FR_insee_code_25493.png","page_title":"La Rivière-Drugeon","context_page_description":"La Rivière-Drugeon es una comuna y población de Francia, en la región de Franco Condado, departamento de Doubs, en el distrito y cantón de Pontarlier.\\nSu población en el censo de 1999 era de 645 habitantes.\\nEstá integrada en la Communauté de communes du Plateau de Frasne et du Val de Drugeon."},{"page_url":"https://tr.wikipedia.org/wiki/Emet","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Kutahya_districts.png","page_title":"Emet","context_page_description":"Emet Kütahya ilinin bir ilçesidir. Şifalı kaplıcalarıyla termal turizme önemli katkıda bulunmaktadır. 17 Ekim 1993 günü Bakanlar Kurulu kararıyla “Termal Turizm Bölgesi” ilan edilmiştir. Ayrıca dünyada rezervi çok az bulunan bor madeni bu ilçede bol miktarda çıkarılabilmektedir. Hatta dünyanın bor rezervlerinin yaklaşık %70 Türkiye'de bulunmasının yanında Türkiye'deki borun %50'den fazlası Emet'te bulunmakta iken Emet ilçesinde yeni bulunan rezervler sayesinde bu oran daha da yükselmiştir. Bunlara ilaveten dünyada sayısı 10'u gecmeyen asit borik fabrikalarından biri de bu ilçede faaliyetlerini sürdürmektedir. Borun başkenti Emet ilçesi bor madeni sebebiyle stratejik ve ekonomik olarak Türkiye'ye çok büyük katkılar sağlamaktadır.\\nŞehirde sülfatlı, bikarbonatlı, kalsiyumlu, magnezyulu hipertermal ve hipotonik özellikler taşıyan kaplıcalar bulunmaktadır."},{"page_url":"https://vec.wikipedia.org/wiki/Gertwiller","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Facade_lips_photo.jpg","page_title":"Gertwiller","context_page_description":"Gertwiller el xé on comun de 1 250 abitanti del departemento de Bas-Rhin che el fa parte del rejon Grand Est in Fransa."},{"page_url":"https://ca.wikipedia.org/wiki/Gran_Premi_d%27Espanya_de_Motocr%C3%B2s_125cc","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Gaston_Rahier_Circuit_Montgai_1978_B.jpg","page_title":"Gran Premi d'Espanya de Motocròs 125cc","context_page_description":"El Gran Premi d'Espanya de Motocròs en la cilindrada de 125cc, abreujat GP d'Espanya de 125cc, fou una prova puntuable per al Campionat del Món de motocròs que es va celebrar a l'estat espanyol entre 1975 i 2003, el darrer any en què es disputà un campionat d'aquesta categoria abans no fos reconvertida a l'actual MX2.\\nSorgit com a continuació del Trofeu Ramon Monsonís, que es venia disputant a Montgai d'ençà de 1966, el Gran Premi d'Espanya es disputà gairebé sempre al llarg de la seva història a Catalunya -primer a Montgai i després a Bellpuig-, tret de dues edicions que es van fer a Morón de la Frontera i una altra a Jerez de la Frontera. D'entre tots aquests escenaris, el més reeixit fou potser el Circuit del Cluet de Montgai, on l'organitzà el Moto Club Segre de 1975 a 1986, essent considerat a la seva època com a un dels millors esdeveniments del calendari internacional."},{"page_url":"https://cs.wikipedia.org/wiki/Ve%C5%99ejn%C3%A9_osv%C4%9Btlen%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/%C5%A0t%C3%ADtek_VO.jpg","page_title":"Veřejné osvětlení","context_page_description":"Veřejné osvětlení je osvětlení ulic, silnic, chodníků nebo jiných veřejných prostranství. Veřejné osvětlení je veřejně prospěšnou službou. V Česku je zařízení veřejného osvětlení podle zákona o pozemních komunikacích příslušenstvím pozemních komunikací. Proto je zpravidla vlastní obec nebo jiný vlastník komunikace. Mimo pozemní komunikace, například v uzavřených areálech, v budovách nebo na železničních stanicích, zřizuje a vlastní osvětlení obvykle vlastník nebo provozovatel pozemku nebo objektu, totéž se zpravidla týká i veřejně přístupných účelových komunikací, zejména pokud je nevlastní obec.\\nOsvětlovací soustava zahrnuje svítidla, podpěrné a nosné prvky, elektrický rozvod, rozvaděče a ovládací systém."},{"page_url":"https://de.wikipedia.org/wiki/Leben_und_Zeit_des_Michael_K.","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Stellenbosch_WC_ZA.jpg","page_title":"Leben und Zeit des Michael K.","context_page_description":"Leben und Zeit des Michael K. ist ein Roman des südafrikanischen Autors und späteren Literaturnobelpreisträgers J. M. Coetzee, der 1983 erschien. Im gleichen Jahr wurde er mit dem Booker Prize ausgezeichnet, 1984 mit dem CNA Literary Award. Der Roman beschreibt aus der Perspektive vor dem Ende der Apartheid ein stark fiktionalisiertes Südafrika der Zukunft, das sich in einem Bürgerkrieg befindet, und zählt zu Coetzees meistrezipierten Texten. Hauptfigur ist der schweigsame und als geistig einfach beschriebene Gärtner Michael K., der seine Mutter in einem Handkarren durch die Kriegswirren zu ihrer Geburtsfarm bringen will. Im Verlauf der Handlung stirbt die Mutter, was Michael K. nicht daran hindert, die Reise mit ihrer Asche fortzusetzen. Der etwa 200 Seiten lange Text wechselt dabei mehrfach die Erzählperspektive. Leben und Zeit des Michael K. behandelt Fragen nach Machtverhältnissen, politischem Widerstand und Individualität und ist reich an Bezügen zu anderen Texten. Auch Sprache, Kommunikation und zwischenmenschliche Verständigung sind zentrale Themen."},{"page_url":"https://en.wikipedia.org/wiki/Yashpal_Sharma_(actor)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Yashpal_Sharma.jpg","page_title":"Yashpal Sharma (actor)","context_page_description":"Yashpal Sharma is an Indian Bollywood actor and theatre artist. He is best known for his role as Randhir Singh in Sudhir Mishra's 2003 Hindi movie Hazaaron Khwaishein Aisi, apart from Lagaan, Gangaajal, Ab Tak Chhappan, Apaharan, Lakshyam, Singh Is Kinng, Aarakshan, Rowdy Rathore and Bharat Ane Nenu. He played Kuwar Singh in Zee's Mera Naam Karegi Roshan. Yashpal is also a stage actor and appears in live plays. He formerly starred in Zee's Neeli Chhatri Waale. The Haryanvi film Pagdi: The Honour was awarded at the 62nd National Film Awards."},{"page_url":"https://pt.wikipedia.org/wiki/Muraenidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Ribbon_Moray_%28Rhinomuraena_quaesita%29_%286052858389%29.jpg","page_title":"Muraenidae","context_page_description":"Muraenidae é uma família de peixes ósseos anguiliformes, que agrupa as espécies conhecidas pelos nomes comuns de moreias e moreões. Uma das principais características deste grupo é o corpo longo e cilíndrico, semelhante em configuração a uma serpente. Conhecem-se cerca de 200 espécies, distribuídas por 15 géneros, das quais a maior mede 4 metros de comprimento. Os murenídeos habitam cavidades rochosas e são carnívoros, caçando com base num olfacto muito apurado. Não têm escamas, para protecção, algumas espécies segregam da pele um muco que contém toxinas. A maior parte das moreias não tem barbatanas peitorais ou pélvicas. A sua pele tem padrões elaborados que servem como camuflagem."},{"page_url":"https://en.wikipedia.org/wiki/George_M._Brown","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/George_M._Brown_1910.JPG","page_title":"George M. Brown","context_page_description":"George M. Brown was an American attorney and judge in the state of Oregon. He was the 50th Associate Justice of the Oregon Supreme Court and the 5th attorney general of the state from 1915 to 1920. An Oregon born and educated attorney, he previously worked as a district attorney in Southern Oregon."},{"page_url":"https://azb.wikipedia.org/wiki/%DA%A9%D9%88%DA%A9%D8%B1%D9%85%D9%88%D8%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Poole_Quay_-_geograph.co.uk_636450.jpg","page_title":"کوکرموث","context_page_description":"کوکرموث بریتانیادا بیر یاشاییش منطقه‌سی‌دیر سوْن نۆفوس تخمین‌لرینه گؤره 8761 نفر دیر. بۇ شهر اینگیلیس اؤلکه‌سینده یئرلشیب."},{"page_url":"https://en.wikipedia.org/wiki/Nyan_Boateng","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Nyan_Boateng_at_EWU_at_Cal_2009-09-12.jpg","page_title":"Nyan Boateng","context_page_description":"Nyan Boateng is a former American football wide receiver. He was signed by the New York Giants of the National Football League as a free agent in 2009. Boateng played college football for the University of Florida and was a member the 2006 BCS National Championship team. He later transferred to UC Berkeley."},{"page_url":"https://sw.wikipedia.org/wiki/Papa_Fransisko","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Papal_Visit_to_the_Philippines_January_18_2015.jpg","page_title":"Papa Fransisko","context_page_description":"Papa Fransisko, S.I. ni askofu wa Roma, na hivyo pia Papa wa Kanisa Katoliki duniani kote, tangu tarehe 13 Machi 2013.\\nAmemfuata Papa Benedikto XVI akiwa wa 266 katika orodha ya mapapa."},{"page_url":"https://en.wikipedia.org/wiki/Kangxi_Emperor","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Young_Kangxi.jpg","page_title":"Kangxi Emperor","context_page_description":"The Kangxi Emperor, given name Xuanye, was the fourth Emperor of the Qing dynasty, and the second Qing emperor to rule over China proper.\\nThe Kangxi Emperor's reign of 61 years makes him the longest-reigning emperor in Chinese history and one of the longest-reigning rulers in the world. However, since he ascended the throne at the age of seven, actual power was held for six years by four regents and his grandmother, the Grand Empress Dowager Xiaozhuang.\\nThe Kangxi Emperor is considered one of China's greatest emperors. He suppressed the Revolt of the Three Feudatories, forced the Kingdom of Tungning in Taiwan and assorted Mongol rebels in the North and Northwest to submit to Qing rule, and blocked Tsarist Russia on the Amur River, retaining Outer Manchuria and Outer Northwest China.\\nThe Kangxi Emperor's reign brought about long-term stability and relative wealth after years of war and chaos. He initiated the period known as the \\"Prosperous Era of Kangxi and Qianlong\\" or \\"High Qing\\", which lasted for several generations after his death. His court also accomplished such literary feats as the compilation of the Kangxi Dictionary."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%8A%D9%84%D8%A7%D9%86%D9%8A_%D8%AC%D8%B1%D9%8A%D9%81%D9%8A%D8%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Melanie_Griffith.jpg","page_title":"ميلاني جريفيث","context_page_description":"ميلاني غريفيث ممثلة أمريكية، حاصلة على جائزة الغولدن غلوب 1988 لأفضل ممثلة عن دورها في فيلم فتاة عاملة."},{"page_url":"https://de.wikipedia.org/wiki/Wilhelm-Gustloff-Stiftung","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Buchenwald_Factories_85867.jpg","page_title":"Wilhelm-Gustloff-Stiftung","context_page_description":"Die Wilhelm-Gustloff-Stiftung war eine Parteistiftung der NSDAP, die industrielle Unternehmungen betrieb. Sie war benannt nach dem von den Nationalsozialisten zum „Märtyrer“ erhobenen Wilhelm Gustloff."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B4%D0%B8%D0%BF%D0%BB%D0%BE%D0%BC%D0%B0%D1%82%D0%B8%D1%87%D0%BD%D0%B8%D1%85_%D0%BC%D1%96%D1%81%D1%96%D0%B9_%D0%9B%D0%B8%D1%82%D0%B2%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Embassy_of_Lithuania_in_Moscow%2C_building.jpg","page_title":"Список дипломатичних місій Литви","context_page_description":"Нижче представлено список дипломатичних місій Литви. Литва має посольства в 40 країнах світу, а також 11 генеральних консульств."},{"page_url":"https://es.wikipedia.org/wiki/Genocidio_blanco_(Armenia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Human_remains_from_the_massacre_of_the_Armenians_at_Erzingan.jpg","page_title":"Genocidio blanco (Armenia)","context_page_description":"Genocidio blanco​​ es el término utilizado ampliamente en la comunidad armenia, tanto de forma histórica como social, para describir la situación de la diáspora armenia, especialmente en el mundo occidental.​\\nEl politólogo alemán Christoph Zürcher escribe en su libro de 2007 Las guerras postsoviéticas: rebelión, conflicto étnico y nación en el Cáucaso:\\n\\"Genocidio\\" se convirtió en una palabra clave, que tenía varias connotaciones. El genocidio \\"blanco\\" o la masacre \\"blanca\\" denotaban la represión, la asimilación o la migración forzada de armenios de sus tierras históricas.​\\nLos armenios que viven en occidente consideran a los armenios que se asimilan dentro de la población local del país donde eventualmente se vieron obligados a emigrar como «perdidos» debido al continuo exilio después del Gran crimen contra el pueblo armenio entre 1915-1917 por parte del Imperio otomano.​ Por lo tanto considera que el armenio perdido es otra víctima del intento genocida de eliminar a los armenios.​"},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saints-Pierre-et-Paul_de_Ville-sur-Saulx","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/Broussier_baron_683.jpg","page_title":"Église Saints-Pierre-et-Paul de Ville-sur-Saulx","context_page_description":"L'église Saints-Pierre-et-Paul est une église catholique située à Ville-sur-Saulx, dans le département de la Meuse."},{"page_url":"https://de.wikipedia.org/wiki/Akemi_(Unternehmen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Abusimbel.jpg","page_title":"Akemi (Unternehmen)","context_page_description":"Die Akemi GmbH ist ein weltweit tätiges Unternehmen der chemischen Industrie mit Stammsitz in Nürnberg, das seinen Schwerpunkt in der Herstellung von zweikomponentigen Klebesystemen hat. Die chemisch-technische Spezialfabrik stellt Kleber, Kitte sowie Reinigungs- und Pflegeprodukte für die Natursteinbranche her sowie Spachtel- und Reparaturmassen, Dichtstoffe, Schutzbeschichtungen, Lacke und Produkte zur Aufbereitung und Pflege für die Automobilbranche.\\nDie Produkte von Akemi werden an zwei Standorten in Deutschland in Nürnberg und Wiehl sowie in fünf weiteren im Ausland hergestellt. Sie befinden sich in Atlanta in den USA, São Paulo in Brasilien, Tuzla ein Vorort von İstanbul in der Türkei, Bangalore und Delhi in Indien und Peking in China. Der Vertrieb der Akemi-Produkte erfolgt nach Angaben des Unternehmens in mehr als 100 Länder.\\nDer Markenname Akemi wurde aufgrund seiner Bedeutung für die Natursteinbranche in dem einzigen deutschsprachigen Natursteinlexikon als Lemma aufgenommen."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%9C%D0%B5%D0%BC%D0%B5%D0%BB%D1%8C%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Wappen_Mehmels.png","page_title":"Мемельс","context_page_description":"Мемельс — Германияла, Тюрингия ерендә урынлашҡан коммуна.\\n2010 йылғы халыҡ иҫәбен алыу буйынса коммунала 363 кеше йәшәй. Майҙаны — 6,46 км². Диңгеҙ кимәленән 310 метр бейеклектә һәм UTC +1 ваҡыт бүлкәтендә урынлашҡан. Почта индексы — 98634 һәм автомобиль коды — SM."},{"page_url":"https://nl.wikipedia.org/wiki/Ursulinenklooster_(Maastricht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/2016_Maastricht%2C_Sint_Pieter%2C_Lourdesgrot_02.jpg","page_title":"Ursulinenklooster (Maastricht)","context_page_description":"Het Ursulinenklooster is het voormalige klooster van de zusters Ursulinen van de Romeinse Unie in het centrum van de Nederlandse stad Maastricht. Het gebouwencomplex aan de Grote Gracht en Capucijnenstraat bestaat uit een klooster, een kloosterkapel en diverse scholen, waaronder zich diverse rijks- en gemeentemonumenten bevinden. De zusters bezaten tevens een buitenhuis met kapel in Sint Pieter, waar zich ook de begraafplaats bevindt. Naast de Ursulinen van de Romeinse Unie waren er twee andere congregaties van ursulinen in Maastricht: aan de Scharnerweg en in Nazareth."},{"page_url":"https://vi.wikipedia.org/wiki/Cuneo_(t%E1%BB%89nh)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Cuneo_map.png","page_title":"Cuneo (tỉnh)","context_page_description":"Cuneo là một tỉnh ở tây nam vùng Piemonte của Italia. Phía tây tỉnh này giáp với vùng Provence-Alpes-Côte d'Azur của Pháp.\\nPhía bắc giáp tỉnh Turin.\\nPhía đông giáp tỉnh Asti.\\nPhía nam giáp với các tỉnh Liguria Savona và Imperia.\\nTỉnh cũng được người Ý gọi là Provincia Granda do đây là tỉnh lớn thứ 3 Ý.\\nTỉnh lỵ là thành phố Cuneo. Có 250 đô thị trong tỉnh, các đô thị lớn nhất xếp theo dân số là:"},{"page_url":"https://de.wikipedia.org/wiki/St._Mauritius_(Hattingen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Hl.Augustinus.jpg","page_title":"St. Mauritius (Hattingen)","context_page_description":"St. Mauritius ist eine neugotische, dreischiffige Hallenkirche in der Mitte von Niederwenigern, einem Stadtteil von Hattingen in Nordrhein-Westfalen. Sie ist die Kirche der katholischen Gemeinde St. Mauritius Hattingen-Niederwenigern, die seit 2007 zur Großpfarrei von St. Peter und Paul Hattingen im Bistum Essen gehört.\\nDie Kirche wurde urkundlich erstmals 1147 erwähnt als Besitz der Abtei Deutz. Der Turm und das spätromanische Taufbecken sind in ihrer ursprünglichen Gestalt erhalten geblieben.\\nSeit dem 17. Januar 1983 ist das Gebäude in die Baudenkmalliste von Hattingen eingetragen. Der seliggesprochene Nikolaus Groß empfing in dieser Kirche die Sakramente der Taufe, Erstkommunion, Firmung und Ehe und wird mit einem Denkmal und einem Museum nahe der Kirche geehrt."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%AC%AC%E4%BA%8C%E6%89%B9%E5%85%A8%E5%9B%BD%E9%87%8D%E7%82%B9%E6%96%87%E7%89%A9%E4%BF%9D%E6%8A%A4%E5%8D%95%E4%BD%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/%E4%BA%94%E9%96%93%E5%BB%B3%E5%85%A7%E6%9C%83%E8%AD%B0%E5%AE%A4.JPG","page_title":"第二批全国重点文物保护单位","context_page_description":"第二批全國重點文物保護單位於1982年2月23日由國務院公布，共62處。"},{"page_url":"https://sk.wikipedia.org/wiki/Ulica_Imricha_Karva%C5%A1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Imricha_Karva%C5%A1a_street%2C_Bratislava.jpg","page_title":"Ulica Imricha Karvaša","context_page_description":"Ulica Imricha Karvaša je ulica v Bratislave, v mestskej časti Staré Mesto. Je pomenovaná podľa Imricha Karvaša, slovenského národohospodára.\\nTvorí spojnicu medzi Mýtnou a Radlinského. Na ulici má sídlo Národná banka Slovenska."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%BE%D0%B2%D0%B8_%D0%9B%D1%8E%D0%BA%D1%81%D0%B5%D0%BC%D0%B1%D1%83%D1%80%D0%B3%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/LuxembourgPartitionsMap.png","page_title":"Мови Люксембургу","context_page_description":"Мови Люксембургу — мови, що мають певний офіційний статус та мови, що ними користуються у Великому Герцогстві Люксембург, невеличкій країні Північно-Західної Європи, розташованій на романо-германському мовному кордоні. Єдиним корінним народом країни є люксембуржці, єдиною рідною мовою яких є люксембурзька. При цьому, мовна ситуація в країні характеризується наявністю трьох мов з особливим статусом. Державною мовою є люксембурзька мова, що використовується як засіб повсякденного усного спілкування, офіційними мовами країни є французька і німецька."},{"page_url":"https://en.wikipedia.org/wiki/Lorenzo_Bellini","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Bellinis-ducts.png","page_title":"Lorenzo Bellini","context_page_description":"Lorenzo Bellini, Italian physician and anatomist."},{"page_url":"https://en.wikipedia.org/wiki/Garibaldi,_Rio_Grande_do_Sul","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Garibaldi_rs.jpg","page_title":"Garibaldi, Rio Grande do Sul","context_page_description":"Garibaldi is a municipality in Rio Grande do Sul, southern Brazil. It has a population of 28,714 people, most of them of Italian descent. The city is famous for its wine and champagne productions. The name Garibaldi is a homage to the Italian revolutionary Giuseppe Garibaldi and his Brazilian wife, Anita Garibaldi. It was settled by Italian immigrants, predominantly Venetians and Prussians in the late 19th century."},{"page_url":"https://lt.wikipedia.org/wiki/Olenegorskas","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Coat_of_Arms_of_Olenegorsk_%28Murmansk_oblast%29.png","page_title":"Olenegorskas","context_page_description":"Olenegorskas – miestas Rusijoje, Murmansko srityje, Kolos pusiasalyje, 112 km į pietus nuo Murmansko. Miesto apygardos centras. Geležinkelio stotis prie Murmansko–Sankt Peterburgo linijos, greta praeina Kolos plentas. Kasama ir apdirbama geležies rūda. Mechaninių įrengimų gamyba. Yra koledžas, muzikos, menų mokyklos."},{"page_url":"https://pl.wikipedia.org/wiki/Eric_Young","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Eric_Young_Slammiversary_2009.jpg","page_title":"Eric Young","context_page_description":"Eric Young, właśc. Jeremy Fritz – kanadyjski profesjonalny wrestler i osobowość telewizyjna, obecnie występujący w federacji WWE w rozwojowym brandzie NXT. Jest liderem grupy Sanity i wraz z Alexandrem Wolfem i Killianem Dainem obecnym posiadaczem NXT Tag Team Championship.\\nJest najbardziej znany z występów w Total Nonstop Action Wrestling od 2004 do 2016, gdzie raz zdobył TNA World Heavyweight Championship, raz X Division Championship, trzy razy Legends/Global/Television/King of the Mountain Championship, dwa razy NWA World Tag Team Championship oraz dwa razy TNA World Tag Team Championship. Był też jedynym męskim posiadaczem TNA Knockouts Tag Team Championship pokonując ODB. Jest jedną z czterech osób, która zyskała miano Grand Slam w TNA. Z powodu zdobycia tytułów TNA jedenaście razy, federacja określała go mianem „TNA Original”."},{"page_url":"https://nl.wikipedia.org/wiki/Amt_Gramzow","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Amt_Gramzow_in_UM.png","page_title":"Amt Gramzow","context_page_description":"Het Amt Gramzow is een samenwerkingsverband van zes gemeenten in het Landkreis Uckermark in de Duitse deelstaat Brandenburg. Het amt telt 7.050 inwoners. Het bestuurscentrum is gevestigd in Gramzow."},{"page_url":"https://ru.wikipedia.org/wiki/Hard_Candy_(%D0%B0%D0%BB%D1%8C%D0%B1%D0%BE%D0%BC_%D0%9C%D0%B0%D0%B4%D0%BE%D0%BD%D0%BD%D1%8B)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Stickyandsweet_candy_shop.jpg","page_title":"Hard Candy (альбом Мадонны)","context_page_description":"Hard Candy — одиннадцатый студийный альбом американской певицы и автора песен Мадонны, выпущенный 28 апреля 2008 года и ставший последним номерным альбомом, выпущенным по её контракту с Warner Bros. Records. Мадонна начала работу над альбомом в 2007 году и сотрудничала с Джастином Тимберлейком, Тимбелэндом, Фареллом Уилльямсом и Флоидом Хиллсом. Альбом имеет общую R&B стилистику, в основе оставаясь танцевальной поп-записью. Warner Bros. также предложила группе Pet Shop Boys сотрудничать с Мадонной над альбомом, но позже звукозаписывающая компания передумала и отозвала свои предложения.\\nМадонна заинтересовалась сотрудничеством с Тимберлейком, прослушав его альбом 2006 года FutureSex/LoveSounds. Вместе они разработали целый ряд песен для альбома, но в основном запись базировалась на демозаписях Уильямса. Мадонна уже имела несколько песен для альбома, которые изменял Тимберлейк. Перед записями между ними развивались интенсивные дискуссии. Позже Мадонна напомнила, что большинство песен на Hard Candy автобиографичны во многих отношениях. Однако, по её словам, это было непреднамеренно и произошло в процессе разработки альбома."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%94%D7%99%D7%9C%D7%AA_%D7%99%D7%94%D7%95%D7%93%D7%99_%D7%A7%D7%90%D7%9C%D7%99%D7%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Kalisz_memorial.JPG","page_title":"קהילת יהודי קאליש","context_page_description":"קהילת יהודי קאליש שבפולין ממוקמת במחוז פוזנן מערבית ללודז'. במשך מאות שנים הייתה קאליש עיירת גבול בין פולין לגרמניה, והיא אחת הערים העתיקות בפולין. קאליש מילאה תפקיד מרכזי בהיסטוריה היהודית הפולנית. ההתיישבות היהודית במקום החלה במאה ה-12.\\nב-1860 מנו יהודי קאליש 34% מאוכלוסיית העיר. במהלך המאה ה-19 ניטש בקהילה מאבק חריף בין חוגי המשכילים, שהושפעו מהנאורות הגרמנית; לבין האורתודוקסים השמרנים. במפנה המאה ה-20 צצו תנועות ציוניות בעיר, בד בבד עם עליית התארגנויות פוליטיות אחרות בקרב היהודים. ב-1931 מנו היהודים 15,300 איש, כ-30% מתושבי העיר. ב-1934 גדל שטח העיר וגודל הקהילה היהודית משמעותית, בשל צירוף שטחים כפריים יהודיים מסביב לקאליש. כמעט כל קהילת קאליש הושמדה בשואה."},{"page_url":"https://fa.wikipedia.org/wiki/%DB%8C%D9%88%D8%AA%DB%8C%D9%88%D8%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Youtubecompfull.png","page_title":"یوتیوب","context_page_description":"یوتیوب یا یوتوب یک پلت‌فرم سرویس اشتراک ویدئو است. یوتیوب دوّمین وبگاه پرطرفدار در جهان پس از گوگل و پیش از تیمال و بزرگترین شاخهٔ گوگل است که در نوار ابزار این وبگاه دیده می‌شود.\\nیوتیوب معروف‌ترین وبگاه بارگذاری و تماشای ویدئو است که توسط سه کارمند پیشین پی‌پل در فوریه ۲۰۰۵ ایجاد شد. چاد هرلی، استیو چن، و جاوید کریم پس از موفقیت‌های وبگاه فلیکر، تصمیم به ایجاد یوتیوب گرفتند.\\nمحل این شرکت در سان برونو، کالیفرنیا است. این سایت به کاربران اجازهٔ بارگذاری، مشاهده و اشتراک‌گذاری ویدئو را می‌دهد و با استفاده از تکنولوژی ادوبی فلش ویدئو و اچ‌تی‌ام‌ال۵ انواع ویدئوها مانند کلیپ‌های فیلم، کلیپ‌های تلویزیون و کلیپ‌های موسیقی و هم چنین ویدئوهای وبلاگ‌ها، ویدئوهای اوریجینال کوتاه و ویدئوهای آموزشی را نمایش می‌دهد. این وبگاه قابلیت پشتیبانی از ویدئوهای سه‌بعدی و آناگلیف را دارد و با فرمت‌های مختلفی از جمله فلش ویدئو سازگاری دارد. ویدئوهای این شرکت را می‌توان در پلی‌استیشن ۳، پلی استیشن ۴، وی، و ایکس‌باکس لایو نیز تماشا کرد. نسخهٔ تلفن همراه این وبگاه به صورت یک نرم‌افزار بر روی پلت فرم اندروید نیز در دسترس است.\\nویدئوی چارلی انگشت منو گاز گرفت از پربازدیدترین ویدئوهای یوتیوب است که در مه ۲۰۱۱ بیش از ۳۷۵ میلیون بار بازدید شد."},{"page_url":"https://id.wikipedia.org/wiki/Pertempuran_Waterloo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/DelarocheNapoleon.jpg","page_title":"Pertempuran Waterloo","context_page_description":"Pertempuran Waterloo terjadi pada tanggal 18 Juni 1815 di dekat kota Waterloo sekitar 15 km selatan ibu kota Belgia, Brussels, merupakan pertempuran terakhir Napoleon. Kekalahan dalam perang ini menjadi penutup sejarahnya sebagai Kaisar Prancis. Pertempuran ini juga dicatat dalam sejarah sebagai penutup dari seratus hari sejak larinya Napoleon dari pulau Elba.\\nKekalahan pasukan Prancis, di bawah pimpinan Napoleon melawan pasukan Inggris-Belanda-Jerman di bawah Jenderal Wellington dan sekutu Prussia-nya di bawah Feldmarschall Blücher, mengakhiri kekuasaan seratus hari Napoleon dan diikuti dengan akhir dari Kekaisaran Prancis yang Pertama pada 22 Juni 1815.\\nSetelah kekalahan militer total yang kedua dalam waktu yang berdekatan ini Prancis dibebankan persyaratan perdamaian yang memberatkan dalam Perjanjian Paris yang Kedua dan Napoleon menjadi tawanan perang oleh pihak Inggris dan ditahan di Pulau St. Helena di lautan Atlantik hingga meninggalnya pada 5 Mei 1821 sebagai orang buangan."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D0%BE%D1%80%D0%B8%D0%BD%D0%B2%D0%B8%D0%BB_(%D0%90%D0%BB%D0%B1%D0%B5%D1%80%D1%82%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/St_Jean_Baptiste_Church_Morinville_Alberta_Canada_01B.jpg","page_title":"Моринвил (Алберта)","context_page_description":"Моринвил је варош у централном делу канадске провинције Алберта, у оквиру агломерације Велики Едмонтон. Налази се 34 км северно од административног центра провинције града Едмонтона, на деоници локалног ауто-пута 2.\\nНасеље је добило име по франкофоном свештенику оцу Морину који је крајем 19. века дошао са групом верника немачког и француског порекла и основао насеље. У спомен на досељавање у насељу је 1907. основана црква светог Јована Крститеља која је 1975. проглашена за културно-историјско добро Алберте.\\nПрема резултатима пописа становништва из 2011. у варошици је живело 8.569 становника у 3.261 домаћинству, што је за чак 26,5% више у односу на попис из 2006. када је регистровано 6.775 становника.\\nЗанимљиво је да је Моринвил било једно од првих насеља у западној Канади у којем је још 1910. отворено одељење краљевске банке Канаде."},{"page_url":"https://en.wikipedia.org/wiki/Royal_Navy_Dockyard","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Dockyard_mumbai.jpg","page_title":"Royal Navy Dockyard","context_page_description":"Royal Navy Dockyards were state-owned harbour facilities where ships of the Royal Navy were built, based, repaired and refitted. Throughout its history, the Royal Navy has made extensive use of private shipyards, both at home and abroad; but at the same time it also had a policy of establishing and maintaining its own dockyard facilities. Portsmouth was the first; it was followed by Deptford, Woolwich, Chatham and others. By the 18th century, Britain had a string of these state-owned naval dockyards, located not just around the country but across the world; each yard was sited close to a safe harbour or anchorage used by the fleet. Most Royal Dockyards had a dual function, providing for both ship building and ship maintenance. Over time, they accrued additional on-site facilities for the support, training and accommodation of naval personnel.\\nFor centuries, in this way, the name and concept of a Royal Dockyard was largely synonymous with that of a naval base."},{"page_url":"https://es.wikipedia.org/wiki/Torroella_de_Montgr%C3%AD","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/77/Spain%2C_Catalonia%2C_Torroella_de_Montgr%C3%AD_%285%29%2C_Carrer_de_l%27Esglesia.jpg","page_title":"Torroella de Montgrí","context_page_description":"Torroella de Montgrí es una villa y un municipio español de la comarca del Bajo Ampurdán en la provincia de Gerona, comunidad autónoma de Cataluña."},{"page_url":"https://ca.wikipedia.org/wiki/Hubbard_(Oregon)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Hubbard_Oregon_watertower.JPG","page_title":"Hubbard (Oregon)","context_page_description":"Hubbard és una població dels Estats Units a l'estat d'Oregon. Segons el cens del 2000 tenia una població de 2.483 habitants."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B5%D0%B7%D0%B0%D1%80_(%D0%BA%D1%96%D0%BD%D0%BE%D0%BF%D1%80%D0%B5%D0%BC%D1%96%D1%8F,_2004)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Julie_Depardieu_C%C3%A9sars.jpg","page_title":"Сезар (кінопремія, 2004)","context_page_description":"29-та церемонія вручення нагород премії «Сезар» Академії мистецтв та технологій кінематографа за заслуги у царині французького кінематографу за 2003 рік відбулася 21 лютого 2004 року в Театрі Шатле.\\nЦеремонія проходила під головуванням Фанні Ардан, розпорядником та ведучим виступив французький актор та режисер Гад Ельмалех. Найкращим фільмом визнано стрічку Навали варварів режисера Дені Аркана."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%AE%E0%A4%BE%E0%A4%AE%E0%A4%BE%E0%A4%B8%E0%A4%BE%E0%A4%B9%E0%A5%87%E0%A4%AC_%E0%A4%9C%E0%A4%97%E0%A4%A6%E0%A4%BE%E0%A4%B3%E0%A5%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/%E0%A4%9C%E0%A4%97%E0%A4%A6%E0%A4%BE%E0%A4%B3%E0%A5%87_%E0%A4%AE%E0%A4%BE%E0%A4%AE%E0%A4%BE_%E0%A4%B9%E0%A5%89%E0%A4%B8%E0%A5%8D%E0%A4%AA%E0%A4%BF%E0%A4%9F%E0%A4%B2_.jpg","page_title":"मामासाहेब जगदाळे","context_page_description":"निवृत्ती गोविंदराव जगदाळे उर्फ कर्मवीर डॉ. मामासाहेब जगदाळे हे महाराष्ट्रातील एक शिक्षणप्रसारक आणि समाजसुधारक होते. कर्मवीर भाऊराव पाटील, शिक्षण महर्षी डॉ.बापूजी साळुंखे, पंजाबराव देशमुख यांनी महाराष्ट्रातील वेगवेगळ्या भागात बहुजनांच्या शिक्षणासाठी प्रसार व्हावा यासाठी संस्था निर्माण केल्या होत्या. यांचे बरोबरीनेच कर्मवीर मामासाहेब जगदाळे यांचे नाव अग्रक्रमाने घेतले जाते. मामांचा उल्लेख बहुजनांच्या शिक्षणाचे कैवारी म्हणून केला जातो. पश्चिम महाराष्ट्रातील सोलापूर व मराठवाड्यातील उस्मानाबाद या सीमावर्ती भागात बहुजन मुलांना शिक्षण घेणे शक्य व्हावे म्हणून बार्शी येथे ‘श्री शिवाजी शिक्षण प्रसारक मंडळ ’ स्थापन करून शिक्षणप्रसार केला. संस्थेची बोर्डिंगे, प्राथमिक शाळा, माध्यमिक शाळा, उच्च माध्यमिक, द्विलक्षी व किमान कौशल्य अभ्यासक्रम, महाविद्यालये, कृषितंत्रनिकेतने, नर्सिंग महाविद्यालय, दवाखाना, शेती, धेनुसंवर्धन, तांत्रिक शिक्षण, छापखाना यांचे मूर्तस्वरूप आज सन २०१८मध्ये लक्षात येते. हे पथदर्शक दिशा देण्याचे द्रष्टेपण मामांच्या विचारात व कृतीत होते. गरीब व होतकरू मुलांना मोफत शिक्षण दिले पाहिजे, पैशावाचून बहुजनांच्या मुलांचे शिक्षण थांबले नाही पाहिजे यासाठी त्यांनी अहोरात्र प्रयत्न केले. त्यामागे उदात्त ध्येयवाद, त्याग व सेवा तसेच कामाची तळमळ व निष्ठा या गोष्टी होत्या."},{"page_url":"https://eo.wikipedia.org/wiki/Dentrado","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Fullerene_Nanogears_-_GPN-2000-001535.jpg","page_title":"Dentrado","context_page_description":"Dentrado estas maŝinelemento, kiu per dentoj elformitaj sur sia supraĵo povas transdoni movon. Al sama kolektanta nocio apartenas ankaŭ la ne cirkloformaj dentradoj kaj la dentita stango. Se en la suba teksto temas pri turnanta movo aŭ perimetro de dentrado, en kazo de dentita stango oni ĉiam devas kompreni irantan movon aŭ longon de dentita stango. La ĉenrado ne estas dentrado."},{"page_url":"https://si.wikipedia.org/wiki/%E0%B6%BD%E0%B7%9A%E0%B6%9B%E0%B6%B1%E0%B6%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Rosetta_Stone_BW.jpeg","page_title":"ලේඛනය","context_page_description":"රොසෙටා පාෂාණය භාෂාවේදීන්ට මෙය කියවා තේරුම් ගත හැකි විය.\\nචිත්‍ර ලිපි ලේඛන කලාව ක්‍රි.පු. 3200 වන ශ.ව. දී පමණ සිදු වී ඇති අතර ඊට සලකුණු 500 ක් පමණ යොදා ගෙන ඇත. එයින් වචනයක්, පණිවිඩයක් නියෝජනය කළ හැකිය; තවද එකම සලකුණු විවිධ සංදර්භ වල විවිධ අරමුණු වෙනුවෙන් පෙනී සිටිය හැකිය. චිත්‍ර ලිපි විධිමත් ශිලා ලේඛන වර්ගයකි. ඒවා නිර්මාණය කොට තිබුණේ සිහිවටන ගල් වල සහ සොහොන් ගෙවල් වලය. ඒවායෙහි තොරතුරු නිරූපණය කර තිබුණි. මෙම සෙල් ලිපි වල යොදා ගෙන තිබුණේ ලේසියෙන් හා ඉක්මනින් ලිවිය හැකි හයරටික් නම් වු වැල් අකුරුය. විධිමත් චිත්‍ර ලිපි පේලි හෝ තීරු වශයෙන් කියවිය හැකි ලෙස ලියා තිබුණු අතර, හයරටික් නිතරම ලියා තිබුණේ දකුණේ සිට වමට සාමාන්‍යයෙන් සමාන්තර පේලී වශයෙනි. අළුතෙන් පැමිණි ලේඛන කලාවක් වු ඩෙමොටික් ක්‍රමය පසුව පිළිගත් ලේඛන ශෛලිය බවට පත්විය. රොසෙටා පාෂාණයේ ග්‍රීක වදනින් ඇත්තේ ද එවන් ලේඛන ශෛලියකි.\\nක්‍රි.ව. 1 වන ශ.ව. දී පමණ සාම්ප්‍රදායික ඩෙමොටික අත් අකුරු වෙනුවට නවීකරණය වු ග්‍රීක හෝඩිය වු කොප්ටික් අක්ෂර මාලාව පැතිරෙන්නට විය. ක්‍රි.ව. 4 වන ශ.ව. දක්වා විධිමත් චිත්‍ර ශිත්‍ර ලිපි භාවිතා වුවද ඒවා කියවීමේ හැකියාව තිබෙන්නේ පුජකවරු අතලොස්සකට පමණි. සාම්ප්‍රදායික ආගමික ක්‍රම වේදයන් විසුරුවා හරින ලද නිසා, චිත්‍ර ලිපි ලේඛනය පිළිබද දැනුම බොහෝ දුරට අඩු වී ගියේය."},{"page_url":"https://fr.wikipedia.org/wiki/Otto_B%C3%B6hler","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Hans_von_B%C3%BClow_Otto_B%C3%B6hler.jpg","page_title":"Otto Böhler","context_page_description":"Otto Böhler est un artiste autrichien spécialisé dans les portraits en silhouette de nombreux grands chefs d'orchestre, compositeurs et pianistes de son temps."},{"page_url":"https://de.wikipedia.org/wiki/San_Phra_Kan","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Crab-eating_macaques_San_Phra_Kan_Lop_Buri.jpg","page_title":"San Phra Kan","context_page_description":"San Phra Kan ist ein Schrein in der Altstadt von Lop Buri, Provinz Lop Buri, Zentralthailand."},{"page_url":"https://de.wikipedia.org/wiki/Katowice","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Katowice_-_Spodek_by_night.jpg","page_title":"Katowice","context_page_description":", deutsch Kattowitz, ist die Hauptstadt der polnischen Woiwodschaft Schlesien. Sie hat rund 300.000 Einwohner.\\nDie knapp 80 km nordwestlich von Krakau im Oberschlesischen Industrierevier liegende Stadt ist das Zentrum der Metropolregion Silesia, zu der je nach Definition zwischen 2,5 und 5 Mio. Einwohner gezählt werden. In der Gegend existieren reichhaltige Kohle- und Erzlagerstätten. Die Stadt ist ein wichtiger und florierender Wirtschaftsstandort, wobei die wirtschaftliche Bedeutung der Bergwerke und Schwerindustrie immer mehr zugunsten der Dienstleistungsbranche, Elektroindustrie und Informationstechnik abnimmt.\\nAb 1742 gehörte Kattowitz zu Preußen und entwickelte sich im Gefolge der industriellen Revolution im 19. Jahrhundert vom unbedeutenden schlesischen Dorf zu einer Industriestadt, die ab 1871 Teil des Deutschen Kaiserreichs war und nach dem Versailler Vertrag mit der Teilung Oberschlesiens im Jahr 1921 an Polen fiel. Während der Zweiten polnischen Republik 1922 bis 1939 war Katowice Hauptstadt der Autonomen Woiwodschaft Schlesien."},{"page_url":"https://en.wikipedia.org/wiki/Minot_State_University","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/MSU_Dome.jpg","page_title":"Minot State University","context_page_description":"Minot State University is a public university in Minot, North Dakota. Founded in 1913 as a normal school, Minot State University is the third-largest university in North Dakota, offering undergraduate and graduate degree programs.\\nMinot State University was founded in 1913 and has evolved from a normal school to a university. Three colleges comprise the university's academic offerings: Arts and Sciences, Business, and Education and Health Sciences. Nine master's degrees and one education specialist degree are offered in such areas as communication disorders, management, and mathematics. There is a mix of liberal arts and professional programs offering more than 60 majors at the undergraduate level. MSU is a member of the North Dakota University System, which comprises eleven institutions representing doctoral, master, baccalaureate, and community colleges. The State Board of Higher Education consists of nine members and is the governing board of the System. Minot State University has a Board of Regents acting as an advisory board and champion for the institution.\\nMinot State's mascot is the beaver and the school colors are red and green."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Ch%C3%A2teauneuf-Grasse","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Ch%C3%A2teauneuf-Grasse.jpg","page_title":"Châteauneuf-Grasse","context_page_description":"Châteauneuf-Grasse sī ūi-tī Hoat-kok Provence-Alpes-Côte d'Azur toā-khu Alpes-Maritimes koān ê chi̍t ê commune."},{"page_url":"https://en.wikipedia.org/wiki/Porto_Cristo","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Interior_de_las_Cuevas_del_Drach.jpg","page_title":"Porto Cristo","context_page_description":"Porto Cristo is a small town on the eastern coast of Mallorca. It is 13.8 km from the town of Manacor and is within the Manacor municipality."},{"page_url":"https://eo.wikipedia.org/wiki/Industrio","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/William_Bell_Scott_-_Iron_and_Coal.jpg","page_title":"Industrio","context_page_description":"Industrio estas baza branĉo de la produktado. En la industrio oni ekspluatas kaj prilaboras la materialojn de la naturo. La industrio produktas eĉ ankaŭ la laborilojn kaj labormaterialojn. Oni dividas la industrion al diversaj gravaj branĉetoj, subbranĉoj, fakbranĉcoj.\\nIndustrio estas la produktado de varo aŭ servo ene de ekonomio. Industrio iĝis grava sektoro de produktado kaj laboro en eŭropaj kaj nordamerikaj landoj dum la Industria revolucio, renversante antaŭajn komercajn kaj feŭdajn ekonomiojn. Tio okazis tra multaj sinsekvaj rapidaj progresoj en teknologio, kiel ekzemple la produktado el ŝtalo kaj karbo.\\nPost la Industria revolucio, eble triono de la ekonomia produktaĵo de la mondo estas derivita de industrioj. Multaj industrilandoj kaj multaj evolua/duon-evoluintaj landoj dependas signife de industrio. Industrioj, la landoj kie ili ekzistas ene, kaj la ekonomioj de tiuj landoj estas interligitaj en kompleksa teksaĵo de interligiteco."},{"page_url":"https://es.wikipedia.org/wiki/Rutland_(condado_de_Rutland,_Vermont)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Center_Rutland_Falls%2C_Rutland%2C_VT.jpg","page_title":"Rutland (condado de Rutland, Vermont)","context_page_description":"Rutland es un pueblo ubicado en el condado de Rutland en el estado estadounidense de Vermont. En el año 2010 tenía una población de 1,056 habitantes y una densidad poblacional de 79.9 personas por km².​"},{"page_url":"https://cs.wikipedia.org/wiki/Gelimer","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/AR_50_Denarii_-_Vandals_-_Gelimer_-_Carthage.jpg","page_title":"Gelimer","context_page_description":"Gelimer byl král Vandalů a Alanů a poslední panovník severoafrického království Vandalů. Králem se stal poté, co sesadil svého bratrance Hildericha, který podporoval katolíky. Východořímský císař Justinián I. brzy na to vyhlásil Vandalům válku, aby se zmocnil jejich území. Vandalové v čele s Gelimerem bojovali proti římské armádě v čele s Belisarem, ale v roce 533 byli dvakrát poraženi a v roce 534 se Belisarovi Gelimer vzdal a přijal římskou nabídku na rozsáhlý majetek ve východořímské říši."},{"page_url":"https://simple.wikipedia.org/wiki/Viktor_Zubkov","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Viktor_Zoebkov.jpg","page_title":"Viktor Zubkov","context_page_description":"Viktor Alekseyevich Zubkov is a Russian politician and businessman. He served as the Prime Minister of Russia twice: from September 2007 to May 2008.\\nHe was Vladimir Putin's First Deputy Prime Minister during the Presidency of Dmitri Medvedev.\\nZubkov was born in Sverdlovsk Oblast."},{"page_url":"https://no.wikipedia.org/wiki/Gast%C3%B3n_Mazzacane","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Mazzacane_en_Minardi_F1_2000.jpg","page_title":"Gastón Mazzacane","context_page_description":"Gastón Mazzacane er en argentinsk racerfører som tidligere har kjørt Formel 1 for Minardi og Prost."},{"page_url":"https://sv.wikipedia.org/wiki/Chrysolopus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Diamond_Weevil_Side.JPG","page_title":"Chrysolopus","context_page_description":"Chrysolopus är ett släkte av skalbaggar. Chrysolopus ingår i familjen vivlar.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://sv.wikipedia.org/wiki/Plenkovice","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Plenkovice_flag.jpg","page_title":"Plenkovice","context_page_description":"Plenkovice är en ort i Tjeckien. Den ligger i länet Södra Mähren, i den sydöstra delen av landet, 170 km sydost om huvudstaden Prag. Plenkovice ligger 315 meter över havet och antalet invånare är 341.\\nTerrängen runt Plenkovice är lite kuperad. Den högsta punkten i närheten är 350 meter över havet, 1,2 km nordost om Plenkovice. Runt Plenkovice är det tätbefolkat, med 442 invånare per kvadratkilometer. Närmaste större samhälle är Znojmo, 7,8 km söder om Plenkovice. Trakten runt Plenkovice består till största delen av jordbruksmark.\\nInlandsklimat råder i trakten. Årsmedeltemperaturen i trakten är 9 °C. Den varmaste månaden är augusti, då medeltemperaturen är 22 °C, och den kallaste är januari, med -6 °C. Genomsnittlig årsnederbörd är 824 millimeter. Den regnigaste månaden är juni, med i genomsnitt 107 mm nederbörd, och den torraste är mars, med 24 mm nederbörd."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_%C5%BDelezn%C3%BD_Brod","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Fountain_at_Mal%C3%A9_n%C3%A1m%C4%9Bst%C3%AD.jpg","page_title":"Liste der denkmalgeschützten Objekte in Železný Brod","context_page_description":"Grundlage dieser Liste der denkmalgeschützten Objekte in Železný Brod ist die ÚSKP-Liste, die von der tschechischen Denkmalschutzbehörde NPÚ seit 1987 geführt wird und an die seit dem Jahre 1850 geschaffenen Listen anschließt.\\nDenkmalgeschützte Objekte in Železný Brod nach Ortsteilen."},{"page_url":"https://fr.wikipedia.org/wiki/Oikos_International","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Oikos_International.jpg","page_title":"Oikos International","context_page_description":"oikos International est une association internationale étudiante apolitique, non religieuse et à but non lucratif qui fédère 39 antennes locales réparties dans 20 pays et qui touche plus de 50 000 étudiants.\\nElle vise à promouvoir le développement durable auprès des décideurs de demain. Pour cela, elle sensibilise les étudiants des universités et des écoles de commerce aux enjeux du développement durable, notamment au niveau économique et dans le monde des affaires. En pratique, oikos organise des conférences, des ateliers, des concours, des journées thématiques, des jeux de rôle, etc. La plupart de ces événements sont organisés au niveau local par les différents Chapters."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D0%BD%D0%BD%D1%8B%D0%B5_%D1%85%D1%80%D0%BE%D0%BC%D0%BE%D1%81%D0%BE%D0%BC%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Flemming1882Tafel1Fig14.jpg","page_title":"Политенные хромосомы","context_page_description":"Полите́нные хромосо́мы — гигантские интерфазные хромосомы, возникающие в некоторых типах специализированных клеток в результате двух процессов: во-первых, многократной репликации ДНК, не сопровождаемой делением клетки, во-вторых, боковой конъюгации хроматид. Клетки, в которых есть политенные хромосомы, теряют способность к делению, они являются дифференцированными и активно секретирующими, то есть, политенизация хромосом является способом увеличения числа копий генов для синтеза какого-либо продукта. Политенные хромосомы можно наблюдать у двукрылых, у растений в клетках, связанных с развитием зародыша, у инфузорий при формировании макронуклеуса. Политенные хромосомы значительно увеличиваются в размерах, что облегчает их наблюдение и что позволяло изучать активность генов ещё в 1930-е годы. Принципиальным отличием от других типов хромосом является то, что политенные хромосомы являются интерфазными, тогда как все остальные можно наблюдать только во время митотического или мейотического деления клетки.\\nКлассическим примером являются гигантские хромосомы в клетках слюнных желёз личинок Drosophila melanogaster."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%B5%D0%BC%D0%B8%D1%8F_%C2%AB%D0%AD%D0%BC%D0%BC%D0%B8%C2%BB_%D0%B7%D0%B0_%D0%BB%D1%83%D1%87%D1%88%D1%83%D1%8E_%D0%BC%D1%83%D0%B6%D1%81%D0%BA%D1%83%D1%8E_%D1%80%D0%BE%D0%BB%D1%8C_%D0%B2_%D0%B4%D1%80%D0%B0%D0%BC%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%BC_%D1%82%D0%B5%D0%BB%D0%B5%D1%81%D0%B5%D1%80%D0%B8%D0%B0%D0%BB%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Telly_Savalas_Kojak_1973.JPG","page_title":"Премия «Эмми» за лучшую мужскую роль в драматическом телесериале","context_page_description":"Прайм-тайм премия «Эмми» в категории «Лучший актёр в драматическом телесериале» ежегодно вручается Американской телевизионной академией одному из номинированных на неё актёров за выдающееся исполнение главной роли в драматическом телесериале, транслирующемся в прайм-тайм.\\nВпервые премия в данной категории была вручена 11 февраля 1954 года на 6-ой церемонии награждения премией «Эмми» актёру Дональду О’Коннору за работу в шоу «Час комедии от Колгейт». На первых церемониях награждения премия за лучшую мужскую роль вручалась деятелям как телевидения, так и радио. Кроме того, вплоть до 1954 года, её вручение обуславливалось только фактом выдающихся работ номинированных актёров на телевидении и не было связано с конкретными ролями номинантов. В период с 1954 по 1965 годы премия в данной категории не всегда разделялась по жанровому признаку, и зачастую на неё номинировались актёры как драматических, так и комедийных телесериалов. С 1966 года на премию стали номинироваться исключительно актёры драматических телесериалов. Однако в 1972 году на неё претендовал исполнитель главной роли в мини-сериале или фильме, а в 1981 и 1992 годах — исполнители гостевых ролей в драматическом телесериале."},{"page_url":"https://en.wikipedia.org/wiki/Vehicle_registration_plates_of_Ecuador","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Ecuador_Police_License_Plate_1989-2014.jpg","page_title":"Vehicle registration plates of Ecuador","context_page_description":"Vehicle registration in Ecuador is composed of two parts.\\nThe vehicle registration document that describes the vehicle characteristics, such as the year of manufacture and vehicle identification number; and the vehicle owner's information, such as name and address. The registration must be renewed every four years.\\nThe registration plates which display a unique registration letter-number combination. These must be placed on the front and rear of the vehicle. Two plates are issued for each vehicle, except motorcycles which receive one plate, and they should be inspected for serviceability every year. If the plates are damaged they should be replaced."},{"page_url":"https://en.wikipedia.org/wiki/Donau_City","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/85/Vienna_DC.JPG","page_title":"Donau City","context_page_description":"Donau City, or Vienna DC, is a new part of Vienna's 22nd District Donaustadt, next to both the Reichsbrücke and the left bank of the Danube's 21.1 km new channel, Neue Donau.\\nConstruction work for the first building on this site, the Andromeda Tower, started in 1996."},{"page_url":"https://de.wikipedia.org/wiki/Ballplatz","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Old_Palais_Dalberg.jpg","page_title":"Ballplatz","context_page_description":"Der Ballplatz liegt im historischen Zentrum der Stadt Mainz. Er ist trapezförmig und umgeben von barocken Adelspalästen oder deren Nachbildung aus dem 20. Jahrhundert."},{"page_url":"https://sv.wikipedia.org/wiki/Melaleuca_wilsonii","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Melaleucawilsonii.JPG","page_title":"Melaleuca wilsonii","context_page_description":"Melaleuca wilsonii är en myrtenväxtart som beskrevs av Ferdinand von Mueller. Melaleuca wilsonii ingår i släktet Melaleuca och familjen myrtenväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Bisch%C3%B6fe_von_Konstanz","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Wappentafel_Bisch%C3%B6fe_Konstanz_16_Otto_von_Lierheim.jpg","page_title":"Liste der Bischöfe von Konstanz","context_page_description":"Die Liste der Bischöfe von Konstanz führt die Fürstbischöfe des Bistums Konstanz. Besonders für die Frühzeit des Bistums, die ins späte 6. Jahrhundert datiert wird, sind die Namen und Daten nicht vollständig gesichert.\\nDer Fürstbischof war nicht nur der oberste Seelsorger der Diözese, sondern auch weltlicher Herrscher über die eher kleinen und verstreuten Territorien des Fürstbistums Konstanz und besaß daher eine Virilstimme im Reichsfürstenrat.\\nWährend im Frühmittelalter der Bischof auch weltlicher Herrscher über die Stadt Konstanz war, wurde diese gegen Ende des 12. Jahrhunderts zur Freien Reichsstadt, womit die Gerichtsbarkeit des Bischofs im Stadtgebiet auf einen kleinen Bereich um die Kathedrale eingeschränkt war. Zahlreiche Bischöfe lagen daher im Konflikt mit der Stadt. Auch das Domkapitel spielte seine Machtposition gegen den Bischof nicht selten aus. Sitz der Bischöfe war die Bischofspfalz neben dem Konstanzer Münster. In der Reformationszeit verlegte der Bischof seinen Sitz nach Meersburg, wo er auch bis zur Auflösung des Bistums durch Papst Pius VII. 1821 blieb.\\nDer Bischof wurde im Normalfall vom Domkapitel gewählt."},{"page_url":"https://hu.wikipedia.org/wiki/Trinity_Church_(Manhattan)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2c/Detroit_Photographic_Company_%280708%29.jpg","page_title":"Trinity Church (Manhattan)","context_page_description":"A Trinity Church a New York-i püspöki egyházmegye történelmi plébániatemploma, New York pénzügyi központjában a Broadway és a Wall Street kereszteződésénél, a Wall Street bejáratával szemben áll Lower Manhattanben. A Szentháromság-templom több mint 300 éven át jelentős szerepet játszott New York City történetében. Mind elhelyezkedése, mind alapítványai miatt is nevezetes. A jelenlegi, 1846-ban felépült templom sorrendben a harmadik, az első templomot angol királyi utasításra eredetileg 1697-ben az Anglikán Egyház számára emelték. A templomépület 1869-ig a város legmagasabb épületének számított. A következő évtizedekben körülötte megindult építkezések következtében a neogótikus, barna homokkőből épült templom már eltörpül a toronyházak között. Tornya 83 m magas. A templom tervezője Richard Upjohn, a XIX. század legnevesebb amerikai egyházi építészeinek egyike volt. A Trinity Church manhattani ingatlanvagyonával az Egyesült Államok leggazdagabb egyházközségei közé tartozik."},{"page_url":"https://es.wikipedia.org/wiki/Mouloudia_Club_d%27Alger","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Mouloudia_d%27Alger%2C_CAF_Champions_League%2C_July_31_2011-1.jpg","page_title":"Mouloudia Club d'Alger","context_page_description":"El Mouloudia Club d'Alger, más conocido como MC Alger, es un club de fútbol profesional de Argelia fundado en Argel, en el año 1921. Juega actualmente en el Campeonato Nacional de Argelia y disputa sus partidos como local en el estadio 5 de Julio 1962. Los colores del club son rojo y verde.\\nFundado en 1921 como Mouloudia Chaàbia d'Alger, el club fue conocido como Mouloudia Pétroliers d'Alger entre 1977 y 1986, pero cambió su nombre por el de Mouloudia Club d'Alger en 1986. Mantiene una gran rivalidad con el JS Kabylie, que son los dos clubes más laureados de Argelia, con quien disputa el Clásico argelino.\\nEl MC Alger fue el primer club de Argelia en ganar una competición continental, ganando la Copa Africana de Clubes Campeones en 1976. Se trata de uno de los clubes más exitosos de Argelia después de haber ganado la liga nacional siete veces, sólo superada por el JS Kabylie, y la copa nacional en seis ocasiones."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BD%E3%82%A6%E3%83%AB%E7%89%B9%E5%88%A5%E5%B8%82%E5%9C%B0%E4%B8%8B%E9%89%84%E5%85%AC%E7%A4%BE2000%E7%B3%BB%E9%9B%BB%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Dangsan_Railway_Bridge.jpg","page_title":"ソウル特別市地下鉄公社2000系電車","context_page_description":"2000系電車は、ソウル交通公社の通勤形電車。ソウル交通公社2号線で使用されている。"},{"page_url":"https://uk.wikipedia.org/wiki/Surfer_Blood","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Surfer_Blood_2013.jpg","page_title":"Surfer Blood","context_page_description":"Surfer Blood — американський гурт із Вест-Палм-Біч, Флорида, що грає в стилі інді-рок. Станом на 2018 рік співпрацює з лейблом Joyful Noise Recordings, раніше — з Warner Bros. Records. Гурт має чотирьох учасників: Джон Пол Піттс, Майк Мак-Клірі, Ліндсі Міллз і Тайлер Шварц."},{"page_url":"https://fr.wikipedia.org/wiki/Voile_(navire)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ea/La_jonque_chinoise_PA_YENG_%285%29.JPG","page_title":"Voile (navire)","context_page_description":"Une voile est un assemblage de pièces de tissu, dont la taille peut varier de quelques mètres carrés à plusieurs centaines de mètres carrés, qui, grâce à l'action du vent, sert à faire avancer un véhicule. Les voiles sont utilisées sur des voiliers, planches à voile, mais aussi sur des véhicules terrestres.\\nLe type de voiles utilisé et leur agencement sur les mâts, vergues et/ou étais s'appellent le gréement.\\nL'effet des courses au large a motivé la recherche dans ce domaine, tout comme dans la conception des coques par adjonction de foils, de ballasts."},{"page_url":"https://ca.wikipedia.org/wiki/Papa_Esteve_VIII","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Pope_Stephen_VIII.jpg","page_title":"Papa Esteve VIII","context_page_description":"Esteve VIII va ser Papa de l'Església Catòlica del 939 al 942.\\nVa ser escollit papa, igual que el seu predecessor, per disposició del príncep i senador romà\\nAlberic II de Tusculum, que com la seva mare Marozia va sotmetre durant dècades els papes escollits sota el seu mandat.\\nDurant el seu pontificat, en 940, va intervenir en l'enfrontament que tenia lloc a França entre el comte Hug de París i el rei Lluís IV d'Ultramar, aliant-se amb el darrer i amenaçant d'excomunica als francesos i borgonyesos que ni li prestessin obediència.\\nSegons certes fonts poc fiables hauria estat objecte d'una conspiració, en el curs de la qual li haurien tallat el nas.\\nVa morir l'octubre del 942."},{"page_url":"https://pl.wikipedia.org/wiki/N%C3%BCrnberger_Gastein_Ladies_2013","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Yvonne_Meusburger_%28AUT%29_%289629999775%29.jpg","page_title":"Nürnberger Gastein Ladies 2013","context_page_description":"Nürnberger Gastein Ladies 2013 – tenisowy turniej WTA z cyklu Gastein Ladies rozgrywany w dniach 15–21 lipca 2013 roku w Bad Gastein na kortach ziemnych o puli nagród 235 000 dolarów amerykańskich."},{"page_url":"https://es.wikipedia.org/wiki/Britain%27s_Next_Top_Model","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/BINTM.png","page_title":"Britain's Next Top Model","context_page_description":"Britain's Next Top Model es un Reality Británico en el que un número de mujeres compiten por el título de Britain's Next Top Model y la oportunidad de iniciar su carrera en la industria del modelaje.\\nComo parte de Top Model está basado en el formato del programa estadounidense America's Next Top Model, con algunas diferencias. El 1 de febrero de 2010 fue anunciado que la supermodelo Elle Macpherson sería la nueva conductora y jueza principal. El show estaba originalmente bajo el mando de Lisa Butcher quien abandonó su lugar al finalizar el Ciclo 1. Ocupando dicho lugar, luego, Lisa Snowdon se mantuvo desde el Ciclo 2 al Ciclo 5.\\nEn una reciente entrevista para la BBC, Macpherson contrastó la versión británica con la original, describiendo BNTM como \\"lo británico de una forma única, con el sentido del humor que nos caracteriza... con situaciones más híbridas, y yo creo que eso es un ejemplificatorio de lo que nos pasa en la actualidad aquí\\".\\nEn 2012, el show original America's Next Top Model anunció que para su Ciclo 18 traería a 7 chicas que ya habían competido en este programa para que compitieran contra 7 chicas estadounidenses en una invasión británica."},{"page_url":"https://war.wikipedia.org/wiki/Trimbach,_Swiza","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Trimbach_de_vidita_Hauenstein-Pasejo_095.JPG","page_title":"Trimbach, Swiza","context_page_description":"An Trimbach amo in usa ka munisipalidad ha distrito han Gösgen han canton han Solothurn ha nasod han Swiza."},{"page_url":"https://nds.wikipedia.org/wiki/H%C3%B6nau-Lind%C3%B6rp","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Oold_Spr%C3%BCttenhuus_in_H%C3%B6nau-Lind%C3%B6rp.jpg","page_title":"Hönau-Lindörp","context_page_description":"Hönau-Lindörp is en Dörp in de Gemeen Bremervöör, in’n Landkreis Rodenborg, Neddersassen."},{"page_url":"https://zh.wikipedia.org/wiki/Strv_74%E5%9D%A6%E5%85%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Strv74wRb52.jpg","page_title":"Strv 74坦克","context_page_description":"Stridsvagn 74，常缩写为Strv 74，是一款瑞典于20世纪50年代研发、生产的中型坦克。该坦克于1958年入役，一直服役到1984年方才退役。1960年代后，瑞典陆军的一线部队逐渐撤装Strv 74坦克，改用更现代的坦克。从1970年代起，一些Strv 74坦克的炮塔陆续被拆下，安装到固定炮塔座上当作堡垒炮塔使用。"},{"page_url":"https://zh.wikipedia.org/wiki/%E9%98%BF%E6%8B%89%E5%B7%B4%E9%A9%AC%E5%B7%9E%E5%B8%82%E9%95%87%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/AuburnALAbove.jpg","page_title":"阿拉巴马州市镇列表","context_page_description":"亚拉巴马州是美国南部州份，根据2010年美国人口普查的统计数据显示，全州共有477万9745人，在50个州中排名第23，13万1170.8平方公里面积则在各州排第28位，全州一共分为67个县，其中包含169个城市和291个镇，共计460个注册成立的市法团。这些城镇的总面积只占全州的9.6%，但人口上则占到了60.4%。\\n根据1975年亚拉巴马州法典的规定，全州各市法团根据人口数量来确定当地属“市”还是“镇”，人口不小于2000的属市，小于2000则属镇。出于立法方面需要，所有市法团按人口多少分为8个类别，其中一类是指人口不少于30万的城市。虽然亚拉巴马州目前没有任何城市的人口达到这一标准，但伯明翰曾于1970年达到30万零910人，此后人口虽有下降，但仍然得以保留这一类别，是州内仅有的一类城市。二类城市是指人口在17万5000至29万9999的城市，现在该州有蒙哥马利、莫比尔和亨茨维尔3个城市人口在这一范围内。三类城市是人口数在10万至17万4999的城市，亚拉巴马州目前没有此类城市。塔斯卡卢萨、胡佛、多森、迪凯特和欧本的人口均在5万至9万9999之间，属四类城市。人口在2万5000至4万9999的属五类城市，全州共有10个。六类城市则有34个，人口在1万2000至2万4999之间。拥有6000至1万1999人的属七类城市，州内共有40个。八类则包括所有的镇，以及人口数不足6000的市。\\n全州人口最多的城市是伯明翰，有21万2237位居民，最少的则是麦克马伦，仅有10人。亨茨维尔是州内面积最大的城市，占地541.4平方公里，麦克马伦的面积仅有0.28平方公里，是亚拉巴马州最小的镇。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B8%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B8%D1%86%D0%B0_%D0%9B%D0%B0%D0%B9%D1%8D%D0%BB%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/Larix_lyallii_seeds.jpg","page_title":"Лиственница Лайэля","context_page_description":"Лиственница Лайэля — вид хвойных деревьев из рода Лиственница семейства Сосновые.\\nВ культуре в Англии с 1904 года, редко. В СССР не отмечена."},{"page_url":"https://fr.wikipedia.org/wiki/Propagande_am%C3%A9ricaine_durant_la_Seconde_Guerre_mondiale","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/Propaganda_poster_depicts_the_Philippine_resistance_movement.jpg","page_title":"Propagande américaine durant la Seconde Guerre mondiale","context_page_description":"La propagande américaine durant la Seconde Guerre mondiale est utilisée pour accroître le soutien à la guerre et souligner la détermination des Alliés à obtenir la victoire. L'utilisation d'un large éventail de médias, la haine de l'ennemi fomentée par les propagandistes et le soutien aux alliés des États-Unis, exhorte le grand public à un plus grand effort pour aider la production de guerre et les jardins de la victoire, persuade les gens d'économiser une partie de leurs matériaux de sorte que davantage peuvent être utilisés pour l'effort de guerre et d'acheter des obligations de guerre. Le patriotisme devient le thème central de la publicité tout au long de la guerre tandis que des campagnes à grande échelle sont lancées pour vendre des obligations de guerre, promouvoir l'efficacité dans les usines, réduire les rumeurs malfaisantes et maintenir le moral des civils. La guerre renforce le rôle de l'industrie de la publicité dans la société américaine, détournant ainsi les critiques antérieures."},{"page_url":"https://fr.wikipedia.org/wiki/Abbaye_de_Perseigne","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Abbaye_de_perseigne_boudan_gaigni%C3%A8res.jpg","page_title":"Abbaye de Perseigne","context_page_description":"L'abbaye de Perseigne est une ancienne abbaye cistercienne, fondée en 1145, dont il ne reste que quelques pans de murs, située dans le nord de la Sarthe, aux portes de la forêt de Perseigne, du Parc naturel régional Normandie-Maine, sur la commune de Neufchâtel-en-Saosnois. Ses ruines sont inscrites aux monument historiques depuis le 4 octobre 1932. Sur le plan matériel, la fondation était d'importance moyenne au sein de l'ordre cistercien. Elle a organisé son temporel aux XIIᵉ et XIIIᵉ siècles au moyen d'un réseau de granges qui a pu être reconstitué par prospection archéologique. Deux bâtiments agricoles ont laissé des vestiges significatifs."},{"page_url":"https://de.wikipedia.org/wiki/M%C3%B6nkloh","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Schleswig-Holstein%2C_M%C3%B6nkloh%2C_Naturdenkmal_1112-2_NIK_3753.JPG","page_title":"Mönkloh","context_page_description":"Mönkloh ist eine Gemeinde im Kreis Segeberg in Schleswig-Holstein. Sie ist die westlichste Gemeinde des Kreises und grenzt an die Kreise Pinneberg und Steinburg."},{"page_url":"https://ro.wikipedia.org/wiki/Cronologia_vie%C8%9Bii_lui_Nicolae_Grigorescu","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Nicolae_Grigorescu_-_Corturi_de_tigani_la_apusul_soarelui.jpg","page_title":"Cronologia vieții lui Nicolae Grigorescu","context_page_description":"Nicolae Grigorescu este primul dintre fondatorii picturii române moderne, urmat de Ion Andreescu și Ștefan Luchian. Nicolae Grigorescu a devenit un simbol pentru tinerele generații de artiști care, în primele decenii ale secolului al XX-lea, căutau să identifice și să aducă la lumină valorile spiritualității românești.\\n„Viața lui Grigorescu o povestesc operele lui. O viața simplă, tăcută, ordonată. Puternică. Închinată toată artei lui. În afară de artă nimic nu exista pentru el. Acolo și-a pus adânca lui iubire de natură, de podoabele și tainele ei, minunate pretutindeni, dar mai ales țara și în făptura neamului lui; acolo iubirea de bine, de adevăr și de frumos...\\nGrigorescu era făcut pentru a vedea înlăuntrul lucrurilor. Tăcut, pururea gânditor, neliniștit, având nu numai pasiunea de a observa, dar și darul de a vedea, omul acesta era cu neputință să se mulțumească numai cu ce spun formele la suprafață. Toată adâncimea acestui suflet meditativ își cerea în afară proporția de adâncime, în bătaia privirii, pe care o arunca asupra lucrurilor. El nu era un trecător grăbit în lumea aceasta, pe care a căutat s-o vadă, fără să fie văzut. Un lucrător grăbit — da."},{"page_url":"https://sv.wikipedia.org/wiki/%C3%89lise-Daucourt","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Map_commune_FR_insee_code_51228.png","page_title":"Élise-Daucourt","context_page_description":"Élise-Daucourt är en kommun i departementet Marne i regionen Grand Est i nordöstra Frankrike. Kommunen ligger i kantonen Sainte-Menehould som tillhör arrondissementet Sainte-Menehould. År 2009 hade Élise-Daucourt 107 invånare."},{"page_url":"https://en.wikipedia.org/wiki/Gerard_de_la_Vall%C3%A9e","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Gerard_de_la_Vallee_-_Longinus_piercing_Christ%27s_side_with_a_spear.png","page_title":"Gerard de la Vallée","context_page_description":"Gerard de la Vallée was a Flemish painter of landscapes and history paintings. His work was inspired by the great Flemish masters and mainly produced for the export market."},{"page_url":"https://de.wikipedia.org/wiki/Mauracher_(Orgelbauer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Filzmoos_1._6%2C_2010_004.jpg","page_title":"Mauracher (Orgelbauer)","context_page_description":"Die Orgelbauerfamilie Mauracher war eine österreichische Orgelbauerfamilie, die vom 18. bis ins 20. Jahrhundert tätig war. Die Familie lässt sich bis zu Georg Mauracher, einem Tischler in Kapfing, heute zur Gemeinde Fügen im Tiroler Zillertal gehörend, rückverfolgen."},{"page_url":"https://en.wikipedia.org/wiki/Horace_Maynard","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Horace-Maynard-THC-marker-tn1.jpg","page_title":"Horace Maynard","context_page_description":"Horace Maynard was an American educator, attorney, politician and diplomat active primarily in the second half of the 19th century. Initially elected to the House of Representatives from Tennessee's 2nd Congressional District for the term commencing on March 4, 1857, Maynard, an ardent Union supporter and later abolitionist, became one of the few Southern congressmen to maintain his seat in the House during the Civil War. Toward the end of the war, Maynard served as Tennessee's attorney general under Governor Andrew Johnson, and later served as ambassador to Turkey under President Ulysses S. Grant and Postmaster General under President Rutherford B. Hayes.\\nMaynard left his teaching position at East Tennessee College in the early 1840s to pursue a career in law, and quickly developed a reputation among his peers for his reasoning ability and biting sarcastic style. He spent much of his first two terms in Congress fighting to preserve the Union, and during the Civil War, he consistently urged President Abraham Lincoln to send Union forces to free East Tennessee from its Confederate occupiers."},{"page_url":"https://it.wikipedia.org/wiki/Mario_Stani%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Mario_Stanic.jpg","page_title":"Mario Stanić","context_page_description":"Mario Stanić è un dirigente sportivo ed ex calciatore croato, di ruolo trequartista."},{"page_url":"https://de.wikipedia.org/wiki/Regressionsanalyse","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Mincer_partiallinear.png","page_title":"Regressionsanalyse","context_page_description":"Die Regressionsanalyse ist ein Instrumentarium statistischer Analyseverfahren, die zum Ziel haben, Beziehungen zwischen einer abhängigen und einer oder mehreren unabhängigen Variablen zu modellieren. Die Durchführung einer Regression wird verwendet, um Zusammenhänge quantitativ zu beschreiben oder Werte der abhängigen Variablen zu prognostizieren. Die häufigste Form der Regressionsanalyse ist die lineare Regression, bei der der Anwender eine Gerade findet, die den Daten nach einem bestimmten mathematischen Kriterium am besten entspricht. Beispielsweise berechnet die gewöhnliche Methode der kleinsten Quadrate eine eindeutige Gerade, die die Summe der Abweichungsquadrate zwischen den wahren Daten und dieser Linie, d. h. die Residuenquadratsumme minimiert. Aus bestimmten mathematischen Gründen kann der Anwender den bedingten Erwartungswert der abhängigen Variablen schätzen, wenn die unabhängigen Variablen eine bestimmte Menge von Werten annehmen. Weniger gebräuchliche Formen der Regression verwenden geringfügig unterschiedliche Verfahren zum Schätzen alternativer Lageparameter oder zum Schätzen des bedingten Erwartungswertes für eine breitere Klasse nichtlinearer Modelle."},{"page_url":"https://cs.wikipedia.org/wiki/Sk%C5%99%C3%ADpina_lesn%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/ScirpusSylvaticus.jpg","page_title":"Skřípina lesní","context_page_description":"Skřípina lesní je jeden ze dvou původních druhů rodu skřípina, které rostou v České republice. Je to vytrvalá, jednoděložná rostlina vlhkých půd vyskytující se v chladnějších oblastech Evropy, jen ojediněle se objevuje v západní Asii a na severovýchodě Severní Americe. V Česku je rozšířena po většině území, od nížin až do podhůří."},{"page_url":"https://sv.wikipedia.org/wiki/Flemingsberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Bj%C3%B6rnkulla%2C_2018b.jpg","page_title":"Flemingsberg","context_page_description":"Flemingsberg är en kommundel i Huddinge kommun, Stockholms län. Bebyggelsen ligger i sydvästra delen av Stockholms sammanhängande tätortsområde. I kommundelen arbetar cirka 12 000 personer och cirka 20 000 studenter läser vid Södertörns högskola, Karolinska Universitetssjukhuset i Huddinge och Kungliga Tekniska Högskolans campus i Flemingsberg. Sedan januari 2015 ligger även Polishögskolan i Flemingsberg och är en del av Södertörns högskola. Folkmängden i Flemingsberg är omkring 17 500."},{"page_url":"https://tr.wikipedia.org/wiki/Gece_u%C3%A7u%C5%9Fu","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Nachtflugbeschraenkungen_DE_2006.jpg","page_title":"Gece uçuşu","context_page_description":"Gece uçuşu, hava taşıtlarının belirli kurallara uyarak, havacılıkta \\"gece\\" olarak tanımlanan zaman aralığında gerçekleştirdiği uçuş. Havacılıkta gecenin tanımı ülkeden ülkeye değişebilir. Gece uçuşları esnasında gerçekleşen gürültünün insan sağlığı üzerindeki olumsuz etkileri nedeniyle pek çok ülkede gece uçuşları ile ilgili kısıtlamalar mevcuttur."},{"page_url":"https://en.wikipedia.org/wiki/Hillary_Clinton_2008_presidential_campaign","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/2008_Democratic_Primaries_Delegate_Vote.svg","page_title":"Hillary Clinton 2008 presidential campaign","context_page_description":"The 2008 presidential campaign of Hillary Rodham Clinton, then junior United States Senator from New York, was announced on her website on January 20, 2007. Hillary Clinton was previously the First Lady of the United States and First Lady of Arkansas prior to her election as U.S. Senator from New York. She is also the wife of former President Bill Clinton. Clinton was the source of much media speculation since having expressed interest in being a candidate in the 2008 presidential election since at least October 2002.\\nFollowing her announcement of an exploratory committee and candidacy filing on January 20, 2007 with the FEC, she began fundraising and campaigning activities. For several months Clinton led opinion polls among Democratic candidates by substantial margins until Senator Barack Obama pulled close to or even with her. Clinton then regained her polling lead, winning many polls by double digits; by autumn 2007 she was leading all other Democratic candidates by wide margins in national polls."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A5%D1%80%D0%B5%D0%B1%D0%B5%D1%82_%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D0%B8_%D0%84%D0%BB%D0%B8%D0%B7%D0%B0%D0%B2%D0%B5%D1%82%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/Antarctica_major_geographical_features.jpg","page_title":"Хребет Королеви Єлизавети","context_page_description":"Хребет Королеви Єлизавети — гірський хребет в Антарктиді, розташований в середній частині гірської системи Трансантарктичних гір, і простягнувся від гірського льодовика Німрод на північному заході до льодовика Лав — на південному сході. Відокремлює шельфовий льодовик Росса від Полярного плато."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%94%D0%BE%D0%BB%D0%BD%D0%BE_%D0%A3%D0%B9%D0%BD%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Dolno-Uyno-mayors.jpg","page_title":"Долно Уйно","context_page_description":"Долно Уйно е село в Западна България. То се намира в община Кюстендил, област Кюстендил."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Bamberg_County,_South_Carolina","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/General_Francis_Marion_Bamberg_House.jpg","page_title":"National Register of Historic Places listings in Bamberg County, South Carolina","context_page_description":"This is a list of the National Register of Historic Places listings in Bamberg County, South Carolina.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Bamberg County, South Carolina, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in a map.\\nThere are 12 properties and districts listed on the National Register in the county, including 1 National Historic Landmark.\\nThis National Park Service list is complete through NPS recent listings posted December 22, 2017."},{"page_url":"https://en.wikipedia.org/wiki/Getting_Gertie%27s_Garter_(play)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Gettinggertiesgarter-1922-newspaperadvert.jpg","page_title":"Getting Gertie's Garter (play)","context_page_description":"Getting Gertie's Garter is a play written by Wilson Collison and Avery Hopwood. Producer A. H. Woods staged it on Broadway, where it opened at the Republic Theatre on August 1, 1921. Hazel Dawn played the role of Gertie. The play was a sex farce, but unlike most productions of its type, the setting was a hayloft instead of a bedroom. It was a success at the box office, running for 15 weeks with 120 performances on Broadway, then moving to touring companies.\\nThe play had tryouts starting in Brooklyn, then in Boston and Chicago under the reduced title of Gertie's Garter. Dawn found her role unsatisfying due to its similarity to her part in Up in Mabel's Room, an earlier farce produced by Woods, but stuck with the show. She eventually left the Broadway production in September to take the lead in another Woods-produced farce, The Demi-Virgin."},{"page_url":"https://pl.wikipedia.org/wiki/Nicolas_Bouvier","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Nicolas_Bouvier_%281987%29_by_Erling_Mandelmann.jpg","page_title":"Nicolas Bouvier","context_page_description":"Nicolas Bouvier - szwajcarski podróżnik, fotograf i pisarz tworzący w języku francuskim.\\nPodróżować - początkowo po Europie - zaczął jako nastolatek, a jego teksty z kolejnych wypraw były publikowane w szwajcarskich gazetach. Studiował literaturę i prawo. Na początku lat 50. wraz z przyjacielem Thierrym Vernetem ruszył w podróż - samochodem - do Azji. Przez Turcję, Iran, Afganistan i Indie dotarł na wyspę Cejlon, gdzie mieszkał przez niemal dwa lata. Pierwsza część wyprawy została opisana w wydanej w 1963 książce Oswajanie świata, pobyt na Cejlonie jest głównym tematem 20 lat późniejszej powieści Ryba-skorpion. Następnie udał się do Japonii. Zafascynowany Azją, a zwłaszcza Japonią, wielokrotnie wracał na ten kontynent.\\nProza Bouviera jest wybitnie autobiograficzna, w kolejnych książkach relacjonuje on swoje podróże. Daleko jej jednak do tradycyjnej literatury podróżniczej - pisarz opisuje nie tylko poznawane kraje i miejscowe zwyczaje, ale odsłania również własne stany psychiczne, chętnie wplatając w relację rozważania filozoficzne."},{"page_url":"https://en.wikipedia.org/wiki/Maria_Agresta","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Berrugi%2C_Agresta%2C_Macheda.jpg","page_title":"Maria Agresta","context_page_description":"Maria Giovanna Agresta is an Italian operatic soprano."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Zevenbergen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Zevenbergen_-_Markt_1_-_Dubbel_woonhuis.jpg","page_title":"Lijst van rijksmonumenten in Zevenbergen","context_page_description":"De plaats Zevenbergen telt 15 inschrijvingen in het rijksmonumentenregister. Hieronder een overzicht."},{"page_url":"https://it.wikipedia.org/wiki/Storia_diplomatica_della_seconda_guerra_mondiale","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Manchukuo011.jpg","page_title":"Storia diplomatica della seconda guerra mondiale","context_page_description":"La storia diplomatica della seconda guerra mondiale include le principali scelte politiche operate in campo estero ed interazioni tra opposte coalizioni, gli Alleati e le potenze dell'Asse. La storia militare della guerra è quella della seconda guerra mondiale. La diplomazia prima dello scoppio della guerra è da ricercare nelle cause della seconda guerra mondiale e nelle relazioni internazionali."},{"page_url":"https://en.wikipedia.org/wiki/Docodonta","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Castorocauda_BW.jpg","page_title":"Docodonta","context_page_description":"Docodonta is an order of extinct mammaliaforms that lived during the Mesozoic, from the Middle Jurassic to Early Cretaceous. They are distinguished from other early mammaliaforms by their relatively complex molar teeth, from which the order gets its name. Until recently, Docodonta were represented primarily by\\nteeth and jaws found across former Laurasia. However, recent discoveries in China include some exceptionally well preserved, almost complete body fossils."},{"page_url":"https://en.wikipedia.org/wiki/Judaizers","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/20050921circoncisionB.jpg","page_title":"Judaizers","context_page_description":"Judaizers are Christians who teach it is necessary to adopt Jewish customs and practices, especially those found in the Law of Moses, to be saved. The term is derived from the Koine Greek word Ἰουδαΐζειν, used once in the Greek New Testament, when Paul publicly challenges Peter for compelling Gentile converts to Early Christianity to \\"judaize\\". This episode is known as the incident at Antioch.\\nThis term includes groups who claim the necessity of continued obedience to the Law of Moses found in the Pentateuch for gentiles. Members of such groups dispute the label because \\"Judaizers\\" is typically used as a pejorative.\\nMost Christians believe that much of the Old Covenant has been superseded, while according to some modern Protestants it has been completely abrogated and replaced by the Law of Christ. The Christian debate over Judaizing began in the lifetime of the apostles, notably at the Council of Jerusalem and the incident at Antioch. It has been carried on parallel to continuing debates about Paul the Apostle and Judaism, Protestant views of the Ten Commandments, and Christian ethics."},{"page_url":"https://eo.wikipedia.org/wiki/Vintra_Palaco_de_%C4%A5ano_Bogd","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Winter_Palace_Bogd_Khan_149183775_8aa3cfd1c9_b.jpg","page_title":"Vintra Palaco de ĥano Bogd","context_page_description":"La Vintra Palaco de la Bogd Khan situas en suda Ulanbatoro, sur la vojo al Zaisan. Ĝi nun estas muzeo. La palaco estas la sole restita el origine kvar restadejoj de la oka Jebtsundamba Ĥutughtu, kiu estis poste proklamita Bogd Ĥan, aŭ imperiestro de Mongolio.\\nLa komplekso inkludas ses templojn. Sur ekrano estas multaj de la posedoj de Bogd Ĥan, kiel lia trono kaj lito, liaj kolektaĵoj de arto kaj remburitaj bestoj, lia ornamita ceremonia jurto, kaj paro de ceremoniaj botoj donita al la Ĥano de rusa caro Nikolao la 2-a."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%8A%D8%A7%27%D8%A7%D9%83%D9%88%DA%A4_%D8%B2%D9%8A%D8%B1%D9%88%D8%A8%D8%A7%DA%A4%D9%8A%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Ya%27akov_Zerubavel.jpg","page_title":"يا'اكوڤ زيروباڤيل","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nيا'اكوڤ زيروباڤيل كان صحفى من اسرائيل."},{"page_url":"https://es.wikipedia.org/wiki/Mundra","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Gujarat_in_India_%28claimed_and_disputed_hatched%29.svg","page_title":"Mundra","context_page_description":"Mundra es una ciudad de India en el distrito de Kutch en el estado de Guyarat. Tenía una población de 20 338 hab. en 2011. Está ubicada al noroeste del estado, sobre la costa del golfo de Kutch, mar Arábigo."},{"page_url":"https://sv.wikipedia.org/wiki/Avenue_of_the_Americas","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/42nd_St_6th_Av_td_64_-_1100_Sixth_Avenue.jpg","page_title":"Avenue of the Americas","context_page_description":"Avenue of the Americas alternativt Sixth Avenue är en huvudled som ligger på Manhattan i New York i den amerikanska delstaten med samma namn. Gatan är cirka sex kilometer lång och sträcker sig från södra änden av parken Central Park i norr och till Church Street i stadsdelen Tribeca i söder.\\nGatan anlades 1811 som Sixth Avenue och hette så officiellt fram till 1945 när New Yorks borgmästare Fiorello La Guardia uppmanade New Yorks stadsfullmäktige att byta det officiella namnet till Avenue of the Americas. La Guardia ville med förslaget att hylla panamerikanismen och att få länder i Central- och Sydamerika att etablera ambassader utmed gatan. Det antogs och blev en lag, som signerades av La Guardia den 2 oktober samma år. Vid Central Park står det statyer av José de San Martín, José Martí och Simón Bolívar medan vid Bryant Park står det en staty av José Bonifácio de Andrada e Silva, statyerna donerades av respektive lands regering för att visa uppskattning till namnbytet. 1984 ville man byta tillbaka till Sixth Avenue för att förenkla för stadens turism men en del av lokalbefolkningen satte sig emot förslaget och det rann ut i sanden."},{"page_url":"https://en.wikipedia.org/wiki/Van_Lear_Black","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/COLLECTIE_TROPENMUSEUM_Vliegveld_Tjililitan_met_benzinestation_bij_Meester_Cornelis_Batavia_Java_TMnr_10010739.jpg","page_title":"Van Lear Black","context_page_description":"Van Lear Black was an American publisher and civil aviation pioneer."},{"page_url":"https://en.wikipedia.org/wiki/Congress_of_People%27s_Deputies_of_Russia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Russian_Congressional_Parties_1991_%28October%29.png","page_title":"Congress of People's Deputies of Russia","context_page_description":"The Congress of People's Deputies of the Russian SFSR and since 1991 Congress of People's Deputies of the Russian Federation was the supreme government institution in the Russian SFSR and in the Russian Federation from 16 May 1990 to 21 September 1993. Elected on 4 March 1990 for a period of five years, it was dissolved by presidential decree during the Russian constitutional crisis of 1993 and ended de facto when the Russian White House was attacked on 4 October 1993. The Congress played an important role in some of the most important events in the history of Russia during this period, such as the declaration of independence of Russia from the USSR, the rise of Boris Yeltsin, and economic reforms."},{"page_url":"https://ceb.wikipedia.org/wiki/Cerro_Romualdo","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/Ninesisters.jpg","page_title":"Cerro Romualdo","context_page_description":"Bukid ang Cerro Romualdo sa Tinipong Bansa. Ang Cerro Romualdo nahimutang sa kondado sa San Luis Obispo County ug estado sa California, sa habagatan-kasadpang bahin sa nasod, 3,900 km sa kasadpan sa ulohang dakbayan Washington, D.C. 363 metros ibabaw sa dagat kahaboga ang nahimutangan sa Cerro Romualdo, o 192 ka metros sa ibabaw sa naglibot nga tereyn. Mga 1.4 ka kilometro ang gilapdon sa tiilan niini.\\nAng yuta palibot sa Cerro Romualdo kay kabungtoran. Ang kinahabogang dapit sa palibot dunay gihabogon nga 801 ka metro ug 7.5 km sa amihanan-sidlakan sa Cerro Romualdo. Dunay mga 86 ka tawo kada kilometro kwadrado sa palibot sa Cerro Romualdo medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang San Luis Obispo, 7.0 km sa habagatan-sidlakan sa Cerro Romualdo. Hapit nalukop sa kabalayan ang palibot sa Cerro Romualdo. Sa rehiyon palibot sa Cerro Romualdo, mga walog, ug kagaangan talagsaon komon.\\nAng klima mediteranyo. Ang kasarangang giiniton 18 °C. Ang kinainitan nga bulan Agosto, sa 25 °C, ug ang kinabugnawan Enero, sa 11 °C. Ang kasarangang pag-ulan 350 milimetro matag tuig."},{"page_url":"https://es.wikipedia.org/wiki/Pedro_Mu%C3%B1oz_(Ciudad_Real)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Mallard_drake_flight.jpg","page_title":"Pedro Muñoz (Ciudad Real)","context_page_description":"Pedro Muñoz es un municipio español situado en la punta nordeste de la provincia de Ciudad Real, en la comunidad autónoma de Castilla-La Mancha.\\nSe encuentra en la región natural de La Mancha y, a su vez, en la comarca de la Mancha Alta, a una altitud de 656 msnm y en el margen derecho del río Záncara. Pertenece también a la asociación para el desarrollo y promoción de la Mancha Norte Promancha y a la Mancomunidad de Servicios de Comsermancha. En la comarca el pueblo es conocido popularmente como Perrote.​ Pertenece al partido judicial de Alcázar de San Juan y se encuentra a 113 km de la capital provincial.\\nEl municipio, con una población de 7.714 habitantes en 2015, ​ y una densidad de población de 77,02 hab./km², tiene un término municipal de reducido tamaño, 101,3 km², debido al abandono del municipio en el año 1410; sin embargo, a finales del siglo XIX y durante principios del siglo XX llegó a convertirse en un importante núcleo económico en la región.​ Por aquel entonces era un referente industrial en la región cuando se creó, en un principio, industria vinculada al cultivo de la vid, cuando los pueblos de alrededor estaban estancados y paralizados económicamente.​"},{"page_url":"https://hu.wikipedia.org/wiki/F%C5%91_utca_(Balk%C3%A1ny)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Balk%C3%A1ny_Szabolcs_Takar%C3%A9k.JPG","page_title":"Fő utca (Balkány)","context_page_description":"A Fő utca Balkány egyik legjelentősebb, legrégebbi utcája, része a 4102-es közútnak. A Kossuth Lajos tér délkeleti sarkából indul kelet felé, keresztezi az Iskola és Dózsa György utca találkozását, majd egyenesen halad tovább a Rákóczi tér irányába. Egyirányú, akárcsak a többi út a balkányi belvárosban. A városon áthaladó személyforgalom itt bonyolódik le, lévén, hogy az utca része a belvárosi körútnak. Az Iskola és Dózsa György utca kereszteződésétől a postahivatal épületéig csak egy sávon, a menetirány szerinti bal oldal használható, 30 km/h-s sebességkorlátozás mellett. Az út jobb oldala leállósáv jellegű parkoló 2006 óta, amikor felújították a teljes utat. Az utca házszámozása a menetiránnyal ellentétesen, a Rákóczi téren kezdődik.\\nAz utca névadója 2012. december 31-ét megelőzően Ságvári Endre volt."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D0%B0%D1%81%D0%B0%D0%BA%D1%80_%D1%83_%D0%92%D0%B0%D1%82%D0%B0%D1%88%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/%D0%9F%D1%80%D0%B5%D0%BD%D0%B5%D1%81%D1%83%D0%B2%D0%B0%D1%9A%D0%B5_%D0%BD%D0%B0_%D0%BE%D1%81%D1%82%D0%B0%D0%BD%D0%BA%D0%B8%D1%82%D0%B5_%D0%BD%D0%B0_%D0%92%D0%B0%D1%82%D0%B0%D1%88%D0%BA%D0%B8%D1%82%D0%B5_%D0%B4%D0%B5%D1%86%D0%B0.jpg","page_title":"Масакр у Ваташи","context_page_description":"Масакр у Ваташи починили су бугарски војници 16. јуна 1943. године, стрељајући 12 омладинаца, чланова СКОЈ-а, из села Ваташе. Стрељање је извршено код села Моклиште, атар Чаир, 12 километара далеко од Ваташе. Масакр је наредио Љубен Апостолов, заповедник 53. велешког пешадијског пука Пете бугарске армије."},{"page_url":"https://gl.wikipedia.org/wiki/Ertzaintza","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Escudo_de_Gorra_%28Escala_Superior%29.png","page_title":"Ertzaintza","context_page_description":"A Ertzaintza é a policía integral de Euskadi. Foi creada en 1982, en desenvolvemento do Estatuto de Autonomía do País Vasco de 1979. Na actualidade, o 90% dos axentes, denominados ertzainas, dos máis de 7.500 que dispón o corpo en Euskadi, son homes. Dispón de 25 comisarías despregadas nas distintas comarcas vascas.\\nActualmente a Ertzaintza ten tódalas competencias en orde pública, seguridade cidadá e tráfico do País Vasco."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_Ramsbottom","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/The_School_House_-_geograph.org.uk_-_330223.jpg","page_title":"Listed buildings in Ramsbottom","context_page_description":"Ramsbottom is a town in the Metropolitan Borough of Bury, Greater Manchester, England, and includes the villages of Holcombe and Summerseat and the surrounding countryside. The area is unparished, and it contains 51 listed buildings that are recorded in the National Heritage List for England. Of these, one is listed at Grade II*, the middle grade, and the others are at Grade II, the lowest grade. The area is partly agricultural, partly industrial, and partly residential. The listed buildings include farmhouses and farm buildings, private houses and associated structures, churches and items in churchyards, a hotel, public houses, an engineering works and a mill, a former railway goods shed, a monument, and a telephone kiosk."},{"page_url":"https://cs.wikipedia.org/wiki/Jakub_Hodr","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Jakub_Hodr.jpg","page_title":"Jakub Hodr","context_page_description":"Jakub Hodr byl český římskokatolický kněz, profesor teologie, buditel národa, kanovník a papežský prelát."},{"page_url":"https://en.wikipedia.org/wiki/Super_Duper","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Super_duper_james_road.jpg","page_title":"Super Duper","context_page_description":"Super Duper is a now-defunct chain of super markets once prevalent in north-eastern Pennsylvania, New York, and Ohio. With the 1997 demise of its owner, Burt Prentice Flickinger Jr., who had been instrumental in the success and growth of \\"S.M. Flickinger Co.\\", the company started a slow demise, and the last store disappeared in March 2010."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%AE%D8%B7%D9%88%D8%B7_%D8%A7%D9%84%D8%AC%D9%88%D9%8A%D8%A9_%D8%A7%D9%84%D8%A8%D9%84%D8%AC%D9%8A%D9%83%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/OO-SNC_Airbus_A320-214_A320_-_BEL_%22Magritte%22_%2830003640385%29.jpg","page_title":"الخطوط الجوية البلجيكية","context_page_description":"خطوط بروكسل الجوية ‏ هي شركة طيران والناقل الوطني وأكبر شركة طيران في بلجيكا وإحدى الشركات التابعة لشركة لوفتهانزا\\n. وتعمل لأكثر من 65 وجهة في 20 بلدا أوروبيا فضلا عن الرحلات الطويلة إلى شرق ووسط وغرب أفريقيا. وتعد الخطوط الجوية عضوا في اتحاد النقل الجوي الدولي واتحاد شركات الطيران الأوروبية وتحالف ستار."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9B%AD%E8%89%BA%E7%BF%A0%E9%9B%80%E8%8A%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Flowers_in_Brodsworth_Hall_gardens_%289313%29.jpg","page_title":"园艺翠雀花","context_page_description":"園藝翠雀花是毛茛科翠雀屬的一個栽培種或品種群，形成於19世紀，其主要親本是高翠雀花。"},{"page_url":"https://en.wikipedia.org/wiki/Architecture_of_Malta","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Malta_-_Mellieha-Manikata_%2B_Triq_Mellieha_-_Misrah_il-Parrocca_-_Manikata_Parish_Church_01_ies.jpg","page_title":"Architecture of Malta","context_page_description":"Maltese architecture has its origins in prehistory, and some of the oldest free-standing structures on Earth – a series of megalithic temples – can be found on Malta. The islands were colonized by the Phoenicians and later the Romans, who established the cities of Melite and Gaulos. Although these were substantial settlements and are known to have had numerous temples, churches and palaces, few remains have survived apart from some architectural fragments.\\nAfter the fall of the Western Roman Empire, Malta became part of the Byzantine Empire, before falling to the Arabs in 870. Virtually no examples of Byzantine or Arab architecture have survived, although the Arabs left a significant influence on Maltese vernacular architecture which remained popular in subsequent centuries. Malta became part of the County and later the Kingdom of Sicily in 1091, and Norman architecture and other European styles were introduced to the island. Relatively few examples of medieval architecture have survived, including a few buildings in Mdina and the Cittadella, as well as several chapels in the Maltese countryside."},{"page_url":"https://de.wikipedia.org/wiki/Zentralrat_der_Konfessionsfreien","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Zentralrat_der_konfessionsfreien.jpg","page_title":"Zentralrat der Konfessionsfreien","context_page_description":"Der Zentralrat der Konfessionsfreien ist ein Verband laizistischer Organisationen in Österreich. Er wurde im Dezember 2009 als Verein in Wien gegründet und versteht sich als Interessenvertretung der weltanschaulich offenen Konfessionsfreien.\\nDer Zentralrat tritt für die Trennung von Religion und Staat sowie für die Gleichstellung von Religions- und Weltanschauungsgemeinschaften ein. Er kämpft gegen die von seinen Mitgliedern als solche empfundene Diskriminierung von Atheisten und Agnostikern."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Grant_County,_Indiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Abijah_C._Jay_House.jpg","page_title":"National Register of Historic Places listings in Grant County, Indiana","context_page_description":"This is a list of the National Register of Historic Places listings in Grant County, Indiana.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Grant County, Indiana, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are 19 properties and districts listed on the National Register in the county, including 1 National Historic Landmark.\\nProperties and districts located in incorporated areas display the name of the municipality, while properties and districts in unincorporated areas display the name of their civil township. Properties and districts split between multiple jurisdictions display the names of all jurisdictions.\\nThis National Park Service list is complete through NPS recent listings posted May 31, 2019."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%83%D9%84%D9%8A%D9%85%D9%89_%D8%B3%D8%A7%D8%A8%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Klemi_Saban_%28cropped%29.JPG","page_title":"كليمى سابان","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nكليمى سابان لاعب كورة قدم من اسرائيل."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B0-%D0%A5%D1%83%D0%BD%D1%82%D0%B0_(%D0%9A%D0%BE%D0%BB%D0%BE%D1%80%D0%B0%D0%B4%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Woodruff_Block_La_Junta_Colorado_1892.jpg","page_title":"Ла-Хунта (Колорадо)","context_page_description":"Ла-Хунта — місто в США, в окрузі Отеро штату Колорадо. Населення — 7077 осіб."},{"page_url":"https://en.wikipedia.org/wiki/Dactyloidae","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/Anolis_garmani_on_tree.jpeg","page_title":"Dactyloidae","context_page_description":"Dactyloidae are a family of lizards commonly known as anoles and native to warmer parts of the Americas, ranging from southeastern United States to Paraguay. Instead of treating it as a family, some authorities prefer to treat it as a subfamily, Dactyloinae, of the family Iguanidae. In the past they were included in the family Polychrotidae together with Polychrus, but the latter genus is not closely related to the true anoles.\\nAnoles are small to fairly large lizards, typically green or brownish, but their color varies depending on species and many can also change it. In most species at least the male has a dewlap, an often brightly colored flap of skin that extends from the throat/neck and is used in displays. Anoles share several characteristics with geckos, including details of the foot structure and the ability to voluntarily break off the tail, but they are only very distantly related, anoles being part of Iguania.\\nAnoles are active during the day and feed mostly on small animals such as insects, but some will also take fruits, flowers, and nectar. They are fiercely territorial. After mating, the female lays an egg; in many species she may do so every few days or weeks."},{"page_url":"https://es.wikipedia.org/wiki/La_La_Anthony","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/La_La_Anthony_2012_%28cropped%29.jpg","page_title":"La La Anthony","context_page_description":"Alani Nicole 'La La' Anthony es una personalidad televisiva, escritora de superventas para el New York Times, empresaria, productora y actriz estadounidense. A inicio de los 2000, consiguió fama al ser VJ en Total Request Live de MTV. Fue presentadora del reality sobre el VH1: Flavor of Love, I Love New York, For the love of Ray J, y Real Chance of Love, y decana en la Escuela de Encanto con Ricki Lago.\\nEmpezó a actuar con participaciones en la gran pantalla que incluyen Dos Puede Jugar Aquel Juego, You Got Served, Think Like a Man, Think Like a Man 2, November Rule y Destined. Después de hacer varios papeles invitados en shows televisivos, protagonizó como Lakeisha Grant en Power de Starz. También ha aparecido en la serie televisiva La La's Full Court Wedding y La La's Full Court Life. Se casó con el jugador de NBA Carmelo Anthony en 2010."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%A9%D0%B5%D1%86%D0%B8%D0%BD_%D1%82%D1%80%D0%B0%D0%BC%D0%B2%D0%B0%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Moderus_Beta_in_Szczecin%2C_2016.jpg","page_title":"Щецин трамвае","context_page_description":"Щецин трамвае — Щецинның трамвай системасы. Польшадә иң борынгылардан берсе санала, 1879 елның 20 августендә ачылган. Хәзерге вакытта 12 маршрут эшли."},{"page_url":"https://fr.wikipedia.org/wiki/Llupia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Mairie_de_Llupia_%2866%29.jpg","page_title":"Llupia","context_page_description":"Llupia est une commune française située dans le département des Pyrénées-Orientales, en région Occitanie.\\nSes habitants sont appelés les Llupianencs."},{"page_url":"https://nl.wikipedia.org/wiki/Guanaco","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Lama_guanicoe_range_map.png","page_title":"Guanaco","context_page_description":"De guanaco is een wilde lama uit de familie der kameelachtigen. Het is een karakteristieke bewoner van de Zuid-Amerikaanse hoogvlakten. De guanaco is de grootste van de twee wilde lamasoorten, maar hij is ook nauw verwant aan de vicuña en de alpaca."},{"page_url":"https://pt.wikipedia.org/wiki/Giovanni_Bellini","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Giovanni_Bellini_San_Giobbe_Altarpiece_-_detail.jpg","page_title":"Giovanni Bellini","context_page_description":"Giovanni Bellini, também chamado em sua terra natal de Giambellino, foi um pintor do Renascimento. O mais famoso de uma família de pintores de mesmo sobrenome, era cunhado e amigo de Mantegna, e teve Tiziano entre seus aprendizes. É considerado como renovador da pintura da escola veneziana, movendo-a para um estilo mais sensual e policromático. Pelo uso de cores claras de lenta secagem, Bellini criou sombras detalhadas, profundidade e ricos coloridos. Suas fluentes e coloridas paisagens tiveram um grande efeito no seu tempo."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BD%D0%B0_%D0%9C%D0%B5%D1%81%D1%98%D0%B5%D0%BE%D0%B2%D0%B8_%D0%BE%D0%B1%D1%98%D0%B5%D0%BA%D1%82%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/LagoonHunterWilson.jpg","page_title":"Список на Месјеови објекти","context_page_description":"Месјеови објекти — збир од астрономски објекти попишан од францускиот астроном Шарл Месје во неговиот „Каталог на маглини и ѕвездени јата“, издаден за првпат во 1771, а последното дополнето издание е објавено во 1966 г.\\nБидејќи Месје бил заинтерсиран да пронаоѓа само комети, составил список на некометни објекти кои го збунувале при ловот на комети. Овој список, составен заедно со неговиот помошник Пјер Мешен е наречен „Месјеов каталог“. Ова е еден од најпознатите списоци н аастрономски објекти, и многу од овие небесни тела и денес се наведуваат по нивниот Месјеов број.\\nВо првото издание биле попишани 45 објекти, а во конечното издание на самиот Месје се наведени 103 објекти. Користејќи ги прибелешките во неговиот текст, извесни други астрономи додале уште објекти и така станале 110."},{"page_url":"https://nl.wikipedia.org/wiki/Point_Reyes_Lifeboat_Station","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Point_Reyes_Lifeboat_Rescue_Station_Inverness_CA_5-31-2010_2-22-51_PM.JPG","page_title":"Point Reyes Lifeboat Station","context_page_description":"Het Point Reyes Lifeboat Station, ook bekend als het Point Reyes Lifeboat Rescue Station en nu ook het Historic Lifeboat Station genoemd, is een historisch bouwwerk in de Point Reyes National Seashore in de Amerikaanse staat Californië."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B2%A9%E6%A7%BB%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Saitama_Shinpukuji_Midden_1.jpg","page_title":"岩槻區","context_page_description":"岩槻區是埼玉市的10個行政區之一，也是10區中最新成立的一區。2005年4月1日，舊岩槻市編入埼玉市，舊岩槻市市域即為現在的岩槻區。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D0%BC%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D1%86%D0%B8%D1%80%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/GomelCircus.jpg","page_title":"Гомельский государственный цирк","context_page_description":"Гомельский государственный цирк — стационарный цирк, расположенный в Гомеле, один из двух в Республике Беларусь. В 2018 году цирк дал 122 представления, которые собрали 148,4 тыс. человек."},{"page_url":"https://en.wikipedia.org/wiki/Bradley_(house)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Bradley_Manor_from_Wolborough_Hill1.JPG","page_title":"Bradley (house)","context_page_description":"Bradley is a medieval manor house in Newton Abbot, Devon, England. It is set amongst woodland and meadows in the valley of the River Lemon about a half mile to the west of the main town. The house is now in the ownership of the National Trust."},{"page_url":"https://pl.wikipedia.org/wiki/Mieczys%C5%82aw_Dukiet","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/1_G%C5%82owackiego_Street_in_Sanok_summer.jpg","page_title":"Mieczysław Dukiet","context_page_description":"Mieczysław Franciszek Dukiet – polski doktor nauk medycznych, lekarz ginekolog, położnik, balneolog i lekarz uzdrowiskowy. Uczestnik czterech wojen w latach 1917-1920, 1939 oraz ruchu oporu 1939-1945, kapitan służby zdrowia rezerwy Wojska Polskiego II RP, major Ludowego Wojska Polskiego. Działacz społeczny i sportowy hokeja na lodzie w klubie KTH Krynica."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B4%D0%BC%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D0%BE-%D1%82%D0%B5%D1%80%D1%80%D0%B8%D1%82%D0%BE%D1%80%D0%B8%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B5_%D0%B4%D0%B5%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5_%D0%A2%D0%B2%D0%B5%D1%80%D1%81%D0%BA%D0%BE%D0%B9_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Flag_of_Lesnoy_rayon_%28Tver_oblast%29.png","page_title":"Административно-территориальное деление Тверской области","context_page_description":"Согласно Закону «Об административно-территориальном устройстве Тверской области», с учётом новейших административно-территориальных изменений, субъект РФ включает следующие административно-территориальные единицы и территориальные единицы::\\n4 округа — города областного значения,\\n9 округов — городов окружного значения,\\n2 округа — закрытых административно-территориальных образования — Озёрный и Солнечный,\\n5 округов — Лесное, Оленино, Пено, Сандово, Селижарово,\\n22 района\\n238 поселений\\n10 городов районного значения,\\nпосёлки городского типа,\\nсельские населённые пункты.\\n5 мая 2020 года были упразднены с преобразованием в округа Западнодвинский, Пеновский, Сандовский, Краснохолмский, Селижаровский районы, города Красный Холм и Западная Двина наделены категорией городов окружного значения; количество поселений сокращено до 238.\\nУстав Тверской области выделяет:\\nгорода: Андреаполь, Бежецк, Белый, Бологое, Вышний Волочек, Весьегонск, Западная Двина, Зубцов, Кашин, Калязин, Кимры, Конаково, Красный Холм, Кувшиново, Лихославль, Нелидово, Осташков, Ржев, Старица, Тверь, Торжок, Торопец, Удомля;"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B9%B3%E5%AE%89%E8%81%96%E6%AF%8D%E4%B8%BB%E6%95%99%E5%BA%A7%E5%A0%82_(%E8%B2%9D%E6%B4%9B%E5%A5%A7%E9%87%8C%E8%97%8F%E7%89%B9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Catedral_da_Boa_Viagem%2C_Belo_Horizonte_040.JPG","page_title":"平安聖母主教座堂 (貝洛奧里藏特)","context_page_description":"平安圣母主教座堂 又名贝洛奥里藏特主教座堂是天主教贝洛奥里藏特总教区的主教座堂，位于巴西贝洛奥里藏特。\\n该堂建于1913年，新哥特风格。1921年2月11日，该堂在尚未完成时，升格为天主教贝洛奥里藏特教区的主教座堂。1924年又升为总主教座堂。\\n该堂供奉葡萄牙船的主保平安圣母。平安圣母像在祭台右侧，高2.5米，正祭台用卡拉拉大理石建造。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Meimbressen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Alte_Schule_Meimbressen.jpg","page_title":"Liste der Kulturdenkmäler in Meimbressen","context_page_description":"Die folgende Liste enthält die in der Denkmaltopographie ausgewiesenen Kulturdenkmäler auf dem Gebiet des Ortsteils Meimbressen der Stadt Calden, Landkreis Kassel, Hessen.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich an der Anschrift, alternativ ist sie auch nach der Bezeichnung oder der Bauzeit sortierbar.\\nGrundlage ist die Veröffentlichung der hessischen Denkmalliste, die auf Basis des Denkmalschutzgesetzes vom 5. September 1986 erstmals erstellt und seither laufend ergänzt wurde."},{"page_url":"https://hr.wikipedia.org/wiki/Crkva_Svete_Marije_Milostive_u_Milanu","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Santa_Maria_delle_Grazie_Milano.jpg","page_title":"Crkva Svete Marije Milostive u Milanu","context_page_description":"Crkva Svete Marije Milostive je slavna crkva dominikanskog samostana u Milanu, koja je upisana na UNESCO-v popis mjesta svjetske baštine u Europi. Crkva je slavna zbog murala Posljednje večere Leonarda da Vincija, koja se nalazi na zidu samostanskog refektorija."},{"page_url":"https://bs.wikipedia.org/wiki/Zapadna_Virginia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Boreman_view.jpg","page_title":"Zapadna Virginia","context_page_description":"Zapadna Virginia jeste američka savezna država koja se nalazi u regiji Apalačkog gorja južnog dijela SAD Graniči sa Virginijom na jugoistoku, Kentuckyjem na jugozapadu, Ohiom na sjeverozapadu, Pennsylvanijom na sjeveru i Marylandom na sjeveroistoku. Zapadna Virginia je 41. savezna država po površini u SAD te 38. po broju stanovnika među 50 saveznih država. Glavni i najveći grad je Charleston.\\nZapadna Virginia je postala savezna država nakon održavanja dvije konvencije u gradiću Wheelingu 1861. gdje su delegati iz nekih unionističkih okruga sa sjeverozapada Virginije odlučili se otcijepiti od Virginije tokom građanskog rata u SAD, pa su time obuhvatili mnoge secesionističke okruge u novu državu. Zapadna Virginia je pristupila Uniji 20. juna 1863. i bila je ključna granična država u građanskom ratu. Ona je jedina država koja je nastala odvajanjem od neke konfederacijske države, te prva koja se odvojila od bilo koje države nakon što se Maine odvojio od Massachusettsa, te jedna od dvije države koja je nastala tokom građanskog rata.\\nBiro za popis stanovništva i Udruženje američkih geografa svrstavaju Zapadnu Virginiju kao dio Juga."},{"page_url":"https://es.wikipedia.org/wiki/Programa_de_Apoyo_a_la_Defensa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/DSP_Phase3.jpg","page_title":"Programa de Apoyo a la Defensa","context_page_description":"El Defense Support Program es una programa de la Fuerza Espacial de los Estados Unidos que opera con satélites espías los cuales conforman el núcleo principal del Sistema de Satélites de Alerta Temprana usado actualmente por los Estados Unidos. El desarrollo del DPS se ha suspendido en el satélite número 23 de los 25 previstos y será sustituido por el programa Space-Based Infrared System"},{"page_url":"https://de.wikipedia.org/wiki/J%C3%BCrgen_Hambrecht","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/J%C3%BCrgen_Hambrecht%2C_March_2011.jpeg","page_title":"Jürgen Hambrecht","context_page_description":"Jürgen Hambrecht war von 2003 bis 2011 Vorstandsvorsitzender der BASF SE und von 2014 bis 2020 deren Aufsichtsratsvorsitzender."},{"page_url":"https://da.wikipedia.org/wiki/Hvirring_Kirke","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Hvirring21.JPG","page_title":"Hvirring Kirke","context_page_description":"Hvirring kirke ligger i Hvirring Sogn, i det tidligere Nim Herred Skanderborg Amt, nuværende Hedensted Kommune, Region Midtjylland.\\nApsis, kor og skib er opført i romansk tid af granitkvadre, apsis og skib over skråkantsokkel, koret over sokkel med rundstavsprofil. Begge døre er i behold, norddøren i tilmuret tilstand. Syddøren har glat tympanon, norddørens tympanon har akantusornamenter om et træ. Flere romanske vinduer er bevaret, i apsis ses et rundbuevindue mod øst og et cirkulært vindue mod sydøst. Det sengotiske tårn har muligvis afløst et ældre og smallere tårn.\\nApsis blev i sengotisk tid adskilt fra koret. Den brede, runde korbue har skråkantsokkel og ornamenterede kragsten. Den nordre kragsten har akantusranke, der i midten afbrydes af et felt, hvori ses en form, der både kan være en dyreform og en vegetativ form. Den søndre kragsten har akantusranke, båndfletning og ringkæde, der knytter sig til fontene i Tvilum og Vejerslev Kirke. Kor og skib har krydshvælv, som ifølge overlevering er iværksat i 1591 af Claus Glambek til Rask Hovedgård med materialer fra den nedbrudte Boring Kirke."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%AB%98%E9%82%A3","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Iriomote_spa_kanban.jpg","page_title":"高那","context_page_description":"高那は日本の南西諸島、沖縄県八重山郡竹富町の字。郵便番号 907-1431。"},{"page_url":"https://sl.wikipedia.org/wiki/Prisekani_oktaeder","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Dual_cube_t12_B2.png","page_title":"Prisekani oktaeder","context_page_description":"Prisekani oktaeder je v geometriji konveksni polieder. Je arhimedsko telo, eno od trinajstih konveksnih izogonalnih neprizmatičnih teles skonstruirano z dvema ali več vrstami pravilnih mnogokotniških stranskih ploskev.\\nIma štirinajst pravilnih stranskih ploskev, od tega šest kvadratnih in osem šestkotniških, ter 36 robov in 24 oglišč. Vsaka izmed stranskih ploskev ima točkovno simetrijo in je tako prisekani oktaeder ali zonoeder.\\nČe ima prvotni prisekani oktaeder enotski rob, ima njegov dualni tetrakisni heksaeder rob z dolžino in."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BD%B1%E5%83%8F%E7%9B%B4%E6%96%B9%E5%9C%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/SunHistacp.jpg","page_title":"影像直方圖","context_page_description":"影像直方圖是一種用來表現數位影像中像素分布的直方圖，根據統計影像中不同亮度的像素總數，我們可以畫出一張代表這張影像的影像直方圖，透過這張直方圖我們可以一眼就看出這張圖中像素的分布情形。\\n在現代的數位相機上通常都會顯示出目前影像的影像直方圖，攝影師可以透過他來觀察這張影像是否有發生過曝或者過暗的現象。但這個方法不適用於RAW格式，因為在RAW格式下像素的動態範圍太大，其直方圖分布會非常分散。\\n影像直方圖的水平軸代表的是其亮度，而其垂直軸代表的是該亮度所累積的像素數量，左邊的區域代表的是較暗的部分，右邊的區域則代表較亮的部分。所以一張過暗的影像所產生的影像直方圖，大部分會集中在中間及左邊區域；相反的，一張過曝的影像所產生的影像直方圖，大部分會集中在中間及右邊區域。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Berlin-Charlottenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Windscheidstra%C3%9Fe_22_%28Berlin-Charlottenburg%29_Durchfahrt.JPG","page_title":"Liste der Kulturdenkmale in Berlin-Charlottenburg","context_page_description":"In der Liste der Kulturdenkmale von Charlottenburg sind die Kulturdenkmale des Berliner Ortsteils Charlottenburg im Bezirk Charlottenburg-Wilmersdorf aufgeführt."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%B1%D8%BA%D9%88%D8%A7%D9%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Amazona_imperialis_-Roseau_-Dominica_-aviary-6a-3c.jpg","page_title":"ارغوانی","context_page_description":"ارغوانی به رنگی در میان دو رنگ بنفش و زرشکی گفته می‌شود.\\nاین رنگ ثانویه با مخلوط کردن رنگ‌های اصلی سرخ و آبی در نسبت‌های برابر به وجود می‌آید. در واقع ارغوانی، رنگ سرخابی تیره است.\\nارغوانی رابطه نزدیکی با بنفش دارد. در اپتیک، بنفش و ارغوانی رنگ‌هایی شبیه به هم هستند. ارغوانی مخلوطی از نور قرمز و نور آبی یا بنفش هستند، در حالی که بنفش رنگ‌های طیفی هستند. در کاربردهای رایج، هر دو به رنگ‌هایی که بین رنگ قرمز و آبی به رنگ روشن وجود دارد می‌گویند، اما ارغوانی نزدیکتر به قرمز و بنفش نزدیک به آبی است. به‌طور مشابه، در چرخ رنگ‌های نقاشان سنتی، بنفش و ارغوانی هر دو بین قرمز و آبی قرار دارند، و ارغوانی نزدیک به قرمز است.\\nدر ابتدا ارغوانی با خانواده سلطنتی در ارتباط بوده‌است، زیرا رنگ بنفش تیریان در دوران باستان بسیار گران بود. بنفش رنگی بود که توسط دادرسان رومی پوشیده می‌شد. این رنگ به رنگ امپراتوری تبدیل شد که توسط حاکمان امپراتوری بیزانس و امپراتوری مقدس روم و بعدها توسط اسقف‌های کاتولیک روم پوشیده شد. به‌طور مشابه در ژاپن، این رنگ به‌طور سنتی با امپراطوری و اشرافیت همراه است.\\nارغوانی رنگ عارف‌ها و روانگران رنگ اسرارآمیز و با شکوهی است. دوستداران این رنگ پیوسته مجذوب زیبایی‌ها و ظرافت‌ها می‌شوند. مغرور و اجتماعی‌اند. معاشرت با آن‌ها لذت‌بخش است و بیشتر مورد پسند عرفاً نیز است."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%82%D1%83_(%D0%BD%D0%B0%D1%80%D0%BE%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/National_route_8A_Vietnam.jpg","page_title":"Кату (народ)","context_page_description":"Кату, кту — катуйский народ, один из тхыонгов. Место обитания — горы центрального Вьетнама, провинции Тхыатхьен-Хюэ и Куангнам, и приграничные с Вьетнамом земли лаосских провинций Саваннакхет и Секонг. Говорят на идиомах катуйского диалектного континуума, а также лаосском и вьетнамском языках.\\nПрародина кату находится в горах Юньнани, они осели в густых лесах в горах Чыонгшон и стали заниматься переложным земледелием, выращивая на своих полях рис и маниок, а также добывая мёд и другие продукты питания в лесу. После Вьетнамской войны многие кату спустились ближе к дорогам и начали возделывать заливные рисовые поля, однако большинство продолжает сочетать различные виды сельскохозяйственной обработки земель. Традиционная система землевладения предполагает, что землёй завладевает первый поджёгший на ней растительность мужчина. Перед началом полевых работ проводят различные ритуалы.\\nПоселение кату традиционно состояло из 1—2 стоящих на сваях длинных домов, которые к тому же покидали раз в 5—10 лет; позже его средний размер увеличился до 4—8, а крупные деревни имеют до 30 домов."},{"page_url":"https://fr.wikipedia.org/wiki/Joseph_Lanzedelly_l%27Ancien","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Joseph_Lanzedelly_der_%C3%84ltere_Selbstportr%C3%A4t.jpg","page_title":"Joseph Lanzedelly l'Ancien","context_page_description":"Joseph Lanzedelly der ältere parfois orthographié « Josef Lanzedelli » est un graveur, un lithographe et un portraitiste autrichien."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B1%D8%B4%D8%AA%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/%D0%A0%D1%8B%D1%88%D1%82%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%B5%D1%80%D0%B0%D0%BC%D1%96%D0%BA%D0%B0._%D0%9A%D0%B0%D1%81%D0%B0_%D0%B7%D0%B2%D0%BE%D0%BD%D0%BA%D1%83_2.jpg","page_title":"رشتان","context_page_description":"رشتان، شهری در استان فرغانه، کشور ازبکستان است. یکی از دانشمندان معروف اسلامی، به نام برهانالدین مرغینانی، مولف کتاب الهدایه، در این شهر متولد شده‌است و در شهر مرغینان، که در همسایگی رشتان و در ولایت فرغانه واقع است، بزرگ شده‌است. این شهر به نام‌های راشدان، رشیدان و رِشدان نیز نامیده شده است."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Wetterzeube","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Haynsburg.jpg","page_title":"Liste der Kulturdenkmale in Wetterzeube","context_page_description":"In der Liste der Kulturdenkmale in Wetterzeube sind alle Kulturdenkmale der Gemeinde Wetterzeube und ihrer Ortsteile aufgelistet. Grundlage ist das Denkmalverzeichnis des Landes Sachsen-Anhalt, das auf Basis des Denkmalschutzgesetzes vom 21. Oktober 1991 durch das Landesamt für Denkmalpflege und Archäologie Sachsen-Anhalt erstellt und seither laufend ergänzt wurde."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1964","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Molly_Shannon_by_David_Shankbone.jpg","page_title":"Lijst van personen geboren in 1964","context_page_description":"Dit is een lijst van personen die geboren zijn in 1964.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Holden_Commodore_(VE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/2006-2007_Holden_Calais_%28VE_MY07%29_sedan%2C_cutaway_%282007-03-12%29.jpg","page_title":"Holden Commodore (VE)","context_page_description":"The Holden Commodore (VE) is an executive car that was produced by the Australian manufacturer Holden from 2006 to 2013. It was the first iteration of the fourth generation of this Australian-made model. Its range included the luxury variants, Holden Berlina (VE) and Holden Calais (VE); utility models were included as the Holden Ute (VE).\\nAs opposed to the VZ and all models previous which used Opel-sourced platforms adapted both mechanically and in size for the local market, the whole-new VE programme is the first Commodore to be developed exclusively by Holden in Australia. Despite its status as an all-new model, engines—comprising the 3.6-litre V6 and more powerful 6.0-litre V8—have been largely carried over from the VZ series. Innovative features to help minimise export redevelopment costs, such as a symmetrical centre console housing a flush-fitting hand brake lever, facilitate the conversion to left-hand drive. Internationally, the VE was badge engineered as the Chevrolet Lumina, Chevrolet Omega and Pontiac G8.\\nHolden implemented a staged roll-out of the VE variants, releasing the sedan first in July 2006."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%AF%DB%81%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Pitampura_TV_Tower%2C_Delhi%2C_India.jpg","page_title":"دہلی","context_page_description":"دہلی اور رسمی طور پر دہلی قومی دار الحکومتی علاقہ جسے مقامی طور پر دِلّی کہا جاتا ہے، بھارت کی دار الحکومتی عملداری ہے۔\\nیہ تین اطراف سے ہریانہ سے گھرا ہوا ہے جبکہ اس کے مشرق میں اتر پردیش واقع ہے۔ یہ بھارت کا مہنگا ترین شہر ہے۔ اس کا رقبہ 1،484 مربع کلومیٹر ہے۔\\n25 ملین آبادی پر مشتمل یہ شہر ممبئی کے بعد بھارت کا دوسرا اور دنیا کا تیسرا سب سے بڑا شہری علاقہ ہے۔\\nدہلی ممبئی کے بعد بھارت میں دوسرا امیر ترین شہر ہے، جس کے کل املاک 450 بلین امریکی ڈالر ہے اور یہ 18 ارب پتی اور 23000 کروڑ پتیوں کا مسکن بھی ہے۔\\nدریائے جمنا کے کنارے یہ شہر چھٹی صدی قبل مسیح سے آباد ہے۔\\nتاریخ میں یہ کئی سلطنتوں اور مملکتوں کا دار الحکومت رہا ہے جو کئی مرتبہ فتح ہوا، تباہ کیا گیا اور پھر بسایا گیا۔\\nسلطنت دہلی کے عروج کے ساتھ ہی یہ شہر ایک ثقافتی، تمدنی و تجارتی مرکز کے طور پر ابھرا۔ شہر میں عہد قدیم اور قرون وسطیٰ کی بے شمار یادگاریں اور آثار قدیمہ موجود ہیں۔\\nسلطنت دہلی کے زمانے کا قطب مینار اور مسجد قوت اسلام ہندوستان میں اسلامی طرز تعمیر کی شان و شوکت کے نمایاں مظاہر ہیں۔\\nعہد مغلیہ میں جلال الدین اکبر نے دار الحکومت آگرہ سے دہلی منتقل کیا، بعد ازاں 1639ء میں شاہجہاں نے دہلی میں ایک نیا شہر قائم کیا جو 1649ء سے 1857ء تک مغلیہ سلطنت کا دار الحکومت رہا۔"},{"page_url":"https://sv.wikipedia.org/wiki/Paraden_(biograf)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/Vallhallav%C3%A4gen_145.JPG","page_title":"Paraden (biograf)","context_page_description":"Paraden var en biograf vid Valhallavägen 147 på gränsen mellan Östermalm och Gärdet i centrala Stockholm. Paraden öppnade i oktober 1932 och stängde i maj 1982. Den öppnades åter under en kort tid i oktober 1984."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_pemimpin_negara_yang_paling_lama_hidup","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Drees%2C_W._-_SFA002019221.jpg","page_title":"Daftar pemimpin negara yang paling lama hidup","context_page_description":"Artikel ini mendaftarkan 100 kepala negara dan kepala pemerintahan negara berdaulat dulu dan sekarang yang diketahui tertua, yang lahir tidak kuerang dari 1800, dan usianya terdokumentasikan dalam sumber yang sah. Orang-orang yang sekarang masih hidup ditebalkan dan dimiringkan dalam warna emas."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D1%80%D0%BE%D0%BC%D0%BE%D0%BD%D0%B5%D1%82%D0%BD%D1%8B%D0%B9_%D0%BF%D0%B5%D1%80%D0%B5%D1%83%D0%BB%D0%BE%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Moscow%2C_Staromonetny_Lane_North.jpg","page_title":"Старомонетный переулок","context_page_description":"Старомонетный переулок в районе Якиманка Центрального административного округа города Москвы проходит от Кадашёвской набережной, параллельно улице Большая Полянка, и выходит на Большую Полянку у дома № 33. К Старомонетному переулку примыкают с нечётной стороны Пыжевский переулок и Большой Толмачёвский переулок."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Bressuire","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/UM_d%27ATER_arrivant_en_gare_de_Bressuire_par_Cramos.JPG","page_title":"Gare de Bressuire","context_page_description":"La gare de Bressuire est une gare ferroviaire française de la ligne des Sables-d'Olonne à Tours, située sur le territoire de la commune de Bressuire, dans le département des Deux-Sèvres, en région Nouvelle-Aquitaine.\\nElle est mise en service en 1868 par la Compagnie du chemin de fer de Paris à Orléans.\\nC'est une gare de la Société nationale des chemins de fer français, desservie par des trains TER Nouvelle-Aquitaine et TER Pays de la Loire et notamment le « train des plages » circulant entre Saumur et Les Sables-d'Olonne depuis 2013."},{"page_url":"https://pl.wikipedia.org/wiki/Korona_%C5%9Bwi%C4%99tego_Stefana","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/A_Szent_Korona_el%C3%B6lr%C5%91l_2.jpg","page_title":"Korona świętego Stefana","context_page_description":"Korona świętego Stefana – insygnium koronacyjne królów Węgier od XI wieku do 1918 roku. Relikwia narodowa i symbol państwowości Węgier. Przechowywana w gmachu parlamentu w Budapeszcie.\\nOd 1867 r. do 1918 r. i w okresie 1919 - 1945 Korona św. Stefana znajdowała się w herbie Węgier, do herbu powróciła w godle przyjętym w 1990 roku przez węgierski parlament. Odwołuje się do niej Konstytucja Węgier z 2011 roku wskazując, że jest ona ucieleśnieniem konstytucyjnej ciągłości państwa i jedność narodu.\\nZ Koroną Świętego Stefana związane jest pojęcie publicznoprawne Krajów Korony Świętego Stefana jako określenie wszystkich terytoriów podległych władzy królów węgierskich, w latach 1867-1918 oznaczające także węgierską część Austro-Węgier."},{"page_url":"https://cs.wikipedia.org/wiki/William_B._Post","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Post_1897b.jpg","page_title":"William B. Post","context_page_description":"William Boyd Post byl americký průkopník výtvarné fotografie. Je považován za jednoho z raných piktorialistů."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%8C%D0%B2%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BF%D1%96%D0%B4%D0%B7%D0%B5%D0%BC%D0%BD%D0%B8%D0%B9_%D1%82%D1%80%D0%B0%D0%BC%D0%B2%D0%B0%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/%D0%A2%D1%80%D0%B0%D0%BC%D0%B2%D0%B0%D0%B9%D0%BD%D0%B0_%D0%BB%D1%96%D0%BD%D1%96%D1%8F_%D0%BD%D0%B0_%D0%9A%D0%BD%D1%8F%D0%B3%D0%B8%D0%BD%D1%96_%D0%9E%D0%BB%D1%8C%D0%B3%D0%B8_%282%29.JPG","page_title":"Львівський підземний трамвай","context_page_description":"Льві́вський підзе́мний трамва́й — радянський інфраструктурний проєкт з будівництва у Львові ліній швидкісного частково підземного трамваю. Роботи розпочалися в 1980-х роках, однак невдовзі були заморожені через фінансову кризу в Радянському Союзі. В 1990-х роках проєкт еволюціонував у ідею будівництва у місті метрополітену."},{"page_url":"https://ca.wikipedia.org/wiki/Albugnano","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Albugnano_Chiesa_di_San_Pietro_abside.jpg","page_title":"Albugnano","context_page_description":"Albugnano és un municipi situat al territori de la província d'Asti, a la regió del Piemont.\\nLimita amb els municipis d'Aramengo, Berzano di San Pietro, Castelnuovo Don Bosco, Moncucco Torinese, Passerano Marmorito i Pino d'Asti.\\nPertanyen al municipi les frazioni de Belsito, Campolungo, Vallana i Vezzolano."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_comtes_et_ducs_de_Savoie","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Amadeus_Savojsk%C3%BD_1307.jpg","page_title":"Liste des comtes et ducs de Savoie","context_page_description":"Les titres de comte, puis de duc de Savoie sont des titres de noblesse rattachés au territoire de la Savoie propre, inféodé au royaume de Bourgogne, puis d'un territoire plus vaste, au sein du Saint-Empire. Le titre de comte de Savoie est associé à la dynastie des Humbertiens, comtes en Maurienne, à l'origine de la Maison de Savoie. Il n'est utilisé qu'à partir du XIIᵉ siècle. Le titre de duc est créé au début du XVᵉ siècle, regroupant tous les territoires des États de Savoie, avant de devenir un terme principalement administratif désignant la Savoie actuelle, à la suite de l’acquisition du titre de roi de Sardaigne par les ducs de Savoie."},{"page_url":"https://fr.wikipedia.org/wiki/Acacia_longifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Acacia-longifolia-tree.jpg","page_title":"Acacia longifolia","context_page_description":"Acacia longifolia est une espèce d'acacia de la famille des Mimosaceae, ou des Fabaceae selon la classification phylogénétique.\\nIl est originaire du sud-est de l'Australie, de l'extrême sud-est du Queensland, de l'est de la Nouvelle-Galles du Sud, de l'est et du sud du Victoria et du sud-est de l'Australie-Méridionale.Il est considéré comme espèce envahissante au Portugal et en Afrique du Sud. C'est un arbre à croissance rapide qui peut atteindre 7 à 10 m de haut en cinq à six ans."},{"page_url":"https://en.wikipedia.org/wiki/2015_Ukrainian_local_elections","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Deput2015_1_Eng._version.PNG","page_title":"2015 Ukrainian local elections","context_page_description":"On 25 October 2015 local elections took place in Ukraine. The elections were conducted a little over a year since the 2014 snap local elections, which were only held throughout parts of the country. A second round of voting for the election of mayors in cities with more than 90,000 residents where no candidate gained more than 50% of the votes were held on 15 November 2015.\\nBecause of the ongoing conflict in East Ukraine and the February 2014 annexation of Crimea by Russia, local elections were not conducted throughout all of the administrative subdivisions of Ukraine.\\nThe highest number of seats were won by the Petro Poroshenko Bloc \\"Solidarity\\", Fatherland and Our Land parties, followed by the Opposition Bloc and the Radical Party. The Petro Poroshenko Bloc did well in the western regions, central Ukraine, and the Kherson Oblast of the south. The Opposition Bloc gained most of the votes of the south and east. In the west, Svoboda improved its performance compared with previous year's parliamentary election.\\nA total of 132 political parties took part in the elections."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9A%E3%83%86%E3%82%B7%E3%83%A5%E3%83%90%E3%83%88%E3%82%A5%E3%83%B3%E6%B9%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Rio_Petexbatun.JPG","page_title":"ペテシュバトゥン湖","context_page_description":"ペテシュバトゥン湖は、グアテマラ共和国ペテン県南部の基礎自治体サヤスチェにある小ぶりな湖である。湖は、同名の川を通って、パシオン川に注ぎ込んでいる。\\n考古学者たちは、ペテシュバトゥン湖周辺に位置する古典期マヤ文明の都市グループを、Petexbatún Stateと名づけた。ペテシュバトゥン湖周辺のドス・ピラス、アグアテカ、タマリンディート、アロヨ・デ・ピエドラ、プンタ・デ・チミノに加えて、ドス・ピラスの勢力圏内であったパシオン川流域のセイバル、イツァン、カンクェン、ナシミエントを含んでいる。\\n古典期マヤ文明の崩壊は中部低地の南から北へと伝播していったが、この地域はその最初期に放棄された。その後の時代の石碑の様式によると、プトゥン・マヤか、トルテカに関係する集団によって占拠されたと考えられている。ペテシュバトゥンの崩壊を引き起こした侵入者は、古典期マヤの勢力ではないという見解で、専門家たちは一致している。この地域における考古学的な発見は、古典期マヤ文明の崩壊について多くの情報をもたらした。"},{"page_url":"https://hu.wikipedia.org/wiki/M%C3%A1ria_magyar_kir%C3%A1lyn%C5%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Mary_%28Chronica_Hungarorum%29.jpg","page_title":"Mária magyar királynő","context_page_description":"Mária, Anjou-házi magyar és lengyel királyi hercegnő, Magyarország és Horvátország királynője 1382 és 1385 között, valamint 1386-tól haláláig, 1387-től férje, Luxemburgi Zsigmond társuralkodójaként. Kortársai latinul királynak nevezték, mert még fogalomként is teljesen idegen volt számukra a királynőség, mint egyeduralkodási forma. Ahhoz, hogy nő létére elfoglalhassa a trónt, apjának, I. Lajosnak fiúsíttatni kellett leányát, így jogilag férfinak számított, ezért is használták rá jogosan a rex megjelölést a regina helyett, amely utóbbi kifejezés elsősorban a király hitvesét jelölte.\\nNagy Lajos király és Kotromanić Erzsébet királyné harmadik leánya, szülei második Mária nevű gyermeke: legidősebb nővére egyévesen, 1366-ban meghalt, így az 1371-ben született leány is a Mária nevet kapta. Fiatalabb nővére, Katalin 1378-ban halt meg. Míg Mária Magyarországot, addig húga Hedvig Lajos király döntése alapján Lengyelország trónját örökölte meg. Máriát 1382. szeptember 17-én koronázták meg Székesfehérvárott. 1385. december 31-én lemondott II."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D8%B1%D9%88%D8%AF%DA%AF%D8%A7%D9%87_%D9%88%D8%B3_%D8%A8%D9%85%D9%88%D8%A6%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Enbm_from_air_summer2006.jpg","page_title":"فرودگاه وس بموئن","context_page_description":"فرودگاه وس بموئن یک فرودگاه همگانی است که یک باند فرود آسفالت دارد و طول باند آن ۱۰۰۰ متر است. این فرودگاه در کشور نروژ قرار دارد و در ارتفاع ۹۱ متری از سطح دریا واقع شده است."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%B5%D0%BC%D0%BF%D0%B8%D0%BE%D0%BD%D0%B0%D1%82_%D0%BC%D0%B8%D1%80%D0%B0_%D0%BF%D0%BE_%D1%85%D0%BE%D0%BA%D0%BA%D0%B5%D1%8E_%D1%81_%D1%88%D0%B0%D0%B9%D0%B1%D0%BE%D0%B9_1954","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/1954_World_Ice_Hockey_Championships_Canada_vs_Soviet.jpg","page_title":"Чемпионат мира по хоккею с шайбой 1954","context_page_description":"21-й чемпионат мира и одновременно 32-й чемпионат Европы по хоккею с шайбой проходил в Швеции, в городе Стокгольм с 26 февраля по 7 марта 1954 года. Турнир проходил в один круг. На нём впервые сыграла сборная СССР и сенсационно стала чемпионом мира. Впервые были определены лучшие игроки турнира — вратарь, защитник и нападающий."},{"page_url":"https://fr.wikipedia.org/wiki/Assembl%C3%A9e_parlementaire_franco-allemande","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Ruppertstefan.jpg","page_title":"Assemblée parlementaire franco-allemande","context_page_description":"L'Assemblée parlementaire franco-allemande est une institution binationale entre la France et l'Allemagne. L’Assemblée est chargée de veiller à la mise en œuvre des dispositions du traité d'Aix-la-Chapelle, d'élaborer des propositions notamment sur les enjeux transfrontaliers, et de promouvoir la mise en œuvre conjointe des directives de l’Union européenne.\\nElle est l'aboutissement des travaux du groupe de travail franco-allemand qui s'est réuni tout au long de l'année 2018. Au terme de ces travaux, l'accord parlementaire franco-allemand, présenté le 14 novembre 2018, constitue le fondement de cette coopération institutionnalisée au niveau des parlements nationaux. Ratifié le 11 mars 2019 par l'Assemblée nationale française et le 20 mars par le Bundestag allemand, il a été signé le 25 mars 2019 par les présidents des deux chambres."},{"page_url":"https://en.wikipedia.org/wiki/Kilgore,_Texas","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Citizens_Bank_in_Kilgore%2C_TX_IMG_5926.JPG","page_title":"Kilgore, Texas","context_page_description":"Kilgore is a city in Gregg and Rusk counties in the eastern part of the U.S. state of Texas. Over three-fourths of the city limits is located in Gregg County, the remainder in Rusk County. Kilgore was the childhood residence from age six of the noted classical pianist Van Cliburn, the namesake for Van Cliburn Auditorium on the Kilgore College campus. The population was 12,975 at the 2010 census; a July 2019 estimate placed it at 14,852."},{"page_url":"https://eu.wikipedia.org/wiki/Iralabarri","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Bilbao_-_Avenida_Kiriki%C3%B1o_%28barrio_de_Iralabarri%2C_distrito_de_Errekalde%29_3.jpg","page_title":"Iralabarri","context_page_description":"Iralabarri Bilboko auzoa da. Bilboko Errekaldeko barrutian kokaturik, zazpigarren barrutian alegia. Auzoak 11.696 biztanle eta 0,39 kilometro koadroko azalera zeukan. Hegoaldean Errekaldeberrirekin egiten du muga, iparraldean Abandorekin, ipar-ekialdean Zabala auzoarekin, mendebaldean A-8 autobidearekin, eta ekialdean Zabalbururekin.\\nIrala landa gunea izan zen, baserriak eta ortuak zeuden bertan. Horietako bat Urizar dorretxea da. Bestalde, XX. mendearen hasieran, industrializazioaren hastapenetan, enpresek euren langileentzako etxeak eraiki ohi zituzten. Bilbon ogia ekoizten zuen lantegi nagusienetakoa zen Harino Panaderak ere halaxe egin nahi izan zuen, eta horretarako Iralabarri auzoan egin zizkien bere langileei etxeak. Auzo berri horrek hiru pisuko etxebizitza blokeak eta ortuak zituzten patio zabalak zeuzkan.\\nOndorengo hamarkadetan ordea, hirira zetorren etorkin oldeak eraginda inolako ordenarik gabe eraiki zen auzoan, arrapaladan eraiki beharrak kale estu eta argitasunik gabeak ekarri zituen. Hala ere, azken urteetan hainbat hobekuntza egin dira bertan eta parke bat eraiki da A-8 autobidetik gertu, Eskurtze parkea."},{"page_url":"https://de.wikipedia.org/wiki/Butterschmalz","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Sliced_clarified_butter.png","page_title":"Butterschmalz","context_page_description":"Butterschmalz ist aus Butter durch Entfernen von Wasser, Milcheiweiß und Milchzucker gewonnenes s.g. Butterreinfett, d. h. Milchfett. Es hat ähnliche Eigenschaften wie Schmalz, wird jedoch nicht aus Schlachtfett, sondern aus ausgelassener Butter von Kuhmilch erzeugt. Butterschmalz wird zum Backen, Braten und Kochen verwendet. Es eignet sich insbesondere zum Frittieren und Braten, ist jedoch auch für andere Zubereitungsverfahren als Zutat Fett geeignet. Beim Backen kann es als Butterersatz eingesetzt werden."},{"page_url":"https://it.wikipedia.org/wiki/Andris_%C5%A0%C4%B7%C4%93le","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Andris_%C5%A0%C4%B7%C4%93le%2C_10._Saeimas_portrets.jpg","page_title":"Andris Šķēle","context_page_description":"Andris Šķēle è un politico lettone, per due volte Primo ministro, dal 21 dicembre 1995 al 6 agosto 1997, e dal 6 luglio 1999 al 5 maggio 2000.\\nDurante il suo primo mandato, non fu associato a nessun partito politico; durante il secondo, invece, fu membro del Partito Popolare, che fondò nel 1998. Attualmente non svolge più la professione di politico, ma rimane, che lui stesso ha affermato, \\"membro ordinario\\" del Partito Popolare. Continua ad avere una considerevole influenza dietro le quinte del partito.\\nAndris Šķēle è una delle persone più ricche della Lettonia. Il quotidiano The Baltic Times lo elenca come la 15ª persona più ricca dei Paesi Baltici, con una ricchezza netta di circa 60 milioni di euro."},{"page_url":"https://de.wikipedia.org/wiki/12._Januar","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Prise_de_la_Bastille.jpg","page_title":"12. Januar","context_page_description":"Der 12. Januar ist der 12. Tag des gregorianischen Kalenders, somit verbleiben noch 353 Tage bis zum Jahresende."},{"page_url":"https://fr.wikipedia.org/wiki/Jardins_suspendus_de_Babylone","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Hanging_Gardens_of_Babylon.jpg","page_title":"Jardins suspendus de Babylone","context_page_description":"Les jardins suspendus de Babylone sont un édifice antique, considéré comme une des Sept Merveilles du monde antique. Ils apparaissent dans les écrits de plusieurs auteurs grecs et romains antiques, qui s'inspirent tous de sources plus anciennes disparues, dont le prêtre babylonien Bérose. C'est à ce dernier que l'on doit l'histoire de la construction de ces jardins par Nabuchodonosor II afin de rappeler à son épouse, Amytis de Médie, les montagnes boisées de son pays natal.\\nLors de la redécouverte et des fouilles de Babylone début du XXᵉ siècle, l'emplacement des jardins suspendus a été cherché. Mais alors que les autres constructions mythiques de la ville ont été retrouvées par l'archéologie et la traduction des inscriptions anciennes, cela n'a pas été le cas des jardins. Les chercheurs contemporains ont donc émis diverses propositions : certains ont cherché à localiser les emplacements possibles des jardins suspendus dans la ville, tandis que d'autres ont remis en cause leur existence, les situant dans une autre ville ou les reléguant au rang d'invention développée par des auteurs antiques à partir des jardins royaux babyloniens."},{"page_url":"https://de.wikipedia.org/wiki/Plauensche_Grundbahn","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Tramcar_309_of_Strassenbahn_Dresden.jpg","page_title":"Plauensche Grundbahn","context_page_description":"Die Plauensche Grundbahn war eine durch den sächsischen Staat erbaute Straßenbahnstrecke in Dresden und Freital. Sie verlief durch den Plauenschen Grund zwischen dem Dresdner Stadtteil Plauen und dem Freitaler Stadtteil Hainsberg. Die Strecke wurde 1902 zwischen Plauen und Deuben freigegeben und sukzessive nach Coßmannsdorf verlängert. Zuletzt wurde sie vom VEB Verkehrsbetriebe der Stadt Dresden als Teil des Dresdner Straßenbahnnetzes betrieben. 1974 wurde die Strecke stillgelegt und durch eine Omnibuslinie ersetzt."},{"page_url":"https://fi.wikipedia.org/wiki/Aleksanteri_Jannaios","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/WillemSwiddeAlexanderJannaeus.jpg","page_title":"Aleksanteri Jannaios","context_page_description":"Aleksanteri Jannaios oli Juudean kuningas vuodet 103–76 eaa. Hän oli makkabealaisten suvun kuudes hallitsija. Aleksanteri Jannaios seurasi kuninkaana veljeänsä Aristobulosta ja oli naimisissa tämän lesken Aleksandran kanssa. Aleksandrasta tuli myös kuningatar Aleksanterin kuoltua.\\nAleksanteri Jannaios oli taitava sotapäällikkö ja julma hallitsija. Hänen aikanaan Juudean alueet levisivät Välimeren rannikkoa pitkin Gazasta Carmeliin ja Gadaran Jordan-virran toiselle puolelle. Aleksanterin aikana Juudean valtakunta oli suurimmillaan sitten Salomon.\\nAleksanteria vastustettiin sotamenestyksestään huolimatta Jerusalemissa. Vuonna 94 eaa. sukkotin, eli lehtimajajuhlan, aikana hänen päälleen heitettiin sitruunoita. Aleksanterin sotilaat teurastivat tuhansia juhlijoita, minkä seurauksena alkoi fariseuksien johtama sisällissota. Fariseukset kutsuivat avukseen myös seleukidihallitsija Demetrios III Eukairoksen. Ensin seleukidit onnistuivat voittamaan Aleksanterin joukot, mutta tämä sai avukseen monia juutalaisia, jotka pelkäsivät Jerusalemin menetystä Demetriokselle. Sisällissodan aikana Aleksanteri ristiinnaulitsi 800 fariseusta."},{"page_url":"https://en.wikipedia.org/wiki/Imperial_Brazilian_Navy","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Brazilian_ironclad_Brasil.jpg","page_title":"Imperial Brazilian Navy","context_page_description":"The Imperial Brazilian Navy was the navy created at the time of the independence of the Empire of Brazil from the United Kingdom of Portugal, Brazil and the Algarves. It existed between 1822 and 1889 during the vigency of the constitutional monarchy. The Navy was formed almost entirely by ships, staff, organizations and doctrines proceeding from the transference of the Portuguese Royal Family in 1808. Some of its members were native-born Brazilians, who under Portugal had been forbidden to serve. Other members were Portuguese who adhered to the cause of separation and German and Irish mercenaries. Some establishments created by King João VI were used and incorporated. Under the reign of Emperor Pedro II the Navy was greatly expanded to become the fifth most powerful navy in the world and the armed force more popular and loyal to the Brazilian monarchy. The republican coup d'état in 1889, led by army men, put an end to the Imperial Navy that fell into decay until the new century."},{"page_url":"https://en.wikipedia.org/wiki/2001_World_Rally_Championship","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Cm2_ford.jpg","page_title":"2001 World Rally Championship","context_page_description":"The 2001 World Rally Championship was the 29th season of the FIA World Rally Championship. In a tightly contested year, Subaru's Richard Burns took his first and only drivers' world title, beating Ford's Colin McRae, Mitsubishi's Tommi Mäkinen and the defending champion Marcus Grönholm of Peugeot. Peugeot successfully defended their manufacturers' title."},{"page_url":"https://en.wikipedia.org/wiki/Supranational_union","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Regional_Organizations_Map.png","page_title":"Supranational union","context_page_description":"A supranational union is a type of multinational political union where negotiated power is delegated to an authority by governments of member states.\\nThe term is sometimes used to describe the European Union as a new type of political entity. It is the only entity that provides for international popular elections, going beyond the level of political integration normally afforded by international treaties.\\nThe term \\"supranational\\" is sometimes used in a loose, undefined sense in other contexts such as a substitute for international, transnational or global.\\nAnother method of decision-making in international organisations is intergovernmentalism in which state governments play a more prominent role."},{"page_url":"https://tr.wikipedia.org/wiki/Stent","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Stent4_fcm.jpg","page_title":"Stent","context_page_description":"Stent, tıpta, kan damarlarındaki ve çeşitli kanallardaki akışı optimize etmek için gerekli bölgelere yerleştirilen yapay bir araçtır. Stent uygulaması, damar tıkanıklığı, böbrek taşı, anevrizma ve birçok hastalığın tedavisinde başvurulan konforlu bir yöntemdir. Stentler, yapılarına göre ve kullanım yerlerine göre sınıflandırılabilir. Yapılarına göre, geleneksel stentler, ilaçlı stentler ve eriyen stentler; kullanım yerlerine göre, koroner stent, vasküler stent, safra stentleri, idrar yolu stentleri... şeklinde sınıflandırılabilir.\\nStentler, akış hızını düzenlemenin yanı sıra, akışı yönlendirerek anevrizma tedavisinde de kullanılmaktardır."},{"page_url":"https://da.wikipedia.org/wiki/GAZ-66","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/GAZ-66.jpg","page_title":"GAZ-66","context_page_description":"GAZ-66 er et russisk firehjulstrukken militært transportkøretøj, produceret af fabrikken GAZ. GAZ-66 var det vigtigeste transportkøretøj til motoriseret infanteri i Den Røde Hær og bruges fortsat i flere tidligere sovjetstater. GAZ-66 har fået kælenavnet shishiga efter et russisk mytologisk hunvæsen.\\nGAZ-66 er kendt for dens ekstreme pålidelighed, dens enkel design og gode terrængegenskaber. Dette sammen med standardudstyr som frontmonteret spil, centralt dæktryksystem og selvlåsende differentialer har gjort den særdeles populær mange steder i verden, til både militær og civil brug."},{"page_url":"https://en.wikipedia.org/wiki/Autechaux-Roide","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Autechaux-Roide_%C3%A9glise_02.JPG","page_title":"Autechaux-Roide","context_page_description":"Autechaux-Roide is a commune in the Doubs department in the Bourgogne-Franche-Comté region in eastern France."},{"page_url":"https://et.wikipedia.org/wiki/%C5%A0koda_Yeti","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/12-02-02-autostadt-wolfsburg-025.jpg","page_title":"Škoda Yeti","context_page_description":"Škoda Yeti on Škoda maastur. Yeti head küljed on dünaamika, hind, kütusekulu ja ruumikus. Näiteks 2,0 TDI maksab vaid 25 270 € ja kulutab vaid 6,5 l kütust/100 km. Ainus miinus on jäik vedrustus.\\nPärast mudeliuuendust 2014.aastal on Yetil kaks versiooni: City ja Outdoor. City on linna- ja Outdoor maastikuversioon."},{"page_url":"https://de.wikipedia.org/wiki/Castillon-de-Castets","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Castillon-de-Castets_Ch%C3%A2teau_Carpia_01.jpg","page_title":"Castillon-de-Castets","context_page_description":"Castillon-de-Castets ist eine Ortschaft und eine Commune déléguée in der französischen Gemeinde Castets et Castillon mit 296 Einwohnern im Département Gironde in der Region Nouvelle-Aquitaine. Die Einwohner werden Castillonais genannt.\\nMit Wirkung vom 1. Januar 2017 wurde Castillon-de-Castets mit der Nachbargemeinde Castets-en-Dorthe zur Commune nouvelle Castets et Castillon fusioniert. Die Gemeinde gehörte zum Arrondissement Langon und zum gleichnamigen Kanton Langon."},{"page_url":"https://cs.wikipedia.org/wiki/Davidka","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/MY-Davidka-1.jpg","page_title":"Davidka","context_page_description":"Davidka byl podomácku vyráběný izraelský minomet použitý ve městech Safed a Jeruzalém během počátečních fází izraelské války za nezávislost v roce 1948. Jeho střely byly mimořádně hlučné a jejich silné exploze měly velký význam v zastrašovací taktice vůči arabským silám. Mimo zastrašovací efekt neměly minomety velkou hodnotu, neboť jejich střely byly velice nepřesné. Formálně je označován jako třípalcový minomet, přestože jeho střely byly podstatně větší."},{"page_url":"https://it.wikipedia.org/wiki/Ballao","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Maria_Maddalena_Ballao.jpg","page_title":"Ballao","context_page_description":"Ballao, in sardo ballàu è un comune italiano di 765 abitanti della provincia del Sud Sardegna."},{"page_url":"https://de.wikipedia.org/wiki/Miglos","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Miglos_%28Ari%C3%A8ge%29.jpg","page_title":"Miglos","context_page_description":"Miglos ist eine französische Gemeinde mit 117 Einwohnern im Département Ariège in der Region Okzitanien. Sie gehört zum Arrondissement Foix und zum Kanton Sabarthès."},{"page_url":"https://it.wikipedia.org/wiki/Villa_Prata","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/080-Monza-Villa-Sala-via-Lecco.JPG","page_title":"Villa Prata","context_page_description":"Villa Prata-Bossi-Sala-Pennati si trova a Monza in via Lecco 29."},{"page_url":"https://fi.wikipedia.org/wiki/Sz%C3%A9chenyin_kylpyl%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Szecskacivertanlegi3.JPG","page_title":"Széchenyin kylpylä","context_page_description":"Széchenyin kylpylä on Budapestin suurin terveys- ja lämminvesikylpylä. Se sijaitsee Pestissä Kaupunginpuistossa. Kylpylässä on sekä sisä- että ulkoaltaita, ja sen uusbarokkinen rakennus on vuodelta 1913. Kylpylä on tunnettu shakinpelaajista ja ulkoaltaistaan, jotka ovat avoinna myös talvisin. Suurimmassa ulkoaltaassa vesi on 27- ja lämminvesialtaassa 38-asteista. Kylpylässä käy arviolta kaksi miljoonaa ihmistä vuodessa.\\nSzéchenyin kylpylä saa vetensä kuumista lähteistä, jotka löydettiin vuonna 1879. Paikalle perustettiin ensimmäinen, väliaikainen kylpylä vuonna 1881, ja sitä kutsuttiin aluksi arteesiseksi kylpyläksi. Vuonna 1913 kylpylälle avattiin pysyvät tilat, joissa se toimii nykyäänkin. Kylpylää laajennettiin vuosina 1927 ja 1966, ja vuonna 1999 uima-altaat uusittiin kokonaan. Vanhemman osan ovat suunnitelleet Győző Czigler ja Ede Dvorzsák ja uudemman osan Imre Francsek."},{"page_url":"https://en.wikipedia.org/wiki/Chukka_boot","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Chukka_boot%2C_black_leather.jpg","page_title":"Chukka boot","context_page_description":"Chukka boots are ankle-high leather boots with suede or leather uppers, leather or rubber soles, and open lacing with two or three pairs of eyelets. The name chukka possibly comes from the game of polo, where a chukka is a period of play.\\nGenerally, \\"chukka boot\\" refers to a form of desert boots originally worn by British soldiers in the Western Desert Campaign of World War II."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A9%E3%83%BC%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Unicup6090RWTH.JPG","page_title":"ラート","context_page_description":"ラートは、ドイツ発祥のスポーツで、2本の鉄の輪を平行につないだ器具を用いて、様々な体操を行う競技である。"},{"page_url":"https://fr.wikipedia.org/wiki/Isabella_de_Danemark","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Monogramme_de_la_Princesse_Isabella_de_Danemark.png","page_title":"Isabella de Danemark","context_page_description":"La princesse Isabella de Danemark, comtesse de Monpezat, est un membre de la famille royale danoise, née le 21 avril 2007 à Copenhague.\\nElle est la fille du prince héritier Frederik et son épouse, la princesse héritière Mary. Elle est également la petite-fille de la reine Margrethe II et son époux le prince consort Henrik. Elle est la première petite fille à naître dans la famille royale depuis la princesse Anne-Marie en 1946.\\nLa princesse Isabelle est actuellement troisième dans l'ordre de succession au trône de Danemark juste après son frère le prince Christian."},{"page_url":"https://nl.wikipedia.org/wiki/Spaans_Gouvernement","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/2010.07.20.124707_Spaans_Governement_Maastricht.jpg","page_title":"Spaans Gouvernement","context_page_description":"Het Spaans Gouvernement is een historisch gebouw aan het Vrijthof in Maastricht. Het is waarschijnlijk het oudst bewaard gebleven woonhuis van Maastricht. Na een aantal grondige restauraties heeft het gebouw thans een museale bestemming, Museum aan het Vrijthof."},{"page_url":"https://en.wikipedia.org/wiki/Fur_farming","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Fur_industry_in_Finland.jpg","page_title":"Fur farming","context_page_description":"Fur farming is the practice of breeding or raising certain types of animals for their fur.\\nFur used from animals caught in the wild is not considered farmed fur, and is instead known as \\"wild fur\\".\\nMost of the world’s farmed fur is produced by European farmers. There are 5,000 fur farms in the EU, all located across 22 countries; these areas of production collectively account for 50% of the global production of farmed fur.\\nThe EU accounts for 63% of global mink production and 70% of fox production. Denmark is the leading mink-producing country, accounting for approximately 28% of world production. Other major producers include China, the Netherlands, Russia, and the U.S. Finland is the largest United States supplier of fox pelts.\\nThe United States is a major exporter of fur skins. Major export markets include China, Russia, Canada, and the EU. Exports to Asia as a share of total exports grew from 22% in 1998 to 47% in 2002.\\nChina is the largest importer of fur pelts in the world and the largest exporter of finished fur products.\\nFur farming is banned in Austria, Croatia, the United Kingdom, the Czech Republic and Norway."},{"page_url":"https://nn.wikipedia.org/wiki/Fylkesveg_213","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/FV213_Br%C3%B8ttum.JPG","page_title":"Fylkesveg 213","context_page_description":"Fylkesveg 213 går mellom Nes i Ringsaker og Lillehammer. Veglengda er 56,9 km, av dette 47,8 km i Hedmark og 9,1 km i Oppland.\\nFør 1. januar 2010 var vegen riksveg, etter at forvaltingsreformen trod i kraft har han status som fylkesveg."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A7%88%EB%A6%AC%EC%95%84_%EB%A9%94%EB%82%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Maria_Mena_Utrecht.jpg","page_title":"마리아 메나","context_page_description":"마리아 메나는 노르웨이의 가수이다."},{"page_url":"https://en.wikipedia.org/wiki/History_of_the_Canadian_Army","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Flag_of_the_Canadian_Army_%281939%E2%80%931944%29.svg","page_title":"History of the Canadian Army","context_page_description":"The history of the Canadian Army, began when the title first came into official use in November 1940, during the Second World War, and is still used today. Although the official titles, Force Mobile Command, and later Land Force Command, were used from February 1968 to August 2011, \\"Canadian Army\\" continued to be unofficially used to refer to the ground forces of the Canadian Armed Forces, much as it has been from Confederation in 1867 to the present. The term was often even used in official military publications, for example in recruiting literature and the official newspaper of the Canadian Forces, The Maple Leaf. On August 16, 2011, the title, \\"Canadian Army\\", was officially restored, once again bringing the official designation in line with common and historical usage."},{"page_url":"https://ro.wikipedia.org/wiki/Azepan","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Azepan.png","page_title":"Azepan","context_page_description":"Azepanul este un compus heterociclic heptaciclic cu azot cu formula chimică C₆H₁₃N. Este omologul superior al piperidinei. Este un lichid incolor la temperatura camerei. Este utilizat ca precursor pentru obținerea mai multor medicamente și pesticide și este obținut prin hidrogenoliza parțială a hexametilen-diaminei. Ca multe alte amine, reacționează cu dioxidul de carbon."},{"page_url":"https://it.wikipedia.org/wiki/Storia_della_medicina_in_Italia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Monumento_a_Maurizio_Bufalini_%28Cesena%29.jpg","page_title":"Storia della medicina in Italia","context_page_description":"La storia della medicina in Italia può essere fatta risalire ai tempi della colonizzazione greca in Italia. In questo periodo, infatti, nascono nella Magna Grecia diverse scuole mediche.\\nSuccessivamente gli Etruschi perfezionano numerose tecniche mediche importate dalle altre civiltà mediterranee. Ma è con lo sviluppo della civiltà romana che la medicina viene sempre più perfezionata, arricchita con nuove tecnologie e diffusa nelle varie parti dell'Impero. Durante il Medioevo la Scuola Medica Salernitana è considerata la più prestigiosa scuola medica europea. A partire dal XIII secolo, con l'istituzione delle Università, la conoscenza medica si diffonde e si perfeziona in molte altre zone d'Italia e d'Europa. A partire dal XVII secolo, poi, grazie alle grandi scoperte e teorie formulate da personaggi come Galileo Galilei, il pensiero scientifico, e di conseguenza anche l'approccio medico, cambia radicalmente e con esso cambiano anche le terapie. Il XVII ed il XVIII secolo sono periodi in cui le tecniche mediche continuano a progredire fino al XIX secolo, periodo importante per le numerose scoperte in ambito medico."},{"page_url":"https://it.wikipedia.org/wiki/Teatro_inglese","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Hamlet.jpg","page_title":"Teatro inglese","context_page_description":"Con la locuzione teatro inglese si intendono tutte le forme di spettacolo drammatico provenienti da uno specifico Stato del continente europeo, l'Inghilterra. In senso allargato vi si includono alcune forme drammatiche britanniche della metà dello scorso millennio, in virtù del fatto che la storia del teatro degli stati britannici ha avuto il suo fulcro proprio a Londra."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A3%D1%81%D0%BF%D0%B5%D0%BD%D0%B8%D0%B5_%D0%91%D0%BE%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D1%87%D0%BD%D0%BE_(%D0%9F%D0%B8%D1%81%D1%82%D0%B8%D0%BA%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Assumption_of_Mary_Church_in_Pistiko_Fresco.png","page_title":"Успение Богородично (Пистико)","context_page_description":"„Успение Богородично“ е възрожденска православна църква в гревенското село Пистико, Егейска Македония, Гърция. Част е от Гревенската епархия.\\nХрамът е издигнат в 1849 година по времето на митрополит Агапий Гревенски, както се разбира от надписа ѝ. Представлява еднокорабна базилика с женска църква и трем от северната страна. Има дървен иконостас и стенописи от XIX век в светилището и на южната стена. При Гревенското земетресение от 1995 година храмът претърпява доста щети като пукнатини, като особено силно пострадват стенописите.\\nВ 1987 година църквата, като забележителен пример за църковната архитектура и живопис от XIX век, е обявена за защитен исторически паметник."},{"page_url":"https://pl.wikipedia.org/wiki/Heuringhem","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Heuringhem_%28Pas-de-Calais%2C_Fr%29_mairie.JPG","page_title":"Heuringhem","context_page_description":"Heuringhem – miejscowość i gmina we Francji, w regionie Hauts-de-France, w departamencie Pas-de-Calais.\\nWedług danych na rok 1990 gminę zamieszkiwały 1212 osoby, a gęstość zaludnienia wynosiła 209 osób/km²."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D1%83%D0%B1%D0%BB%D1%8C_%D0%A1%D0%A1%D0%A1%D0%A0","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a3/SUR_50_1947_B.jpg","page_title":"Рубль СССР","context_page_description":"Рубль — валюта СССР с 1923 года по 26 декабря 1991 года, а после этой даты — валюта некоторых государств, возникших после распада Советского Союза. До 1947 года имел параллельное хождение с червонцем.\\nДизайн большинства советских банкнот разработал гравёр и художник Иван Иванович Дубасов.\\nВ СССР, начиная с ноября 1923 и до февраля 1924, все бумажные денежные знаки назывались Государственными денежными знаками Союза Советских Социалистических Республик. С 1924 года по 1991 год банкноты достоинством до 10 рублей именовались Государственными казначейскими билетами СССР, от 10 рублей и выше — Билетами Государственного банка СССР. С 1991 года банкноты всех номиналов стали именоваться Билетами Государственного банка СССР.\\nСоветский рубль после денежной реформы 1 января 1961 года был формально равен 0,987412 г золота. Золото в СССР можно было приобрести в виде ювелирных изделий, которых в 1985 году было реализовано на сумму в 2,926 миллиарда рублей, выпускались памятные монеты из золота. Государственный банк СССР устанавливал официальный курс рубля по отношению к другим валютам, так, на 25 декабря 1991 года 1 доллар США равнялся 0,5571 рубля, 1 фунт стерлингов — 1,0389 рубля."},{"page_url":"https://nl.wikipedia.org/wiki/25e_Screen_Actors_Guild_Awards","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Sandra_Oh_2016.jpg","page_title":"25e Screen Actors Guild Awards","context_page_description":"De 25e Screen Actors Guild Awards, waarbij prijzen werden uitgereikt voor uitstekende acteerprestaties in film en televisie voor het jaar 2018, gekozen door de leden van SAG-AFTRA, vonden plaats op 27 januari 2019 in het Shrine Auditorium in Los Angeles. De prijs voor de volledige carrière werd uitgereikt aan Alan Alda."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_Ho%C3%A0ng_%C4%91%E1%BA%BF_La_M%C3%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Campidoglio%2C_Roma_-_Costantino_II_cesare_dettaglio.jpg","page_title":"Danh sách Hoàng đế La Mã","context_page_description":"Danh hiệu ‘\\"Hoàng đế La Mã\\"’ được các nhà sử học về sau dùng để gọi người đứng đầu nhà nước La Mã trong thời kỳ đế quốc. Đế quốc La Mã phát triển từ nền Cộng hòa La Mã, sau khi nó từng bước thống trị toàn bộ bờ biển Địa Trung Hải, có điểm đặc trưng là quyền lực tập trung vào một cá nhân, thay vì \\"Viện nguyên lão và toàn thể công dân La Mã\\".\\nAugustus, người được công nhận rộng rãi là hoàng đế La Mã đầu tiên, lên cầm quyền sau một cuộc chiến đẫm máu và trong một thời kỳ mà nhiều người dân La Mã còn giữ ý niệm mạnh mẽ về nền Cộng hòa, đã cẩn thận duy trì lớp vỏ Cộng hòa cho nền cai trị của mình. Ông không đặt ra một danh hiệu mới, mà tập trung quyền lực vào một chức vụ tồn tại từ trước mà nay ông thâu tóm, ‘’ Princeps Senatus’’. Thể chế chính quyền này, tồn tại gần 300 năm, được gọi là ‘‘Chế độ Nguyên thủ’’.\\nVề mặt từ nguyên, từ '’ Hoàng đế’’ trong các ngôn ngữ châu Âu xuất phát từ tiếng Latin ‘’Imperator’’, một danh hiệu dành cho người đứng đầu quân đội. Trong thời kỳ đầu của đế chế, Nguyên thủ không đương nhiên có được danh hiệu này mà phải được phong sau một thành tích quân sự."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Bene%C5%A1ov%C4%9B_nad_Plou%C4%8Dnic%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Bene%C5%A1ov_nad_Plou%C4%8Dnic%C3%AD_-_d%C5%AFm_%C4%8Dp._129_v_Husov%C4%9B_ulici_%281%29.jpg","page_title":"Seznam kulturních památek v Benešově nad Ploučnicí","context_page_description":"Tento seznam nemovitých kulturních památek ve městě Benešov nad Ploučnicí v okrese Děčín vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://ca.wikipedia.org/wiki/Alte_Oper","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Alteoper_ffm.jpg","page_title":"Alte Oper","context_page_description":"L'Alte Oper és una sala de concerts i antic teatre d'òpera de Frankfurt del Main, Alemanya."},{"page_url":"https://de.wikipedia.org/wiki/Australische_Zyklonsaison_2011%E2%80%932012","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/Koji_Mar_8_2012_0400Z.jpg","page_title":"Australische Zyklonsaison 2011–2012","context_page_description":"Die Australische Zyklonsaison 2011–2012 begann offiziell am 1. November 2011 und endete am 30. April 2012. Der operative Plan der World Meteorological Organization sieht für die Gewässer auf der Südhalbkugel zusätzlich ein „tropisches Zyklonjahr“ vor. Dieses begann bereits am 1. Juli 2011 und wird am 30. Juni 2012 enden."},{"page_url":"https://sq.wikipedia.org/wiki/Harald_Hardrada","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Harald_Hardrada_window_in_Kirkwall_Cathedral_geograph_2068881.jpg","page_title":"Harald Hardrada","context_page_description":"Harald Sigurdsson, mban bindshëm epitetin Hardrada në baladë, del si Mbret i Norvegjisë nga viti 1046 deri 1066. Përveç kësaj, ai pa sukses pretendonte Fronin e Danimarkës deri në vitin 1064 dhe Fronin anglez deri në vitin 1066. Para se të bëhej mbret, Harald kishte shpenzuar rreth pesëmbëdhjetë vjet në mërgim si një mercenar dhe komandant ushtarak në Kievan Rus dhe si Gardian Varangian në Perandorinë Bizantine."},{"page_url":"https://pt.wikipedia.org/wiki/Imunoglobulina","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Immunoglobulin_basic_unit.svg","page_title":"Imunoglobulina","context_page_description":"Os anticorpos são glicoproteínas do tipo gamaglobulina, a fracção de globulinas mais abundante no plasma sanguíneo. Podem encontrar-se em forma solúvel no sangue ou noutros fluídos corporais dos vertebrados, ou podem estar inseridos na membrana plasmática, onde actuam como receptores nos linfócitos B e são empregues pelo sistema imunitário para neutralizar patógenos tais como bactérias patogénicas e viroses. Em geral, considera-se que tanto anticorpo como imunoglobulina são termos equivalentes, sendo que o primeiro termo faz referência à função, enquanto que o segundo alude à estrutura. O termo gamaglobulina refere-se às propriedades electroforéticas das imunoglobulinas solúveis no soro sanguíneo, se bem que algumas imunoglobulinas migram com as fracções alfa, beta e inclusive com a albumina.\\nUm anticorpo é tipicamente constituído por unidades estruturais básicas, cada uma das quais com duas grandes cadeias pesadas e duas cadeias leves de menor peso molecular. A molécula de anticorpo tem forma de Y; as extremidades dos braços do Y são o fragmento Fab por onde se ligam ao antígeno; o pé do Y é o fragmento Fc."},{"page_url":"https://it.wikipedia.org/wiki/B-albero","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/B-tree-search.png","page_title":"B-albero","context_page_description":"I B-alberi sono delle strutture di dati/metodi che permettono la rapida localizzazione dei file, specie nei database, riducendo il numero di volte che un utente necessita per accedere alla memoria in cui il dato è salvato. Essi derivano dagli alberi di ricerca, in quanto ogni chiave appartenente al sottoalbero sinistro di un nodo è di valore inferiore rispetto a ogni chiave appartenente ai sottoalberi alla sua destra; inoltre, la loro struttura ne garantisce il bilanciamento: per ogni nodo, le altezze dei sottoalberi destro e sinistro differiscono al più di una unità. Questo è il vantaggio principale dei B-Tree, e permette di compiere operazioni di inserimento, cancellazione e ricerca in tempi ammortizzati logaritmicamente.\\nSono utilizzati spesso nell'ambito dei database, in quanto permettono di accedere ai nodi in maniera efficiente sia nel caso essi siano disponibili in memoria centrale, sia qualora essi siano presenti solo sulla memoria di massa."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%80%D1%83%D0%BD%D0%BE_%D0%AF%D1%81%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Bruno_Jasienski.jpg","page_title":"Бруно Ясенский","context_page_description":"Бру́но Ясе́нский, 17 июля 1901 — 17 сентября 1938 — польский и советский писатель, поэт, драматург. Писал на русском, польском и французском языках."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_National_Historic_Landmarks_de_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/HWB_in_the_Snow.jpg","page_title":"Liste des National Historic Landmarks de New York","context_page_description":"Les National Historic Landmarks de New York sont les sites historiques d'intérêt national de la ville de New York aux États-Unis."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_der_Radeberger_Vorstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Fischhausstra%C3%9Fe_10_Loschwitz_7.JPG","page_title":"Liste der Kulturdenkmale in der Radeberger Vorstadt","context_page_description":"Die Liste der Kulturdenkmale in der Radeberger Vorstadt enthält die Kulturdenkmale des Stadtteils Radeberger Vorstadt in der Dresdner Gemarkung Neustadt. Diese Gemarkung gliedert sich in die Stadtteile Innere Neustadt, Äußere Neustadt, Leipziger Vorstadt, Radeberger Vorstadt und Albertstadt. Zur Radeberger Vorstadt gehören das Preußische Viertel zwischen Forststraße, Körnerweg, Waldschlösschenstraße und Jägerstraße sowie östlich davon das Waldschlösschenviertel zwischen der Bautzner Straße und der Radeberger Straße.\\nZusätzlich wurden die Kulturdenkmale der Radeberger Vorstadt, die in der Gemarkung Loschwitz liegen, in einer separaten Liste erfasst.\\nDie Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Dresden.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%BE%D0%B4%D0%BE%D1%80%D0%BE%D0%B6%D0%BD%D0%B8%D0%BA_%D0%BC%D0%BE%D1%80%D1%81%D1%8C%D0%BA%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Plantago-maritima-foliage.JPG","page_title":"Подорожник морський","context_page_description":"Морський подорожник — рослина родини подорожникових, поширена у помірних районах майже всього світу."},{"page_url":"https://si.wikipedia.org/wiki/%E0%B7%83%E0%B7%92%E0%B6%BD%E0%B7%8A%E0%B6%BD%E0%B7%8F%E0%B7%84%E0%B7%92_%E0%B6%9A%E0%B7%92%E0%B6%BB%E0%B7%94%E0%B7%85%E0%B7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/SillaCrownGuimet.jpg","page_title":"සිල්ලාහි කිරුළු","context_page_description":"සිල්ලාහි කිරුළු නිර්මාණය වූයේ ව්‍යවහාර වර්ෂයෙන් 5වන-7වන සියවස් අවට කාලයේ කොරියානු රාජධානියක් වූ සිල්ලාවේ ය.\\nමෙම කිරුළු හමුවූයේ සිල්ලාවේ පැරණි අගනුවර වූ ග්යොංජුහි කැනීම් කටයුතුවලින් වන අතර, වර්තමානයේ ඒවා දකුණු කොරියාවේ ජාතික වස්තූන් ලෙස නම්කොට ඇත.\\nසිල්ලාවේ කිරුළු ඉතා බි‍ඳෙනසුලු ස්වභාවයකින් යුක්ත අතර, ඒවා කිලෝග්‍රෑම් එකකට වඩා වැඩි බරකින් යුක්ත ය. සිල්ලා රජවරුන් රන්වන් කිරුළු නිතර පැළඳ නැති බැව් පෙනේ. ඒවා බොහෝවිට චාරිත්‍රානුකූල සහ උත්සව කටයුතු සඳහා පමණක් භාවිතා වන්නට ඇත."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B9%8C%E5%85%8B%E5%85%B0%E9%99%86%E5%86%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/ZSU-23-4_Shilka_01.jpg","page_title":"乌克兰陆军","context_page_description":"烏克蘭陸軍，是烏克蘭武裝部隊的地面作戰軍種。源自於1991年12月從蘇聯陸軍繼承而來的三大軍區的部隊：基輔軍區、喀爾巴阡軍區、敖德薩軍區。"},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_queijos","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Coalho_cheese.jpg","page_title":"Lista de queijos","context_page_description":"Isto é uma lista de queijos ordenada por país de origem."},{"page_url":"https://de.wikipedia.org/wiki/Beijing_Motor_Corporation","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Senova_D50_China_2015-04-06.jpg","page_title":"Beijing Motor Corporation","context_page_description":"Beijing Motor Corporation ist ein Hersteller von Automobilen aus der Volksrepublik China."},{"page_url":"https://fr.wikipedia.org/wiki/Principaut%C3%A9_%C3%A9piscopale_de_Frisingue","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/HRR_1648_Freising.png","page_title":"Principauté épiscopale de Frisingue","context_page_description":"La principauté épiscopale de Frisingue désigne les territoires du prince-évêques ayant leur siège à Freising. La principauté est un État du Saint-Empire romain germanique; les évêques de Frisingue, qui relèvent du duché de Bavière, obtinrent l'immédiateté impériale comme seigneurs temporels vers l'an 1294.\\nLes frontières de la principauté et du diocèse de Freising, un suffragant de l'archidiocèse de Salzbourg, ne coïncidaient pas. Le territoire immédiat comprenait :\\nla ville de Freising avec l'ancienne résidence des ducs de Bavière ;\\nle comté d' Ismaning sur la rive est du fleuve Isar ;\\nla seigneurie de Burgrain à Isen\\nle comté de Werdenfels autour de Garmisch.\\nDe plus, Fresing possédait plusieurs seigneuries médiates en Bavière comme dans l'Autriche, la Styrie, la Carinthie, la Carniole et le Tyrol. Dans le périmètre du diocèse fondé en 739 par Boniface de Mayence, l'autorité spirituelle de l’évêque s’étendait à proprement parler sur une zone plus grande du sud de la Bavière.\\nLes évêques faisaient partie du collège des princes ecclésiastiques à la Diète d'Empire. Lors de la diète à Augsbourg en 1500, la principauté épiscopale de Freising rejoint le Cercle de Bavière."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%85%E0%B4%B1%E0%B5%8D%E0%B4%B1%E0%B5%8D%E0%B4%B2%E0%B4%BE%E0%B4%A8%E0%B5%8D%E0%B4%B1%E0%B4%BF%E0%B4%95%E0%B5%8D_%E0%B4%9A%E0%B4%BE%E0%B5%BC%E0%B4%9F%E0%B5%8D%E0%B4%9F%E0%B5%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Prince_of_Wales-5.jpg","page_title":"അറ്റ്ലാന്റിക് ചാർട്ടർ","context_page_description":"യു.എസ്. പ്രസിഡന്റ് ഫ്രാങ്ക്ളിൻ റൂസ്‌വെൽറ്റും ബ്രിട്ടിഷ് പ്രധാനമന്ത്രി വിൻസ്റ്റൺ ചർച്ചിലും കൂടി 1941 ആഗസ്റ്റ് 14-ന് രൂപംകൊടുത്ത സമ്മതപത്രമാണ് അറ്റ്ലാന്റിക് ചാർട്ടർ 1941 ആഗസ്റ്റ് 9 മുതൽ 12 വരെ ന്യൂഫൗണ്ട്‌ലാൻഡിന്റെ സമുദ്രതീരത്തുനിന്ന് 5 കി.മീ. അകലെ ആർജന്റീയ ഉൾക്കടലിൽ അഗസ്റ്റാ, പ്രിൻസ് ഒഫ് വെയിൽസ് എന്നീ യുദ്ധക്കപ്പലുകളിൽവച്ച് അവർ നടത്തിയ കൂടിയാലോചനയുടെ ഫലമായിട്ടാണ് ഈ സമ്മതപത്ര പ്രഖ്യാപനം ഉണ്ടായത്. നാസിസത്തിനും ഫാസിസത്തിനും എതിരായ ഈ ഉഭയകക്ഷി പ്രഖ്യാപനത്തിൽ എട്ടു വകുപ്പുകളാണുള്ളത്.\\nഭൂവിസ്തൃതി സംബന്ധിച്ച വികസനങ്ങൾക്ക് തങ്ങളുടെ രാജ്യങ്ങൾ മോഹിക്കുകയില്ല.\\nബന്ധപ്പെട്ട ജനങ്ങളുടെ, ആഗ്രഹത്തിന്റെ അംഗീകാരമില്ലാത്ത പ്രദേശപരമായ മാറ്റങ്ങൾ ഉണ്ടായിക്കാണാൻ തങ്ങൾ ആഗ്രഹിക്കുന്നില്ല.\\nഎല്ലാ ജനവിഭാഗങ്ങൾക്കും അവരുടേതായ ഭരണസംവിധാനം തിരഞ്ഞെടുക്കാൻ അവകാശമുണ്ടായിരിക്കണം. ബലപ്രയോഗം മൂലം അവരിൽനിന്നും അപഹരിക്കപ്പെട്ട പരമാധികാരവും സ്വതന്ത്രഭരണവും പുനഃസ്ഥാപിക്കപ്പെടണം.\\nലോകത്തിലെ വാണിജ്യവിഭവങ്ങളും അസംസ്കൃത വസ്തുക്കളും തോറ്റതും ജയിച്ചതുമായ എല്ലാ ജനങ്ങൾക്കും സമാനമായ വ്യവസ്ഥകളോടുകൂടി ലഭിക്കുന്നതിനും ഉപയോഗിക്കുന്നതിനുമുള്ള സൗകര്യങ്ങൾ വർധിപ്പിക്കാൻ ഉദ്യമിക്കേണ്ടതാണ്.\\nഎല്ലാവർക്കും മെച്ചപ്പെട്ട തൊഴിൽ നിലവാരങ്ങളും സാമ്പത്തിക ക്രമീകരണവും സാമൂഹിക സുരക്ഷിതത്വവും ഭദ്രമാക്കുവാൻ വേണ്ടി തങ്ങൾ അന്താരാഷ്ട്ര സഹകരണം വളർത്തുന്നതാണ്."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%9E%D7%95%D7%A0%D7%94_(%D7%A4%D7%A1%D7%9C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Jerusalem_Belief_by_Alexander_Lieberman.jpg","page_title":"אמונה (פסל)","context_page_description":"אמונה הוא פסל סביבתי רחב ידיים שתוכנן על ידי הפסל היהודי אמריקאי אלכסנדר ליברמן והוקם ב-1984. הפסל ניצב בקצה מדשאה רחבה בסמוך לצומת הגבעה הצרפתית ומעט לפני \\"גשר הגבעה הצרפתית\\" ומלון דן ירושלים, בין השכונות גבעת המבתר והגבעה הצרפתית בירושלים, בהצטלבות הכבישים שדרות בר-לב, שדרות לוי אשכול ודרך שכם.\\nאלכסנדר ליברמן פיסל פסלים רבים בסגנון גאומטרי וזהו מהמפורסמים שביצירותיו. הפסל בנוי ממספר אלמנטים בעלי צורות גאומטריות שונות המחוברות זה אל זה בצורה בה הפסל נראה שונה מכל זווית, בהם האמן ביקש להביע את הפסיפס האנושי המורכב והחיבור המשותף בין כל הדתות והמגזרים בעיר ירושלים מתוך האמונה המשותפת באל, ומכאן ניתן לו שמו, \\"אמונה\\". הוא העניק אותו במתנה לעיריית ירושלים וזו מתחזקת אותו בקביעות, לצד הפארק שסביבו. הפסל עשוי מבטון וממתכת.\\nהפסל מסמל את המעבר לירושלים הצפונית, ומיקומו היווה ציון סמלי לצומת המכונה \\"צומת הגבעה הצרפתית\\" או \\"צומת בר-לב\\" בו התרחשו פיגועים ומתקפות טרור במהלך השנים, בעיקר במהלך האינתיפאדה השנייה."},{"page_url":"https://sv.wikipedia.org/wiki/Curlewis","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Curlewis_%28NSW%29.jpg","page_title":"Curlewis","context_page_description":"Curlewis är en ort i Australien. Den ligger i kommunen Gunnedah och delstaten New South Wales, i den sydöstra delen av landet, omkring 320 kilometer norr om delstatshuvudstaden Sydney.\\nRunt Curlewis är det mycket glesbefolkat, med 2 invånare per kvadratkilometer. Närmaste större samhälle är Gunnedah, omkring 15 kilometer norr om Curlewis.\\nTrakten runt Curlewis består till största delen av jordbruksmark. Genomsnittlig årsnederbörd är 729 millimeter. Den regnigaste månaden är februari, med i genomsnitt 131 mm nederbörd, och den torraste är oktober, med 13 mm nederbörd."},{"page_url":"https://it.wikipedia.org/wiki/M%C3%A9lagues","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Melagues_vue_generale.JPG","page_title":"Mélagues","context_page_description":"Mélagues è un comune francese di 66 abitanti situato nel dipartimento dell'Aveyron nella regione dell'Occitania."},{"page_url":"https://es.wikipedia.org/wiki/Borexino","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/SolarSpectraWithExp.jpg","page_title":"Borexino","context_page_description":"Borexino es un experimento de física de partículas que tiene como objetivo estudiar neutrinos de bajas energías.​\\nEl detector es el calorímetro de centelleador líquido más radio-puro del mundo, encargado de detectar neutrinos a través de su dispersión elástica en los electrones de las moléculas aromáticas del centelleador, que emiten señales luminosas digitalizables para su posterior análisis. El detector está contenido en una esfera de acero inoxidable de 13.7 m de diámetro, que se encarga también de servir de soporte mecánico para más de 2200 fotomultiplicadores, y está protegido por un Tanque de Agua que le sirve de escudo frente a radiactividad natural externa y se encarga de identificar muones cósmicos que consiguen atravesar la gran masa de montaña bajo la que se encuentra.\\nEl propósito principal del experimento es medir el flujo de neutrinos solares con alta precisión, en particular los provenientes del decaimiento radioactivo de berilio-7 en el Sol."},{"page_url":"https://es.wikipedia.org/wiki/Estepona","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Playa_de_la_Rada_autumn_-_Estepona_beach.jpg","page_title":"Estepona","context_page_description":"Estepona es un municipio y localidad española de la provincia de Málaga, Andalucía. Está situado en la zona suroccidental de la provincia e integrado en la comarca de la Costa del Sol Occidental, en la mancomunidad de municipios homónima​ y en el partido judicial que lleva su nombre.​\\nSu término municipal tiene una superficie de 137,5 km² que se extienden a lo largo de 23 km de litoral y se adentran hacia el interior abarcando un fértil valle surcado por pequeños arroyos y una zona montañosa dominada por la Sierra Bermeja, que alcanza los 1449 msnm en el pico de Los Reales. La población del municipio se sitúa en 66 683 habitantes censados en 2016 y se caracteriza por su composición multicultural.\\nEstepona es un destino turístico popular, especialmente durante el verano, debido a su clima mediterráneo y sus playas. Junto con el turismo, la construcción ha sido un pilar importante para la economía municipal. Asimismo, también tiene una pequeña y escasa actividad pesquera y agrícola.\\nEl origen de Estepona es discutido."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BD%D0%B0_%D1%81%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE_%D0%BD%D0%B0%D1%81%D0%BB%D0%B5%D0%B4%D1%81%D1%82%D0%B2%D0%BE_%D0%B2%D0%BE_%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Mosteiro_de_Alcoba%C3%A7a_%28Portugal%29.jpg","page_title":"Список на светско наследство во Европа","context_page_description":"Ова е список на објекти во Европа заведени како светско наследство на УНЕСКО."},{"page_url":"https://es.wikipedia.org/wiki/Benedicto_XVI","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/BentoXVI-29-10052007.jpg","page_title":"Benedicto XVI","context_page_description":"Benedicto XVI, de nombre secular Joseph Aloisius Ratzinger, ha sido el 265.° papa de la Iglesia católica y séptimo soberano de la Ciudad del Vaticano.​\\nResultó elegido el 19 de abril de 2005 tras el fallecimiento de Juan Pablo II, por los cardenales que votaron en el cónclave.​\\nEl 28 de febrero de 2013 renunció al papado asumiendo el título de papa emérito, con la intención de dedicarse a la oración y el retiro espiritual.​ Su renuncia fue anunciada por él mismo días antes, el 11 de febrero, y es una decisión excepcional en la historia de la Iglesia, ​ ya que, si bien el sumo pontífice que renunció al papado más próximo fue Gregorio XII, el precedente de Celestino V es el único del que puede asegurarse que fue de forma libre y voluntaria.​\\nComo cardenal de la Iglesia, Ratzinger ha estado presente en tres cónclaves: Juan Pablo I, Juan Pablo II y el de su elección.\\nTras su renuncia, se celebró el cónclave del que resultó elegido el cardenal Jorge Mario Bergoglio, arzobispo de Buenos Aires, como romano pontífice, que tomó el nombre de Francisco."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%A7%D7%A8%D7%91_%D7%94%D7%A8%D7%90%D7%A9%D7%95%D7%9F_%D7%A2%D7%9C_%D7%97%D7%A6%D7%99_%D7%94%D7%90%D7%99_%D7%A7%D7%A8%D7%99%D7%9D","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f2/German_Conquest_of_the_Crimea.png","page_title":"הקרב הראשון על חצי האי קרים","context_page_description":"הקרב הראשון על קרים במלחמת העולם השנייה התחיל בספטמבר 1941 ונמשך עד נובמבר 1941. במהלך הקרב הצליחו הארמייה ה-11 של הוורמאכט בפיקודו של אריך פון מנשטיין עם הארמייה הרומנית השלישית לכבוש את רוב חצי האי קרים מידי הכוחות הסובייטיים ולהתחיל מצור על סבסטופול.\\nכוחות הציר לא הצליחו לכבוש את העיר סבסטופול שנותרה כמובלעת עד ה-4 ביולי 1942, אז נפלה בידיהם לאחר מצור ממשוך."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%BE%80%E6%BE%A4%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Shibusawa-Sta-Gate.JPG","page_title":"澀澤站","context_page_description":"涩泽站是一个位于神奈川县秦野市曲松一丁目，属于小田急电铁小田原线的铁路车站。车站编号是OH 40。"},{"page_url":"https://id.wikipedia.org/wiki/Orang_Yahudi","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Maimonides-2.jpg","page_title":"Orang Yahudi","context_page_description":"Yahudi adalah istilah yang merujuk kepada sebuah agama, etnisitas, atau suku bangsa. Sebagai agama, istilah ini merujuk kepada umat yang beragama Yahudi.\\nBerdasarkan etnisitas, kata ini merujuk kepada suku bangsa yang berasal dari keturunan Eber atau Yakub anak Ishak anak Abraham dan Sara, atau keturunan Suku Yehuda, yang berasal dari Yehuda anak Yakub. Etnis Yahudi juga termasuk Yahudi yang tidak beragama Yahudi tetapi beridentitas Yahudi dari segi tradisi.\\nAgama Yahudi adalah kombinasi antara agama dan suku bangsa. Agama Yahudi dibahas lebih lanjut dalam artikel agama Yahudi; artikel ini hanya membahas dari segi suku bangsa saja. Kepercayaan semata-mata dalam agama Yahudi tidak menjadikan seseorang menjadi Yahudi. Di samping itu, dengan tidak memegang kepada prinsip-prinsip agama Yahudi tidak menjadikan seorang Yahudi kehilangan status Yahudinya. Tetapi, definisi Yahudi undang-undang kerajaan Israel tidak termasuk Yahudi yang memeluk agama yang lain."},{"page_url":"https://zh.wikipedia.org/wiki/1993%E5%B9%B4%E5%A4%AA%E5%B9%B3%E6%B4%8B%E9%A2%B6%E9%A2%A8%E5%AD%A3","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/17-E_1993_track.png","page_title":"1993年太平洋颶風季","context_page_description":"1993年太平洋颶風季是每年一度全球熱帶氣旋產生週期的一部分。東太平洋颶風季從1993年5月至1993年11月結束；而中太平洋颶風季從1993年6月開始，至1993年11月結束。本條目的範圍僅侷限於赤道以北及國際換日線以東的太平洋，於赤道以北及國際換日線以西的太平洋水域產生的風暴則被稱為颱風，並被列入1993年太平洋颱風季。在中東太平洋產生的熱帶風暴是由美國國家颶風中心及中太平洋颶風中心命名，國際編號為xxE或xxC。"},{"page_url":"https://es.wikipedia.org/wiki/Santa_Cruz_de_Mompox","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Albarrada_del_Campillo..jpg","page_title":"Santa Cruz de Mompox","context_page_description":"Mompox o Mompós, oficialmente Distrito Especial, Turístico, Histórico y Cultural de Santa Cruz de Mompox, ​ es un distrito de Colombia, en el departamento de Bolívar. En mérito del estado de conservación de su centro histórico fue declarada Monumento Nacional en 1959 y Patrimonio de la Humanidad por las UNESCO en 1995. Mompox limita con los municipios de Pinillos y San Fernando. Su cabecera municipal está a 248 km de Cartagena de Indias. Hace parte de la Red de pueblos patrimonio de Colombia. El 27 de diciembre de 2017 fue elevado a la categoría de Distrito."},{"page_url":"https://es.wikipedia.org/wiki/Canal_de_la_Robine","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/AudeRobineMoussoulens.jpg","page_title":"Canal de la Robine","context_page_description":"El canal de la Robine es un antiguo paso del río Aude situado en Narbona, en el departamento de Aude. Se trata de una rama lateral del canal de Midi, del que depende administrativamente. Permite conectar el río Aude con el mar Mediterráneo pasando por Narbona. Otro canal, el canal de Jonction, conecta el canal de Midi al río Aude.\\nEl canal de la Robine está dentro de la clasificación de patrimonio mundial de la Unesco, igual que el canal de Midi con el que conecta."},{"page_url":"https://en.wikipedia.org/wiki/Nicola_Peltz","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Bates_Motel_Cast_2013.jpg","page_title":"Nicola Peltz","context_page_description":"Nicola Peltz is an American actress. Her breakthrough role came when she played Katara in the 2010 film The Last Airbender. From 2013 to 2015, she co-starred as Bradley Martin in the A&E drama series Bates Motel. In 2014, she starred as Tessa Yeager in Transformers: Age of Extinction."},{"page_url":"https://es.wikipedia.org/wiki/Iglesia_de_San_Pablo_(Zaragoza)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Zaragoza_-_San_Pablo_-_Puerta_mud%C3%A9jar.jpg","page_title":"Iglesia de San Pablo (Zaragoza)","context_page_description":"La iglesia de San Pablo es llamada la tercera catedral de Zaragoza. Está situada entre las calles de San Blas y San Pablo, en el barrio de San Pablo de esta ciudad y su primera fábrica en estilo gótico-mudéjar data de finales del siglo XIII d. C. y la primera mitad del siglo XIV d. C..\\nDesde su estado inicial, ha experimentado sucesivas ampliaciones en los siglos XV y XVI para atender a las necesidades demográficas del barrio de San Pablo, cuya población fue en progresivo aumento.\\nYa durante la Edad Media el barrio de San Pablo llegó a tener casi tantos habitantes como el antiguo centro amurallado. Por esta razón, en 1284 se vio necesario derruir la antigua ermita románica de San Blas y construir un nuevo templo, que estaría terminado antes de la mitad del siglo XIV d. C..\\nSe trata de una iglesia de grandes proporciones debidas a las muchas ampliaciones, que han configurado un espacio complejo y variado. Inicialmente constaba de una nave que albergaba capillas entre sus contrafuertes y poseía una cabecera de planta poligonal.\\nEn el siglo XV d."},{"page_url":"https://pt.wikipedia.org/wiki/Bamberga_(distrito)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Saengerehrenmal_Melkendorf_01.JPG","page_title":"Bamberga (distrito)","context_page_description":"Bamberga é um distrito da Alemanha, na região administrativa de Oberfranken, estado de Baviera."},{"page_url":"https://en.wikipedia.org/wiki/Hope_(sloop)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Hope_With_Oyster_Shell.jpg","page_title":"Hope (sloop)","context_page_description":"Hope is an oyster sloop that was completed in 1948. It is believed to be the last sail-powered oystering vessel built on the Long Island Sound. Hope is 56 feet long, including the bowsprit, and 42 feet 2 inches at the waterline. Its beam is 15 feet 2 inches, and it draws 4 feet 9 inches with the centerboard up. Hope is gaff rigged, 'V'-bottomed and has an 850-pound centerboard. Hope's shallow draft facilitated shoal water work."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AE%DB%8C%D8%A7%D8%A8%D8%A7%D9%86_%D9%81%D9%86%DA%86%D9%88%D8%B1%DA%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Eastern_City_of_London_08.03.2013_16-32-59_20_fenchurch_street.jpg","page_title":"خیابان فنچورچ","context_page_description":"خیابان فنچورچ یک خیابان در لندن، انگلستان است.\\nاین خیابان که در سیتی لندن قرار دارد از سمت غرب به خیابان لومباد و خیابان گریسچورچ و از سمت شرق به خیابان آلدگیت محدود میشود، ایستگاه راه‌آهن خیابان فنچورچ، ۲۰ خیابان فنچورچ و پلاتیشن پلیس در این خیابان قرار دارند."},{"page_url":"https://en.wikipedia.org/wiki/Forest_falcon","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Micrastur_mintoni_-_Cryptic_Forest_Falcon%3B_Parauapebas%2C_Par%C3%A1%2C_Brazil.jpg","page_title":"Forest falcon","context_page_description":"Forest falcons are members of the genus Micrastur, part of the family Falconidae. They are endemic to the Americas, found from Mexico in the north, south through Central America and large parts of South America, and as far south as northern Argentina. Most are restricted to humid tropical and subtropical forests, but the two most widespread species, the collared and the barred forest falcon, also range into drier and more open habitats.\\nForest falcons, like most Accipiter-type hawks, are adapted for agility in thick cover rather than outright speed in the open air. They have short wings, long tails, and extraordinarily acute hearing. While generally visually inconspicuous, their songs are commonly heard.\\nTheir diet is a mixture of birds, mammals, and reptiles. Hunting is often performed in goshawk fashion: the bird takes up a perch in an inconspicuous position and waits for a prey species to pass, then strikes with a short, rapid pursuit. Forest falcons are inventive, flexible hunters, and at least some species are also capable of catching terrestrial prey on foot.\\nIn 2002, a new species was described, found in the Atlantic forest and the southeastern Amazon of Brazil."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B8%D0%BD%D0%BE%D1%80%D0%B4%D0%B8,_%D0%94%D0%B6%D0%B0%D1%80%D1%80%D0%B5%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Jarred_Tinordi.png","page_title":"Тинорди, Джарред","context_page_description":"Джа́рред Тино́рди — американский хоккеист, защитник клуба Национальной хоккейной лиги «Нэшвилл Предаторз»."},{"page_url":"https://en.wikipedia.org/wiki/Kurobe_Gorge_Railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Kurobe_Gorge_Railway_07.jpg","page_title":"Kurobe Gorge Railway","context_page_description":"The Kurobe Gorge Railway, or Kurotetsu for short, is a private, 762 mm narrow gauge railway company operating the Kurobe Gorge Main Line along the Kurobe River in the Kurobe gorge area of Toyama Prefecture, Japan. The railway was built to serve the construction of the Kurobe dam for the Kansai Electric Power Company, which was completed in 1963; Kurotetsu was spun off from the power company in June 1971, but remains a wholly owned subsidiary. At its terminus, the Main Line links to Kurobe Senyō Railway, which is not open to general public.\\nIn 2008 the company operated 27 locomotives, 138 passenger carriages and 322 freight wagons."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%81%D1%83%D0%B4%D0%B8%D0%BD%D0%BD%D0%B8%D1%85_%D1%80%D0%BE%D1%81%D0%BB%D0%B8%D0%BD_%D0%9C%D0%BE%D0%BB%D0%B4%D0%BE%D0%B2%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Pulsatilla_grandis_1.jpg","page_title":"Список судинних рослин Молдови","context_page_description":"Список судинних рослин Молдови містить перелік з 1860 видів, зареєстрованих на території республіки Молдови. Список налічує 28 видів судинних спорових, 1 вид голонасінних і 1831 вид покритонасінних рослин. Культивовані та випадкові чужорідні види рослин до таблиці не включені. З-поміж культивованих голонасінних видів часто трапляються: Picea abies, Pinus nigra, Platycladus orientalis."},{"page_url":"https://en.wikipedia.org/wiki/Diving_suit","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Chasseur_sous-marin_et_son_%C3%A9quipement.jpg","page_title":"Diving suit","context_page_description":"A diving suit is a garment or device designed to protect a diver from the underwater environment. A diving suit may also incorporate a breathing gas supply. but in most cases applies only to the environmental protective covering worn by the diver. The breathing gas supply is usually referred to separately. There is no generic term for the combination of suit and breathing apparatus alone. It is generally referred to as diving equipment or dive gear along with any other equipment necessary for the dive.\\nDiving suits can be divided into two classes: \\"soft\\" or ambient pressure diving suits – examples are wetsuits, dry suits, semi-dry suits and dive skins – and \\"hard\\" or atmospheric pressure diving suits, armored suits that keep the diver at atmospheric pressure at any depth within the operating range of the suit."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%9C%E0%B2%97%E0%B2%A4%E0%B3%8D%E0%B2%A4%E0%B2%BF%E0%B2%A8_%E0%B2%85%E0%B2%A4%E0%B2%BF_%E0%B2%AC%E0%B3%83%E0%B2%B9%E0%B2%A4%E0%B3%8D%E0%B2%AA%E0%B3%8D%E0%B2%B0%E0%B2%AE%E0%B2%BE%E0%B2%A3%E0%B2%A6_%E0%B2%95%E0%B2%9F%E0%B3%8D%E0%B2%9F%E0%B2%A1%E0%B2%97%E0%B2%B3%E0%B3%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/The_Pentagon_US_Department_of_Defense_building.jpg","page_title":"ಜಗತ್ತಿನ ಅತಿ ಬೃಹತ್ಪ್ರಮಾಣದ ಕಟ್ಟಡಗಳು","context_page_description":"This list ranks the buildings throughout the world with the largest amount of usable space.\\nBoeing's Everett Factory is currently the world's largest, used to assemble a selection of the company's largest aircraft, originally built for construction of the 747. This building is 13.3 million m³ and covers 398,000 m² of land.\\nThe Aerium was built to house the construction of a giant airship, although the airship was never completed. This building now houses an indoor, artificial tropical resort.\\nNASA's 160 m tall Vehicle Assembly Building was originally built to enable simultaneous assembly and shelter for four Saturn V rockets."},{"page_url":"https://sw.wikipedia.org/wiki/Thomas_Mann","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Thomas_Mann_1937.jpg","page_title":"Thomas Mann","context_page_description":"Thomas Mann alikuwa mwandishi kutoka nchi ya Ujerumani. Hasa anajulikana kwa riwaya zake, k.m. \\"Akina Buddenbrook\\", \\"Kifo katika mji wa Venice\\", \\"Mlima wa Ajabu\\" au \\"Maungamo ya Felix Krull, Tapeli\\". Pia aliandika insha nyingi. Mwaka wa 1929 alikuwa mshindi wa Tuzo ya Nobel ya Fasihi."},{"page_url":"https://bs.wikipedia.org/wiki/Kalinjingrad","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Kaliningrad_map.png","page_title":"Kalinjingrad","context_page_description":"Kaliningrad jest lučki grad i glavni grad Kalinjingradske oblasti, ruske eksklave između Poljske i Litvanije, s pristupom Baltičkom moru.\\nPod njemačkim imenom, bio je glavni grad njemačke pokrajine Istočne Pruske, bivšeg poljskog posjeda Pruske kneževine i prije toga, Države Teutonskog viteškog reda."},{"page_url":"https://cs.wikipedia.org/wiki/Amaz%C3%B3nek_b%C4%9Blob%C5%99ich%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Pionites_leucogaster_-pet_in_USA-8a.jpg","page_title":"Amazónek bělobřichý","context_page_description":"Amazónek bělokřídlý je ohrožený druh papouška, spolu s amazónkem černotemenným jeden ze dvou druhů papoušků z rodu Pionites."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%8E%8B%E7%BB%8D%E9%8F%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/%E7%8E%8B%E7%B4%B9%E9%8F%8A2.jpg","page_title":"王绍鏊","context_page_description":"王绍鏊，字却尘、格成，江苏吴江同里镇人，中国政治家，中国民主促进会创始人之一。"},{"page_url":"https://es.wikipedia.org/wiki/Edguy","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Dirk_Sauer_2009.01.10.jpg","page_title":"Edguy","context_page_description":"Edguy es una banda de power metal originaria de Fulda, Alemania. Fundada en 1992 por los músicos Tobias Sammet, Jens Ludwig y Dirk Sauer e influenciada principalmente por la agrupación también alemana Helloween, ​ la banda publicó su primer álbum, Savage Poetry, de manera independiente en 1995.​\\nMás adelante firmaron un contrato con la discográfica AFM, con la que grabaron cinco álbumes de estudio. Desde el lanzamiento del álbum Hellfire Club de 2004, la banda ha estado asociada con la discográfica Nuclear Blast, con la que ha publicado exitosos álbumes en términos comerciales como Rocket Ride, Age of the Joker y Space Police: Defenders of the Crown.​\\nTobias Sammet, cantante, tecladista y principal compositor de la banda, ha estado en el seno de la misma desde su fundación, alternando su trabajo en Edguy con su proyecto paralelo, Avantasia, una ópera metal en la que se rodea de importantes músicos de la escena power metal como Jørn Lande, Timo Tolkki, Kai Hansen, Michael Kiske, André Matos, Doro, entre otros.​"},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%AC%E0%A8%B0%E0%A8%AB%E0%A8%BC%E0%A9%80%E0%A8%B2%E0%A8%BE_%E0%A8%A4%E0%A9%87%E0%A8%82%E0%A8%A6%E0%A9%82%E0%A8%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Jielbeaumadier_panthere_des_neiges_1_mjp_paris_2014.jpeg","page_title":"ਬਰਫ਼ੀਲਾ ਤੇਂਦੂਆ","context_page_description":"ਬਰਫ਼ੀਲਾ ਤੇਂਦੂਆ ਇੱਕ ਵੱਡੇ ਆਕਾਰ ਦੀ ਬਿੱਲੀ ਹੈ ਜੋ ਕੇਂਦਰੀ ਅਤੇ ਦੱਖਣੀ ਏਸ਼ੀਆ ਵਿੱਚ ਪਾਈ ਜਾਂਦੀ ਹੈ। ਇਹ 2003 ਵਿੱਚ ਖਤਰੇ ਵਿੱਚ ਘਿਰੀ ਪ੍ਰਜਾਤੀ ਐਲਾਨਿਆ ਗਿਆ ਸੀ। 2003 ਦੀ ਗਿਣਤੀ ਦੇ ਅਨੁਸਾਰ ਇਨ੍ਹਾਂ ਦੀ ਗਿਣਤੀ ਲਗਭਗ 4,080–6,590 ਸੀ\\nਜਿਸ ਵਿਚੋਂ ਸਿਰਫ 2500 ਦੇ ਕਰੀਬ ਹੀ ਪ੍ਰਜਨਨ ਦੀ ਸਮਰੱਥਾ ਰੱਖਦੇ ਸਨ।\\nਚਲੰਤ ਚੱਲਦੇ ਆਂਕੜਿਆਂ ਅਨੁਸਾਰ, ਗਲੋਬਲ ਬਰਫ਼ੀਲਾ ਤੇਂਦੁਆ ਅਤੇ ਵਾਤਾਵਰਣ ਸੁਰੱਖਿਆ ਪ੍ਰੋਗਰਾਮ ਵਿੱਚ ਲਗਭਗ 3,920 ਤੋਂ 6,390 ਤੇਂਦੁਆਂ ਨੂੰ ਰੱਖਿਆ ਗਿਆ ਹੈ।\\nਬਰਫ਼ੀਲੇ ਤੇਂਦੁਏ alpine ਅਤੇ subalpine ਖੇਤਰਾਂ ਵਿੱਚ ਰਹਿੰਦੇ ਹਨ। ਇਹ ਥਾਵਾਂ ਆਮ ਤੌਰ ਉੱਤੇ ਜ਼ਮੀਨੀ ਤਲ ਤੋਂ 3000 ਤੋਂ 4500 ਮੀਟਰ ਉੱਪਰ ਹੁੰਦੀਆਂ ਹਨ। ਉੱਤਰੀ ਖੇਤਰਾਂ ਵਿੱਚ ਇਹ ਕੁਝ ਨੀਵੇਂ ਹਿੱਸਿਆਂ ਵਿੱਚ ਵੀ ਰਹਿੰਦੇ ਹਨ।\\nਟੈਕਸੋਨੋਮੀ ਅਨੁਸਾਰ 1930 ਤੋਂ ਬਾਅਦ ਇਸਨੂੰ Uncia uncia ਸ਼੍ਰੇਣੀ ਦਿੱਤੀ ਹੈ ਹੈ। ਜੀਨੋਟਾਈਪਿੰਗ ਅਧਿਐਨ ਦੇ ਆਧਾਰ ਉੱਤੇ ਇਹ 2008 ਤੋਂ ਜਿਨਸ ਪੈਂਥਰਾਸ਼੍ਰੇਣੀ ਦੀ ਮੈਂਬਰ ਮੰਨੀ ਗਈ ਹੈ। ਦੋ ਉਪ-ਪ੍ਰਜਾਤੀਆਂ ਹੋਰ ਮਿਲਦੀਆਂ ਹਨ ਜਿਨ੍ਹਾਂ ਦੇ ਲੱਛਣ ਮਿਲਦੇ ਜੁਲਦੇ ਹੋਣ ਕਾਰਣ ਉਹਨਾਂ ਦਾ ਆਪਸੀ ਅੰਤਰ ਸੁਲਝਿਆ ਨਹੀਂ।\\nਬਰਫ਼ੀਲਾ ਤੇਂਦੁਆ ਅਫ਼ਗਾਨਿਸਤਾਨ ਅਤੇ ਪਾਕਿਸਤਾਨ ਵਿੱਚ ਰਾਸ਼ਟਰੀ ਆਵਾਸ ਪਸ਼ੂ ਹੈ।"},{"page_url":"https://pt.wikipedia.org/wiki/Ponto_de_alinhavo","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Running_stitch.gif","page_title":"Ponto de alinhavo","context_page_description":"Ponto de alinhavo é um ponto de bordado do tipo reto, o ponto básico para a costura à mão."},{"page_url":"https://en.wikipedia.org/wiki/Port_de_Pollen%C3%A7a","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/061_Exploring_the_pine_walk.JPG","page_title":"Port de Pollença","context_page_description":"Port de Pollença is a small town in northern Majorca, Spain, situated on the Bay of Pollença. It is located about 6 km east of the inland town of Pollença and two kilometres southeast of Cala Sant Vicenç. The Cap de Formentor is connected to Port de Pollença via a 13.5 km road."},{"page_url":"https://ar.wikipedia.org/wiki/NGC_4808","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/NGC4808_-_SDSS_DR14.jpg","page_title":"NGC 4808","context_page_description":"NGC 4808 في الفهرس العام الجديد، هي مجرة، تقع في كوكبة العذراء. اكتشفت في 17 أبريل 1786 بواسطة ويليام هيرشل."},{"page_url":"https://pt.wikipedia.org/wiki/Boston_Celtics","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Dennis_Johnson_Lipofsky.jpg","page_title":"Boston Celtics","context_page_description":"O Boston Celtics é uma franquia de basquetebol filiada à National Basketball Association e situada na cidade de Boston, no estado americano de Massachusetts. Fundado em 6 de junho de 1946, é uma das únicas equipes que se mantém desde que foi criada. É propriedade da Boston Basketball Partners LCC e joga os seus jogos em casa no TD Banknorth Garden, dividindo o ginásio com o Boston Bruins da National Hockey League. É conhecido mundialmente por obter 17 títulos da NBA, o que o deixa como o maior vencedor da história da liga.\\nTanto o apelido de \\"Celtics\\" quanto o mascote \\"Lucky the Leprechaun\\" são uma homenagem à população irlandesa historicamente grande de Boston.\\nApontada como uma das melhores equipes de basquetebol de todos os tempos, dominou de 1957 a 1969, quando conquistou 11 de 13 campeonatos, com destaque para o período de 1959-1966, quando foi campeã oito vezes consecutivas, escrita que permanece até os dias de hoje como a maior sequência de títulos da história do esporte dentro dos Estados Unidos. No Hall da Fama do Basquetebol, jogadores como Bill Russell, John Havlicek, Bob Cousy, Larry Bird e o treinador Red Auerbach fizeram história nos Celtics."},{"page_url":"https://fr.wikipedia.org/wiki/Oppidum_des_Encourdoules","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Oppidum_des_Encourdoules_-_site_archeologique.jpg","page_title":"Oppidum des Encourdoules","context_page_description":"L’oppidum des Encourdoules est un oppidum ligure situé sur la commune de Vallauris dans le département français des Alpes-Maritimes. Les sols du camp ont fait l’objet d’une inscription au titre des monuments historiques depuis le 26 janvier 1978 et l'oppidum d'une inscription le 20 juin 1983."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D1%83%D0%B7%D0%B5%D0%B9_%D0%B2%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE%D0%B9_%D1%81%D0%B2%D1%8F%D0%B7%D0%B8_%D0%B8_%D1%8D%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%BE%D0%BD%D0%B8%D0%BA%D0%B8_(%D0%9E%D0%BD%D1%82%D0%B0%D1%80%D0%B8%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Greatwar-switchboard.jpg","page_title":"Музей военной связи и электроники (Онтарио)","context_page_description":"Музей военной связи и электроники — военный музей в Кингстоне, Онтарио, Канада. Является членом Организации военных музеев Канады. Музей связи был создан на одной из военных баз в 1961 году и переехал в нынешнее специально построенное для него здание в 1996 году.\\nОписанный «Lonely Planet» как «комплексный и хорошо продуманный музей, предлагающий хронологические экспозиции по коммуникационным технологиям и различным военным приборам», музей предлагает посетителю рассмотреть развитие военных коммуникаций, начиная с 1903 года, вплоть до Первой и Второй мировых войн, Корейской войны, операций НАТО и миротворческих миссий Организации Объединенных Наций в современную эпоху спутниковой связи."},{"page_url":"https://fr.wikipedia.org/wiki/Bussi%C3%A8res_(Yonne)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/EgliseSt_Jean-Baptiste.jpg","page_title":"Bussières (Yonne)","context_page_description":"Bussières est une commune française située dans le département de l'Yonne en région Bourgogne-Franche-Comté."},{"page_url":"https://de.wikipedia.org/wiki/Grub_am_Forst","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Grub-am-Forst-Kirche.jpg","page_title":"Grub am Forst","context_page_description":"Grub am Forst ist eine Gemeinde und eine Ortschaft im oberfränkischen Landkreis Coburg sowie Sitz der Verwaltungsgemeinschaft Grub am Forst."},{"page_url":"https://sv.wikipedia.org/wiki/Primula_pedemontana","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Primula_pedemontana_%27ALBA%27_Flowers.jpg","page_title":"Primula pedemontana","context_page_description":"Primula pedemontana är en viveväxtart som först beskrevs av Thomas och publicerades av Gaudin 1828. Primula pedemontana ingår i släktet vivor, och familjen viveväxter."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B0%80%EC%96%91%EC%8B%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Miryang_city_hall.jpg","page_title":"밀양시","context_page_description":"밀양시는 대한민국 경상남도 동북부에 있는 시이다. 경부선 철도와 중앙고속도로가 지나며, 대구광역시와 부산광역시의 중간 지점에 위치하고 있다. 울산광역시 울주군과 경상북도 청도군을 경계를 이루고 있으며, 주변 6개 시군과 경계를 두고 있다. 시청 소재지는 교동이고, 행정구역은 2읍 9면 5동이다. 동서북 삼면은 심산준령에 위치해 있으며, 남쪽으로는 낙동강이 유하하여 동북쪽이 높고 서남쪽이 낮으며 동서의 길이가 남북의 길이보다 큰 지형 형태를 이루고 있다."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%93%D0%BE%D0%BB%D1%8F%D0%BC%D0%B0_%D0%BD%D0%B0%D0%B3%D1%80%D0%B0%D0%B4%D0%B0_%D0%BD%D0%B0_%D0%9C%D0%B5%D0%BA%D1%81%D0%B8%D0%BA%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Autodromo_Hermanos_Rodriguez_1963.svg","page_title":"Голяма награда на Мексико","context_page_description":"Голямата награда на Мексико е кръг от календара на световния шампионат на ФИА – Формула 1. Стартовете се провеждат на пистата „Ерманос Родригес“, Мексико сити, Мексико.\\nЗа първи път се провежда през 1962 г. като нешампионатно състезание. Вече като шампионатно състезание е в календара на Формула 1 от 1963 до 1970 г. и от 1986 до 1992 година.\\nОт 1992 година в Мексико не са се провеждали стартове от Формула 1."},{"page_url":"https://en.wikipedia.org/wiki/Old_Dominion_University","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Engineering_Systems_Building_at_Old_Dominion.JPG","page_title":"Old Dominion University","context_page_description":"Old Dominion University is a public research university in Norfolk, Virginia. It was established in 1930 as the Norfolk Division of the College of William & Mary and is now one of the largest universities in Virginia with an enrollment of 24,176 students for the 2019 academic year. Old Dominion University is also home to over 700 international students from 89 different countries. Its main campus covers over 251 acres straddling the city neighborhoods of Larchmont, Highland Park, and Lambert's Point, approximately five miles from Downtown Norfolk.\\nOld Dominion University is classified among \\"R2: Doctoral Universities – High research activity\\". According to the National Science Foundation, ODU spent $60.3 million on research and development in 2018. It contributes nearly $2 billion annually in economic impact to the regional economy.\\nThe university offers 168 undergraduate and graduate degree programs to over 24,000 students and is one of the nation's largest providers of online distance learning courses. Old Dominion University has approximately 124,000 alumni in all 50 states and 67 countries."},{"page_url":"https://pl.wikipedia.org/wiki/Warto%C5%9B%C4%87_energetyczna","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Nutrition-label.jpg","page_title":"Wartość energetyczna","context_page_description":"Wartość energetyczna – ilość energii w danym produkcie jaką organizm może przyswoić przez trawienie. Wartość energetyczna wyrażana jest w kilokaloriach i kilodżulach."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8B%D5%AB%D5%B6%D5%B8%D5%A6%D5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Ginosa_Corso_Vittorio_Emanuele_II.jpg","page_title":"Ջինոզա","context_page_description":"Ջինոզա, կոմունա Իտալիայում, Ապուլիա մարզում՝ Տարանտո գավառում։\\nԲնակչությունը կազմում է 22 421 մարդ, բնակչության խտությունը կազմում է 118 մարդ/կմ²։ Զբաղեցնում է 187 կմ² տարածք։ Փոստային ինդեքսն է՝ 74013։ Հեռախոսային կոդը՝ 099։\\nՔաղաքի հովանավոր սուրբն է սուրբ Maria SS.ma del Rosariocopatroni-ն և սրբեր SS. Medici Cosma-ն և Damiano-ն։"},{"page_url":"https://en.wikipedia.org/wiki/Dwarskersbos","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Velddrif_Beach_House.JPG","page_title":"Dwarskersbos","context_page_description":"Dwarskersbos is a settlement in West Coast District Municipality in the Western Cape province of South Africa.\\nFishing village some 11 km north of Laaiplek. Near here the Portuguese navigator Vasco da Gama first set foot on South African soil on 7 November 1497 when he explored the present St Helena Bay. A 6m high storm surge struck Dwarskersbos on 27 August 1969. The name is said to be derived from Afrikaans; kersbos is a type of plant, Euclea polyandra, or Sarcocaulon species. The beach stretches from Velddrif and Dwarskerbos to Elands Bay, making it the longest uninterrupted sandy beach in South Africa."},{"page_url":"https://ro.wikipedia.org/wiki/Fredrik_Ljungstr%C3%B6m","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Fredrik_Ljungstr%C3%B6m_1951.jpg","page_title":"Fredrik Ljungström","context_page_description":"Fredrik Ljungström a fost un inginer, constructor și industriaș suedez."},{"page_url":"https://de.wikipedia.org/wiki/Zaunk%C3%B6nig","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/39/Zaunk%C3%B6enig_Entsorgung_05.jpg","page_title":"Zaunkönig","context_page_description":"Der Zaunkönig ist die einzige in Eurasien vorkommende Art aus der Vogelfamilie der Zaunkönige. Er ist nach Winter- und Sommergoldhähnchen der drittkleinste Vogel Europas. Lange Zeit wurde er Schneekönig genannt, da er auch im Winter lebhaft singt. Der Zaunkönig besiedelt Europa, Nordafrika, Vorder-, Zentral- und Ostasien und Nordamerika. Seine Nahrung setzt sich aus Spinnen, Weberknechten und Insekten, wie beispielsweise Nachtfaltern und Fliegen, sowie deren Eiern und Larven zusammen. Die Art gilt derzeit als nicht gefährdet.\\nIn Erzählungen hat der Zaunkönig den Ruf der Schlauheit und List. Diese Nachrede geht auf eine Fabel des Äsop zurück, nach der die Vögel einst beschlossen, denjenigen von ihnen zum König zu machen, der am höchsten flöge. Dies gelang dem Adler, aber der Zaunkönig schaffte es durch eine List, diesen zu übertreffen."},{"page_url":"https://fa.wikipedia.org/wiki/%DB%8C%D9%88%D8%A7%D8%B3%E2%80%8C%D8%A7%D8%B3_%D8%A7%D9%BE%D9%88%D8%B1%DA%86%D9%88%D9%86_(%D8%A7%DB%8C%E2%80%8C%D8%A2%D8%B1%D8%A7%D8%B3-%DB%B4%DB%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/USS_Opportune_%28ARS-41%29_underway_on_1_November_1983_%286430328%29.jpg","page_title":"یواس‌اس اپورچون (ای‌آراس-۴۱)","context_page_description":"یواس‌اس اپورچون (ای‌آراس-۴۱) یک کشتی بود که طول آن ۲۱۳ فوت ۶ اینچ بود. این کشتی در سال ۱۹۴۵ ساخته شد."},{"page_url":"https://ceb.wikipedia.org/wiki/Alpheopsis","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Alpheopsis_yaldwyni.JPG","page_title":"Alpheopsis","context_page_description":"Henero sa mga krustaseo ang Alpheopsis. Ang Alpheopsis sakop sa kabanay nga Alpheidae.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://en.wikipedia.org/wiki/Abbey_of_Vangadizza","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Vangadizza_Badiapol.jpg","page_title":"Abbey of Vangadizza","context_page_description":"Vangadizza Abbey is a former Benedictine abbey in the modern comune of Badia Polesine, northern Italy. It was an independent state from the early Middle Ages until the 14th century."},{"page_url":"https://en.wikipedia.org/wiki/Gorbea","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Vitoria_-_Monte_Gorbea.jpg","page_title":"Gorbea","context_page_description":"Gorbea or Gorbeia is a mountain and massif, the highest in Biscay and Alava, with a height of 1,481 m AMSL. The massif covers a wide area between the two provinces. The main mountain is a round grass-covered summit where a 20-metre-tall metallic cross has been constructed to reach the altitude of 1,500 m. Other important mountains of the massif are the Berretín, Lekanda and Aldamin limestone peaks.\\nPart of the massif is delimited North by the high karstic plateau of Itxina, an intrincate landscape of limestone full of shafts and caves such as Supelegor. The Atxular's Eye cave is the only walking access to the plateau.\\nThe South is delimited by the Berretín mountain and the lush forests of Zuia.\\nThe entire massif has been enclosed in a natural park of 200 km² created by the Basque Government in 1994 to preserve the local flora of beech and oak and fauna of wild boar and deer. The main access points for the mountain are Murgia from Alava and Areatza from Biscay."},{"page_url":"https://en.wikipedia.org/wiki/List_of_apple_cultivars","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Malus_domestica_Manks_Codlin_Locatie_De_Kruidhof.JPG","page_title":"List of apple cultivars","context_page_description":"Over 7,500 cultivars of the culinary or eating apple are known. Some are extremely important economically as commercial products, though the vast majority are not suitable for mass production. In the following list, use for \\"eating\\" means that the fruit is consumed raw, rather than cooked. Cultivars used primarily for making cider are indicated. Those varieties marked agm have gained the Royal Horticultural Society's Award of Garden Merit.\\nThis list does not include the species and varieties of apples collectively known as crab apples, which are grown primarily for ornamental purposes, though they may be used to make jelly. These are described under Malus."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D8%B1%D8%A7%D9%86%D8%AF%D9%86_%D8%A7%D9%88%D9%84%D9%8A%D9%81%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Oliver_vs_UMass.jpg","page_title":"براندن اوليفر","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nبراندن اوليفر لاعب كورة القدم الامريكيه من امريكا."},{"page_url":"https://ca.wikipedia.org/wiki/Saint-Sorlin","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Map_commune_FR_insee_code_69237.png","page_title":"Saint-Sorlin","context_page_description":"Saint-Sorlin és un municipi francès, situat al departament del Roine i a la regió d'Alvèrnia-Roine-Alps. L'any 2007 tenia 681 habitants."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A6%D7%9E%D7%97%D7%95%D7%A0%D7%95%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/CoconutGlens_003.jpg","page_title":"צמחונות","context_page_description":"צמחונות הוא אורח חיים תזונתי המתאפיין בהימנעות מאכילת בשר בעלי חיים. חלק מהצמחונים נמנעים גם מלבישת מלבוש המכיל עור, פרווה ונוצות, וכן מרכישת ריהוט המכיל אותם. בין הסיבות לאימוץ תזונה או אורח חיים צמחוני נמנים נימוקים מוסריים ואידאולוגיות רוחניות, דתיות ואחרות, טעם אישי, סיבות בריאותיות ונימוקים סביבתיים-אקולוגיים. צמחונים הנמנעים מכל מזון מהחי כגון ביצים וחלב ומוצריו נקראים לרוב טבעונים.\\nצמחונים רבים משתמשים בתחליפי בשר כדוגמת טופו, טמפה וסייטן."},{"page_url":"https://ro.wikipedia.org/wiki/Comuna_Komenda","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Kriz-Komenda1.jpg","page_title":"Comuna Komenda","context_page_description":"Komenda este o comună din Slovenia, cu o populație de 4.628 de locuitori."},{"page_url":"https://ast.wikipedia.org/wiki/Estilu_Imperiu","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/SilkLampas.jpg","page_title":"Estilu Imperiu","context_page_description":"El estilu Imperiu ye un estilu artísticu dominante, esencialmente, en decoración d'interiores, moblame y moda, que s'enserta dientro del movimientu neoclásicu, y en concretu del neoclasicismu tardíu. Toma'l so nome del periodu de gobiernu de Napoleón en Francia, conocíu como Primer Imperiu Francés.\\nA pesar del so nome, l'estilu desenvuélvese antes de la proclamación del Imperiu en 1804, teniendo'l so puntu d'orixe nes campañes militares d'Italia y Exiptu. En Francia, al estilu Imperiu antecédelu'l estilu Directoriu y asocéde-y l'estilo Restauración.\\nL'estilu Imperiu espresóse sobremanera na redecoración de la residencies imperiales como les Tullerías, Saint-Cloud, Fontainebleau, La Compiègne o'l Grand Trianon, amás d'en residencies particulares como la Malmaison o'l Hôtel de Beauharnais."},{"page_url":"https://es.wikipedia.org/wiki/ArduSat","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ed/ISS-36_HTV-4_berthing_2.jpg","page_title":"ArduSat","context_page_description":"ArduSat es un satélite en miniatura con software de código abierto, desarrollado por la empresa Arduino, basado en el CubeSat estándar. Tiene un conjunto circuitos y sensores producido por Arduino. El público general podrá utilizar estos dispositivos para sus propios propósitos mientras estén en el espacio exterior.\\nArduSat fue diseñado por Nanosatisfi LLC, una compañía aeroespacial qué en palabras de Phil Plait​ tiene \\"el objetivo para democratizar acceso al espacio\\" y fue fundado por 4 estudiantes de posgrado de la Universidad Espacial Internacional en 2012.\\nArduSat es el primer satélite de código abierto que proporcionará acceso al público en general al espacio.​"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D9%88%D9%8A%D8%B3_%D8%A7%D9%84%D8%A3%D9%88%D9%84%D8%8C_%D8%AF%D9%88%D9%82_%D8%A3%D9%88%D8%B1%D9%84%D9%8A%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/LudvikOrlean_Pizan.jpg","page_title":"لويس الأول، دوق أورليان","context_page_description":"لويس الأول، دوق أورليان ‏ ؛ كان دوق أورليان من 1392 حتى اغتياله، وأيضا دوق تورين، وكونت فالوا، وبلوا، وأنغوليم، وبيرغورد، وسواسون.\\nلويس يعتبر الابن الثاني لـ شارل الخامس ملك فرنسا وزوجته جوان من بوربون، وبالتالي هو شقيق الأصغر لـ شارل السادس ملك فرنسا، وأيضا هو جد لويس الثاني عشر ملك فرنسا وجد الأكبر لـ فرانسوا الأول ملك فرنسا."},{"page_url":"https://en.wikipedia.org/wiki/Dutar","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Joueur_de_dutar_ouzbek.jpg","page_title":"Dutar","context_page_description":"The dutar is a traditional long-necked two-stringed lute found in Iran and Central Asia. Its name comes from the Persian word for \\"two strings\\", دوتار do tār, although the Herati dutar of Afghanistan has fourteen strings. When played, the strings are usually plucked by the Uyghurs of Western China and strummed and plucked by the Tajiks, Turkmen, Uzbeks. Related instruments include the Kazakh dombra. The Dutar is also an important instrument among the Kurds of Khorasan amongst whom Haj Ghorban Soleimani of Quchan was a noted virtuoso. In Kurdish one who plays the dutar is known as a bakci, while in Azeri the term is ashiq. Khorasan bakhshi music is recognized on the Representative List of the Intangible Cultural Heritage of Humanity.\\nAt the time of the Dutar's humble origins in the 15th century as a shepherd's instrument its strings were made from gut. However, with the opening up of the Silk Road, catgut gave way to strings made from twisted silk imported from China. To this day some instruments still feature silk strings, although nylon strings are also commonly used.\\nThe dutar has a warm, dulcet tone. Typical sizes for the pear-shaped instrument range from one to two meters."},{"page_url":"https://es.wikipedia.org/wiki/Los_maor%C3%ADs_y_la_conservaci%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/PolynesianRatNZ.jpg","page_title":"Los maorís y la conservación","context_page_description":"Los maorís tienen una ética de conservación fuerte y cambiante desde el momento en que se descubrieron y se establecieron en Nueva Zelanda hasta el día de hoy y están estrechamente vinculados a sus las creencias espirituales.​"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%BE%D0%B2%D1%81%D1%82%D1%83%D1%85%D0%B0_%D0%86%D0%B2%D0%B0%D0%BD_%D0%9F%D0%B0%D0%B2%D0%BB%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Ivantovstucha.jpg","page_title":"Товстуха Іван Павлович","context_page_description":"Ів́ан Па́влович'Товсту́ха — учасник революційного руху в Україні, агент чернігівської організації РСДРП. Політемігрант, а після Жовтневого перевороту 1917 - член Колегії Наркомату у справах національностей РСФСР, секретар шефа СССР Йосипа Сталіна, його перший офіційний біограф. Помічник директора Інституту Лєніна при ЦК ВКП, заступник директора Інституту Маркса — Енгельса — Леніна."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%AE%87%E5%AE%99%E6%B0%B4%E7%88%86%E6%88%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/ThisIslandEarth.jpg","page_title":"宇宙水爆戦","context_page_description":"『宇宙水爆戦』は1955年に製作されたアメリカ合衆国のSF映画。"},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_Sheffield_City_Centre","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/K6_Phone_Box%2C_Leopold_St.jpg","page_title":"Listed buildings in Sheffield City Centre","context_page_description":"This is a list of listed buildings in Sheffield City Centre. For the purposes of this list, the city centre is defined as being equivalent to the S1 postcode district."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D9%88%D8%A8_%D9%86%D9%8A%D9%88%D9%85%D8%A7%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/Robnewman.jpeg","page_title":"روب نيومان","context_page_description":"روب نيومان ‏ هو لاعب كرة قدم بريطاني يلعب كمدافع."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9C%8B%E7%AB%8B%E8%87%BA%E4%B8%AD%E6%95%99%E8%82%B2%E5%A4%A7%E5%AD%B8%E9%99%84%E8%A8%AD%E5%AF%A6%E9%A9%97%E5%9C%8B%E6%B0%91%E5%B0%8F%E5%AD%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/NTCTCPS_door.JPG","page_title":"國立臺中教育大學附設實驗國民小學","context_page_description":"國立臺中教育大學附設實驗國民小學，是中華民國臺中市的一所國立國民小學，為國立臺中教育大學附設實驗小學，前身為「臺灣總督府臺中師範學校附屬公學校」。"},{"page_url":"https://fr.wikipedia.org/wiki/Mobilien","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/CIFVAS100_Cr%C3%A9teilEchat3.JPG","page_title":"Mobilien","context_page_description":"Mobilien est le réseau de transport routier de personnes d'Île-de-France destiné à faciliter les liaisons de pôle à pôle et de rocade, avec des fréquences élevées dans les zones denses et urbaines d'Île-de-France. Le réseau était principalement en grande couronne avant la création du réseau de bus Express, destiné à relier les principales agglomérations de grande couronne.\\nLes lignes qui le composent sont exploitées par plusieurs organismes. En effet, les lignes de Paris et de la proche banlieue sont exploitées pour la plupart par la Régie autonome des transports parisiens. Les autres lignes, principalement en moyenne et grande banlieue, le sont par des opérateurs indépendants regroupés dans l'Organisation professionnelle des transports d'Île-de-France."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_platges_de_la_Costa_Brava","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Tamariu.JPG","page_title":"Llista de platges de la Costa Brava","context_page_description":"Llista de platges de la Costa Brava, seguint el litoral de nord a sud entre Portbou i Blanes, segons l'inventari de platges de l'Agència Catalana de Turisme i la Direcció General de Protecció Civil del Departament d'Interior.\\nS'indica amb una icona les platges amb el distintiu de Bandera Blava en la temporada del 2014."},{"page_url":"https://be.wikipedia.org/wiki/%D0%93%D0%B5%D0%BD%D1%80%D1%8B%D1%85_%D0%9B%D0%B5%D1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Heinrich_der_L%C3%B6we_und_Mathilde_von_England.jpg","page_title":"Генрых Леў","context_page_description":"Генрых Леў — манарх з дынастыі Вельфаў, герцаг Саксоніі і Баварыі. Сын герцага Саксонскага і Баварскага Генрыха Ганарлівага і Гертруды Суплінбургскай, дачкі імператара Лотара II."},{"page_url":"https://no.wikipedia.org/wiki/Simen_Aanerud","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Simen_aanerud.jpg","page_title":"Simen Aanerud","context_page_description":"Simen Aanerud er en norsk musiker og oppfinner fra Nes i Akershus. Han er kjent som pianist og som eier i firmaet Aanerud Industries.\\nAanerud er kjent for mange som bluespianist, både i Norge og New Zealand. Han har spilt med artister som blant annet Tim Finn, Gin Wigmore, Amund Maarud, Stellar* og Darcy Perry. I tillegg til sin karriere som musiker er han også oppfinner og eier av firmaet Aanerud Industries i Skogbygda. Dette firmaet lager design- og interiørobjekter.\\nAaneruds musikerkarriere startet som 12-åring, med Amund Maarud og Henrik Maarud i bandet MaarudKara. Bandet kom på andreplass i Talentiaden på NRK i 1997 og ga året etter ut albumet First Blues på Tylden & Co. I 2001 flyttet han til Auckland, New Zealand, hvor han viderutviklet sin pianistkarriere. Han ble med bluesgitarist Darcy Perry i 2002, og spilte sammen med ham inn albumet Blues4Dad. I 2003 og 2005 etterfulgte albumene Don't Hold Back og Heavy Rain. Samtidig som Aanerud arbeidet med flere artister i New Zealand, etablerte han også sine egne band Handsome Giants og Blue Devils. Bandet Handsome Giants ga i 2005 ut DVD-en Live on Bow Streetsom ble utgitt uavhengig i New Zealand."},{"page_url":"https://en.wikipedia.org/wiki/Troelstralaan_metro_station","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/Station_troelstralaan.jpg","page_title":"Troelstralaan metro station","context_page_description":"Troelstralaan is a metro station in Schiedam, situated on Rotterdam Metro line C. The station was opened on 4 November 2002 as part of the last major expansion of the Rotterdam metro. The main entrance, at the east end of the subway station, is located on the street named after P.J. Troelstralaan, and the island platform is accessible by entrances on both ends."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_K%C3%B6tz","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Kapelle_St._Anna%2C_Gro%C3%9Fk%C3%B6tz%2C_Gemeinde_K%C3%B6tz.JPG","page_title":"Liste der Baudenkmäler in Kötz","context_page_description":"Auf dieser Seite sind die Baudenkmäler der schwäbischen Gemeinde Kötz zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://pl.wikipedia.org/wiki/Mistrzostwa_Europy_w_Pi%C5%82ce_No%C5%BCnej_2016_(eliminacje)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Ukraine_vs_Luxembourg_14062015_UEFA_EURO_2016_Qualifying_round_-_Group_C_%288%29.jpg","page_title":"Mistrzostwa Europy w Piłce Nożnej 2016 (eliminacje)","context_page_description":"W eliminacjach do piłkarskich Mistrzostw Europy 2016 wzięły udział reprezentacje narodowe z 53 europejskich federacji krajowych, które walczyły o 23 miejsca dających prawo występu w finałach ME – ostatnie jest zarezerwowane dla drużyny gospodarza imprezy: Francji. Zespoły podzielono na 9 grup: 8 grup po 6 drużyn i jedną grupę z 5 drużynami, w której szósta drużyna grała mecze towarzyskie z drużynami, które w danej kolejce pauzują."},{"page_url":"https://en.wikipedia.org/wiki/Package_testing","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9f/Heat_Sealing_Film_for_Permeability_Test.jpg","page_title":"Package testing","context_page_description":"Package testing or packaging testing involves the measurement of a characteristic or property involved with packaging. This includes packaging materials, packaging components, primary packages, shipping containers, and unit loads, as well as the associated processes.\\nTesting measures the effects and interactions of the levels of packaging, the package contents, external forces, and end-use.\\nIt can involve controlled laboratory experiments, subjective evaluations by people, or field testing. Documentation is important: formal test method, test report, photographs, video, etc.\\nTesting can be a qualitative or quantitative procedure. Package testing is often a physical test. With some types of packaging such as food and pharmaceuticals, chemical tests are conducted to determine suitability of food contact materials. Testing programs range from simple tests with little replication to more thorough experimental designs.\\nPackage testing can extend for the full life cycle. Packages can be tested for their ability to be recycled and their ability to degrade as surface litter, in a sealed landfill or under composting conditions."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Ajitgarh","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/PCA_Stadium%2C_Mohali_1.jpg","page_title":"Ajitgarh","context_page_description":"Ajitgarh sī Ìn-tō͘ Punjab pang Rupnagar koān ê chi̍t ê chng-thâu."},{"page_url":"https://de.wikipedia.org/wiki/Liste_abgegangener_Denkm%C3%A4ler_in_Frankfurt_(Oder)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Postkarte_Frankfurt_Oder_Denkmal_des_Leibgrenadierregiments_Nr._8.jpg","page_title":"Liste abgegangener Denkmäler in Frankfurt (Oder)","context_page_description":"Frankfurt (Oder) weist wegen seiner langen Geschichte viele Denkmäler auf. Es gibt neben Bau-, Flächen-, Bodendenkmälern und Denkmalbereichen viele Denkmäler im engeren Sinne. Fast genauso viele sind jedoch auch verlorengegangen; nur von wenigen ist etwas über den Verbleib bekannt.\\nAuf Grund des Bedarfs an Metallen durch die Armee wurden im Sommer 1942 das bronzene Reiterdenkmal des Kaisers am Wilhelmsplatz sowie der bronzene Adler auf dem Kriegerdenkmal am Kleinen Wilhelmsplatz entfernt und der Metallreserve zugeführt.\\nNach dem Zweiten Weltkrieg wurde mit Befehl Nr. 30 vom 13. Mai 1946 des Alliierten Kontrollrates die Beseitigung deutscher militärischer und nazistischer Denkmäler und Museen angeordnet. Dabei waren Denkmäler gemeint, die nach 1914 errichtet worden waren. Ausnahmen gab es grundsätzlich für Grabdenkmäler und für Werke großer künstlerischer Bedeutung; diese konnten auf Antrag erteilt werden. Symbole mit dem Reichsadler waren aber zu diesem Zeitpunkt bereits größtenteils beseitigt. Insgesamt wurden für Frankfurt 24 Standorte festgestellt, und zwischen dem 16. Oktober und dem 13. Dezember 1946 wurde die Beseitigung bei neun dieser Standorte durchgeführt."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%D8%AA%D8%B1%D9%87_%D8%AF%D9%88%D8%B1%D9%86%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Templul_Mare_din_Vatra_Dornei4.jpg","page_title":"وتره دورنه","context_page_description":"شهر وتره دورنه در شهرستان سوچاوا در کشور رومانی واقع شده‌است. جمعیت این شهر ۱۷٬۸۶۴ نفر است."},{"page_url":"https://en.wikipedia.org/wiki/X-raid","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/X-raid_MINI_ALL4_Racing_Dakar.jpg","page_title":"X-raid","context_page_description":"X-raid is a German motoring team owned by Sven Quandt, whose family is a majority shareholder of BMW, for which it plays the official team in the Dakar Rally and in the FIA World Cup for Cross-Country Rallies."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1940","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Berger7.JPG","page_title":"Lijst van personen geboren in 1940","context_page_description":"Dit is een lijst van personen die geboren zijn in 1940.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://ro.wikipedia.org/wiki/Comuna_Racovi%C8%9Ba,_Sibiu","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Ana_lu_Onu_Pascului_verso.jpg","page_title":"Comuna Racovița, Sibiu","context_page_description":"Racovița este o comună în județul Sibiu, Transilvania, România, formată din satele Racovița și Sebeșu de Sus. Prima atestare documentară a satului a fost descoperită într-un act de danie al voievodului Ioan de Hunedoara din 22 mai 1443. Satul este menționat pentru prima dată în documentele bisericești în 8 iulie 1647, într-un act prin care Gheorghe Rákóczi I îl numea pe popa Ion din Țichindeal protopop peste 17 sate din jurul Sibiului, printre care s-a numărat și Racovița. Bogata istorie a satului este legată în principal de înființarea graniței militare transilvănene de către împărăteasa imperiului Maria Terezia în 1765, Racovița făcând parte din Compania a VII-a a Regimentului I de Graniță de la Orlat. Începând încă din 1698, înainte de militarizarea completă a satului, Racovița, ca de altfel toate localitățile aparținătoare regimentului orlățean, s-a confruntat cu o serie de conflicte interconfesionale petrecute la jumătatea secolului XVIII împotriva procesului de unire a mitropoliei ortodoxe de Alba-Iulia cu Biserica Catolică a Romei."},{"page_url":"https://en.wikipedia.org/wiki/Hunping","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/JinJar.JPG","page_title":"Hunping","context_page_description":"The hunping, translated as soul jar or soul vase, is a type of ceramic funerary urn often found in the tombs of the Han dynasty and especially the Six Dynasties periods of early imperial China. It was characteristic of the Jiangnan region in modern southern Jiangsu and Zhejiang provinces.\\nThe purpose of a hunping is somewhat enigmatic, but archaeologists suggest that they may have been used as containers for fruit accompanying the deceased into the afterlife. According to the Metropolitan Museum of Art, the ancients may have hoped that the soul of the deceased would eventually reside in the vessel.\\nSince the last decades of the Han Dynasty, the top of hunping vessels started to be decorated with miniature sculptures of men, animals, birds, etc. Gradually, sculptural compositions became more elaborate, including images of entire buildings.\\nIt is due to an early-Jin Dynasty hunping, dating to 272, that an early example of a tortoise-born stele is known to us."},{"page_url":"https://it.wikipedia.org/wiki/Mario_Occhiuto","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Padiglioni_Expo_Shanghai_2010_Occhiuto.jpg","page_title":"Mario Occhiuto","context_page_description":"Mario Occhiuto è un architetto e politico italiano, sindaco di Cosenza dal 31 maggio 2011 all'11 febbraio 2016 e dal 7 giugno 2016 e in seguito anche presidente della Provincia di Cosenza dal 2014 al 2016."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%94%D0%B2%D1%94%D1%80%D0%BE%D0%B4%D0%BE%D0%BD%D0%B5%D1%86%D1%8C%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/%D0%A5%D1%80%D0%B5%D1%89%D0%B5%D0%BD%D0%BD%D1%8F%D0%9A%D0%A5%D0%A0%D0%91%282009-01-19%29-2.jpg","page_title":"Сєвєродонецьк","context_page_description":"Сє́вєродоне́цьк — місто на сходi України, адміністративний центр Луганської області та Сєвєродонецького району. Одне з найважливіших промислових міст Донбасу, центр хімічної промисловості України.\\nМісто лежить між річками Сіверським Дінцем і Боровою та входить до складу Лисичансько-Сєвєродонецької агломерації. Міській раді підпорядковані 4 селища міського типу, 3 села і 3 селища."},{"page_url":"https://fr.wikipedia.org/wiki/Pourim","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Homemade_hamantaschen.jpg","page_title":"Pourim","context_page_description":"Pourim est une fête juive d’origine biblique et d’institution rabbinique, qui commémore les événements relatés dans le Livre d’Esther : la délivrance miraculeuse d’un massacre de grande ampleur, planifié à leur encontre par Haman l’Agaggite dans l’Empire perse sous le règne d’Assuérus.\\nLa fête est célébrée chaque année à la date du 14 adar.\\nAux pratiques traditionnelles, consignées dans le Livre d’Esther et ordonnancées par les Sages de la Mishna, se sont ajoutées diverses coutumes, notamment culinaires, avec les hamantaschen ou deblas, ainsi que des manifestations joyeuses et carnavalesques, et l’usage de crécelles à l’évocation du nom de Haman."},{"page_url":"https://hr.wikipedia.org/wiki/Kokosov_otok","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Isla_del_Coco-chatham_beach.jpg","page_title":"Kokosov otok","context_page_description":"Kokosov otok je nenaseljeni otok 550 km ispred pacifičke obale Kostarike, koji čini 11. distrikt kantona Puntarenas u istoimenoj kostarikanskoj pokrajini.\\nOtok je okružen dubokim vodama u kojima obitavaju morski psi batovi, mante, tune, dupini i druge morke vrste koje privlače turiste ronioce. Ekstremno vlažna oceanska klima utjecala je na razvitak jedinstvenog ekosustava tropske kišne šume, jedini takve vrste u istočnom Tihom Oceanu koji se odlikama razlikuje od svakog otočja u ovom području. Zbog toga je upisan na UNESCO-v popis mjesta svjetske baštine u Amerikama 1997. godine kao \\"područje na udaru sjeverne ekvatorske protustruje koje je idealno za proučavanje bioloških procesa pomorskog života\\"."},{"page_url":"https://de.wikipedia.org/wiki/Exkavator","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Excavator1.JPG","page_title":"Exkavator","context_page_description":"Ein Exkavator ist ein beidseitiges zahnärztliches Handinstrument zum Entfernen kariösen Dentins in der Nähe der Pulpa vor dem Legen einer Füllung.\\n„Excavator“ ist das englische Wort für Bagger.\\nAn beiden Arbeitsenden besitzt das Instrument kleine, scharfe Löffelchen von etwa 1–2 Millimeter Durchmesser, ähnlich einem scharfen Löffel. Mit diesen wird das kariöse Gewebe herausgekratzt. Obgleich dieses bereits durch seine braune Farbe zu erkennen ist, kann es durch ein spezielles Medikament zusätzlich angefärbt werden.\\nDer Exkavator ist eines der ältesten Geräte zum Entfernen von Karies. Modernere Alternativen sind turbinenbetriebene Diamantschleifer und Rosenbohrer aus Hartmetall, und seit einigen Jahren auch der Laser.\\nWird das Instrument mit wenig Druck benutzt, ist die Behandlung auch ohne Anästhesie relativ schmerzfrei. Ferner entfallen der Turbinenlärm und sonstige Bohrgeräusche. Hierdurch vermindern sich zum einen Vibrationen und die Lärmangst; zum anderen wird eine bessere Kommunikation zwischen Zahnarzt und Patient während der Behandlung möglich. Nachteilig ist jedoch die deutlich längere Behandlungszeit."},{"page_url":"https://ko.wikipedia.org/wiki/2017~2018%EB%85%84_%EC%98%A4%EC%8A%A4%ED%8A%B8%EB%A0%88%EC%9D%BC%EB%A6%AC%EC%95%84_%EA%B7%BC%ED%95%B4_%EC%82%AC%EC%9D%B4%ED%81%B4%EB%A1%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Joyce_2018-01-12_0536Z.jpg","page_title":"2017~2018년 오스트레일리아 근해 사이클론","context_page_description":"2017~2018년 오스트레일리아 근해 사이클론은 2017년 8월 8일에서 2018년 사이에 호주 근해에서 발생한 사이클론을 기록한 문서이다.\\n이 지역은 5개의 열대저기압 경보 센터가 감시한다. 그 5개 기구는 호주 기상청의 TCWC 퍼스, TCWC 다윈, TCWC 브리즈번, 인도네시아의 TCWC 자카르타, 파푸아뉴기니의 TCWC 포트모르즈비이다.\\n참고로 호주 근해의 TCWC들은 최대풍속 34kt 미만의 열대 저기압을 \\"저기압\\"이라 하므로, 원래 의미의 저기압과 혼동되어서는 안 된다."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1947","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/James_Woods_2015.jpg","page_title":"Lijst van personen geboren in 1947","context_page_description":"Dit is een lijst van personen die geboren zijn in 1947.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://da.wikipedia.org/wiki/Kaufmann_(virksomhed)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Quintessbutik.jpg","page_title":"Kaufmann (virksomhed)","context_page_description":"Kaufmann APS er en dansk familieejet tøjkoncern med hovedsæde i Aarhus. Kaufmann forhandler modetøj i mærkerne Polo Ralph Lauren, Hugo Boss, Sand, Jacob Cohën, Lacoste, Tiger of Sweden, EA7 med flere.\\nKaufmann kæden blev grundlagt den 10. oktober 1908 af Axel Kaufmann i det indre Aarhus og er i 2015 landsdækkende med butikker over hele landet. I 2010 omfattede Kaufmann koncernen butikskæderne AXEL, Kaufmann, Quint og Quintess, og beskæftigede mere end 400 ansatte fordelt i deres forskellige butikker."},{"page_url":"https://it.wikipedia.org/wiki/Battaglia_di_Barga","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Firenze-Stemma.png","page_title":"Battaglia di Barga","context_page_description":"La battaglia di Barga fu una battaglia delle Guerre di Lombardia che si svolse nel febbraio 1437. Fu combattuta tra l'esercito del Ducato di Milano, comandato da Niccolò Piccinino e quello della Repubblica di Firenze comandato da Francesco Sforza."},{"page_url":"https://ca.wikipedia.org/wiki/Diagrama_de_Tanabe-Sugano","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/D5_Tanabe-Sugano_diagram.png","page_title":"Diagrama de Tanabe-Sugano","context_page_description":"Els diagrames de Tanabe-Sugano s'utilitzen en química de coordinació per predir les absorcions dels compostos de coordinació en les regions de la UV i el visible de l'espectre electromagnètic. Els resultats de l'anàlisi d'un diagrama de Tanabe-Sugano d'un complex metàl·lic també poden ser comparats amb les dades espectroscòpiques experimentals."},{"page_url":"https://es.wikipedia.org/wiki/Monedas_de_Grecia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Tetradrachm_Athens_reverse_CdM_Paris.jpg","page_title":"Monedas de Grecia","context_page_description":"Las monedas fueron inventadas en Asia Menor, en lo que hoy es el noroeste de Lidia, hacia el 620 a. C. Las monedas pronto se extendieron a las polis independientes de Jonia en la costa egea, y desde allí al resto del mundo griego, el cual se extendía en aquella época desde el mar Negro hasta Sicilia y el sur de Italia.\\nLa historia de las antiguas monedas griegas puede dividirse, en tres periodos, el arcaico, el clásico y el helenístico. Expertos aun debaten si incluir al período bizantino como parte de la historia griega o romana, incluyendo a esto todo su tipo de arte, incluyendo sus monedas.\\nEl periodo arcaico se extiende desde la introducción de la moneda en el mundo griego sobre el 600 a. C. hasta las Guerras Médicas sobre el 480 a. C.\\nEl periodo clásico comenzó al terminar el anterior y terminó con las conquistas de Alejandro Magno sobre el 330 a. C., en que empezó el periodo helenístico, llegando hasta la absorción romana del mundo griego en el siglo I a. C. las ciudades griegas continuaron acuñando moneda durante varios siglos más bajo gobierno romano, son las llamadas monedas provinciales romanas."},{"page_url":"https://de.wikipedia.org/wiki/Herzogtum_Westfalen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Anno_II.jpg","page_title":"Herzogtum Westfalen","context_page_description":"Das Herzogtum Westfalen war ein Territorium im Heiligen Römischen Reich Deutscher Nation und gehörte bis 1803 zu Kurköln. Das Herzogtum lag im Süden der Westfälischen Bucht. Neben den fruchtbaren Ebenen der Hellwegbörden gehörte ein beträchtlicher Teil des Sauerlandes zum Herzogtum.\\nUrsprünglich war das Gebiet ein Teil des Stammesherzogtums Sachsen. Dessen Teilung und die Übertragung der Herzogswürde für den westfälischen Teil an Philipp von Heinsberg, den Erzbischof von Köln, auf dem Hoftag zu Gelnhausen des Jahres 1180 war die zentrale Voraussetzung für die Entstehung des Landes. Über einen längeren Zeitraum hinweg entwickelten die Erzbischöfe aus den ursprünglichen Herzogsrechten, die vor allem eine Herrschaft über Menschen war, eine Landesherrschaft über ein geschlossenes Territorium. So besaßen die Erzbischöfe zunächst nur verstreute Gebiete insbesondere im Norden und Osten sowie im Südwesten, die durch den Erwerb der dazwischen liegenden Grafschaft Arnsberg 1368 verbunden wurden. Die territoriale Entwicklung war nach der Soester Fehde im 15. Jahrhundert abgeschlossen, und das Territorium blieb bis zum Ende des Heiligen Römischen Reichs weitgehend unverändert."},{"page_url":"https://de.wikipedia.org/wiki/Sophie_Luck","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/SophieLuckAug2011.jpg","page_title":"Sophie Luck","context_page_description":"Sophie Luck ist eine australische Schauspielerin."},{"page_url":"https://lmo.wikipedia.org/wiki/Mossul","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Tigris_river_Mosul.jpg","page_title":"Mossul","context_page_description":"Mossul a l'è una cità in del nord de l'Iraq. \\"Mossul\\" a l'è el nom arab de l'antiga Ninive, la capital assira che l'è citada anca in de la Bibia. El sit de Ninive a l'è in sü la riva urientala del fiüm Tigri, intanta che Mossul a l'è in sü l'altra, quela ucidentala. A l'è cunsiderada la terza cità de l'Iraq, dopu de Baghdad e Bassora, cunt una stima de 450.000 abitant."},{"page_url":"https://fi.wikipedia.org/wiki/Comanthina_schlegeli","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Comanthina_schlegeli_Variable_Bushy_Feather_Star.jpg","page_title":"Comanthina schlegeli","context_page_description":"Comanthina schlegeli on hiustähti eli merililjoihin kuuluva, ulkonäöltään saniaista muistuttava piikkinahkainen eläin.\\nComanthina schlegeli muistuttaa rakenteeltaan höyhenmäisten oksien muodostamaa pensasta tai saniaista. Sen väri voi vaihdella kullankeltaisesta ruskeaan tai lähes mustaan. Haarojen lukumäärä on nuorilla yksilöillä 5 tai 10, vanhemmilla jopa 200, ja usein se pysyy viidellä jaollisena. Se käyttää oksiaan planktonin ja muun ohiajelehtivan saaliin siivilöimiseen ravinnokseen.\\nHiustähtiä myydään joskus meriakvaarioihin, mutta koska ne eivät kykene käyttämään korvikeruokia, ne nääntyvät ennen pitkää nälkään, jos eivät saa riittävästi luonnollista ravintoa. Siksi niiden pitämistä akvaarioissa ei suositella."},{"page_url":"https://it.wikipedia.org/wiki/Spizaetus_ornatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Spizaetus_ornatus_crop.png","page_title":"Spizaetus ornatus","context_page_description":"L'aquilastore ornato è un uccello accipitriforme della famiglia degli Accipitridi originario di una vasta fascia del continente americano che dal Messico sud-orientale giunge fino al nord dell'Argentina."},{"page_url":"https://fr.wikipedia.org/wiki/Armenian_Heritage_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Armenian_Heritage_Park.jpg","page_title":"Armenian Heritage Park","context_page_description":"L'Armenian Heritage Park est un parc et un mémorial dédié au génocide arménien, situé à Boston. Il constitue la treizième étape de la coulée verte Rose Fitzgerald Kennedy Greenway, entre Faneuil Hall et Christopher Columbus Park."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_villes_de_Lituanie","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/LIT_Bia%C5%82a_Waka_COA.png","page_title":"Liste des villes de Lituanie","context_page_description":"Suivant la définition de ville établie par le parlement lituanien la Lituanie compte 103 villes.\\nLes agglomérations ayant actuellement moins de 3 000 habitants, mais qui par le passé les ont eu, ont conservé le statut de ville. Les agglomérations plus petites sont appelées miestelis que l'on pourrait traduire par village ou bourgade.\\nLa plupart des villes de Lituanie ont été fondées avant le XVIIIᵉ siècle et sont de taille réduite. La population ne dépasse 20 000 habitants que pour 19 d'entre elles. Elles sont réparties de façon assez homogène. Environ les deux tiers des Lituaniens vivent en ville, proportion qui est en augmentation."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%A5%D1%83%D1%83%D1%87%D0%B8%D0%BD_%D0%91%D0%B0%D1%80%D0%B3%D0%B0_%D1%85%D0%BE%D1%88%D1%83%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/ChinaHulunbuirChenBaragqi.png","page_title":"Хуучин Барга хошуу","context_page_description":"Хуучин Барга хошуу - Бүгд Найрамдах Хятад Ард Улсын дотор Өвөр Монголын ӨЗО-ы аймгийн түвшний Хөлөнбуйр хотод харъяалагддаг хошуу.\\nНутаг дэвсгэр - 21,192 км², 2000 оны тооллогоорх хүн амын тоо - 67,882. Хошууны нутаг дотроо Баянхүрээ, Боршил, Хөхнуур гэх гурван балгас, Үзүүр, Эвэнх хоёр суманд хуваагдана. Хошууны төв болдог, захиргааны газар байрладаг нь Баянхүрээ балгас.\\nХошууны нутгаар Хайлаар гол, түүний цутгал Мэргэл гол урсдаг."},{"page_url":"https://cs.wikipedia.org/wiki/Um%C4%9Bl%C3%A9_textiln%C3%AD_vl%C3%A1kno","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/Kohlenstoff_fasern_8mm_laenge_2000dpi.jpg","page_title":"Umělé textilní vlákno","context_page_description":"Umělá vlákna jsou textilie získané chemickým výrobním postupem z přírodních nebo syntetických polymerů nebo z anorganických látek. Často se proto označují pojmem chemická vlákna."},{"page_url":"https://ca.wikipedia.org/wiki/Medicina_tradicional","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Arabic_herbal_medicine_guidebook.jpeg","page_title":"Medicina tradicional","context_page_description":"La medicina tradicional engloba el conjunt de pràctiques i tècniques utilitzades amb fins medicinals desenvolupades durant generacions en diverses societats d'arreu del món abans de l'era de la medicina moderna.\\nL'Organització Mundial de la Salut defineix les medicines tradicionals com\\n\\"la suma total del coneixement, habilitats i pràctiques basades en teories, creences i experiències originades en diferents cultures, ja sigui explicables o no, utilitzades en el manteniment de la salut, així com en la prevenció, diagnosi, millora o tractament de malalties físiques i mentals.\\""},{"page_url":"https://es.wikipedia.org/wiki/Museo_Jud%C3%ADo_de_Berl%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/JewishMuseumBerlinAerial.jpg","page_title":"Museo Judío de Berlín","context_page_description":"El Museo Judío está ubicado en la ciudad de Berlín, Alemania, y es uno de los mayores museos judíos de Europa. Muestra, a través de obras artísticas y objetos de la vida cotidiana, la historia de los judíos que viven y vivieron en Alemania durante los últimos dos mil años. El edificio que alberga el museo está diseñado por el arquitecto polaco Daniel Libeskind y fue inaugurado en 1999. El inmueble tiene las fachadas metálicas, ventanas con caprichosas formas y orientaciones, y la planta con forma de rayo. La idea principal que transmite el edificio es el vacío que han dejado los judíos berlineses desaparecidos durante el Holocausto. La Torre del Holocausto y el Jardín del Exilio son otras dos construcciones pertenecientes al museo."},{"page_url":"https://de.wikipedia.org/wiki/Cabo_de_Santo_Agostinho","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Montagem_Cabo_de_Santo_Agostinho.jpg","page_title":"Cabo de Santo Agostinho","context_page_description":"Cabo de Santo Agostinho, amtlich Município de Cabo de Santo Agostinho, ist eine Stadt im brasilianischen Bundesstaat Pernambuco und gehört zur Metropolregion von Recife."},{"page_url":"https://fr.wikipedia.org/wiki/Trogen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/TrogenAR.jpg","page_title":"Trogen","context_page_description":"Trogen est une commune suisse du canton d'Appenzell Rhodes-Extérieures."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B5%D0%B0%D0%BA%D1%86%D1%96%D1%8F_%D0%9C%D0%B0%D0%BD%D0%BD%D1%96%D1%85%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3a/Mannich_Reaction_V.1.png","page_title":"Реакція Манніха","context_page_description":"Реа́кція Ма́нніха — хімічна реакція амінометилювання сполук, що містять активний атом Гідрогену коло атома Карбону, дією формальдегіду та аміаку. Зазвичай таким сполуками є кетони, здатні до енолізації:\\nКарбоновий ланцюг вихідної CH-сполуки видовжується на одну метиленову ланку.\\nРеакцію названо за ім'ям німецького хіміка Карла Манніха. Кінцеві продукти, β-амінокарбонільні сполуки, називають основами Манніха."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%83%D1%87%D1%83%D0%BA%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Ceylon_rubber.jpg","page_title":"Каучуки","context_page_description":"Каучу́ки — натуральные или синтетические эластомеры, характеризующиеся эластичностью, водонепроницаемостью и электроизоляционными свойствами, из которых путём вулканизации получают резины и эбониты."},{"page_url":"https://sr.wikipedia.org/wiki/Renesansna_filozofija","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Aristotle_Altemps_Inv8575.jpg","page_title":"Renesansna filozofija","context_page_description":"Naziv renesansna filozofija naučnici u oblasti intelektualne istorije koriste za označavanje misaonih ostvarenja o periodu Evropske istorije između 1355. i 1650. godine. Ona se stoga preklapa s kasnosrednjovekovnom filozofijom, na koju su u četrnaestom i petnaestom veku uticale značajne ličnosti, kao što su Albert Veliki, Toma Akvinski, Vilijam Okamski i Marsilije Padovanski, i ranom modernom filozofijom, koja konvencionalno počinje sa Reneom Dekartom i njegovom publikacijom „Rasprava o metodi” iz 1637. godine\\nFilozofi obično razdvajaju period s manjom granularnošću, prelazeći iz srednjovekovne u rano modernu filozofiju, pod pretpostavkom da se vekovima nije desio radikalni pomak u perspektivi pre Dekarta. Intelekturalni istoričari, pored ideja, uzimaju u obzir i faktore kao što su izvori, pristupi, publika, jezik i književni žanrovi. Ovaj članak analizira i promene u kontekstu i sadržaju renesansne filozofije i njen izvanredan kontinuitet sa prošlošću."},{"page_url":"https://it.wikipedia.org/wiki/Classe_Type_22","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/HMS_Cornwall_F99.jpg","page_title":"Classe Type 22","context_page_description":"Le fregate lanciamissili Type 22 o Broadsword sono unità navali che hanno costituito la principale innovazione della Marina inglese negli anni ottanta, che servirono insieme ai cacciatorpediniere Type 42 rinnovando la linea di navi da combattimento e potenziando le capacità di combattimento notevolmente, ma non senza limiti e problemi di un certo livello."},{"page_url":"https://es.wikipedia.org/wiki/Villars-en-Pons","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Eglise_Villars-en-pons.JPG","page_title":"Villars-en-Pons","context_page_description":"Villars-en-Pons es una población y comuna francesa, situada en la región de Poitou-Charentes, departamento de Charente Marítimo, en el distrito de Saintes y cantón de Gémozac."},{"page_url":"https://ceb.wikipedia.org/wiki/Carir%C3%A9_(munisipyo)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/Bandeira_de_Carir%C3%A9.jpg","page_title":"Cariré (munisipyo)","context_page_description":"Munisipyo ang Cariré sa Brasil. Nahimutang ni sa estado sa Ceará, sa sidlakang bahin sa nasod, 1,500 km sa amihanan-sidlakan sa Brasília ang ulohan sa nasod. Adunay 18,348 ka molupyo. Naglangkob kin og 757 ka kilometro kwadrado.\\nAng yuta sa Cariré kay patag sa habagatang-sidlakan, apan sa amihang-kasadpan nga kini mao ang kabungtoran.\\nMga lungsod sa Cariré:\\nCariré\\nSa mosunod nga mga natural nga mga bahin makita sa Cariré:\\nPico da Onça\\nHapit nalukop sa durowan ug kabugangan ang palibot sa Cariré. Dunay mga 27 ka tawo kada kilometro kwadrado sa palibot sa Cariré medyo gamay nga populasyon. Ang klima nga savanna. Ang kasarangang giiniton 26 °C. Ang kinainitan nga bulan Oktubre, sa 32 °C, ug ang kinabugnawan Abril, sa 22 °C. Ang kasarangang pag-ulan 753 milimetro matag tuig. Ang kinabasaan nga bulan Marso, sa 177 milimetro nga ulan, ug ang kinaugahan Agosto, sa 1 milimetro."},{"page_url":"https://ca.wikipedia.org/wiki/Denominaci%C3%B3_d%27Origen_Pened%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Pened%C3%A8s_montserrat02.jpg","page_title":"Denominació d'Origen Penedès","context_page_description":"La Denominació d'Origen Penedès és la zona de major producció de Catalunya, al llarg de la comarca històrica del Penedès."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%B0%D0%BC%D0%BE%D0%BA_%D0%A1%D0%B2%D1%96%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Zamek_%C5%9Awiny_10.jpg","page_title":"Замок Свіни","context_page_description":"Замок Свіни — спершу оборонний, а з початку XVII століття житловий замок у селі Свіни у Нижньосілезькому воєводстві в Польщі, що знаходиться на Качавському Передгір'ї в Судетах, недалеко від міста Болькув.\\nЄ одним із найстаріших замків на туристичному Шляху П'ястівських Замків. За легендою, замок з'єднаний підземним переходом із замком у Болькові, розташованим за кілька кілометрів від нього."},{"page_url":"https://sl.wikipedia.org/wiki/Seznam_cerkva_v_Sloveniji_(J)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Saint_Joseph_Church%2C_Ljubljana.jpg","page_title":"Seznam cerkva v Sloveniji (J)","context_page_description":null},{"page_url":"https://nl.wikipedia.org/wiki/Klederdracht_(Nederland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Walchersche_boer.jpg","page_title":"Klederdracht (Nederland)","context_page_description":"Klederdracht of streekdracht is de traditionele kleding die in Nederlandse gemeenschappen gedragen werd door een groot deel van de bevolking. Er is een aantal dorpen en streken in Nederland waar nog dagelijks klederdracht wordt gedragen, in het algemeen alleen nog door oudere vrouwen. Alleen in Staphorst-Rouveen en in Bunschoten-Spakenburg-Eemdijk maakt klederdracht nog deel uit van het gewone straatbeeld, maar ook daar wordt het aantal mensen in dracht snel minder."},{"page_url":"https://en.wikipedia.org/wiki/Japanese_military_modernization_of_1868%E2%80%931931","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/MikadoWithFrenchMission.jpg","page_title":"Japanese military modernization of 1868–1931","context_page_description":"The modernization of the Japanese army and navy during the Meiji period and until the Mukden Incident was carried out by the newly founded national government, a military leadership that was only responsible to the Emperor, and with the help of France, Britain, and later Germany."},{"page_url":"https://en.wikipedia.org/wiki/Aer_Lingus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Aer_Lingus_Airbus_A330-302_EI-EDY_approaching_EWR_Airport.jpg","page_title":"Aer Lingus","context_page_description":"Aer Lingus is the flag carrier airline of Ireland. Founded by the Irish government, it was privatised between 2006 and 2015 and it is now a wholly owned subsidiary of International Airlines Group. The airline's head office is on the grounds of Dublin Airport in Cloghran, County Dublin.\\nFormed in 1936, Aer Lingus is a former member of the Oneworld airline alliance, which it left on 31 March 2007. After the takeover by IAG, it was expected that Aer Lingus would re-enter Oneworld, however, at a press briefing on 15 November 2017 the airline's then CEO Stephen Kavanagh stated that the airline has \\"no plans to join Oneworld\\". The airline has codeshares with Oneworld, Star Alliance and SkyTeam members, as well as interline agreements with Etihad Airways, JetBlue Airways and United Airlines. Aer Lingus has a hybrid business model, operating a mixed fare service on its European routes and full service, two-class flights on transatlantic routes.\\nRyanair owned over 29% of Aer Lingus stock and the Irish state owned over 25% before being bought out by IAG in 2015."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A0%D0%B0%D0%BA%D0%B5%D1%82%D0%B5%D0%BD_%D0%BA%D1%80%D0%B0%D0%B9%D1%86%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/USS_Belknap_%28CG-26%29_underway_in_the_Mediterranean_Sea_on_21_July_1992_%286480605%29.jpg","page_title":"Ракетен крайцер","context_page_description":"Ракетен крайцер – подклас на крайцерите, военен кораб с голяма водоизместимост, имащ многоцелево предназначение и въоръжен преимуществено с пускови установки за управляеми ракети. Широко разпространен е също и терминът крайцер УРО, в англоезичните страни съответно Guided Missile Cruiser. Следва да се отбележат особените национални класификации: в американския флот терминът „ракетен“ означава кораб, снабден със ЗРК за зонална отбрана, а в съветския/руския ВМФ приставката „ракетен“ означава наличието на противокорабен ракетен комплекс."},{"page_url":"https://vi.wikipedia.org/wiki/Batrachoseps_major","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Gardenslendersalamander.JPG","page_title":"Batrachoseps major","context_page_description":"Batrachoseps major là một loài kỳ giông trong họ Plethodontidae. Nó được tìm thấy ở miền bắc Baja California ở México và miền nam California ở Hoa Kỳ."},{"page_url":"https://eo.wikipedia.org/wiki/Espreso","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Brown_cup_of_coffee.jpg","page_title":"Espreso","context_page_description":"Espreso estas trinkaĵo el kafo, preparita pere de tralasado de varmigita kaj premita akvo tra filtro kun muelita kafo.\\nMalgraŭ variaj opinioj, enhavo de kafeino en la espreso superas ĝian enhavon en kafo preparita laŭ maniero de kuiro sur fornelo."},{"page_url":"https://de.wikipedia.org/wiki/Arbeitsgemeinschaft_ehemaliger_Abwehrangeh%C3%B6riger","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Gedenktafelcanaris.jpg","page_title":"Arbeitsgemeinschaft ehemaliger Abwehrangehöriger","context_page_description":"Die Arbeitsgemeinschaft ehemaliger Abwehrangehöriger war eine in den 1960er- und 1970er-Jahren aktive Gruppe von 14 Personen, die während der NSDAP-Diktatur in der deutschen „Abwehr“ gearbeitet hatten."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%9C%8B%E5%A0%B1%E7%B4%99%E6%89%8D%E7%9F%A5%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/%E7%B8%BD%E7%B5%B1%E8%94%A1%E8%8B%B1%E6%96%87%E8%88%87%E5%89%8D%E7%B8%BD%E7%B5%B1%E9%A6%AC%E8%8B%B1%E4%B9%9D%E6%AD%A5%E5%87%BA%E7%B8%BD%E7%B5%B1%E5%BA%9C_%2826851536660%29.jpg","page_title":"看報紙才知道","context_page_description":"看報紙才知道，或看電視才知道，是臺灣政治人物有時候會用來回應記者提問的句子，用來表示事前對某件事毫不知情。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Gem%C3%A4lde_von_%C3%89douard_Manet","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Edouard_Manet_-_Girl_in_the_Garden_at_Bellevue.JPG","page_title":"Liste der Gemälde von Édouard Manet","context_page_description":"Die Liste der Gemälde von Édouard Manet enthält das bekannte Gesamtwerk der in Öl ausgeführten Bilder des französischen Malers Édouard Manet. Nicht in dieser Liste enthalten sind die Pastelle von Édouard Manet, für die es eine gesonderte Liste gibt. Diese Trennung orientiert sich an der Aufteilung des zuletzt veröffentlichten Werkverzeichnisses der Autoren Rouart/Wildenstein aus dem Jahr 1975.\\nDie genaue Zahl der Gemälde von Édouard Manet ist nicht bekannt. Er selbst hat vor allem in den 1860er Jahren eine Reihe von Gemälden zerstört, so dass sein Frühwerk heute sicher unvollständig ist. Zudem ist bei einigen Bildern bekannt, dass er diese zerschnitten und anschließend einzelne Fragmente weiter bearbeit hat. In der nachfolgenden Liste sind diese Werke entsprechend gekennzeichnet. Ein weiteres Problem sind Werke, bei denen die Autorschaft Manets umstritten ist. Hierzu trug zunächst Manets Witwe Suzanne Manet bei, die gelegentlich Kopien von Manets Werken anfertigen ließ, um beim Verkauf von Originalen ihres Mannes Erinnerungsstücke zu behalten. Später gelangten diese Kopien teilweise als vermeintliche Originale in den Kunstmarkt."},{"page_url":"https://pl.wikipedia.org/wiki/Atlas_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Atlas_IIA.jpg","page_title":"Atlas II","context_page_description":"Atlas II – seria rakiet nośnych Atlas, wykorzystywana w latach 1991–2004 na potrzeby zarówno wojska USA, jak i do startów komercyjnych. Uważana była za jedną z najbardziej niezawodnych rakiet nośnych."},{"page_url":"https://da.wikipedia.org/wiki/Z%C3%BCrich","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Zuerich_Fraumuenster_St_Peter.jpg","page_title":"Zürich","context_page_description":"Zürich er den største by i Schweiz med sine 415.215 indbyggere. Byen er hovedstad i kanton Zürich, og ligger i naturskønne omgivelser ved Zürichsøen og gennemstrømmes af floden Limmat.\\nByens lufthavn, Zürich Lufthavn, er beliggende 13 km nord for byen, og ekspederede 24.802.466 passagerer i 2012.\\nByen har universitet, teknisk universitet, finanscentrum og tekstil-, maskin- og grafisk industri.\\nZürich var allerede en keltisk bebyggelse og havde i Romertiden et kastel og i Højmiddelalderen en borg for de tyske konger/kejsere. Byen blev i 1218 en fri rigsstad, og blev i 1351 medlem af det Schweiziske Edsforbund. Byen var i Reformationstiden et centrum for protestantisme.\\nI slutningen af det 19. og starten af det 20. århundrede var Zürich et yndet tilflugtssted for politiske flytninge fra Østeuropa; blandt andre Vladimir Lenin og Rosa Luxemburg har boet i Zürich."},{"page_url":"https://fr.wikipedia.org/wiki/Pile_%C3%A0_combustible","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Green_GT_H2_avant.jpg","page_title":"Pile à combustible","context_page_description":"Une pile à combustible est une pile dans laquelle la génération d'une tension électrique se fait grâce à l'oxydation sur une électrode d'un combustible réducteur couplée à la réduction sur l'autre électrode d'un oxydant, tel que l'oxygène de l'air."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_Saab_37_Viggen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Saab_SH_37_Viggen_37904_31_%288370473013%29.jpg","page_title":"Lista över Saab 37 Viggen","context_page_description":"Lista över Saab 37 Viggen är en sammanställning över de flygplansindivider som tillverkades av Saab 37 Viggen under åren 1972–1990. Av samtliga tillverkade individer finns ett 70-tal bevarade av både prov- och serietillverkade flygplan utställda på olika platser runt om i Sverige men även andra delar av världen. Av de bevarade individerna är en del endast framkroppen bevarad, och andra sitter på pelare vid vägar, rastplatser och flottiljer. Majoriteten av flygplanen som skrotats har demonterats i Halmstad. Flertalet av individerna har efter att de tagit ur tjänst använts som bland annat brandövningsobjekt vid flottiljerna Jämtlands flygflottilj, Västgöta flygflottilj, Skaraborgs flygflottilj, Skånska flygflottiljen, Bråvalla flygflottilj, Flygvapnets Halmstadsskolor, Hälsinge flygflottilj, Upplands flygflottilj, Blekinge flygflottilj, Norrbottens flygflottilj."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B0%D0%B2%D0%BB%D1%83%D0%B2_(%D0%A1%D1%82%D0%B0%D1%80%D0%B0%D1%85%D0%BE%D0%B2%D0%B8%D1%86%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BE%D0%B2%D1%96%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Gops_Pawlow.jpg","page_title":"Павлув (Стараховицький повіт)","context_page_description":"Павлув — село в Польщі, у гміні Павлув Стараховицького повіту Свентокшиського воєводства.\\nНаселення — 1167 осіб.\\nУ 1975-1998 роках село належало до Келецького воєводства."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%BB_%D0%9C%D0%B0%D1%80%D0%BA%D1%81_%D1%83%D1%80%D0%B0%D0%BC%D1%8B_(%D0%A3%D1%84%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/%D0%A3%D0%BB.%D0%9A.%D0%9C%D0%B0%D1%80%D0%BA%D1%81%D0%B0_17-19_%28%D0%A3%D1%84%D0%B0%29_2.jpg","page_title":"Карл Маркс урамы (Уфа)","context_page_description":"Карл Маркс урамы — Уфаның Киров, Ленин һәм Совет районнарында урнашкан урам. Алман фәлсәфәчесе Карл Маркс хөрмәтенә аталган."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9A%97%E8%8A%B1%E9%87%91%E6%8C%96%E8%80%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Carpesium_triste_1.JPG","page_title":"暗花金挖耳","context_page_description":"暗花金挖耳是菊科天名精属的植物。分布在日本、俄罗斯、朝鲜以及中国大陆的辽宁、黑龙江、吉林、云南、西藏、四川等地，生长于海拔700米至3,300米的地区，见于林下和溪边，目前尚未由人工引种栽培。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%B4%D9%8A%D9%88%D8%AE_(%D8%A7%D9%84%D8%AE%D9%84%D9%8A%D9%84)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/%D8%A8%D9%84%D8%AF%D9%8A%D8%A9_%D8%A7%D9%84%D8%B4%D9%8A%D9%88%D8%AE_%D8%AA%D8%B1%D8%AD%D8%A8_%D8%A8%D9%83%D9%85.jpg","page_title":"الشيوخ (الخليل)","context_page_description":"الشيوخ قرية فلسطينية تتبع محافظة الخليل وتقع شمال مدينة الخليل. أقيمت القرية حول قبر الشيخ إبراهيم الهدمي، وتقع الشيوخ في الشمال الشرقي من مدينة الخليل، وتبعد عنها 6 كم، وترتفع 880 م عن سطح البحر. تبلغ مساحة أراضيها دونما، ويحيط بها أراضي قرية سعير من جميع الجهات. قدر عدد سكانها عام 1922 960 نسمة، وفي عام 1945 1240 نسمة. وفي عام 1967 بلغ عدد سكانها 1800 نسمة وارتفع في عام 1987 إلى 3400 نسمة وتشير آخر الإحصاءات ان عدد اهالي القرية يقارب 8000 نسمة.\\nيوجد في القرية جامع ومقام الشيخ إبراهيم الهدمي، وبها مدارس لمختلف المراحل. صادرت سلطات الاحتلال الإسرائيلي جزءا من أراضيها وأقامت عليها مستوطنة عام 1983. تحيط بالبلدة مجموعة من الخرب التي تحتوي على مواقع أثرية أهمها: خربة أبي ريش، وخربة الربيعة، و خربة الزعفران، و خربة الجرادات، وفي أراضيها القريتان الصغيرتان: العديسة، وبيت عينون."},{"page_url":"https://en.wikipedia.org/wiki/423rd_Maryland_General_Assembly","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Nathaniel_Exum_%282007%29.jpg","page_title":"423rd Maryland General Assembly","context_page_description":"The 423rd Maryland General Assembly convened in a regular session on January 10, 2007 and adjourned sine die on April 10, 2007."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%A7%DA%A9%D8%B3%D8%A7%DA%A9%D8%A7%D9%84%DB%8C%D8%B3%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/MaxakalisaurusTopai_Rec.jpg","page_title":"ماکساکالیسور","context_page_description":"ماکساکالیسور نام یک سرده از زیرراسته سوسمارپاشکلان است."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%BA%D0%B0%D1%80%D0%BB%D0%B8%D1%81%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Espagnacarlista.jpg","page_title":"Первая карлистская война","context_page_description":"Первая карлистская война — гражданская война в Испании с 1833 по 1839 год."},{"page_url":"https://en.wikipedia.org/wiki/Grand_tourer","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Alfa_Romeo_1938_2900_B_Speciale.jpg","page_title":"Grand tourer","context_page_description":"A grand tourer is a type of sports car that is designed for high speed and long-distance driving, due to a combination of performance and luxury attributes. The most common format is a front-engine, rear-wheel-drive two-door coupé with either a two-seat or a 2+2 arrangement. Grand tourers are most often the coupé derivative of luxury saloons.\\nThe term is a near-calque from the Italian language phrase gran turismo which became popular in the English language from the 1950s, evolving from fast touring cars and streamlined closed sports cars during the 1930s."},{"page_url":"https://nl.wikipedia.org/wiki/Notre-Dame_van_Amiens","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Gisant_d%27Evrard_de_Fouilloy_Amiens_110608_3.jpg","page_title":"Notre-Dame van Amiens","context_page_description":"De Kathedrale basiliek van Onze-Lieve-Vrouw is de grootste kerk van de Franse stad Amiens, de hoofdstad van de voormalige regio Picardië. Het is de grootste gotische kathedraal van Frankrijk en behoort met die van Chartres, Reims en Bourges tot de zuiverste voorbeelden van de gotiek. Op 12 december 1854 werd zij door paus Pius IX verheven tot basiliek. Sinds 1981 staat de kathedraal op de Werelderfgoedlijst van de UNESCO.\\nDe bouw werd begonnen in 1220, nadat een oudere kathedraal door brand was verwoest. Men begon de bouw met het schip en niet, zoals gebruikelijk, met het koor. Het schip werd voltooid in 1247. Het heeft een hoogte van bijna 43 meter. In 1269 werd de kathedraal voltooid. Tussen 1292 en 1375 werd er een aantal kapellen aangebouwd tussen de steunberen van de zijschepen.\\nIn de 19e eeuw voerde Viollet-le-Duc na een lange periode van verwaarlozing een grondige restauratie door die meer dan 25 jaar in beslag nam. Deze restauratie was niet geheel zonder controverses omdat elementen aan het interieur werden toegevoegd die het middeleeuwse gebouw nooit had gekend."},{"page_url":"https://en.wikipedia.org/wiki/The_Donald_Dewar_Memorial_Debating_Tournament","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Scottish_Parliament%2C_Main_Debating_Chamber_-_geograph.org.uk_-_1650829.jpg","page_title":"The Donald Dewar Memorial Debating Tournament","context_page_description":"The Donald Dewar Memorial Debating Tournament is a national debating competition held throughout the year in Scottish Secondary Schools. It is one of the leading debating tournaments in Scotland and is organised annually by the Law Society of Scotland. It was created in 1999 and was held in order to remember the life, work and passion of Donald Dewar, the first First Minister of Scotland. Since 2006, the final of the tournament has been held in the debating chamber of The Scottish Parliament, in Edinburgh. The 2016 competition had 128 teams participating, with winners Finlay Allmond and Caitlin Sherret from Nairn Academy. Craigmount High School have won the competition a record three times- in 2007 2012, and 2014. Glasgow Academy and Robert Gordon's College are the only other schools to have won the competition more than once."},{"page_url":"https://jv.wikipedia.org/wiki/Tahu_bundher","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Tahu_bulat.jpg","page_title":"Tahu bundher","context_page_description":"Tahu bundher sing misuwur kanthi jeneng tahu bulat ya iku jajanan pinggir dalan saka olah-olahan tahu kang wujudé bundher lan njeroné kopong. Jajanan iki biasané didol limang atus sak iji. Nyamikan racaké iki didol nganggo montor bak kabuka sing surasané bak iku ana juru masak, bahan tahu, kompor lan piranti nggorèng. Biasané tahu iki dipangan karo saos utawa bubuk lombok."},{"page_url":"https://fr.wikipedia.org/wiki/Volodymyr_Bezsonov","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Volodymyr_Bezsonov.JPG","page_title":"Volodymyr Bezsonov","context_page_description":"Vladimir Vasilievitch Bessonov est un footballeur international ukrainien."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D0%B4%D0%BD%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/%D0%9F%D0%B0%D0%BC%27%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%A8%D0%B5%D0%B2%D1%87%D0%B5%D0%BD%D0%BA%D1%83_%D0%BD%D0%B0_%D0%BC%D1%96%D1%81%D1%86%D1%96_%D1%81%D1%82%D0%B0%D1%80%D0%BE%D0%B4%D0%B0%D0%B2%D0%BD%D1%8C%D0%BE%D1%97_%D0%B4%D0%B5%D1%80%D0%B5%D0%B2%60%D1%8F%D0%BD%D0%BE%D1%97_%D1%86%D0%B5%D1%80%D0%BA%D0%B2%D0%B8%2C_%D0%BF%D1%96%D0%B4_%D1%8F%D0%BA%D0%BE%D1%8E_%D0%B2%D1%96%D0%B4_%D0%BF%D0%BE%D1%87%D0%B0%D0%B2_%D0%BF%D0%B8%D1%81%D0%B0%D1%82%D0%B8_%22%D0%93%D0%B0%D0%B9%D0%B4%D0%B0%D0%BC%D0%B0%D0%BA%D1%96%D0%B2%22.jpg","page_title":"Кодня","context_page_description":"Ко́дня — село Житомирського району, Житомирської області. Розташоване на р. Коденка, притоці р. Гуйва"},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A1%E1%83%90%E1%83%AE%E1%83%90%E1%83%9A%E1%83%AE%E1%83%9D_%E1%83%92%E1%83%95%E1%83%90%E1%83%A0%E1%83%93%E1%83%98%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Gvardia7.jpg","page_title":"სახალხო გვარდია","context_page_description":"საქართველოს სახალხო გვარდია — შეიარაღებული ძალების შემადგენელი საარმიო ტიპის ფორმირება, რომელიც მოწყობილი იყო ტერიტორიული პრინციპით და ძირითადად შედგებოდა კადრირებული დანაყოფებისგან. მშვიდობიან დროს გვარდიას მართავდა გვარდიის მთავარი შტაბი, ხოლო ომის შემთხვევაში შეიარაღებული ძალების გენერალური შტაბი. გვარდია მონაწილეობდა როგორც სიმეტრიულ საომარ მოქმედებებში, ასევე ანტიპარტიზანულ და საპოლიციო ოპერაციებში. სახალხო გვარდია ძალიან მნიშვნელოვან როლს ასრულებდა წესრიგის დამყარებაში 1918-1919 წლებში და სახელმწიფო აპარატის ჩამოყალიბება დიდწილად მათი დამსახურება იყო, ამიტომ „გვარდიის ხელის ხლება საშიში იყო, გვიწევდა თვალის დახუჭვა, რადგან ის დომინირებდა სახელმწიფოში და მათ ხელში იყო დეფაქტო ძალაუფლება ქვეყანაში ... ამ პერიოდში გვარდიამ ქვეყნის შიდა ცხოვრებაში საკმაოდ მნიშვნელოვანი როლი შეასრულა. გარდა ძირითადი ამოცანისა, დაეცვა რევოლუციური მონაპოვარი, ის არაერთგზის ამყარებდა წესრიგს ქვეყანაში და ჩანასახშივე ახშობდა უწესრიგობას როგორც ხალხში, ასევე ახლადფორმირებად საარმიო დანაყოფებში, რომლებშიც რუსეთის არმიიდან დემობილიზებული ჯარისკაცების გამო, ბოლშევიკების ძლიერი გავლენა იყო. თავისი მოქმედებით ის ამყარებდა ცენტრალურ ხელისუფლებას და ეს უდაოდ მათი დამსახურებაა“."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Osterode_am_Harz","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Osterode_am_Harz%2C_Aegidienstra%C3%9Fe_19_20171103_001.jpg","page_title":"Liste der Baudenkmale in Osterode am Harz","context_page_description":"In der Liste der Baudenkmale in Osterode am Harz sind die Baudenkmale der niedersächsischen Gemeinde Osterode am Harz und ihrer Ortsteile aufgelistet. Der Stand der Liste ist 1. Mai 2020. Die Quelle der Baudenkmale ist der niedersächsische Denkmalatlas."},{"page_url":"https://bs.wikipedia.org/wiki/Spisak_rijeka_u_Bosni_i_Hercegovini","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/R%C3%ADo_Trebisnjica%2C_Bosnia_y_Herzegovina%2C_2014-04-14%2C_DD_03.jpg","page_title":"Spisak rijeka u Bosni i Hercegovini","context_page_description":"Spisak svih rijeka koje se nalaze u Bosni i Hercegovini:"},{"page_url":"https://vi.wikipedia.org/wiki/Bombycoidea","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/20_petit_paon_de_nuit.jpg","page_title":"Bombycoidea","context_page_description":"Bombycoidea là một liên họ bướm đêm, bao gồm các loài bướm tơ, bướm hoàng đế, sphinx moth và các họ hàng của chúng. Liên họ Lasiocampoidea có quan hệ gần gũi và đôi khi được sáp nhập vào nhóm này. Ấu trùng của chúng có sừng."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%A7%D9%87%D8%A7%D8%A8%D8%A7%D9%84%D9%8A%D8%B4%D9%88%D8%A7%D8%B1_%D8%B3%D8%A7%D9%8A%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Shubhankar_-_M._Sail_-_20_Feb_2018_-_1.jpg","page_title":"ماهاباليشوار سايل","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nماهاباليشوار سايل كاتب من الهند."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AA%E0%B8%AB%E0%B8%A0%E0%B8%B2%E0%B8%9E%E0%B9%82%E0%B8%97%E0%B8%A3%E0%B8%84%E0%B8%A1%E0%B8%99%E0%B8%B2%E0%B8%84%E0%B8%A1%E0%B8%A3%E0%B8%B0%E0%B8%AB%E0%B8%A7%E0%B9%88%E0%B8%B2%E0%B8%87%E0%B8%9B%E0%B8%A3%E0%B8%B0%E0%B9%80%E0%B8%97%E0%B8%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/ITU_2.jpg","page_title":"สหภาพโทรคมนาคมระหว่างประเทศ","context_page_description":"สหภาพโทรคมนาคมระหว่างประเทศ เป็นองค์การชำนัญพิเศษของสหประชาชาติ ซึ่งนับเป็นองค์การสากลที่เก่าแก่มากที่สุดอันดับสอง ที่ยังคงดำเนินการอยู่ โดยในระยะแรกเริ่ม ใช้ชื่อว่า สหภาพโทรเลขระหว่างประเทศ จัดตั้งขึ้นที่กรุงปารีส ประเทศฝรั่งเศส เมื่อวันที่ 17 พฤษภาคม ค.ศ. 1865 ปัจจุบัน มีสำนักงานใหญ่ตั้งอยู่ที่ นครเจนีวา ประเทศสวิสเซอร์แลนด์ ใกล้กับสำนักงานสหประชาชาติ\\nสหภาพโทรคมนาคมระหว่างประเทศมีหน้าที่ในการพัฒนามาตรฐาน และกฎระเบียบ สำหรับการสื่อสารวิทยุ และโทรคมนาคมระหว่างประเทศ การกำหนดแถบคลื่นความถี่วิทยุ และบริหารจัดการ กรณีที่จำเป็นสำหรับการเชื่อมโยงโครงข่ายระหว่างประเทศ เช่น บริการโทรศัพท์ระหว่างประเทศ อันเป็นภารกิจในเชิงโทรคมนาคม ในลักษณะเดียวกับการปฏิบัติงานของสหภาพสากลไปรษณีย์ ในกรณีของงานบริการไปรษณีย์"},{"page_url":"https://he.wikipedia.org/wiki/%D7%91%D7%A1%D7%98%D7%90%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Bastei_%282%29.jpg","page_title":"בסטאי","context_page_description":"בסטאי הוא אתר טבע של תצורת סלעים המתנשאים לגובה 194 מטר מעל נהר אלבה, 35 ק\\"מ דרומית-מזרחית לדרזדן. השם הוא מהמילה Bastion בגלל הסלעים הזקופים כמבצר ובגלל מבצר קטן שהיה במקום ושרידיו נראים עד היום.\\nהסלעים נוצרו לפני כמיליון שנה כתוצאה משינויים טקטונים ומארוזיה.\\nהאתר נמצא בתוך שמורת טבע גדולה הנקראת \\"סקסוניה השווייצרית\\" הנמשכת גם מעבר לגבול עם צ'כיה ונקראת שם \\"בוהמיה השווייצרית\\".\\nבסטאי משמש כ-אטרקציה תיירותית למעלה מ-200 שנים. ב-1824 נבנה גשר עץ המחבר בין מספר סלעים לנוחיות המבקרים. ב-1851 הוא הוחלף בגשר אבן.\\nהסלעים סובלים מתהליכי בליה. ב-22 בנובמבר 2000 נבקע סלע גדול הנקרא Wartturm ושליש ממנו, במשקל 800 טון, צנח לתוך עמק האלבה. במזל לא היו נפגעים. הסלע הזה נצפה מאחת מנקודות התצפית בבסטאי.\\nמנקודות התצפית על הסלעים ניתן לצפות על עיקול האלבה והר Lilienstein. שני אלמנטים אלה מהווים את הסמליל של שמורת סקסוניה השווייצרית.\\nמאז איחוד גרמניה פותח המקום, נעשה יותר נגיש והוא נחשב לאטרקציה תיירותית פופולרית. הכניסה לאתר חופשית."},{"page_url":"https://simple.wikipedia.org/wiki/V%C3%A4ster%C3%A5s_Cathedral","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/V%C3%A4ster%C3%A5s_domkyrka1001.jpg","page_title":"Västerås Cathedral","context_page_description":"Västerås Cathedral is a cathedral in the town of Västerås in Sweden. Belonging to Västerås Cathedral Parish of the Church of Sweden, it serves the Diocese of Västerås, and was opened in the 13th century."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2-18","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/%D0%A2%D0%B0%D0%BD%D0%BA_%D0%9C%D0%A1-1.jpg","page_title":"Т-18","context_page_description":"Т-18 — советский лёгкий танк непосредственной поддержки пехоты 1920-х годов. Создан в 1925—1927 годах. Стал первым танком советской разработки. Серийно производился с 1928 по 1931 год, всего в нескольких вариантах было выпущено 959 танков этого типа, не считая прототипа. В конце 1920-х — начале 1930-х годов Т-18 составлял основу танкового парка РККА, но довольно быстро был вытеснен более совершенным Т-26. Применялся в бою в конфликте на КВЖД, но в 1938—1939 годах устаревшие и достигшие крайней степени износа Т-18 были в основном сняты с вооружения или использовались как неподвижные огневые точки. В незначительном количестве использовались на начальном этапе Великой Отечественной войны."},{"page_url":"https://fr.wikipedia.org/wiki/Project_Genoa","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Genoa_Project.gif","page_title":"Project Genoa","context_page_description":"Project Genoa, système logiciel réalisé à la demande de DARPA, a servi à analyser de grandes quantités de données et métadonnées dans le but de soutenir les analystes humains dans la lutte au terrorisme par les États-Unis. Il est remplacé par Genoa II."},{"page_url":"https://ca.wikipedia.org/wiki/Piper_PA-28_Cherokee","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/PiperPA-28-236DakotaC-GGFSPhoto4.JPG","page_title":"Piper PA-28 Cherokee","context_page_description":"El Piper PA-28 Cherokee és un model d'avioneta de la companyia Piper Aircraft dissenyat l'entrenament en vol, aerotaxi i ús personal.\\nTotes les versions del PA-28 són dissenys de construcció completament metàl·lica, amb fuselatge sense pressurització i propulsió per un sol motor. Tenen una configuració d'ala baixa amb tren d'aterratge tricicle i 4 places. Tots disposen d'una sola porta, pel cantó del copilot, a la que s'accedeix pujant sobre l'ala."},{"page_url":"https://no.wikipedia.org/wiki/Boris_Gromov","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ce/Gromov_boris_8.06.2010.jpg","page_title":"Boris Gromov","context_page_description":"Boris Gromov er en russisk general og politiker. Under den afghansk-sovjetiske krig i Afghanistan kommanderte Gromov de sovjetiske styrkene, og han skal ha vært den siste sovjetiske soldaten som forlot Afghanistan da Sovjetunionen trakk seg ut i februar 1989. Han var guvernør av Moskva oblast siden 2000, og som visepresidentkandidat for kommunistpartiet i valget i 1991. Ved valget i 1995 ble han valgt inn til Statsdumaen, underhuset i Russlands parlament."},{"page_url":"https://it.wikipedia.org/wiki/Governatorato_di_Erivan","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/Erivangub.png","page_title":"Governatorato di Erivan","context_page_description":"La Gubernija di Erivan, in russo: Эриванская губерния era una Gubernija dell'Impero Russo, che si occupava il territorio delle attuali Armenia, Repubblica Autonoma di Nakhchivan e Provincia di Iğdır, una provincia della Turchia. Istituita nel 1849, esistette fino al 1917. Il suo capoluogo era Erivan."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%95%B7%E7%99%BC%E9%82%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Cheung_Fat_Estate_201408.jpg","page_title":"長發邨","context_page_description":"長發邨，是香港的一個公共屋邨，位於新界青衣島北面，本屬長安邨的一部份，因屋邨管理上的需要，於1986年把施工中的第11至15座樓宇從長安邨分拆出來，且易名為長發邨。\\n長發邨於1989年開始入伙，亦是26座問題公屋醜聞中葵青區受影響屋邨居民的其中一個次要安置屋邨，其後於2005年9月1日起在租者置其屋計劃把單位出售給所屬租戶。現時的管理公司是佳定物業管理有限公司。\\n青雅苑本屬長安邨第12座，於1989年4月被房委會列入第十一期甲居者有其屋計劃發售，同年11月30日入伙。"},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%AE%E1%83%90%E1%83%9C%E1%83%98%E1%83%90_(%E1%83%A5%E1%83%90%E1%83%9A%E1%83%90%E1%83%A5%E1%83%98)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Chania_-_Venetian_harbor_1.jpg","page_title":"ხანია (ქალაქი)","context_page_description":"ხანია – ქალაქი საბერძნეთში, კუნძულ კრეტაზე. იგი მოსახლეობის რიცხვით მეორეა კუნძულზე. ხანიას ნომის ადმინისტრაციული ცენტრი. ეგეოსის ზღვის პორტი."},{"page_url":"https://hu.wikipedia.org/wiki/Brass%C3%B3-belv%C3%A1rosi_r%C3%B3mai_katolikus_templom","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/20140627_Bra%C5%9Fov_052.jpg","page_title":"Brassó-belvárosi római katolikus templom","context_page_description":"A Brassó-belvárosi Szent Péter és Szent Pál apostolok római katolikus plébániatemplom a Kolostor utca 21. szám alatt áll. A barokk templomot 1776 és 1782 között építették, Karl Joseph Lamasch tervei alapján. Helyén a középkorban a helyi domonkos kolostor temploma állt. A reformáció után a magyar evangélikusoké, majd reformátusoké volt, és a fejedelmek mindig ebbe a templomba jártak, ha Brassóban szálltak meg. Miután Erdély a Habsburg Birodalom tartománya lett, a templom visszakerült a katolikusokhoz. 1766-ban lebontották és a helyén építették fel a mai templomot; mellette a 19. szám alatti plébániahivatal épülete a templommal egy időben épült."},{"page_url":"https://vec.wikipedia.org/wiki/Le_Tholonet","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Moulin_Cezanne_20100206_2.jpg","page_title":"Le Tholonet","context_page_description":"Le Tholonet el xé on comun de 2 305 abitanti del departemento de Bouches-du-Rhône che el fa parte del rejon Provensa-Alpe-Costa Axura in Fransa."},{"page_url":"https://fr.wikipedia.org/wiki/R%C3%A9gime_g%C3%A9n%C3%A9ral_des_transports_routiers","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Autobus_bei_der_Gare_Rodange.jpg","page_title":"Régime général des transports routiers","context_page_description":"Le Régime général des transports routiers est un système de transports en commun interurbain opérant dans le Grand-Duché de Luxembourg, placé sous l'autorité du ministère de la Mobilité et des Travaux publics de ce même État.\\nCréé en 1978, il unifie les différentes lignes de transport routier interurbain au Luxembourg depuis cette date, et ce d'autant plus depuis l'intégration du service d'autobus des CFL en 1996.\\nLe réseau est constitué début 2018 de 342 lignes dont 139 lignes scolaires et 39 à destination des zones d'activités. Les lignes scolaires intégrées au réseau sont celles assurant le transport scolaire vers les établissements de l'enseignement secondaire, en revanche le transport scolaire des établissements de l'enseignement fondamental est du ressort des communes."},{"page_url":"https://br.wikipedia.org/wiki/Fernando_VII_(Spagn)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Fernando_VII_-_Vicente_L%C3%B3pez.jpg","page_title":"Fernando VII (Spagn)","context_page_description":"Fernando VII, lesanvet el Deseado pe el Rey Felón a voe roue Spagn dre ziv wech: adalek Meurzh betek Mae 1808, ha goude skarzhet ar «rey intruso» José Iañ Bonaparte, adal Kerzu 1813 betek e varv, war-bouez ur pennadig e 1823, pa voe diroueet gant Kuzul ar Rejañs."},{"page_url":"https://az.wikipedia.org/wiki/Sarua_g%C3%B6l%C3%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Relief_Map_of_Bashkortostan.jpg","page_title":"Sarua gölü","context_page_description":"Sarua gölü — Başqırdıstanın Nuriman rayonu, Sarva kəndi ərazisində yerləşən göl. 1956-cı ildən təbiət abidəsi elan edilmişdir. Göl Saldıbaş çayının hövzəsində yerləşir. Gölün şərqi hündür və meşə ilə örtülü olsa da, qərbi düzən və meşəsizdir. Göldə Başqırdıstan və Rusiyanın qırmızı kitabına salınmış Avropa xariusu adlı balıq yaşayır."},{"page_url":"https://fi.wikipedia.org/wiki/Nissan_Wingroad","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Y11_Familia_Van.jpg","page_title":"Nissan Wingroad","context_page_description":"Nissan Wingroad / AD on Nissanin vuodesta 1982 lähtien valmistama keskiluokan farmariauto. Nissan AD on tavarankuljetukseen tarkoitettu malli, kun taas Wingroad on paremmin varusteltu henkilöautoversio. Malleja on markkinoitu lukuisilla eri nimillä, ja esimerkiksi Euroopassa myyty Sunny N14 -mallin farmariversio on todellisuudessa uudelleennimetty AD."},{"page_url":"https://es.wikipedia.org/wiki/Mariano_I_de_Torres","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Mariano1.jpg","page_title":"Mariano I de Torres","context_page_description":"Mariano I fue juez de Logudoro desde 1073, cuando es mencionado por primera vez tras su padre o abuelo Barisono I, hasta alrededor de 1082, cuando es mencionado por última vez. Su gobierno es un tanto desconocido y el siguiente juez nombrado es su hijo Constantino I en 1112, pero parece innecesario atribuir a Mariano un gobierno de 39 años y es probable la presencia de otros jueces desconocidos entre Mariano y Constantino.\\nEn 1147 el nieto de Mariano, Gonario II, hizo una donación de plata a la abadía de Montecassino, citando a su padre y a su nieto como principales donantes. Quizás este Mariano era otro diferente del que recibió una carta del papa Gregorio VII en 1073. Asimismo, la Cronaca sarda establece a Mariano como el hijo de Andrés Tanca. La identidad y relación exactas de este juez son discutidas.\\nMariano no solo realizó una donación a Montecassino, sino que benefició a las iglesias locales también y pagaba una suma anual al papa. Era aliado de la república de Pisa."},{"page_url":"https://la.wikipedia.org/wiki/Granges-la-Ville","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fa/Map_commune_FR_insee_code_70276.png","page_title":"Granges-la-Ville","context_page_description":"Granges-la-Ville est commune Francicum 214 incolarum praefecturae Araris Superioris in regione Libero Comitatu."},{"page_url":"https://en.wikipedia.org/wiki/Forte_de_Santa_Catarina","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Panor%C3%A2mica_da_Fortaleza_de_Santa_Catarina.JPG","page_title":"Forte de Santa Catarina","context_page_description":"Forte de Santa Catarina is a fort located in Cabedelo, Paraíba in Brazil."},{"page_url":"https://en.wikipedia.org/wiki/Lola_B08/80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Speedy_Sebah_Lola.jpg","page_title":"Lola B08/80","context_page_description":"The Lola B08/80 is a Le Mans Prototype built by Lola Cars International. It is effectively the LMP2 version of the larger Lola B08/60; they are the first closed-cockpit sports prototypes built by Lola since the T92/10 of 1992. The B08/80 is optimised for the smaller engines and lighter weight of the LMP2 category in comparison to the larger and heavier B08/60.\\nThe first chassis of the B08/80 is used by the joint Speedy Racing Team and Sebah Automotive outfits in the Le Mans Series as well as at 24 Hours of Le Mans. The team's car uses the latest V8 engine from Judd. A second car was entered by B-K Motorsports and Mazda in the American Le Mans Series, debuting at the Petit Le Mans in October 2008, while a third B08/80 chassis was sold to Ray Mallock Ltd. and completed with parts from the team's former B05/40 to create the MG-Lola EX265C for the Le Mans Series. B-K Motorsports closed shop in late 2008 and sold their car to Dyson Racing. 2009 LMS season saw the B08/80 being the 2nd fastest LMP2, behind the Essex Porsche."},{"page_url":"https://es.wikipedia.org/wiki/Shinmabyu_kyun","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Shah_Porir_Island_03.jpg","page_title":"Shinmabyu kyun","context_page_description":"Shinmabyu kyun​ también llamada Shapura o Shapuree​​ es el nombre de una isla que está situada en la desembocadura del río Naf, una frontera marítima entre Bangladés y Birmania. Históricamente, se considera que la posesión de la isla fue una de las causas inmediatas de la primera Guerra Anglo-birmana.​"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%83%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B5_%D1%8F%D0%B7%D1%8B%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Tukano_Languages.png","page_title":"Туканские языки","context_page_description":"Туканские языки, или языки тукано — языковая семья индейских языков Южной Америки.\\nТуканские языки достаточно близки между собой, для них характерно большое количество когнатов и наличие схожей грамматики."},{"page_url":"https://eo.wikipedia.org/wiki/Eltzer_Fehde","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/20060915_eltzer_fehde_karte.jpg","page_title":"Eltzer Fehde","context_page_description":"Eltzer Fehde aŭ ’’’kvereloj de Eltz’’’ ekestis en la jaro 1331 kiam la Trevira Ĉefepiskopo kaj princelektisto Balduin de Luksemburgo volis konkeri la regnajn kavalirojn de la burgoj Ehrenburg, Eltz, Schöneck kaj Waldeck La malproksimeco kaj la malfortaj antaŭaj episkipoj toleris la pligrandiĝantan potencon de la kavaliroj, kvankam ili jam estis vasaloj de la Trevira episkopo. Balduin tamen provis starigi sian pretendon pri regnado per la konstruo de kontraŭburgoj Rauschenburg kaj Trutzeltz. De tie li malhelpis al la kunlaboro de la kavaliroj. La celo de Balduin ne estis la pereo de la kavaliroj, sed la respekto al li kiel suvereno. 1336/37 la kverelo finiĝis per la venko de Kurtrier kaj la malvenkintoj devis pagi alten rekompenson. Dum la sieĝado okazis la unua dokumentita uzo de fajroarmiloj en Germanio. Oni uzis sagpafilon ĉe la burgo Eltz."},{"page_url":"https://sv.wikipedia.org/wiki/Trachinops_brauni","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Trachinops_brauni_Bluelined_hulafish_PC269928.JPG","page_title":"Trachinops brauni","context_page_description":"Trachinops brauni är en fiskart som beskrevs av Allen, 1977. Trachinops brauni ingår i släktet Trachinops och familjen Plesiopidae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%90%A8%E5%85%B0%E8%BE%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Harbour_of_Saranda%2C_Albania_2016.jpg","page_title":"萨兰达","context_page_description":"萨兰达是位于阿尔巴尼亚南部的一个沿海城市，属夫罗勒州萨兰达区一部分。萨兰达是阿尔巴尼亚全国最重要的旅游城市之一，其附近的文化古城布特林特被列入世界文化遗产名录之中。萨兰达也是阿尔巴尼亚重要的港口。在2001年阿尔巴尼亚全国的人口普查中，达特福区居住人口有85,911人。2008年，萨兰达居住人口有32000人。萨兰达有着多样的植物品种，因此也是阿尔巴尼亚重要的疗养度假都市。随着近年到访萨兰达的游客数量持续上升，萨兰达沿海岸线一带的度假旅馆、民宿、酒店数量也不断增加。进入21世纪初期后，许多新人选择在萨兰达进行新婚旅行，萨兰达也因此是一座蜜月旅行都市。现在萨兰达的观光产业取得了巨大的发展。萨兰达的主要产业是观光业。现时萨兰达的服务业、渔业、建造业等产业也很发达。自2012年起，萨兰达港口的规模得到了扩大。"},{"page_url":"https://pl.wikipedia.org/wiki/Myrina_(Azja_Mniejsza)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Atene_o_mirina%2C_statuette_di_danzatrici_e_suonatrici%2C_IV-II_sec_ac._01.JPG","page_title":"Myrina (Azja Mniejsza)","context_page_description":"Myrina – w starożytności niewielkie portowe miasto greckie w małoazjatyckiej Eolidzie nad Zatoką Eleacką, usytuowane na prawym brzegu u ujścia rzeki Pithikos.\\nHerodot wymienia je wśród 11 miast eolskich; w źródłach antycznych wspominane też m.in. przez Ksenofonta, Tacyta, Liwiusza."},{"page_url":"https://es.wikipedia.org/wiki/Bella_(Italia)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Map_of_comune_of_Bella_%28province_of_Potenza%2C_region_Basilicata%2C_Italy%29.svg","page_title":"Bella (Italia)","context_page_description":"Bella es un municipio situado en el territorio de la provincia de Potenza, en Basilicata, (Italia)."},{"page_url":"https://cs.wikipedia.org/wiki/David_Hume_Kennerly","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/David_Hume_Kennerly_13873-108_%28cropped%29.jpg","page_title":"David Hume Kennerly","context_page_description":"David Hume Kennerly je americký fotograf a fotožurnalista. V roce 1972 získal Pulitzerovu cenu za portfolio fotografií vietnamské války, Kambodže, uprchlíků z východního Pákistánu poblíž Kalkaty a boxerský zápas Ali vs Joe Frazier v Madison Square Garden 8. března 1971. Je bývalý hlavní oficiální fotograf Bílého domu během prezidentství Geralda Forda v období 1974–1977."},{"page_url":"https://en.wikipedia.org/wiki/Grand_Hotel_Kronenhof","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Grand_Hotel_Kronenhof_Winter.jpg","page_title":"Grand Hotel Kronenhof","context_page_description":"The Grand Hotel Kronenhof is an historic five-star Belle Epoque-era Grand Hotel in Pontresina, Upper Engadin, Switzerland.\\nThe hotel is situated in the Laret quarter of the village, adjacent to the San Niculò protestant church, and is included in the Swiss Inventory of Cultural Property of National and Regional Significance.\\nFor over 140 years, the hotel was owned by its founding family, the Gredigs."},{"page_url":"https://sv.wikipedia.org/wiki/Lac_Saint-Louis","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/L%C3%A9ry001.JPG","page_title":"Lac Saint-Louis","context_page_description":"Lac Saint-Louis är en sjö i sydvästra Québec, Kanada, vid sammanflödet av Saint Lawrencefloden och Ottawafloden. Saint Lawrenceleden passerar genom sjön. Det finns många fiskarter i sjön, bland andra gul abborre."},{"page_url":"https://en.wikipedia.org/wiki/Ram_pickup","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Ram_Pickup_plug-in_hybrid_WAS_2011_1199.JPG","page_title":"Ram pickup","context_page_description":"The Ram pickup is a full-size pickup truck manufactured by FCA US LLC and marketed from 2010 onwards under the Ram Trucks brand. The current fifth-generation Ram debuted at the 2018 North American International Auto Show in Detroit, Michigan, in January of that year.\\nPreviously, Ram was part of the Dodge line of light trucks. The name Ram was first used in 1981 model year Dodge Trucks in October 1980, following the retiring and rebadging of the Dodge D Series pickup trucks as well as B-series vans, though the company had used a ram's-head hood ornament on some trucks as early as 1933.\\nRam trucks have been named Motor Trend magazine's Truck of the Year seven times; the second-generation Ram won the award in 1994, the third-generation Ram heavy duty won the award in 2003, the fourth-generation Ram Heavy Duty won in 2010 and the fourth-generation Ram 1500 won in 2013 and 2014, and the current fifth-generation Ram 1500 won in 2019 and 2020."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E9%BD%8B%E6%BB%B7%E5%91%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Vegetarian_mock_meat_take-out_counter.JPG","page_title":"齋滷味","context_page_description":"斋卤味是一种素食，一般有“酸斋”、“豉油斋”和“咖喱斋”的口味。外形造成“斋鸡”、“斋鲍鱼”、“斋叉烧”及“斋鸭肾”等不同的质感和形态，其实这些卤味的主要成分皆是面筋配合不同的酱汁所做成。\\n酸斋的红色往往是使用人工合成的食用色素E110，豉油斋和咖喱斋则可能加入E621，即是谷氨酸盐增味剂。日落黄在挪威和芬兰已经被禁止使用，亦有组织催促美国食品药品监督管理局禁止日落黄的使用，因为该物质可能对儿童的行为及专注力有不良影响。\\n斋卤味在香港的传统素食餐馆都有供应，市民也会外卖回家佐膳。但是，必须注意不能让这类食物在室温下长时间摆放，否则会滋生细菌，导致细菌性食物中毒。"},{"page_url":"https://nl.wikipedia.org/wiki/Station_Iwashimizu-hachimangu","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Keihan_Iwashimizu-Hachimangu_Station.jpg","page_title":"Station Iwashimizu-hachimangu","context_page_description":"Station Iwashimizu-hachimangu is een spoorwegstation in de Japanse stad Yawata. Het wordt aangedaan door de Keihan-lijn en de Otokoyama-kabelbaan. Het station heeft drie sporen, gelegen aan één eilandperron en een enkel zijperron. De enkelsporige kabelbaan kent twee ongenummerde zijperrons welke buiten het treinstation liggen."},{"page_url":"https://simple.wikipedia.org/wiki/Caterpillar","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Chenille_de_Grand_porte_queue_%28macaon%29_Fausses_pattes.jpg","page_title":"Caterpillar","context_page_description":"A caterpillar is a young butterfly or moth that has just hatched out of its egg. A caterpillar is a kind of larva. When it is older, the caterpillar will turn into a pupa, and then later the pupa will turn into a butterfly.\\nCaterpillars usually have three pairs of small, but noticeable, true legs at the front and up to 5 pairs of fleshy false legs at the back.\\nCaterpillars are commonly found feeding on leaves, but they are also found inside living stems and branches or on the roots of plants and dead wood.\\nMost caterpillars are shades of green or brown and are relatively hairless, although in many families caterpillars are very hairy and often brightly coloured. Some species are pests of growing plants, carpets, woollens, organic fabrics and stored food products.\\nCaterpillars are an important source of food for birds and other invertebrates and many species help dead animals and plants decompose."},{"page_url":"https://nl.wikipedia.org/wiki/Muszyna","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Panorama_Muszyny.jpg","page_title":"Muszyna","context_page_description":"Muszyna is een stad in het Poolse woiwodschap Klein-Polen, slechts enkele kilometers van de Slowaakse, gelegen in de powiat Nowosądecki grens. De oppervlakte bedraagt 23,96 km², het inwonertal 4975.\\nMuszyna werd voor het eerst vermeld in 1209. In de directe omgeving van Muszyna bevinden zich minerale bronnen, waardoor de plaats een zekere naam als kuuroord verwierf. De componist Zbigniew Bujarski en de dichter Adam Ziemianin zijn geboren in Muszyna."},{"page_url":"https://it.wikipedia.org/wiki/Convento_greco-ortodosso_di_Nostra_Signora_di_Seidnaya","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Sednaya_Mary.jpg","page_title":"Convento greco-ortodosso di Nostra Signora di Seidnaya","context_page_description":"Il Convento greco-ortodosso di Nostra Signora di Seidnaya fu fondato dall'imperatore bizantino Giustiniano I nel VI secolo."},{"page_url":"https://fr.wikipedia.org/wiki/Char_lourd_M103","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/M103_USMC.jpg","page_title":"Char lourd M103","context_page_description":"Le M103 était un char lourd américain développé à la suite du blocus de Berlin en 1948, afin d'appuyer les M48 Patton en cas de conflit armé avec l'Union des républiques socialistes soviétiques.\\nLe M103 fut déployé en 1954 et fut retiré du service actif en 1974."},{"page_url":"https://es.wikipedia.org/wiki/Sistema_de_nomenclatura_de_fusi%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Excepciones_a_la_numeraci%C3%B3n_de_sistemas_fusionados.png","page_title":"Sistema de nomenclatura de fusión","context_page_description":"La nomenclatura de fusión o Nomenclatura de hidrocarburos policíclicos fusionados es un método que sirve para nombrar estructuras orgánicas denominados policiclos fusionados. Los sistemas de anillos policíclicos fusionados son aquellos en donde al menos dos ciclos comparten un enlace y dos carbonos.​​\\nExisten dos tipos de fusión:\\nAquella en la que por cada dos anillos adyacentes tiene dos y sólo dos átomos y un enlace común. Esta fusión se denomina orto. Dichos sistemas tienen n lados comunes y 2n átomos comunes.\\nAquella en la que además de presentarse una fusión orto simple, contiene otro anillo fusionado con dos enlaces y tres átomos en común. Este sistema se denomina orto-peri fusionado. Dichos sistemas cíclicos tienen n lados comunes y menos de 2n átomos comunes."},{"page_url":"https://war.wikipedia.org/wiki/Pseudicius","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Pseudicius_sp.1_male_Hong_Kong_laterodorsal.jpg","page_title":"Pseudicius","context_page_description":"An Pseudicius in uska genus han Araneae. An Pseudicius in nahilalakip ha familia nga Salticidae."},{"page_url":"https://hu.wikipedia.org/wiki/Kurganyec%E2%80%9325","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/4mayrehearsal_17.jpg","page_title":"Kurganyec–25","context_page_description":"A Kurganyec–25 orosz 25 tonnás, univerzális lánctalpas harcjármű, amely a tervek szerint többféle fegyverrendszer – gyalogsági harcárművek, deszant-harcjárművek és egyéb önjáró fegyverek – alvázául szolgál a jövőben. Sorozatgyártása várhatóan 2016 elején kezdődik el."},{"page_url":"https://bg.wikipedia.org/wiki/Epinephelus_cyanopodus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Epinephelus_cyanopodus_JNC1902.JPG","page_title":"Epinephelus cyanopodus","context_page_description":"Epinephelus cyanopodus е вид бодлоперка от семейство Serranidae. Видът не е застрашен от изчезване."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%A1%80%E6%A0%93%E7%B4%A0","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Thromboxane_B2.svg","page_title":"血栓素","context_page_description":"血栓素又稱凝血噁烷，是一類花生四烯類激素。兩種主要的血栓素為血栓素A2和血栓素B2。"},{"page_url":"https://gl.wikipedia.org/wiki/Tibur%C3%B3n_balea","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Whaleshark_scale.jpg","page_title":"Tiburón balea","context_page_description":"O tiburón balea, Rhincodon typus, é unha especie de peixe cartilaxinoso elasmobranquio da orde dos orectolobiformes, único membro da familia dos rincodóntidos e do xénero Rhincodon.\\nÉ o peixe máis grande do mundo, que pode excepcionalmente alcanzar os 20 m de longo e un peso de 34 t. Porén, o tamaño dos espécimes observados está en xeral comprendido entre os 4 e os 14 m de lonxitude.\\nMasivo, desprázase lentamente por augas cálidas e temperadas de todos os mares abertos e océanos. Desprovisto de agresividade, este tiburón é totalmente inofensivo para o home; a semellanza da balea azul, o seu equivalente entre os mamíferos da megafauna mariña, este xigante dos mares aliméntase principalmente de plancto, é dicir, de algas e animais microscópicos que absorbe pola súa ancha boca.\\nEstímase que pode vivir entre 100 e 150 anos, aínda que o máis vello espécime recollido tiña ao redor de 70 anos de idade.\\nEstímase que habita na Terra desde o paleoceno, hai sesenta millóns de anos.\\nAínda que no hai datos precisos sobre o total da súa poboación actual, a especie considérase como vulnerábel."},{"page_url":"https://fr.wikipedia.org/wiki/Ateliers_de_la_Dyle","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/MSvB_5025_front.JPG","page_title":"Ateliers de la Dyle","context_page_description":"Les Ateliers de la Dyle furent fondés en 1866 sous le nom de Société en Commandite A. Durieux et Cie par Aimé Durieux et Louis Bosmans à Louvain.\\nSpécialisée dans les constructions métalliques, cette société construisait du matériel de voie et du matériel roulant ferroviaire et tramviaire, du matériel de manutention et des ouvrages de génie civil.\\nL'une de leurs productions emblématiques fut la charpente des serres royales de Laeken"},{"page_url":"https://eo.wikipedia.org/wiki/Benno_Elkan","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Legros_-buste_de_Rodin_%28dessin%29.jpg","page_title":"Benno Elkan","context_page_description":"Benno ELKAN estis germana juda skulptisto, kiu kreis la grandan sepbrakan kandelingon, nomatan menoro, antaŭ la israela parlamentejo Kneset en Jerusalemo kaj multnombrajn pliajn monumentojn, bustojn kaj medalojn en Germanio kaj Britio. Li honoriĝis per la Ordeno de la Brita Imperio.\\nBenno Elkan komencis sian artan skulptistan laboron en sia hejma urbo Dortmund per la kreo de tombomonumentoj. Pli poste li portretis armeestrojn, politikistojn, sciencistojn kaj artistojn, ĉefe el Germanio, Francio kaj Britio, per bustoj kaj medaloj. Pro sia judeco li ekde la jaro 1935 ne plu rajtis profesie labori en Nazia Germanio kaj elmigris al Londono. En Germanio li rekonatiĝis en la 1950-aj jaroj, kiam liaj verkoj montriĝis en pluraj ekspozicioj. Lia kreado ne ligeblas al certa arta stilo, li eksperimentis pri pluraj."},{"page_url":"https://en.wikipedia.org/wiki/Morton_Bagot","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Morton_Bagot_Holy_Trinity_East_Window_t_017.jpg","page_title":"Morton Bagot","context_page_description":"Morton Bagot is a small village in the Stratford-on-Avon district of Warwickshire, England. The population from the 2011 Census is included within Redditch. It lies about 1.5 miles east of the Birmingham-Alcester road, the modern A435 and Roman Ryknild Street, 6.5 miles north of Alcester, 9.5 miles from Stratford upon Avon and 12 miles from Warwick, across the valley of a small brook, flowing south-east to join the River Arrow. A road from Oldberrow to Spernall runs north and south through the middle of the parish of Morton Bagot, Oldberrow and Spernall, past the church.\\nThe name means the settlement of the moor, the Bagot element coming from the name of the lords of the Manor who added their name when they came into possession during the reign of Henry II.\\nThe elevation varies from 200 feet to 400 feet, the highest point being at Bannum's Wood.There is no main village and there has been considerable depopulation here since the 18th century. In 2001 the whole parish had a population of 153."},{"page_url":"https://ca.wikipedia.org/wiki/Alpini","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Alpini_ISAF.jpg","page_title":"Alpini","context_page_description":"Els Alpini són una especialitat d'infanteria de l'Exèrcit italià."},{"page_url":"https://en.wikipedia.org/wiki/Stanley_family","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Coat_of_Arms_of_Sir_Thomas_Stanley%2C_1st_Baron_Stanley%2C_KG.png","page_title":"Stanley family","context_page_description":"The Stanley family is an English family with many notable members, including the Earls of Derby and the Barons Audley who descended from the early holders of Audley, Staffordshire. The Audley family in the male line lost prominence after its considerable estates were passed by a number of female heiresses in different branches of the family.\\nThe use of \\"Stanley\\" as a first name began with political followers of the family."},{"page_url":"https://cs.wikipedia.org/wiki/Houba_kom%C3%ADnov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Aplysina_aerophoba_1346.JPG","page_title":"Houba komínová","context_page_description":"Houba komínová je mořská houba žijící ve Středozemním moři a při pobřeží Afriky od Kapverd po Kanárské ostrovy a západní část Guinejského zálivu. Vytváří širokou bázi, ze které vyrůstají nepravidelné komínovité výběžky s plochým vrcholem, na kterém ústí osculum. Výběžky jsou 3–4 cm vysoké a mají 1 - 2,5 cm v průměru. Na omak je houba slizká, gumové konzistence. Celý živočich je jasně žlutý.\\nHouba komínová má leukonový typ těla, zpevněný sponginovou síťovitou kostrou. Jehlice sponginu, které pronikají na povrch houby, zde tvoří tužší, hmatatelné kuželovité výběžky.\\nŽije v mělkých, osluněných vodách do 20 m hloubky. Při vytažení z vody rychle mění barvu, nejprve zezelená a pak zčerná. Tato vlastnost jí dala vědecké druhové jméno, aerophoba znamená \\"mající strach ze vzduchu\\"."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8E%9F%E5%AD%90%E8%BD%A8%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/D5x2-y2.png","page_title":"原子轨道","context_page_description":"原子軌域，又稱軌態，是以數學函數描述原子中電子似波行為。此波函數可用來計算在原子核外的特定空間中，找到原子中電子的機率，並指出電子在三維空間中的可能位置。「軌域」便是指在波函數界定下，電子在原子核外空間出現機率較大的區域。具體而言，原子軌域是在環繞著一個原子的許多電子中，個別電子可能的量子態，並以軌域波函數描述。\\n現今普遍公認的原子結構是波耳氫原子模型：電子像行星，繞著原子核運行。然而，電子不能被視為形狀固定的固體粒子，原子軌域也不像行星的橢圓形軌道。更精確的比喻應是，大範圍且形狀特殊的「大氣」，分布於極小的星球四周。只有原子中存在唯一電子時，原子軌域才能精準符合「大氣」的形狀。當原子中有越來越多電子時，電子越傾向均勻分布在原子核四周的空間體積中，因此「電子雲」越傾向分布在特定球形區域內。\\n在原子物理學的運算中，複雜的電子函數常被簡化成較容易的原子軌域函數組合。雖然多電子原子的電子並不能以「一或二個電子之原子軌域」的理想圖像解釋，它的波函數仍可以分解成原子軌域函數組合，以原子軌域理論進行分析；就像在某種意義上，由多電子原子組成的電子雲在一定程度上仍是以原子軌域「構成」，每個原子軌域內只含一或二個電子。"},{"page_url":"https://fr.wikipedia.org/wiki/Loire_70","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Loire_70.jpg","page_title":"Loire 70","context_page_description":"Le Loire 70 est un avion militaire de l'entre-deux-guerres réalisé en France par Loire Aviation."},{"page_url":"https://es.wikipedia.org/wiki/Flora_australiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Botanical_Magazine_4906_BANKSIA_Victori%C3%A6.jpeg","page_title":"Flora australiana","context_page_description":"La flora australiana es la vegetación que habita en Australia, es decir, en el continente australiano, Tasmania y otras islas menores de alrededor. Es lo que se denomina como reino floral de Australia. En total, comprende unas veinte mil plantas vasculares, catorce mil plantas no-vasculares, doscientas cincuenta mil especies de hongos y tres mil tipos de líquenes, por lo que se considera un país megadiverso. En el paisaje natural australiano contrastan las zonas interiores de climatología árida donde prevalecen matas de triodias y astreblas con las zonas costeras de clima templado y mediterráneo donde predominan los bosques de eucalipto y de acacias. En el extremo norte australiano —en la Tierra de Arnhem y el Cabo York, principalmente— existen pequeñas áreas de selvas tropicales, afectadas por los monzones.\\nA pesar de la cercanía de Nueva Zelanda, la isla de Papúa y otras islas indonesas, estas no tienen la misma flora, por lo tanto no se consideran del mismo reino floral que Australia."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B1%D9%88%D8%AC%D9%8A%D9%84%D9%8A%D9%88_%D9%81%D9%88%D9%86%D9%8A%D8%B3_%D9%85%D9%88%D8%B1%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Rogeliofunesmori.jpg","page_title":"روجيليو فونيس مورى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nروجيليو فونيس مورى لاعب كورة قدم من ارجنتين."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%A8%81%E6%AD%A6%E9%99%B3%E5%85%83%E5%B8%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/%E9%A6%AC%E7%A5%96%E5%8D%97%E7%AB%BF%E9%84%89%E9%A6%AC%E6%B8%AF%E5%A4%A9%E5%90%8E%E5%AE%AE%E5%85%A7%E4%B9%8B%E5%A8%81%E6%AD%A6%E9%99%B3%E5%B0%87%E8%BB%8D%E7%A5%9E%E9%BE%95.jpg","page_title":"威武陳元帥","context_page_description":"威武陈元帅是发起于福建连江马祖西莒岛居民崇奉的神灵，其他的信徒则遍及福建、浙江、台湾等福州籍或大陈籍住民或移民；因源于西莒岛，故住民视其为西莒岛的守护神。"},{"page_url":"https://fr.wikipedia.org/wiki/Stenka_Razine_(Glazounov)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Kustodiev_razin.jpg","page_title":"Stenka Razine (Glazounov)","context_page_description":"Stenka Razine opus 13 est un poème symphonique d'Alexandre Glazounov composé en 1885 d'après la vie du célèbre cosaque éponyme qui a vécu au XVIIᵉ siècle. Dédié à la mémoire d'Alexandre Borodine, il est l'une des rares compositions écrites par Glazounov sur un sujet nationaliste et est composé dans un style qui rappelle ceux de Borodine et Piotr Ilitch Tchaïkovski."},{"page_url":"https://vi.wikipedia.org/wiki/Oak_Grove,_Qu%E1%BA%ADn_Pierce,_Wisconsin","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/WIMap-doton-Oak_Grove.png","page_title":"Oak Grove, Quận Pierce, Wisconsin","context_page_description":"Oak Grove là một thị trấn thuộc quận Pierce, tiểu bang Wisconsin, Hoa Kỳ. Năm 2010, dân số của thị trấn này là 2.101 người."},{"page_url":"https://sk.wikipedia.org/wiki/Kuurne","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ca/Vlag_Kuurne.PNG","page_title":"Kuurne","context_page_description":"Kuurne je belgická obec na pobreží Severného mora vo Flámskom regióne v provincii Západné Flámsko."},{"page_url":"https://pt.wikipedia.org/wiki/Alpinia_purpurata","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Gengibre-vermelho.jpg","page_title":"Alpinia purpurata","context_page_description":"Alpinia purpurata é uma espécie de planta perene da família Zingiberaceae, conhecida pelos nomes comuns de gengibre-vermelho e alpínia, utilizada como planta ornamental nas regiões tropicais e subtropicais."},{"page_url":"https://en.wikipedia.org/wiki/Stefano_Bollani","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Stefano-Bollani-ph-ValentinaCenni_2.jpg","page_title":"Stefano Bollani","context_page_description":"Stefano Bollani is an Italian composer, pianist and singer, also active as a writer and a television presenter.\\nHe has worked with such musicians as Gato Barbieri, Chick Corea, Bill Frisell, Sol Gabetta, Richard Galliano, Egberto Gismonti, Lee Konitz, Bobby McFerrin, Pat Metheny, Caetano Veloso, Phil Woods, Hector Zazou and has recorded more than 15 albums with the trumpeter Enrico Rava. Bollani has performed with several symphonic orchestras and with directors such as Riccardo Chailly, Daniel Harding, Kristjan Järvi, Zubin Mehta, Gianandrea Noseda and Antonio Pappano. He has also played with Italian pop-rock artists, and has participated in and hosted many TV and radio shows. Currently he has published 43 albums alone and has collaborated extensively with other artists."},{"page_url":"https://de.wikipedia.org/wiki/Stadt_Hasselfelde","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/eb/Hasselfelde_Sagewerk.jpg","page_title":"Stadt Hasselfelde","context_page_description":"Stadt Hasselfelde ist ein Ortsteil der Stadt Oberharz am Brocken und seit 2002 ein staatlich anerkannter Luftkurort im Landkreis Harz in Sachsen-Anhalt."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D9%81%D8%B6%D8%A7%D8%A1_%D9%88%D8%A7%D9%84%D9%86%D8%AC%D8%A7%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/NASA_Space_Suit.jpg","page_title":"الفضاء والنجاة","context_page_description":"يُشير عنوان الفضاء\\nوالنجاة إلى فكرة أن بقاء [الجنس البشري] والحضارة على المدى الطويل يتطلبان الاستخدام السليم لموارد الفضاء الخارجي والحاجة إلى استعمار الفضاء و[علوم الفضاء]. يفترض المفهوم أن التقاعس قد يؤدي إلى [انقراض]] [الإنسان]. الملاحظة ذات الصلة هي أن الوقت والموارد المحدودين قد يكونان متاحين لاستعمار الفضاء. نوقشت سيناريوهات مختلفة لبقاء الإنسان في العلوم والثقافة الشعبية، لا سيما الآفاق الإنسانية بعد الأحداث الكارثية في النظام الشمسي والعوامل التي يمكن أن تساعد أو تعيق البقاء على قيد الحياة.ظهور أقرب صلة بين [استكشاف الفضاء]، والبقاء على قيد الحياة البشرية في مقالة لويس ج. هالي في عام في الشؤون الخارجية، والتي ذكر فيها أن استعمار الفضاء سيحافظ على سلامة الإنسان في حالة حدوث [حرب نووية] عالمية. نالت هذه الفكرة مزيد من الاهتمام في السنوات الأخيرة لأن التكنولوجيا المتقدمة تجعل السفر إلى الفضاء الرخيص الثمن أمرا أكثر جدوى."},{"page_url":"https://hu.wikipedia.org/wiki/Canal_Grande","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Palazzo_Emo_Cannaregio_Canal_Grande_Venezia.jpg","page_title":"Canal Grande","context_page_description":"A Canal Grande Velence fordított „S” alakú fő csatornája, amely két részre osztja a történelmi központot a Ponte della Libertà csomópont és a Bacino di San Marco között. Összesen körülbelül 3800 méter hosszú, szélessége 30–70 méter, átlagos mélysége 5 méter."},{"page_url":"https://ceb.wikipedia.org/wiki/Sleeping_Bear_Dunes_National_Lakeshore","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Sleeping_Bear_Dune_Aerial_View.jpg","page_title":"Sleeping Bear Dunes National Lakeshore","context_page_description":"Parke ang Sleeping Bear Dunes National Lakeshore sa Tinipong Bansa. Ang Sleeping Bear Dunes National Lakeshore nahimutang sa kondado sa Leelanau County ug estado sa Michigan, sa sidlakang bahin sa nasod, 1,000 km sa amihanan-kasadpan sa ulohang dakbayan Washington, D.C. 217 metros ibabaw sa dagat kahaboga ang nahimutangan sa Sleeping Bear Dunes National Lakeshore.\\nAng yuta palibot sa Sleeping Bear Dunes National Lakeshore kay kasagaran patag. Sleeping Bear Dunes National Lakeshore nahimutang sa usa ka gitas-on. Ang kinahabogang dapit sa palibot dunay gihabogon nga 273 ka metro ug 1.2 km sa habagatan-kasadpan sa Sleeping Bear Dunes National Lakeshore. Sa rehiyon palibot sa Sleeping Bear Dunes National Lakeshore, mga lawis talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 5 °C. Ang kinainitan nga bulan Agosto, sa 17 °C, ug ang kinabugnawan Pebrero, sa -13 °C. Ang kasarangang pag-ulan 1,165 milimetro matag tuig. Ang kinabasaan nga bulan Oktubre, sa 173 milimetro nga ulan, ug ang kinaugahan Agosto, sa 59 milimetro."},{"page_url":"https://it.wikipedia.org/wiki/Enoli","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Alchilazione_di_enolati_a_partire_da_Nitrili.jpg","page_title":"Enoli","context_page_description":"Gli enoli sono composti organici che possiedono un gruppo ossidrilico e un gruppo alchenico. Il nome enolo deriva da alchene ed alcolo. I sali in cui sono presenti anioni deprotonati degli enoli vengono definiti enolati. I dioli corrispondenti prendono il nome di endioli dove entrambi gli atomi di carbonio impegnati nel doppio legame sono sostituiti con un gruppo -OH, caratterizzati quindi dal gruppo funzionale -C=C-. Per la reattività di questi composti, di rilievo ad esempio per le reazioni della biochimica cellulare, è di particolare importanza la tautomeria cheto-enolica. Gli enoli possono convertirsi prontamente in chetoni o aldeidi: la forma più stabile dominerà sull'altra in un processo di equilibrio chimico. Risulta quindi molto difficile ottenere un enolo puro, così come è altrettanto difficile ottenere un chetone o un'aldeide puri. In natura si possono ottenere solo delle miscele di questi due composti."},{"page_url":"https://en.wikipedia.org/wiki/B%C3%A1nhorv%C3%A1ti","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/B%C3%A1nhorv%C3%A1ticivertanlegi2.jpg","page_title":"Bánhorváti","context_page_description":"Bánhorváti is a village in Borsod-Abaúj-Zemplén county, Hungary. It appeared after Bánfalva and Bánhorvát merged in 1950."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BA%95%E5%8F%A3%E5%8F%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/%E4%BA%95%E5%8F%A3%E5%8F%B0%E4%B8%89%E4%B8%81%E7%9B%AE%E3%81%8B%E3%82%89%E3%81%AE%E7%9C%BA%E3%82%81.JPG","page_title":"井口台","context_page_description":"井口台は、広島県広島市西区の町名・住宅地名。通称は井口台パークタウン。一丁目から四丁目まである。郵便番号は733-0844。当地域の人口は7,680人、世帯数は2,860世帯。"},{"page_url":"https://en.wikipedia.org/wiki/Mantis_shrimp","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/39/OdontodactylusScyllarus2.jpg","page_title":"Mantis shrimp","context_page_description":"Mantis shrimps, or stomatopods, are marine crustaceans of the order Stomatopoda. Some species have specialised calcified \\"clubs\\" that can strike with great power, while others have sharp forelimbs used to capture prey. They branched from other members of the class Malacostraca around 340 million years ago. Mantis shrimps typically grow to around 10 cm in length. A few can reach up to 38 cm. The largest mantis shrimp ever caught had a length of 46 cm; it was caught in the Indian River near Fort Pierce, Florida, in the United States. A mantis shrimp's carapace covers only the rear part of the head and the first four segments of the thorax. Varieties range in color from shades of brown to vivid colors, with more than 450 species of mantis shrimps being known. They are among the most important predators in many shallow, tropical and subtropical marine habitats. However, despite being common, they are poorly understood, as many species spend most of their lives tucked away in burrows and holes."},{"page_url":"https://ceb.wikipedia.org/wiki/Huy%E1%BB%87n_L%E1%BB%87_Th%E1%BB%A7y","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/KienGiangTown.jpg","page_title":"Huyện Lệ Thủy","context_page_description":"Lalawigan ang Huyện Lệ Thủy sa Viyetnam. Nahimutang ni sa lalawigan sa Tỉnh Quảng Bình, sa sentro nga bahin sa nasod, 400 km sa habagatan sa Hanoi ang ulohan sa nasod. Adunay 140,804 ka molupyo.\\nAng klima habagat. Ang kasarangang giiniton 23 °C. Ang kinainitan nga bulan Abril, sa 26 °C, ug ang kinabugnawan Disyembre, sa 20 °C. Ang kasarangang pag-ulan 2,163 milimetro matag tuig. Ang kinabasaan nga bulan Septiyembre, sa 648 milimetro nga ulan, ug ang kinaugahan Pebrero, sa 16 milimetro."},{"page_url":"https://de.wikipedia.org/wiki/Shing-Mun-Fluss","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Shing_Mun_River_Drone_I_love_ST_20180630.jpg","page_title":"Shing-Mun-Fluss","context_page_description":"Der Shing-Mun-Fluss, auch Shing-Mun-Kanal genannt, ist heute ein künstlicher Wasserlauf in Sha Tin. Der natürliche Shing-Mun-Fluss wurde im Zuge der Urbanisierung in den 1970er Jahren durch den Bau von Planstädten, sogenannte „New Towns“, in den New Territories von Hongkong, begradigt, verlängert und verbreitet. Ziel der Maßnahmen waren sowohl Entwässerung als auch Erschaffung von Naherholungs- und Freizeitflächen entlang des künstlichen Wasserlaufs. Der Abfluss von Wassermassen bei Starkregen und Taifunen sowie Abwässer der Bewohner soll über den Shing-Mun-Fluss ins offene Meer geleitet und entsorgt werden."},{"page_url":"https://ms.wikipedia.org/wiki/Jeonju","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Outdoor_city_park_-_2014..JPG","page_title":"Jeonju","context_page_description":"Jeonju adalah bandar di Korea Selatan, dan ibu negara Wilayah Jeolla Utara. Ia merupakan pusat pelancongan penting yang terkenal dengan makanan Korea, bangunan bersejarah, aktiviti sukan dan festival yang inovatif.\\nPada bulan Mei 2012, Jeonju telah dipilih sebagai Bandar Kreatif untuk Gastronomi sebagai sebahagian daripada Rangkaian Bandar Kreatif UNESCO. Penghormatan ini mengiktiraf masakan tradisional rumah di bandar ini yang diturunkan melalui generasi sejak beribu-ribu tahun, penyelidikan makanan awam dan swasta yang aktif, sistem memupuk chef berbakat, dan penganjuran festival makanan tempatan yang tersendiri."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A7%80%EB%A6%AC%ED%95%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/British_Empire_1897.jpg","page_title":"지리학","context_page_description":"지리학은 지표 상에서 일어나는 자연 및 인문 현상을 지역적 관점에서 연구하는 과학의 한 분야이다.\\n공간 및 자연과 경제, 사회와의 관계를 대상으로 하는 학문 분야로, 공간이나 자연 환경이라고 하는 물리적 존재를 대상 안에 포함하는 점에서 사회과학과 자연과학의 양면의 성격이 있다. 원래는 농경이나 전쟁, 통치를 위해 각지의 정보를 조사해 정리하기 위한 연구 영역으로서 성립했다. 그러나 현재는 자연과학 내지 사회과학의 한 분야로서 지역마다 다른 공간적 이질성을 설명하는 데 필요하게 되었다.\\n지리학의 관심 대상은 불규칙한 분포이다. 지구에서 발견되는 사물에는 다중성이 존재한다. 사물의 다중성은 공간적으로 불규칙하게 분포한다. 불규칙한 분포가 사물이 지리적인 성격을 나타내게 한다. 다른 관심 대상은 상호관련성이다. 예를 들어, 농업 현상의 경우 농업과 연관된 기후, 토양, 인구, 경제적 조건, 기술력과 다른 조건 사이의 연관성을 이해하지 않으면 해당 농업의 지리적인 특성을 파악할 수 없다. 이를 바탕으로 미루어 볼 때, 지리학의 가장 근본적인 질문은 왜, 그곳에, 무엇이 있으며, 그래서 그곳에서 나타나는 현상이 어떻게 되느냐에 대해 설명하는 것이다.\\n영어에서 지리를 뜻하는 단어은 고대 그리스어의 고대 그리스어: γεωγραφία에서 유래하였다. 에라토스테네스가 처음 사용한 용어로, 땅을 뜻하는 \\"η γη\\" 와 기술을 뜻하는 \\"γραφειν\\" 를 합친 용어다. 지리라는 용어는 주역에서는 산천의 환경과 형세를 나타내는 말이었고, 구당서, 원사에서는 오늘날의 지리학과 유사한 용례로 쓰였다."},{"page_url":"https://az.wikipedia.org/wiki/Bristol_k%C3%B6rf%C9%99zi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Bristol_channel_detailed_map.png","page_title":"Bristol körfəzi","context_page_description":"Bristol körfəzi və ya Bristol kanalı — Atlantik okeanında, Britaniya adasının cənub-qərbində yerləşir. Uelsin cənubundan İngiltərənin Somerset və Devon qraflıqlarının şimal sahillərini əhatə edir. Körfəz Kelt dənizi akvatoriyasına daxildir. Öz adını sahilində yerləşən Bristol liman şəhərindən götürmüşdür."},{"page_url":"https://war.wikipedia.org/wiki/Rhagoletis_completa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Rhagoletis_completa_Piazzo.jpg","page_title":"Rhagoletis completa","context_page_description":"An Rhagoletis completa in uska species han Diptera nga ginhulagway ni Cresson hadton 1929. An Rhagoletis completa in nahilalakip ha genus nga Rhagoletis, ngan familia nga Tephritidae. Waray hini subspecies nga nakalista."},{"page_url":"https://it.wikipedia.org/wiki/M14_(fucile)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/CBP_M14.jpg","page_title":"M14 (fucile)","context_page_description":"L'M14, è un fucile da battaglia a fuoco selettivo camerato per la munizione 7,62 × 51 mm NATO. Rimpiazzò gradualmente il Garand M1 come arma di servizio prima nell'esercito e poi nel corpo dei Marines e fu impiegato dalle truppe americane dal 1959 fino al 1964, quando cominciò a essere rimpiazzato dall'M16.\\nL'M14 fu l'ultimo fucile da battaglia adottato dalle forze armate americane e rimane oggi in servizio solo in pochi reparti come arma da tiratore, cerimoniale o addestramento. I modelli civili semiautomatici sono particolarmente apprezzati per la caccia o alle competizioni.\\nLe varianti di precisione M21 e M25 sono state gradualmente rimpiazzate dal più preciso e maneggevole M24 SWS ma rimangono ancora in servizio presso certi reparti. Una variante modernizzata dell'arma, denominata M14 EBR realizzata dalla Sage International Ltd e dalla Smith Enterprise, è stata immessa in servizio a partire dal 2002. Tale versione è dotata di calcio telescopico, guida Picatinny e sistema di mira olografico."},{"page_url":"https://bg.wikipedia.org/wiki/Coua_coquereli","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Coquerel%27s_Coua_RWD3.jpg","page_title":"Coua coquereli","context_page_description":"Coua coquereli е вид птица от семейство Cuculidae."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%93%D1%80%D1%8E%D1%80%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/GruryChurch.JPG","page_title":"Грюри","context_page_description":"Грюри — Францин гӀала-коммуна, лаьтта Бургунди — Франш-Конте регионехь. Коммунан департамент — Сона а, Луара а. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://de.wikipedia.org/wiki/Hong_Kong_UNESCO_Global_Geopark","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/North_Ninepin_Island.JPG","page_title":"Hong Kong UNESCO Global Geopark","context_page_description":"Der Hong Kong UNESCO Global Geopark, kurz Hong Kong Geopark ist ein im November 2009 eröffneter Geopark in Hongkong."},{"page_url":"https://pl.wikipedia.org/wiki/Markus_Schupp","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Markus_Schupp.jpg","page_title":"Markus Schupp","context_page_description":"Markus Schupp – niemiecki piłkarz występujący na pozycji pomocnika."},{"page_url":"https://en.wikipedia.org/wiki/Brandenburg-Prussia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Locator_Brandenburg-Prussia_within_the_Holy_Roman_Empire_%281618%29.svg","page_title":"Brandenburg-Prussia","context_page_description":"Brandenburg-Prussia is the historiographic denomination for the Early Modern realm of the Brandenburgian Hohenzollerns between 1618 and 1701. Based in the Electorate of Brandenburg, the main branch of the Hohenzollern intermarried with the branch ruling the Duchy of Prussia, and secured succession upon the latter's extinction in the male line in 1618. Another consequence of the intermarriage was the incorporation of the lower Rhenish principalities of Cleves, Mark and Ravensberg after the Treaty of Xanten in 1614.\\nThe Thirty Years' War was especially devastating. The Elector changed sides three times, and as a result Protestant and Catholic armies swept the land back and forth, killing, burning, seizing men and taking the food supplies. Upwards of half the population was killed or dislocated. Berlin and the other major cities were in ruins, and recovery took decades. By the Peace of Westphalia, which ended the Thirty Years' War in 1648, Brandenburg gained Minden and Halberstadt, also the succession in Farther Pomerania and the Duchy of Magdeburg."},{"page_url":"https://sv.wikipedia.org/wiki/Lewisia_nevadensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Lewisianevadensis.jpg","page_title":"Lewisia nevadensis","context_page_description":"Lewisia nevadensis är en källörtsväxtart som först beskrevs av Samuel Frederick Gray, och fick sitt nu gällande namn av B.L. Robins. Lewisia nevadensis ingår i släktet Lewisia och familjen källörtsväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://nl.wikipedia.org/wiki/Niepor%C4%99t","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/POL_Niepor%C4%99t_rynek.jpg","page_title":"Nieporęt","context_page_description":"Nieporęt is een dorp in het Poolse woiwodschap Mazovië, in het district Legionowski. De plaats maakt deel uit van de gemeente Nieporęt en telt 2000 inwoners."},{"page_url":"https://tr.wikipedia.org/wiki/Lemgo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Lemgo_-_Marktplatz_mit_Rathaus.jpg","page_title":"Lemgo","context_page_description":"Lemgo Almanya'nın Kuzey Ren-Vestfalya eyaletinde bulunan bir üniversite şehridir ve Bielefeld'in 25 km doğusundadır. 31 Aralık 2016 itibarıyla şehrin 41.087 nüfusu vardı."},{"page_url":"https://en.wikipedia.org/wiki/Mausoleum_of_M%C4%83r%C4%83%C8%99e%C8%99ti","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Mausoleul_Eroilor_%281916_-_1919%29_-_Cupola.JPG","page_title":"Mausoleum of Mărășești","context_page_description":"The Mausoleum of Mărășești is a memorial site in Romania containing remains of 5,073 Romanian soldiers and officers killed in the First World War and dedicated to the commemoration of the Battle of Mărășești and Romanian Army members who were killed during World War I.\\nThe memorial took architects George Cristinel and Constantin Pomponiu 15 years to build and was unveiled on 18 September 1938 by King Carol II. The frieze in bas-relief surrounding the base of the dome was sculpted by Cornel Medrea and Ion Jalea."},{"page_url":"https://es.wikipedia.org/wiki/Circuito_Tur%C3%ADstico_Ferroviario_de_Jun%C3%ADn","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cf/JUNIN_UNNOBA_002.jpg","page_title":"Circuito Turístico Ferroviario de Junín","context_page_description":"El Circuito Turístico Ferroviario de Junín es un itinerario que recorre distintos lugares de interés de la ciudad de Junín, Argentina. Comprende diferentes plazas, edificios y monumentos ubicados entre la estación ferroviaria y la Avenida San Martín."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Ansauville","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Eglise_Ansauville.JPG","page_title":"Ansauville","context_page_description":"Ansauville sī ūi-tī Hoat-kok Lorraine toā-khu Meurthe-et-Moselle koān ê chi̍t ê commune."},{"page_url":"https://hu.wikipedia.org/wiki/Kabo-reformok","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Kim_Hong-Jip.jpg","page_title":"Kabo-reformok","context_page_description":"A Kabo-reformok a koreai Csoszon államban 1894 és 1896 között végrehajtott reformok összefoglaló neve. A Kodzsong uralkodása alatti reformokat a japánok kényszerítették ki, megpróbálva minél nagyobb irányítás alá vonni Koreát."},{"page_url":"https://de.wikipedia.org/wiki/Arzneimittel_pflanzlicher_Herkunft_im_Kleinen_Destillierbuch","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/1497_1500_Gersten-Krut.jpg","page_title":"Arzneimittel pflanzlicher Herkunft im Kleinen Destillierbuch","context_page_description":"Die Arzneimittel pflanzlicher Herkunft im Kleinen Destillierbuch des Hieronymus Brunschwig sind in der folgenden Tabelle nach den vom Autor verwendeten Namen und nach der modernen Nomenklatur aufgeführt. Berücksichtigt werden auch solche Pflanzen, von denen Brunschwig lediglich eine botanische Beschreibung ohne Angaben über ihre therapeutische Verwendung gab. In der vierten Spalte werden die von Brunschwig angegebenen Indikationen der Pflanzenwässer dargestellt, und es wird der Versuch unternommen, die direkten Quellen für diese Indikationsangaben zu bestimmen. Die indirekten Quellen wie zum Beispiel die Werke von Pedanios Dioskurides und von Plinius dem Älteren sind in dieser Tabelle nicht berücksichtigt."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%92%D0%B8%D1%82%D0%BE%D1%88%D0%B0_(%D0%BF%D1%80%D0%B8%D1%80%D0%BE%D0%B4%D0%B5%D0%BD_%D0%BF%D0%B0%D1%80%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Adonis_vernalis-%D0%9F%D1%80%D0%BE%D0%BB%D0%B5%D1%82%D0%B5%D0%BD_%D0%B3%D0%BE%D1%80%D0%B8%D1%86%D0%B2%D0%B5%D1%82.jpg","page_title":"Витоша (природен парк)","context_page_description":"„Витоша“ е първият природен парк в България и на Балканския полуостров."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Pretzfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Poppendorf_14_%28Pretzfeld%29.jpg","page_title":"Liste der Baudenkmäler in Pretzfeld","context_page_description":"Auf dieser Seite sind die Baudenkmäler des oberfränkischen Marktes Pretzfeld zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%A1%E6%B4%9B%C2%B7%E4%BC%AF%E4%BC%BD%E7%B1%B3%E5%B0%BC%E7%B4%9A%E5%B7%A1%E9%98%B2%E8%89%A6_(2011%E5%B9%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Carlo_Margottini_%28F_592%29_12_%40chesi.JPG","page_title":"卡洛·伯伽米尼級巡防艦 (2011年)","context_page_description":"卡洛·伯伽米尼級巡防艦，為義大利海軍版本的歐洲多用途巡防艦，為法國和義大利兩國繼地平線級驅逐艦後又一合作的軍艦，並且以歐洲為名推出。"},{"page_url":"https://nl.wikipedia.org/wiki/Belgisch_vrouwenvoetbalelftal","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Tessa_Wullaert_2014_%28cropped%29.jpg","page_title":"Belgisch vrouwenvoetbalelftal","context_page_description":"Het Belgisch vrouwenvoetbalelftal is een voetbalteam dat uitkomt voor België bij internationale wedstrijden en toernooien, zoals het Europees kampioenschap. De bijnaam van de ploeg is de Red Flames."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Cl%C3%A9ment_de_Flottemanville","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/%C3%89glise_Saint-Cl%C3%A9ment_de_Flottemanville_-_Statue_de_sainte_Jeanne_de_Chantal.JPG","page_title":"Église Saint-Clément de Flottemanville","context_page_description":"L'église Saint-Clément est une église catholique située à Flottemanville, en France."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D8%B1%DA%AF_%D8%AF%D8%B1%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Sea-wolf_cover.jpg","page_title":"گرگ دریا","context_page_description":"گرگ دریا رمانی از جک لندن نویسنده آمریکایی است که در سال ۱۹۰۴ منتشر شد و به سرعت با استقبال خوانندگان روبرو گشت.\\nجک لندن در این رمان داستان روشن فکری به نام هامفری وان ویدن را بیان می‌کند که بر اثر غرق کشتی اسیر گروهی ملوان خشن به سرپرستی شخصی به نام ولف لارسن می‌شود که او را با کشتی خود به دریاهای دوردست می‌برند. ولف لارسن مردی است بی‌اخلاق و خشن که قدرت بدنی زیادی دارد و در عین حال خودآموخته است و کتاب‌های زیادی خوانده است. داستان با ورود زنی به نام ماد بروستر که شاعر مشهوری است صورت دیگری می‌گیرد و هامفری که عاشق ماد شده در جزیره‌ای دورافتاده با همکاری او از پس ولف برمی‌آید.\\nجک لندن در این رمان به ابرانسان نیچه نظر داشته و در داستان به بزرگان عرصه ادب و اندیشه مانند هربرت اسپنسر، عمر خیام، ایپولیت تن، شکسپیر و جان میلتون اشاره دارد.\\nاین کتاب پر از اصطلاحات دریانوردی است و جک لندن در نوشتن آن از تجربه زندگی خود بهره گرفته است."},{"page_url":"https://en.wikipedia.org/wiki/List_of_United_States_commemorative_coins_and_medals_(2010s)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/2014_National_Baseball_Hall_of_Fame_Half_Dollar_Obverse.jpg","page_title":"List of United States commemorative coins and medals (2010s)","context_page_description":"Although technically a circulating coin, no dollar coins have been struck for circulation since 2011. Dollar coins are struck for circulation when the economy needs them.\\nThis is a non-circulating variety of a circulating coin."},{"page_url":"https://fr.wikipedia.org/wiki/Acad%C3%A9mie_de_musique_de_Cracovie","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/Henryk_Miko%C5%82aj_G%C3%B3recki_Polish_composer.jpg","page_title":"Académie de musique de Cracovie","context_page_description":"L’Académie de musique de Cracovie est un établissement public d'enseignement supérieur à orientation professionnelle artistique et de recherche assurant une formation universitaire du premier au troisième cycle.\\nElle a été créée en 1888 sous le nom de Conservatoire de la société de musique de Cracovie, Konserwatorium Towarzystwa Muzycznego w Krakowie devenue ensuite École nationale supérieure de musique de Cracovie, Państwowa Wyższa Szkoła Muzyczna w Krakowie. Elle est par ancienneté la deuxième école de formation supérieure de musiciens en Pologne."},{"page_url":"https://la.wikipedia.org/wiki/Les_Pieux","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/AnseSciotot.JPG","page_title":"Les Pieux","context_page_description":"Les Pieux est commune 3588 incolarum praefecturae Manicae in Franciae borealis provincia Normannia Inferiori."},{"page_url":"https://id.wikipedia.org/wiki/Fausto_Tozzi","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Fausto_Tozzi.jpg","page_title":"Fausto Tozzi","context_page_description":"Fausto Tozzi adalah seorang pemeran dan penulis naskah asal Italia. Ia tampil dalam 70 film antara 1951 dan 1978. Ia menulis naskah untuk The Defeated Victor, yang masuk Festival Film Internasional Berlin ke-9. Ia juga menyutradarai satu film, Trastevere."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B2%E0%A6%BE%E0%A6%AF%E0%A6%BC%E0%A6%B2%E0%A7%80-%E0%A6%AE%E0%A6%9C%E0%A6%A8%E0%A7%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Layla_va_Majnun.jpg","page_title":"লায়লী-মজনু","context_page_description":"দৌলত উজির বাহরাম খান বিরচিত লায়লী-মজনু কাব্য রোমান্টিক প্রণয়োপাখ্যান কাব্যধারায় একটি বিশেষ গুরুত্বপূর্ণ সংযোজন হিসেবে স্থান পেয়েছে। ডঃ মুহম্মদ এনামুল হক এর মতে, ১৫৬০ থেকে ১৫৭৫ সালের মধ্যে কবি লায়লী-মজনু কাব্য রচনা করেছিলেন। ডঃ আহমদ শরীফ ১৫৪৩ থেকে ১৫৫৩ সালের মধ্যে কাব্যের রচনাকাল মনে করেন। ডঃ মুহম্মদ শহীদুল্লাহ এর মতে লায়লী-মজনু কাব্যের রচনাকাল ১৬৬৯ খ্রিষ্টাব্দ।\\nকবি দৌলত উজির বাহরাম খান রচিত লায়লী-মজনু কাব্য পার্সিয়ান তথা ইরানি কবি জামীর লায়লী-মজনু নামক কাব্যের ভাবানুবাদ। লায়লী-মজনু প্রেমকাহিনী সারা বিশ্ব জুড়ে পরিচিত। এই কাহিনীর মূল উৎস আরবি লোকগাঁথা। কাহিনীটিকে ঐতিহাসিক দিক থেকে সত্য বিবেচনা করা হয়।\\nআমির পুত্র কয়েস বাল্যকালে বণিক-কন্যা লায়লীর প্রেমে পড়ে মজনু বা পাগল নামে খ্যাত হয়। লায়লীও মজনুর প্রতি গভীর আকর্ষণ অনুভব করে। কিন্তু উভয়ের বিবাহে আসে বাধা। ফলে মজনু পাগল রূপে বনেজঙ্গলে ঘুরে বেড়াতে থাকে। অন্যদিকে লায়লীর অন্যত্র বিয়ে হলেও তার মন থেকে মজনু সরে যায় নি। তাদের দীর্ঘ বিরহজীবনের অবসান ঘটে করুণ মৃত্যুর মাধ্যমে। এই মর্মস্পর্শী বেদনাময় কাহিনী অবলম্বনেই লায়লী-মজনু কাব্য রচিত।"},{"page_url":"https://nl.wikipedia.org/wiki/Leopold_I_van_Habsburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Leopold_I_Habsburg.jpg","page_title":"Leopold I van Habsburg","context_page_description":"Leopold I van Habsburg was van 1308 tot aan zijn dood samen met zijn broer Frederik de Schone hertog van Oostenrijk en Stiermarken. Hij behoorde tot het huis Habsburg."},{"page_url":"https://de.wikipedia.org/wiki/Ron_McClure","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Ron_McClure.jpg","page_title":"Ron McClure","context_page_description":"Ronald Dix „Ron“ McClure ist ein US-amerikanischer Jazzmusiker."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%AB%E3%83%A0%E3%83%8BAC","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Alumni_1906champion.jpg","page_title":"アルムニAC","context_page_description":"アルムニ・アスレティック・クラブ 、通称アルムニ は、かつてアルゼンチン・ブエノスアイレス州で活動していたサッカークラブである。\\n1893年に設立されたアルゼンチンサッカー協会 が組織するサッカー選手権に参加するため、同年、ブエノスアイレス英語学校の学生グループがアレクサンダー・ワトソン・ハットン博士の下に集って設立された。公式に設立が認められたのは1898年。1911年までに10度のリーグ優勝を果たし、また国内外問わず多数のカップ戦で優勝したが、1913年、内部問題のために解散した。アルゼンチンのサッカー史において最も重要なクラブのひとつである。"},{"page_url":"https://en.wikipedia.org/wiki/Sergei_Witte","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Vitte_M.I._%28zhena_S.Y%29._1905._Karl_Bulla.jpg","page_title":"Sergei Witte","context_page_description":"Count Sergei Yulyevich Witte, also known as Sergius Witte, was a Russian statesman who served as the first Prime Minister of the Russian Empire. He is widely considered to have been one of the key figures in Russian politics at the end of 19th and at the beginning of the 20th century. He was made a count because of his service to the government in negotiations over the end of the Russo-Japanese War.\\nWitte was neither a liberal nor a conservative. He attracted foreign capital to boost Russia's industrialization. He served under the last two emperors of Russia, Alexander III and Nicholas II. During the Russo-Turkish War, he had risen to a position in which he controlled all the traffic passing to the front along the lines of the Odessa Railways. As Minister of Finance, Witte presided over extensive industrialization and achieved monopoly control by the government over an expanded system of railroad lines.\\nFollowing months of civil unrest and outbreaks of violence, in what was known as the 1905 Russian Revolution, he framed the October Manifesto of 1905, and the accompanying government communication to establish constitutional government."},{"page_url":"https://en.wikipedia.org/wiki/Big_Apple_(Colborne,_Ontario)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Colborne_Big_Apple.jpg","page_title":"Big Apple (Colborne, Ontario)","context_page_description":"The Big Apple is a bakery, restaurant and roadside attraction in the community of Colborne, part of the municipality of Cramahe, Northumberland County in Central Ontario, Canada, a driving distance of approximately 135 kilometres eastward from downtown Toronto. It is located on the south side of Ontario Highway 401 at interchange 497 and is easily recognizable from the highway by its huge apple-shaped structure, claimed to be the world's largest.\\nWith a height of 10.7 metres and diameter of 11.6 metres, the Big Apple features an observation deck.\\nThe site also features a petting zoo, a complimentary miniature golf course, and other amenities."},{"page_url":"https://de.wikipedia.org/wiki/Otto_Ludwig_von_Kanitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Hainewalde%2C_evangelische_Kirche_-_Wappen_der_Familien_von_Kanitz_und_Kyaw_an_der_Herrschaftsloge_%2801-2%29.JPG","page_title":"Otto Ludwig von Kanitz","context_page_description":"Otto Ludwig von Kanitz war ein Oberst der kursächsischen Kavallerie und der königlich polnischen Armee, sowie Herr der Güter Hainewalde, Oderwitz, Spitzkunnersdorf, Mücka, Radischholz und Neundorf aus dem Geschlecht derer von Kanitz. Er wurde unter anderem auch für die Stiftung mehrerer Kirchen und als Bauherr der Kanitz-Kyawschen Gruft in Hainewalde bekannt."},{"page_url":"https://cs.wikipedia.org/wiki/Kassel","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/73/Alte_Br%C3%BCderkirche_Kassel.jpg","page_title":"Kassel","context_page_description":"Kassel je město na severu spolkové země Hesensko v Německu. Je po Frankfurtu nad Mohanem a Wiesbadenu třetím největším městem Hesenska. Leží asi 80 km SZ od Eisenachu, 80 km SV od Marburgu a asi 40 km JZ od Göttingen a protéká jím řeka Fulda. Horský park Wilhelmshöhe je zapsán na seznamu Světového dědictví a proslulá je i výstava moderního umění Documenta."},{"page_url":"https://en.wikipedia.org/wiki/West_African_Aquatic_Mammals_Memorandum_of_Understanding","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Humpback_dolphin.jpg","page_title":"West African Aquatic Mammals Memorandum of Understanding","context_page_description":"The Memorandum of Understanding Concerning the Conservation of the Manatee and Small Cetaceans of Western Africa and Macaronesia is a Multilateral Environmental Memorandum of Understanding and entered into effect on 3 October 2008 under the auspices of the Bonn Convention. The MoU covers 29 range States. As of August 2012, 17 range States have signed the MoU, as well as a number of cooperating organizations."},{"page_url":"https://eu.wikipedia.org/wiki/Philippe_Starck","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Mus%C3%A9e_des_Arts_d%C3%A9coratifs%2C_Paris_1.jpg","page_title":"Philippe Starck","context_page_description":"Philippe Starck bere diseinuen funtzionalitate eta estetikagatik mundu osoan ezaguna den frantziar industria-diseinatzailea da. André Starck eta Jaqueline Lanourisseren semea da Philippe Starck. 25 urterekin hasi zuen bere ibilbide profesionala, eta gaur egun 66 urterekin lan egiten jarraitzen du."},{"page_url":"https://fr.wikipedia.org/wiki/Dioc%C3%A8se_de_Ba_Ria","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Nh%C3%A0_th%E1%BB%9D_B%C3%A0_R%E1%BB%8Ba.jpg","page_title":"Diocèse de Ba Ria","context_page_description":"Le diocèse de Ba Ria est un territoire ecclésial de l'Église catholique au Viêt Nam suffragant de l'archidiocèse d'Hô-Chi-Minh-Ville, formé en 2005. Il comprenait au 31 décembre 2007, un nombre de baptisés de 228 294 fidèles, sur une population totale de 952 721 habitants, soit 24 %. Son titulaire est Mᵍʳ Emmanuel Nguyên Hong Son."},{"page_url":"https://it.wikipedia.org/wiki/Mauno_Koivisto","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Mauno_Koivisto.png","page_title":"Mauno Koivisto","context_page_description":"Mauno Henrik Koivisto è stato un economista e politico finlandese.\\nDi orientamento socialdemocratico è stato più volte ministro, presidente del Consiglio di Stato e presidente della Repubblica finlandese dal 1982 al 1994."},{"page_url":"https://pt.wikipedia.org/wiki/%C5%9Awi%C4%85tniki_G%C3%B3rne","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/%C5%9Awi%C4%85tniki_G%C3%B3rne_location_map.png","page_title":"Świątniki Górne","context_page_description":"Świątniki Górne é um município da Polônia, na voivodia da Pequena Polônia e no condado de Cracóvia. Estende-se por uma área de 4,43 km², com 2 400 habitantes, segundo os censos de 2016, com uma densidade de 540,5 hab/km²."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%93%E3%83%BC%E3%83%88%E3%83%AB_(%E9%AB%98%E9%80%9F%E8%88%B9)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/JR_Beetle2_2009.jpg","page_title":"ビートル (高速船)","context_page_description":"ビートル はJR九州高速船が運航している高速船である。\\n運航船舶はボーイング929の旅客型「ジェットフォイル」である。全没翼型水中翼船と呼ばれるタイプの水中翼船で、半没翼型水中翼船より波浪による船体の揺れが少ないといわれている。"},{"page_url":"https://en.wikipedia.org/wiki/Central_and_Western_Heritage_Trail","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/HK_RowlinsonHouse.JPG","page_title":"Central and Western Heritage Trail","context_page_description":"The Central and Western Heritage Trail is a Heritage Trail in Hong Kong, that was designed by the Antiquities and Monuments Office of the Leisure and Cultural Services Department.\\nIt covers the Central and Western District of Hong Kong and consists of 3 parts:\\nThe Central Route\\nThe Sheung Wan Route\\nThe Western District and the Peak Route"},{"page_url":"https://de.wikipedia.org/wiki/Ash%C3%A1ninka","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Ashaninka_Huanuco.jpg","page_title":"Asháninka","context_page_description":"Die Asháninka oder Asháninca sind ein indigenes Volk im östlichen Peru und westlichen Brasilien.\\nDer Name bezieht sich auf eine Volksgruppe, die im Tropenwald des westlichen Amazonasbecken im Einzugsbereich der Flüsse Apurímac, Ene, Perené, Tambo wohnt, am Ostrand der Westkordillere der Anden."},{"page_url":"https://de.wikipedia.org/wiki/One_Direction/Auszeichnungen_f%C3%BCr_Musikverk%C3%A4ufe","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/One_Direction_2015.jpg","page_title":"One Direction/Auszeichnungen für Musikverkäufe","context_page_description":"Dies ist eine Übersicht über die Auszeichnungen für Musikverkäufe der britisch-irischen Boygroup One Direction. Die Auszeichnungen finden sich nach ihrer Art, nach Staaten getrennt in chronologischer Reihenfolge, geordnet sowie nach den Tonträgern selbst, ebenfalls in chronologischer Reihenfolge, getrennt nach Medium, wieder."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%B3%D8%A7%D9%86_%D9%81%D8%B1%D9%86%D8%A7%D9%86%DA%88%D9%88%D8%8C_%D9%BE%D8%A7%D9%85%D9%BE%D8%A7%D9%86%DA%AF%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/San_Fernando_City_Hall.jpg","page_title":"سان فرنانڈو، پامپانگا","context_page_description":"سان فرنانڈو، پامپانگا فلپائن کا ایک رہائشی علاقہ جو پامپانگا میں واقع ہے۔"},{"page_url":"https://no.wikipedia.org/wiki/T%C3%B5rva","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Eesti_torva_linn.png","page_title":"Tõrva","context_page_description":"Tõrva er en by og bykommune i Valga fylke i Estland. Kommunen har cirka 3 100 innbyggere og et areal på 4,8 km². Tõrva fikk bystatus 1. mai 1938. Folketallet er svakt fallende. Selve tettstedet har 3.163 innbyggere.\\nTõrva er helt omgitt av landkommunen Helme, som byen også er administrasjonssenter for."},{"page_url":"https://de.wikipedia.org/wiki/Hillsboro_(North_Dakota)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Traill_County_Courthouse.jpg","page_title":"Hillsboro (North Dakota)","context_page_description":"Hillsboro ist eine Kleinstadt und Verwaltungssitz des Traill County im US-amerikanischen Bundesstaat North Dakota. Im Jahr 2010 hatte Hillsboro 1603 Einwohner."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rechters_in_het_Hooggerechtshof_van_de_Verenigde_Staten","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/RobertTrimble.jpg","page_title":"Lijst van rechters in het Hooggerechtshof van de Verenigde Staten","context_page_description":"Dit is een lijst van de rechters in het Hooggerechtshof van de Verenigde Staten."},{"page_url":"https://de.wikipedia.org/wiki/Museum_Villa_Haiss","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Walter_Bischoff.jpg","page_title":"Museum Villa Haiss","context_page_description":"Das Museum Villa Haiss ist ein privates Museum für moderne Kunst in Deutschland. Es befindet sich in dem badischen Ort Zell am Harmersbach, einer ehemaligen Freien Reichsstadt, im Ortenaukreis, unweit von Offenburg. Das 1830 von einem Fabrikanten erbaute, heute denkmalgeschützte Haus, wurde in den 1990er Jahren von dem Galeristen Walter Bischoff erworben, der die Villa restaurierte und nach zweijähriger Umbauzeit 1997 als privates Museum für zeitgenössische Kunst eröffnete. Für Ausstellungen stehen insgesamt 850 m² zur Verfügung. Das Museum zeigt eine repräsentative Sammlung mit Malerei, Fotografien und Skulpturen der europäischen und amerikanischen Kunst seit 1945. Im gegenüber liegenden Park befinden sich aus der Museumsammlung seit 1999 fünf Originalelemente der Berliner Mauer. Es sind dies die einzigen fünf zusammenhängenden Teile außerhalb Berlins.\\nIn den beiden Obergeschossen wird die ständige Ausstellung präsentiert. Zu den circa 140 Werken der gezeigten Sammlung gehören Arbeiten der Künstler Joseph Beuys, Jürgen Brodwolf, Christo, Yves Klein, Arnulf Rainer, Gerhard Richter, Julian Schnabel, Walter Stöhrer und Jean Tinguely."},{"page_url":"https://fr.wikipedia.org/wiki/Vara%C5%BEdinske_Toplice","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Varazdinske_Toplice.jpg","page_title":"Varaždinske Toplice","context_page_description":"Varaždinske Toplice est une ville et une municipalité située dans la région de Hrvatsko Zagorje, dans le comitat de Varaždin, en Croatie. Au recensement de 2001, la municipalité comptait 6 973 habitants, dont 98,87 % de Croates et la ville seule comptait 1 877 habitants.\\nVaraždinske Toplice est réputé pour ses eaux aux propriétés thermales qui atteignent une température de 58 °C."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B2%D0%B8%D0%B9_%D0%B0%D0%BA%D0%B0%D0%B4%D0%B5%D0%BC%D1%96%D1%87%D0%BD%D0%B8%D0%B9_%D0%BA%D0%BE%D1%80%D0%BF%D1%83%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/%D0%A1%D0%BA%D0%BE%D0%B2%D0%BE%D1%80%D0%BE%D0%B4%D0%B8_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D1%96%D1%8F_%D0%B2%D1%83%D0%BB.%2C_2_IMG_0233.jpg","page_title":"Новий академічний корпус","context_page_description":"Нови́й академі́чний ко́рпус — навчальний корпус Національного університету «Києво-Могилянська академія» у стилі пізнього класицизму, розташований у південній частині академічного подвір'я, на розі Контрактової площі та Іллінської вулиці. Будувався протягом 1822-1825 років та добудовувався пізніше.\\nПостановою Ради Міністрів УРСР від 6 вересня 1979 року № 442 корпус внесено до списку пам'яток містобудування і архітектури Української РСР, що перебувають під охороною держави з охоронним номером 15/5 у складі Комплексу споруд Києво-Могилянської Академії. Комплекс споруд разом з корпусом отримав статус пам'ятки архітектури та історії національного значення у 2009 році.\\nПервинно корпус призначений для навчання і проживання студентів і викладачів Київської духовної академії, збудований за проектом архітектора Л. Шарлеманя міським архітектором А. Меленським.\\nУ 1812 р. А. Меленський здійснив проект перепланування території Братського монастиря, що передбачав розширення і упорядкування його садиби, розкриття північного фронту забудови. У квітні 1819 р. 12 планів Меленського з фасадами і описом старих і новоспланованих монастирських будівель було затверджено митрополитом Серапіоном."},{"page_url":"https://ca.wikipedia.org/wiki/Zommange","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Map_commune_FR_insee_code_57763.png","page_title":"Zommange","context_page_description":"Zommange és un municipi francès, situat al departament del Mosel·la i a la regió del Gran Est. L'any 2007 tenia 36 habitants."},{"page_url":"https://cs.wikipedia.org/wiki/Nov%C3%BD_%C5%BEidovsk%C3%BD_h%C5%99bitov_v_Ostrav%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/New_jewish_cementery_Ostrava.jpg","page_title":"Nový židovský hřbitov v Ostravě","context_page_description":"Nový židovský hřbitov v Ostravě je součástí Ústředního hřbitova na ulici Na Najmanské ve Slezské Ostravě, zhruba 1,5 km jihovýchodně od centra města. Nachází se v jeho severozápadním rohu. Jeho rozloha činí 3 370 m² a nalézá se zde zhruba 170 náhrobků."},{"page_url":"https://de.wikipedia.org/wiki/Ernst_Giese_(Architekt)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Rathaus_in_Sch%C3%B6nheide_Bericht_in_der_Architektonischen_Rundschau_von_1885.jpg","page_title":"Ernst Giese (Architekt)","context_page_description":"Ernst Giese war ein deutscher Architekt und Hochschullehrer an der Düsseldorfer Kunstakademie und an der Technischen Hochschule Dresden; er führte die Titel „Baurat“ und „Geheimer Hofrat“."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%81%D9%88%D9%84%DA%A9%D9%85%D8%A7%D8%B1%D8%B3%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/20142505_St.-Marien-Kirche_Volkmarsen.jpg","page_title":"فولکمارسن","context_page_description":"فولکمارسن آلمانین هسن ایالتینده یئر آلان بیر شهردیر و ۲۵۹ متر دنیز سوییه‌سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا ۶۹۴۹ نفر دیر. بۇ شهرین ۶۷٫۴۷ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://fr.wikipedia.org/wiki/Tazria","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/11/Ezekiel.jpg","page_title":"Tazria","context_page_description":"Tazria, 13ᵉ mot et premier significatif de la parasha, ou plus exactement ki tazria est la 27ᵉ section hebdomadaire du cycle annuel de lecture de la Torah et la quatrième du Livre du Lévitique.\\nElle correspond à Lévitique 12:1–13:59. Les Juifs de la Diaspora la lisent le 26 ou 27ᵉ Shabbat après Simhat Torah, généralement en avril.\\nLe calendrier juif luni-solaire comprend jusqu'à 54 semaines, le nombre exact variant selon les années, \\"pleines\\" ou \\"défectives\\". Dans les années pleines, la parashat Tazria est lue indépendamment. Dans les années de moins de 54 semaines, la lecture de la Torah combine cette parasha et la suivante, Metzora, afin d'atteindre le nombre de lectures hebdomadaires requis."},{"page_url":"https://eo.wikipedia.org/wiki/Jacobus_Arminius","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Jacobus_Arminius_02_IV_13_2_0026_01_0309_a_Seite_1_Bild_0001.jpg","page_title":"Jacobus Arminius","context_page_description":"Jakobo ARMINIO, estis Nederlanda pastoro kaj teologo."},{"page_url":"https://ro.wikipedia.org/wiki/Stejeri%C8%99,_Mure%C8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Josephinische_Landaufnahme_pg143.jpg","page_title":"Stejeriș, Mureș","context_page_description":"Stejeriș este un sat în comuna Acățari din județul Mureș, Transilvania, România. Se află în partea de sud a județului, pe Niraj."},{"page_url":"https://ca.wikipedia.org/wiki/Les_Cro%C3%BBtes","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Croutes_%C3%A9glise_00157.jpg","page_title":"Les Croûtes","context_page_description":"Les Croûtes és un municipi francès, situat al departament de l'Aube i a la regió del Gran Est. L'any 2007 tenia 104 habitants."},{"page_url":"https://fr.wikipedia.org/wiki/Symbole_de_Wythoff","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Tetrahedral_reflection_domains.png","page_title":"Symbole de Wythoff","context_page_description":"En géométrie, un symbole de Wythoff est une notation courte, créée par le mathématicien Willem Abraham Wythoff, pour nommer les polyèdres réguliers et semi-réguliers utilisant une construction kaléidoscopique, en les représentant comme des pavages sur la surface d'une sphère, sur un plan euclidien ou un plan hyperbolique.\\nLe symbole de Wythoff donne 3 nombres p, q, r et une barre verticale positionnelle qui sépare les nombres avant et après elle. Chaque nombre représente l'ordre des miroirs à un sommet du triangle fondamental.\\nChaque symbole représente un polyèdre uniforme ou un pavage, bien qu'un même polyèdre/pavage puisse avoir des symboles de Wythoff différents à partir de générateurs symétriques différents. Par exemple, le cube régulier peut être représenté par 3 | 4 2 avec une symétrie Oₕ et 2 4 | 2 comme un prisme carré avec deux couleurs et une symétrie D₄ₕ, autant que 2 2 2 | avec 3 couleurs et une symétrie D₂ₕ."},{"page_url":"https://ca.wikipedia.org/wiki/Canal_de_Panam%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/PuenteAmericas3.jpg","page_title":"Canal de Panamà","context_page_description":"El canal de Panamà, inaugurat el 15 d'agost de 1914, amb la seva singular ubicació en el punt més estret entre l'oceà Atlàntic i l'oceà Pacífic, ha tingut un efecte d'àmplies projeccions en escurçar la distància i el temps de comunicació marítima, i ha produït avenços econòmics i comercials al llarg de gairebé tot el segle xx."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%89%AF%E6%B4%9E%E5%B8%82%E5%A0%B4%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Gwangju-metro-107-Yangdong-market-station-entrance-3-20190521-073928.jpg","page_title":"良洞市場駅","context_page_description":"良洞市場駅は、大韓民国光州広域市西区にある光州都市鉄道1号線の駅である。駅番号は107。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%80%D0%B8%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Bundesarchiv_N_1603_Bild-121%2C_Russland%2C_Sewastopol%2C_zerst%C3%B6rter_Hafen.jpg","page_title":"Крим","context_page_description":"Крим, Кри́мський піво́стрів, раніше Таврія, Газарія — півострів на північному узбережжі Чорного моря, з північного сходу омивається Азовським морем. Розташований на півдні України та охоплює Автономну Республіку Крим, Севастополь та частково південь Херсонської області; більша частина півострова з кінця лютого 2014 року захоплена і окупована російськими регулярними військовими частинами, а пізніше тимчасово анексована Російською Федерацією.\\nОкупація півострова міжнародно не визнана та визначається як акт незаконної анексії внаслідок збройної агресії Росії. АР Крим та Севастополь мають міжнародно-правовий статус «територій України, тимчасово окупованих Росією». На незаконно анексованій території Криму російська влада утворила так звані «суб'єкти Російської Федерації» «Республіка Крим» і «місто федерального значення Севастополь». У 2014—2015 роках встановлена система міжнародних санкцій за будь-яке визнання Криму частиною Росії та спроби легалізації незаконної окупації півострова."},{"page_url":"https://it.wikipedia.org/wiki/Th%C3%A9roigne_de_M%C3%A9ricourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Theroigne_de_Mericourt.jpg","page_title":"Théroigne de Méricourt","context_page_description":"Théroigne de Méricourt, pseudonimo di Anne-Joseph Terwagne, è stata una politica e rivoluzionaria belga di tendenze femministe, protagonista in importanti eventi della Rivoluzione francese del 1789."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%AF%D0%BF%D0%BE%D0%BD%D1%81%D1%8C%D0%BA%D1%96_%D0%BA%D0%B0%D1%80%D1%82%D0%BE%D0%B3%D1%80%D0%B0%D1%84%D1%96%D1%87%D0%BD%D1%96_%D1%81%D0%B8%D0%BC%D0%B2%D0%BE%D0%BB%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Japanese_Map_symbol_%28Historic_battlefield%29.PNG","page_title":"Японські картографічні символи","context_page_description":"Японські картографічні символи — особливі знаки, що використовують в японській картографії для позначення наземних об'єктів. Згідно положень Інституту географії Японії більшість таких знаків використовують зі світлим пунсоном, який розміщують нижче і який вказує на точне розташування об'єкта. Для геодезичних знаків центром розміщення точкового об'єкта слугує темний пунсон, що входить до складу знака.\\nЗ огляду на збільшення туристичних потоків до країни під час Олімпіади в Токіо 2020 року, для зручності іноземців Інститутом географії був розширений стандартний список позначень важливими для туристів об'єктами. Значна кількість умовних картографічних знаків стандартизована і включена до символів Юнікод у ревізії 5.2, але частина символів залишаються поза цим стандартом."},{"page_url":"https://en.wikipedia.org/wiki/Asian_Century","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Free_Trade_Areas.PNG","page_title":"Asian Century","context_page_description":"The Asian Century is the projected 21st-century dominance of Asian politics and culture, assuming certain demographic and economic trends persist. The concept of Asian Century parallels the characterisation of the 19th century as Britain's Imperial Century, and the 20th century as the American Century and Pax Sovietica.\\nA 2011 study by the Asian Development Bank found that an additional 3 billion Asians could enjoy living standards similar to those in Europe today, and the region could account for over half of global output by the middle of this century. It warned, however, that the Asian Century is not preordained.\\nThe growing importance and emphasis of unity in Asia, as well as maturing and progressive relationships among countries in the region further solidify the creation of the 21st Asian Century."},{"page_url":"https://fr.wikipedia.org/wiki/Ashigaru","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Hara-ate_karuta_tatami_dou.JPG","page_title":"Ashigaru","context_page_description":"Le mot ashigaru signifie « pied léger ». Ce sont les unités d'infanterie de base du Japon médiéval, principalement constituées de paysans coiffés du jingasa. Leur nom provient du peu d'armure dont ils disposaient, leur offrant une certaine mobilité mais peu de protection.\\nL'arme de l'ashigaru était théoriquement le naginata mais, avec le temps, leur armement a été de plus en plus constitué de yari pour finalement être remplacé par les arquebuses tanegashima ou teppo. Ils constituaient la majeure partie des troupes d'une armée et la presque totalité des troupes à pied.\\nAu départ, de simples paysans armés de manière désordonnée, ils devinrent de vraies troupes d'infanterie, armées de mousquets après l'apparition de ceux-ci au XVIᵉ siècle. Ils étaient redoutables en groupe. Le rôle qu'ils ont joué dans la victoire d'Oda Nobunaga sur la cavalerie Takeda à la bataille de Nagashino reste célèbre."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%B0%D0%BA_%D1%88%D0%B5%D1%82%D1%9A%D0%B8_%D1%81%D0%B2%D0%B5%D0%BC%D0%B8%D1%80%D0%BE%D0%BC_1965%E2%80%941999.","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/Upgrading_Hubble_during_SM1.jpg","page_title":"Списак шетњи свемиром 1965—1999.","context_page_description":"Ова листа садржи све шетње свемиром и Месецом спроведене између 1965. и 1999. године током којих су космонаути делом или у целости напустили свемирску летелицу. Уноси за шетње по површини Месеца имају сиву позадину, док су уноси за све остале изласке у отворени свемир необојени.\\nТоком свих излазака у отворени свемир космонаути су били повезани са свемирском летелицом, осим у седам наврата када астронаути из САД нису били повезани — шест пута током 1984. године користећи јединицу за маневрисање, и једном 1994. године приликом испитивања уређаја Сејфер. Током свих шетњи по површини Месеца астронаути нису били везани за свемирску летелицу којом су се спустили, а у појединим приликама астронаути су одлазили довољно далеко да су губили визуелни контакт са летелицом. Један излазак у отворени свемир на површини Месеца не спада у „шетње Месецом“. Током њега, астронаути су само провирили кроз горњи отвор на лендеру, јер је контрола мисије сматрала да ће са веће висине моћи да осмотре већу површину око места слетања и тако одаберу које локације ће посетити током шетњи по површини."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D1%80%D0%B0%D1%84%D0%B5%D1%80%D0%BD%D0%B0%D0%BB%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Old_Japanese_military_paraphernalia.jpg","page_title":"Параферналия","context_page_description":"Параферналия — совокупность снаряжения, оборудования, принадлежностей, используемых для занятий определенного рода, и, как следствие, являющихся отличительными чертами этих занятий. Параферналия может быть связана со спортом, хобби, историческим периодом, и так далее."},{"page_url":"https://en.wikipedia.org/wiki/Anatrytone_logan","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Delaware_Skipper_-_Anatrytone_logan%2C_Green_Ridge_State_Forest%2C_Flintstone%2C_Maryland_-_28173792996.jpg","page_title":"Anatrytone logan","context_page_description":"Anatrytone logan, the Delaware skipper, is a North American butterfly. It is a member of the subfamily Hesperiinae, the grass skippers. This skipper ranges from the southern Canadian Prairies and southern Ontario through the midwestern and eastern United States."},{"page_url":"https://en.wikipedia.org/wiki/Zygentoma","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Thermobia_domestica1.jpg","page_title":"Zygentoma","context_page_description":"Zygentoma are an order in the class Insecta, and consist of about 550 known species. The Zygentoma include the so-called silverfish or fishmoths, and the firebrats. A conspicuous feature of the order are the three long caudal filaments. The two lateral filaments are cerci, and the medial one is an epiproct or appendix dorsalis. In this they resemble the Archaeognatha, although the cerci of Zygentoma, unlike in the latter order, are nearly as long as the epiproct.\\nUntil the late twentieth century the Zygentoma were regarded as a suborder of the Thysanura, until it was recognized that the order Thysanura was paraphyletic, thus raising the two suborders to the status of independent monophyletic orders, with Archaeognatha as sister group to the Dicondylia, including the Zygentoma."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%83%D0%BF%D1%81%D1%82%D0%B8%D1%85_(%D0%9E%D0%BB%D1%8C%D1%88%D1%82%D0%B8%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BE%D0%B2%D1%96%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/%C5%81upstych_and_Lake_Ukiel%2C_airview.jpg","page_title":"Лупстих (Ольштинський повіт)","context_page_description":"Лупстих — село в Польщі, у гміні Ґетшвалд Ольштинського повіту Вармінсько-Мазурського воєводства.\\nНаселення — 281 особа.\\nУ 1975-1998 роках село належало до Ольштинського воєводства."},{"page_url":"https://nl.wikipedia.org/wiki/Tverskaja_(metrostation_Moskou)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/MWunderPS-1.jpg","page_title":"Tverskaja (metrostation Moskou)","context_page_description":"Tverskaja is een station aan de Zamoskvoretskaja-lijn van de Moskouse metro. Dit station was al opgenomen in het ontwerp van lijn 2 uit 1934. Het is echter pas gebouwd in de jaren 70 van de twintigste eeuw om een overstap op de toen gebouwde lijnen 7 en 9 mogelijk te maken."},{"page_url":"https://da.wikipedia.org/wiki/Nicolai_Jonathan_Meinert","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Nicolai_Jonathan_Meinert_1863_by_Hallager.jpg","page_title":"Nicolai Jonathan Meinert","context_page_description":"Nicolai Jonathan Meinert var en dansk grosserer og politiker, far til Mathilde og Frederik Meinert."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%88%86%E6%B5%81_(%E6%B0%B4%E6%96%87%E5%AD%A6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Bifurkation-Melle.JPG","page_title":"分流 (水文学)","context_page_description":"分流在水文学上指从主干河流中分出一条或多条河道的情况。与之相反的情况称为支流。\\n很多时候河道有大量沉积物时，河道上的河水往往会分开流动。如在河流汇入海洋或湖泊附近的三角洲地区，沉积作用经常导致主河道多次分流，造成扇形网状的水系结构。\\n在有些河道上，人们出于防止洪水、农业灌溉等需要而修建了人工分流。"},{"page_url":"https://fr.wikipedia.org/wiki/Toussaint_L%C3%A9zat","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Lezat-Ch.Jouas.jpg","page_title":"Toussaint Lézat","context_page_description":"Toussaint Lézat, né le 24 octobre 1804 à Thil, mort en 1884, est un géomètre et pyrénéiste français, connu pour avoir fait de nombreuses ascensions dans la région de Luchon et avoir réalisé un plan en relief des montagnes du Luchonnais.\\nToussaint Lézat est géomètre du cadastre. Il préfère se présenter comme ingénieur civil. C'est un excellent grimpeur, passionné par la montagne et y faisant de fréquentes ascensions, principalement dans les environs de Luchon. Le 29 août 1844, deux ans après les première et deuxième ascensions de l'Aneto, réalisées consécutivement par l'équipe Tchihatcheff et Franqueville, Lézat, accompagné d'un M. Augère, de Muret, et des guides Nate, Ursule et Estrejo, effectuent la troisième, en deux jours, avec une étape à la Rencluse : format désormais classique.\\nEn 1850, Lézat fonde la première compagnie des guides de la Maladeta à Luchon. Elle est aujourd'hui devenue la Compagnie des guides de Luchon.\\nEn 1858, Lézat réalise les cartes, plans et tableaux pour un ouvrage du docteur Lambron, une des figures du Luchon de l'époque : Les Pyrénées et les eaux thermales sulfurées de Bagnères-de-Luchon, Paris, Napoléon Chaix, 1860."},{"page_url":"https://nl.wikipedia.org/wiki/Mikl%C3%B3s_B%C3%A9la_Hoffer","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Madonna_met_kind_%28Dronrijp%29.JPG","page_title":"Miklós Béla Hoffer","context_page_description":"Miklós Béla Hoffer was een Nederlandse tekenleraar en beeldhouwer."},{"page_url":"https://mg.wikipedia.org/wiki/Bridgetown","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Bridgetown%2C_Barbados..JPG","page_title":"Bridgetown","context_page_description":"I Bridgetown dia tanàna renivohitr'i Barbady."},{"page_url":"https://mn.wikipedia.org/wiki/SAMBA_%D0%BF%D1%80%D0%BE%D0%B3%D1%80%D0%B0%D0%BC_%D1%85%D0%B0%D0%BD%D0%B3%D0%B0%D0%BC%D0%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Samba.png","page_title":"SAMBA програм хангамж","context_page_description":"Самба гэсэн маш олон ойлголтууд байдаг. Үүнд: Самба үйлдлийн систем, Самба сервер, Самба төсөл гэх мэт. Мөн Самба нь SMB/CIFS протокол ашиглан файл болон Принт Сервер-ийн үйлчилгээ үзүүлдэг. Самба нь бусад SMB/CIFS-ийн шийдлүүдээс ялгаатай тал нь Линукс/Юникс сервер болон Виндоуз дээр суурилсан хэрэглэгч хоорондох харилцан ажиллагааг бүрэн хангадагаараа давуу талтай юм.\\nЭнэ бүгдийг нэгтгээд үзэхэд Самба бол нээлттэй эхийн үнэгүй програм хангамжийн цуглуулга гэж хэлж болно. Учир нь Самба нь GNU General Public License –ийн лицензийн эрхтэй үйлдлийн систем. Мөн Software Freedom Convervancy –ийн гишүүн. GNU General Public License гэдэг нь өргөн хэрэглэгддэг үйлдлийн системүүдэд олгодог бөгөөд ийм лицензтэй үйлдлийн системийг ашиглаж буй хувь хүн болон байгууллага нь чөлөөтэй ашиглаж болдог. Үүнд үйлдлийн системийн програм хангамжийг өөрчлөх хуулбарлах гэх зэрэг үйлдлүүд орно. Харин Software Freedom Convervancy нь 2006 онд байгууллагдсан нээлттэй эхийн програм хангамжийг дэмжин ажиллаж үйлчилгээ үзүүлдэг байгууллага юм. Самба нь платформ дээр ажиллах чадвартай бөгөөд Microsoft Windows, Unix, Linux, IBM System 390, OpenVMS болон бусад үйлдлийн систем дээр ажиллах боломжтой."},{"page_url":"https://it.wikipedia.org/wiki/Impianto_dentale","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Panoramic_radiograph_of_historic_dental_implants.jpg","page_title":"Impianto dentale","context_page_description":"L'impianto dentale è un dispositivo medico di tipo chirurgico utilizzato per riabilitare funzionalmente ed esteticamente la perdita o la mancanza congenita di uno o più denti, permettendo il sostegno di un sostituto protesico tramite il supporto diretto dell'osso grazie a un processo biologico noto come osteointegrazione; può essere inserito sia nella mandibola che nella mascella.\\nL'elemento di impianto viene inserito immediatamente, in modo che l'osteointegrazione avvenga più facilmente, mentre solo dopo viene aggiunta la protesi dentale visibile; è quindi necessaria una quantità variabile di tempo per arrivare a una corretta osteointegrazione. Il tipo più comunemente utilizzato è formato da una o più sezioni, di forma usualmente variabile tra cilindrica e tronco conica, ed è fornito spesso nella sua parte endossea di spire o altri elementi di ritenzione accessori. Può essere utilizzato per il supporto di corone protesiche singole e ponti, fino ad arcate complete. Il materiale più frequentemente utilizzato è il titanio nella sua forma pura, in quanto permette una migliore osteointegrazione, andando a formare un intimo legame con l'osso."},{"page_url":"https://fr.wikipedia.org/wiki/Le_Temps_%C3%A0_l%27%C5%93uvre","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Louvre-Lens_-_Le_Temps_%C3%A0_l%27%C5%93uvre_-_24_C_-_INV_18901_G.JPG","page_title":"Le Temps à l'œuvre","context_page_description":"Le Temps à l'œuvre est une exposition temporaire du Louvre-Lens qui a lieu dans le Pavillon de verre du 4 décembre 2012, jour de l'inauguration du musée, au 21 octobre 2013. Cette exposition présente un peu plus de 125 œuvres, allant de l'Antiquité jusque 2011. Le thème est la perception du temps.\\nBien que la plupart de ces œuvres proviennent des collections du musée du Louvre, des œuvres ont également été prêtées par des musées régionaux tels que le MUba Eugène Leroy à Tourcoing, le musée du Mont-de-Piété de Bergues, le Château-musée de Boulogne-sur-Mer, le musée de l'hôtel Sandelin de Saint-Omer, le Musée du dessin et de l'estampe originale de Gravelines...\\nL'exposition étant d'accès gratuit et située dans le prolongement de La Galerie du temps, elle a accueille plusieurs centaines de milliers de visiteurs. Elle a été remplacée par Voir le sacré."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%8E%E5%B3%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Sunchine_on_Great_Seto_Bridge.jpg","page_title":"与島","context_page_description":"与島は、香川県坂出市の瀬戸内海に浮かぶ塩飽諸島の島。\\n与島を中心に、坂出市に属する櫃石島、岩黒島、与島、鍋島、小与島、瀬居島、沙弥島などを束ねて与島諸島とも言う。"},{"page_url":"https://pl.wikipedia.org/wiki/Jean-Antoine_Houdon","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Jean_antoine_houdon-rembrandt_peale.jpg","page_title":"Jean-Antoine Houdon","context_page_description":"Jean-Antoine Houdon – francuski rzeźbiarz neoklasyczny, wolnomularz.\\nUkończył w 1761 Królewska Akademię Malarstwa i Rzeźby. Jego nauczycielem był Jean-Baptiste Pigalle. W 1771 po 10-letnim pobycie w Rzymie powrócił na stałe do Paryża. Był twórcą posągów mitologicznych i alegorycznych. Zasłynął jako doskonały portrecista. Houdon jest znany z przedstawień filozofów, wynalazców i polityków. W jego twórczości możemy odnaleźć rzeźby takich osób jak Denis Diderot, Benjamin Franklin, Jean-Jacques Rousseau, Voltaire, Molière, George Washington, Thomas Jefferson, Ludwik XVI, Robert Fulton oraz Napoleon Bonaparte. W 1778 został członkiem loży masońskiej. 1 lipca 1786 poślubił Marie-Ange Langlois, był ojcem trzech córek. Pochowany został na cmentarzu Montparnasse"},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_d%27Amposta","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Antigues_Escoles_Miquel_Granell_%28Amposta%29P1050801.JPG","page_title":"Llista de monuments d'Amposta","context_page_description":"Llista de monuments d'Amposta inclosos en l'Inventari del Patrimoni Arquitectònic Català per al municipi d'Amposta. Inclou els inscrits en el Registre de Béns Culturals d'Interès Nacional amb la classificació de monuments històrics, els Béns Culturals d'Interès Local de caràcter immoble i la resta de béns arquitectònics integrants del patrimoni cultural català."},{"page_url":"https://en.wikipedia.org/wiki/Mohammad_Roshandel","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Mohammad_Roshandel.jpg","page_title":"Mohammad Roshandel","context_page_description":"Mohammad Roshandel is an Iranian Football Defender who played for Iranian football club Sepahan in the Azadegan League."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%DB%8C%D8%B1_(%D8%B3%D8%B1%D8%AF%D9%87)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Flor_de_cebola_2.jpg","page_title":"سیر (سرده)","context_page_description":"سیر، تره، والک یا پیاز نام یک سرده از گیاهان است. سیر به زبان لاتین Allium گفته می‌شود. این جنس به وسیلهٔ پوشینه‌های یک پارچه، الیافی یا توری به رنگ‌های سیاه، خاکستری یا مایل به قهوه‌ای پوشیده شده که در بعضی گروه‌ها به صورت دسته‌ای به یک ساقهٔ زیرزمینی متصل گردیده‌اند. برگ‌ها همگی قاعده‌ای ولی در عضی گروه‌ها برگ‌ها به صورت غلاف‌های کوتاه یا بلندی به دور ساقهٔ گل پیچیده شده که در انتها به شکل پهنک گسترده‌ای دیده می‌شوند. برگ‌های له شدهٔ این گیاهان ممکن است بوی پیاز خوراکی را داشته باشند. گل آذین چتر این گیاهان شامل چند یا تعداد زیادی گل است که قبل از شکوفایی در یک پوشش محافظ احاطه شده و بعد از شکفتن چتر این پوشش یا می‌افتد یا به تعداد یک تا ۴ برگه غشایی شفاف در پای چتر باقی می‌ماند. در گونه‌های ایرانی گل‌ها، به رنگ سفید، مایل به سبز، زرد مایل به قرمز، قهوه‌ای، ارغوانی یا یاسمنی تا بنفش دیده می‌شود. دارای ۶۰۰ تا ۷۵۰ گونه است که تقریباً تمام آن‌ها در نیم کره شمالی بخصوص در مرکز و جنوب غربی آسیا یافت می‌شود. در ایران در حدود ۷۰ گونه از آن‌ها وجود دارد. این جنس شامل گونه‌های مهم سبزیجات از قبیل پیاز، تره، و سیر بوده و بعضی از گونه‌های آن ارزش زینتی دارند."},{"page_url":"https://fi.wikipedia.org/wiki/Amerikankarpalo","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/Vaccinium-macrocarpon-total.JPG","page_title":"Amerikankarpalo","context_page_description":"Amerikankarpalo on puolukoiden sukuun kuuluva ikivihreä varpu. Se kasvaa luonnonvaraisena soilla Pohjois-Amerikan koillisosissa. Lehdet ovat 10–20 mm pitkät ja suuremmat kuin isokarpalolla.\\nAmerikankarpalosta on kehitetty runsaasti viljelylajikkeita Pohjois-Amerikassa, jossa sitä kasvatetaan laajoilla aloilla.\\nPohjois-Amerikan intiaanit tunsivat amerikankarpalon hyvin ja esittelivät sen uudisasukkaille Massachusettsissa. Vähitellen karpalohillosta tuli olennainen osa periamerikkalaista kiitospäivän ateriaa tai jouluateriaa.\\nKarpaloa viljellään Yhdysvalloissa ja Kanadassa. Se on hyvä hyötymarja, jonka maku paranee pakkasten jälkeen. Karpalo poimitaan myöhään syksyllä tai varhain keväällä. Marjat säilyvät talven yli varastossa. Karpalosta valmistetaan mehua ja muita juomia, hyytelöä, sosetta ja nektaria."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D1%83_%D0%9D%D0%B5%D0%B5%D1%80%D0%B2%D0%B8%D0%BD%D0%B4%D0%B5%D0%BD%D0%B0_(1693)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Schlacht_bei_Neerwinden_%281693%29.jpg","page_title":"Сражение у Неервиндена (1693)","context_page_description":"Сражение у Неервиндена или у Ландена — сражение состоявшееся 29 июля 1693 года во время войны Аугсбургской лиги между Французской армией маршала Люксембурга и союзной армией под командованием принца Вильгельма Оранского. Сражение окончилось победой французов."},{"page_url":"https://az.wikipedia.org/wiki/Klapa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Klapa_Sagena_koncert_Kri%C5%BE_nek_ti_sa%C4%8Duva_ime_Vatroslav_Lisinski_7_rujna_2008.jpg","page_title":"Klapa","context_page_description":"Klapa — Xorvatiyanın Dalmaçiya vilayətində ənənəvi a kapella oxuma forması. 2012-ci ildə klapa YUNESKO-nun qeyri-maddi mədəni irs siyahısına salınıb."},{"page_url":"https://en.wikipedia.org/wiki/Soyuz_TMA-01M","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Soyuz-TMA-01M-Mission-Patch.svg","page_title":"Soyuz TMA-01M","context_page_description":"Soyuz TMA-01M was a Soyuz flight that transported three members of the Expedition 25 crew to the International Space Station. TMA-01M was the 107th flight of a Soyuz spacecraft, and the first flight of the modernized TMA-M series. The spacecraft remained docked to the space station during Expedition 25, to serve as an emergency escape vehicle. The spacecraft's COSPAR ID was 2010-052A."},{"page_url":"https://et.wikipedia.org/wiki/Gordon_Ramsay","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Gordon_Ramsay.jpg","page_title":"Gordon Ramsay","context_page_description":"Gordon James Ramsay, OBE, on briti peakokk, ka telekokk ja gastronoom ning mitme kokaraamatu autor.\\nGordon Ramsay on alates 1996. aastast abielus Cayetana Elizabeth Hutchesoniga ja peres kasvab 5 last: Megan, Matilda, kaksikud Jack ja Holly ning Oscar.\\nTa hoiab töös 18 restorani Suurbritannias, Ameerika Ühendriikides, Jaapanis ja Dubais. Vahepeal oli neil restoranidel kokku 15, kuid 2012. aasta seisuga oli lisandunud veel 12 Michelini tärni.\\nRamsay on tunnustatud telesaatejuht, kelle hinnatud saatesarjade hulka kuuluvad \\"Köögikubjas\\" ja \\"Põrgulikud köögid\\"."},{"page_url":"https://es.wikipedia.org/wiki/K%C3%B6%C3%A7ek","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Koceks_-_Surname-i_Vehbi.jpg","page_title":"Köçek","context_page_description":"El köçek era típicamente un joven muy guapo, rakkas, o bailarín, que normalmente travestido en atuendo femenino, era empleado como artista.​"},{"page_url":"https://nds.wikipedia.org/wiki/Selbke","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Wapen_Selbke.JPG","page_title":"Selbke","context_page_description":"Selbke [sɛˑlpkə] is eun Dörp, dat teo de Stadt Barntrup in’n Krüis Lippe in Noordrhüin-Westfolen. Up Lippsk Platt werrt de Naam van’n Dörp faken mit „in“ briuket. Man säjjet also: In’r Selbke."},{"page_url":"https://sv.wikipedia.org/wiki/Svartk%C3%A4mpar","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Plantago_lanceolata6_ies.jpg","page_title":"Svartkämpar","context_page_description":"Svartkämpar, Plantago lanceolata L. är en flerårig ört."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B3%E3%82%BD%E3%83%9C%E7%B4%9B%E4%BA%89","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e9/Kosovo_uranium_NATO_bombing1999.png","page_title":"コソボ紛争","context_page_description":"コソボ紛争コソボふんそう、アルバニア語：Lufta e Kosovës、セルビア語：Рат на Косову и Метохијиは、ユーゴスラビア内戦の過程で、バルカン半島南部のコソボで発生した2つの武力衝突を示す。\\n1998年 - 1999年：1998年2月から1999年3月にかけて行われたユーゴスラビア軍およびセルビア人勢力と、コソボの独立を求めるアルバニア人の武装組織コソボ解放軍との戦闘\\n1999年：1999年3月24日から6月10日にかけて行われた北大西洋条約機構（NATO）によるアライド・フォース作戦、この間、NATOはユーゴスラビア軍や民間の標的に対して攻撃を加え、アルバニア人勢力はユーゴスラビア軍との戦闘を続け、コソボにおいて大規模な人口の流動が起こった。\\nなお、セルビア語とアルバニア語で地名が異なる場合、この記事では「アルバニア語呼称 / セルビア語呼称」のように表記する。"},{"page_url":"https://la.wikipedia.org/wiki/Morus_alba","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Bombyx_mori_Morus_Zetarra_marugatze_zuhaitzean1.JPG","page_title":"Morus alba","context_page_description":"Morus alba est species plantarum florentium generis Mori et familiae Moracearum in Asia orientali iam diu culta, cuius folia cibum praebent insectis speciei Bombycis mori, bombycinum sericum producentibus."},{"page_url":"https://cy.wikipedia.org/wiki/Vilmos_Husz%C3%A1r","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Vilmos_Huszar.jpg","page_title":"Vilmos Huszár","context_page_description":"Peintiwr a dyluniwr o Hwngari oedd Vilmos Huszár. Adnabyddir ef orau am fod yn un o sefydlwyr symudiad arlunio'r Iseldiroedd, De Stijl.\\nGanwyd yn Bwdapest, Hwngari ac ymfudodd i'r Iseldiroedd yn 1905, gan fyw yn Voorburg gyntaf, dylanwadwyd gan arlunwaith Ciwbiaeth a Dyfodiaeth. Cyfarfu nifer o arlunwyr dylanwadol megis Piet Mondrian a Theo van Doesburg, y ddau yn ganolig yn sefydliad symudiad De Stijl gyda Huszár yn 1917. Cyd-sefydlodd gylchgrawn De Stijl yn ogystal, a dyluniodd glawr y rhifyn cyntaf.\\nYn 1918 dyluniodd gynllun lliw mewnol ar gyfer lloft Tŷ Bruynzeel yn Voorburg. Rhwng 1920 a 1921 cydweithiodd gyda Piet Zwart ar ddyluniadau dodrefn. Gadawodd y grŵp De Stijl yn 1923 a chyd-weithiodd gyda Gerrit Rietveld ar arddangosfa mewnol ar gyfer Arddangosfa Alrunio Berlin Fwyaf. Rhwng 1925, Huszár canolbwyntiodd ar ddylunio graffeg a phaentio.\\nYn 1926 creodd hunaniaeth gweledol cyflawn ar gyfer cwmni sigaret Miss Blanche Virginia, a gynhwysodd pecynnu, hysbysebu, a deunudd arddangos man gwethiant. Tynnodd y gysyniad elfennau o'r lluniau a oedd yn gysylltiedig â \\"Merched Newydd\\", neu Flappers, a oedd yn dechrau ymddangos yn yr 1920au."},{"page_url":"https://de.wikipedia.org/wiki/Bad_Blankenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Bad_Blankenburg_in_SLF.png","page_title":"Bad Blankenburg","context_page_description":"Bad Blankenburg ist eine Kleinstadt im Landkreis Saalfeld-Rudolstadt in Thüringen, die an der Thüringer Porzellanstraße liegt. Sie war bis 2007 ein staatlich anerkannter Luftkurort und bezeichnet sich selbst als Lavendelstadt.\\nDie Stadt hat knapp 7000 Einwohner und eine Fläche von 35,56 km²."},{"page_url":"https://uk.wikipedia.org/wiki/Webley_%26_Scott","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/WebleyServiceAirRifle.jpg","page_title":"Webley & Scott","context_page_description":"Webley & Scott — виробник зброї з Бірмінгему в Англії. Webley випускав ручну зброю та довгоствольної зброї з 1834 по 1979, коли компанія перейшла від виробництва вогнепальної зброї і переключила свою увагу на пневматичні пістолети та рушниці. В 2010 Webley & Scott відновили виробництво дробовиків для комерційних продажів.\\nКомпанія Webley відома своїми револьверами та автоматичними пістолетами, які вона поставляла британським військовим, в першу чергу в британську армію, починаючи з 1887 і протягом Першої та Другої світової воєн."},{"page_url":"https://vi.wikipedia.org/wiki/Carmichaelia_exsul","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Carmichaelia_exsul_kz02.jpg","page_title":"Carmichaelia exsul","context_page_description":"Carmichaelia exsul là một loài thực vật có hoa trong họ Đậu. Loài này được F.Muell. miêu tả khoa học đầu tiên."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D1%80%D0%BE%D0%B2%D0%B0%D1%80%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%B0%D0%B5%D1%80%D0%BE%D0%BF%D0%BE%D1%80%D1%82_%C2%AB%D0%9A%D0%B8%D1%97%D0%B2%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/%D0%A5%D1%80%D0%B5%D1%81%D1%82_%D0%BF%D1%80%D0%B8_%D0%B4%D0%BE%D1%80%D0%BE%D0%B7%D1%96.jpg","page_title":"Броварський аеропорт «Київ»","context_page_description":"Броварськи́й аеропо́рт «Ки́їв» побудували на території міста Бровари. У період з 1935 по 1941 роки — головний аеропорт для міста Київ. Розміщувався неподалік кінцевої частини нинішньої вулиці Броварської сотні. Знищений 25 червня 1941 під час німецького бомбардування."},{"page_url":"https://cs.wikipedia.org/wiki/Sethi_I.","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Hitt_Egypt_Perseus.png","page_title":"Sethi I.","context_page_description":"Seti I., byl faraonem 19. dynastie, která je charakteristická jednak svými válečnými výpravami proti Chetitům, monumentálními stavbami, obnovení mocenského postavení Egyptu v severních oblastech Syro-Palestiny a rozvojem obchodních vazeb s Levantou."},{"page_url":"https://pl.wikipedia.org/wiki/Park_Jurajski_(film)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Universal_Orlando_%287323913288%29.jpg","page_title":"Park Jurajski (film)","context_page_description":"Park Jurajski – amerykański film z 1993 roku, zrealizowany na podstawie książki Michaela Crichtona o tym samym tytule, wyreżyserowany przez Stevena Spielberga. Został nagrodzony trzema Oscarami. Jest jednym z najbardziej dochodowych filmów w historii. Traktuje o fikcyjnej wyspie, na której naukowcy skonstruowali park rozrywki z genetycznie wyhodowanymi dinozaurami. Pierwszy film z cyfrowym dźwiękiem DTS. Z okazji dwudziestolecia wejścia do kin, film w 2013 roku powrócił na ekrany w wersji 3D."},{"page_url":"https://sv.wikipedia.org/wiki/Antidesma_acidum","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Antidesma_acidum_Retz._02.JPG","page_title":"Antidesma acidum","context_page_description":"Antidesma acidum är en emblikaväxtart som beskrevs av Anders Jahan Retzius. Antidesma acidum ingår i släktet Antidesma och familjen emblikaväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ro.wikipedia.org/wiki/Quismondo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Quismondo%2C_Toledo.JPG","page_title":"Quismondo","context_page_description":"Quismondo este un oraș din Spania, situat în provincia Toledo din comunitatea autonomă Castilia-La Mancha. Are o populație de 1.533 de locuitori."},{"page_url":"https://en.wikipedia.org/wiki/Baumkuchen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Sakotis2.jpg","page_title":"Baumkuchen","context_page_description":"Baumkuchen is a German variety of spit cake. It is a traditional pastry of many European countries, and also a popular snack and dessert in Japan. The characteristic rings, which resemble tree rings when sliced, give the cake its German name, Baumkuchen, which literally translates to \\"tree cake\\"."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A2%D1%80%D0%B8%D0%BD%D0%B8%D1%82%D0%B8_(%D0%B3%D1%83%D0%BE,_%D0%9A%D0%B0%D0%BB%D0%B8%D1%84%D0%BE%D1%80%D0%BD%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Seal_of_Trinity_County%2C_California.png","page_title":"Тринити (гуо, Калифорния)","context_page_description":"Тринити — АЦШ Калифорния штатера гуо. Центр – гӀала Уивервилл."},{"page_url":"https://en.wikipedia.org/wiki/Don_Det","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Two_water_buffaloes_bathing_at_sunset.jpg","page_title":"Don Det","context_page_description":"Don Det, is an island in the Mekong River in the Si Phan Don archipelago in Champasak Province of southern Laos."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%AF%A1%E9%AD%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Global_capture_of_all_herring_1950%E2%80%932010.png","page_title":"鯡魚","context_page_description":"鲱鱼是大部分鲱科鱼的通称。它们多在暗沙或岸边联群游弋。其中，最常见，而且具高商业价值的鲱鱼有3种，皆属于鲱属，其捕获量占了鲱鱼总捕获量约90%。其中，三种鲱属鱼中捕获量最多的为大西洋鲱，占比过半。这三种鱼一般在北太平洋、北大西洋、波罗的海和南美洲西岸的浅水温带区出没。此外，也有一些被称作鲱鱼的鱼类在阿拉伯海、印度洋和孟加拉湾一带出没。\\n历史上，鲱鱼在欧洲渔业扮演了举足轻重的角色，对此鱼的研究在二十世纪早期为渔业学提供了长足进步的基础。此外，它们曾长年为重要的食用鱼，常以熏、腌处理保存。"},{"page_url":"https://nl.wikipedia.org/wiki/Hendrik_de_Zeevaarder","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Henry_the_Navigator1.jpg","page_title":"Hendrik de Zeevaarder","context_page_description":"Hendrik de Zeevaarder was de derde zoon van koning Johan I van Portugal en Filippa van Lancaster. Hoewel zijn bijnaam anders doet vermoeden, was hij zelf geen groot reiziger. Hij was de initiator en financier van veel reizen, die de aanzet gaven tot het Portugese wereldrijk.\\nPortugal eerde de prins in 1960 met de instelling van een Orde van de Infant Dom Henrique."},{"page_url":"https://de.wikipedia.org/wiki/Gersprenztalbahn","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Tunnel_Reinheim.jpg","page_title":"Gersprenztalbahn","context_page_description":"Die Gersprenztalbahn ist eine private Nebenbahn im Odenwald, die ursprünglich von Reinheim nach Reichelsheim führte, aber seit 1964 zwischen Groß-Bieberau und Reichelsheim abgebaut ist. Auf dem bestehenden Reststück findet zurzeit kein Verkehr mehr statt. Im Volksmund auch Lieschen genannt, wird die Verbindung – um sie vom Stockheimer Lieschen in der Wetterau zu unterscheiden – auch als „Odenwälder Lieschen“, seltener auch „Reichelsheimer Lieschen“ bezeichnet."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1924","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Portret_louis_le_roy_2006.jpg","page_title":"Lijst van personen geboren in 1924","context_page_description":"Dit is een lijst van personen die geboren zijn in 1924.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://fr.wikipedia.org/wiki/Vin_et_cuisine","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Tracle_du_bugey.jpg","page_title":"Vin et cuisine","context_page_description":"Le mariage vin et cuisine remonte à l'Antiquité. Il va traverser le Moyen Âge, s'enrichir à la Renaissance et devenir un véritable classique de nos jours. On doit distinguer dans cette alliance la cuisine du vin et la cuisine au vin qui ont été et restent les deux façons d'utiliser les apports qualitatifs du vin en gastronomie."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/Map_Canada_political_ru.png","page_title":"Канада","context_page_description":"Кана́да — государство в Северной Америке, занимает второе место в мире по площади. Омывается Атлантическим, Тихим и Северным Ледовитым океанами, имея самую длинную береговую линию в мире. Граничит с США на юге и на северо-западе, также имеет морские границы с Данией на северо-востоке и с Францией на востоке. Граница Канады и США является самой протяжённой общей границей в мире.\\nКанада — конституционная монархия с парламентарной системой, её монархом является монарх Британского Содружества наций; Канада — двуязычная и многокультурная страна, где английский и французский языки признаны официальными на федеральном уровне. Технологически и промышленно развитое государство, Канада имеет многоотраслевую экономику, базирующуюся на богатых природных ресурсах и торговле.\\nОснованная французским исследователем Ж. Картье в 1534 году, Канада берёт своё начало от французской колонии на месте современного Квебека, населённого первоначально местными народами. После периода английской колонизации из союза трёх британских колоний родилась канадская конфедерация. Канада получила независимость от Соединённого Королевства в результате мирного процесса, длившегося с 1867 по 1982 год."},{"page_url":"https://ro.wikipedia.org/wiki/Enslaved","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Enslaved-Live-Norway_Rock_2010.jpg","page_title":"Enslaved","context_page_description":"Enslaved este o formație de viking metal / black metal înființată în 1991 în Haugesund, Norvegia de către Grutle Kjellson, Ivar Bjørnson și Trym Torson. Numele formației provine de la melodia celor de la Immortal \\"Enslaved In Rot\\".\\nÎn peste 20 de ani de existență formația a lansat 13 albume de studio și 3 EP-uri."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Apfeldorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Apfeldorf_-_Apfeldorfhausen_-_Lechrainstr_Nr_5_m_Kapelle_v_SO.JPG","page_title":"Liste der Baudenkmäler in Apfeldorf","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberbayerischen Gemeinde Apfeldorf zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://it.wikipedia.org/wiki/Cacul%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Cacule-Bahia_Praca_do_Mercado.jpg","page_title":"Caculé","context_page_description":"Caculé è un comune del Brasile nello Stato di Bahia, parte della mesoregione del Centro-Sul Baiano e della microregione di Guanambi."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B5%D1%80%D0%B5%D0%B2%27%D1%8F%D0%BD%D0%B0_%D0%B0%D1%80%D1%85%D1%96%D1%82%D0%B5%D0%BA%D1%82%D1%83%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Kolochava.JPG","page_title":"Дерев'яна архітектура","context_page_description":"Дерев'я́на архітекту́ра — різновид архітектури, пов'язаний з використанням дерева. Притаманна багатьом культурам у котрих дерево є місцевим матеріалом, доступною сировиною, лісистістю місцевості, культом деревини тощо. В мистецтві і архітектурі деяких країн впродовж століть мала переважну роль."},{"page_url":"https://pt.wikipedia.org/wiki/Acad%C3%AAmicos_de_Santa_Cruz","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Quadra_Acad%C3%AAmicos_de_Santa_Cruz.jpg","page_title":"Acadêmicos de Santa Cruz","context_page_description":"Grêmio Recreativo Escola de Samba Acadêmicos de Santa Cruz é uma escola de samba brasileira da cidade do Rio de Janeiro, com sede no bairro de Santa Cruz, na zona oeste da cidade.\\nDentre as escolas de samba do carnaval carioca que já desfilaram na Marquês de Sapucaí, é a que se situa mais distante do sambódromo, localizada na Rua do Império em Santa Cruz. Atualmente é filiada a LIERJ, entidade que fundou juntamente com outras seis escolas em 2008, e participa da Série A.\\nDesde a sua estreia no carnaval carioca sempre foi tida como a escola de samba representante da zona rural do Rio, fato este que, por vezes implicava em preconceito por parte da mídia e de sambistas de outras escolas. Já no seu quarto ano de desfiles no Rio de Janeiro figurava entre as grandes do carnaval carioca. Fato este que se repetiria por mais oito vezes. A Acadêmicos de Santa Cruz porém, nunca permaneceu neste grupo.\\nA Santa Cruz sempre esteve atrelada as manifestações culturais do seu bairro e ligada aos projetos sociais. Estes já beneficiaram crianças e jovens, adultos e idosos ao longo dos anos."},{"page_url":"https://de.wikipedia.org/wiki/Technische_Universit%C3%A4t_f%C3%BCr_Bauwesen_Bukarest","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Bucharest_Arch_Faculty_1.jpg","page_title":"Technische Universität für Bauwesen Bukarest","context_page_description":"Die Technische Universität für Bauwesen Bukarest ist eine im Jahre 1864 gegründete technische Universität in der rumänischen Hauptstadt Bukarest, mit knapp 10.000 Studenten und 300 wissenschaftlichen Angestellten in 6 Fakultäten.\\nRektor der Universität ist Radu Văcăreanu."},{"page_url":"https://en.wikipedia.org/wiki/Warwick_Goble","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/9_WARWICK_GOBLE.jpg","page_title":"Warwick Goble","context_page_description":"Warwick Goble was an illustrator of children's books. He specialized in Japanese and Indian themes.\\nGoble was born in Dalston, north London, the son of a commercial traveller, and educated and trained at the City of London School and the Westminster School of Art. He worked for a printer specializing in chromolithography and contributed to The Pall Mall Gazette and The Westminster Gazette.\\nIn the 1890s, he contributed half-tone illustrations to monthly magazines such as The Strand Magazine, Pearson's Magazine, and The Boy's Own Paper. In 1893, he was exhibiting at the Royal Academy. In 1896, he began illustrating books. In 1898, he was the first to illustrate H. G. Wells's The War of the Worlds, having illustrated it for Pearson's Magazine in 1897. He briefly continued with scientific romance themes.\\nIn 1909, he became resident gift book illustrator for MacMillan and produced illustrations for The Water Babies, Green Willow, and Other Japanese Fairy Tales, The Complete Poetical Works of Geoffrey Chaucer, Stories from the Pentamerone, Folk Tales of Bengal, The Fairy Book, and The Book of Fairy Poetry."},{"page_url":"https://de.wikipedia.org/wiki/Schloss_Neustrelitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Schloss_Neustrelitz_Modell_Modellpark_Mecklenburgische_Seenplatte_Residenzschloss.jpg","page_title":"Schloss Neustrelitz","context_page_description":"Das Schloss Neustrelitz, erbaut 1726–1731 als erster Bau der späteren Residenzstadt Neustrelitz, war ab 1731 bis zum Ende der Monarchie Hauptresidenz der regierenden Herzöge und Großherzöge von Mecklenburg-Strelitz. Dem Bau einer Siedlung für Hofstaat und Landesverwaltung nahe dem Schloss folgte 1733 ein Aufruf des Herzogs zur Ansiedlung von Neubürgern. Dieses Schriftstück gilt heute als Gründungsurkunde der Stadt Neustrelitz.\\nDas Schloss Neustrelitz wurde mehrfach umgebaut und erweitert, zuletzt von 1905 bis 1909. Nach 1918 war das Schloss bis zur Wiedervereinigung der Freistaaten Mecklenburg-Strelitz und Mecklenburg-Schwerin im Jahr 1934 Sitz des demokratisch gewählten Landtags des Freistaates Mecklenburg-Strelitz. Der Strelitzer Landtag handelte hier die erste demokratische Verfassung eines deutschen Bundesstaates aus. Ferner wurden die in Jahrhunderten gewachsenen Sammlungen des strelitzschen Fürstenhauses um zahlreiche Ausstattungsstücke aus diversen Schlössern der Dynastie erweitert und als Mecklenburg-Strelitzsches Landesmuseum im Schloss ausgestellt."},{"page_url":"https://en.wikipedia.org/wiki/Sabu_(wrestler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Sabu_and_Gordon_HHoF.jpg","page_title":"Sabu (wrestler)","context_page_description":"Terry Michael Brunk is an American professional wrestler, better known by his ring name Sabu. He is currently signed to Impact Wrestling and also wrestles on the independent circuit. He is known for his trademark style of hardcore wrestling, which he pioneered in his time with Extreme Championship Wrestling from 1995 to 2000. He is a three-time World Heavyweight Champion having held the ECW World Heavyweight Championship twice and the NWA World Heavyweight Championship once.\\nUnder the tutelage of his uncle The Sheik, Brunk began his career wrestling in the North American independent scene in 1985 under the name of Sabu, before traveling to Japan, competing in Frontier Martial-Arts Wrestling and New Japan Pro-Wrestling, winning several championships, including the IWGP Junior Heavyweight Championship. He returned to the United States in 1995, briefly working for World Championship Wrestling, before beginning his most well-known stint in ECW, where he quickly became a fixture of the promotion. During his time in ECW, he became a two-time ECW World Heavyweight Champion and a one-time ECW World Television Champion."},{"page_url":"https://en.wikipedia.org/wiki/Baduy_people","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Kanekes_people%2C_28-11-2010.jpg","page_title":"Baduy people","context_page_description":"The Baduy are a traditional Bantenese community living in the southeastern part of the Indonesian province of Banten, near Rangkasbitung. They are considered an uncontacted people, a group who are almost completely isolated from the outside world."},{"page_url":"https://sk.wikipedia.org/wiki/World_Trade_Center_(1973_%E2%80%93_2001)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Marriott_World_Trade_Center.jpg","page_title":"World Trade Center (1973 – 2001)","context_page_description":"World Trade Center alebo Svetové obchodné centrum bol koncom 20. storočia veľký komplex siedmich budov, ktoré sa nachádzali na Dolnom Manhattane v meste New York v Spojených štátoch. Boli to 2 vysoké budovy Twin Towers, 3 nízke budovy, jedna vyššia budova WTC 7 a Hotel Marriott. Dňa 11. septembra 2001 bol katastrofálne zničený náletmi unesených dopravných lietadiel v rámci série teroristických útokov na USA. Celý komplex WTC pozostával aj spolu s mrakodrapmi zo 7 budov, pri ktorých sa rozprestieralo námestie. Pod ním bola verejná nákupná hala, z ktorej návštevníci a pracovníci boli spojení so všetkými časťami veľkomesta dvomi hlavnými trasami newyorského metra a vlakmi, ktorými ľudia dochádzali do New Jersey. Budovy Twin Towers boli v USA, ale i na celom svete veľmi obľúbené."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D0%B8%D0%B2%D0%B0_%D0%B2%D1%80%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Hooded_crow_map2.jpg","page_title":"Сива врана","context_page_description":"Сивата врана е врапчевидна птица од семејството на враните. Распространета е низ северна, источна и јужна Европа, вклучувајќи ја и Македонија, како и во дел од Блиски Исток. Taa e пепелавосива птица со црна глава, врат, крилја, опашка и слабини, како и црни очи, клун и нозе. Исто како другите врани, таа е сештојад и опортунист во исхраната."},{"page_url":"https://eu.wikipedia.org/wiki/Braillans","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Braillans%2C_le_lavoir-abreuvoir.jpg","page_title":"Braillans","context_page_description":"Braillans Frantziako udalerria da, Doubs departamenduan dagoena, Franche-Comté eskualdean. 2013an 166 biztanle zituen."},{"page_url":"https://en.wikipedia.org/wiki/Grevillea_thelemanniana","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Grevillea_thelemanniana.jpg","page_title":"Grevillea thelemanniana","context_page_description":"Grevillea thelemanniana, the spider-net grevillea or hummingbird bush, is a small, spreading shrub endemic to Western Australia.\\nThe species occurs in the Perth region in low-lying areas on sandy and sandy-clay soils which are generally wet in the winter."},{"page_url":"https://es.wikipedia.org/wiki/Orebi%C4%87","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Fountain_or3.jpg","page_title":"Orebić","context_page_description":"Orebić es una ciudad portuaria y municipio en el condado de Dubrovnik-Neretva, en Croacia. Está situada en la península de Pelješac. Orebić está separada de la ciudad de Kórchula, en la isla del mismo nombre, por un estrecho atravesado por servicios continuos de ferry.\\nHay en la región una serie de importantes atracciones turísticas, como el monasterio franciscano de Nuestra Señora de los Ángeles o el monte de San Elías, localizado tras la ciudad, que ofrece buenas vistas de la isla de Korčula y el Adriático."},{"page_url":"https://lb.wikipedia.org/wiki/Linda_Villumsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Linda_Melanie_Villumsen%2C_Mendrisio_2009_-_Women_Elite.jpg","page_title":"Linda Villumsen","context_page_description":"D'Linda Melanie Villumsen Serup, gebuer den 9. Abrëll 1985 zu Herning, ass eng néiséilännesch Vëlossportlerin vun dänescher Ofstamung.\\n2015 war se Weltmeeschterin am Contre-la-montre op der Strooss."},{"page_url":"https://en.wikipedia.org/wiki/Lindeman_Creek","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Bennett_on_Bennett_Lake%2C_British_Columbia%2C_ca_1898_%28HEGG_671%29.jpeg","page_title":"Lindeman Creek","context_page_description":"Lindeman Creek, formerly known as One Mile River connects Bennett Lake to Lindeman Lake, areas on the Chilkoot Trail in far northwestern British Columbia, Canada. It flows just south of Bennett Lake and northeast of the summit of the Chilkoot Pass. It is a treacherous class 3 rapid river.\\nThe caption for an 1897 Frank La Roche photograph refers to it as the Lewes River and featured in En Route to the Klondike with text saying: \\"Skill, cool heads and hard work are the necessary requirements for navigating the rapids of the Lewes River. Here is portrayed an exciting scene, similar to which everyone who goes to the Klondike in the same way must experience. Partly guided by ropes in the hands of men ashore and steered clear of dangerous rocks by men in the boat, the frail craft dashes and struggles along, at one time miraculously escaping destruction in a wild eddy and at another time gliding gracefully between jagged rocks that rise threateningly out of the seething waters. There is no time to think - a sharp lookout and a steady hand are the only means to victory over the angry waters of the rapids one meets en route to the Klondike.\\""},{"page_url":"https://en.wikipedia.org/wiki/Georgia_State_Route_219","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Georgia_state_route_219_map.png","page_title":"Georgia State Route 219","context_page_description":"State Route 219 is a 58.9-mile-long state highway that runs south-to-north through portions of Muscogee, Harris, Troup, and Heard counties in the west-central part of the U.S. state of Georgia. It runs from Columbus north to a point southwest of Franklin."},{"page_url":"https://es.wikipedia.org/wiki/Cueva_de_Blombos","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Blombos_point_white.JPG","page_title":"Cueva de Blombos","context_page_description":"La Cueva de Blombos es una cueva en un arrecife de arenisca calcarenítica en la costa del cabo sur de Sudáfrica. Es un yacimiento arqueológico que saltó a la fama por el descubrimiento de piezas de ocre de 76 000 años de antigüedad grabadas con diseños abstractos y cuentas hechas de caparazones de Nassarius, así como herramientas de hueso de 80 000 años de antigüedad. Se han descubierto evidencias de marisqueo y posiblemente pesca, y el asentamiento data de hace 140 000 años."},{"page_url":"https://ast.wikipedia.org/wiki/Jimena_de_la_Frontera","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/R%C3%ADoHozgarganta.jpg","page_title":"Jimena de la Frontera","context_page_description":"Jimena de la Frontera ye un conceyu español na provincia de Cádiz, na comunidá autónoma d'Andalucía. Ta asitiada na contorna del Campu de Xibraltar, a 157 km de la capital provincial, Cádiz.\\nEl conceyu tien cuatro llocalidaes: Jimena de la Frontera, Los Angeles o Estación de Jimena, San Pablo de Buceite y San Martín del Tesorillo. El so términu municipal, asitiáu ente la Badea d'Alxecires y la Serranía de Ronda, ta incluyíu nel Parque Natural de les Sufrerales."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Iowa_County_(Wisconsin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Harris_House_Barneveld.jpg","page_title":"Liste der Einträge im National Register of Historic Places im Iowa County (Wisconsin)","context_page_description":"Die Liste der Registered Historic Places im Iowa County in Wisconsin führt alle Bauwerke und historischen Stätten im Iowa County auf, die in das National Register of Historic Places aufgenommen wurden."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%B5%D1%81%D1%82%D0%B5%D1%80%D0%BE_(%D0%BF%D0%BE%D0%B2%D0%B5%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Bundesarchiv_Bild_183-33184-0005%2C_Wurzelrodemaschine.jpg","page_title":"Шестеро (повесть)","context_page_description":"«Шестеро» — повесть русского советского писателя Виля Липатова, опубликована в 1958 году."},{"page_url":"https://no.wikipedia.org/wiki/Japansk_kjempeveps","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Picture_Vespa.jpg","page_title":"Japansk kjempeveps","context_page_description":"Japansk kjempeveps, Vespa mandarinia, er en asiatisk art – den største av alle – i familien stikkeveps. Den tilhører samme slekt som vår norske geithams og minner om denne i levevis. Underarten Vespa mandarinia japonica hører hjemme i Japan."},{"page_url":"https://fy.wikipedia.org/wiki/Provo_(Utah)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Fort_Utah_c1850.jpg","page_title":"Provo (Utah)","context_page_description":"Provo is in stêd yn it súdeasten fan 'e Amerikaanske steat Utah, 70 km besuden Salt Lake City. It is it grutste plak en haadplak fan Utah County. Ynwennertal wie 112.488 yn 2010."},{"page_url":"https://zh.wikipedia.org/wiki/3%E7%BE%8E%E5%85%83%E9%87%91%E5%B8%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/1867_3_dollar_silver_edit.jpg","page_title":"3美元金币","context_page_description":"3美元金币是由美国铸币局该局首席雕刻师詹姆斯·巴顿·朗埃克设计，1853年2月21日获得授权，于1854至1889年间生产的一种金币。硬币正面刻有头戴美洲原住民公主头饰的自由女神头像，背面的中间是面值和年份，周围有玉米、小麦、棉花和烟草组成的花环。\\n1851年，联邦国会授权发行银质3美分硬币，以便人们今后在购买3美分邮票时不再需要使用很不得人心的铜质分币。两年后，国会又通过法案授权发行3美元金币。部分来源认为，这种金币是为了方便人们大量购买邮票。朗埃克在设计金币时想了多种办法确保新币和2.5美元金币有显著区别，不但采用的坯饼更薄，而且设计图案也是别具一格。\\n金币投产后的第一年就出产了超过10万枚，但其流通程度非常有限。虽然美国西岸部分地区不接受纸币，只能使用金币和银币，但东部的情况截然不同，特别是在经济因内战爆发而陷入动荡后，3美元金币基本上在东部的商品交易中难得一见，并且此后再也没有出现过大范围流通。3美元金币于1889年停产，国会在次年中止其发行授权。这种硬币存在多种年份版本，其中许多版本的铸造量都很少，但最为罕见的品种还是旧金山铸币局1870年打造的1870-S版，确认存在的仅有一枚。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Rostock","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Rostock-Stadtmitte-Kroepeliner_Strasse_18.jpg","page_title":"Liste der Baudenkmale in Rostock","context_page_description":"In der Liste der Baudenkmale in Rostock sind alle Baudenkmale der Hansestadt Rostock aufgelistet.\\nEinzelheiten zu den Kunstdenkmälern sind in der Liste der Denkmäler, Brunnen und Skulpturen in Rostock zu finden."},{"page_url":"https://ca.wikipedia.org/wiki/Amadeu_Bernad%C3%B3_i_Calcat%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Amadeu_Bernad%C3%B3_i_Calcat%C3%B3.jpg","page_title":"Amadeu Bernadó i Calcató","context_page_description":"Amadeu Bernadó i Calcató fou un polític i periodista català. El 1924 ingressà a Estat Català, però es posà en contacte amb els cercles marxistes de l'Ateneu Enciclopèdic Popular, s'orientà cap a ells, de manera que el 1926 abandonà Estat Català i el 1928 participà amb Jordi Arquer i Saltor en la fundació del Partit Comunista Català. Fou dirigent del seu portaveu, Treball. Quan el 1930 el PCC s'uní amb la Federació Comunista Catalanobalear per fer el Bloc Obrer i Camperol, abandonà el partit. Proper a Estat Català-Partit Proletari, finalment no hi ingressà, i el 1932 ho va fer a la Unió Socialista de Catalunya. Fou redactor de L'Opinió i de Justícia Social. El 1936 la USC s'incorporà al Partit Socialista Unificat de Catalunya i fou cap de redacció del seu portaveu Treball. El 1939 s'exilià a França, on participà en la resistència comunista contra l'ocupació nazi. Dins de la polèmica al si del PSUC, s'arrenglerà amb el sector catalanista liderat per Joan Comorera. Destacà com a historiador de l'obrerisme."},{"page_url":"https://it.wikipedia.org/wiki/Velleron","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/Velleron_streat_by_JM_Rosier.jpg","page_title":"Velleron","context_page_description":"Velleron è un comune francese di 3.048 abitanti situato nel dipartimento della Vaucluse, nella regione della Provenza-Alpi-Costa Azzurra."},{"page_url":"https://de.wikipedia.org/wiki/Dolmen_vom_Coll_de_la_Llosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Dolmen_du_Coll_de_la_Llosa_-_9.jpg","page_title":"Dolmen vom Coll de la Llosa","context_page_description":"Der Dolmen vom Coll de la Llosa ist eine Megalithanlage auf dem Gebirgspass Coll de la Llosa zwischen den Dörfern Bouleternère, Casefabre und Saint-Michel-de-Llotes im östlichen Vorland des Canigou-Massivs, im Norden des Département Pyrénées-Orientales in Frankreich. Der Dolmen dient seit alter Zeit – spätestens seit dem frühen 19. Jahrhundert – als Grenzmarkierung für die drei Orte.\\nDolmen ist in Frankreich der Oberbegriff für neolithische Megalithanlagen aller Art."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B9%BF%E6%B5%8E%E5%AF%BA_(%E5%8C%97%E4%BA%AC%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Guangjisi_gulou.JPG","page_title":"广济寺 (北京市)","context_page_description":"广济寺位于北京城内西城区阜成门内大街25号，为古代皇家寺院，是中国佛教协会所在地和直属寺院。广济寺是北京著名的\\"内八刹\\"之一、北京市文物保护单位、汉族地区全国重点寺院、全国重点文物保护单位。\\n广济寺初名西刘村寺，明天顺初年重建，明宪宗成化二年命名\\"弘慈广济寺\\"。1931年寺院失火焚毁，1935年重建。\\n广济寺现任方丈是明晹法师，现任监院是演觉法师。"},{"page_url":"https://pl.wikipedia.org/wiki/Bilety_Skarbu_Wyzwolonej_Polski","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/10_z%C5%82otych_polskich_1853_Skarb_Wyzwolonej_Polski_rewers.jpg","page_title":"Bilety Skarbu Wyzwolonej Polski","context_page_description":"Bilety Skarbu Wyzwolonej Polski – drukowane w 1853 r. przez Komitet Centralny Polski z siedzibą w Londynie, bilety denominowane w złotych polskich w ramach funduszu – Skarb Wyzwolonej Polski.\\nKomitet Centralny Polski z siedzibą w Londynie, w celu finansowania Centralizacji Towarzystwa Demokratycznego Polskiego, ustanowił specjalny fundusz pod nazwą Skarb Wyzwolonej Polski. Pozyskanie potrzebnych kapitałów miało być dokonane za pomocą emisji biletów oprocentowanych na 5 procent. Bilety drukowano w Londynie w nominałach: 10, 25, 50 i 100 złotych polskich. Podawano na nich również ich równowartość w czterech obcych walutach:\\nangielskiej,\\nfrancuskiej,\\npruskiej i\\nwłoskiej.\\nGwarantami biletów byli członkowie Komitetu Centralnego Polskiego w osobach:\\nStanisław Worcell.\\nLeon Zienkowicz,\\nAntoni Żabicki,\\nktórych faksymilia umieszczono na biletach. Dodatkowym gwarantem tej emisji był Giuseppe Mazzini jako reprezentant Komitetu Centralnego Europejskiego – faksymile jego podpisu zostało również umieszczone na biletach."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AE%E0%B5%86%E0%B4%B4%E0%B5%81%E0%B4%95%E0%B5%81%E0%B4%A4%E0%B4%BF%E0%B4%B0%E0%B4%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/LA2_Skultuna_kontorsljusstake.jpg","page_title":"മെഴുകുതിരി","context_page_description":"മെഴുകു കൊണ്ടുള്ള സ്തംഭത്തിനുള്ളിൽ തിരി വച്ചിരിക്കുന്ന സംവിധാനം. രാത്രികാലങ്ങളിൽ വിളക്കായി ഉപയോഗിക്കുന്നു. ഏറെ പഴക്കമുള്ള ഈ വിളക്കിന്റെ വിവിധ വലിപ്പത്തിലുള്ള രൂപങ്ങൾ ഇന്ന് ലഭ്യമാണ്."},{"page_url":"https://en.wikipedia.org/wiki/Debra_Monk","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Debra_Monk12.jpg","page_title":"Debra Monk","context_page_description":"Debra Monk is an American actress, singer, and writer, best known for her performances on the Broadway stage. She earned her first Tony Award for the 1993 production of Redwood Curtain and won an Emmy Award for several guest appearances on NYPD Blue between 1998 and 1999."},{"page_url":"https://da.wikipedia.org/wiki/Los_Jaivas","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Gabriel_Parra_en_Piedra_Roja.jpg","page_title":"Los Jaivas","context_page_description":"Los Jaivas er en chilensk gruppe, hvis musik er kendetegnet ved en kombination af stilarterne progressiv rock og zamacueca, med brug af latinamerikanske instrumenter og rytmer, især fra Andes-området. Gruppen blev dannet i 1963 i Viña del Mar, der ligger på kysten i regionen Valparaíso i Chile. De er ofte blevet betragtet som \\"en af de vigtigste og mest indflydelsesrige musikgrupper i Chile og resten af Sydamerika.\\"\\nDeres musik har været præget af udforskning og sammensmeltning af forskellige stilarter, i begyndelsen cumbia, siden over avantgarde- og jazzimprovisation, til klassisk rock og latinamerikansk fusion. I løbet af sin karriere, har Los Jaivas komponeret, arrangeret og fortolket både sin egen musik og sat musik til digte af Pablo Neruda, samt ind i mellem arrangeret og fortolket sange af kunstnere som Violeta Parra, Víctor Jara og Osvaldo Rodríguez."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturdenkm%C3%A4ler_im_Bezirk_Wiener_Neustadt-Land","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Schradler%2C_Miesenbach_02.JPG","page_title":"Liste der Naturdenkmäler im Bezirk Wiener Neustadt-Land","context_page_description":"Die Liste der Naturdenkmäler im Bezirk Wiener Neustadt-Land enthält die Naturdenkmäler im Bezirk Wiener Neustadt-Land."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D1%81%D1%82%D0%BE%D1%80%D1%96%D1%8F_%D0%BF%D0%BE%D1%88%D1%82%D0%B8_%D1%96_%D0%BF%D0%BE%D1%88%D1%82%D0%BE%D0%B2%D0%B8%D1%85_%D0%BC%D0%B0%D1%80%D0%BE%D0%BA_%D0%A1%D0%A8%D0%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Stamp_US_1956_5dollar.jpg","page_title":"Історія пошти і поштових марок США","context_page_description":"Історія пошти Сполучених Штатів Америки бере свій початок ще в 17 столітті. Випуск же поштових марок був організований в 1847 році. Розвиток поштового зв'язку і знаків поштової оплати США в сучасних умовах ознаменовано використанням нових технологій на ринку поштових послуг."},{"page_url":"https://fr.wikipedia.org/wiki/Tramway_de_la_Vall%C3%A9e_d%27H%C3%A9rimoncourt","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Tramway_Sarthe_Bicabine_No_60_Blanc_Misseron.JPG","page_title":"Tramway de la Vallée d'Hérimoncourt","context_page_description":"Le Tramway de la Vallée d'Hérimoncourt est un ancien réseau de chemin de fer secondaire du Doubs centré sur la ville d'Audincourt, long d'une vingtaine de kilomètres, et qui fonctionna de 1887 à 1932, afin d'assurer un maillage plus fin que celui assuré par les lignes du PLM et notamment la ligne Dole-Ville - Belfort, ou, plus modestement, la ligne de Montbéliard à Morvillars.\\nIl était principalement destiné à favoriser le déplacement des ouvriers et des marchandises dans ce secteur marqué par la prédominance des usines Peugeot, et à relier les usines entre elles.\\nIl a toujours été exploité en traction vapeur, et a cessé son activité en 1932."},{"page_url":"https://fr.wikipedia.org/wiki/Mante_religieuse","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Mante_religieuse_d%C3%A9vorant_un_papillon.jpg","page_title":"Mante religieuse","context_page_description":"La mante religieuse, surnommée tigre de l'herbe, cheval du diable, ou Prie Dieu, est une espèce d'insectes de la famille des Mantidae originaire du bassin méditerranéen, introduite en Asie et en Amérique du Nord."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B2%90%E9%98%9C%E4%B9%97%E5%90%88%E8%87%AA%E5%8B%95%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Gifubus-brchybrid-20070310.jpg","page_title":"岐阜乗合自動車","context_page_description":"岐阜乗合自動車株式会社は、岐阜県岐阜市に本社を置く名鉄グループのバス会社である。通称は岐阜バス。"},{"page_url":"https://fr.wikipedia.org/wiki/Gouvernement_Dmitri_Medvedev_(2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Vladimir_Yakushev_govru.png","page_title":"Gouvernement Dmitri Medvedev (2)","context_page_description":"Le gouvernement Dmitri Medvedev 2 est le gouvernement de la Russie depuis le 18 mai 2018 à la suite de la nomination de Dmitri Medvedev comme Président du Gouvernement par Vladimir Poutine récemment réélu."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Aussichtst%C3%BCrmen_in_Sachsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Kapellenberg_Vogtl_079.JPG","page_title":"Liste von Aussichtstürmen in Sachsen","context_page_description":"Die Liste von Aussichtstürmen in Sachsen enthält Bauwerke, welche über für den Publikumsverkehr zugängliche Aussichtsmöglichkeiten verfügen. Sie umfasst Aussichts-, Fernseh- und Wassertürme, Hochhäuser, Kirchtürme, stationäre Fahrgeschäfte und sonstige Aussichtsplattformen – auch ehemalige Türme. Die Listen enthalten keine reisenden Panoramafahrgeschäfte."},{"page_url":"https://tl.wikipedia.org/wiki/Charles_Darwin","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Annie_Darwin.jpg","page_title":"Charles Darwin","context_page_description":"Si Charles Robert Darwin FRS ay isang Ingles na naturalista. Kanyang pinatunayan na ang lahat ng mga espesye ng buhay ay nagmula sa loob ng maraming panahon mula sa karaniwang mga ninuno, at nagmungkahi ng teoriyang siyentipiko na ang sumasangay na paterno ng ebolusyon ay nagresulta mula sa isang prosesong tinatawag na natural na seleksiyon. Inilimbag ni Darwin ang kanyang teoriya na may nakapipilit na ebidensiya para sa ebolusyon sa kanyang 1859 na aklat na On the Origin of Species na nanaig sa siyentipikong pagtakwil ng mas naunang mga konsepto ng transmutasyon ng mga espesye. Nang mga 1870, ang pamayanang siyentipiko at karamihan sa pangkahalatang publiko ay tumanggap sa ebolusyon bilang isang katotohan. Gayunpaman, marami ang pumabor sa magkakalabang mga paliwanag at hanggang sa paglitaw lamang ng modernong ebolusyonaryong sintesis mula 1930 hanggang 1950 nang ang isang malawak na kasunduan ay nabuo kung saan ang natural na seleksiyon ang basiko o saligang mekanismo ng ebolusyon. Sa binagong anyo, ang pagkakatuklas siyentipiko ni Darwin ang nagsasamang teoriya ng mga agham ng buhay na nagpapaliwanag sa dibersidad ng buhay."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%81%D1%82%D1%80%D0%BE%D0%B2%D1%8B%D0%B5_(%D0%BF%D0%BE%D0%B4%D1%81%D0%B5%D0%BC%D0%B5%D0%B9%D1%81%D1%82%D0%B2%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Aster_amellus_Sturm6-cropped.jpg","page_title":"Астровые (подсемейство)","context_page_description":"Подсемейство Астровые — одно из двух или одно примерно из двенадцати подсемейств семейства Астровые.\\nПодсемейство Астровые объединяет более тысячи родов и более шестнадцати тысяч видов, в то время как второе подсемейство, Цикориевые, или Латуковые, или Язычковоцветковые, состоит примерно из двухсот родов и четырёх тысяч видов."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Monuments_of_National_Importance_in_Tripura","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Buddhist_Stupa_Shyamsundar_Mound.jpg","page_title":"Liste der Monuments of National Importance in Tripura","context_page_description":"Die Liste der Monuments of National Importance in Tripura wird vom Archaeological Survey of India, einer Abteilung des indischen Kulturministeriums, geführt und umfasst zurzeit 8 verschiedene Kulturgüter."},{"page_url":"https://pt.wikipedia.org/wiki/Ceife_Aldaul%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Dinar_of_Abu%27l-Musk_Kafur_al-Ikhshidi%2C_AH_355.jpg","page_title":"Ceife Aldaulá","context_page_description":"Ali ibne Abul Haija Abdalá ibne Hamadã ibne Alarite Altaglibi, mais conhecido simplesmente por seu lacabe de Ceife Aldaulá, foi o fundador do Emirado de Alepo, que compreendeu boa parte do norte da Síria e porções do oeste da Jazira, e o irmão de Haçane ibne Abdalá ibne Hamadã.\\nO membro mais proeminente da dinastia, Ceife Aldaulá originalmente serviu sob seu irmão mais velho nas tentativas do último de estabelecer seu controle sobre o fraco governo abássida em Bagdá durante o começo da década de 940. Após falhar nesses empreendimentos, o ambicioso Ceife Aldaulá virou-se à Síria, onde confrontou as ambições dos iquíxidas do Egito para controlar a província. Após duas guerras com eles, sua autoridade sobre o norte da Síria, centrada em Alepo, e no oeste da Jazira, centrada em Maiafarquim, foi reconhecida pelos iquíxidas e o califa. Uma série de rebeliões tribais atormentaram seu reino até 955, mas foi bem-sucedido em suprimi-las e manter a aliança das mais importantes tribos árabes."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B0%D1%81%D0%BB%D0%BE%D0%BD_(%D0%BA%D0%B0%D0%BD%D1%82%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Els-bas-mo-wa.png","page_title":"Васлон (кантон)","context_page_description":"Васло́н — упразднённый кантон на северо-востоке Франции, в регионе Эльзас, департамент Нижний Рейн, округ Мольсем. Площадь кантона Васлон составляла 155,22 км², количество коммун в составе кантона — 17, численность населения 22 231 человек, при средней плотности 143 жителя на квадратный километр."},{"page_url":"https://af.wikipedia.org/wiki/Wassily_Kandinsky","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Vassily_Kandinsky%2C_1926_-_Several_Circles%2C_Gugg_0910_25.jpg","page_title":"Wassily Kandinsky","context_page_description":"Wassily Wassilyevich Kandinsky was 'n Russiese skilder en kunsteoretikus. Hy het een van die eerste suiwer abstrakte werke geskilder."},{"page_url":"https://en.wikipedia.org/wiki/Demographics_of_Turkey","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Gipsy_camp.png","page_title":"Demographics of Turkey","context_page_description":"In 2019, the population of Turkey was 83.2 million with a growth rate of 1.39% per annum. Turkish people are the largest ethnic group, followed by Kurdish people.\\nThe population is relatively young, with 23.6% falling in the 0–14 age bracket. According to OECD/World Bank population statistics, from 1990 to 2008 the population growth in Turkey was 16 million or 29%."},{"page_url":"https://nds.wikipedia.org/wiki/Karl_V._(HRR)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Karl_V.-Carlos_I._1548_%28Tiziano_Vecellio%3F%29_066.jpg","page_title":"Karl V. (HRR)","context_page_description":"Karl V. ut dat Huus Habsborg, weer toeerst vun 1516 af an unner den Naam Karl I. König vun Spanien. He is denn 1519 to’n Röömsch-düütschen König wählt wurrn. Na siene Krönung 1520 hett he sik „utwählten“ Kaiser vun dat Hillige Röömsche Riek nömmt. 1530 is he denn, as lesten röömsch-düütschen Herrscher, vun den Paavst to’n Kaiser kröönt wurrn. Dat weer in Bologna un de Paavst is dormols Clemens VII. ween. An’n 23. August 1556 hett he Bott geven un den spaanschen Throon for sien Söhn Philipp II. free maakt. De Kaiserkroon hett he dortieds sien Broder Ferdinand I. overlaten.\\nKarl V. harr dat dor up afsehn, over de ganze Welt to regeern. He seeg dat so, dat de Kaiser over de annern Könige stunn. He hett dat ok so verstahn, dat he den Freden in Europa bewohren un dat he dat Avendland schulen dö vor dat Osmaansche Riek. Ok de Karken, meen he, harr he to schulen un dor for to sorgen, dat dor Reformen in Angreep nahmen würrn. Vundeswegen, dat König Franz I. vun Frankriek de Meenung weer, he harr just desulvigen Upgaven, hett Karl sik mit em jummers in’e Plunnen harrt."},{"page_url":"https://id.wikipedia.org/wiki/3_Januari_(liturgi_Ortodoks_Timur)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Malachia.jpg","page_title":"3 Januari (liturgi Ortodoks Timur)","context_page_description":"2 Januari - kalender liturgi Ortodoks Timur - 4 Januari\\nSeluruh peringatan sah di bawah ini diadakan pada 16 Januari oleh Gereja Ortodoks Timur pada Kalender Gereja Purba.\\nUntuk 3 Januari, Gereja-gereja Ortodoks pemakai Kalender Gereja Purba memperingati orang-orang kudus yang didaftarkan pada 21 Desember."},{"page_url":"https://es.wikipedia.org/wiki/Kreuzberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Kottbusser_Tor_Panorama.jpg","page_title":"Kreuzberg","context_page_description":"Kreuzberg es una parte del distrito de Friedrichshain-Kreuzberg en Berlín, la capital de Alemania. Hasta su fusión en el 2001 con el antiguo distrito Friedrichshain, Kreuzberg era un distrito independiente, colindante al norte con el distrito de Mitte, al sur con el distrito de Neukölln, al este con el de Friedrichshain y al oeste con Schöneberg.\\nEl significado de Kreuzberg viene de las palabras alemanas Kreuz y Berg, en relación a un pequeño monte, hoy el parque Viktoria, que está coronado por una cruz latina en la cima. Siguiendo la numeración de los antiguos códigos postales alemanes, se pueden distinguir dos partes en Kreuzberg: Kreuzberg 61, la mayor, y la menor pero más conocida SO 36. Cuando existía el Muro de Berlín, SO 36 estaba rodeada por él en tres de sus cuatro lados, y apareció una cultura propia alternativa a la de Berlín Oeste."},{"page_url":"https://pt.wikipedia.org/wiki/Peggy_March","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/2018-06-24_Peggy_March-.jpg","page_title":"Peggy March","context_page_description":"Peggy March é uma cantora pop americana. Ela é conhecida principalmente por sua música de 1963 que atingiu um milhão de vendas \\"I Will Follow Him\\". Embora ela às vezes seja lembrada como uma maravilha de um sucesso só, ela continuou a ter sucesso na Europa até os anos '70."},{"page_url":"https://ceb.wikipedia.org/wiki/Chatkal_(suba)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Chatkal-Charvak.jpg","page_title":"Chatkal (suba)","context_page_description":"Suba ang Chatkal sa Kirgistan. Nahimutang ni sa kasadpang bahin sa nasod, 400 km sa kasadpan sa Bishkek ang ulohan sa nasod. Ang Chatkal mao ang bahin sa tubig-saluran sa Aral Sea."},{"page_url":"https://fr.wikipedia.org/wiki/Accolade_(architecture)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Catedral_de_Alcal%C3%A1_de_Henares-Portada.png","page_title":"Accolade (architecture)","context_page_description":"En architecture, une accolade, appelée aussi arc en accolade ou arc en talon, est un faux-arc en forme d'accolade horizontale, typique de la période gothique."},{"page_url":"https://en.wikipedia.org/wiki/2019_Indian_general_election_in_Karnataka","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Indian_Election_Symbol_Lady_Farmer.png","page_title":"2019 Indian general election in Karnataka","context_page_description":"The 2019 Indian general election were held in Karnataka on Two phases- 18 and 23 April 2019 to constitute the 17th Lok Sabha."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BB%D0%B8%D0%BD%D0%BA%D0%B0_(%D0%A1%D0%BC%D0%BE%D0%BB%D0%B5%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Nikolay_church_glinka_smolensk.jpg","page_title":"Глинка (Смоленская область)","context_page_description":"Гли́нка — село в Смоленской области России, административный центр Глинковского района. Расположено в центральной части области в 60 километрах к юго-востоку от Смоленска.\\nНаселение — 2,111 тыс. жителей.\\nЖелезнодорожная станция на линии Смоленск — Сухиничи"},{"page_url":"https://et.wikipedia.org/wiki/Komposiitorder","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Building_with_fish_pond%2C_winter_palace%2C_Hadrian%27s_Villa%2C_Tivoli_%2816104079496%29.jpg","page_title":"Komposiitorder","context_page_description":"Komposiitorder, ka liitorder on rooma arhitektuuris esinev saledaima tüvesega ja visuaalselt kergeim klassikaline order, mille kapiteelis on kokku pandud joonia voluudid kapiteeli ülaosas ja korintose orderi akantuslehed nende all. Muus osas sarnaneb korintose orderiga. Komposiitkapiteel esineb Rooma, Bütsantsi ning lihtsustatuna eelromaani arhitektuuris, komposiitorderit omaette orderina on kasutatud renessanss- ja barokkarhitektuuris, samuti historitsismis."},{"page_url":"https://es.wikipedia.org/wiki/Presidente_del_Senado_de_Chile","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Juan_Ega%C3%B1a.jpg","page_title":"Presidente del Senado de Chile","context_page_description":"El presidente del Senado de la República de Chile, es la máxima autoridad del Senado. El cargo fue establecido en 1812 por el Primer Senado de Chile.\\nSe encuentra, tras el ministro del Interior y Seguridad Pública, en el segundo lugar en la línea de sucesión del presidente de la República, en caso de impedimento temporal o vacancia.​\\nEl cargo actualmente está en manos de la senadora Adriana Muñoz D'Albora del Partido por la democracia."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%88%D9%84_%D9%88%D9%8A%D9%86%D8%AA%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Paul_Winter_6-16-07_Photo_by_Anthony_Pepitone.jpg","page_title":"بول وينتر","context_page_description":"بول وينتر ‏ هو عازف جاز وملحن أمريكي، ولد في 31 أغسطس 1939 في ألتونا في الولايات المتحدة."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BF%9D%E5%9C%9F%E3%82%B1%E8%B0%B7%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Hamasoba_in_Hodogaya_Station.JPG","page_title":"保土ケ谷駅","context_page_description":"保土ケ谷駅は、神奈川県横浜市保土ケ谷区岩井町にある、東日本旅客鉄道の駅である。"},{"page_url":"https://en.wikipedia.org/wiki/Arani_Province","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Bolivia_department_of_cochabamba.png","page_title":"Arani Province","context_page_description":"Arani is a province in Cochabamba Department, Bolivia. Its capital is Arani, situated about 53 km from Cochabamba. Arani is known for its bread and its artisan wickerwork."},{"page_url":"https://es.wikipedia.org/wiki/Gobernaci%C3%B3n_de_Grodno","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Lithuania-1867-1914-es.svg","page_title":"Gobernación de Grodno","context_page_description":"La gobernación de Grodno fue un gobernación del Imperio ruso."},{"page_url":"https://tl.wikipedia.org/wiki/L%27Arc-en-Ciel","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/L%27arc_En_Ciel_%40_MSG_-_3-25-12_-_040.jpg","page_title":"L'Arc-en-Ciel","context_page_description":"Ang L'Arc-en-Ciel, kadalasang dinadaglat sa anyong L'Arc, ay isang grupo ng Hapong musikero na binuo noong 1991."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%A7%D8%A6%D8%B2%D8%A9_%D8%A5%D9%8A%D8%B1%D8%A7%D8%B3%D9%85%D9%88%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Paul_Delouvrier_en_Prins_Bernhard_%281985%29.jpg","page_title":"جائزة إيراسموس","context_page_description":"جائزة إيراسموس هي جائزة سنوية يمنحها مجلس مؤسسة بريميم إيرازمانوم للأفراد أو المؤسسات التي قدمت مساهمات استثنائية للثقافة، أو المجتمع، أو العلوم الاجتماعية في أوروبا و بقية العالم. تعتبر تلك الجائزة من أكثر جوائز أوروبا تميزًا. سُميت الجائزة باسم دسيدريوس إراسموس، رائد النهضة الهولندية."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B0%D0%B4%D0%B7%D0%B8%D0%B2%D1%96%D0%BB%D0%BB%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BB%D1%96%D1%82%D0%BE%D0%BF%D0%B8%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Radzivill_chronicle_184.jpg","page_title":"Радзивіллівський літопис","context_page_description":"Радзиві́ллівський літо́пис — руський лицевий літописний список кінця XV ст., що нині зберігається в Санкт-Петербурзі в Бібліотеці академії наук. Цей рукопис належав у XVII ст. польсько-литовським магнатам Радзивіллам, потім потрапив до Східної Пруссії, де з нього була знята копія. 1758 року був захоплений як трофей у Семирічній війні, відвезений до Петербурга і опублікований в 1767."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Backsteinbauwerke_des_G%C3%B3tico-Mud%C3%A9jar_in_Spanien","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Toro_-_San_Lorenzo_el_Real_02.jpg","page_title":"Liste der Backsteinbauwerke des Gótico-Mudéjar in Spanien","context_page_description":"Dieser Artikel ist Teil des Listenwerks Backsteinbauwerke der Gotik.\\nIn Spanien war der Backsteinbau bis ins frühe 17. Jahrhundert eine Spezialität maurischer Handwerker und daher von islamisch-orientalischen Traditionen geprägt. Gotische Bauten in Spanien wurden überwiegend von aus Kerneuropa herbeigeholten Baumeistern errichtet. Inwieweit Mudéjares den neuen Stil übernahmen, war regional unterschiedlich. Eine beträchtliche Anzahl ihrer Bauwerke lässt sich aber deutlich nach Zügen europäischer Stile unterschieden, zuerst der Romanik, dann der Gotik, schließlich der Renaissance.\\nSolange in Spanien sowohl christliche als auch islamische Staaten bestanden, konnten Menschen islamischer und jüdischer Religion auch in den christlichen Staaten unbehelligt leben. Daher entstand Mudéjar-Architektur auch in Regionen, die schon seit Jahrhunderten christlich regiert wurden. Nach dam Abschluss der Reconquista 1492 wurden die Juden durch zwei königliche Anordnungen 1492 und 1513 vertrieben, und auch die Situation der Mohammedaner verschlechterte sich Schritt für Schritt. 1610 wurden die letzten Mudéjares vertrieben.\\nUmfang:\\n111 Gebäude und Gebäudegruppen\\nDetaillierte Verteilungskarte:"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%A5%D5%AE_%D5%80%D5%A1%D5%B5%D6%84%D5%AB_%D5%A3%D5%A1%D5%BE%D5%A1%D5%BC%D5%B6%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/%D5%80%D5%A1%D6%80%D6%84_%D5%8F%D5%B8%D6%82%D6%80%D5%B8%D6%82%D5%A2%D5%A5%D6%80%D5%A1%D5%B6.jpg","page_title":"Մեծ Հայքի գավառների ցանկ","context_page_description":"Սույն ցանկում ներկայացված են Մեծ Հայքի գավառների ցանկը մանրամասն նկարագրությունով։\\nՄեծ Հայքի աշխարհագրական սահմանները․\\nՀարավային սահման\` սահմանակից է Միջագետքին՝ անցնում է Հարավային Տավրոս լեռներով, Եփրատի արմունկով, Եփրատ և Տիգրիս գետերով ու Նիփատես լեռով։ Վերջիններս սահմանազատում էին Մեծ Հայքը Ասորեստանից։\\nԱրևմտյան սահման՝ սահմանակից է Կապադովկիային՝ Եփրատ գետի գծած մի մասով, Կապադովկիական Պոնտոսի այն մասով, որը հասնում է մինչև Կողքիս՝ Մոսքական լեռների գծած գծով։\\nԱրևելյան սահման՝ սահմանակից է Հիրկանյան ծովի այն մասին, որը Կուր գետի գետաբերանից սկսում և հասնում է մինչև Արաքս գետի գետաբերանը, և Մարաստանին՝ այստեղից մինչև Կասպիական լեռներ։\\nՀյուսիսային սահման՝ սահմանակից է Կողքիսի մի մասին՝ Ճորոխ գետի ստորին հոսանքում գտնվող Եգր «փոքր աշխարհին», ապա Վիրքին և Աղվանքին՝ Կուր գետով։"},{"page_url":"https://ca.wikipedia.org/wiki/Sparisoma_rubripinne","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Yellowtail_parrotfish_Sparisoma_rubripinne_%284676538159%29.jpg","page_title":"Sparisoma rubripinne","context_page_description":"Sparisoma rubripinne és una espècie de peix de la família dels escàrids i de l'ordre dels perciformes."},{"page_url":"https://es.wikipedia.org/wiki/Juan_Mart%C3%ADn_Cabezalero","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Cabezalero-la_lanzada-vot.jpg","page_title":"Juan Martín Cabezalero","context_page_description":"Juan Martín Cabezalero fue un pintor barroco español, integrante destacado de la escuela madrileña de la segunda mitad del siglo xvii. Prematuramente fallecido, el catálogo de obras documentadas o a él atribuidas es muy reducido."},{"page_url":"https://en.wikipedia.org/wiki/John_Ricus_Couperus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Pieter_Merkus_%281851%29.jpg","page_title":"John Ricus Couperus","context_page_description":"John Ricus Couperus was a Dutch lawyer, member of the Council of Justice in Padang and member of the High Military Court of the Dutch East Indies. He was also the father of the Dutch writer Louis Couperus and knight in the Order of the Netherlands Lion."},{"page_url":"https://pt.wikipedia.org/wiki/Neuhausen_ob_Eck","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/Neuhausen_ob_Eck.JPG","page_title":"Neuhausen ob Eck","context_page_description":"Neuhausen ob Eck é um município da Alemanha, no distrito de Tuttlingen, na região administrativa de Freiburg, estado de Baden-Württemberg."},{"page_url":"https://pl.wikipedia.org/wiki/Dublin_Bus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Dublin_Bus_SG-146.jpg","page_title":"Dublin Bus","context_page_description":"Dublin Bus – przewoźnik publiczny w stolicy Irlandii, Dublinie. Firma została w 1987 roku wydzielona ze spółki Córas Iompair Éireann, której właścicielem jest rząd Irlandii. Siedziba przewoźnika mieści się na 59 Upper O'Connell St, Dublin 1.\\nSieć linii autobusowych składa się obecnie ze 104 tras miejskich i obwodowych oraz 18 tras nocnych Nitelink w całej aglomeracji dublińskiej. Część linii jest rozciągnięta poza stolicę, do Newcastle w hrabstwie Wicklow, Dunboyne w hrabstwie Meath i Maynooth w hrabstwie Kildare. Część linii dotychczas należących do Dublin Bus wybiegających poza Dublin od 2017 r. przejmuje prywatna firma Go-Ahead Ireland, działająca na zlecenie Transport for Ireland."},{"page_url":"https://sv.wikipedia.org/wiki/Costus_pulverulentus","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Costus_pulverulentus_2.jpg","page_title":"Costus pulverulentus","context_page_description":"Costus pulverulentus är en enhjärtbladig växtart som beskrevs av Karel Presl. Costus pulverulentus ingår i släktet Costus och familjen Costaceae. Inga underarter finns listade."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A7%E0%B8%B1%E0%B8%94%E0%B9%80%E0%B8%A7%E0%B8%AC%E0%B8%B8%E0%B8%A7%E0%B8%B1%E0%B8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Venuvana.jpg","page_title":"วัดเวฬุวัน","context_page_description":"วัดเวฬุวันมหาวิหาร หรือ พระวิหารเวฬุวันกลันทกนิวาปสถาน เป็นอาราม แห่งแรกในพระพุทธศาสนา ตั้งอยู่ใกล้เชิงเขาเวภารบรรพต บนริมฝั่งแม่น้ำสรัสวดีซึ่งมีตโปธาราม คั่นอยู่ระหว่างกลาง นอกเขตกำแพงเมืองเก่าราชคฤห์ รัฐพิหาร ประเทศอินเดียในปัจจุบัน\\nคำว่า เวฬุวัน แปลว่าสวนไผ่ เดิมอารามแห่งนี้เป็นพระราชอุทยานของพระเจ้าพิมพิสาร กษัตริย์แคว้นมคธ ตั้งอยู่นอกเมืองราชคฤห์ เมื่อพระพุทธเจ้าตรัสรู้แล้วได้เสด็จไปยังเมืองราชคฤห์ พระเจ้าพิมพิสารพร้อมด้วยข้าราชบริพารเข้าไปเฝ้า หลังจากทรงสดับธรรมแล้วทรงเลื่อมใสจึงถวายสวนเวฬุวันเป็นพุทธบูชา ด้วยทรงเห็นว่าเป็นที่สงบร่มรื่น เหมาะสำหรับอยู่บำเพ็ญธรรมของพระสงฆ์ ถือกันต่อมาว่าสถานที่นี้เป็นวัดแห่งแรกในพระพุทธศาสนา เรียกว่า วัดเวฬุวันมหาวิหาร นอกจากนี้วัดนี้ยังเป็นสถานที่พระพุทธเจ้าแสดงโอวาทปาติโมกข์แก่พระสงฆ์สาวกจำนวน 1,250 รูป แล้วส่งไปเป็นพระธรรมทูตประกาศพระศาสนา อันเป็นที่มาของวันมาฆบูชา\\nวัดเวฬุวันมหาวิหาร ปัจจุบันยังคงอยู่ เป็นซากโบราณสถานในสวนไผ่ที่ร่มรื่น มีสระน้ำขนาดใหญ่ภายใน มีรั้วรอบด้าน อยู่ในความดูแลของทางราชการอินเดีย"},{"page_url":"https://pl.wikipedia.org/wiki/Dioda_elektroluminescencyjna","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/LED-Leuchtmittel_als_Halogen-Ersatz%2C_1.jpeg","page_title":"Dioda elektroluminescencyjna","context_page_description":"Dioda elektroluminescencyjna, dioda świecąca, dioda emitująca światło, LED – dioda zaliczana do półprzewodnikowych przyrządów optoelektronicznych, emitujących promieniowanie w zakresie światła widzialnego, podczerwieni i ultrafioletu."},{"page_url":"https://en.wikipedia.org/wiki/Vestergade_1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Vestergade_1_%28Copenhagen%29_02.jpg","page_title":"Vestergade 1","context_page_description":"Vestergade 1 is a Neoclassical property located at the corner of Gammeltorv and the street Vestergade in the Old Town of Copenhagen, Denmark. The facade towards Gammeltorv and Vestergade meet in an Obtuse angle with four bays towards the square and five bays towards the street. The building was listed in the Danish registry of protected buildings and places in 1950. Café Gammel Torv, a traditional Danish lunch restaurant, has since 1910 been based in the basement at Gammeltorv 20. The building/restaurant is now cologually known as The House With The Green Tree after an eponymous 1942 novel by Kalvin Lindemann."},{"page_url":"https://de.wikipedia.org/wiki/Columbia_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Vistahouse.jpg","page_title":"Columbia River","context_page_description":"Der Columbia River ist ein 1953 Kilometer langer Fluss im westlichen Nordamerika. Er ist der wasserreichste aller nordamerikanischen Flüsse, die in den Pazifischen Ozean münden.\\nMit seinem linken Nebenfluss, dem Snake River, zusammen hat er eine Länge von 2240 km. Sein Einzugsgebiet umfasst 668.217 km², wovon etwa 15 % innerhalb Kanadas liegen.\\nDer Fluss ist nach dem Schiff Columbia Rediviva des US-amerikanischen Kapitäns Robert Gray benannt, der am 11. Mai 1792 als erster Weißer den Columbia River hinauffuhr. Gray reiste in den pazifischen Nordwesten, um mit Fellen zu handeln.\\nDie Lewis-und-Clark-Expedition erreichte 1805 vom Osten auf dem Landweg die Mündung des Flusses. Der Columbia River wurde 1814 erstmals vollständig von David Thompson kartografiert.\\nVon den 1820er Jahren bis in die 1840er Jahre folgte der York Factory Express, eine Handelsroute der Hudson’s Bay Company zwischen der York Factory an der Hudson Bay und dem Fort Vancouver, abschnittsweise dem Flusslauf."},{"page_url":"https://fr.wikipedia.org/wiki/Diam%C3%A8tre_%C3%A0_hauteur_de_poitrine","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/Kluppeneinsatz.jpg","page_title":"Diamètre à hauteur de poitrine","context_page_description":"Le diamètre à hauteur de poitrine, ou DHP, est une mesure standard du diamètre du tronc d'un arbre.\\nIl s'agit donc du diamètre du seul tronc, et non du diamètre d'ensemble de l'arbre avec ses branches de la base."},{"page_url":"https://en.wikipedia.org/wiki/21st_Operations_Group","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/7th_Space_Warning_Squadron.PNG","page_title":"21st Operations Group","context_page_description":"The 21st Operations Group was an operations group of the United States Space Force. It was assigned to the 21st Space Wing, stationed at Peterson Air Force Base, Colorado. It was responsible for ground-based missile warning, space control operations. It provided real-time missile warning, attack assessment, and space control. The 21 OG was also responsible for the development of future counterspace capabilities and was the most geographically dispersed operations group in the Space Force."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AF%D1%80%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BD%D1%84%D1%80%D0%B0%D0%BA%D1%80%D0%B0%D1%81%D0%BD%D0%B0%D1%8F_%D0%B3%D0%B0%D0%BB%D0%B0%D0%BA%D1%82%D0%B8%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/A_tale_of_galactic_collisions.jpg","page_title":"Яркая инфракрасная галактика","context_page_description":"Яркая инфракрасная галактика — галактика со светимостью выше 10¹¹ светимостей Солнца. Такие галактики более распространены, чем галактики со вспышками звездообразования, сейфертовские галактики и квазары сравнимых светимостей. Инфракрасные галактики создают больше излучения в инфракрасной части спектра по сравнению с другими диапазонами длин волн.\\nГалактики со светимостями выше 10¹² светимостей Солнца называются ультраяркими инфракрасными галактиками. Многие яркие инфракрасные галактики проявляют признаки взаимодействий и разрушения. Темп звездообразования может достигать 100 звёзд в год, в то время как в нашей галактике появляется в среднем одна звезда в год.\\nЕщё более яркие галактики называются гиперяркими галактиками.\\nГалактики данного типа с наибольшей светимостью носят название экстремально ярких инфракрасных галактик."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%D9%81%D8%B1%D9%88%D8%AF%DA%AF%D8%A7%D9%87%E2%80%8C%D9%87%D8%A7%DB%8C_%D8%A7%D9%86%D8%AF%D9%88%D9%86%D8%B2%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Indonesia-CIA_WFB_Map.png","page_title":"فهرست فرودگاه‌های اندونزی","context_page_description":"این مقاله شامل فهرست فرودگاه‌های اندونزی است که بر پایهٔ مکان قرارگیری آن‌ها مرتب شده است."},{"page_url":"https://ca.wikipedia.org/wiki/%C3%93scar_Plano_Pedre%C3%B1o","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Real_Valladolid_-_Rayo_Vallecano_2019-01-05_36_%28cropped%29.jpg","page_title":"Óscar Plano Pedreño","context_page_description":"Óscar Plano Pedreño és un futbolista professional espanyol que juga com a migcampista ofensiu al Real Valladolid."},{"page_url":"https://fr.wikipedia.org/wiki/Tour_de_France_2020","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/Col_de_la_Madeleine-_73.JPG","page_title":"Tour de France 2020","context_page_description":"Le Tour de France 2020 est la 107ᵉ édition du Tour de France cycliste. Initialement prévu pour se tenir du 27 juin au 19 juillet 2020, il est reporté en raison de la pandémie de Covid-19 et part de Nice le 29 août pour se terminer le 20 septembre à Paris, sur l'avenue des Champs-Élysées. Pour la première fois depuis la fin de la Seconde Guerre mondiale, le Tour n'a pas lieu pendant le mois de juillet."},{"page_url":"https://ca.wikipedia.org/wiki/Spatuloricaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Spatuloricaria_evansii.jpg","page_title":"Spatuloricaria","context_page_description":"Spatuloricaria és un gènere de peixos de la família dels loricàrids i de l'ordre dels siluriformes."},{"page_url":"https://fr.wikipedia.org/wiki/Empain","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Chateau_de_Bouffemont.jpg","page_title":"Empain","context_page_description":"Empain est un nom propre utilisé comme patronyme et toponyme."},{"page_url":"https://en.wikipedia.org/wiki/Religion_in_Russia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Dharma%C4%8Dakra.png","page_title":"Religion in Russia","context_page_description":"Religion in Russia is diverse with Christianity, especially Russian Orthodoxy being the most widely professed faith, but with significant minorities of non-religious people and adherents of other faiths. A 1997 law on religion recognises the right to freedom of conscience and creed to all the citizenry, the spiritual contribution of Orthodox Christianity to the history of Russia, and respect to \\"Christianity, Islam, Buddhism, Judaism and other religions and creeds which constitute an inseparable part of the historical heritage of Russia's peoples\\", including ethnic religions or Paganism, either preserved or revived. According to the law, any religious organisation may be recognised as \\"traditional\\" if it was already in existence before 1982, and each newly founded religious group has to provide its credentials and re-register yearly for fifteen years, and, in the meantime until eventual recognition, stay without rights."},{"page_url":"https://no.wikipedia.org/wiki/Tysklands_departement_for_fordrevne,_flyktninger_og_krigsofre","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Bundesarchiv_B_145_Bild-P003214%2C_Eckernf%C3%B6rde%2C_Fl%C3%BCchtlingsbaracken.jpg","page_title":"Tysklands departement for fordrevne, flyktninger og krigsofre","context_page_description":"Tysklands departement for fordrevne, flyktninger og krigsofre var et tysk føderalt departement som eksisterte fra 1949 til 1969.\\nDepartementets oppgave var hovedsakelig å ta seg av de ca. 15 millionene tyske ofre for fordrivelse gjennom etnisk rensning fra Øst-Tyskland og det øvrige Øst-Europa ved slutten av annen verdenskrig, og alle forhold som angikk flyktningene og integrasjonen av dem. I mange år bodde store antall flyktninger i flyktningleire. Da departementet ble oppløst i 1969 var de fleste flyktningene vel integrert i samfunnet i sitt nye hjemland. Departementets gjenværende oppgaver ble da fordelt på andre departementer.\\nHans Lukaschek var departementets første sjef."},{"page_url":"https://vi.wikipedia.org/wiki/Gobionellinae","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/14/Brachygobius.jpg","page_title":"Gobionellinae","context_page_description":"Gobionellinae là một phân họ cá bống của họ Gobiidae"},{"page_url":"https://en.wikipedia.org/wiki/Tyre,_Lebanon","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/BeitShaddadRuinsSkyWindows_TyreSourLebanon_RomanDeckert16082019.jpg","page_title":"Tyre, Lebanon","context_page_description":"Tyre is one of the oldest continually inhabited cities in the world, though in medieval times for some centuries by just a tiny population. It was one of the earliest Phoenician metropolises and the legendary birthplace of Europa, her brothers Cadmus and Phoenix, as well as Carthage's founder Dido. The city has many ancient sites, including the Tyre Hippodrome, and was added as a whole to UNESCO's list of World Heritage Sites in 1984.\\nThe historian Ernest Renan noted:\\nOne can call Tyre a city of ruins, built out of ruins.\\nToday Tyre is the fifth largest city in Lebanon after Beirut, Tripoli, Aley and Sidon, It is the capital of the Tyre District in the South Governorate. There were approximately 200,000 inhabitants in the Tyre urban area in 2016, including many refugees."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1949","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Hintjens%2C_Arno_%282005%29.jpg","page_title":"Lijst van personen geboren in 1949","context_page_description":"Dit is een lijst van personen die geboren zijn in 1949.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://ja.wikipedia.org/wiki/V250_(%E9%89%84%E9%81%93%E8%BB%8A%E4%B8%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/ETR_700-004_Milano_centrale.jpg","page_title":"V250 (鉄道車両)","context_page_description":"V250は、ピニンファリーナがスタイリングし、アンサルドブレーダが製造する、オランダの高速新線用の高速鉄道車両で、19編成が発注中である。\\nオランダ高速鉄道によって運行されるオランダ南高速線や、ベルギー高速鉄道4号線沿線を結ぶシャトル列車、フィーラに導入予定で、V250の名称は列車の営業最高速度である250km/hに由来している。他の高速鉄道車両に比べるとやや低い速度であるが、最高速度が160km/hであった従来のオランダの列車に比べると著しく高速化されている。独特の外観から、アルバトロスやドードーのあだ名の他、カモノハシに例えられることもある。"},{"page_url":"https://sv.wikipedia.org/wiki/Font%C3%A4nbron","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Brunnsparken-DSC00004.JPG","page_title":"Fontänbron","context_page_description":"Fontänbron, är en bro i centrala Göteborg, som går över Hamnkanalen väster om Brunnsparken. Bron förbinder den norra delen av Östra Hamngatan med den södra. Den har sitt namn efter konstnären Per Hasselbergs verk Såningskvinnan, i folkmun kallad \\"Johanna i Brunnsparken\\", som invigdes 21 juli 1883. Såningskvinnan står här placerad i en fontän.\\nTrots att vanlig biltrafik inte är tillåten på bron är trafiken på bron mycket livlig, med spårväg, bussar, taxi, cyklar och fotgängare."},{"page_url":"https://it.wikipedia.org/wiki/Karl_von_St%C3%BCrgkh","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Karl_Graf_von_St%C3%BCrgkh.jpg","page_title":"Karl von Stürgkh","context_page_description":"Conte Karl von Stürgkh è stato un politico austriaco e primo ministro durante gli ultimi anni della monarchia asburgica. Fu assassinato per la sua politica dispotica dal socialista Friedrich Adler."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A3%D0%BB%D0%B8%D1%87%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Ulychne_prapor.png","page_title":"Уличне","context_page_description":"У́личне — село Дрогобицького району Львівської області, адміністративний центр Уличненської сільської ради."},{"page_url":"https://ca.wikipedia.org/wiki/Lo_Lui","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/Map_commune_FR_insee_code_40153.png","page_title":"Lo Lui","context_page_description":"Lo Lui és un municipi francès, situat al departament de les Landes i a la regió de la Nova Aquitània."},{"page_url":"https://vi.wikipedia.org/wiki/Nga_thu%E1%BB%99c_ch%C3%A2u_%C3%82u","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Russia_ethnic.JPG","page_title":"Nga thuộc châu Âu","context_page_description":"Nga thuộc châu Âu là cách nói để ám chỉ những khu vực nằm phía tây của nước Nga mà nó thuộc châu Âu, khu vực này có diện tích gần 3.960.000 km², lớn hơn cả Ấn Độ, và chiếm 40% lãnh thổ châu Âu. Ranh giới phía đông của nó là dãy núi Ural và phía nam là ranh giới với Kazakhstan. Khu vực này cũng bao gồm hai thành phố lớn nhất Nga là Moskva và Sankt-Peterburg.\\nKhu vực này chiếm gần 78% dân số toàn nước Nga, mật độ trung bình 27 người/km². Mặc dù 75% lãnh thổ Nga nằm trên châu Á, nhưng phần châu Á chỉ có 22% dân số Nga với mật độ 2,5 người/km²."},{"page_url":"https://fr.wikipedia.org/wiki/Royal_Air_Force","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/RAF-AVM-OF-7.png","page_title":"Royal Air Force","context_page_description":"La Royal Air Force est la force aérienne de l'armée britannique. Elle forme avec la British Army et la Royal Navy les Forces armées britanniques. Sa devise est Per Ardua ad Astra qui signifie « À travers les embûches jusqu'aux étoiles ».\\nLa Royal Air Force est créée le 1ᵉʳ avril 1918, devenant la 1ʳᵉ force aérienne indépendante du monde, par regroupement des Royal Flying Corps et Royal Naval Air Service."},{"page_url":"https://en.wikipedia.org/wiki/Toyota_Starlet","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/Toyota_Starlet_Carat_003.JPG","page_title":"Toyota Starlet","context_page_description":"The Toyota Starlet is a subcompact car manufactured by Toyota from 1973 to 1999, replacing the Publica, but retaining the Publica's \\"P\\" code and generation numbering. The first generation Starlet was sold as the Publica Starlet in some markets. In Japan, it was exclusive to Toyota Corolla Store dealers.\\nStarlets were typically dependable but austere vehicles; however, some upgraded versions were produced. Turbocharged Starlets were offered in three generations: the 1986–1989 Turbo S, the 1990–1995 GT turbo, and the 1996–1999 Glanza V. Another variant was the Sera, made in the early 1990s and officially sold only in Japan; the Sera had a unique two-door coupe body and butterfly doors but shared the Starlet's chassis and mechanicals.\\nThe Starlet was briefly exported to North America from 1981 to 1984.\\nIn 1999, the Starlet was replaced by the Vitz—sold as the Echo or Yaris in international markets—and the bB mini MPV, which was later sold as the Scion xB in Canada and the United States and as the Daihatsu Materia in the United Kingdom. However, Toyota effectively vacated the European city car market until the Aygo was launched in 2005."},{"page_url":"https://es.wikipedia.org/wiki/Trifolium_glomeratum","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/Leguminosae1-British_Entomology.jpg","page_title":"Trifolium glomeratum","context_page_description":"Trifolium glomeratum L. o trébol aglomerado es una especie originaria de Europa, el norte de África y el oeste de Asia. Aunque es una planta que no tiene demasiada importancia como forrajera, sí que presenta cierto interés pastoral, sobre todo en suelos pobres y en zonas de dehesa.\\nEn la actualidad se están desarrollando estudios en los que se emplean mezclas de leguminosas anuales, entre ellas T. glomeratum, para la mejora de suelos pobres o abandonados. Tras una siembra adecuada de esos ecotipos que se están investigando, junto con un correcto manejo y aprovechamiento ganadero, se podría conseguir mejorar las condiciones de esos suelos. Así se favorecería el posterior establecimiento de pastizales con elevado potencial productivo y desarrollo, integrado por especies como Trifolium subterraneum, Medicago polymorpha y Ornithopus compressus, entre otras."},{"page_url":"https://sv.wikipedia.org/wiki/S%C3%B6dert%C3%A4ljev%C3%A4gen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Milsten_Bergaholm_2013.jpg","page_title":"Södertäljevägen","context_page_description":"Södertäljevägen är en vägförbindelse mellan Liljeholmsbron i Stockholm och Södertälje som idag till största delen utgörs av motorvägen E4/E20. Gamla Södertäljevägen i Huddinge kommun och sydvästra Stockholms kommun är en kvarstående rest av den äldre huvudvägförbindelsen och numera en lokalgata. Södertäljevägen var tidigare en del av Riksväg 1."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%DB%8C%D9%84_%DA%A9%DB%8C%D8%AB_(%D9%85%D9%88%D8%B2%DB%8C%D8%B3%DB%8C%D9%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Bill_Keith%2C_banjoist_on_stage_at_Cambridge_Folk_Festival%2C_July_1985.jpg","page_title":"بیل کیث (موزیسین)","context_page_description":"بیل کیث (موزیسین) آمریکالی موسیقیچی - کانتری موسیقی ژانرلاریندا اثرلر یارادیب. بیل کیث (موزیسین) ۲۰ دسامبر ۱۹۳۹ تاریخینده حیاتا گؤز آچیب و ۲۳ اوْکتوبر ۲۰۱۵ میلادی تاریخینده وفات ائدیب."},{"page_url":"https://pl.wikipedia.org/wiki/Chylonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Chylonia.png","page_title":"Chylonia","context_page_description":"Chylonia – największa pod względem liczby mieszkańców dzielnica Gdyni – zamieszkuje ją ponad 22,3 tys. osób. Jej zabudowa jest zróżnicowana, stanowią ją głównie bloki mieszkalne i domy jednorodzinne oraz tereny przemysłowe i kolejowe."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A4%D1%80%D0%B5%D0%BD%D0%BA_%D0%91%D0%BE%D1%80%D0%BC%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/MV_Retriever_1.jpg","page_title":"Френк Борман","context_page_description":"Френк Фредерик Борман II бивши је амерички пилот, ваздухопловни инжењер, астронаут. Изабран је за астронаута 1962. године. Носилац је Конгресне свемирске медаље части.\\nПре него што је изабран за астронаута, летео је као борбени и тест пилот у Америчком ратном ваздухопловству. Службовао је на Филипинима. Након што је завршио мастер студије, три године је био асистент на Вест Поинту на предметима термодинамика и механика флуида. Завршио је елитну школу за пробне пилоте при Ратном ваздухопловству САД у ваздухопловној бази Едвардс, Калифорнија. Летео је два пута у свемир, на мисијама Џемини 7, која је била најдужа мисија тог програма и трајала је две недеље, и Аполо 8, која је прва обишла Месец са људском посадом. Био је резервни командант мисије Џемини 4. Један је од ретких астронаута који су добили прилику да командују својим првим летом. Пензионисао се у јулу 1970. године са чином пуковника, претходно одбивши могућност командовања мисијом на Месец. Мада му није званично понуђено, тадашњи директор летачких операција НАСА Доналд Слејтон истакао је да би послао посаду Апола 8 на Месец да слети да је Борман био вољан да командује. У свемиру је провео непуних 20 дана."},{"page_url":"https://ko.wikipedia.org/wiki/AV_%EC%97%AC%EB%B0%B0%EC%9A%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Uehara_Ai_%28%E4%B8%8A%E5%8E%9F%E4%BA%9C%E8%A1%A3%29_at_Tokyo_Game_Show_2014_%282%29.jpg","page_title":"AV 여배우","context_page_description":"AV 여배우는 일본의 어덜트 비디오에 출연하는 전문 여배우를 말한다. 성인물이 아닌 다른 분야에서 활동을 할 때에는 섹시 여배우라고 부른다. AV 아이돌 이라고 부르는 경우도 있다. 2012년 기준으로 6~8천명의 AV 여배우가 활동하고 있다고도 하며, 다른 의견으로 2011년에 이미 연인원 20만명에 이르렀다는 말도 있다. 한편, 과거에는 성인 비디오에 출연하는 사람을 배우라고 부르는 것은 배우에게 실례가 된다며, AV 걸이라고 부르기도 했다."},{"page_url":"https://sv.wikipedia.org/wiki/Ratufa_macroura","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Flickr_-_Rainbirder_-_Giant_Squirrel_%28Ratufa_macroura%29.jpg","page_title":"Ratufa macroura","context_page_description":"Ratufa macroura är en däggdjursart som först beskrevs av Thomas Pennant 1769. Ratufa macroura ingår i släktet jätteekorrar och familjen ekorrar.\\nInga underarter finns listade i Catalogue of Life. Wilson & Reeder skiljer mellan 3 underarter."},{"page_url":"https://sv.wikipedia.org/wiki/Morristown,_Tennessee","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Rose_School_-Now_Rose_Center_Council_for_the_Arts.jpg","page_title":"Morristown, Tennessee","context_page_description":"Morristown är en stad i Hamblen County, och Jefferson County, i Tennessee. I Hamblen County är Morristown administrativ huvudort. Vid 2010 års folkräkning hade Morristown 29 137 invånare."},{"page_url":"https://pt.wikipedia.org/wiki/Iostephane","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/IostephaneheterophyllaUNAM.JPG","page_title":"Iostephane","context_page_description":"Iostephane é um género botânico pertencente à família Asteraceae."},{"page_url":"https://ro.wikipedia.org/wiki/Clementinum","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Prague_Praha_2014_Holmstad_observasjonst%C3%A5rnet_Klementinum_observation_tower.jpg","page_title":"Clementinum","context_page_description":"Clementinum este un complex de clădiri istorice din Praga. Până de curând, complexul a găzduit Bibliotecile Națională, Universitară și Tehnică, în timp ce Biblioteca Orașului se afla în apropiere, pe Mariánské Náměstí. Biblioteca Tehnică și Biblioteca Municipală s-au mutat în anul 2009 în clădirea Bibliotecii Tehnice Naționale din Praga din Technická 6. Clădirea este utilizată în prezent ca Biblioteca Națională a Republicii Cehe. În 2005, Biblioteca Națională Cehă a primit Premiul Jikji din partea UNESCO."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%83%D1%82%D0%B5%D0%BD%D0%B0%D0%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/Chateau_de_Boutenac.JPG","page_title":"Бутенак","context_page_description":"Бутена́к — коммуна во Франции, находится в регионе Лангедок — Руссильон. Департамент коммуны — Од. Входит в состав кантона Лезиньян-Корбьер. Округ коммуны — Нарбонна.\\nКод INSEE коммуны — 11048."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_Kaisar_Romawi_Timur","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Heraclius_and_sons.jpg","page_title":"Daftar Kaisar Romawi Timur","context_page_description":"Berikut ini merupakan sebuah daftar Kaisar Romawi Timur atau Kekaisaran Bizantium. Daftar ini tidak termasuk sejumlah rekan-kaisar yang tidak pernah secara tunggal atau status senior sebagai pemimpin, tidak termasuk pula sejumlah penyerap atau pemberontak yang menuntut gelar kerajaan.\\nDaftar ini dimulai dengan Konstantinus I, Kaisar Romawi pertama yang menganut Kristiani, yang mendirikan Konstantinopel, dan yang juga dianggap oleh Kaisar-kaisar Bizantium selanjutnya sebagai tokoh pemimpin. Diokletianus yang merupakan pendahulunya terkadang dianggap Kaisar \\"Bizantium\\" pertama di dalam akal politik, karena ia menggantikan jebakan-jebakan republika di kantor dengan otokrasi yang mudah, menandai transisi dari Kepangeranan menjadi Dominan yang absolutis, bentuk yang biasanya lebih oriental dan monarki Helenistik yang mencirikan Kekaisaran. Akan tetapi hanya di bawah kekuasaan Konstantinuslah karakteristik utama dari negara Bizantium muncul: sebuah pemerintahan Romawi berpusat di Konstantinopel dan budaya didominasi oleh Timur Yunani, dengan agama Kristen sebagai agama negara."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_2017/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Ugo_Ehiogu.jpg","page_title":"Lijst van personen overleden in 2017/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 2017.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://fr.wikipedia.org/wiki/ASP_World_Tour_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Gabriel_Medina_2012.jpg","page_title":"ASP World Tour 2014","context_page_description":"L'ASP World Tour 2014 est un circuit professionnel de surf organisé par l'Association des surfeurs professionnels et qui constitue le championnat du monde pour la discipline en 2014. Il s'agit de la trente-neuvième édition de l'ASP World Tour qui se tient tous les ans. Il se déroule en plusieurs étapes dispersées à travers le monde entre mars et décembre 2014."},{"page_url":"https://en.wikipedia.org/wiki/Elizabeth_Meyer","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Yacht_Endeavour_C_photo_D_Ramey_Logan.jpg","page_title":"Elizabeth Meyer","context_page_description":"Elizabeth E Meyer, was born in Baltimore in 1953. She was instrumental in the restoration of the J Class Yachts beginning with Endeavour in the mid 1980s. She is married to Michael McCaffrey."},{"page_url":"https://fa.wikipedia.org/wiki/VIPR2","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/PBB_GE_VIPR2_205947_s_at_fs.png","page_title":"VIPR2","context_page_description":"گیرنده ۲ پپتید وازواکتیو روده‌ای که با نام VPAC₂ هم شناخته می‌شود، یک پروتئین است که در انسان توسط ژن «VIPR۲» کدگذاری می‌شود.\\nاین پروتئین در رحم، پروستات، ماهیچه صاف دستگاه گوارش، کیسه منی، پوست، رگ‌های خونی و تیموس بیان می‌شود. این پروتئین در مخچه هم یافت می‌شود."},{"page_url":"https://nl.wikipedia.org/wiki/Menkaoera","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Menkaura.jpg","page_title":"Menkaoera","context_page_description":"Menkaoera was de zesde koning van de 4e dynastie. Hij regeerde volgens de Turijnse koningslijst 28 jaar, Manetho geeft hem 63 jaar. Hij is de zoon van Chafra en de kleinzoon van Choefoe."},{"page_url":"https://es.wikipedia.org/wiki/Regi%C3%B3n_H_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Eagle_nebula_pillars.jpg","page_title":"Región H II","context_page_description":"Una región H II es una nube de gas y plasma brillante que puede alcanzar un tamaño de varios cientos de años luz y en la cual se forman estrellas masivas. Dichas estrellas emiten copiosas cantidades de luz ultravioleta extrema que ionizan la nebulosa a su alrededor.\\nEstas regiones pueden dar nacimiento a una gran cantidad de estrellas durante un periodo de varios millones de años. Al final, los intensos vientos estelares y explosiones de supernova en el cúmulo estelar resultante dispersan los gases de la región, dejando atrás un cúmulo similar al de las Pléyades.\\nLas regiones H II son llamadas así por la gran cantidad de hidrógeno atómico ionizado que contienen. En astronomía se denomina H₂ al hidrógeno molecular, H I al hidrógeno neutro y H II al hidrógeno ionizado. Pueden ser vistas a gran distancia en el universo y su estudio es importante para determinar la distancia y la composición química de otras galaxias."},{"page_url":"https://de.wikipedia.org/wiki/Nahverkehr_in_K%C3%B6ln","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/KKS_Nordwest.jpg","page_title":"Nahverkehr in Köln","context_page_description":"In der nordrhein-westfälischen Großstadt Köln besteht ein dichtes Nahverkehrsnetz, welches aus der Stadtbahn Köln, einem Mischsystem aus Straßen- und U-Bahn, sowie der S-Bahn, Regionalzügen und Buslinien besteht."},{"page_url":"https://ca.wikipedia.org/wiki/G%C3%ADtion","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Dimos_Gythiou.png","page_title":"Gítion","context_page_description":"Gítion fou una antiga ciutat aquea de Lacònia, prop del golf Lacònic, al sud-oest de la desembocadura del riu Eurotes, a uns 43 km d'Esparta. Era a la riba d'un petit riu anomenat Gythios, i en una fèrtil plana. Era famosa pels seus formatges que s'esmenten als diàlegs de Lucià.\\nFou la principal ciutat marítima de Lacònia i fou considerada el port d'Esparta, i els vaixells de guerra d'Esparta normalment estacionaven al port de Gítion. Durant la guerra del Peloponès fou atacada pels atenencs diverses vegades; el 455 aC fou incendiada per Tòlmides, el comandant atenenc. Durant el període d'hegemonia tebana, Epaminondes, després de la batalla de Leuctres, va avançar al sud fins a Gítion però, tot i que la va assetjar durant tres dies, no la va poder ocupar. Encara que era ben fortificada el tirà Nabis d'Esparta en va reforçar les muralles; fou conquerida pels romans el 195 aC i vers el 30 aC August la va incloure dins la confederació de ciutats lliures de Lacònia, i durant la dominació romana fou una ciutat de certa importància."},{"page_url":"https://es.wikipedia.org/wiki/Diglossa_humeralis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Black_Flowerpiercer_%28Diglossa_humeralis%29.jpg","page_title":"Diglossa humeralis","context_page_description":"Diglossa humeralis es una especie de ave paseriforme de la familia Thraupidae que vive en Sudamérica.​"},{"page_url":"https://en.wikipedia.org/wiki/Atys_(Piccinni)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Attis_thymiaterion_Louvre_Tarse61.jpg","page_title":"Atys (Piccinni)","context_page_description":"Atys is a tragédie lyrique in three acts by Niccolò Piccinni with a French libretto by Jean-François Marmontel. Marmontel's libretto was based upon Philippe Quinault's libretto for Jean-Baptiste Lully's 1676 opera of the same title. Quinault based his rendition on Ovid's Fasti. Marmontel adapted Quinault's libretto and modified it by removing the prologue and divertissements. He also altered the plot; instead of using Ovid's metamorphic ending, Atys commits suicide. Piccinni's opera was premiered by the Paris Opera at the second Salle du Palais-Royal on 22 February 1780. Musically the opera is admired for its fugal overture, the dream sequence in Act II, the long quartet at the dramatic climax, and the somber dirge with which it ends.\\nIn 1783 there was a second version of the opera produced by Piccinni and Marmontel. In order to satisfy the current trends in opera, they changed the ending to a lieto fine, or happy ending, by rewriting entire sections of the original opera. In this second version Atys was returned to the stage of the Opéra in 1783, 1784, 1791 and 1792. In all, it was mounted at the Opéra on 65 dates before being dropped for good."},{"page_url":"https://uz.wikipedia.org/wiki/Sahihi_Muslim","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/SahihMuslimCover.jpg","page_title":"Sahihi Muslim","context_page_description":"Sahihi Muslim-sunniy Islomdagi Kutub as-Sittah dan biridir. Bu sunniy musulmonlar va Zaydiy shia musulmonlari tomonidan katta eʼtirof etilgan.\\nSahihi Buxoriydan keyingi eng ishonchli hadislar toʻplami hisoblanadi. Uni Imom Muslim deb nomlanuvchi Muslim Ibn Hajjoj toʻplagan"},{"page_url":"https://nl.wikipedia.org/wiki/Richard_Roland_Holst","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Goethe%27s_Faust.jpeg","page_title":"Richard Roland Holst","context_page_description":"Richard Nicolaüs Roland Holst was een Nederlandse beeldend kunstenaar: schilder, tekenaar, lithograaf, boekbandontwerper, etser, houtsnijder, glazenier en schrijver."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D1%96%D0%BC%D0%BE%D1%82%D1%96_%D2%90%D0%B0%D1%80%D1%82%D0%BE%D0%BD_%D0%95%D1%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Timothy_Garton_Ash_2009.jpg","page_title":"Тімоті Ґартон Еш","context_page_description":"Тімоті Ґартон Еш — британський історик, журналіст і письменник, автор багатьох книг та публікацій, присвячених політиці та «історії теперішнього часу», які змальовують трансформацію Європи протягом останньої чверті століття."},{"page_url":"https://id.wikipedia.org/wiki/Safety_Last!","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Safetylast-1.jpg","page_title":"Safety Last!","context_page_description":"Safety Last! adalah film bisu komedi percintaan tahun 1923 yang dibintangi Harold Lloyd. Film ini berisi adegan paling terkenal dari era film bisu: Lloyd bergantungan pada jarum dari sebuah jam besar di luar sebuah pencakar langit dengan lalu lintas kendaraan di bawahnya.\\nJudul film ini merupakan parodi dari ungkapan safety first. Lloyd melakukan sendiri adegan ketangkasan memanjat tanpa pemeran pengganti, meski sudah kehilangan sebuah ibu jari dan sebuah telunjuk dalam pengambilan gambar sebuah film empat tahun sebelumnya."},{"page_url":"https://en.wikipedia.org/wiki/Irish_nationalism","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/%22To_Protest_Against_the_Lawless_Policy_of_Carsonism%22.jpg","page_title":"Irish nationalism","context_page_description":"Irish nationalism is a nationalist political movement which asserts that the Irish people are a nation and espouses the creation of a sovereign Irish nation-state on the island of Ireland. Irish nationalism celebrates the culture of Ireland, especially the Irish language, literature, music, and sports. It grew more potent during the period in which all of Ireland was part of the United Kingdom, which led to most of the island seceding from the UK in 1921.\\nIrish nationalists assert that foreign rule has been detrimental to Irish interests. Politically, Irish nationalism gave way to many factions which created conflict, often violent, throughout the island. The chief division affecting nationalism in Ireland was religious. The majority of the island's population was Roman Catholic, which is the part that seceded, but a portion of the northern part has a Protestant majority that elected to stay a part of the United Kingdom. Since the partition of Ireland, Irish nationalism often refers to support for Irish reunification."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%86%D8%B7%D9%82%D8%A9_%D8%AF%D9%8A%D8%BA%D9%8A%D9%86%D8%AF%D9%88%D8%B1%D9%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Aerials_Deggendorf_16.06.2006.jpg","page_title":"منطقة ديغيندورف","context_page_description":"مِنْطَقَة دِيغيِندُورف هي دائِرَة أَلمانِيَّة تَّابعة لمُحافظة باڤارِيا السُّفلَى في وِلاَية باڤارِيا في جُمهُوريَّة أَلمَانيَا الاِتّحاديّة. وتضُمّ مِنطقَة دِيغيِندُورف ثلاث مُدُن، وأَربعة أَسواق، وسَبع بلدات بمِساحة تُقَدَّر بحَوالَي 861 كم."},{"page_url":"https://en.wikipedia.org/wiki/Ghostbusters_II","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/116_NYC_%28Liberty_Island%29.jpg","page_title":"Ghostbusters II","context_page_description":"Ghostbusters II is a 1989 American supernatural comedy film directed by Ivan Reitman and written by Dan Aykroyd and Harold Ramis. It stars Bill Murray, Dan Aykroyd, Sigourney Weaver, Harold Ramis, Rick Moranis, Ernie Hudson, and Annie Potts. It is the sequel to the 1984 film Ghostbusters and the second film in the Ghostbusters franchise. Set five years after the events of the first film, the Ghostbusters have been sued and put out of business after the destruction caused during their battle with the demi-god Gozer. When a new paranormal threat emerges, the Ghostbusters re-form to combat it and save the world.\\nAfter the phenomenal success of Ghostbusters, Columbia Pictures wanted a sequel but struggled to overcome objections from the cast and crew. As with the first film, Aykroyd and Ramis collaborated on the script, which went through many variations. The pair wanted to convey a message about the consequences of negative human emotions in large cities. They settled on the idea of negative feelings creating a mass of supernatural slime beneath New York City that empowers malevolent spirits."},{"page_url":"https://fr.wikipedia.org/wiki/Culture_%C3%A9gyptienne","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/The_ladies.jpg","page_title":"Culture égyptienne","context_page_description":"La culture égyptienne désigne ici la culture contemporaine, les pratiques culturelles observables de ses 93 000 000 d'habitants, sur les bases des cultures antiques de l'Égypte"},{"page_url":"https://en.wikipedia.org/wiki/Wicket","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Loughton_Cricket_Club_ground_scoreboard_at_Loughton%2C_Essex%2C_England.jpg","page_title":"Wicket","context_page_description":"In cricket, the term wicket has several meanings:\\nIt is one of the two sets of three stumps and two bails at either end of the pitch.\\nThe wicket is guarded by a batsman who, with his bat, attempts to prevent the ball from hitting the wicket and to score runs where possible.\\nThrough metonymic usage, the dismissal of a batsman is known as the taking of a wicket,\\nThe cricket pitch itself is sometimes referred to as the wicket."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Lynyrd_Skynyrd_members","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Skinny_Molly_en_Barcelona.jpg","page_title":"List of Lynyrd Skynyrd members","context_page_description":"Lynyrd Skynyrd is a Southern rock band from Jacksonville, Florida. Formed in 1964, the group originally included vocalist Ronnie Van Zant, guitarists Gary Rossington and Allen Collins, bassist Larry Junstrom and drummer Bob Burns. The current lineup features Rossington, guitarist and vocalist Rickey Medlocke, lead vocalist Johnny Van Zant, drummer Michael Cartellone, guitarist Mark Matejka, keyboardist Peter Keys and bassist Keith Christopher. The band also tours with two backing vocalists, currently Dale Krantz-Rossington and Carol Chase."},{"page_url":"https://en.wikipedia.org/wiki/Edward_J._Nanson","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Ejnanson155x273.jpg","page_title":"Edward J. Nanson","context_page_description":"Edward John Nanson was a mathematician known for devising Nanson's method, a Condorcet-compliant variation of the Borda count using successive elimination to find a winner.\\nHe was born in England and received his professional education at Trinity College from 1870 to 1874. In 1875, he was appointed Professor of Mathematics at the University of Melbourne, in the state of Victoria, Australia where he immigrated. Nanson was an election reformer and office bearer of the Proportional Representation League of Victoria who produced several booklets on election methods. He retired from his lifetime appointment in 1922. At the time of his death, he was survived by ten children from two marriages. The Professor Nanson Prize was named in his honour, which is annually awarded to students for outstanding achievements in pure and applied mathematics."},{"page_url":"https://nl.wikipedia.org/wiki/Allan_Jepsen","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/22/Allan_Jepsen_02.jpg","page_title":"Allan Jepsen","context_page_description":"Allan Kierstein Jepsen is een voormalig profvoetballer uit Denemarken, die speelde als verdediger. Hij beëindigde zijn loopbaan in 2011 bij de Deense club AC Horsens."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%BC%D0%B1%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Flag_of_Staroyurevsky_rayon_%28Tambov_oblast%29.png","page_title":"Тамбовская область","context_page_description":"Тамбо́вская о́бласть — субъект Российской Федерации, входит в состав Центрального федерального округа. Площадь — 34 462 км². Население — 1 040 327. Глава администрации — Никитин, Александр Валерьевич.\\nТамбовская область лежит в южной части Восточно-Европейской равнины, в центральной части Окско-Донской равнины. Наиболее значительные реки — Цна, Ворона, Битюг и другие. Климат Тамбовской области умеренно континентальный. Средняя температура января −8 −9, июля +19 +20. Осадков в среднем за год выпадает от 450 до 550 мм. Тамбовская область расположена в зоне лесостепи. Почвы — чернозёмы типичные мощные, на юге — выщелоченные, на севере — серые лесные почвы. По долинам и балкам — лугово-чернозёмные и торфяно-болотные. Леса занимают около 10 % территории.\\nАдминистративный центр: город Тамбов.\\nОбразована: 27 сентября 1937 года.\\nНаграждена 22 июня 1967 года орденом Ленина.\\nГраничит с Рязанской, Пензенской, Саратовской, Воронежской и Липецкой областями."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8D%A1%E6%B3%BD%E8%92%99%E4%BB%A3%E7%BA%B3%E5%B0%94","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/Map_commune_FR_insee_code_82042.png","page_title":"卡泽蒙代纳尔","context_page_description":"卡澤蒙代納爾是法國南部-庇里牛斯大區 塔恩-加龍省的一個市鎮，屬於卡斯特爾薩拉桑區 洛澤爾特縣。該市鎮2009年時的人口 為1,185人。"},{"page_url":"https://de.wikipedia.org/wiki/Braunau_TG","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Braunau_%28Turgovio%29_faktrabdomo_262.JPG","page_title":"Braunau TG","context_page_description":"Braunau, schweizerdeutsch Brunau, ist eine politische Gemeinde und eine Ortschaft im Bezirk Münchwilen des Schweizer Kantons Thurgau.\\nDie Ortsgemeinde Braunau wurde 1999 von der Munizipalgemeinde Tobel abgetrennt und in die politische Gemeinde Braunau umgewandelt. Gleichzeitig vereinigten sich die verbleibenden Ortsgemeinden Tägerschen und Tobel zur politischen Gemeinde Tobel-Tägerschen."},{"page_url":"https://es.wikipedia.org/wiki/Rosa_Gil_Bosque","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Rosa-gil-bosque.jpg","page_title":"Rosa Gil Bosque","context_page_description":"Rosa Gil Bosque, fue la primera catedrática de guitarra del Conservatorio de Valencia, Presidenta de la Sociedad Amigos de la Guitarra e Insigne de la Música Valenciana."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D0%BB%D1%84%D1%80%D0%B5%D0%B4_%D0%A4%D0%B0%D1%83%D0%BB%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Alfred_Fowler.jpg","page_title":"Алфред Фаулер","context_page_description":"Алфред Фаулер, члан Краљевског астрономског друштва био је енглески астроном. Немојте га помешати са америчким астрофизичарем Вилијамом Алфредом Фовлером.\\nРођен је у Јоркширу и школовао се у Лондонској нормалној научној школи која је касније апсорбована у Империјал Колеџ у Лондону.\\nПостављен је за Инструктора за астрофизику на Империјал Колеџу и радио је тамо до своје смрти. Био је експерт на пољу стетоскопије. Био је један од троје који је открио да је температура сунчане мрље мања од температуре области која је окружује.\\nИзабран је за члана Краљевског астрономског друштва 1910. године, на шта указује његов цитат:\\n\\"Помоћник Краљевског научног колеџа. Асистент професора физике Империјал Колеџа и Технологије. Истакнут због својих доприноса астрономској физици стетоскопским опсервацијама еклипсе, сунчаних мрља и експерименталним истраживањима. Помоћник у опсервацијама тоталне еклипсе Сунца са Норманом Локјером 1893., 1896., 1898., 1900. године.\\nФаулер је био председник Краљевског астрономског друштва од 1919. до 1921. године, а преминуо је у Лондону 1940. године."},{"page_url":"https://fi.wikipedia.org/wiki/Profeettojen_Haggai,_Sakarja_ja_Malakia_hauta","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/C%2BB-Tombs-Fig3-TombOfTheProphets.PNG","page_title":"Profeettojen Haggai, Sakarja ja Malakia hauta","context_page_description":"Profeettojen Haggai, Sakarja ja Malakia hauta on Jerusalemissa Öljymäen länsirinteeseen louhittu kalliohauta. Keskiaikaisen juutalaisen perimätiedon mukaan Profeettojen hautaan on haudattu profeetat Haggai, Sakarja ja Malakia, jotka ovat viimeiset heprealaiset profeetat. Profeettojen uskotaan eläneen 500–400-luvuilla eaa. Arkeologisesti haudan kolme vanhinta hautakammiota on kuitenkin ajoitettu vasta ensimmäiselle vuosisadalle eaa."},{"page_url":"https://de.wikipedia.org/wiki/Ost-S%C3%BCd-Umfahrung_Landshut","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Ost-S%C3%BCd-Umfahrung_Landshut_-_Trassenvarianten_%28Dez2014-M%C3%A4r2015%29.png","page_title":"Ost-Süd-Umfahrung Landshut","context_page_description":"Die Ost-Süd-Umfahrung Landshut ist eine zum Bundesverkehrswegeplan 2030 angemeldete Ortsumfahrung der Stadt Landshut, die teilweise über das Gebiet des Landkreises Landshut führt. Ab dem Autobahnkreuz mit der A 92 ist sie als vierspurige Fortführung der Bundesstraße 15n zur Bundesstraße B 299 geplant. In einem zweiten Abschnitt soll sie von der B 299 zweispurig bis zur B 15 weitergeführt werden. Im vom Bundeskabinett beschlossenen Bundesverkehrswegeplan 2030 sowie dem Entwurf eines Sechsten Gesetzes zur Änderung des Fernstraßenausbaugesetzes, wird sie als Teilstück der B 15 geführt."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Arsk","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Coat_of_Arms_of_Arsk_%28Tatarstan%29.png","page_title":"Arsk","context_page_description":"Arsk sī Lō͘-se-a Tatarstan Kiōng-hô-kok ê chi̍t ê siâⁿ-chhī."},{"page_url":"https://ca.wikipedia.org/wiki/Compost_qu%C3%ADmic","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Iron-pentacarbonyl-from-xtal-3D-balls.png","page_title":"Compost químic","context_page_description":"Un compost químic és una substància pura formada per dos o més elements químics i que pot descompondre's en aquests per mètodes químics apropiats.\\nEls composts, igual que les mescles, estan constituïts per dos o més elements químics diferents, però es diferencien essencialment d'aquestes en els següents aspectes:\\nEls components de les mescles poden separar-se per mitjans físics, però els constituents dels composts, no.\\nLes mescles tenen les propietats dels seus components, però els composts posseeixen les seves propietats específiques corresponents.\\nLes mescles poden existir en qualsevol proporció mentre que els composts es formen a partir dels elements químics en proporció invariable.\\nLa formació o descomposició d'un compost químic va sempre unida a un despreniment o absorció de calor, mentre que per a una mescla l'efecte calorífic és nul o en tot cas, molt petit.\\nEn general els composts químics tenen una estructura química definida i única i amb una relació determinada dels components."},{"page_url":"https://kk.wikipedia.org/wiki/IC_3029","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/IC3029_-_SDSS_DR14.jpg","page_title":"IC 3029","context_page_description":"IC 3029 — Вероника шашы шоқжұлдызында орналасқан SBc типті галактика."},{"page_url":"https://fi.wikipedia.org/wiki/Alankomaat","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Map_provinces_Netherlands-en.svg","page_title":"Alankomaat","context_page_description":"Alankomaat eli Hollanti on valtio läntisessä Euroopassa. Yhdessä Curaçaon, Sint Maartenin ja Aruban kanssa se muodostaa Alankomaiden kuningaskunnan. Maa on yksi Euroopan unionin perustajavaltioista. Belgian ja Luxemburgin kanssa se muodostaa niin sanotun Benelux-maiden alueen.\\nAlankomaat rajoittuu idässä Saksaan, etelässä Belgiaan ja pohjoisessa sekä lännessä Pohjanmereen. Lisäksi Alankomailla on maarajaa myös Ranskan kanssa Karibianmerellä sijaitsevalla Saint-Martinin saarella. Valtion pinta-ala on 41 526 neliökilometriä. Väkiluku oli vuoden 2019 lopussa 17,4 milj. Alankomaiden pääkaupunki on Amsterdam, mutta valtionhallinto sijaitsee Haagissa, joka on asukasluvultaan maan kolmanneksi suurin kaupunki. Maan toiseksi suurimmassa kaupungissa, Rotterdamissa, on Euroopan suurin satama. Maan neljänneksi suurin kaupunki on Utrecht. Maan tiheimmin asuttua aluetta kutsutaan Randstadiksi.\\nMaantieteellisesti Alankomaat on ainutlaatuinen valtio maailmassa, sillä suuri osa siitä sijaitsee merenpinnan tason alapuolella. Maapinta-alasta noin 20 prosenttia sijaitsee ja 21 prosenttia väestöstä asuu merenpinnan tason alapuolella."},{"page_url":"https://fr.wikipedia.org/wiki/Photographes_officiels_des_Beatles","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Donald_McCullin_%281964%29.jpg","page_title":"Photographes officiels des Beatles","context_page_description":"Cette page énumère les photographes qui ont façonné l'image du groupe rock britannique The Beatles."},{"page_url":"https://fr.wikipedia.org/wiki/Minorque","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/Bandera_de_Menorca.svg","page_title":"Minorque","context_page_description":"Minorque est l'une des quatre îles Baléares habitées, cet archipel étant situé en mer Méditerranée. Elle se place au nord-est de Majorque et est voisine de l'îlot de l'Aire. Son nom provient du fait qu'elle est plus petite que l'île de Majorque. Elle a été appelée Nura par les Phéniciens en l'honneur de leur dieu Baal. Elle est située entre 39° 47' N et 40° 00' N, 3° 52' E et 4° 24' E. Son point culminant, El Toro, est à 358 m au-dessus du niveau de la mer. L'île a de nombreux monuments en pierre mégalithique : navetes, taulas, et talaiots. Rocailleuse et battue par les vents, l'île est la plus préservée de l'archipel. Minorque a été reconnue en tant que réserve de biosphère par l'UNESCO le 8 octobre 1993.\\nMinorque abrite une population de plus de 93 000 habitants, les Minorquins."},{"page_url":"https://eu.wikipedia.org/wiki/Londresko_Olinpiar_Estadioa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Olympic_Stadium_%28London%29%2C_8_August_2012.jpg","page_title":"Londresko Olinpiar Estadioa","context_page_description":"Londresko Olinpiar Estadioa Ingalaterrako Londres hiriburuko Stratford auzoan dagoen estadio bat da. 2012ko Udako Olinpiar Jokoen egoitza edo jokoleku nagusia izateko Londresko Olinpiar Parkean eraikia izan zen. West Ham United F.C. futbol taldearen jokalekua da."},{"page_url":"https://en.wikipedia.org/wiki/Hassocks","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Hassocks_Infants_School.jpg","page_title":"Hassocks","context_page_description":"Hassocks is a large village and civil parish in the Mid Sussex District of West Sussex, England. Its name is believed to derive from the tufts of grass found in the surrounding fields.\\nLocated approximately 7 miles north of Brighton, with a population of 8,319, the area now occupied by Hassocks was just a collection of small houses and a coaching house until the 19th century, when work started on the London to Brighton railway. Hassocks until 2000 was just a postal district and prior to that the name of the railway station. The Parishes were named Clayton and Keymer and it is believed that when the railway came in 1841 the Parish Councils were given the opportunity of naming the station. However they could not agree and eventually the directors of the London, Brighton & South Coast Railway gave up waiting and named the station Hassocks Gate themselves."},{"page_url":"https://de.wikipedia.org/wiki/Menhir","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Yverdon-Clendy-02.jpg","page_title":"Menhir","context_page_description":"Menhir ist eine aus dem Bretonischen entlehnte Bezeichnung für einen vorgeschichtlichen, hochragenden Steinblock, der auch als Hinkelstein bekannt ist.\\nIn der prähistorischen Archäologie bezeichnet das Wort einen länglichen Einzelstein, der in vorgeschichtlicher Zeit von Menschen aufrecht gestellt wurde. Die Identifikation als Menhir ist oft nur durch eine Ausgrabung zu verifizieren. Aufrechte Steine dienten auch als Grenzsteine, Ruhsteine, Werbung für Steinbrüche, moderne Gedenksteine und Gartenornamente sowie als Markierung von Straßen."},{"page_url":"https://en.wikipedia.org/wiki/Ashl%C3%A9_Dawson","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Dawson_02.png","page_title":"Ashlé Dawson","context_page_description":"Ashlé Dawson is an American choreographer, director, and dancer from Long Island, New York."},{"page_url":"https://pl.wikipedia.org/wiki/Zasada_jednej_kropli_krwi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/US_miscegenation.svg","page_title":"Zasada jednej kropli krwi","context_page_description":"Zasada jednej kropli krwi – obowiązująca w ustawodawstwie części stanów USA do 1979 roku oraz w szerokim zakresie społecznie uznawana w tym państwie zasada, że człowiek, który posiada domieszkę choćby „jednej kropli krwi” rasy czarnej, a w szerszym rozumieniu innej niż biała, nie może być uważany za białego. Zasada ta była podstawą wprowadzenia w niektórych stanach zakazu małżeństw międzyrasowych zniesionego w 1967 i powiązanego z eugeniką the Racial Integrity Act z 1924, zniesionego w 1979 roku."},{"page_url":"https://hu.wikipedia.org/wiki/Tiurana","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Tiurana_fa%C3%A7ana_santpere.jpg","page_title":"Tiurana","context_page_description":"Tiurana község Spanyolországban, Lleida tartományban. Tiurana La Baronia de Rialb, Bassella, Vilanova de l'Aguda, Oliola és Ponts, Lleida községekkel határos. Lakosainak száma 77 fő."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A7%D0%B5%D1%80%D0%BA%D0%B0%D1%81%D1%8C%D0%BA%D0%B0_%D0%9B%D0%BE%D0%B7%D0%BE%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/River%2C_Cherkasy_Lozova%2801%29.JPG","page_title":"Черкаська Лозова","context_page_description":"Черка́ська Лозова́ — село в Україні, у Дергачівському районі Харківської області. Населення становить 4186 осіб. Орган місцевого самоврядування — Черкасько-Лозівська сільська рада."},{"page_url":"https://fr.wikipedia.org/wiki/Loretta_Young","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Cause_For_Alarm%21.JPG","page_title":"Loretta Young","context_page_description":"Gretchen Michaela Young, connue sous le nom de Loretta Young, est une actrice américaine née le 6 janvier 1913 à Salt Lake City, et morte le 12 août 2000 à Los Angeles.\\nElle est la sœur des actrices Polly Ann Young et Sally Blane."},{"page_url":"https://fr.wikipedia.org/wiki/Porozovo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/%D0%97%D0%B0%D0%B2%D0%BE%D0%BB%D0%B6%D1%81%D0%BA%D0%B8%D0%B9_%D1%85%D0%B8%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4.jpg","page_title":"Porozovo","context_page_description":"Porozovo est un village de 100 habitants situé dans le raïon de Zavoljsk de l'oblast d'Ivanovo, en Russie. Il est arrosé par la Volga.\\nPorozovo fait partie de la commune rurale de Vozvdijenskoïe."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D1%8D%D1%83%D1%82%D0%B0%D1%80%D1%83,_%D0%91%D0%B0%D1%80%D0%B1%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Stefan_Luchian_-_Barbu_Lautarul.jpg","page_title":"Лэутару, Барбу","context_page_description":"Барбу Лэутару — молдавский певец и музыкант.\\nРодился в 1780 году. Настоящая имя и фамилия лэутара — Василе Барбу. Родился в Яссах, посвятил себя лэутарскому делу с детских лет.\\nОн научился играть на скрипке, нае и кобзе. В 1812 году Василе Барбу избрали старостой лэутарского цеха в его родном городе. Он умер в 1860 году."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%95%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%B8%D1%87%D0%BD%D0%B8%D0%B9_%D0%B3%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Dynamo.wechsel.wiki.v.1.00.gif","page_title":"Електричний генератор","context_page_description":"Електричний генератор — пристрій, призначений для перетворення енергії механічного руху на енергію електричного струму, здебільшого з використанням принципу електромагнітної індукції. Електричний генератор є електричною машиною з дією, протилежною дії електродвигуна. Завдання джерела механічної енергії для генератора, можуть виконувати: парова машина чи парова турбіна, потік води, що обертає колесо, вітер, двигун внутрішнього згоряння або навіть сила людини."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B1%D0%B4%D1%83%D0%BB-%D0%A5%D0%B0%D0%BC%D0%B8%D0%B4_I","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/Tughra_of_Abd%C3%BClhamid_I.JPG","page_title":"Абдул-Хамид I","context_page_description":"Абдул-Хами́д I — 27-й султан Османской империи."},{"page_url":"https://no.wikipedia.org/wiki/Vaal_(elv)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/VaalSunrise.jpg","page_title":"Vaal (elv)","context_page_description":"Vaal er den største bielva til Oranje i Sør-Afrika. Elva har sin kilde i Drakensberg-fjellene i iMpumalanga øst for Johannesburg og rundt 30 km nord for Clarens i Freistata ved en kilde kjent som Ash. Den flyter så sørvestover til den møter Oranje sørvest for Kimberley i Noord-Kaap. Den er 1 120 km lang og utgjør grensen mellom iMpumalanga, Gauteng og Bokone Bophirima på sin nordlige bredde og Freistata på sin sørlige.\\nNavnet Vaal kommer fra nederlandsk og betyr «blek», noe som henspiller på den gråaktige fargen på vannet, særlig i flomperioden da den fører med seg mye slam. Historisk utgjorde elva grensen mellom to boer–republikker, og senere provinser, Transvaal og Oranjefristaten. Det geografiske navnet Transvaal kommer fra navnet på elva og betyr «bortenfor Vaal». Dette var i forhold til Kappkolonien og Natal som var de viktigste områdene for europeisk bosetning på den tiden og som lå sør for Vaal.\\nDet tas ut vann til industriens behov i Greater Johannesburg Metropolitan Area og en stor del av provinsen Freistata. Som del av Vaal–Hartz-prosjektet er den en betydelig kilde for vann til irrigasjon. Vann trukket ut fra Vaal støtter 12 millioner konsumenter i Gauteng."},{"page_url":"https://ca.wikipedia.org/wiki/Hostal_de_la_Gavina","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Hostal_de_la_Gavina_des_de_la_pla%C3%A7a_del_Roserar_en_S%27Agar%C3%B3.JPG","page_title":"Hostal de la Gavina","context_page_description":"L’Hostal de la Gavina és un hotel de luxe de cinc estrelles situat a la plaça del Roserar de S’Agaró. És un dels hotels amb major prestigi de la Costa Brava. No obstant això, en un principi no va ser concebut com a tal, sinó que va ser un dels primers xalets de la Urbanització de S’Agaró. Aquest edifici acollia dos habitatges encara que des de l’exterior semblava un únic xalet. Tant la residència com la urbanització van ser dissenyades per l’arquitecte Rafael Masó i Valentí i promogudes per la família Ensesa, uns empresaris gironins. Tot i que en un principi va estar pensat com xalet, ràpidament es va adaptar i convertir en hotel. Aquesta primera reforma la va realitzar el mateix Masó.\\nA poc a poc l’hostal va anar creixent i es va anar dotant de més estances i equipaments. En l'època de Rafael Masó va patir dues ampliacions i es van construir unes pistes de tennis obra del mateix arquitecte.\\nL’edifici actual és obra de Francesc Folguera, arquitecte que va substituir al difunt Masó en la direcció de les obres de la urbanització de S’Agaró. Folguera va remodelar totalment l’hotel de manera que de la part construïda per Masó només es conserva un passadís."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%DB%8C%D9%88%D8%A7%D8%B1_%D8%A8%D8%B2%D8%B1%DA%AF_%DA%AF%D8%B1%DA%AF%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/%D8%B9%D9%84%D8%A7%DB%8C%D9%85_%D8%A8%D8%AA%D9%88%D9%86%DB%8C_%D8%AF%DB%8C%D9%88%D8%A7%D8%B1_%D8%AA%D8%A7%D8%B1%DB%8C%D8%AE%DB%8C_%DA%AF%D8%B1%DA%AF%D8%A7%D9%86_%DA%A9%D9%87_%D8%B2%DB%8C%D8%B1_%D8%AE%D8%A7%DA%A9_%D9%85%D8%AF%D9%81%D9%88%D9%86_%D8%B4%D8%AF%D9%87_%D8%A7%D8%B3%D8%AA.jpg","page_title":"دیوار بزرگ گرگان","context_page_description":"دیوار بزرگ گرگان یا دیوار بزرگ اسکندر یا دیوار سرخ که در متون قدیمی با نام مار سرخ نیز نامیده شده‌است دیواری تاریخی است که از کنار دریای خزر در ناحیه گمیشان آغاز شده و تا کوه‌های گلیداغ در شمال شرق کلاله ادامه می‌یافته‌است. هم‌اکنون تقریباً تمام این دیوار از میان رفته‌است و تنها بخش‌های کوچکی از آن که در زیر خاک مدفون مانده، باقی است. دیوار تاریخی گرگان پس از دیوار چین، بزرگترین دیوار دفاعی جهان است. این دیوار عظیم تاریخی که ۲۰۰ کیلومتر طول دارد در ۲۹ تیرماه سال ۱۳۷۸ به ثبت ملی رسیده‌است.\\nعکس این دیوار نخستین بار توسط اریک اشمیت باستان‌شناس آمریکایی ثبت شد. آقای اشمیت باستان‌شناس آمریکایی که با هواپیمای خود در سالهای ۱۳۱۵و ۱۳۱۶ از نقاط باستانی ایران عکاسی می‌کرد، در منطقه گرگان دیوار قرمز رنگی را دید که از سمت دریای خزر به طرف کوه‌های گلیداغ امتداد دارد. او از این دیوار عکس گرفت و این عکس‌ها سندی برای تحقیقات باستان شناسان ایرانی و خارجی بر این دیوار شد."},{"page_url":"https://sv.wikipedia.org/wiki/Riva_Ligure","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Riva_Ligure.jpg","page_title":"Riva Ligure","context_page_description":"Riva Ligure är en ort och kommun i provinsen Imperia i regionen Ligurien i Italien. Kommunen hade 2 824 invånare."},{"page_url":"https://bg.wikipedia.org/wiki/Erebia_gorge","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Erebia_gorge.jpg","page_title":"Erebia gorge","context_page_description":"Erebia gorge е вид пеперуда от семейство Многоцветници. Видът не е застрашен от изчезване."},{"page_url":"https://simple.wikipedia.org/wiki/New_Fairfield","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Fairfield_County_Connecticut_incorporated_and_unincorporated_areas_New_Fairfield_highlighted.svg","page_title":"New Fairfield","context_page_description":"New Fairfield is a town in Fairfield County, Connecticut, United States. The population was 13,881 at the 2010 census. New Fairfield is one of five towns that surround Candlewood Lake, the largest lake in Connecticut."},{"page_url":"https://et.wikipedia.org/wiki/Alpha_Centauri","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Alpha%2C_Beta_and_Proxima_Centauri_%281%29.jpg","page_title":"Alpha Centauri","context_page_description":"Alpha Centauri on Maale lähim tähesüsteem, asudes Maast 4,37 valgusaasta kaugusel.\\nSee on kolmiktähesüsteem ning koosneb kolmest tähest: α Centauri A, α Centauri B ja α Centauri C.\\nAlpha Centauri A ja B on Päikese-sarnased G- ja K-klassi tähed, mis koos moodustavad kaksiktähesüsteemi Alpha Centauri AB. Palja silmaga vaadeldes näib see ühe tähena, mille näiv tähesuurus on -0,27. Alpha Centauri AB on lõunataevas asuva Kentauri tähtkuju heledaim täht ning on Siiriuse ja Canopuse järel tähistaeva heleduselt kolmas täht.\\nAlpha Centauri A mass on 1,1 Päikese massi ning on Päikesest 1,519 korda heledam. Alpha Centauri B väiksem ja jahedam ning selle mass on 0,907 Päikese massi ja on 0,445 korda heledam. Tähed tiirlevad ümber üksteise tiirlemisperioodiga 79,9 aastat ning nende vaheline kaugus varieerub 11,2 aü-st kuni 35,6 aü-ni.\\nAlpha Centauri C või Proxima Centauri on väike ja tuhm punane kääbus, mis pole palja silmaga vaadeldav. See on Maale lähim täht, asudes 4,24 valgusaasta kaugusel ehk veidi lähemal kui Alpha Centauri AB. Alpha Centauri AB ja Proxima Centauri asuvad üksteisest 13 000 valgusaasta kaugusel. Proxima Centauri ja Alpha Centauri AB süsteemi seotus tõestati 2016. aastal."},{"page_url":"https://en.wikipedia.org/wiki/Stalybridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Bucktonvale.jpg","page_title":"Stalybridge","context_page_description":"Stalybridge is a town in Tameside, Greater Manchester, England, with a population of 23,731 at the 2011 Census.Historically part of Cheshire, it is 8 miles east of Manchester city centre and 6 miles north-west of Glossop.\\nWhen a water-powered cotton mill was constructed in 1776, Stalybridge became one of the first centres of textile manufacture during the Industrial Revolution. The wealth created in the 19th century from the factory-based cotton industry transformed an area of scattered farms and homesteads into a self-confident town."},{"page_url":"https://fi.wikipedia.org/wiki/Amerikanratsuhevonen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/American_Saddlebred14.jpg","page_title":"Amerikanratsuhevonen","context_page_description":"Amerikanratsuhevonen on Yhdysvaltojen eteläosista kotoisin oleva lämminverinen ratsuhevosrotu, joka tunnetaan erityisesti kahdesta näyttävästä erikoisaskellajistaan. Tätä 1800-luvulta peräisin olevaa siroa hevosrotua käytetään erityisesti rodun omissa askellajikilpailuissa mutta myös este- ja kouluratsastuksessa sekä harrasteratsuna. Rotu on yleinen Yhdysvalloissa, mutta amerikanratsuhevosia on myös Australiassa, Etelä-Afrikassa ja Euroopassa."},{"page_url":"https://pt.wikipedia.org/wiki/M%C3%A1scara_ib%C3%A9rica","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Carnaval_de_Podence_2008_1.jpg","page_title":"Máscara ibérica","context_page_description":"A Máscara ibérica é a máscara típica de Portugal e Espanha e segundo Hélder Ferreira \\"muitas estão ligadas a cultos celtas, ao solstício de inverno... e mesmo as do Entrudo estão ligadas a cultos deste tipo como também pode ser o da fertilidade\\".\\nA \\"Máscara Ibérica\\" é o nome do projecto, do livro e da exposição que envolve a divulgação das máscaras regionais dos dois países.\\nAs máscaras Ibéricas preparam a sua candidatura como Património Imaterial da Humanidade.\\nOs mascarados têm diversos nomes consoante a região de onde são:\\nPortugal\\nCareto de Aveleda\\nCareto de Lazarim\\nMáscaro de Ousilhão\\nCareto de Podence\\nCardador de Vale de Ílhavo\\nCaretos da Lagoa - Mira\\nCarocho de Constantim\\nChocalheiro de Bemposta\\nChocalheiro de Bruçó\\nChocalheiro de Val de Porco\\nGualdrapa\\nVelho\\nDiabo\\nSécia\\nFarandulo de Tó, Mogadouro\\nMarafona\\nFilandorra\\nZangarrão\\nSão João de Sobrado- Bugios e Mourisqueiros\\nCachera\\nEspanha\\nBoteiros\\nPantallas\\nPeliqueiro\\nCigarróns\\nVergalleiros\\nFelos"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Mitglieder_des_Landtages_Nordrhein-Westfalen_(17._Wahlperiode)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Listenplatz_13_Verena_Sch%C3%A4ffer_%282%29.jpg","page_title":"Liste der Mitglieder des Landtages Nordrhein-Westfalen (17. Wahlperiode)","context_page_description":"Die Liste der Mitglieder des 17. Landtages Nordrhein-Westfalen umfasst die bei der Landtagswahl vom 14. Mai 2017 gewählten Abgeordneten. Ihre Amtszeit begann am 1. Juni 2017 mit der Konstituierenden Sitzung des Landtages."},{"page_url":"https://fr.wikipedia.org/wiki/Charlie_Hebdo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Tignous_20080318_Salon_du_livre_1.jpg","page_title":"Charlie Hebdo","context_page_description":"Charlie Hebdo est un journal hebdomadaire satirique français fondé en 1970 par François Cavanna et le professeur Choron. Il fait une large place aux illustrations, notamment aux caricatures politiques, et il pratique aussi le journalisme d'investigation en publiant des reportages à l'étranger ou sur les domaines les plus divers : les sectes, les religions, l'extrême droite, l'islamisme, la politique, la culture. Le journal paraît tous les mercredis. Il a publié également des hors-séries à périodicité variable.\\nCréé en 1970 pour remplacer la version hebdomadaire d'Hara-Kiri, édité par la même équipe et qui venait d'être interdite, il est publié régulièrement jusqu'en 1981. Défenseur acharné de la liberté de la presse, son positionnement politique est celui d'un journal de gauche critique, dans une société profondément marquée par Mai 68. Après un unique numéro en 1982, la parution cesse jusqu'en 1992, date à laquelle une partie des membres de l'ancienne équipe se retrouvent pour relancer Charlie Hebdo avec de nouveaux talents."},{"page_url":"https://en.wikipedia.org/wiki/Winston_Churchill","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/05/Yalta_Conference_%28Churchill%2C_Roosevelt%2C_Stalin%29_%28B%26W%29.jpg","page_title":"Winston Churchill","context_page_description":"Sir Winston Leonard Spencer Churchill KG OM CH TD DL FRS RA was a British statesman, army officer, and writer. He was Prime Minister of the United Kingdom from 1940 to 1945, when he led the country to victory in the Second World War, and again from 1951 to 1955. Apart from two years between 1922 and 1924, Churchill was a Member of Parliament from 1900 to 1964 and represented a total of five constituencies. Ideologically an economic liberal and imperialist, he was for most of his career a member of the Conservative Party, as leader from 1940 to 1955. He was a member of the Liberal Party from 1904 to 1924.\\nOf mixed English and American parentage, Churchill was born in Oxfordshire to a wealthy, aristocratic family. He joined the British Army in 1895 and saw action in British India, the Anglo-Sudan War, and the Second Boer War, gaining fame as a war correspondent and writing books about his campaigns. Elected a Conservative MP in 1900, he defected to the Liberals in 1904. In H. H. Asquith's Liberal government, Churchill served as President of the Board of Trade and Home Secretary, championing prison reform and workers' social security."},{"page_url":"https://en.wikipedia.org/wiki/Turoe_Stone","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Stone_of_Turoe.JPG","page_title":"Turoe Stone","context_page_description":"The Turoe stone is a granite stone decorated in a Celtic style located in the village of Bullaun, County Galway, Ireland, 6 km north of Loughrea off the R350 regional road. It probably dates to about the period 100 BC to 100 AD. The stone is now positioned in a covered protective structure on the lawn in front of Turoe House, set in a concrete base surrounded by a metal cattle grill.\\nThe Turoe stone is National Monument of Ireland Nr. 327"},{"page_url":"https://uz.wikipedia.org/wiki/Nasyonal","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Estadio_Gran_Parque_Central_de_Montevideo.JPG","page_title":"Nasyonal","context_page_description":"\\"Nasyonal\\" Futbol Klubi — Urugvayning yetakchi futbol jamoasi. 46 marta mamlakat chempioni, 3 marta Libertadores kubogi va Interkontinental kubogi chempioni."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B3%95%E5%9C%8B%E6%8E%88%E5%8B%B3%E5%8F%8A%E5%98%89%E7%8D%8E%E5%88%B6%E5%BA%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Medaille_de_chine_1900_rebellion_des_boxers.jpg","page_title":"法國授勳及嘉獎制度","context_page_description":"法國授勳與嘉獎制度列表呈列出現代法國勳章、榮譽與嘉獎的所有裝飾。有些勳章可同時頒發給軍人或平民，例如榮譽軍團勳章；其他勳章則分為純軍用或民間性質的嘉獎。1963年法國改革授勳制度之後，19個部長級勳章僅有4個保存下來，其他則被國家功績勳章所取代。"},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%B0%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/37/Hofmann_voltameter_fr.svg","page_title":"氧","context_page_description":"氧是一种化学元素，符号为O，原子序为8，在元素周期表中属于氧族。氧属于非金属，是具有高反应性的氧化剂，能够与大部分元素以及其他化合物形成氧化物。氧在宇宙中的总质量在所有元素中位列第三，仅居氢和氦之下。在标准温度和压力下，两个氧原子会自然键合，形成无色无味的氧气，即双原子氧。氧气是地球大气层的主要成分之一，在体积上占20.8%，仅次于氮气。地球地壳中近一半的质量都是由氧和氧化物所组成。\\n氧是细胞呼吸作用中重要的元素。在生物体中，主要有机分子，如蛋白质、核酸、碳水化合物和脂肪等，还有组成动物外壳、牙齿和骨骼的无机化合物，都含有氧原子。生物体绝大部分的质量都由含氧原子的水组成。光合作用利用阳光的能量把水和二氧化碳转化为氧气。氧气的化学反应性强，容易与其他元素结合，所以大气层中的氧气成分只能通过生物的光合作用持续补充。臭氧是氧元素的另一种同素异构体，能够较好地吸收中紫外线辐射。位于高海拔的臭氧层有助阻挡紫外线，从而保护生物圈。不过，在地表上的臭氧属于污染物，为雾霾的副产品之一。在低地球轨道高度的单原子氧足以对航天器造成腐蚀。\\n卡尔·威廉·舍勒于1773年或之前在乌普萨拉最早发现氧元素。约瑟夫·普利斯特里亦于1774年在威尔特郡独立发现氧，因为其成果的发表日期较舍勒早，所以一般被誉为氧的发现者。1777年，安东万-罗伦·德·拉瓦锡进行了一系列有关氧的实验，推翻了当时用于解释燃烧和腐蚀的燃素说。他也提出了氧的现用IUPAC名称“oxygen”，源自希腊语中的“ὀξύς”和“-γενής”。这是因为命名之时，人们曾以为所有酸都必须含有氧。东亚的日本最先开始接触化学，因此将其直译为酸素，成为第一个汉字名称，中国则是在清末由徐寿等人的翻译书籍传入许多化学词汇，其中原法文元素名“oxygène”被译为“养”，后译为“氱”，最终演变为今天的中文名“氧”。\\n氧的应用包括暖气、内燃机、钢铁、塑料和布料的生产、金属气焊和气割、火箭推进剂、氧疗及航空器、潜艇、载人航天器和潜水所用的生命保障系统。"},{"page_url":"https://bs.wikipedia.org/wiki/Cvjetnice_Bosne_i_Hercegovine","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Ranunculus_lanuginosus2_W.jpg","page_title":"Cvjetnice Bosne i Hercegovine","context_page_description":"Ovaj spisak cvjetnica Bosne i Hercegovine, skupa sa unesenim vrstama i bosanskohercegovačkim endemima, nepotpuni je pregled angiospermnih biljnih vrsta koje se navode u raspoloživoj literaturi na bosanskom hrvatskom, srpskom i srpskohrvatskom jeziku. Nisu uključene kulturne i povremeno unošene.\\nNapomena\\nZbog višekratnih promjena u biološkoj klasifikaciji i/ili taksonomskih rangova i naziva obuhvaćenih taksona, neki od njih se u priloženom spisku pojavljuju i po dva puta. To se posebno odnosi na one nazive binomne nomenklature koji su i danas u širokoj upotrebi.\\nNajčešće je promijenjeno ime roda i porodice, a ponekad i pripadajućih vrsta."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%92%D7%A9_%D7%97%D7%96%D7%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/BajagaDagesh.JPG","page_title":"דגש חזק","context_page_description":"דגש חזק, המכונה גם \\"מִכְפָּל\\" או \\"כַּפְלָן\\", הוא סימן ניקוד בעברית, המורה להכפיל את האות בה הוא נמצא."},{"page_url":"https://en.wikipedia.org/wiki/Hindu_temples_in_Pune","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Bhimashankar.jpg","page_title":"Hindu temples in Pune","context_page_description":"The city of Pune and the surrounding district have been at the centre of the history of Maharashtra for more than eight hundred years, and a number of places revered by Marathi Hindu people are located in the district. These revered places include five of the eight Ashtavinayak Ganesh temples. The Samadhi or the resting places of the two most revered Marathi Bhakti saints, namely Dnyaneshwar and Tukaram are located at Alandi and Dehu respectively. The main temple of Khandoba, the family deity for most Marathi Hindus, is also located in the district at Jejuri. The oldest temple in the city is the Pataleshwar rock-cut temple complex which was built during the 8th century."},{"page_url":"https://it.wikipedia.org/wiki/Medjez_el-Bab","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Tombs_Medjez_el-Bab_war_cemetery.jpg","page_title":"Medjez el-Bab","context_page_description":"Medjez el-Bab è una città del nord-est della Tunisia con una popolazione di 21 653 secondo il censimento del 2004 del governatorato di Béja, a circa 60 Chilometri a ovest di Tunisi de Tunis lungo il corso del fiume la Medjerda."},{"page_url":"https://no.wikipedia.org/wiki/Hamburgs_flagg","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Flag_of_Hamburg.svg","page_title":"Hamburgs flagg","context_page_description":"Hamburgs flagg er rødt med en hvit borg. Hamburg har i tillegg et statsflagg med delstatens store våpen på hvitt felt i den røde duken, og et admiralitetsflagg med et blått anker plassert bak borgen.\\nUtformingen av delsatsflagget ble fastlagt i 1834. Utformingen tilsvarer den til Hamburgs våpen og går tilbake til 1100-tallet. Det midtre tårnet med kors blir tolket som uttrykk for middelalderborgen som var Hamburgs opphavssted. Stjernene over de to sidetårnene er Mariastjerner, oppkalt etter byens skytspatron. Døren i midten har i løpet av århundrene vært både åpen og lukket, og med og uten fallgitter.\\nAdmiralitetsflagget brukes av delstaten Hamburgs bygninger som utelukkende har med sjøfart å gjøre.\\nFørsteborgermesteren har et eget flagg. Det er basert på Tysklands trikolor, men med et rødt midtfelt der det store våpenet er plassert mot hvit bakgrunn. Borgermesterens flagg benyttes i forbindelse med offisielle statsbesøk.\\nDelstatsflagget kan brukes av alle, mens de øvrige flaggene kun kan brukes av Hamburgs embetsmenn, offentlige institusjoner eller Hamburg borgerskap."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%88%D8%B1%D8%AA%D8%B2%D9%88%D8%A6%D9%88%D9%84%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Verzuolo-IMG_1192.JPG","page_title":"ورتزوئولو","context_page_description":"ورتزوئولو ایتالیا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. سوْن نۆفوس ساییمی اساسيندا ۶۳۷۹ نفر ایمیش. دنیز سوُلاری سَویه‌سیندن ۴۲۰ متر یۇکسک‏لیکده یئر آلیب. و پیمونت اوستانیندا یئرلشیب."},{"page_url":"https://eo.wikipedia.org/wiki/Johann_Balthasar_Neumann","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Vierzehnheiligen-Basilika3-Asio.JPG","page_title":"Johann Balthasar Neumann","context_page_description":"Johann Balthasar NEUMANN [JOhan BALtaza NOJman], kutime sen la unua persona nomo nomata Balthasar Neumann, estis germana artitekto de la 17-a jarcento, kiu signife influis la konstruostilon de la epokoj baroko kaj rokoko. Li naskiĝis la 27-an de januaro 1687 en la urbo Cheb, kiu liaepoke germane nomiĝis Eger, en Bohemio, dum 1711 venis al la princepiskopa urbo Würzburg en Frankonio, kie li unue iĝis inĝeniero kaj poste fama arkitekto. Li konstruis ĉiujn tiuepokajn barokajn konstruaĵojn de la nobela princoepiskopo de Würzburg kaj ankaŭ mortis en la urbo, sed plue ankaŭ respondecis pri multaj aliaj pompaj barokaj konstruaĵoj, kaj religiaj kaj nobelaj, en suda kaj okcidenta Germanio. La 19-an de aŭgusto 1753 li mortis en Würzburg.\\nBalthasar Neumann rifuzis transpreni aŭstriajn, bohemiajn, italiajn kaj franciajn tiuepokajn arkitektajn elementojn, kaj lia stilo de baroka arkitekturo estis rafinita kaj unika: pluraj el la plej impresaj konstruaĵoj de la periodo estas lia verko, inter alie la princoepiskopa rezidejo de Würzburg kaj la preĝejo \\"Dekkvar Sanktuloj\\"."},{"page_url":"https://hu.wikipedia.org/wiki/Julius_Middelthun","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7c/Middelthun_Welhaven_1867.JPG","page_title":"Julius Middelthun","context_page_description":"Julius Middelthun norvég szobrász."},{"page_url":"https://nl.wikipedia.org/wiki/Boulogne_(Vend%C3%A9e)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Map_commune_FR_insee_code_85030.png","page_title":"Boulogne (Vendée)","context_page_description":"Boulogne is een gemeente in het Franse departement Vendée en telt 547 inwoners. De plaats maakt deel uit van het arrondissement La Roche-sur-Yon."},{"page_url":"https://no.wikipedia.org/wiki/Eidsfossen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Laksetrapp_Eidsfossen.jpg","page_title":"Eidsfossen","context_page_description":"Eidsfossen er en foss i Gloppeelva mot øst på gården Eide i Gloppen kommune. Fossen er en kaskadefoss med et fall på 32 meter. På grunn av den store vassføringa i elva er fossen et markant landemerke i kommunen, og er merket som severdighet av NAF og Statens vegvesen. Vassføringa er på sitt største mellom april og juli.\\nFossen ble utbygget med elvekraftverk av Gloppen Energiverk i 1917, og siden 2000 driftet av Sogn og Fjordane energi. I 2008 ble kraftverket, Eidsfossen kraftverk, siste gang oppgradert."},{"page_url":"https://es.wikipedia.org/wiki/Barriga_Verde","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/Jose_Silvent%2C_m%C3%A1is_co%C3%B1ecido_como_Barriga_Verde%2C_titiriteiro_galego.jpg","page_title":"Barriga Verde","context_page_description":"José Silvent Martínez, más conocido como Barriga Verde, fue un pionero del espectáculo de marionetas en la Galicia de mediados del siglo XX."},{"page_url":"https://de.wikipedia.org/wiki/Quintana_Roo_(Bundesstaat)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Municipios_de_Quintana_Roo.svg","page_title":"Quintana Roo (Bundesstaat)","context_page_description":"Quintana Roo, offiziell Freier und Souveräner Staat Quintana Roo ist ein Bundesstaat Mexikos mit 1.325.578 Einwohnern.\\nQuintana Roo hat eine Fläche von 50.212 km² und wurde, gemeinsam mit Baja California Sur, als vorerst letzter Bundesstaat Mexikos am 8. Oktober 1974 aus dem gleichnamigen Territorium Quintana Roo gegründet. Benannt wurde der Staat nach Andrés Quintana Roo, einem Freiheitsdichter.\\nHauptstadt ist das ganz im Süden des Landes an der Grenze zu Belize liegende Chetumal. Die größte und bekannteste Stadt hingegen ist Cancún im äußersten Nordosten."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_pessoas_que_viajaram_no_espa%C3%A7o","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Tamara_E._Jernigan.jpg","page_title":"Lista de pessoas que viajaram no espaço","context_page_description":"Esta lista de de pessoas que viajaram no espaço é uma lista dos astronautas/cosmonautas/taikonautas que viajaram no espaço como pilotos, engenheiros, cientistas ou outros e que estão classificados como tal na Wikidata.\\nA lista está ordenada pela data de nascimento de cada astronauta porque não foi possível por enquanto ordená-la pela data da primeira missão de cada um dos astronautas no espaço. A ter sido deste modo, o primeiro da lista seria Iuri Gagarin que em geral é considerado o primeiro ser humano a voar no espaço e a orbitar a Terra, viagem que efectuou a bordo da Vostok I, em 1961. De salientar também Valentina Tereshkova como a primeira mulher a navegar no espaço o que fez a bordo da Vostok VI, em 1963. E ainda Neil Armstrong como o primeiro homem a pisar a face da lua ao alunar a bordo do módulo lunar da Apollo 11, em 1969.\\nNão existe unanimidade de classificação da altitude acima da qual um viajante pode ser considerado astronauta."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%27%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%86%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D1%96_%D0%A4%D0%B5%D0%B4%D0%BE%D1%80%D0%BE%D0%B2%D1%83_(%D0%9B%D1%8C%D0%B2%D1%96%D0%B2)","image_url":"https://upload.wikimedia.org/wikipedia/uk/2/2b/Monument_to_Ivan_Fedorov_in_Lviv.jpg","page_title":"Пам'ятник Іванові Федорову (Львів)","context_page_description":"Пам'ятник Іва́нові Фе́дорову у Львові — пам'ятник першодрукареві на території України Іванові Федорову у Львові, що знаходиться на вулиці Підвальній, 13. Встановлений 26 листопада 1977 року на честь т.зв. «400-ліття книгодрукування на українських землях». Площа навколо пам'ятника — найбільший букіністичний ринок Львова."},{"page_url":"https://en.wikipedia.org/wiki/Balut_Island","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Sarangani_islas.jpg","page_title":"Balut Island","context_page_description":"Balut Island, also known as Malulong, is a potentially active volcanic island south of the tip of Davao Occidental province in the Mindanao region, Southern Philippines. Located in the center of the island is the Balut Volcano, a fumarolic volcano with no historical eruptions.\\nThe island of Balut is located about 13 km from mainland Mindanao, separated by the Sarangani Strait. Balut, Sarangani and Olanivan Islands make up the island group known as the Sarangani Islands. The group comprises the Municipality of Sarangani of Davao Occidental. Mabila on Balut Island is the town's center for commerce and the local government.\\nBalut is subdivided into 8 barangays:\\nBatuganding\\nGomtago\\nKonel\\nLipol\\nMabila\\nTagen\\nTinina\\nTucal"},{"page_url":"https://pl.wikipedia.org/wiki/Kalendarium_UMK_w_Toruniu","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Wydzial_prawa_umk.jpeg","page_title":"Kalendarium UMK w Toruniu","context_page_description":"Kalendarium UMK w Toruniu – chronologiczne zestawienie najważniejszych faktów z dziejów Uniwersytetu Mikołaja Kopernika w Toruniu."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%9A%E0%A7%87%E0%A6%95%E0%A7%8B%E0%A6%B8%E0%A7%8D%E0%A6%B2%E0%A7%8B%E0%A6%AD%E0%A6%BE%E0%A6%95%E0%A6%BF%E0%A6%AF%E0%A6%BC%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Czechoslovakia.png","page_title":"চেকোস্লোভাকিয়া","context_page_description":"চেকোশ্লোভাকিয়া ১৯১৮ সালের অক্টোবর থেকে ১৯৯২ সাল পর্যন্ত সার্বভৌম রাষ্ট্র হিসেবে অস্তিত্বশীল ছিল। ১৯৯৩ সালে এই রাষ্ট্র বিভক্ত হয়ে চেক প্রজাতন্ত্র ও স্লোভাকিয়া নামক দুটি রাষ্ট্র গঠিত হয়।"},{"page_url":"https://qu.wikipedia.org/wiki/P%27utuqsi_kantun","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Lagunas_Kari_Kari_%28Potos%C3%AD_-_Bolivia%29.jpg","page_title":"P'utuqsi kantun","context_page_description":"P'utuqsi kantun nisqaqa Buliwya suyupi huk kantunmi, P'utuqsi suyupi, Tomás Frías pruwinsyapi, P'utuqsi munisipyupi. Uma llaqtanqa P'utuqsi llaqtam.."},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%D7%90%D7%A8%D7%99_%D7%9C%D7%90%D7%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/General_Gary_Edward_Luck.JPEG","page_title":"גארי לאק","context_page_description":"גארי אדוארד לאק היה גנרל אמריקאי אשר שימש כמפקד פיקוד המבצעים המיוחדים המשולבים והקורפוס המוטס ה-18."},{"page_url":"https://it.wikipedia.org/wiki/Grafengehaig","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Grafengehaig_Kirche_3.JPG","page_title":"Grafengehaig","context_page_description":"Grafengehaig è un comune tedesco di 1.017 abitanti, situato nel land della Baviera."},{"page_url":"https://es.wikipedia.org/wiki/Rutenoceno","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Ruthenocene_original_synthesis.png","page_title":"Rutenoceno","context_page_description":"El rutenoceno es un compuesto organometálico de rutenio de fórmula (C₅H₅)₂Ru. Este sólido volátil, amarillo pálido, se clasifica dentro de los denominados compuestos sándwich y, más específicamente, como un metaloceno."},{"page_url":"https://vi.wikipedia.org/wiki/Henryk_Ross","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Gideon_Hausner_questions_witness_Henryk_Ross_during_Eichmann-Trial_USHMM_No_65274.jpg","page_title":"Henryk Ross","context_page_description":"Henryk Ross là một nhiếp ảnh gia người Ba Lan gốc Do Thái, ông đã làm việc cho Cục Thống kê của Hội đồng Do Thái trong Łódź Ghetto thời kỳ Holocaust ở Ba Lan bị chiếm đóng. Táo bạo, khi làm công việc nhiếp ảnh gia chụp hình nhân viên, Ross cũng ghi lại những hành động tàn bạo của Đức Quốc xã trong khi ông vẫn chính thức được chính quyền lao động Đức ân sủng.\\nMột phần nhiệm vụ chính thức của ông là chụp ảnh lấy danh tính. Ông đã xây dựng một sân khấu ba cấp trong studio của mình, cho phép ông chụp ảnh tối đa 12 người với một âm bản duy nhất. Mặc dù các nhà chức trách chỉ cung cấp cho ông đủ phim cho công việc được giao, thủ thuật này cho phép ông có thêm phim mà ông có thể sử dụng để chụp ảnh trái phép.\\nNhững tấm hình không chính thức của ông bao gồm các hình chụp cuộc sống hàng ngày, các lễ kỷ niệm cộng đồng, cảnh trẻ em đang đào bới thức ăn thừa và các nhóm lớn người Do Thái bị dẫn đi trục xuất và bị chất lên ô tô. Khi khu người Do Thái bị dẹp vào mùa thu năm 1944, Ross đã chôn các tấm ảnh và phim âm bản của mình trong một chiếc hộp, hy vọng chúng có thể tồn tại như một sự ghi nhận lịch sử. Ông đã đào được chiếc hộp vào tháng 1 năm 1945, sau khi Hồng quân giải phóng Ba Lan."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9C%B0%E4%B8%8B%E8%A1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Nishibori_ROSA_002.JPG","page_title":"地下街","context_page_description":"地下街とは、地下に設置された不特定多数の通行のための歩道に面した商店街である。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_fauna_of_Utah","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Bubulcus_ibis_-Dallas%2C_Texas%2C_USA_-flying-8.jpg","page_title":"List of fauna of Utah","context_page_description":"This is a list of fauna observed in the U.S. state of Utah."},{"page_url":"https://cy.wikipedia.org/wiki/Maes_Awyr_Rhyngwladol_Bangor","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Bangor-International-Aerial.jpg","page_title":"Maes Awyr Rhyngwladol Bangor","context_page_description":"Maes awyr sifil a leolir 3 milltir i'r gorllewin o ddinas Bangor, Swydd Penobscot, Maine, yn yr Unol Daleithiau, yw Maes Awyr Rhyngwladol Bangor. Mae'n perthyn i Ddinas Bangor ac yn cael ei redeg ganddi; yn y gorffennol roedd yn gwasanaethu fel Gwersyll Awyrlu Dow. Mae gan y maes awyr un rhedfa 11,439 troedfedd o hyd a 200 tr o led."},{"page_url":"https://de.wikipedia.org/wiki/Schulattentat_in_New_Mexico_2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/William_Atchison_timeline_note_via_San_Juan_County_Sheriffs_Office.jpg","page_title":"Schulattentat in New Mexico 2017","context_page_description":"Bei einem Schulattentat in New Mexico 2017 wurden am 7. Dezember 2017 zwei Schüler hispanoamerikanischer Herkunft von dem 21-jährigen Rechtsextremen William Atchison an seiner ehemaligen Schule, der Highschool in Aztec, erschossen. Nachdem er im Flur und in einem Klassenzimmer, wo sich Schüler in einem kleinen Bürobereich verschanzt hatten, mehrere Magazine leer geschossen hatte und die Polizei in das abgesperrte Schulgebäude eindrang, nahm er sich das Leben.\\nDer Fall wurde in Deutschland insbesondere durch die engen Kontakte des Attentäters mit dem Täter des Anschlags in München 2016 sowie einem eines geplanten Amoklaufs beschuldigten Schülers aus dem Landkreis Ludwigsburg rezipiert."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_M%C3%B6nchengladbach_-_Stadtbezirk_S%C3%BCd","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Stolpersteine_MG_Cahn_Rebeka.jpg","page_title":"Liste der Stolpersteine in Mönchengladbach - Stadtbezirk Süd","context_page_description":"Die Liste der Stolpersteine in Mönchengladbach – Stadtbezirk Süd enthält alle Stolpersteine, die im Rahmen des gleichnamigen Projekts von Gunter Demnig in Mönchengladbach im Stadtbezirk Süd verlegt wurden. Mit ihnen soll an Opfer des Nationalsozialismus erinnert werden, die hier lebten und wirkten.\\nWeitere verlegte Stolpersteine in anderen Stadtbezirken von Mönchengladbach sind hier zu finden:\\nStadtbezirk Nord\\nStadtbezirk Ost\\nStadtbezirk West"},{"page_url":"https://it.wikipedia.org/wiki/Igny-Comblizy","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Igny_statue_d%27_henri_le_large_06680.JPG","page_title":"Igny-Comblizy","context_page_description":"Igny-Comblizy è un comune francese di 456 abitanti situato nel dipartimento della Marna nella regione del Grand Est."},{"page_url":"https://ca.wikipedia.org/wiki/Llac_Chiem","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Karte_Chiemgau.png","page_title":"Llac Chiem","context_page_description":"El llac Chiem és un llac de Baviera, Alemanya, a prop de Rosenheim. Sovint es coneix com \\"el mar de Baviera\\". Els rius Großache i Prien desemboquen a la part sud del llac, i el riu Alz neix al nord del llac. El riu Alz desemboca al riu Inn, que més endavant s'uneix al Danubi. El llac es divideix entre una secció nord més gran, al nord-est, anomenada Weitsee, i la secció sud, anomenada Inselsee, al sud-oest.\\nLa regió de Chiemgau, al voltant del llac, és una famosa àrea de vacances."},{"page_url":"https://ca.wikipedia.org/wiki/Crosville-la-Vieille","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Crosville-la-Vieille.JPG","page_title":"Crosville-la-Vieille","context_page_description":"Crosville-la-Vieille és un municipi francès, situat al departament de l'Eure i a la regió de Normandia. L'any 2007 tenia 564 habitants."},{"page_url":"https://fr.wikipedia.org/wiki/Fungi","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Russula_aurora_JPG1.jpg","page_title":"Fungi","context_page_description":"Le règne des Fungi, aussi appelés Mycota ou Mycètes ou fonge, constitue un taxon regroupant des organismes eucaryotes appelés communément champignons. Ce règne constitue un large groupe diversifié, depuis des organismes microscopiques, invisibles à l'œil nu, unicellulaires ou pluricellulaires, jusqu'aux « champignons supérieurs » dotés le plus souvent d'un pied et d'un chapeau, que le promeneur récolte.\\nLeur succès évolutif est en grande partie dû à leur plasticité génétique associée à des caractéristiques biologiques extrêmement diversifiées, depuis leurs modes de vie jusqu'à leur développement qui implique divers processus : la sporulation, la germination des spores, la croissance de l'appareil végétatif, et la reproduction par voie asexuée ou sexuée en différenciant un appareil reproducteur, le sporophore.\\nL'existence simultanée d’une paroi cellulaire périphérique et de vacuoles turgescentes dans le cytoplasme, les rapproche des végétaux auxquels on les rattachait autrefois, alors que leur corps végétatif non différencié et leur paroi peptido-polyosidique les distingue des plantes."},{"page_url":"https://pt.wikipedia.org/wiki/Saint-Remy-en-l%27Eau","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Egise_de_Saint-R%C3%A9my-en-l%27Eau.JPG","page_title":"Saint-Remy-en-l'Eau","context_page_description":"Saint-Remy-en-l'Eau é uma comuna francesa na região administrativa de Altos da França, no departamento de Oise. Estende-se por uma área de 10,06 km². Em 2010 a comuna tinha 426 habitantes."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%A7%D8%B1%DB%8C_%DA%A9%D9%88%D8%B1%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Marie_Curie%3B_Holograph_Notebook._Wellcome_L0021265.jpg","page_title":"ماری کوری","context_page_description":"ماری کوری با نام کامل ماریا اسکودوسکا کوری یا ماریا سالومیا کوری که همچنین به نام مادام کوری نیز شناخته می‌شود، فیزیک‌دان و شیمی‌دان لهستانی-فرانسوی بود که از پیشگامان پژوهش در زمینه‌ رادیواکتیویته است.\\nاو اولین زنی بود که موفق به کسب جایزه نوبل شد و همچنین اولین فردی بود که توانست موفق به کسب جایزه نوبل در دو زمینه‌ مختلف علمی شود. ماری یکی از اعضای خانواده کوری بود که در مجموع موفق به کسب شش جایزه نوبل شدند. او همچنین اولین زنی بود که موفق به کسب کرسی استادی دانشگاه در دانشگاه پاریس شد و در سال ۱۹۹۵ تبدیل به اولین زنی شد که به پاس شایستگی‌ها و دستاوردهایش در پانتئون دفن شد.\\nماری کوری در ورشو، لهستان متولد شد، شهری که در آن زمان در پادشاهی لهستان قرار داشت که این پادشاهی خود بخشی از امپراتوری روسیه بود. او در دانشگاه فلایینگ که به‌طور پنهانی در ورشو دایر بود، به تحصیل پرداخت. در سال ۱۸۹۱ و در سن ۲۴ سالگی او به همراه خواهر بزرگ‌ترش، برونیسواوا برای تحصیل به پاریس رفت، جایی که او موفق به کسب مدرک آموزش عالی و انجام تحقیقات علمی خود شد. ماری به‌همراه همسرش، پیر کوری و فیزیک‌دانی به‌نام هانری بکرل، موفق به کسب جایزه نوبل مشترک در فیزیک در سال ۱۹۰۳ شدند. پس از آن و در سال ۱۹۱۱ او موفق شد که یک بار دیگر جایزه نوبل را این بار در زمینه شیمی و به‌تنهایی کسب کند."},{"page_url":"https://hu.wikipedia.org/wiki/S%C3%ADkk%C3%B6t%C5%91g%C3%A9p","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Korgstickning.jpg","page_title":"Síkkötőgép","context_page_description":"A síkkötőgép a vetülékrendszerű kötőgépek egyik legismertebb, legelterjedtebb, legsokoldalúbb fajtája, amely – konstrukciójától függően – rendkívül változatos kötésmódok, mintázatok és nagyon különféle felhasználásra szánt kötöttáruk és kötött kelmék készítésére alkalmas. Jellemzője az egyenes tűágy, amelyen síklapú kelme készül – innen ered a síkkötőgép elnevezés. Általában kanalas tűkkel működik, bár vannak olyan típusai is, amelyeken tolókás tűket használnak. A tűk egyenként mozgathatók és egy vagy két tűágyba foglalva működnek, eszerint különböztetnek meg egy ill. két tűágyas síkkötőgépeket. A két tűágy vagy Λ alakban, háztetőszerűen helyezkedik el, vagy egy síkban, egymással szemben. Az egy tűágyas gépeken „egyszínoldalas”, a két tűágyas gépeken „kétszínoldalas” kelme készíthető, de a két tűágyas gépek egy tűággyal is működtethetők, így alkalmasak egyszínoldalas kötés előállítására is.\\nA síkkötőgépek magas fokon automatizált, nagyipari változatai a kötőiparban nagyon elterjedtek, egyszerűbb változatait pedig előszeretettel használják magán célra, hobbikötőgép gyanánt, saját készítésű kötöttáruk előállítására."},{"page_url":"https://sl.wikipedia.org/wiki/%C5%BDelezna_krona_Langobardov","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Duomo_Monza.jpg","page_title":"Železna krona Langobardov","context_page_description":"Železna krona Langobardov je tako relikviarij kot ena najstarejših kraljevih insignij krščanskega sveta. Narejena je bila v zgodnjem srednjem veku, in je sestavljena iz zlatega obroča, za katerega so verjeli, da je opremljen okoli osrednjega dela z železom, ki naj bi bil po legendi žebelj iz Pravega Križa..\\nKrona je postala eden od simbolov Kraljevine Langobardov in kasneje srednjeveške Kraljevine Italije. Hranijo jo v stolnici v Monzi, v bližini Milana."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%84%D0%B0%D1%80%D0%B0%D0%BE%D0%BD%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Shery-5.JPG","page_title":"Список фараонов","context_page_description":"Список фараонов — список правителей Древнего Египта, традиционно называемых «фараонами». В начале перечня находятся правители, известные сегодняшней египтологии в додинастический период — конец IV тысячелетия до н. э. Заканчивается список с началом эллинистического периода — завоевание страны Александром Македонским в 332 году до н. э. Также имеется раздел посвящённый мифическим правителям-богам, изначально властвовавшим над страной согласно представлениям древнеегипетской религии.\\nПроблема написания имён. В списке имена фараонов даны по источникам, авторы которых передают их наиболее традиционные формы, появившееся в результате произвольного, так называемого, «школьного» прочтения. Связано это с тем, что оригинальное написание имени каждого фараона бывает многовариантно и часто транскрибируются лишь в теории, которая с течением времени развивается и обновляется. Фонетика египетского языка изучена плохо, что также может приводить к нескольким вариантам огласовки некоторых имён. В списке не указана разбивка имён фараонов согласно титулатуре — «Хорово Имя», «Небти Имя», «Золотое Имя», «Тронное Имя» и «Личное Имя».\\nПроблема хронологии."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%B8%D0%BC%D0%BE%D0%B2%D0%B8%D0%B9_%D0%BF%D0%B0%D0%BB%D0%B0%D1%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/%D0%A1%D0%BA%D1%83%D0%BB%D1%8C%D0%BF%D1%82%D1%83%D1%80%D1%8B_%D0%BD%D0%B0_%D0%BA%D1%80%D1%8B%D1%88%D0%B5_%D0%97%D0%B8%D0%BC%D0%BD%D0%B5%D0%B3%D0%BE_%D0%B4%D0%B2%D0%BE%D1%80%D1%86%D0%B0.jpg","page_title":"Зимовий палац","context_page_description":"Зимовий палац — палац міста Санкт-Петербург, розташований на Двірцевій площі, головна споруда всесвітньо відомого музею Ермітаж. Сучасна споруда побудована в середині 18 століття."},{"page_url":"https://sv.wikipedia.org/wiki/Anolis_poncensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Lagartijo_jardinero_del_sur_%28Anolis_poncensis%29%2C_en_Ponce%2C_Puerto_Rico_%28DSC00434A%29.jpg","page_title":"Anolis poncensis","context_page_description":"Anolis poncensis är en ödleart som beskrevs av Leonhard Hess Stejneger 1904. Anolis poncensis ingår i släktet anolisar, och familjen Polychrotidae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ms.wikipedia.org/wiki/Putera_Wales","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Charles%2C_Prince_of_Wales.jpg","page_title":"Putera Wales","context_page_description":"Putera Wales merupakan gelaran yang diberikan kepada pewaris takhta United Kingdom. Oleh itu, penyandang jawatan ini biasanya merupakan putera sulung Raja atau Ratu Britain. Wales merupakan satu daripada empat negara konstituen United Kingdom."},{"page_url":"https://nl.wikipedia.org/wiki/Larisa_Yurkiw","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Larisa_Yurkiw_Altenmarkt-Zauchensee_2009.jpg","page_title":"Larisa Yurkiw","context_page_description":"Larisa Yurkiw is een Canadees voormalig alpineskiester."},{"page_url":"https://es.wikipedia.org/wiki/Quesos_de_Espa%C3%B1a","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/Zamorano_Jon_Sullivan.jpg","page_title":"Quesos de España","context_page_description":"En España se elaboran numerosos quesos, algunos de ellos de renombre internacional. A lo largo de toda la geografía encontramos quesos de leche de vaca, cabra y oveja, que se aprovecha para elaborar diversos quesos. Algunas regiones son más conocidas por sus quesos que otras, siendo singularmente conocido el queso manchego. No obstante hay 26 quesos con denominación de origen protegida en España y muchísimos más que carecen de ella. Los hay de todos los tipos, de leche de oveja, de cabra, de vaca o de mezclas. Los hay frescos y curados, de pasta prensada o no, de leche cruda y pasteurizada, cremosos, azules, etcétera.​"},{"page_url":"https://en.wikipedia.org/wiki/Passport_stamp","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Narva_passport_stamp.jpg","page_title":"Passport stamp","context_page_description":"A passport stamp is an inked impression in a passport typically made by rubber stamp upon entering or exiting a territory.\\nPassport stamps may occasionally take the form of sticker stamps, such as entry stamps from Japan. Depending on nationality, a visitor may not receive a stamp at all, such as an EU or EFTA citizen travelling to an EU or EFTA country, Albania, or North Macedonia. Most countries issue exit stamps in addition to entry stamps. A few countries issue only entry stamps, including Canada, El Salvador, Ireland, New Zealand, Singapore, the United Kingdom and the United States.\\nAustralia, Hong Kong, Israel, Macau and South Korea do not stamp passports upon entry nor exit, but issue landing slips instead. Visas may also take the form of passport stamps."},{"page_url":"https://it.wikipedia.org/wiki/Conte_di_Merano","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Franz%2C_Count_of_Meran.jpg","page_title":"Conte di Merano","context_page_description":"Nella nobiltà austriaca, Conte di Merano è un titolo ereditario di un ramo morganatico della famiglia imperiale degli Asburgo."},{"page_url":"https://en.wikipedia.org/wiki/Neighbourhood","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Chelsea1217.JPG","page_title":"Neighbourhood","context_page_description":"A neighbourhood or neighborhood is a geographically localised community within a larger city, town, suburb or rural area. Neighbourhoods are often social communities with considerable face-to-face interaction among members. Researchers have not agreed on an exact definition, but the following may serve as a starting point: \\"Neighbourhood is generally defined spatially as a specific geographic area and functionally as a set of social networks. Neighbourhoods, then, are the spatial units in which face-to-face social interactions occur—the personal settings and situations where residents seek to realise common values, socialise youth, and maintain effective social control.\\""},{"page_url":"https://vi.wikipedia.org/wiki/Phan_B%E1%BB%99i_Ch%C3%A2u","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Nh%C3%A0_Phan_B%E1%BB%99i_Ch%C3%A2u.jpg","page_title":"Phan Bội Châu","context_page_description":"Phan Bội Châu là một danh sĩ và là nhà cách mạng Việt Nam, hoạt động trong thời kỳ Pháp thuộc."},{"page_url":"https://uz.wikipedia.org/wiki/NGC_3766","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/02/Star_cluster_NGC_3766.jpg","page_title":"NGC 3766","context_page_description":"NGC 3766 Kentavr yulduz turkumidagi I1p tipli ochiq klasterdir.\\nUshbu obyekt Yangi umumiy katalog asl nashrida mavjud."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%96%D0%B5%D1%80%D0%B1%D0%B5%D0%BA%D1%83%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Gerb%C3%A9court_la_chapelle.JPG","page_title":"Жербекур","context_page_description":"Жербекур — Франциянең Мозель департаментына караган коммуна."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_r%C3%A8gnes_europ%C3%A9ens_les_plus_longs","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/ClotaireIer_Jean_de_Tillet-Recueil_des_rois_de_France.jpg","page_title":"Liste des règnes européens les plus longs","context_page_description":"Cette page comprend la liste des règnes de souverains européens supérieurs à 50 ans.\\nLes souverains ayant changé le nom de leur territoire sont également comptés, s'ils ont atteint les cinquante années de règne.\\nSeuls les souverains d'États indépendants sont comptés et sont exclus les souverains légendaires, qui dépassent souvent cette limite d'âge.\\nLes souverains de Turquie et du Caucase ne sont pas comptés dans cette liste, mais dans la liste asiatique.\\nLe souverain régnant actuellement depuis le plus longtemps est la reine Élisabeth II du Royaume-Uni."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%8C%EB%9E%AD_%EB%8B%AC%EB%B8%8C%EB%A0%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Map_France_1477-en.svg","page_title":"알랭 달브레","context_page_description":"알랭 달브레는 프랑스의 강력한 귀족 중 한 명이다. 제16대 알브레 영주이자 타르타스의 자작, 제2대 그라브의 백작이자 카스트르의 백작이기도 하다. 그는 장 1세 달브레와 카트린 드 로앙의 아들이다. 샤를 2세 달브레의 손자이자 후계자이며, 1471년 알브레 가의 가주가 되었다.\\n그의 통치 시기의 절반 동안에 그는 아버지의 예시를 따르기 보다는 더 동요 된 정치 코스를 택했고, 이는 그를 유럽 무대에서 가장 뚜렷한 배우 중 한명으로 만들었다."},{"page_url":"https://simple.wikipedia.org/wiki/List_of_settlements_in_Hungary","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Kaposv%C3%A1r_c%C3%ADmere.png","page_title":"List of settlements in Hungary","context_page_description":"Hungary has 3152 localities as of July 1, 2009.\\nThe largest city is the capital, Budapest. The smallest town is Pálháza with 1038 inhabitants. The largest village is Solymár. There are more than 100 villages with fewer than 100 people while the smallest villages have fewer than 20 inhabitants."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B2%D0%B8%D1%80%D0%B8%D0%B4%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D0%B7%D1%91%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Charrancito_Sternula_albifrons_7.jpg","page_title":"Свиридовские озёра","context_page_description":"Свиридовские озёра — охраняемый ландшафт, особо охраняемая природная территория, созданная с целью сохранения уникального природного комплекса — системы озёр, имеющих важное средообразующее значение, являющихся местом обитания малочисленных, редких и исчезающих видов животных, занесенных в Красную книгу Волгоградской области. ООПТ расположена с северо-западной и юго-восточной сторон хутора Свиридовский."},{"page_url":"https://it.wikipedia.org/wiki/Bologna_Football_Club_1909","image_url":"https://upload.wikimedia.org/wikipedia/it/1/1e/Bologna_-_Viareggio_1967.jpg","page_title":"Bologna Football Club 1909","context_page_description":"Il Bologna Football Club 1909, comunemente noto come Bologna, o con la sigla BFC, è una società calcistica italiana per azioni con sede nell'omonima città emiliana. Nella stagione 2019-2020 milita in Serie A, il massimo livello della piramide calcistica italiana. I colori sociali sono il rosso e il blu e la maglia di gioco è a pali verticali alternati della medesima cromia. Dal 1927 la squadra disputa le proprie gare interne nello Stadio Renato Dall'Ara, nato come Stadio Littoriale e chiamato, dal dopoguerra fino al 1983, Stadio Comunale, il quale può ospitare 36 462 spettatori.\\nFondata il 3 ottobre 1909 da Emilio Arnstein, cadde in fallimento nel 1993 e si ricostituì a livello societario con l'attuale denominazione dopo aver acquisito nuovamente i diritti e il titolo sportivo del sodalizio precedente."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%AC%E0%B2%BF%E0%B2%8E%E0%B2%82%E0%B2%A1%E0%B2%AC%E0%B3%8D%E0%B2%B2%E0%B3%8D%E0%B2%AF%E0%B3%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/BMW_X3_2.jpg","page_title":"ಬಿಎಂಡಬ್ಲ್ಯೂ","context_page_description":"Bayerische Motoren Werke AG ೧೯೧೬ರಲ್ಲಿ ಸ್ಥಾಪನೆಗೊಂಡ ಜರ್ಮನಿಯ ಆಟೋಮೊಬೈಲ್‌, ಮೋಟಾರ್‌ ಸೈಕಲ್‌ ಮತ್ತು ಎಂಜಿನ್‌ ತಯಾರಿಸುವ ಸಂಸ್ಥೆ. BMW MINI ಬ್ರ್ಯಾಂಡ್‌ ಕಾರುಗಳನ್ನು ತಯಾರಿಸುತ್ತಿದ್ದು, ಇದು ರೋಲ್ಸ್‌-ರಾಯ್ಸ್‌ ಮೋಟರ್‌ ಕಾರ್ಸ್‌ನ ಮಾತೃ ಸಂಸ್ಥೆ.\\nBMW ತನ್ನ ಸಮರ್ಥ ಕಾರ್ಯ ನಿರ್ವಹಣೆಯಿಂದಲೂ, ವಿಲಾಸೀ ವೈಭವದಿಂದಲೂ ಜನಪ್ರಿಯವಾಗಿದೆ."},{"page_url":"https://ms.wikipedia.org/wiki/Ta%C5%9Fburun,_Karakoyunlu","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/TasburunIgdir.jpg","page_title":"Taşburun, Karakoyunlu","context_page_description":"Taşburun merupakan sebuah kawasan yang terletak dalam daerah Karakoyunlu di Wilayah Iğdır, Turki. Kampung ini mempunyai 1028 penduduk, dan ketinggian purata 835 m dari aras laut."},{"page_url":"https://en.wikipedia.org/wiki/Wetlands_of_Louisiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/The_wetland_lose_of_southern_louisiana_due_to_human_activities.jpg","page_title":"Wetlands of Louisiana","context_page_description":"The wetlands of Louisiana are water-saturated coastal and swamp regions of southern Louisiana.\\nThe Environmental Protection Agency defines wetlands as \\"those areas that are inundated or saturated by surface or groundwater at a frequency and duration water to support, and that under normal circumstances do support, a prevalence of vegetation typically adapted for life in saturated soil conditions.\\" Different wetland types arise due to a few key factors, primarily: water levels, fertility, natural disturbance and salinity. Around Lake Pontchartrain, for example, these few factors produce wetlands including bottomland hardwoods, cypress swamp, freshwater marsh and brackish marsh. High levels of flooding reduce the abundance of trees, leaving four principal marsh types: saline, brackish, intermediate and fresh.\\nAlthough these areas make up a very small percentage of the total land found in the United States, southern Louisiana contains 40 to 45 percent of the wetlands found in the lower states. This is because Louisiana is the drainage gateway to the Gulf of Mexico for the Lower Mississippi Regional Watershed."},{"page_url":"https://sh.wikipedia.org/wiki/Bija%C4%87i","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Bija%C4%87i%2C_Ka%C5%A1tel_Novi_036.jpg","page_title":"Bijaći","context_page_description":"Bijaći su bili staro hrvatsko naselje smješteno zapadnom dijelu Kaštelanskog polja."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B5%D8%AD%D8%B1%D8%A7%D8%A1_%D8%A7%D9%84%D8%B1%D9%85%D9%84_%D8%A7%D9%84%D8%B5%D8%BA%D8%B1%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/IBRA_6.1_Little_Sandy_Desert.png","page_title":"صحراء الرمل الصغرى","context_page_description":"صحراء الرمل الصغرى هي الصحراء الواقعة غرب أستراليا جنوب صحراء ساندي الكبرى، وإلى الغرب من صحراء جيبسون، وهي مشابهه للصحراء الرملية الكبرى، إلا أنها أصغر حجما منها بكثير، أما التضاريس والحيوانات والنباتات المتواجده في صحراء الرمل الصغرى فهي تشبه صحراء ساندي الكبرى."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AA%D8%A7%D8%A8%D8%B1%D8%AA%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Tavertet_-_Puig_de_la_for%C3%A7a_des_de_la_via%2C_sota_Santa_Cilia.jpg","page_title":"تابرتت","context_page_description":"تابرتت ایسپانیادا بیر یاشاییش منطقه‌سی‌دیر و بارسلونادا یئرلشیب. بۇ شهرین مساحتی ۳۲٫۵ کیلومتر موربّع دیر. ۸۶۹ متر دنیز سویه‌سیندن اۇجالیقی وار. سوْن نۆفوس تخمین‌لرینه گؤره ۱۲۵ نفر دیر."},{"page_url":"https://ca.wikipedia.org/wiki/La_Bazouge-de-Chemer%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/La_Bazouge-de-Chemer%C3%A9_%2853%29_%C3%89glise_01.JPG","page_title":"La Bazouge-de-Chemeré","context_page_description":"La Bazouge-de-Chemeré és un municipi francès, situat al departament de Mayenne i a la regió de País del Loira. L'any 2007 tenia 515 habitants."},{"page_url":"https://en.wikipedia.org/wiki/List_of_United_States_bomber_aircraft","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ed/A-12_Avenger_in_flight_NAN11-90.jpg","page_title":"List of United States bomber aircraft","context_page_description":"This is a list of United States bomber aircraft"},{"page_url":"https://en.wikipedia.org/wiki/Givrycourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Givrycourt_l%27%C3%A9glise_de_l%27Assomption-de-la-Bienheureuse-Vierge-Marie.JPG","page_title":"Givrycourt","context_page_description":"Givrycourt is a commune in the Moselle department in Grand Est in north-eastern France."},{"page_url":"https://cs.wikipedia.org/wiki/Pendon_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Pendon%27s_White_Horse_Hill.JPG","page_title":"Pendon Museum","context_page_description":"Pendon muzeum, které se nachází v Long Wittenhamu poblíž Didcotu v hrabství Oxfordshire v Anglii, je muzeem, jehož expozice se skládá z několika modelových kolejišť, z nichž za zvláštní pozornost stojí model krajiny představující části Údolí Bílého koně ve 20. a 30. letech 20. století. Scéna, která je ve výstavbě od padesátých let 20. století a obsahuje součásti z dřívější doby, byla inspirována velmi podrobným výzkumem architektury a krajiny údolí, přičemž některé modely chalup byly vytvářeny stovky hodin. Muzeum, které založil Roye England, je provozováno skupinou dobrovolníků a je otevřeno veřejnosti většinu víkendů a svátků, kromě zimy."},{"page_url":"https://ceb.wikipedia.org/wiki/Big_Sandy_Regional_Airport","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/20090121_0704_Big_Sandy_K22.JPG","page_title":"Big Sandy Regional Airport","context_page_description":"Tugpahanan ang Big Sandy Regional Airport sa Tinipong Bansa. Ang Big Sandy Regional Airport nahimutang sa kondado sa Martin County ug estado sa Kentucky, sa sidlakang bahin sa nasod, 500 km sa kasadpan sa ulohang dakbayan Washington, D.C. 356 metros ibabaw sa dagat kahaboga ang nahimutangan sa Big Sandy Regional Airport.\\nAng yuta palibot sa Big Sandy Regional Airport kay patag sa amihang-sidlakan, apan sa habagatang-kasadpan nga kini mao ang kabungtoran. Big Sandy Regional Airport nahimutang sa usa ka gitas-on. Ang kinahabogang dapit sa palibot dunay gihabogon nga 394 ka metro ug 1.4 km sa kasadpan sa Big Sandy Regional Airport. Dunay mga 15 ka tawo kada kilometro kwadrado sa palibot sa Big Sandy Regional Airport may gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Prestonsburg, 14.8 km sa habagatan-kasadpan sa Big Sandy Regional Airport. Hapit nalukop sa lasang nga tigkapulak ang palibot sa Big Sandy Regional Airport.\\nAng klima umogon ug subtropikal. Ang kasarangang giiniton 13 °C. Ang kinainitan nga bulan Agosto, sa 22 °C, ug ang kinabugnawan Enero, sa 0 °C. Ang kasarangang pag-ulan 1,660 milimetro matag tuig."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D0%BB%D0%BB_%D0%9A%D1%8D%D0%BB%D0%BB%D0%BE%D1%83%D1%8D%D0%B9,_%D0%92%D0%B0%D0%BD%D0%B5%D1%81%D1%81%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Vanessa_Bell_Calloway_10.jpg","page_title":"Белл Кэллоуэй, Ванесса","context_page_description":"Ванесса Белл Кэллоуэй — американская актриса."},{"page_url":"https://nl.wikipedia.org/wiki/Heathfield_and_Waldron","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/High_Street%2C_Heathfield%2C_East_Sussex.jpg","page_title":"Heathfield and Waldron","context_page_description":"Heathfield and Waldron is een civil parish in het bestuurlijke gebied Wealden, in het Engelse graafschap East Sussex met 11913 inwoners."},{"page_url":"https://sk.wikipedia.org/wiki/%C5%BDdiar","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Zdiar_0303.jpg","page_title":"Ždiar","context_page_description":"Ždiar je obec na Slovensku v okrese Poprad. Leží v údolí medzi Belianskymi Tatrami a Spišskou Magurou v Podtatranskej brázde. Rovnobežne s obcou prechádza Cesta slobody z Tatranskej Kotliny do Lysej Poľany. Obec je 3 km vzdialená od hraničného priechodu do Poľska a 34 km od Popradu.\\nPočet obyvateľov približne 1330. Väčšina hovorí aj po goralsky. Dĺžka obce 5 km. Obcou preteká potok Biely potok.\\nZachovaná ľudová architektúra v časti obce Antošovský vrch a Blaščatská dolina, originálne kroje charakteristické svojou ornamentálnosťou využívajú motívy rastlín a živočíchov z prostredia Belianskych Tatier a okolia obce Ždiar. Každoročne sa v obci konajú Goralské folklórne slávnosti, na ktorých slovenské aj poľské tanečné súbory prezentujú tance, piesne a zvyklosti Goralov."},{"page_url":"https://fr.wikipedia.org/wiki/Seigneurie_d%27Outre-Jourdain","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/14_Al-Karak.JPG","page_title":"Seigneurie d'Outre-Jourdain","context_page_description":"La seigneurie d'Outre-Jourdain aussi appelée seigneurie de Montréal, du nom de sa capitale, était au XIIᵉ siècle un fief du royaume de Jérusalem situé à l'est du Jourdain."},{"page_url":"https://la.wikipedia.org/wiki/Saint-Maurice-en-Valgodemard","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/Map_commune_FR_insee_code_05152.png","page_title":"Saint-Maurice-en-Valgodemard","context_page_description":"Saint-Maurice-en-Valgodemard est commune Francicum 137 incolarum praefecturae Alpium Superiorum in regione Provincia et Alpis."},{"page_url":"https://ga.wikipedia.org/wiki/Contae_Montgomery,_Carolina_Thuaidh","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Map_of_North_Carolina_highlighting_Montgomery_County.svg","page_title":"Contae Montgomery, Carolina Thuaidh","context_page_description":"Is contae Meiriceánach é Contae Montgomery atá suite i stát Carolina Thuaidh. Sa bhliain 2010, bhí daonra 27,798 duine ann. Is é Troy a phríomhbhaile contae."},{"page_url":"https://es.wikipedia.org/wiki/Dinast%C3%ADa_Kayar","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Persian_Qajar_Empire1808.jpg","page_title":"Dinastía Kayar","context_page_description":"La dinastía kayar es una familia real de Irán, de origen turco, que gobernó Persia desde 1785 hasta 1925. La familia Qajar tomó el control total de Irán en 1794, al deponer a Lutf Ali Khan Zand, el último Shah de la dinastía Zand. Reafirmaron la soberanía persa sobre los anteriores territorios iraníes de Georgia y el Cáucaso. En 1796 Aga Muhammad Kan fue coronado formalmente como sah.​ Fue sucedida por la Dinastía Pahlaví en 1925.\\nKayar es el término comúnmente usado para describir Irán bajo el gobierno de la familia real kayar, ​ que gobernó en Irán desde 1794 hasta 1925."},{"page_url":"https://en.wikipedia.org/wiki/Slum","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Slums_and_Skyscrapers_in_La_Paz.jpg","page_title":"Slum","context_page_description":"A slum is usually a highly populated urban residential area consisting mostly of closely packed, decrepit housing units in a situation of deteriorated or incomplete infrastructure, inhabited primarily by impoverished persons. Although slums, especially in America, are usually located in urban areas, in other countries they can be located in suburban areas where housing quality is low and living conditions are poor. While slums differ in size and other characteristics, most lack reliable sanitation services, supply of clean water, reliable electricity, law enforcement, and other basic services. Slum residences vary from shanty houses to professionally built dwellings which, because of poor-quality construction and/or lack of basic maintenance, have deteriorated.\\nDue to increasing urbanization of the general populace, slums became common in the 18th to late 20th centuries in the United States and Europe. Slums are still predominantly found in urban regions of developing countries, but are also still found in developed economies.\\nAccording to UN-Habitat, around 33% of the urban population in the developing world in 2012, or about 863 million people, lived in slums."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%87%91%E6%98%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Venus_Express_in_orbit.jpg","page_title":"金星","context_page_description":"金星は、太陽系で太陽に近い方から2番目の惑星。また、地球にもっとも近い公転軌道を持つ惑星である。\\n地球型惑星であり、太陽系内で大きさと平均密度がもっとも地球に似た惑星であるため、「地球の姉妹惑星」と表現されることがある。また、太陽系の惑星の中で最も真円に近い公転軌道を持っている。地球から見ると、金星は明け方と夕方にのみ観測でき、太陽、月に次いで明るく見える星であることから、明け方に見えるものを「明けの明星」、夕方に見えるものを「宵の明星」という。"},{"page_url":"https://pt.wikipedia.org/wiki/Bolsa_(Gotemburgo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Kommunalfullm%C3%A4ktiga_b%C3%B6rshuset_G%C3%B6teborg.JPG","page_title":"Bolsa (Gotemburgo)","context_page_description":"Bolsa é um edifício do século XIX em Gotemburgo, na Suécia, usado como local de representação e assembleia municipal. Está localizada no lado norte da praça Gustavo Adolfo, no centro histórico."},{"page_url":"https://de.wikipedia.org/wiki/Refik_Veseli","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Refik_Veseli.jpg","page_title":"Refik Veseli","context_page_description":"Refik Veseli war Fotograf und ein Gerechter unter den Völkern aus Albanien. Während der deutschen Besatzung Albaniens initiierte er die Aufnahme von zwei jüdischen Familien im Haus der Familie Veseli. Er ist der erste Albaner und einer der ersten Muslime, der von Yad Vashem als Gerechter unter den Völkern geehrt wurde."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%94%D0%B5%D0%BF%D0%B0%D1%80%D1%82%D0%B0%D0%BC%D0%B5%D0%BD%D1%82%D0%B8_%D0%9B%D0%B0%D0%BD%D0%B4","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/Labastide9.JPG","page_title":"Департаменти Ланд","context_page_description":"Департаменти Ланд — яке аз департаментҳои Фаронса аст."},{"page_url":"https://eu.wikipedia.org/wiki/%C5%A0ebrov-Kate%C5%99ina","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Sebrov-Katerina_CZ_CoA.jpg","page_title":"Šebrov-Kateřina","context_page_description":"Šebrov-Kateřina Txekiar Errepublikako udalerri bat da. 818 biztanle ditu eta 10,29 kilometro koadroko azalera. Blanskoko barrutian dago."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D0%B4%D0%BE%D0%BD%D0%BD%D0%B0_%D0%BC%D0%B8%D0%BB%D0%BE%D1%81%D0%B5%D1%80%D0%B4%D1%8F_(%D0%95%D0%BB%D1%8C_%D0%93%D1%80%D0%B5%D0%BA%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/El_Greco_-_The_Madonna_of_Charity_-_WGA10573.jpg","page_title":"Мадонна милосердя (Ель Греко)","context_page_description":"«Мадонна милосердя» — це картина олійною фарбою, намальована Ель Греко, починаючи з 1603 і 1605, зберігається в шпиталі де ла Карідад в Ільєскасі, Іспанії."},{"page_url":"https://de.wikipedia.org/wiki/Monarchfalter","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/BBGMonarchButterflyWings.jpg","page_title":"Monarchfalter","context_page_description":"Der Monarchfalter oder Amerikanische Monarch ist ein auffällig orange und schwarz gezeichneter Schmetterling aus der Familie der Edelfalter. Er ist in Amerika weit verbreitet und hat sich im 18. Jahrhundert über den Südpazifik bis nach Australien ausgebreitet. Der Monarchfalter ist der am besten erforschte Schmetterling Nordamerikas und ein berühmter Wanderfalter. Einzelne Tiere legen bei Wanderungen im Herbst in Nordamerika bis zu 3600 Kilometer zurück. Die östliche Population in Nordamerika überwintert mit mehreren 100 Millionen Tieren auf wenigen Hektar in der mexikanischen Sierra Nevada.\\nIn den Jahren ab etwa 2010 brachen die überwinternden Bestände drastisch ein, die in Anspruch genommene Fläche betrug ebenfalls nur noch einen Bruchteil; 2013/14 verzögerte sich die Ankunft der Falter in Mexiko zudem um drei Wochen.\\nEine deutlich kleinere westliche Population überwintert entlang der Pazifikküste in Kalifornien."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%B9%E5%B0%BC%E5%A3%AB%C2%B7%E6%96%AF%E9%87%91%E7%B4%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Dennis_Skinner_MP_Parliament.jpg","page_title":"丹尼士·斯金納","context_page_description":"丹尼士·愛德華·斯金納，英國政客，前任下議院議員，因為在國會的所作所為反叛，被人冠以「保素華怪獸」 之名。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_im_Stadtbezirk_Mengede","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Str%C3%BCnkede-26-Postamt.jpg","page_title":"Liste der Baudenkmale im Stadtbezirk Mengede","context_page_description":"Die Liste der Baudenkmale im Stadtbezirk Mengede enthält die denkmalgeschützten Bauwerke auf dem Gebiet des Stadtbezirks Dortmund-Mengede in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Dortmund eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen.\\nBaudenkmäler sind „Denkmäler, die aus baulichen Anlagen oder Teilen baulicher Anlagen bestehen “. Die Denkmalliste der Stadt Dortmund umfasst im Stadtbezirk Mengede 79 Baudenkmäler, darunter je 21 Wohnhäuser, Villen oder Wohnsiedlungen und landwirtschaftliche Gebäude, 16 Wohn- und Geschäftshäuser, je fünf öffentliche Gebäude und Kleindenkmäler, je drei Sakralbauten und Industrieanlagen, zwei Adelssitze sowie je einen Friedhof, ein Geschäftshaus und eine Verkehrsanlage.\\nWeiterhin sind Haus Mengede an der Waltroper Straße 2–10 und die Kapelle Haus Westhusen an der Schloß-Westhusener-Straße als Bodendenkmäler in Teil B sowie der Straßenbahntriebwagen Nr. 290 als bewegliches Denkmal in Teil C der Denkmalliste der Stadt Dortmund eingetragen."},{"page_url":"https://fr.wikipedia.org/wiki/Carlos_Ambrosius","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/DM_Rad_2017_EZF_039_Carlos_Ambrosius.jpg","page_title":"Carlos Ambrosius","context_page_description":"Carlos Ambrosius, né le 24 novembre 1998 à Kolkwitz, est un coureur cycliste allemand. Il participe à des compétitions sur route et sur piste."},{"page_url":"https://et.wikipedia.org/wiki/Merkur_Arena","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Merkur_Arena.jpg","page_title":"Merkur Arena","context_page_description":"Merkur Arena on jalgpallistaadion, mis asub Grazis Austrias."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A5%D9%8A%D8%AF%D8%A7_%D8%A8%D8%B1%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Ida_brun.jpg","page_title":"إيدا برون","context_page_description":"إيدا برون ‏ هي مغنية وراقصة باليه وفنانة صامتة وممثلة دنماركية، ولدت في 20 سبتمبر 1792، وتوفيت في 23 نوفمبر 1857."},{"page_url":"https://pl.wikipedia.org/wiki/Schillingstedt","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Schillingstedt_Kirche_2.JPG","page_title":"Schillingstedt","context_page_description":"Schillingstedt – dzielnica miasta Sömmerda w Niemczech, w kraju związkowym Turyngia, w powiecie Sömmerda. Do 5 lipca 2018 jako samodzielna gmina wchodziła w skład wspólnoty administracyjnej Kölleda."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BD%D1%81%D0%B0%D0%BC%D0%B1%D0%BB%D1%8C_%D0%90%D0%B1%D0%B4%D0%B8_%D0%91%D0%B8%D1%80%D1%83%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Antiquities_of_Samarkand._Mosque_of_Khodzha_Abdu-Berun._Tomb_%28sagana%29_of_the_Saint_WDL3744.png","page_title":"Ансамбль Абди Бирун","context_page_description":"Ансамбль Абди Бирун — комплекс сооружений первой половины XVII века мемориального и культового назначения в южном пригороде Самарканда. Построен в 1630-х годах визирем и дядей правителя Бухарского ханства Имамкули-хана Надиром диван-беги на мазаре XII века. Считается одним из крупнейших средневековых мемориалов на территории Средней Азии."},{"page_url":"https://en.wikipedia.org/wiki/Watford_and_Rickmansworth_Railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Ebury_Way.jpg","page_title":"Watford and Rickmansworth Railway","context_page_description":"The Watford and Rickmansworth Railway ran services between Watford and Rickmansworth in Hertfordshire, England. The company was incorporated in 1860; the line opened in 1862. The Rickmansworth branch was closed in 1952, and the remaining line was gradually run down and eventually closed in 1996."},{"page_url":"https://ceb.wikipedia.org/wiki/Bembidion_castum","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Bembidion_castum.jpg","page_title":"Bembidion castum","context_page_description":"Espesye sa bakukang ang Bembidion castum. Una ning gihulagway ni Xasey. Ang Bembidion castum sakop sa kahenera nga Bembidion sa kabanay nga Carabidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturdenkm%C3%A4ler_im_Landkreis_Bad_Kissingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Dorflinde_in_Waizenbach%2C_1.jpg","page_title":"Liste der Naturdenkmäler im Landkreis Bad Kissingen","context_page_description":"Die Liste der Naturdenkmäler im Landkreis Bad Kissingen enthält alle Bäume und Baumgruppen im Landkreis Bad Kissingen, die als Naturdenkmäler durch Rechtsverordnung geschützt sind. Sie werden bei der Unteren Naturschutzbehörde des Landratsamts Bad Kissingen geführt. Naturdenkmäler sind nach Artikel 9 des Bayerischen Naturschutzgesetzes Einzelschöpfungen der Natur, deren Erhaltung wegen ihrer hervorragenden Schönheit, Seltenheit oder Eigenart oder ihrer ökologischen, wissenschaftlichen, geschichtlichen, volks- oder heimatkundlichen Bedeutung im öffentlichen Interesse liegt. Ein großer Teil der 80 geschützten Baumobjekte des Landkreises zeichnet sich durch ein für die Baumart hohes Alter und einen starken Stammumfang aus."},{"page_url":"https://lt.wikipedia.org/wiki/Egiptologija","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Carl_Richard_Lepsius_%281810-1884%29.jpg","page_title":"Egiptologija","context_page_description":"Egiptologija − studijų kryptis, tirianti Senovės Egipto istoriją, kultūrinį palikimą."},{"page_url":"https://no.wikipedia.org/wiki/Malegaon","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/PowerLooms.JPG","page_title":"Malegaon","context_page_description":"Malegaon er en by og et kommunestyre i distriktet Nashik i den indiske delstaten Maharashtra. Malegaon er administrativt hovedkvarter for en tehsil med samme navn som byen. Byen ligger omtrent 280 km nordøst for storbyen Mumbai og ca. 100 km nordøst for Nashik. Malegaon ligger ved samløpet mellom elvene Girna og Mosam, i en gjennomsnittlig høyde på 438 moh.. Malegaon er en av de største byene i det nordvestre Maharashtra. Det er den nest største byen i Nashik-distriktet etter Nashik. Byen ligger på National Highway 3 som forbinder Mumbai til Agra.\\nByen er handelssentrum og har mye tekstilindustri. Ettersom flertallet av byens befolkning hører til hinduistiske og muslimske samfunn, har størsteparten av byens utdanningsinstitusjoner vært i stand til å undervise på flere ulike språk. Til tross for alt dette har Malegaon sett en forringelse av infrastruktur og livskvalitet med årene. Mens befolkningen har vokst fra 121 000 i 1961 til anslagsvis 1 000 000 innbyggere nå, er veiene, avløpssystemene, sykehusene og telekommunikasjonen fortsatt ikke utviklet fullt ut."},{"page_url":"https://it.wikipedia.org/wiki/Rio_San_Marino","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Carta_Rio_San_Marino_.png","page_title":"Rio San Marino","context_page_description":"Il rio San Marino noto anche come torrente San Marino è un breve corso d'acqua a carattere torrentizio che scorre in Italia e nella Repubblica di San Marino."},{"page_url":"https://hr.wikipedia.org/wiki/Sjeverni_kri%C5%BEarski_ratovi","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/2010_09_04_7Tervete37.JPG","page_title":"Sjeverni križarski ratovi","context_page_description":"Sjeverni križarski ratovi ili baltički križarski ratovi bili su križarski ratovi poduzimane od strane kršćanskih vladara iz Danske i Švedske, njemačkog livonskog i teutonskog viteškog reda, i njihovih saveznika protiv poganskih naroda sjeverne Europe oko južnih i istočnih obala Baltičkog mora. Švedski i njemački katolički pohodi protiv ruskih pravoslavaca se također ponekad smatraju dijelom sjevernih križarskih ratova. Neke od tih ratova su se zvali križarskim ratovima tijekom srednjeg vijeka, ali drugi, uključujući i većinu onih švedskih, bili su prvi put nazvani križarskim ratovima od strane romantičnih nacionalističkih povjesničara iz 19. stoljeća. Svijet istočnog Baltika je transformiran vojnim osvajanjima: najprije Livi i Latgalijanci i Estonci, a zatim Semigalijanci, Kuronci, Prusi i Finci su doživjeli poraz, pokrštavanje, vojnu okupaciju, a ponekad i istrebljenja od strane Danaca, Nijemaca i Šveđana."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Hamburg-Hohenfelde","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Stolperstein_G%C3%BCntherstra%C3%9Fe_44_%28Jenny_Reich%29_in_Hamburg-Hohenfelde.JPG","page_title":"Liste der Stolpersteine in Hamburg-Hohenfelde","context_page_description":"Die Liste der Stolpersteine in Hamburg-Hohenfelde enthält alle Stolpersteine, die im Rahmen des gleichnamigen Kunst-Projekts von Gunter Demnig in Hamburg-Hohenfelde verlegt wurden. Mit ihnen soll Opfern des Nationalsozialismus gedacht werden, die in Hamburg-Hohenfelde lebten und wirkten.\\nDiese Seite ist Teil der Liste der Stolpersteine in Hamburg, da diese mit insgesamt 5836 Steinen zu groß würde und deshalb je Stadtteil, in dem Steine verlegt wurden, eine eigene Seite angelegt wurde."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D9%86%DA%AF%E2%80%8C%D9%85%DB%8C%D9%86_%DA%AF%D9%88%D8%B1%DB%8C%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/King_Kongmin_of_Koryo.jpg","page_title":"گنگ‌مین گوریو","context_page_description":"پادشاه گنگ‌مین سی و یکمین پادشاه گوریو بود که در سال ۱۳۵۱ پس از پادشاه چونگ جونگ به حکومت رسید و تا سال ۱۳۷۴ حکومت کرد. او پسر پادشاه چونگ سوک و ملکه گونگ وون بود."},{"page_url":"https://br.wikipedia.org/wiki/Kastell_La_Hunaudaye","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/Ch%C3%A2teau_de_la_Hunaudaye_SW.jpg","page_title":"Kastell La Hunaudaye","context_page_description":"Kastell La Hunaudaye a chom dismantroù anezhañ e kumun Pledeliav e reter departamant Aodoù-an-Arvor. Gallout a reer gweladenniñ anezho an hanter eus ar bloavezh, etre miz Ebrel ha miz Du.\\nUr c'hastell pempkornek eo, gant 5 tour, unan e pep korn, ha mogerioù uhel etrezo. N’eus tour-meur ebet; douvezioù leun a zour zo en-dro d’ar c’hastell. Ur chapel a oa en estaj uhelañ tour ar gevred. Distrujet e oa bet an toennoù da vare an Dispac'h gall ha n’int ket bet adsavet abaoe, daoust ma’z eus bet labourioù adkempenn."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%91%D7%A8%D7%94%D7%9D_%D7%97%D7%9E%D7%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/ISRAEL_BASKETBALL_TEAM._R-L_1ST._ROW%2C_A._HEMO.jpg","page_title":"אברהם חמו","context_page_description":"אברהם חמו הוא כדורסלן עבר ישראלי, מאמן כדורסל וקצין משטרה שעסק בתחום מניעת צריכת אלכוהול וסמים בקרב צעירים ואף פרסם ספרים בתחום זה, לאחר שחרורו מהמשטרה הקים את מכון חינוך מפעיל ומונע ובמסגרתו מהווה יו\\"ר משותף של עמותת עתיד בטוח."},{"page_url":"https://en.wikipedia.org/wiki/Asociaci%C3%B3n_Deportiva_Atenas","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Atenas_roster_1987.jpg","page_title":"Asociación Deportiva Atenas","context_page_description":"Asociación Deportiva Atenas, known simply as Atenas or Atenas de Córdoba, is a sports club based in Córdoba, Argentina. It was founded in 1938, and is mostly known for its achievements in basketball. The club is the winningest team of Argentina holding 20 titles. Club's home arena is Polideportivo Carlos Cerutti, while some high attendance games are held at the Orfeo Superdomo.\\nApart from basketball, other sports practised at Atenas are gymnastics, roller skating, swimming and volleyball."},{"page_url":"https://es.wikipedia.org/wiki/Phylloscopus_schwarzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Radde%27s_Warbler_%28Phylloscopus_schwarzi%29.jpg","page_title":"Phylloscopus schwarzi","context_page_description":"El mosquitero de Schwarz ​ es una especie de ave paseriforme de la familia Phylloscopidae que vive en Asia. Su nombre conmemora al astrónomo alemán Ludwig Schwarz."},{"page_url":"https://de.wikipedia.org/wiki/Bahnhof_Wittenberge","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/BfWittenbergeWerkHalle.jpg","page_title":"Bahnhof Wittenberge","context_page_description":"Der Bahnhof Wittenberge der brandenburgischen Stadt Wittenberge liegt fast genau in der Mitte der Bahnstrecke Berlin–Hamburg und hat als Eisenbahnknoten überregionale Bedeutung.\\nTäglich nutzen etwa 5000 Fahrgäste den von rund 100 Reisezügen bedienten Bahnhof. Der Bahnhof war lange Zeit derjenige mit den meisten Fernverkehrs-Fahrgästen in Brandenburg."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9C%A3%E7%81%B5%E5%A0%82_(%E6%B5%B7%E5%BE%B7%E5%A0%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Heidelberg_Heiliggeistkirche.jpg","page_title":"圣灵堂 (海德堡)","context_page_description":"圣灵堂是德国海德堡最有名的教堂，位于海德堡老城中心，距离海德堡城堡不远。教堂的尖顶主宰该市的天际线。\\n该堂的建设历时150年。唱诗班席完成于1411年，钟楼完成于1544年。在14世纪，圣灵堂代替圣彼得堂的堂区，后者成为海德堡大学的大学教堂。\\n在历史上，该堂曾被天主教和新教轮流或同时使用。1706年开始，堂内安装分隔，这样不受干扰各自举行自己的礼拜。1936年，分隔被拆除，该堂完全归属新教的巴登福音教会。"},{"page_url":"https://en.wikipedia.org/wiki/Arthur_C._Clarke","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Prins_Claus_en_Arthur_C_Clarke_%281982%29.jpg","page_title":"Arthur C. Clarke","context_page_description":"Sir Arthur Charles Clarke CBE FRAS was an English science-fiction writer, science writer, and futurist, inventor, undersea explorer, and television series host.\\nHe co-wrote the screenplay for the 1968 film 2001: A Space Odyssey, one of the most influential films of all time. Clarke was a science writer, an avid populariser of space travel, and a futurist of a distinguished ability. He wrote more than a dozen books and many essays for popular magazines. In 1961, he received the Kalinga Prize, a UNESCO award for popularising science. Clarke's science and science-fiction writings earned him the moniker \\"Prophet of the Space Age\\". His science-fiction writings in particular earned him a number of Hugo and Nebula awards, which along with a large readership, made him one of the towering figures of the genre. For many years Clarke, Robert Heinlein, and Isaac Asimov were known as the \\"Big Three\\" of science fiction.\\nClarke was a lifelong proponent of space travel. In 1934, while still a teenager, he joined the British Interplanetary Society. In 1945, he proposed a satellite communication system using geostationary orbits."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%90%B4%E4%BC%BC%E7%A5%9E%E7%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Hotoku_Shrine_at_Kotoni_Shrine.JPG","page_title":"琴似神社","context_page_description":"琴似神社は、北海道札幌市西区琴似1条7丁目1-30にある神社。旧社格は郷社。江戸時代後期から明治時代初期に流行した藩祖を祀った神社のひとつ。"},{"page_url":"https://fr.wikipedia.org/wiki/Beedenbostel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Ortsblick_in_Beedenbostel_IMG_2045.jpg","page_title":"Beedenbostel","context_page_description":"Beedenbostel est une commune de l'arrondissement de Celle."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%9B%87%E9%B9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Snake_bird_nesting.jpg","page_title":"蛇鹈","context_page_description":"蛇鵜或蛇鳥是一種熱帶水鳥，它屬於蛇鵜科中唯一的蛇鵜屬。該屬有四個現存的種，其中有三種很常見且分布廣泛，而第四種較為罕見，並被國際自然保護聯盟歸為近危物種。使用「蛇鳥」一詞時，通常沒有任何修飾，涵蓋了異域物種形成的出現在任何地區的任何物種。這個名字來源於它們細長的脖子。當它們把身體潛在水下游泳時，或者在炫耀結合期配對的蛇鳥扭動脖子時，它們的脖子擁有蛇一樣的外觀。而「蛇鵜」則會加上一個地理學詞彙，用來指特定的種類。它們捕食的方式是，用其薄而尖的喙刺穿魚。在美國南部，有時也稱它們為「水火雞」，但實際上蛇鵜與野生火雞完全無關，儘管它們有許多共同點，比如，它們都是大型的、黑色的鳥兒，都有長尾巴，並且有時作為食物被捕獵。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D1%83%D1%80%D0%B0%D0%B4%D0%BE,_%D0%A5%D0%BE%D1%81%D0%B5_%D0%9C%D0%B0%D0%BD%D1%83%D1%8D%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Watford_v_Norwich_%285%29.jpg","page_title":"Хурадо, Хосе Мануэль","context_page_description":"Хосе́ Мануэ́ль Хура́до Мари́н — испанский футболист, полузащитник клуба «Кадис». Самый результативный испанец в истории чемпионатов России по футболу."},{"page_url":"https://pl.wikipedia.org/wiki/Dragon_Ball","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Dragon_Ball_anime_logo.png","page_title":"Dragon Ball","context_page_description":"Dragon Ball – manga stworzona przez Akirę Toriyamę. Jej pierwsze rozdziały są luźno oparte na motywach zaczerpniętych z szesnastowiecznej powieści chińskiej Wędrówka na Zachód.\\nRozdziały mangi ukazywały się w latach 1984–1995 na łamach japońskiego tygodnika Shūkan Shōnen Jump wydawnictwa Shūeisha, a następnie zostały wydane w formie 42 tomów tankōbon. W Polsce została wydana nakładem wydawnictwa Japonica Polonica Fantastica.\\nNa podstawie mangi studio Toei Animation wyprodukowało anime, które składa się z czterech serii – Dragon Ball i Dragon Ball Z opartych na mandze, a także Dragon Ball GT i Dragon Ball Super, prezentujących nowe przygody bohaterów. W latach 2009–2011 i 2014–2015 emitowana była odświeżona wersja serii Z pod tytułem Dragon Ball Kai.\\nSeria zdobyła na świecie wielką popularność. Autorzy obecnie popularnych mang przyznają, że czerpali z niej inspirację do własnej twórczości."},{"page_url":"https://de.wikipedia.org/wiki/Friedl%C3%A4nder_M%C3%BChlenteich","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Friedl%C3%A4nder_M%C3%BChlenteich_Nordost.JPG","page_title":"Friedländer Mühlenteich","context_page_description":"Der Friedländer Mühlenteich liegt im Stadtgebiet von Friedland im Landkreis Mecklenburgische Seenplatte etwas südwestlich der Stadt im Niederungsbereich des Datzetales. Er befindet sich im Ausläuferbereich der Friedländer Großen Wiese. Die Einspeisung in den Teich erfolgt über den Walkmühlengraben, einen Zufluss der Datze, die nördlich am Teich vorbeiführt. Durch die künstliche Anlage des Teiches schwankt die Größe je nach Wasserstand. Der trockenfallende Teil bleibt sumpfig. Den Teich gab es nachweislich schon im Mittelalter. Er diente namentlich dem Betrieb der Amtsdamm-Mühle und dem Schutz der Stadt in Richtung Süden. Die Mühle wurde im Friedländer Urbanium von 1406 erwähnt."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%B4%9D%E5%A1%9E%E5%B0%94%E9%99%A8%E7%9F%B3%E5%9D%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Bessel_crater_Apollo_15.jpg","page_title":"贝塞尔陨石坑","context_page_description":"贝塞尔陨石坑是月球正面位于澄海中部的一座小撞击坑，约形成于32-11亿年前的爱拉托逊纪，1834年德国天文学家约翰·海因里希·冯·马德勒曾对它进行过描述。该陨石坑的名称取自十九世纪德国数学家暨天文学家，坚信月球上没有大气层和生命的\\"弗里德里希·威廉·贝塞尔\\"，1935年被国际天文学联合会批准接受。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B9_%D0%A8%D0%B0%D1%83%D1%88%D0%BF%D0%B8%D0%BB%D1%8C%D1%85%D0%B0%D1%83%D1%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/BE_und_Alter_Friedrichstadtpalast_1964.jpg","page_title":"Большой Шаушпильхаус","context_page_description":"Большой Шаушпильхаус — ныне несуществующий известный театр в центральном берлинском районе Митте, где ставились ревю, оперетты и другие музыкальные представления. По заказу возникшего в 1917 году объединения немецких национальных театров в 1918—1919 годы здание строилось на улице Шифбауэрдамм. Театр дважды менял своё название до сноса здания в 1985 году."}]`),L={name:"App",components:{PoemCard:M},data(){return{searchQuery:"",visibleCount:4,poemsData:P,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},T={class:"search-container"},I={class:"card-container"},G={key:0,class:"empty-state"},F=["disabled"],R={key:0},H={key:1}